INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(1, 'MediEvil', '9th October, 1998', 'MediEvil is an action-adventure hack and slash video game developed by SCE Cambridge Studio and published by Sony Computer Entertainment for the PlayStation. The game is set in the medieval Kingdom of Gallowmere and centres around the charlatan protagonist, Sir Daniel Fortesque, as he makes an attempt to stop antagonist Zarok\'s invasion of the kingdom whilst simultaneously redeeming himself.', 'M', 0, 0, NULL, NULL),
(1, '<b>Anything / Collections</b>', '3th December 1994', 'A section for discussing about any/all games released for the Sony PlayStation.', '.', 1, 0, NULL, NULL),
(1, 'Doom', '16th November, 1995', 'Doom is a 1993 first-person shooter (FPS) video game by id Software. It is considered one of the most significant and influential titles in video game history, for having helped to pioneer the now-ubiquitous first-person shooter.\r\nThe Sony PlayStation version of Doom was a conversion of The Ultimate Doom and Doom II by Williams Entertainment. It was released on November 16, 1995 and ran with a modified version of the Doom engine used in the Atari Jaguar port.', 'D', 2, 0, NULL, NULL),
(3, 'BIOS', '3rd December, 1994', 'The Sony PlayStation BIOS screen.', 'B', 3, 0, NULL, NULL),
(6, 'BIOS', '4th March, 2000', 'The Sony PlayStation 2 BIOS screen.', 'B', 4, 0, NULL, NULL),
(9, 'Doom', '16th November, 1995', 'Doom is a 1993 first-person shooter (FPS) video game by id Software. It is considered one of the most significant and influential titles in video game history, for having helped to pioneer the now-ubiquitous first-person shooter.', 'D', 5, 0, NULL, NULL),
(10, 'MS-DOS 6.22', 'April 1994', '\r\nMS-DOS (acronym for Microsoft Disk Operating System) is an operating system for x86-based personal computers mostly developed by Microsoft. Collectively, MS-DOS, its rebranding as IBM PC DOS, and some operating systems attempting to be compatible with MS-DOS, are sometimes referred to as \"DOS\" (which is also the generic acronym for disk operating system). MS-DOS was the main operating system for IBM PC compatible personal computers during the 1980s and the early 1990s, when it was gradually superseded by operating systems offering a graphical user interface (GUI), in various generations of the graphical Microsoft Windows operating system.', 'M', 6, 0, NULL, NULL),
(2, 'It Might be NES', '17th December, 2002', 'It Might be NES (imbNES) is a Nintendo Entertainment System (NES) emulator for the Sony PlayStation.\r\nIt allows NES games to be played on a Sony PlayStation console.', 'I', 7, 0, NULL, NULL),
(4, '<b>Anything / Collections</b>', '4th March, 2000', 'A section for discussing about any/all games released for the Sony PlayStation 2.', '.', 8, 0, NULL, NULL),
(5, 'Free MCBoot', 'February, 2008', 'Free McBoot is a free homebrew exploit for memory cards allowing for unofficial games and homebrew to run on a Sony PlayStation 2.', 'F', 9, 0, NULL, NULL),
(8, 'Windows 95', '24th August, 1995', 'Windows 95 (codenamed Chicago) is a consumer-oriented operating system developed by Microsoft as part of its Windows 9x family of operating systems. The first operating system in the 9x family, it is the successor to Windows 3.1x, and was released to manufacturing on August 15, 1995, and generally to retail on August 24, 1995.', 'W', 10, 0, NULL, NULL),
(7, 'Full Tilt! Pinball', '31st October, 1995', 'Full Tilt! Pinball is a pinball video game developed by Cinematronics and published by Maxis in 1995. It features pre-rendered 3D graphics and three tables â€” Space Cadet, Skulduggery, and Dragon\'s Keep. On each table, there are displays on the side that show the players\' score, ball number, player number, a display for various information and a table-specific image.', 'F', 11, 0, NULL, NULL),
(7, 'Resident Evil', '6th December, 1996', 'Resident Evil, known in Japan as Bio Hazard, is a survival horror video game developed and released by Capcom originally for the PlayStation in 1996, and is the first game in the Resident Evil series. It is Capcom\'s best-selling debut game, with sales of over 8.63 million copies worldwide. The game\'s plot follows Chris Redfield and Jill Valentine, members of an elite task force known as S.T.A.R.S., as they investigate the outskirts of Raccoon City following the disappearance of their team members. They soon become trapped in a mansion infested with zombies and other monsters. The player, having selected to play as Chris or Jill at the start of the game, must explore the mansion to uncover its secrets.', 'R', 12, 0, NULL, NULL),
(2, 'Superman (Unreleased)', '2000?', 'After the critical failure of the N64 version, Titus gave BlueSky Software the reins to completely redesign Superman for the PlayStation. The game received approval from Sony, but the license from Warner Bros. had expired and Titus was unable to secure a new one, resulting in the game\'s cancellation in 2000.', 'S', 13, 0, NULL, NULL),
(4, 'Grand Theft Auto III', '22nd October, 2001', 'Grand Theft Auto III is an action-adventure video game developed by DMA Design and published by Rockstar Games. It was released in October 2001 for the PlayStation 2, in May 2002 for Microsoft Windows, and in October 2003 for the Xbox. A remastered version of the game was released on mobile platforms in 2011, for the game\'s tenth anniversary. It is the fifth title in the Grand Theft Auto series, and the first main entry since 1999\'s Grand Theft Auto 2. Set within the fictional Liberty City, based on New York City, the game follows Claude after he is left for dead and quickly becomes entangled in a world of gangs, crime and corruption.', 'G', 14, 0, NULL, NULL),
(4, 'Grand Theft Auto: Vice City', '27th October, 2002', 'Grand Theft Auto: Vice City is an action-adventure video game developed by Rockstar North and published by Rockstar Games. It was released on 29 October 2002 for the PlayStation 2, on 12 May 2003 for Microsoft Windows, and on 31 October 2003 for the Xbox. A remastered version was released for mobile platforms in 2012, for the game\'s tenth anniversary. It is the sixth title in the Grand Theft Auto series and the first main entry since 2001\'s Grand Theft Auto III. Set within the fictional Vice City, based on Miami, the game follows Tommy Vercetti following his release from prison. After he is caught up in an ambushed drug deal, he seeks out those responsible while building a criminal empire and seizing power from other criminal organisations in the city.', 'G', 15, 0, NULL, NULL),
(4, 'Grand Theft Auto: San Andreas', '26th October, 2004', 'Grand Theft Auto: San Andreas is an action-adventure video game developed by Rockstar North and published by Rockstar Games. It was released on 26 October 2004 for PlayStation 2, and on 7 June 2005 for Microsoft Windows and Xbox. A high definition remastered version received a physical release for both Xbox 360 and PlayStation 3 on 30 June 2015 and 1 December 2015, respectively. It is the seventh title in the Grand Theft Auto series, and the first main entry since 2002\'s Grand Theft Auto: Vice City. It was released on the same day as the handheld game Grand Theft Auto Advance for Game Boy Advance. On 8 June 2018, the game was added to the Xbox One Backward Compatible library.', 'G', 16, 0, NULL, NULL),
(1, 'Final Doom', '1st October, 1996', 'Final Doom is a first-person shooter video game released in 1996. The game contains the same weapons, items, and monsters from Doom II: Hell on Earth, and was released as an officially licensed product from id Software and distributed by GT Interactive Software.\r\nThe Sony PlayStation version of Final Doom was a conversion of Final Doom and Doom II: The Master Levels by Williams Entertainment. It was released on October 1st, 1996 and ran with a modified version of the Doom engine used in the Atari Jaguar port.\r\n', 'F', 17, 0, NULL, NULL),
(1, 'Spyro The Dragon', '2nd November, 1999', 'Spyro the Dragon is a platform game developed by Insomniac Games and published by Sony Computer Entertainment. The game was released for the PlayStation on September 9, 1998. The first game in the Spyro series, it stars the title character, a young purple dragon named Spyro, and his dragonfly friend, Sparx, who venture through the dragon kingdom to rescue the other dragons from a spell placed by Gnasty Gnorc. The game is an open-ended 3D platformer, with large, sprawling levels which require the use of Spyro\'s dragon abilities- most prominently, his mid-air gliding technique, which can be utilized to glide across large distances. Several collectible items, among which are multicolored gemstones, stolen dragon eggs, and encapsulated dragons, are located throughout stages, and must be collected in order to progress through the game.', 'S', 18, 0, NULL, NULL),
(1, 'Final Fantasy VII', '31st January, 1997', 'Final Fantasy VII is a 1997 role-playing video game developed by Square for the PlayStation console. It is the seventh main installment in the Final Fantasy series. Published in Japan by Square, it was released in other regions by Sony Computer Entertainment, and became the first in the main series to see a PAL release. The game\'s story follows Cloud Strife, a mercenary who joins an eco-terrorist organization to stop a world-controlling megacorporation from using the planet\'s life essence as an energy source. Events send Cloud and his allies in pursuit of Sephiroth, a superhuman intent on destroying their planet. During the journey, Cloud builds close friendships with his party members, including Aerith Gainsborough, who holds the secret to saving their world.', 'F', 19, 0, NULL, NULL),
(1, 'Crash Bandicoot', '9th September, 1996', 'Crash Bandicoot is a franchise of platform video games. The series was created by Andy Gavin and Jason Rubin during their tenure at Naughty Dog for Universal Interactive Studios and Sony Computer Entertainment; the series was originally exclusive to the PlayStation family of video game consoles. The series has appeared on multiple platforms and gone through various developers and spans numerous genres. The series comprises eighteen games and shipped over 50 million copies worldwide.', 'C', 20, 0, NULL, NULL),
(1, 'Medal of Honor', '31st October, 1999', 'Medal of Honor is a 1999 first-person shooter video game, developed by DreamWorks Interactive and published by Electronic Arts for PlayStation. It is the first installment in the Medal of Honor video game series. The story was created by film director and producer Steven Spielberg.\r\nThe player takes the role of the fictional Lieutenant Jimmy Patterson, a former C-47 Skytrain pilot in the Air Transport Command who was later recruited to the OSS. The game takes place near the end of World War II, (mid 1944-mid 1945). The goal of the game is to complete objectives, such as destroying enemy positions, and kill enemy Nazi forces in the process.', 'M', 21, 0, NULL, NULL),
(1, 'Crash Team Racing', '30th September, 1999', 'Crash Team Racing (stylized as CTR: Crash Team Racing) is a kart racing video game developed by Naughty Dog and published by Sony Computer Entertainment for the PlayStation.\r\nCrash Team Racing is the fourth installment in the Crash Bandicoot series. The game\'s story focuses on the efforts of a ragtag team of characters in the Crash Bandicoot series, who must race against the egomaniacal Nitros Oxide to save their planet from destruction. In the game, players can take control of one of fifteen Crash Bandicoot series characters, though only eight are available at first. During the races, offensive and speed boosting power ups can be used to gain an advantage.', 'C', 22, 0, NULL, NULL),
(1, 'Crash Bandicoot 2: Cortex Strikes Back', '31st October, 1997', 'Crash Bandicoot 2: Cortex Strikes Back is a platform video game developed by Naughty Dog and published by Sony Computer Entertainment for the PlayStation. It is the second game in the Crash Bandicoot series, and the sequel to the original game.', 'C', 23, 0, NULL, NULL),
(4, 'Okami', '20th April, 2006', 'Ōkami (Japanese: 大神, lit. \"great god\" or \"great spirit\") is an action-adventure video game developed by Clover Studio and published by Capcom. It was released for Sony Computer Entertainment\'s PlayStation 2 video game console in 2006 in Japan and North America, and in 2007 in Europe and Australia. Despite the closure of Clover Studio a few months after the game\'s initial release, a version for Nintendo\'s Wii console was developed and produced by Ready at Dawn, Tose and Capcom, which was released in North America in April 2008, in Europe in June 2008, and in Japan in October 2009.', 'O', 24, 0, NULL, NULL),
(4, 'Destroy All Humans!', '21st June, 2005', 'Destroy All Humans! is an open world action-adventure video game franchise that is designed as a parody of Cold War-era alien invasion films. Destroy All Humans! is available for the PlayStation 2, Xbox, and Xbox One game consoles.', 'D', 25, 0, NULL, NULL),
(1, 'Quake II', '5th October, 1999', 'Quake II is a first-person shooter video game released in December 1997. It was developed by id Software and published by Activision. It is not a direct sequel to Quake; id decided to revert to an existing trademark when the game\'s fast-paced, tactile feel felt closer to a Quake game than a new franchise.\r\nPorts of Quake II were released in 1999 on the Nintendo 64 (ported by Raster Productions) and PlayStation (ported by Hammerhead) video game consoles.', 'Q', 26, 0, NULL, NULL),
(1, 'Resident Evil / Biohazard', '22nd March, 1996', 'Resident Evil, known in Japan as Bio Hazard, is a survival horror video game developed and released by Capcom for the PlayStation in 1996, and is the first game in the Resident Evil series. It is Capcom\'s best-selling debut game, with sales of over 8.63 million copies worldwide. The game\'s plot follows Chris Redfield and Jill Valentine, members of an elite task force known as S.T.A.R.S., as they investigate the outskirts of Raccoon City following the disappearance of their team members. They soon become trapped in a mansion infested with zombies and other monsters. The player, having selected to play as Chris or Jill at the start of the game, must explore the mansion to uncover its secrets.', 'R', 27, 0, NULL, NULL),
(1, 'Bugs Bunny: Lost in Time', '31st May, 1999', 'Bugs Bunny: Lost in Time is a Looney Tunes platform video game released for the PlayStation and Microsoft Windows in 1999. An indirect sequel, Bugs Bunny & Taz: Time Busters, was released for the same platforms in 2000.', 'B', 28, 0, NULL, NULL),
(1, 'Gex 3: Deep Cover Gecko', '1st March, 1999', 'Gex 3: Deep Cover Gecko is a platform video game. It is the third and final instalment of the Gex video game trilogy. Danny John-Jules provided the voice for Gex in the UK and European release and comedian Dana Gould reprised the role for the American release, also starring the Playboy model Marliece Andrada as Agent Xtra, the only character that is featured in live-action. Unlike the first two Gex games, passwords are not used for saving. A memory card on the PlayStation are the only options for saving.', 'G', 29, 0, NULL, NULL),
(1, 'Spyro 2: Ripto\'s Rage! / Spyro 2: Gateway to Glimmer', '2nd November, 1999', 'Spyro 2: Ripto\'s Rage!, known in Europe and Australia as Spyro 2: Gateway to Glimmer, is a 1999 platform game developed by Insomniac Games and published by Sony Computer Entertainment for the PlayStation. It is the second game in the main Spyro series following Spyro the Dragon, and like its predecessor, received critical acclaim.', 'S', 30, 0, NULL, NULL),
(1, 'Kula World / Roll Away', '10th July, 1998', 'Kula World (Roll Away in North America) is a 3D platform puzzle video game developed by Game Design Sweden AB for the Sony PlayStation, which places the player in control of a Kula beach ball. The main objective of the game is to collect keys which unlock the level exits, as well as coins and jewels along the way. The game makes use of alternative physics, changing the direction of gravity as the ball moves.', 'K', 31, 0, NULL, NULL),
(4, 'Driv3r', '21st June, 2004', 'Driver 3 is a 2004 open world action-adventure video game. It is the third installment in the Driver series and was developed by Reflections Interactive and published by Atari, Inc.. Driver 3 was released in North America for the PlayStation 2 and Xbox on 21 June 2004.', 'D', 32, 0, NULL, NULL),
(1, 'Ape Escape', '31st May, 1999', 'Ape Escape is a platform video game, developed by SCE Japan Studio and published by Sony Computer Entertainment. It was released for the PlayStation in May 1999 in North America, and June 1999 in Japan. The first in the Ape Escape series, the game tells the story of an ape named Specter who gains enhanced intelligence and a malevolent streak through the use of an experimental helmet. Specter produces an army of apes, which he sends through time in an attempt to rewrite history. Spike, the player character, sets out to capture the apes with the aid of special gadgets.', 'A', 33, 0, NULL, NULL),
(1, 'V-Rally 2: Championship Edition / Need for Speed: V-Rally 2', '28th October, 1999', 'V-Rally 2 is a rally racing video game and the sequel to V-Rally. It was succeeded by V-Rally 3.\r\nThe game features rally cars that competed in the 1999 World Rally Championship season. There are 26 cars in Championship Edition and 27 in Expert Edition. There are over 80 original tracks which represent all of the rallies of the 1999 season, excluding Greece and Safari. The game modes include a time trial mode, an arcade mode which follows the traditional style of arcade games, V-Rally Trophy where the player completes against 3 AI opponents to see who can get the least time in all of the rallies. The championship mode follows the actual example of rallying with different stages in the rallies featured in the game. V-Rally Trophy and Championship Mode feature 3 distinct championships: European, World and Expert.', 'V', 34, 0, NULL, NULL),
(1, 'Tom and Jerry in House Trap', '24th November, 2000', 'Tom and Jerry in House Trap is an action video game released in 2000 for the PlayStation. The game was developed by Warthog Games and was published by NewKidCo in North America. In Europe, the game was published by Ubisoft and NewKidCo. Success published a Japanese version of the game in 2002.\r\n\r\nThe game is an example of the trap-em-up genre, which also includes games like Heiankyo Alien, Space Panic, and Lode Runner. The gameplay is largely similar to the classic multi-platform Spy vs. Spy video game, adopting the split-screen aesthetics.', 'T', 35, 0, NULL, NULL),
(1, 'Castlevania: Symphony of the Night', '20th March, 1997', 'Castlevania: Symphony of the Night is a platform-adventure action role-playing game developed and published by Konami in 1997 for the PlayStation. It was directed and produced by Toru Hagihara, with Koji Igarashi acting as assistant director. It is the direct sequel to Castlevania: Rondo of Blood taking place four years later. It features Dracula\'s dhampir son Alucard as the protagonist rising from his slumber to explore the Dracula\'s castle which has re-appeared after Richter Belmont has vanished. It marks a break from previous games in the series, introducing exploration, non-linear level design and role-playing elements.', 'C', 36, 0, NULL, NULL),
(1, 'Resident Evil 2 / Biohazard 2', '21st January, 1998', 'Resident Evil 2, known in Japan as Biohazard 2, is a survival horror game developed and published by Capcom and released for the PlayStation in 1998. The player controls Leon S Kennedy and Claire Redfield, who must escape Raccoon City after its citizens are transformed into zombies by a biological weapon two months after the events of the original Resident Evil. The gameplay focuses on exploration, puzzles, and combat; the main difference from its predecessor are the branching paths, with each player character having unique storylines and obstacles.', 'R', 37, 0, NULL, NULL),
(4, 'Spider-Man 2', '28th June, 2004', 'Spider-Man 2 is a 2004 action-adventure video game based loosely on the Spider-Man 2 film. They are follow-ups of the game Spider-Man: The Movie, and the series is followed by Spider-Man 3. Published by Activision, each of these console games have different developers, with Treyarch being the most common game.', 'S', 38, 0, NULL, NULL),
(9, 'Doom II: Hell on Earth', 'September 30th, 1994', 'Doom II: Hell on Earth is a first-person shooter video game, the second title of id Software\'s Doom franchise. It was originally released for MS-DOS computers in 1994 and Macintosh computers in 1995. Unlike Doom, which was initially only available through shareware and mail order, Doom II was a commercial release sold in stores. Master Levels for Doom II, an expansion pack that includes 21 new levels, was released on December 26, 1995 by id Software.', 'D', 39, 0, NULL, NULL),
(4, 'Digimon Rumble Arena 2', '29th July, 2004', 'Digimon Rumble Arena 2, known as Digimon Battle Chronicle (デジモンバトルクロニクル Dejimon Batoru Kuronikuru) in Japan, is a 2004 Digimon fighting video game released by Bandai for the PlayStation 2, GameCube, and the Xbox. It is the sequel to Digimon Rumble Arena and has a similar style of gameplay as Super Smash Bros. Melee, except with a health meter.', 'D', 40, 0, NULL, NULL),
(7, 'Serious Sam: The First Encounter', '21st March, 2001 ', 'The First Encounter was the first game in the series; it had been in the making since 1996 and had a video showing its early game play in 2000. The First Encounter was originally developed by Croteam as a demonstrator for their engine and this is the reason why some countries saw its initial release priced at less than half the price of other games in the genre. ', 'S', 41, 0, NULL, NULL),
(1, 'Spyro: Year of the Dragon', '24th October, 2000', 'Spyro: Year of the Dragon is a platformer video game developed by Insomniac Games and published by Sony Computer Entertainment for the PlayStation in 2000. Year of the Dragon is the third installment in the Spyro series. The game was the last Spyro game Insomniac developed; their next title would be Ratchet & Clank for the PlayStation 2. It was released in North America and for PAL regions in October and November 2000, respectively, but unlike the other two games, it was not given a Japanese release.\r\n\r\nNamed after the animal of the Chinese zodiac, which was the symbol at the time of the game\'s release, Year of the Dragon follows the titular purple dragon Spyro as he travels to the \"Forgotten Worlds\" after 150 magical dragon eggs are stolen from the land of the dragons by an evil sorceress. Players travel across thirty different worlds gathering gems and eggs. Year of the Dragon introduced new characters and minigames to the series, as well as offering improved graphics and music.', 'S', 42, 0, NULL, NULL),
(1, 'MediEvil 2', '19th April, 2000', 'MediEvil 2, stylised as MediEvil II in North America, is an action-adventure hack and slash video game developed by SCE Cambridge Studio and published by Sony Computer Entertainment for the PlayStation. It is the second instalment of the MediEvil series and a sequel to MediEvil. It was first released on 19 April 2000 in Europe and 30 April 2000 in North America. Taking place 500 years after the events of the first game, it follows series\' protagonist Sir Daniel Fortesque\'s revival in Victorian era London as he attempts to stop sorcerer Lord Palethorn and Jack the Ripper\'s plans to terrorise the city by raising the dead.', 'M', 43, 0, NULL, NULL),
(4, 'Silent Hill 3', '23rd May, 2003', 'Silent Hill 3 is a survival horror video game published by Konami for the PlayStation 2 and developed by Team Silent, a production group within Konami Computer Entertainment Tokyo. It is the third installment in the Silent Hill series and a sequel to the first Silent Hill game.', 'S', 44, 0, NULL, NULL),
(4, 'Mortal Kombat: Deception', '4th October, 2004', 'Mortal Kombat: Deception is a fighting video game developed and published my Midway in the sixth installment of the Mortal Kombat franchise of video games. The Dragon King, Onaga, has acquired artifacts known as the Kamidogu, that have the power of destroying all the realms in the Mortal Komabt universe. In order to save the realms from Onaga, you must fight against the realms most powerful warriors in Mortal Kombat, to be able to challenge Onaga and save the realms from total destruction.', 'M', 45, 0, NULL, NULL),
(7, 'Postal', '14th November, 1997', 'Postal is an isometric top-down shooter video game developed by Running With Scissors and published by Ripcord Games in 1997.', 'P', 46, 0, NULL, NULL),
(7, 'Super Mario 64 - Reimagined Tech Demo', '16th December, 2018', 'Super Mario 64 Reimagined is a FAN MADE production, an experiment and study in to achieving the highest quality standard that \"Nimso Ny\" could possibly achieve as a one person team.', 'S', 47, 0, NULL, NULL),
(7, 'Kerbal Space Program', '24th June, 2011', 'Kerbal Space Program is a space flight simulation video game developed and published by Squad for Microsoft Windows, OS X, Linux, PlayStation 4, and Xbox One. In the game, players direct a nascent space program, staffed and crewed by green humanoid aliens known as \"Kerbals\". The game features a realistic orbital physics engine, allowing for various real-life orbital maneuvers such as Hohmann transfer orbits and bi-elliptic transfer orbits.', 'K', 48, 0, NULL, NULL),
(8, 'Windows XP', '24th August, 2001', 'Windows XP is a personal computer operating system produced by Microsoft as part of the Windows NT family of operating systems. It was released to manufacturing on August 24, 2001, and broadly released for retail sale on October 25, 2001.', 'W', 49, 0, NULL, NULL),
(7, 'Manhunt', '20th April, 2004', 'Manhunt is a stealth-based survival horror video game developed by Rockstar North and published by Rockstar Games. It was originally released for the PlayStation 2 on November 18, 2003, and for Microsoft Windows and Xbox on April 20, 2004.\r\nManhunt is a stealth-based psychological horror game played from a third-person perspective. The game consists of twenty levels, called \"scenes\", as well as four unlockable bonus scenes. Players survive the scenes by dispatching enemy gang members, occasionally with firearms, but primarily by stealthily executing them.', 'M', 50, 0, NULL, NULL),
(11, '<b>Anything / Collections</b>', '15th July, 1983', 'A section for discussing about any/all games released for the Nintendo Entertainment System.', '.', 51, 0, NULL, NULL),
(12, 'Plants vs. Zombies', '2012', 'Plants vs. Zombies is an unofficial port of Plants vs. Zombies, made in 2012. It was likely developed by Nice Code.\r\nIt utilizes the same engine as the Angry Birds bootleg, and a lot of its music was recycled from said game. This port obviously has fewer plants and zombies than the original, but is considerably more faithful than the Angry Birds port. Plants vs. Zombies has five levels based on the first five of the official release.', 'P', 52, 0, NULL, NULL),
(13, '<b>Anything / Collections</b>', '21st November, 1990', 'A section for discussing about any/all games released for the Super Nintendo Entertainment System.', '.', 53, 0, NULL, NULL),
(14, 'Super 3D Noah\'s Ark', '1994', 'Super 3D Noah\'s Ark is a Christian-themed video game for MS-DOS and unofficially on the Super Nintendo Entertainment System. It was developed by the biblical video game producer Wisdom Tree and released in 1994. It was the only commercially released SNES game in the U.S. that was not officially sanctioned by Nintendo. Despite its name, it is unrelated to Konami\'s official Noah\'s Ark for the Nintendo Entertainment System.\r\nThe game plays similarly to Wolfenstein 3D, but the graphics were changed to reflect a non-violent christian theme.', 'S', 54, 0, NULL, NULL),
(15, 'Super Mario 64', '23rd June, 1996', 'Super Mario 64 is a platform video game developed and published by Nintendo for the Nintendo 64. It is the first Super Mario game to use three-dimensional (3D) graphics. Along with Pilotwings 64, it was one of the launch games for the console. It was released in Japan on June 23, 1996, and later in North America, Europe, and Australia. It is the best-selling game on the Nintendo 64, with more than eleven million copies sold.', 'S', 55, 0, NULL, NULL),
(16, '64Doom', '2014?', '64Doom (not to be confused with Doom 64) is an unofficial homebrew port of the original Doom by Id Software for the Nintendo 64 by jnmartin84.\r\nhttps://github.com/jnmartin84/64doom\r\nhttps://github.com/jnmartin84/64doom/wiki/How-to-build-your-own-64Doom-ROM', '#', 56, 0, NULL, NULL),
(17, 'Resident Evil 4', '11th January, 2005', 'Resident Evil 4, known in Japan as Biohazard 4, is a survival horror game developed and published by Capcom. The sixth major installment in the Resident Evil series, it was originally released for the GameCube in 2005.', 'R', 57, 0, NULL, NULL),
(18, 'Game Boy Interface', 'March, 2015', 'The Game Boy Interface (GBi) is homebrew software that’s a replacement for the GameCube / Game Boy Player boot disc.  It’s written by Extrems, who’s also part of the Swiss team. Original hardware is still required (GameCube and Game Boy Player), it is considered to be a vast improvement over the original software, as it supports 240p, low-lag as well as many other options. ', 'G', 58, 0, NULL, NULL),
(19, 'BIOS', '14th September, 2001', 'The Nintendo GameCube BIOS screen.\r\n', 'B', 59, 0, NULL, NULL),
(20, 'Sonic The Hedgehog', '25th October, 1991', 'Sonic the Hedgehog is a 1991 side-scrolling platform game and companion to the 16-bit Sega Genesis game of the same name for the 8-bit Game Gear and Master System consoles. Ancient—a studio founded by composer Yuzo Koshiro for the project—developed the game and Sega published it to promote the handheld Game Gear. The 8-bit Sonic is similar in style to its Genesis predecessor, but reduced in complexity to fit the 8-bit systems.', 'S', 60, 0, NULL, NULL),
(21, 'Super Boy II', '1989', 'Super Boy II (슈퍼보이 II) is an unlicensed Sega Master System game developed by Zemina and released exclusively in South Korea in 1989. It is the direct sequel to Super Boy I and like its prequel, was ported from an MSX version of the game. Despite only working in a Sega Master System, it uses the same graphical mode used to run SG-1000 games, so could be considered an SG-1000 game in disguise.\r\n\r\nLike Super Boy I, Super Boy II is a Super Mario Bros. clone, however offers a brand new set of levels not seen in any official Mario game. Due to its MSX roots the graphics are simpler, scrolling is choppy and several gameplay aspects are missing (such as the ability to kick koopa shells).', 'S', 61, 0, NULL, NULL),
(22, 'Sonic the Hedgehog', 'June 23rd, 1991', 'Sonic the Hedgehog, also referred to as Sonic 1, is a platform game developed by Sonic Team and published by Sega for the Sega Genesis console. The game was first released in North America in June 1991, and in PAL regions and Japan the following month. The game features an anthropomorphic hedgehog named Sonic in a quest to defeat Doctor Robotnik, a scientist who has imprisoned animals in robots and stolen the magical Chaos Emeralds. Sonic the Hedgehog\'s gameplay involves collecting rings as a form of health and a simple control scheme, with jumping and attacking controlled by a single button.', 'S', 62, 0, NULL, NULL),
(24, 'Sonic CD', '23rd September, 1993', 'Sonic the Hedgehog CD, commonly called Sonic CD, is a 1993 platform game for the Sega CD. The story follows Sonic the Hedgehog as he attempts to save an extraterrestrial body, Little Planet, from Doctor Robotnik. As a Sonic the Hedgehog series platformer, Sonic runs and jumps through several themed levels while collecting rings and defeating robots. Sonic CD is distinguished from other Sonic games by its time travel feature, a key aspect to the story and gameplay. By traveling through time, players can access different versions of stages featuring alternate layouts, music, and graphics based on the time period.', 'S', 63, 0, NULL, NULL),
(25, 'Knuckles\' Chaotix', 'April, 1995', 'Knuckles\' Chaotix is a 1995 platform game by Sega for the 32X. A spinoff to the Sonic the Hedgehog series, it features Knuckles the Echidna and four other characters known as the Chaotix, who must prevent Doctor Robotnik and Metal Sonic from obtaining six magic rings and conquering a mysterious island. Gameplay is similar to previous Sonic games: players complete levels while collecting rings and defeating enemies. Knuckles\' Chaotix introduces a partner system whereby the player is connected to another character via a tether; the tether behaves like a rubber band and must be used to maneuver the characters.', 'K', 64, 0, NULL, NULL),
(23, 'Action 52', '1993', 'Action 52 features a largely different lineup of games, some with more effort put into design and fewer technical issues than the NES version. Each game is color-coded on the main menu screen; \"Beginner\" games are green, \"Intermediate\" games are purple, \"Expert\" games are yellow, \"Challenge\" games are white, and multiplayer games are blue. \r\nSeveral new games were introduced in the Genesis version, a number of which share their names with games from the NES cartridge, but are different in terms of content.', 'A', 65, 0, NULL, NULL),
(15, '<b>Anything / Collections</b>', '23rd June, 1996', 'A section for discussing about any/all games released for the Nintendo 64.', '.', 66, 0, NULL, NULL),
(17, '<b>Anything / Collections</b>', '14th September, 2001', 'A section for discussing about any/all games released for the Nintendo GameCube.', '.', 67, 0, NULL, NULL),
(20, '<b>Anything / Collections</b>', '20th October, 1985', 'A section for discussing about any/all games released for the Sega Master System / Mark III.', '.', 68, 0, NULL, NULL),
(22, '<b>Anything / Collections</b>', '29th October, 1988', 'A section for discussing about any/all games released for the Sega Genesis / Mega Drive.', '.', 69, 0, NULL, NULL),
(26, '<b>Anything / Collections</b>', '22nd November, 1994', 'A section for discussing about any/all games released for the Sega Saturn.', '.', 70, 0, NULL, NULL),
(27, '<b>Anything / Collections</b>', '27th November, 1998', 'A section for discussing about any/all games released for the Sega Dreamcast.', '.', 71, 0, NULL, NULL),
(29, 'BIOS', '27th November, 1998', 'The Sega Dreamcast BIOS screen.', 'B', 72, 0, NULL, NULL),
(28, 'Bleemcast!', '1st May, 2001', 'Bleemcast! is an independently developed commercial emulator by Bleem! that allows one to load and play PlayStation discs on the Sega Dreamcast. It is compatible with most Dreamcast controllers and steering wheels, and leverages the Dreamcast\'s superior processing power for enhanced graphics. It was created by using the MIL-CD security hole found in the Dreamcast BIOS.', 'B', 73, 0, NULL, NULL),
(30, 'Halo: Combat Evolved', '15th November, 2001', 'Halo: Combat Evolved is a 2001 military science fiction first-person shooter video game developed by Bungie and published by Microsoft Game Studios. The first game of the Halo franchise, it was released as a launch title for the Xbox gaming system on November 15, 2001. More than five million copies were sold worldwide by November 2005.', 'H', 74, 0, NULL, NULL),
(32, 'BIOS', '15th November, 2001', 'The Xbox BIOS/Dashboard screen.', 'B', 75, 0, NULL, NULL),
(4, 'The Dog Island', '26th April, 2007', 'The Dog Island is a 2008 adventure video game for the Wii and PlayStation 2 consoles in which players control a dog and must go on a journey to search for a special flower to aid their sick sibling, which can only be found by achieving their goal to become a \"sniff master\". The player interacts with various other animals in the game that give hints and information to aid on the quest. The video game is based on The Dog and Friends franchise.', 'T', 76, 0, NULL, NULL),
(31, 'FCEUltraX', '2007', 'FCEUltraX v17 is an NES Emulator for the Original Xbox.', 'F', 77, 0, NULL, NULL),
(33, 'Tetris', '14th June, 1989', 'Tetris is a puzzle video game for the Game Boy released in 1989. It is a portable version of Alexey Pajitnov\'s original Tetris and it was bundled in the North American and European releases of the Game Boy itself.', 'T', 78, 0, NULL, NULL),
(34, 'BIOS', '21st April, 1989', 'The Nintendo Game Boy BIOS screen.\r\n', 'B', 79, 0, NULL, NULL),
(36, 'BIOS', '21st October, 1998', 'The Nintendo Game Boy Color BIOS screen.\r\n', 'B', 80, 0, NULL, NULL),
(39, 'BIOS', '21st March, 2001', 'The Nintendo Game Boy Advance BIOS screen.\r\n', 'B', 81, 0, NULL, NULL),
(35, 'Super Mario Bros. Deluxe', '1st May, 1999', 'Super Mario Bros. Deluxe is a platform video game released on the Game Boy Color in 1999 as an enhanced port of the 1985 NES game Super Mario Bros., also including its 1986 Disk System sequel, Super Mario Bros.: The Lost Levels, as a hidden reward. It was released fourteen years after the original Super Mario Bros.', 'S', 82, 0, NULL, NULL),
(38, 'PocketNES', '2005?', 'PocketNES is a freeware (100% free) NES emulator for the Game Boy Advance and, at the same time, the most capable one on this handheld. It was originally developed for hobbyists to use with their own ROM collections and rewritable flash cartridges, but a few game publishers ended up releasing multicarts of their old NES games for GBA, as did pirates. They didn\'t need to ask permission because the PocketNES developers had released the emulator to the public domain. Pirates would often change the name of the program from PocketNES to VisualNES.', 'P', 83, 0, NULL, NULL),
(37, 'F-Zero: Maximum Velocity', '21st March, 2001', 'F-Zero Maximum Velocity is a futuristic racing video game developed by NDcube and published by Nintendo for the Game Boy Advance. The game was released in Japan, North America and Europe in 2001. It is the first F-Zero game to be released on a handheld game console.\r\n\r\nMaximum Velocity takes place twenty-five years after F-Zero, in yet another F-Zero Grand Prix. The past generations of F-Zero had \"piloted their way to fame\", so it is the only F-Zero game without Captain Falcon, Samurai Goroh, Pico, or Dr. Stewart. Players control fast hovering crafts and use their speed-boosting abilities to navigate through the courses as quickly as possible.', 'F', 84, 0, NULL, NULL),
(42, 'BIOS', '21st November, 2004', 'The Nintendo DS BIOS screen.', 'B', 85, 0, NULL, NULL),
(45, 'BIOS', '12th December, 2004', 'The Sony PlayStation Portable BIOS/VSH screen.', 'B', 86, 0, NULL, NULL),
(45, 'Custom Firmware', 'May, 2005', 'Custom Firmware for the Sony PlayStation Portable.', 'C', 87, 0, NULL, NULL),
(40, 'Super Mario 64 DS', '21st November, 2004', 'Super Mario 64 DS is a 2004 platform game developed and published by Nintendo for the Nintendo DS. It was a launch title for the DS and the system\'s first Mario game. Super Mario 64 DS is a remake of the 1996 Nintendo 64 game Super Mario 64; in addition to revised graphics, the game includes new characters, thirty additional star collectibles, a multiplayer mode, and several minigames independent of the main adventure.', 'S', 88, 0, NULL, NULL),
(41, 'nesterDS', '2006?', 'nesterDS is a DS port of of the NES emulator \"Nester\".', 'N', 89, 0, NULL, NULL),
(43, 'Grand Theft Auto: Liberty City Stories', '24th October, 2005', 'Grand Theft Auto: Liberty City Stories is an action-adventure video game developed in a collaboration between Rockstar Leeds and Rockstar North, and published by Rockstar Games. It was released on 24 October 2005, for PlayStation Portable, it is the ninth game in the Grand Theft Auto series and was preceded by Grand Theft Auto: San Andreas and succeeded by Grand Theft Auto: Vice City Stories. It is a prequel to Grand Theft Auto III.', 'G', 90, 0, NULL, NULL),
(44, 'NesterJ', '2005?', 'NesterJ is a pretty functional NES emulator for the Sony PSP. It was developed by Japanese developer Ruka but then eventually forked into several different sub projects.', 'N', 91, 0, NULL, NULL),
(40, '<b>Anything / Collections</b>', '21st November, 2004', 'A section for discussing about any/all games released for the Nintendo DS.', '.', 92, 0, NULL, NULL),
(35, '<b>Anything / Collections</b>', '21st October, 1998', 'A section for discussing about any/all games released for the Game Boy Color.', '.', 93, 0, NULL, NULL),
(33, '<b>Anything / Collections</b>', '21st April, 1989', 'A section for discussing about any/all games released for the Game Boy.', '.', 94, 0, NULL, NULL),
(37, '<b>Anything / Collections</b>', '21st March, 2001', 'A section for discussing about any/all games released for the Game Boy Advance.', '.', 95, 0, NULL, NULL),
(43, '<b>Anything / Collections</b>', '12th December, 2004', 'A section for discussing about any/all games released for the PlayStation Portable.', '.', 96, 0, NULL, NULL),
(15, 'Doom 64', '31st March, 1997', 'Doom 64 is a first-person shooter video game for the Nintendo 64 that was developed and published by Midway Games on March 31, 1997. It is a sequel to the Doom series, taking place after Final Doom.', 'D', 97, 0, NULL, NULL),
(7, 'Bugdom', '27th October, 2000', 'Bugdom is a 1999 platform video game originally created by Pangea Software for Mac OS 9. It was included with the iMac DV 2000 and later iBook models. The Microsoft Windows version, released in 2000, was developed by Hoplite Research and published by On Deck Interactive, a division of Gathering of Developers. Bugdom was generally well received by critics, being praised for its graphics, gameplay and soundtrack but criticized for certain technical glitches as well as gameplay repetition, and sold fairly well.', 'B', 98, 0, NULL, NULL),
(7, 'Half-Life', '19th November, 1998', 'Half-Life is a first-person shooter video game developed by Valve and published by Sierra Studios for Microsoft Windows in 1998. It was Valve\'s debut product and the first in the Half-Life series. Players assume the role of Dr. Gordon Freeman, who must fight his way out of the Black Mesa research facility after an experiment goes wrong, fighting enemies and solving puzzles.', 'H', 99, 0, NULL, NULL),
(7, 'Grand Theft Auto IV', '2nd December, 2008', 'Grand Theft Auto IV is an action-adventure video game developed by Rockstar North and published by Rockstar Games. It was released for the PlayStation 3 and Xbox 360 consoles on 29 April 2008, and for Microsoft Windows on 2 December 2008. It is the eleventh title in the Grand Theft Auto series, and the first main entry since 2004\'s Grand Theft Auto: San Andreas.', 'G', 100, 0, NULL, NULL),
(7, 'Postal 2', '13th April, 2003', 'Postal 2 is a black comedy first-person shooter video game by Running With Scissors, and it is the sequel to the 1997 game Postal. Both are intentionally highly controversial due to high levels of violence and stereotyping. Unlike its predecessor, Postal 2 is played completely in first-person based on the Unreal Engine 2.', 'P', 101, 0, NULL, NULL),
(30, 'Half-Life 2', '16th November, 2004', 'Half-Life 2 continues the story of Gordon Freeman, the scientist-turned-marine who managed to escape from the Black Mesa Research Facility in Half-Life. In Half-Life 2, Gordon has accepted the G-Man\'s \"offer\" and become a government agent on Earth. However, the Xen aliens, Combine soldiers, headcrabs, \"ant lions,\" and other enemies threaten everything.', 'H', 102, 0, NULL, NULL),
(1, 'Resident Evil 3: Nemesis / Biohazard 3: Last Escape', '22nd September, 1999', 'Resident Evil 3: Nemesis is a survival horror game developed by Capcom and released for the PlayStation in 1999. It is the third installment in the Resident Evil series and takes place around the events of Resident Evil 2. The story follows Jill Valentine and her efforts to escape from a city infected with a biological weapon. Choices through the game affect the story and ending. The game uses the same engine as its predecessors and features 3D models over pre-rendered backgrounds with fixed camera angles.', 'R', 103, 0, NULL, NULL),
(4, 'Sonic Heroes', '30th December, 2003', 'Sonic Heroes is a 2003 3D platform game in Sega\'s Sonic the Hedgehog series. The player races a team of series characters through levels to amass rings, defeat robots, and collect the seven Chaos Emeralds needed to defeat Doctor Eggman. Within each level, the player switches between the team\'s three characters, who each have unique abilities, to overcome obstacles. Sonic Heroes abandons the action-adventure and exploration-based gameplay of its predecessors Sonic Adventure (1998) and Sonic Adventure 2 (2001) and instead returns to the linear style of Sega Genesis-era Sonic games.', 'S', 104, 0, NULL, NULL),
(7, 'Clock Tower: The First Fear', '28th March, 1997', 'Clock Tower is a survival horror point-and-click adventure game developed and published by Human Entertainment for the Super Famicom in 1995. It is the first installment in the Clock Tower series. The story follows orphan Jennifer Simpson soon after she is adopted by the Barrows family along with other orphaned girls. With the introduction of Scissorman, the game\'s antagonist, one of the other children is killed. Jennifer must then explore the Barrows Mansion to find a way to escape while evading Scissorman, leading to one of the game\'s multiple endings. Clock Tower utilizes a point and click interface with the player controlling a cursor to direct Jennifer\'s actions. An updated version, titled Clock Tower: The First Fear was ported to the PlayStation, WonderSwan, and Windows a few years later.', 'C', 105, 0, NULL, NULL),
(1, 'Disney\'s 102 Dalmatians: Puppies to the Rescue', '8th November, 2000', 'Disney\'s 102 Dalmatians: Puppies to the Rescue is a platform video game developed by Toys for Bob and published by Eidos Interactive for Microsoft Windows, PlayStation, Dreamcast and Game Boy Color. It is loosely based on the live-action Disney movie 102 Dalmatians.', 'D', 106, 0, NULL, NULL),
(1, 'Disney\'s Hercules Action Game', '20th June, 1997', 'Disney\'s Hercules, also known in Europe as Disney\'s Action Game Featuring Hercules, is an action video game for the PlayStation and Microsoft Windows, released on June 20, 1997 by Disney Interactive, based on the animated film of the same name. It was released a week prior to the film\'s release.', 'D', 107, 0, NULL, NULL),
(11, 'Mega Man / Rockman', '17th December, 1987', 'Mega Man, known as Rockman (ロックマン Rokkuman) in Japan, is a 1987 action-platform video game developed and published by Capcom for the Nintendo Entertainment System (NES). It was directed by Akira Kitamura, with Nobuyuki Matsushima as lead programmer, and is the first game of the Mega Man franchise and the original video game series. Mega Man was produced by a small team specifically for the home console market, a first for Capcom, who previously focused on arcade titles.', 'M', 108, 0, 3.85, 'https://images.igdb.com/igdb/image/upload/t_cover_big/co1hqf.jpg'),
(11, 'Mega Man 2 / Rockman 2', '24th December, 1988', 'Mega Man 2 is an action game developed and published by Capcom for the Nintendo Entertainment System. It was released in Japan in 1988 and in North America and PAL regions the following years. Mega Man 2 continues Mega Man\'s battle against the evil Dr. Wily and his rogue robots. The game features graphical and gameplay changes from the first Mega Man game, many of which have remained throughout the series.\r\n\r\nAlthough sales for the original Mega Man were unimpressive, Capcom allowed the team to create a sequel. They worked concurrently on other Capcom projects, using their free time to develop the game, using unused content from the first game. Takashi Tateishi composed the soundtrack, with Yoshihiro Sakaguchi serving as a sound programmer.', 'M', 109, 0, 4.45, 'https://images.igdb.com/igdb/image/upload/t_cover_big/mgkjnpq0gowuvxqwyza9.jpg'),
(11, 'Dr. Jekyll and Mr. Hyde', '8th April, 1988', 'Dr. Jekyll and Mr. Hyde is a 1988 side-scrolling action video game for the Nintendo Entertainment System loosely based on the novella Strange Case of Dr Jekyll and Mr Hyde. Gameplay alternates between the characters of Dr. Jekyll and Mr. Hyde based on the player\'s ability to either avoid or cause damage.', 'D', 110, 0, 0.95, 'https://images.igdb.com/igdb/image/upload/t_cover_big/h106korxjazfxupsb7ut.jpg'),
(37, 'Crash Bandicoot: The Huge Adventure', '25th February, 2002', 'Crash Bandicoot: The Huge Adventure (released as Crash Bandicoot XS in Europe) is a platform game developed by Vicarious Visions and published by Universal Interactive (a subsidiary of Vivendi Universal Interactive Publishing) for the Game Boy Advance. It was released in North America on February 25, 2002 and in Europe on March 15, 2002.\r\n\r\nThe Huge Adventure is the seventh installment in the Crash Bandicoot video game series and the first Crash Bandicoot game to be released on a handheld console.The game acts as an alternate sequel to the first four mainline games, and its story centers on a plot to shrink the Earth by the main antagonist, Doctor Neo Cortex, through the use of a gigantic weapon named the \"Planetary Minimizer\". The protagonist of the story, Crash Bandicoot, must gather Crystals in order to power a device that will return the Earth to its proper size, defeating Doctor Cortex and his minions along the way. ', 'C', 111, 0, NULL, NULL);
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(1, 'Medal of Honor: Underground', '23rd October, 2000', 'Medal of Honor: Underground is a first-person shooter video game, the second installment in the Medal of Honor video game series, and a prequel to 1999\'s Medal of Honor. It was initially released for the PlayStation video game console on October 23, 2000. It was developed by DreamWorks Interactive and was published by Electronic Arts.\r\n\r\nThe gameplay is much like its predecessor requiring the player to complete objectives by acquiring items, interacting with objects and destroying specified targets as well as the use of four different weapons and disguise against enemies. As well as new types of weapons, the new mechanics in the game are fighting against tanks and halftracks in three out of eight missions and fighting alongside friendly allies.', 'M', 112, 0, NULL, NULL),
(1, 'Spider-Man', '30th August, 2000', 'Spider-Man is an action-adventure video game based on the Marvel Comics comic book series The Amazing Spider-Man, which features the fictional superhero Spider-Man. Although it features the likenesses and same voice actors, it is not based on the animated television shows from the 1990s. It was developed by Neversoft and published by Activision using the Tony Hawk\'s Pro Skater game engine for the PlayStation in 2000.', 'S', 113, 0, NULL, NULL),
(1, 'Spider-Man 2: Enter Electro', '19th October, 2001', 'Spider-Man 2: Enter Electro is an action-adventure video game developed by Vicarious Visions and published by Activision for the PlayStation in 2001. It is the sequel to Neversoft\'s Spider-Man title, which was released the previous year. The game follows Spider-Man as he attempts to stop another old nemesis Electro from obtaining a source of power known as the Bio-Nexus Device. Game bosses include Shocker, Hammerhead, Lizard, Sandman and the charged-up Hyper-Electro.\r\n\r\nThe game is known for having its final level drastically changed after the September 11 attacks. Originally, the final battle between Spider-Man and Electro was set to take place during a severe thunderstorm atop the World Trade Center. A set piece of the level saw Electro destroying a portion of the North Tower. After the September 11 attacks, the level was changed to feature a battle atop a generic building.', 'S', 114, 0, NULL, NULL),
(13, 'Super Metroid', '19th March 1994', 'Super Metroid is an action-adventure game developed and published by Nintendo for the Super Nintendo Entertainment System in 1994. It is the third installment in the Metroid series, following the events of the Game Boy game Metroid II: Return of Samus (1991). Players control bounty hunter Samus Aran, who travels to planet Zebes to retrieve an infant Metroid creature stolen by the Space Pirate leader Ridley.', 'S', 115, 0, NULL, NULL),
(13, 'Star Fox / Starwing', '21st February, 1993', 'Star Fox, released as Starwing in Europe, is a 1993 rail shooter video game co-developed by Nintendo EAD and Argonaut Software and published by Nintendo for the Super Nintendo Entertainment System (SNES). The first game in the Star Fox series, Star Fox follows Fox McCloud and the rest of the Star Fox team defending their homeworld of Corneria against the attacking forces of Andross. It ultimately sold over 4 million copies.\r\n\r\nStar Fox was Nintendo\'s second 3D game after the release of X for the Game Boy in 1992. However, it was Nintendo\'s first game to use polygonal graphics. It accomplished this by being the first ever game to use the Super FX graphics acceleration coprocessor powered GSU-1. The complex display of three-dimensional models with polygons was still new and uncommon in console video games, and the game was praised as a result.', 'S', 116, 0, NULL, NULL),
(13, 'Earthbound', '27th August, 1994', 'EarthBound (known as Mother 2 in Japan) is a 1994 Japanese role-playing video game co-developed by Ape Inc. and HAL Laboratory and published by Nintendo for the Super Nintendo Entertainment System. As Ness and his party of four, the player travels the world to collect eight melodies in order to defeat the evil alien force Giygas. It is the second game of the Mother series and the first and only to be released outside of Japan for two decades. EarthBound was released in Japan in August 1994, and in North America the next June.', 'E', 117, 0, NULL, NULL),
(13, 'The Legend of Zelda: A Link to The Past', 'November 21st, 1991', 'The Legend of Zelda: A Link to the Past is an action-adventure video game developed and published by Nintendo for the Super Nintendo Entertainment System video game console. It is the third installment in The Legend of Zelda series and was released in 1991 in Japan and 1992 in North America and Europe.\r\nPlay as Link in his quest to save Hyrule from the evil Ganon, and save Princess Zelda!', 'T', 118, 0, NULL, NULL),
(13, 'Super Mario Kart', 'August 27th, 1992', 'Super Mario Kart is a 1992 kart racing video game developed and published by Nintendo for the Super Nintendo Entertainment System video game console. The first game of the Mario Kart series, it was released in Japan and North America in 1992, and in Europe the following year. Selling 8.76 million copies worldwide, the game went on to become the fourth best selling SNES game of all time. Super Mario Kart was re-released on the Wii\'s Virtual Console in 2009, and on the Wii U\'s Virtual Console in 2013. Nintendo re-released Super Mario Kart in the United States in September 2017 as part of the company\'s Super NES Classic Edition.', 'S', 119, 0, NULL, NULL),
(37, 'Metroid Fusion', '18th November, 2002', 'Metroid Fusion is an action-adventure game video game published by Nintendo for the Game Boy Advance handheld game console in 2002. The fourth installment in the Metroid series, it was developed by Nintendo Research & Development, which previously developed the 1994 game Super Metroid. Players control bounty hunter Samus Aran, who investigates a space station swarming with organisms infected with virions known as X parasites.', 'M', 120, 0, NULL, NULL),
(37, 'Advance Wars', '10th September, 2001', 'Advance Wars is a turn-based tactics video game developed for the Game Boy Advance by Intelligent Systems and published by Nintendo. It was released in North America on September 10, 2001 with a later release date on Japan and Europe, but the game release was put on hold in both Japan and Europe region due to the following day\'s September 11 attacks in the United States. The story involves Orange Star Army\'s efforts in battling the other countries\' armies, where Orange Star commanding officer Andy is accused of attacking the other countries\' troops for no reason. The game was released to critical acclaim, and has been listed among the greatest video games of all time.', 'A', 121, 0, NULL, NULL),
(40, 'Asphalt Urban GT', '15th November, 2004', 'Asphalt Urban GT is a racing video game for the Nintendo DS and the Nokia N-Gage handheld video game consoles. It was developed by Gameloft and published by Ubisoft, and released on November 21, 2004, making it one of the DS launch titles. The game sports nine tracks modelled after real-world locations such as Paris and New York City. The game\'s 23 cars are licensed from real manufacturers such as Lamborghini, Hummer, Volkswagen, and others, and can be enhanced with over 30 addons.', 'A', 122, 0, NULL, NULL),
(40, 'Animal Crossing: Wild World', '23rd November, 2005', 'Animal Crossing: Wild World is a social simulation video game developed and published by Nintendo for the Nintendo DS handheld game console, released in Japan and North America in late 2005 and Europe in March 2006. It is the second installment in the Animal Crossing series, and a sequel to Animal Crossing on the GameCube.', 'A', 123, 0, NULL, NULL),
(40, 'Metroid Prime Hunters', '20th March, 2006', 'Metroid Prime Hunters is a first-person action-adventure video game published by Nintendo and developed by its Redmond-based subsidiary Nintendo Software Technology for the Nintendo DS handheld game console. It was released in North America in March 2006, with other territories later. It is a part of the Metroid series, and the story takes place between the events of Metroid Prime and Metroid Prime 2: Echoes. Players assume the role of series protagonist Samus Aran, a bounty hunter who investigates a mysterious message that originated from the Alimbic Cluster.', 'M', 124, 0, NULL, NULL),
(13, 'Super Mario World ', '21nd November, 1990', 'Super Mario World is a 1990 side-scrolling platform game developed and published by Nintendo for the Super Nintendo Entertainment System. The story follows Mario\'s quest to save Princess Toadstool and Dinosaur Land from the series antagonist Bowser and his children, the Koopalings. The gameplay is similar to that of earlier Super Mario games: Players control Mario or his brother Luigi through a series of levels in which the goal is to reach the flagpole at the end. Super Mario World introduced Yoshi, a dinosaur who can eat enemies and gain abilities by eating the shells of Koopa Troopas.', 'S', 125, 0, NULL, NULL),
(37, 'Pokémon FireRed / Pokémon LeafGreen', '29th January, 2004', 'Pokémon FireRed Version and LeafGreen Version are enhanced remakes of the 1996 video games Pokémon Red and Blue. The new titles were developed by Game Freak, published by The Pokémon Company and Nintendo for the Game Boy Advance and have compatibility with the Game Boy Advance Wireless Adapter, which originally came bundled with the games. FireRed and LeafGreen were first released in Japan in January 2004 and released in North America and Europe in September and October respectively. Nearly two years after their original release, Nintendo re-marketed them as Player\'s Choice titles. The two games hold the distinction of being the first enhanced remakes of previous games within the franchise.', 'P', 126, 0, NULL, NULL),
(15, 'Conker\'s Bad Fur Day', '5th March, 2001', 'Conker\'s Bad Fur Day is a platformer video game developed by Rare and released for the Nintendo 64 console in 2001. As part of the Conker series, the game follows the story of Conker the Squirrel; a greedy, heavy-drinking red squirrel who attempts to return home to his girlfriend. It features a single-player mode where the player must complete challenges that involve jumping over obstacles, solving puzzles, and fighting enemies, and a competitive multiplayer mode that supports up to four players.', 'C', 127, 0, NULL, NULL),
(15, 'Star Fox 64 / Lylat Wars', '27th April, 1997', 'Star Fox 64, known in the PAL region as Lylat Wars, is a 3D scrolling shooter game themed around aircraft combat for the Nintendo 64 video game console. It is a reboot of the original Star Fox, and the only game in the Star Fox series to be released on the Nintendo 64. An autostereoscopic remake, titled Star Fox 64 3D, was released for the Nintendo 3DS in 2011.', 'S', 128, 0, NULL, NULL),
(15, 'F-Zero X', '14th July, 1998', 'F-Zero X is a futuristic racing video game for the Nintendo 64 (N64) console. Developed by Nintendo\'s EAD division, it was released in Japan, North America, and Europe in 1998. It is a fast paced racing game in the far future and is the second instalment of the F-Zero franchise.', 'F', 129, 0, NULL, NULL),
(13, 'Chrono Trigger', '11th March, 1995', 'Chrono Trigger is a role-playing video game developed and published by Square for the Super Nintendo Entertainment System in 1995 that began the Chrono series. The game\'s story follows a group of adventurers who travel through time to prevent a global catastrophe.', 'C', 130, 0, NULL, NULL),
(15, 'Super Smash Bros', '21st January, 1999', 'Super Smash Bros is a crossover fighting video game developed by HAL Laboratory and published by Nintendo for the Nintendo 64. It was first released in Japan on January 21, 1999, in North America on April 26, 1999, and in Europe on November 19, 1999. The first game in the Super Smash Bros. series, it is a crossover between several different Nintendo franchises, including Mario, The Legend of Zelda, Star Fox, Yoshi, Donkey Kong, Metroid, F-Zero, Mother, Kirby, and Pokémon. It presents a cast of characters and locations from these franchises and allows players to use each character\'s unique skills and the stage\'s hazards to inflict damage, recover health, and ultimately knock opponents off the stage.', 'S', 131, 0, NULL, NULL),
(13, 'Street Fighter II: The World Warrior', '10th June, 1992', 'Street Fighter II is a competitive fighting game developed by Capcom and released for arcades in 1991. The sequel to the 1987 game Street Fighter, Street Fighter II adds multiple playable characters, each with their own fighting style, and features such as command-based special moves, a six-button configuration, a combo system, and competitive two-player multiplayer.', 'S', 132, 0, NULL, NULL),
(15, 'Mario Kart 64 ', '14th December, 1996', 'Mario Kart 64 is a kart racing video game developed and published by Nintendo for the Nintendo 64 video game console. It is the successor to Super Mario Kart for the Super Nintendo Entertainment System, and the second game in the Mario Kart series. It was released in Japan on December 14, 1996, and in North America and Europe in 1997. It was later released as a Virtual Console game for the Wii and Wii U in 2007 and 2016, respectively.\r\n\r\nA great game to play with friends!', 'M', 133, 0, NULL, NULL),
(13, 'Mortal Kombat', '9th August, 1992', 'Mortal Kombat is a video game franchise originally developed by Midway Games\' Chicago studio in 1992. The development of the first game was originally based on an idea that Ed Boon and John Tobias had of making a video game starring Jean-Claude Van Damme, but as that idea fell through, a horror-fantasy themed fighting game titled Mortal Kombat was created instead.', 'M', 134, 0, NULL, NULL),
(15, 'Legend of Zelda: Majora’s Mask ', 'April 27th, 2000', 'The Legend of Zelda: Majora\'s Mask is an action-adventure game developed and published by Nintendo for the Nintendo 64. It was released in 2000 as the sixth main installment in The Legend of Zelda series and was the second to use 3D graphics, following 1998\'s The Legend of Zelda: Ocarina of Time. Designed by a creative team led by Eiji Auonuma, Yoshiaki Koizumi, and Shigeru Miyamoto, Majora\'s Mask was completed in less than two years. It featured enhanced graphics and several gameplay changes from its predecessor, though it reused a number of elements and character models, which the game\'s creators called a creative decision made necessary by time constraints.', 'L', 135, 0, NULL, NULL),
(15, 'Legend of Zelda: Ocarina of Time ', '21st November, 1998', 'The Legend of Zelda: Ocarina of Time is an action-adventure game developed and published by Nintendo for the Nintendo 64. It was released in Japan and North America in November 1998, and in Europe and Australia the following month. Ocarina of Time is the fifth game in the Legend of Zelda series, and the first with 3D graphics. Originally developed for the 64DD peripheral, it was instead released on a 256-megabit (32-megabyte) cartridge, the largest-capacity cartridge Nintendo produced at that time.', 'L', 136, 0, NULL, NULL),
(9, 'Oregon Trail Deluxe', '1992', 'Oregon Trail Deluxe, was released for DOS and Macintosh in 1992, as well as Windows in 1993 (under the title of simply The Oregon Trail Version 1.2)\r\nCan you survive the tough and dangerous crossing of the United States? Come find out in this timeless classic! Try not to die of dysentery...', 'O', 137, 0, NULL, NULL),
(9, 'The Elder Scrolls II: Daggerfall', '20th September, 1996', 'The Elder Scrolls II: Daggerfall is a fantasy open-world action role-playing video game developed and published by Bethesda Softworks and released in 1996 for MS-DOS. \r\nAn incredibly open ended RPG with one of the largest open worlds in all of videogaming!\r\nIt is a sequel to The Elder Scrolls: Arena and the second installment in The Elder Scrolls series. On July 9, 2009, Bethesda made Daggerfall available as a free, legal download on their website, commemorating the 15th anniversary of The Elder Scrolls franchise.', 'T', 138, 0, NULL, NULL),
(17, 'Pikmin', '26th October, 2001', 'Pikmin is a Real-time strategy and puzzle video game developed and published by Nintendo for the GameCube in 2001. It was created and produced by Shigeru Miyamoto, and is the first game in the Pikmin series. The player controls Captain Olimar, an alien, who crash lands on a mysterious planet, where he befriends creatures called \"Pikmin\", and utilizes their abilities to collect the parts for the SS Dolphin, his beloved ship. The player has thirty days to recover the pieces and repair the ship.', 'P', 139, 0, NULL, NULL),
(9, 'Duke Nukem 3D', '29th January, 1996', 'Duke Nukem 3D is a first-person shooter video game developed by 3D Realms. It is a sequel to the platform games Duke Nukem and Duke Nukem II, published by 3D Realms.\r\nDuke Nukem 3D features the adventures of the titular Duke Nukem, voiced by Jon St. John, who fights against an alien invasion on Earth. Along with Wolfenstein 3D and Doom, Duke Nukem 3D is considered to be responsible for popularizing first-person shooters, and was released to major acclaim. Reviewers praised the interactivity of the environments, gameplay, level design, and unique risqué humor, a mix of pop-culture satire and lampooning of over-the-top Hollywood action heroes. The game\'s violent nature, erotic elements, and portrayal of women incited controversy.', 'D', 140, 0, NULL, NULL),
(17, 'Paper Mario: The Thousand-Year Door', '22nd July, 2004', 'Paper Mario: The Thousand-Year Door is a 2004 role-playing video game developed by Intelligent Systems and published by Nintendo for the GameCube. The Thousand-Year Door is the second game in the Paper Mario series.\r\nPlay as Mario in his quest to open the Thousand-Year Door in this charming RPG!', 'P', 141, 0, NULL, NULL),
(7, 'Command & Conquer: Red Alert', '22nd November, 1996', 'Command & Conquer: Red Alert is a real-time strategy video game of the Command & Conquer franchise, produced by Westwood Studios and released by Virgin Interactive Entertainment in 1996. The second game to bear the Command & Conquer title, Red Alert is the prequel to the original Command & Conquer of 1995, and takes place in the alternate early history of Command & Conquer when Allied Forces battle an aggressive Soviet Union for control over the European mainland.\r\n\r\nIt was initially available for PC (MS-DOS and Windows 95 versions included in one package) and was subsequently ported to PlayStation.', 'C', 142, 0, NULL, NULL),
(9, 'Command & Conquer: Red Alert', '22nd November, 1996', 'Command & Conquer: Red Alert is a real-time strategy video game of the Command & Conquer franchise, produced by Westwood Studios and released by Virgin Interactive Entertainment in 1996. The second game to bear the Command & Conquer title, Red Alert is the prequel to the original Command & Conquer of 1995, and takes place in the alternate early history of Command & Conquer when Allied Forces battle an aggressive Soviet Union for control over the European mainland.\r\n\r\nIt was initially available for PC (MS-DOS and Windows 95 versions included in one package) and was subsequently ported to PlayStation.', 'C', 143, 0, NULL, NULL),
(17, 'Animal Crossing', '14th April, 2001', 'Animal Crossing is a life simulation video game developed by Nintendo EAD and published by Nintendo. It is a localised version of Dōbutsu no Mori, a Nintendo 64 title that was released in Japan on April 14, 2001.', 'A', 144, 0, NULL, NULL),
(17, 'Metroid Prime', '17th November, 2002', 'Metroid Prime is a first-person action-adventure game developed by Retro Studios and Nintendo for the GameCube video game console. It was released in North America on November 17, 2002, and in Japan and Europe the following year. Metroid Prime is the fifth main installment in the Metroid series, and the first Metroid game to use 3D computer graphics. Because exploration takes precedence over combat, Nintendo classifies the game as a first-person adventure rather than a first-person shooter.\r\nOn the same day as its North American release, Nintendo also released the Game Boy Advance game Metroid Fusion, marking the return of the Metroid series after an eight-year hiatus following Super Metroid (1994).', 'M', 145, 0, NULL, NULL),
(17, 'Legend of Zelda: The Wind Waker', '13th December, 2002', 'The Legend of Zelda: The Wind Waker is an action-adventure game developed and published by Nintendo for the GameCube home video game console. The tenth installment in The Legend of Zelda series, it was released in Japan in December 2002, in North America in March 2003, and in Europe in May 2003.\r\n\r\nThe game is set on a group of islands in a vast sea, a departure for the series. The player controls the series\' protagonist Link as he attempts to save his sister from the sorcerer Ganon and becomes embroiled in a struggle for the Triforce, a sacred wish-granting relic. Aided by allies including pirate captain Tetra – an incarnation of Princess Zelda – and a talking boat named the King of Red Lions, Link sails the ocean, explores islands, and traverses dungeons to acquire the power necessary to defeat Ganon. Wind, which facilitates sailing, plays a prominent role and can be controlled with a magic conductor\'s baton called the Wind Waker.', 'L', 146, 0, NULL, NULL),
(9, 'Sid Meier\'s Civilization', 'September, 1991', 'Sid Meier\'s Civilization is a turn-based strategy 4X video game created by Sid Meier and Bruce Shelley for MicroProse in 1991. The game\'s objective is to \"Build an empire to stand the test of time\": it begins in 4000 BC and the players attempt to expand and develop their empires through the ages from the ancient era until modern and near-future times.', 'S', 147, 0, NULL, NULL),
(9, 'Lemmings', '14th February, 1991', 'Lemmings is a puzzle-platformer video game originally developed by DMA Design in Dundee, Scotland and published by Psygnosis for the Amiga in 1991 and later ported for numerous other platforms. The game was programmed by Mike Dailly and David Jones, and was inspired by a simple animation that Dailly created while experimenting with Deluxe Paint. Control the not-so-bright Lemmings as you attempt to guide them towards an exit in a deceptively simple puzzler!', 'L', 148, 0, NULL, NULL),
(17, 'Super Smash Bros. Melee', '21st November, 2001', 'Super Smash Bros. Melee is a crossover fighting video game developed by HAL Laboratory and published by Nintendo for the GameCube. It was first released in Japan on November 21, 2001, in North America on December 3, 2001, in Europe on May 24, 2002, and in Australia on May 31, 2002. The second installment in the Super Smash Bros. series, it features characters from Nintendo video game franchises such as Mario, The Legend of Zelda, Star Fox, and Pokémon. The stages and gameplay modes reference or take designs from these franchises as well.', 'S', 149, 0, NULL, NULL),
(17, 'Pikmin 2', '29th April, 2004', 'Pikmin 2 is a 2004 puzzle strategy video game developed and published by Nintendo for the GameCube home video game console. It is the direct sequel to the 2001 game Pikmin and is the second game in the Pikmin series.\r\n\r\nLike its predecessor, Pikmin 2 focuses on exploring the surface of an unknown planet from a microscopic perspective, where the player directs and delegates tasks to a horde of tiny plant-like creatures called Pikmin. The Pikmin can be directed to destroy obstacles, defeat enemies and retrieve objects. It introduces many gameplay mechanics not seen in Pikmin, including the ability to control two different leaders of the Pikmin at once and the addition of new Pikmin types.', 'P', 150, 0, NULL, NULL),
(8, 'MiniTool Power Data Recovery', '2014(?)', 'MiniTool Power Data Recovery is a Free Partition Recovery & Data Recovery Software that helps recover deleted, lost or damaged logical drives and partitions on Windows, then recover data from them.\r\n\r\nIt bundles several tools that together can recover lost and deleted data from hard drives, USB drives, and nearly every kind of disk or directory that can hold (and lose) data:\r\n\r\n\"Undelete Recovery\": is used to recover mistakenly deleted files and folders.\r\n\r\n\"Damaged Partition Recovery\": is used to recover data from damaged partition. For instance, if a drive is displayed as RAW and Windows asks \"Do you need to format this drive?\"\r\n\r\n\"Lost Partition Recovery\": fully supports lost or deleted partition data recovery.\r\n\r\n\"Digital Media Recovery\": can help users recover digital media files such as photos, music files and video from storage devices such as memory card, memory stick and USB flash disk.\r\n\r\n\"CD/DVD Recovery\": is available for users to recover deleted or lost data from formatted or scratched CD/DVD.', 'M', 151, 0, NULL, NULL),
(7, 'Microsoft Minesweeper', '1990', 'Microsoft Minesweeper (formerly Minesweeper) is a minesweeper computer game created by Curt Johnson, originally for OS/2, and ported to Microsoft Windows by Robert Donner, both Microsoft employees at the time. First officially released as part of the Microsoft Entertainment Pack 1 in 1990, it was included in the standard install of Windows 3.1 in 1992, replacing Reversi from Windows 3.0.\r\nThe goal of the game is to uncover all the squares that do not contain mines without being \"blown up\" by clicking on a square with a mine underneath. The location of the mines is discovered by a process of logic. Clicking on the game board will reveal what is hidden underneath the chosen square or squares (a large number of blank squares may be revealed in one go if they are adjacent to each other). Some squares are blank but some contain numbers (1 to 8), each number being the number of mines adjacent to the uncovered square. To help avoid hitting a mine, the location of a suspected mine can be marked by flagging it with the right mouse button. The game is won once all blank squares have been uncovered without hitting a mine, any remaining mines not identified by flags being automatically flagged by the computer. However, in the event that a game is lost and the player mistakenly flags a safe square, that square will either appear with a red X covering the mine (denoting it as safe), or just a red X (also denoting it as safe). The game board comes in three set sizes: beginner, intermediate, and expert, though a custom option is available as well.', 'M', 152, 0, NULL, NULL),
(7, '3D Pinball for Windows – Space Cadet', '1995', '3D Pinball for Windows – Space Cadet is a version of the Space Cadet table bundled with Microsoft Windows. It was originally packaged with Microsoft Plus! 95 and later included in Windows NT 4.0, Windows 2000, Windows ME, and Windows XP. The Windows 98 installation CD has instructions on installing Pinball 3D on this version of Windows which are partly wrong; Microsoft later issued an updated support article. Windows XP was the last client release of Windows to include this game', '#', 153, 0, NULL, NULL),
(7, 'Solitaire', '1990', 'Solitaire is a computer game included with Microsoft Windows, based on a card game of the same name, also known as Klondike. Microsoft intended Solitaire \"to soothe people intimidated by the operating system,\" and at a time where many users were still unfamiliar with graphical user interfaces, it proved useful in familiarizing them with the use of a mouse, such as the drag-and-drop technique required for moving cards.', 'S', 154, 0, NULL, NULL),
(46, '<b>Anything / Collections</b>', 'August, 1982', 'A section for discussing about any/all games released for the Commodore 64.', '.', 155, 0, NULL, NULL),
(46, 'Super Mario Bros. C64', '18th April, 2019', 'A developer under the name of ZeroPaige has spent the last seven years creating a port of Super Mario Bros. for the Commodore 64. It\'s a painstaking recreation that manages to look and sound incredibly similar to the original game, an impressive accomplishment considering the vast differences between the Commodore hardware and NES.', 'S', 156, 0, NULL, NULL),
(13, 'Mega Man X', '17th December, 1993', 'Mega Man X is an action-platform video game developed and published by Capcom for the Super Nintendo Entertainment System (SNES). Taking place a century after the original Mega Man series, Mega Man X is set in a futuristic world populated by both humans and \"Reploids\", robots capable of thinking, feeling, and growing like their human creators. Because of these complex attributes, many Reploids are prone to destructive, renegade activity and are thereafter referred to as \"Mavericks\". The plot of the game follows the protagonist Mega Man X, an android member of a military task force called the \"Maverick Hunters\". With the help of his partner Zero, X must thwart the plans of Sigma, a powerful Maverick leader wishing to bring about human extinction.', 'M', 157, 0, NULL, NULL),
(9, 'Wing Commander', '26th September, 1990', 'Wing Commander is the eponymous first game in Chris Roberts\' science fiction space flight simulation franchise Wing Commander by Origin Systems.\r\nThe game was a marked departure from the standard formula, bringing space combat to a level approaching the Star Wars films. Set in the year 2654 and characterized by Chris Roberts as \"World War II in space\", it features a multinational cast of pilots from the \"Terran Confederation\" flying missions against the predatory, aggressive Kilrathi, a feline warrior race (heavily inspired by the Kzinti of Larry Niven\'s Known Space universe)', 'W', 158, 0, NULL, NULL),
(15, 'GoldenEye 007', '25th August, 1997', 'GoldenEye 007 is a first-person shooter video game developed by Rare and based on the 1995 James Bond film GoldenEye. It was released for the Nintendo 64 video game console in August 1997. The game features a single-player campaign in which players assume the role of British Secret Intelligence Service agent James Bond as he fights to prevent a criminal syndicate from using a satellite weapon against London to cause a global financial meltdown. The game includes a split-screen multiplayer mode in which up to four players can compete in different types of deathmatch games.', 'G', 159, 0, NULL, NULL),
(9, 'X-COM', '1st March, 1994', 'X-COM is a science fiction video game franchise featuring an elite international organization tasked with countering alien invasions of Earth. The series began with the strategy video game UFO: Enemy Unknown created by Mythos Games and MicroProse in 1994.\r\nTake the role of a commander of X-COM – a clandestine, international paramilitary organization defending Earth from an alien invasion. Through the game, issue orders to individual X-COM troops in a series of turn-based tactical missions. At strategic scale, direct the research and development of new technologies, and build and expand X-COM\'s bases, manage the organization\'s finance and personnel, and monitor and respond to UFO activity.', 'X', 160, 0, NULL, NULL),
(47, 'KoalaPainter', '1983', 'KoalaPainter is a simple bitmap graphics editor bundled with the KoalaPad, developed for Koala by Audio Light, Inc. KoalaPainter could also be operated using an ordinary digital joystick.\r\nOne unique feature of the program, for its time, was that it held two pictures in the computer\'s memory, allowing the user to flip from one to the other—a function commonly used in order to study the differences between an original and modified picture, and to copy and paste between two different pictures.', 'K', 161, 0, NULL, NULL),
(25, '<b>Anything / Collections</b>', '21st November, 1994', 'A section for discussing about any/all games released for the Sega 32X.', '.', 162, 0, NULL, NULL),
(48, '<b>Anything / Collections</b>', '6th October, 1990', 'A section for discussing about any/all games released for the Sega Game Gear.', '.', 163, 0, NULL, NULL),
(49, 'Super Boy II', '1989', 'Super Boy II (슈퍼보이 II) is an unlicensed Sega Master System game developed by Zemina and released exclusively in South Korea in 1989. \r\nIt was ported to the Game Gear the same year.', 'S', 164, 0, NULL, NULL),
(7, 'Professor Fizzwizzle', '2006', 'Professor Fizzwizzle is a fun, mind-expanding puzzle game, where you take control of the diminutive genius, Professor Fizzwizzle. You must help the professor use his brains and his gadgets to solve each exciting level. Do you have what it takes to get past the Rage-Bots and bring the prof back to his lab?', 'P', 165, 0, NULL, NULL),
(17, 'Super Mario Sunshine', '26th August, 2002', 'Super Mario Sunshine is a 3D platform game developed and published by Nintendo for the GameCube. It was first released in Japan on July 19, 2002, and was later released in North America, Europe and Australia. It is the second 3D platformer in the Super Mario series, following Super Mario 64 in 1996.', 'S', 166, 0, NULL, NULL),
(37, 'Doom', '5th November, 2001', 'The Game Boy Advance version of Doom was developed by David A. Palmer Productions and was released on November 5, 2001, and featured a level set identical to the Jaguar version, as the engine is actually a port of it.', 'D', 167, 0, NULL, NULL),
(37, 'Doom 2', '23rd October, 2002', 'Doom II for the Game Boy Advance was developed by Torus Games of Australia and published by Activision. It was released on October 23, 2002. This version of the game does not run on a port of the original Doom engine, but instead runs on a custom engine shared with several other Game Boy Advance first-person shooter games called the Southpaw Engine.\r\n\r\nIn terms of content, the game is nearly identical to the PC version, with only very minor changes. However, conversion of the game play and rendering functions to a different engine resulted in a number of visual and mechanical inconsistencies from the original game; some are purely cosmetic, but others can have a significant—and sometimes detrimental—effect on game play.', 'D', 168, 0, NULL, NULL),
(4, 'Tony Hawks Underground 2', '4th October, 2004', 'Tony Hawk\'s Underground 2 is a sports video game, the sixth installment in Neversoft\'s Tony Hawk\'s series and is the sequel to Tony Hawk\'s Underground. Underground 2 was released on October 4, 2004 in the U.S. for the PlayStation 2, Xbox, GameCube, Microsoft Windows and Game Boy Advance platforms.', 'T', 169, 0, NULL, NULL),
(4, 'Manhunt', '18th November, 2003', 'Manhunt (video game) Manhunt is a stealth-based survival horror video game developed by Rockstar North and published by Rockstar Games. It was originally released for the PlayStation 2 on November 18, 2003, and for Microsoft Windows and Xbox on April 20, 2004.', 'M', 170, 0, NULL, NULL),
(7, 'Manhunt 2', '29th October, 2007', 'Manhunt 2 is a psychological horror stealth video game published by Rockstar Games. It was developed by Rockstar London for Microsoft Windows and PlayStation 2, Rockstar Leeds for the PlayStation Portable, and Rockstar Toronto for the Wii.', 'M', 171, 0, NULL, NULL),
(4, 'Bully / Canis Canem Edit', '17th October, 2006', 'Bully is an action-adventure video game developed by Rockstar Vancouver and published by Rockstar Games. It was released on 17 October 2006 for PlayStation 2.', 'B', 172, 0, NULL, NULL),
(7, 'Hatred', '1st June, 2015', 'Hatred is an isometric shoot \'em up video game developed and published by Destructive Creations that was released on June 1, 2015 on Microsoft Windows. The player-character is a misanthropic mass-killer who begins a \"genocide crusade\" to kill as many human beings as possible.', 'H', 173, 0, NULL, NULL),
(7, 'Grand Theft Auto: San Andreas', '7th June, 2005', 'Grand Theft Auto: San Andreas is an action-adventure video game developed by Rockstar North and published by Rockstar Games. It was released on 26 October 2004 for PlayStation 2, and on 7 June 2005 for Microsoft Windows and Xbox.', 'G', 174, 0, NULL, NULL),
(7, 'Grand Theft Auto 2', '22nd October, 1999', 'Grand Theft Auto 2 is an action-adventure video game developed by DMA Design and published by Rockstar Games. It was released on 22 October 1999 for Microsoft Windows and the PlayStation, followed by Dreamcast and Game Boy Color releases in 2000.', 'G', 175, 0, NULL, NULL),
(7, 'Half Life 2', '16th November, 2004', 'Half-Life 2 is a first-person shooter video game developed and published by Valve Corporation. It is the sequel to 1998\'s Half-Life and was released in November 2004 following a five-year $40 million development. During development, a substantial part of the project was leaked and distributed on the Internet.', 'H', 176, 0, NULL, NULL),
(7, 'Grand Theft Auto: London 1969', '31st March, 1999', 'Grand Theft Auto: London 1969 is a mission pack for Grand Theft Auto. London 1969 was developed by Rockstar Canada and released by Rockstar Games on 31 March 1999 for Microsoft Windows and on 30 April 1999 for PlayStation. The game was awarded the BAFTA Interactive Entertainment Award in the category \"Sound\" in 1999.', 'G', 177, 0, NULL, NULL),
(22, 'ToeJam & Earl', '12nd March, 1991', 'ToeJam & Earl is an action game developed by Johnson Voorsanger Productions and published by Sega for the Sega Genesis console. Released in 1991, it centers on ToeJam and Earl—alien rappers who have crash-landed on Earth.', 'T', 178, 0, NULL, NULL),
(22, 'ToeJam & Earl in Panic on Funkotron', '1993', 'ToeJam & Earl: Panic on Funkotron is a platform video game developed by Johnson Voorsanger Productions and published by Sega in 1993 for the Sega Genesis. The game is the sequel to cult video game ToeJam & Earl, released in 1991.', 'T', 179, 0, NULL, NULL),
(7, 'Grand Theft Auto III', '20th May, 2002', 'Grand Theft Auto III is an action-adventure video game developed by DMA Design and published by Rockstar Games. It was released in October 2001 for the PlayStation 2, in May 2002 for Microsoft Windows, and in October 2003 for the Xbox.', 'G', 180, 0, NULL, NULL),
(4, 'Tony Hawks Underground', '27th October, 2003', 'Tony Hawk\'s Underground is a skateboarding video game published by Activision in 2003, the fifth entry in the Tony Hawk\'s series. Neversoft developed the GameCube, PlayStation 2, Xbox versions, Beenox developed the Microsoft Windows version, which was released in Australia and New Zealand as a budget release in 2004, while the Game Boy Advance adaptation was developed by Vicarious Visions and a mobile version by Jamdat.\r\n\r\nUnderground is built upon the skateboarding formula of previous Tony Hawk\'s games: the player explores levels and completes goals while performing tricks. The game features a new focus on customization; the player, instead of selecting a professional skater, creates a custom character. Underground adds the ability for players to dismount their boards and explore on foot. The plot follows the player character and their friend Eric Sparrow as the two become professionals and grow apart.\r\n\r\nThe game was developed with a theme of individuality, which was manifested in the extensive customization options, the presence of a narrative, and the product\'s characterization as an adventure game. Real-world professional skateboarders contributed their experiences to the plot. Upon release, the game was a major critical and commercial success, with reviewers praising its wide appeal, soundtrack, customization, multiplayer, and plot. The graphics and the controls for driving vehicles and walking were less well received. Underground\'s PlayStation 2 version had sold 2.11 million copies in the United States by December 2007. A sequel, Underground 2, was released in 2004.', 'T', 181, 0, NULL, NULL),
(9, 'Life & Death', '1988', 'Life & Death is a computer game published in 1988 by The Software Toolworks. It is one of the few realistic medical computer games ever released. In the role of a resident abdominal surgeon at fictional hospital Toolworks General, the player must diagnose and treat a variety of maladies including kidney stones, arthritis, appendicitis, and aneuritic aorta. The last two require the player to perform surgery.', 'L', 182, 0, NULL, NULL),
(4, 'Medal Of Honor: Rising Sun', '11th November, 2003', 'Medal of Honor: Rising Sun is a first-person shooter video game, the fifth installment of the Medal of Honor series, released by EA Games in November 2003. Rising Sun is set in World War II, one of few during the Pacific War. It features single-player and multiplayer capabilities.', 'M', 183, 0, NULL, NULL),
(37, 'Grand Theft Auto Advance', '26th October, 2004', 'Grand Theft Auto Advance, marketed as Grand Theft Auto, is an action-adventure video game developed by Digital Eclipse and published by Rockstar Games for the Game Boy Advance, released on 26 October 2004. ', 'G', 184, 0, NULL, NULL),
(35, 'Grand Theft Auto 2', '2000', 'Grand Theft Auto 2 stays true to the gameplay of the original title and puts the player back into the shoes of a criminal. Again, your goal is to achieve fame by performing violent and criminal activities while avoiding the police. Carjacking plays a prominent role as you can take just about any car for a spin and driving wherever you please. When traveling on foot a variety of hand weapons can be used to keep pedestrians and the law out of the way. The primary difference between this game and the original is that instead of only working for crime bosses you can now choose gangs to perform tasks for and play the gangs off of each other.', 'G', 185, 0, NULL, NULL),
(1, 'Who Wants To Be A Millionare?', '29th Sep, 2000', 'The Video Game Based On The United Kingdom Television Show.', 'W', 186, 0, NULL, NULL),
(35, 'Grand Theft Auto', '1999', 'In Grand Theft Auto, the player takes the role of a small-time criminal trying to make it big with the mob. Stealing cars, doing jobs for the gangsters and behaving generally anti-social are the way to success.', 'G', 187, 0, NULL, NULL),
(40, 'Grand Theft Auto Chinatown Wars', '17th March 2009', 'Grand Theft Auto: Chinatown Wars is an action-adventure video game developed by Rockstar Leeds in conjunction with Rockstar North and published by Rockstar Games.', 'G', 188, 0, NULL, NULL),
(46, 'Skool Daze', '1984', 'Skool Daze is a computer game released by Microsphere in 1984 for the ZX Spectrum and Commodore 64 computers. It was written by David Reidy, with graphics designed by Keith Warrington. The game was commercially and critically successful, and praised for its original concept.', 'S', 189, 0, NULL, NULL),
(4, 'Disney\'s Extreme Skate Adventure', '3rd September, 2003', 'Disney\'s Extreme Skate Adventure is a sports video game developed by Toys for Bob and published by Activision for GameCube, PlayStation 2 and Xbox. The Game Boy Advance version was ported by Vicarious Visions.', 'D', 190, 0, NULL, NULL),
(4, 'Shaun Palmer\'s Pro Snowboarder', '2001', 'Shaun Palmer\'s Pro Snowboarder is a sports game with a similar feel to the Tony Hawk\'s Pro Skater series, published by Activision under the Activision O2 label. The game features 10 famous snowboarders including Shaun Palmer, Ross Powers and Shaun White.', 'S', 191, 0, NULL, NULL),
(4, 'Silent Hill 2', '24th September, 2001', 'Silent Hill 2 is a survival horror video game published by Konami for the PlayStation 2 and developed by Team Silent, part of Konami Computer Entertainment Tokyo. It was released in September 2001 as the second installment in the Silent Hill series.', 'S', 192, 0, NULL, NULL),
(4, 'The Simpsons Skateboarding', '12th November, 2002', 'The Simpsons Skateboarding is an extreme sports video game based on the animated sitcom The Simpsons. It was released for the PlayStation 2 in North America on 12 November 2002 and Europe on 6 December 2002. The game was developed by The Code Monkeys and published by Fox Interactive and Electronic Arts.\r\n', 'T', 193, 0, NULL, NULL),
(4, 'The Simpsons: Hit & Run', '16th September, 2003', 'The Simpsons: Hit & Run is an action-adventure video game developed by Radical Entertainment and published by Vivendi Universal Games, for GameCube, PlayStation 2, Xbox and Microsoft Windows. It is based on the American animated sitcom of the same name, and is the twenty-second installment in the Simpsons series.', 'T', 194, 0, NULL, NULL),
(9, '<b>Anything / Collections</b>', '12th August, 1981', 'A section for discussing about any/all games released for MS-DOS.', '.', 195, 0, NULL, NULL),
(8, 'The Games Factory', '1996', 'The Games Factory, or shortened to TGF is the successor product to Klik & Play developed by Europress (now known as Clickteam). It was a sister product to Click & Create at release, which offered additional features and had a more relaxed runtime agreement. The product’s distribution varied by region. For instance, in the United Kingdom, it was published by Empire Interactive under the publishing label Xplosiv (now defunct)\r\n\r\nThe software was released in 1996 and is available in 2 editions: Home and Pro. It also provided an option to install the 16-bit version (for Windows 3.1 users) or the 32-bit version (for Windows 95 users). Creations saved by the product used the GAM file extension as well as being able to create stand alone executables with an optional installer. An unregistered “trial” version was also available.', 'T', 196, 0, NULL, NULL),
(1, 'Tekken 3', '26th March, 1998', 'Tekken 3 is a fighting game, the third installment in the Tekken series. It was released in arcades in March 1997, and for the PlayStation in 1998. The original arcade version of the game was released in 2005 for the PlayStation 2 as part of Tekken 5\'s Arcade History mode. The game was re-released in 2018 as part of Sony\'s PlayStation Classic.', 'T', 197, 0, NULL, NULL),
(37, 'Super Mario Advance 4: Super Mario Bros. 3', '11th July, 2003', 'Super Mario Advance 4: Super Mario Bros 3 is a platform video game developed and published by Nintendo for the Game Boy Advance handheld game console. It was released in Japan, and later released in Europe, North America, and Australia. It is an enhanced remake of the Nintendo Entertainment System video game Super Mario Bros. 3, and is based on the remake found in Super Mario All-Stars for the Super NES.', 'S', 198, 0, NULL, NULL),
(8, 'Windows 10', '15th July, 2015', 'Windows 10 is a series of personal computer operating systems produced by Microsoft as part of its Windows NT family of operating systems. It is the successor to Windows 8.1, and was released to manufacturing on July 15, 2015, and broadly released for retail sale on July 29, 2015. Windows 10 receives new builds on an ongoing basis, which are available at no additional cost to users, in addition to additional test builds of Windows 10 which are available to Windows Insiders. Devices in enterprise environments can receive these updates at a slower pace, or use long-term support milestones that only receive critical updates, such as security patches, over their ten-year lifespan of extended support.', 'W', 199, 0, NULL, NULL),
(7, 'The Simpsons: Hit & Run', '11th November, 2003', 'The Simpsons: Hit & Run is an action-adventure video game developed by Radical Entertainment and published by Vivendi Universal Games, for GameCube, PlayStation 2, Xbox and Microsoft Windows. It is based on the American animated sitcom of the same name, and is the twenty-second installment in the Simpsons series. It was released on September 16, 2003.\r\n\r\nThe game follows the Simpson family and their friend Apu Nahasapeemapetilon, who witness many strange incidents that occur in Springfield; security cameras, mysterious vans, crop circles, and a \"new and improved\" flavor of the popular soft drink Buzz Cola, which causes insanity. Taking matters into their own hands, they discover numerous shocking secrets, and soon realize these incidents are part of a larger alien conspiracy, caused by Kang and Kodos. Gameplay largely focuses on exploration and missions; players often race enemies and interact with supporting characters on timed quests. The game also features many elements found in role-playing games, such as a branching storyline and side tasks.', 'T', 200, 0, NULL, NULL),
(50, '<b>Anything / Collections</b>', '30th October, 1987', 'A section for discussing about any/all games released for the PC Engine / TurboGrafx-16.', '.', 201, 0, NULL, NULL),
(52, '<b>Anything / Collections</b>', '30th October, 1987', 'A section for discussing about any/all games released for the PC Engine CD-ROM²/ TurboGrafx-CD.', '.', 202, 0, NULL, NULL),
(24, '<b>Anything / Collections</b>', '12th December, 1991', 'A section for discussing about any/all games released for the Sega CD / Mega CD.', '.', 203, 0, NULL, NULL),
(53, 'BIOS', '12th December, 1991', 'The PC Engine CD-ROM²/ TurboGrafx-CD Bios', 'B', 204, 0, NULL, NULL),
(51, 'HuZero', '21st November, 2014', 'HuZERO is a futuristic racing game for the PC-Engine, made by Chris Covell as a tribute to a great Mode-7 racer on the Super Famicom.\r\nThis version is a \"Summer Caravan\" parody edition which, if you\'re familiar with Hudson\'s Caravans, gives you 2 minutes to attain a high score. And not die.', 'H', 205, 0, NULL, NULL),
(1, 'Bomberman World', '29th January, 1998', 'Bomberman World (ボンバーマンワールド Bonbāman Wārudo) is a video game for the PlayStation. It is part of the Bomberman series. It was the first Bomberman game to be released for the PlayStation.', 'B', 206, 0, NULL, NULL),
(1, 'Bomberman / Bomberman Party Edition', '10th December, 1998', 'Bomberman Party Edition, known in Japan and Europe as simply Bomberman, is a PlayStation version of the 1983 game Bomberman. In addition to vintage graphics for single player mode, an option for enhanced graphics is added. The game was released to the PlayStation Network as a PSone Classic on May 28, 2008 in Japan and December 10, 2009 in North America.', 'B', 207, 0, NULL, NULL);
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(1, 'JoJo\'s Bizarre Adventure / Jojo no Kimyou na Bouken', '14th October, 1999', 'JoJo\'s Bizarre Adventure (Japanese: ジョジョの奇妙な冒険 Hepburn: JoJo no Kimyō na Bōken) is a fighting video game developed by Capcom based on Hirohiko Araki\'s manga of the same title. The game was developed by the same team who are responsible for the Street Fighter III series.', 'J', 208, 0, NULL, NULL),
(22, 'Bonanza Bros', '16th May, 1991', 'Bonanza Bros. is a shooter platform game where players take the role of one or both of the brothers Robo (1P, red) and Mobo (2P, blue) (Mike and Spike in some PAL versions), who were modeled on The Blues Brothers.\r\nThe arcade game was later ported to the Sega Mega Drive, Sega Master System, TurboGrafx-CD (Japan only), ZX Spectrum (Europe only), Amstrad CPC (Europe only), Commodore 64, Amiga, Sharp X68000 (Japan only) and Atari ST, with minor graphics differences, depending on the system, and some changes in the gameplay, mainly in the bonus stages.', 'B', 209, 0, NULL, NULL),
(4, 'Resident Evil Outbreak', '11th December, 2003', 'Resident Evil Outbreak is a survival horror video game with online playability for the PlayStation 2', 'R', 210, 0, NULL, NULL),
(7, 'AM2R', '2016', 'AM2R (Another Metroid 2 Remake) is an action-adventure game developed by Argentinian programmer Milton Guasti and released in August 2016 for Windows. It is an unofficial remake of the 1991 Game Boy game Metroid II: Return of Samus in the style of Metroid: Zero Mission (2004). As in the original Metroid II, players control bounty hunter Samus Aran, who aims to eradicate the parasitic Metroids. AM2R adds several features, including new graphics and music, new areas and bosses, altered controls, and a map system.', 'A', 211, 0, NULL, NULL),
(15, 'Rayman 2: The Great Escape', '29th October, 1999', 'Rayman 2: The Great Escape is a platform video game developed by Ubi Pictures and published by Ubi Soft for the Nintendo 64, Microsoft Windows and Sega Dreamcast. ', 'R', 212, 0, NULL, NULL),
(12, 'Micro Mages', '2018', 'Micro Mages is a platformer developed for the original 8-bit NES console. Play solo or with up to 4 players simultaneously. Compete over score or cooperate to overcome challenging levels.', 'M', 213, 0, NULL, NULL),
(17, 'Tom Clancy\'s Splinter Cell', '17th November, 2002', 'Tom Clancy\'s Splinter Cell is a 2002 stealth video game developed by UbiSoft Montreal and built on the Unreal Engine 2. It is the first game in the Splinter Cell series. Endorsed by author Tom Clancy, it follows the activities of NSA black ops agent Sam Fisher. The character of Fisher is voiced by actor Michael Ironside. The game was inspired by the Metal Gear series.', 'T', 214, 0, NULL, NULL),
(7, 'RollerCoaster Tycoon 3', '26th October, 2004', 'RollerCoaster Tycoon 3 is a construction and management simulation video game. It is the third installment in the RollerCoaster Tycoon series, first released on October 26, 2004, in North America. RollerCoaster Tycoon 3 places players in charge of managing amusement parks; rides can be built or demolished, terrain and scenery can be adjusted, and prices can be controlled to keep visitors or \"peeps\" happy.\r\nOn 9th May 2018, the game was pulled from Steam and GOG as \"Frontier sued Atari for not paying the company enough for royalties for the game\".', 'R', 215, 0, NULL, NULL),
(37, 'Golden Sun: The Lost Age', '28th June, 2002', 'Golden Sun: The Lost Age, is a 2002 role-playing video game for the Game Boy Advance, developed by Camelot Software Planning and published by Nintendo. It is the second installment in the Golden Sun series. It was released on June 28, 2002 in Japan, and through 2003 in North America and Europe.\r\n\r\nPicking up the story during the events of the previous game, The Lost Age puts the player into the roles of the previous games\' antagonists, primarily from the perspective of magic-attuned \"adepts\" Felix and his allies as they seek to restore the power of alchemy to the world of Weyard. Along the way, the player uses psynergy to defeat enemies and discover new locations, help out local populations, and find elemental djinn which augment the characters\' powers. Players can transfer their characters and items from Golden Sun to The Lost Age by means of a password system or Game Link Cable, and players are rewarded for fully completing both games.', 'G', 216, 0, NULL, NULL),
(37, 'Golden Sun', '1st August, 2001', 'Golden Sun is a series of fantasy role-playing video games developed by Camelot Software Planning and published by Nintendo. Golden Sun follows the story of a group of magically-attuned \"adepts\" who are charged with preventing the potentially destructive power of alchemy from being released as it was in the past.', 'G', 217, 0, NULL, NULL),
(11, 'Bomberman', '20th December, 1985', 'Bomberman is an arcade-style maze-based video game developed by Hudson Soft. Bomberman was later released for the Nintendo Entertainment System and retitled Dynablaster in Europe & Australia. It spawned the Bomberman series with many installments building on its basic gameplay.', 'B', 218, 0, 3.95, 'https://images.igdb.com/igdb/image/upload/t_cover_big/co1qn8.jpg'),
(11, 'Bomberman II / Dynablaster', '28th June, 1991', 'Bomberman II is a video game developed and published by Hudson Soft and released for the Family Computer/Nintendo Entertainment System in 1991. The game was titled Dynablaster in Europe.', 'B', 219, 0, 4.1, 'https://images.igdb.com/igdb/image/upload/t_cover_big/co1qn9.jpg'),
(33, 'Pokémon', '27th February, 1996', 'Pokémon Red Version and Pokémon Blue Version are role-playing video games developed by Game Freak and published by Nintendo for the Game Boy and Game Boy Color. They are the first installments of the Pokémon series. They were first released in Japan in 1996 as Pocket Monsters Red and Pocket Monsters Green, with the special edition Pocket Monsters Blue being released in Japan later that same year. The games were later released as Pokémon Red and Blue in North America and Australia in 1998 and Europe in 1999.', 'P', 220, 0, NULL, NULL),
(7, 'Sim City 2000 Special Edition', '1995', 'SimCity 2000 is a city-building simulation video game jointly developed by Will Wright and Fred Haslam of Maxis. It is the successor to SimCity Classic and was released for Apple Macintosh personal computers in 1993, after which it was released on other platforms over the following years, such as the Sega Saturn and SNES game consoles in 1995 and the PlayStation in 1996.\r\n\r\nSimCity 2000 is played from an isometric perspective as opposed to the previous title, which was played from a top-down perspective. The objective of the game is to create a city, develop residential and industrial areas, build infrastructure and collect taxes for further development of the city. Importance is put on increasing the standard of living of the population, maintaining a balance between the different sectors, and monitoring the region\'s environmental situation to prevent the settlement from declining and going bankrupt. ', 'S', 221, 0, NULL, NULL),
(8, 'Adobe Photoshop', '19th February, 1990', 'Adobe Photoshop is a raster graphics editor developed and published by Adobe Inc. for Windows and macOS. It was originally created in 1988 by Thomas and John Knoll. Since then, this software has become the industry standard not only in raster graphics editing, but in digital art as a whole.', 'A', 222, 0, NULL, NULL),
(11, 'Contra / Probotector', '20th February, 1987', 'Contra was released for the Nintendo Entertainment System in North America in February 1988. This version was produced in-house by Konami and features several differences from the arcade release in order to better suit the NES\'s hardware. For example, sprites for effects (like explosions) are shown at 30fps instead of 60fps to work around the sprite limitations of the system. Another game to use this technique is Recca. The Famicom version contains cutscenes, an additional music track, and environment effects which were removed from the NES version.\r\nA modified version of Contra was released for the PAL region under the name Probotector on December 28, 1990. This version redesigns the human protagonists and some of the enemy characters to give them a robotic appearance.', 'C', 223, 0, 4.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1vwz.jpg'),
(11, 'Pac-Man', '1985', 'Pac-Man is a maze arcade game developed and released by Namco in 1980. The player controls Pac-Man, who must eat all the dots inside an enclosed maze while avoiding four colored ghosts. Eating large flashing dots called power pellets causes the ghosts to turn blue, allowing Pac-Man to eat them for bonus points.\r\n\r\nNamco later produced versions for the Nintendo Entertainment System, Game Boy, Game Boy Color, Game Gear, and Neo Geo Pocket Color. Namco ported the game to the Famicom in 1985, but, as they had no North American operations at this time, they had to license Atari—under the Tengen name—to release certain Namco Famicom games for US audiences. The Atari release of Pac-Man was initially a licensed Nintendo cartridge in a standard gray shell, but soon afterward Atari began manufacturing unauthorized clones of the NES lockout chip and produced unlicensed NES cartridges in black shells, including Pac-Man. Nintendo eventually discovered this ruse and filed a lawsuit against Atari. In 1993, Namco released Pac-Man for the NES itself, so there are three different North American releases of the NES Pac-Man—the Atari gray cartridge, the Atari black cartridge, and the Namco version—differing only in the copyright notices on the title screen.', 'P', 224, 0, 4.1, NULL),
(11, 'Super Mario Bros.', '13th September, 1985', 'Super Mario Bros. is a platform video game developed and published by Nintendo. The successor to the 1983 arcade game, Mario Bros., it was released in Japan in 1985 for the Famicom, and in North America and Europe for the Nintendo Entertainment System (NES) in 1985 and 1987 respectively. Players control Mario, or his brother Luigi in the multiplayer mode, as they travel the Mushroom Kingdom to rescue Princess Toadstool from Bowser. They must traverse side-scrolling stages while avoiding hazards such as enemies and pits with the aid of power-ups such as the Super Mushroom, Fire Flower, and Starman.', 'S', 225, 0, 4.2, 'https://images.igdb.com/igdb/image/upload/t_cover_big/co1wor.jpg'),
(11, 'Super Mario Bros. 2', '9th October, 1988', 'Super Mario Bros. 2 is a platform game developed and published by Nintendo for the Nintendo Entertainment System. The game was first released in North America in October 1988, and in the PAL region the following year. It has been remade or re-released for several video game consoles.', 'S', 226, 0, 3.85, 'https://images.igdb.com/igdb/image/upload/t_cover_big/co1wos.jpg'),
(11, 'Super Mario Bros. 3', '23rd October, 1988', 'Super Mario Bros. 3 is a platform video game developed and published by Nintendo for the Nintendo Entertainment System (NES). It was released in Japan on October 23, 1988, and in North America on February 12, 1990. It was developed by Nintendo Entertainment Analysis and Development, led by Shigeru Miyamoto and Takashi Tezuka.\r\n\r\nPlayers control plumbers Mario or Luigi, who must save Princess Toadstool and the rulers of seven different kingdoms from the antagonist Bowser. As in previous Mario games, they defeat enemies by stomping them or using items that bestow magical powers; they also have new abilities, including flight or sliding down slopes. Super Mario Bros. 3 introduces many elements that became Mario series staples, such as Bowser\'s children (the Koopalings) and a world map to transition between levels.', 'S', 227, 0, 4.5, 'https://images.igdb.com/igdb/image/upload/t_cover_big/co1nyx.jpg'),
(37, 'Robots', '4th February, 2005', 'Robots is a platform video game released in 2005 by Eurocom to coincide with the film of the same name.\r\n\r\nA robot named Rodney Copperbottom decides to leave his home at Rivet Town and head to Robot City to realize his dream of working for his childhood hero, Bigweld. He makes a flying robot called Wonderbot out of scrap before he leaves. At the city, he goes to Bigweld\'s factory, but realizes that Bigweld is mysteriously absent, and finds out that the factory is currently being run by a robot by the name of Phineas T. Ratchet, who hatches an evil plan to create more futuristic robots like himself and destroying old robots made out of scrap. Rodney also meets a gang of colorful outmodes called the Rusties, who are also affected from the change Ratchet has made. A robot named Jack Hammer tells Rodney that there are many scrap parts in the sewers of Robot City and that Rodney can go collect the scrap in order to keep the Rusties alive. After doing so, Rodney and the Rusties go to Bigweld\'s Mansion to find Bigweld. Bigweld agrees to help Rodney and the Rusties, and sets off with Rodney to stop Ratchet and save all robot-kind.', 'R', 228, 0, NULL, NULL),
(11, '\'89 Dennou Kyuusei Uranai', '10th January, 1989', '\'89 Dennou Kyuusei Uranai is one of those horoscope sims that used to be very popular in Japan in the early days of home consoles. They still exist today, but they tend to be extended to more interactive dating sims rather than just walls of text to read. \n \nThis game being released in December 1988 and namely so, it was designed to predict your fortune for the upcoming year 1989. This makes attempting to play it already kind of useless once the year had passed. Therefore one can only look back at what the computer predicted for you back in 1989.', '#', 229, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rffpch6vj4e45rqvbni7.jpg'),
(11, '10-Yard Fight', '1st December, 1983', 'The game is viewed in a top-down perspective and is vertical scrolling. The player does not select plays for either offense or defense. On offense, the player simply receives the ball upon the snap and either attempt to run with the quarterback, toss the ball to a running back, or throw the ball to the one long distance receiver - basically the option offense. On defense, the player chooses one of two players to control, and the computer manipulates the others. The ball can also be punted or a field goal can be attempted.\n\n10-Yard Fight has five levels of difficulty; from easiest to most difficult: high school, college, professional, playoff, and Super Bowl. If the player wins both halves of an &quot;accelerated real time&quot; 30-minute half at an easier level, the player advanced to the next level of difficulty, like a career mode.', '#', 230, 0, 2.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z6xrk4qkqerfdrvsgkin.jpg'),
(11, '1942', '1st December, 1984', '1942 is a vertically scrolling shoot \'em up made by Capcom that was released for the arcade in 1984. The goal is to reach Tokyo and destroy the entire Japanese air fleet. The player pilots a plane dubbed the &quot;Super Ace&quot; . The player has to shoot down enemy planes; to avoid enemy fire, the player can perform a roll or &quot;loop-the-loop&quot;. During the game the player may collect a series of power-ups, one of them allowing the plane to be escorted by two other smaller fighters in a Tip Tow formation.', '#', 231, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1w4l.jpg'),
(11, '1943: The Battle of Midway', '1st June, 1987', 'The game is set in the Pacific theater of World War II, off the coast of the Midway Atoll. The goal is to attack the Japanese Air Fleet that bombed the players\' American Aircraft Carrier, pursue all Japanese Air and Sea forces, fly through the 16 levels of play, make their way to the Japanese battleship Yamato and destroy her. 11 Levels consist of an Air-to-Sea battle (with a huge battleship or an aircraft carrier as an End-Level Boss), while 5 levels consist of an all-aerial battle against a squadron of Japanese Bombers and a Mother Bomber that needs to be destroyed. \n \nAs in 1942, players pilot a P-38. Two buttons are used: one for regular attacks (with several weapons) and one for special actions that executes either a loop like in 1942 or one of three special attacks that damage the plane. Unlike 1942, the player only has one life, with one refillable energy meter. Destroying a complete formation of red enemy planes will result in a power-up, such as a health boost or a temporary special weapons which replaces the default twin gun.', '#', 232, 0, 2.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm0.jpg'),
(11, '1991 Du Ma Racing', '31st December, 1991', '1991 Du Ma Racing is an unlicensed horse racing game for the NES that was developed by Idea-Tek and published by Super Mega. The game offers two game modes. \n \nIn race mode, two players can compete in a race. By pressing a button at the right time, they can build up their horse\'s power, then press another button to release it and give their horse an edge in the race. The player who does this faster and more accurately will have a better chance of winning the race. \n \nIn gamble mode, 1 to 6 players start out with 500 credits to place bets on 5 horses. The race will be simulated without any player interaction, and at the end of each race event players will get their respective prize money. The goal is to earn more money this way than any other player.', '#', 233, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mjvv0vaebrpmibo3km6i.jpg'),
(11, 'Street Fighter 2010: The Final Fight', '8th August, 1990', 'Conquer a galaxy with your bare hands! Twenty-five years ago you ruled in the world of the street fighter. Since then you and your partner have created a formula that turns men into supermen. Your partner is dead, the formula has been stolen, and you\'re out for revenge. You use your serum to transform into the most powerful man in the galaxy. You\'ll cross the stars in search of the killers that changed your life forever. With your newfound strength and your old street fighter training, you can\'t wait for your final fight! Teleport across the galaxy in this action/adventure game for the NES! Detailed graphics bring you all the excitement of countless worlds!', 'S', 234, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1yd0.jpg'),
(11, '3-D WorldRunner', '12th October, 1987', 'The battle of a lifetime comes alive in 3-D! The wildest of the space cowboys is out looking for adventure. Now he\'s got it and he needs your help. A strange world terrorized by Grax, the Alien Serpentbeast, has asked you, Worldrunner, for help. Knowing you can outrun, outjump and outblast anyone or anything, you race into battle. But this is no ordinary fight. These battles will carry you to eight strange planets filled with bottomless pits, shooting stars, and poisonous aliens, all sworn to defend their Serpent King. And each new world is ruled by an Alien Serpentbeast more terrifying and more powerful than anything you\'ve ever seen before. Are you ready, Worldrunner? They\'re waiting for you!', '#', 235, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/baeltds6neojwfrmcqq1.jpg'),
(11, '720 Degrees', '1st December, 1986', '720 Degrees is a 1986 arcade game by Atari Games. 720Â°, a skateboarding game, is notable in that along with BMX Simulator, it is one of the first extreme sports video games, and has a unique timed structure that requires the player score points in order to keep the game going.', '#', 236, 0, 1.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qly.jpg'),
(11, '8 Eyes', '27th September, 1988', 'CONTROL MAN AND BIRD IN A FIGHT FOR THE EIGHT JEWELS OF POWER! \n \nAfter hundreds of years of chaos, mankind has finally emerged from the ruins of nuclear war. This world of the distant future has once again fluorished under the guidance of the Great King, who harnessed the power of the 8 Eyes to rebuild the planet. \n \nThese strange jewels of power were formed at the eyes, or centers, of the eight nuclear explosions which nearly destroyed the Earth. In the wrong hands, the 8 Eyes could cause untold destruction...And now, they have been seized by the Great King\'s eight Dukes, in a desperate bid to gain control of the world for themselves. They have banished the King to the nuclear wastelands, and already their squabbling threatens to plunge the world into war once again! \n \nThe task of retrieving the 8 Eyes falls to you, Orin the Falconer, the bravest and mightiest of the King\'s Guardsmen. With your fighting falcon, Cutrus, you must penetrate each of the eight Dukes\' castles. There you will face the Dukes\' soldiers, and battle strange nuclear mutants such as living skeletons, giant wasps, and mud men. You must defeat the monstrous Boss of each castle to retrieve the Jewel of Power he guards. \n \nThen, to complete your quest, return the 8 Eyes to the Altar of Peace to await the return on the Great King, so that he may finish the rebuilding of Earth. Your reward will be the the eternal gratitude of all mankind!', '#', 237, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmb.jpg'),
(11, 'Aa Yakyuu Jinsei Icchokusen', '25th January, 1993', 'Aa Yakyuu Jinsei Icchokusen is a board game. The title translates to &quot;Straight Baseball Life&quot;. Players assume the role of a small child who goes through the ranks and eventually becomes a professional baseball player if the player is successful.', 'A', 238, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hcass4vx9njpkhwfsgps.jpg'),
(11, 'Abadox: The Deadly Inner War', '6th April, 1988', 'In the year 5012, the planet known as Abadox is soon eaten by a giant alien organism known as Parasitis. Once the planet has been consumed, the alien takes the form of the entire planet and seeks to devour other planets within the galaxy. The galactic military tries to fight the alien, but to no avail as Parasitis destroys the entire galactic military, except for one hospital ship. It is then discovered that Princess Maria has been devoured as well. The galactic military decides to send out their best fighter, &quot;Second Lieutenant Nazal&quot;, to attempt to enter Parasitis\' body and rescue Princess Maria before it\'s too late.', 'A', 239, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm1.jpg'),
(11, 'Zombie Nation', '14th December, 1990', '1999. What appeared to be a harmless meteorite crashing in the Nevada desert has turned out to be Darc Seed, an evil alien creature with horrible powers. By shooting strange magnetic rays, Darc Seed had turned the helpless nation into zombies and had brought the Statue of Liberty to life to do his dirty work. These rays had also given him control over many deadly weapons, but none were more powerful than the legendary samurai sword, Shura. When the great head of the samurai, Namakubi, heard that the sword had fallen into evil hands, he set off immediately for the United States. For only he possessed the strength and knowledge needed to recapture the magical sword and free the U.S. from the evil clutches of Darc Seed.', 'Z', 240, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1r5t.jpg'),
(11, 'Action 52', '31st December, 1991', 'Get 52 &quot;New and Original&quot; exciting games for play on your Nintendo System. Try to get Billy Bob out of the Dungeon where he is imprisoned, to save MARYLOU. Go along with the ACTION GAMEMASTER as he changes into one of the fearsome CHEETAHMEN to try to defeat all of the ACTION 52 evil attackers. These two games plus an additional 50 games on this one &quot;Multi-GamePak&quot; will keep you entertained for a long time.', 'A', 241, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1htt.jpg'),
(11, 'S.C.A.T.: Special Cybernetic Attack Team', '1st February, 1990', 'It\'s the year 2029 and humanity faces certain extinction! An alien force led by the Supreme Commander Vile Malmort is positioned to destroy the earth. \nThe President had little time to act. He assembled the greatest scientists from around the globe to stop this menace. From their laboratory came mankind\'s last hope - the members of S.C.A.T. \nThe Special Cybernetic Attack Team has one goal: the utter destruction of the alien fleet. &quot;They\'ve sent an armada to conquer us. We\'ve sent two warriors from S.C.A.T... It should be a fair fight.&quot;', 'S', 242, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m5hpqn1mki1xqmj02dft.jpg'),
(11, 'The Addams Family', '31st December, 1992', 'A tie-in to the movie, players take control of Addams Family\'s lawyer, Tully Alford, as he ventures into the Addams Residence to find their family vault.', 'T', 243, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hdidqbl2vlkysp1b5c6d.jpg'),
(11, 'The Addams Family: Pugsley\'s Scavenger Hunt', '1st February, 1993', 'As if things weren\'t ooky enough! Wednesday has devised a simply torturous game which will drive her darling wretched brother, Pugsley, to happiness. How absolutely delicious! She has hidden six wonderfully strange items somewhere about the Addams Family Mansion. Now, you must guide poor Pugsley on his quest to uncover them. \n \nTraps, traps, traps you say! Well, yes. What else would add so much lovely horror to this unnaturally delightful fun? Little Wednesday has made sure this adventure will be a doom-filled doozie. There are hidden switches all about, which produce the loveliest blood-curdling effects when Pugsley runs into them. And letâ€™s not forget all the money that Pugsley will be able to gather on his way. Thereâ€™s even magic money which will have an extra lively effect you wonâ€™t want to miss. So get ready to get spooky, and get set to get kookyâ€¦ itâ€™s Pugsleyâ€™s Scavenger Hunt! En garde!', 'T', 244, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mpsgaihfvcrly1uesgz6.jpg'),
(11, 'Fester\'s Quest', '1st October, 1989', 'It\'s just a kidnapping. Of an entire day. By an alien UFO! Will Fester sit still for this? The quest begins. For starters, take on slime replicators, skeeters, globules and giant scorpions. Your health is at stake, not to mention your life! Will you whip the Alien Bosses or will they whip you? Lucky for you, this is a family affair. And what a family! Find your way to Thing and help is right at hand. In trouble? Just ring for Lurch. He\'ll give those aliens trouble with a capital &quot;L&quot;. The fate of the whole city is in your hands, and we\'ve saved the worst for last!', 'F', 245, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/g58jt3fotv1eze2fbrkp.jpg'),
(11, 'Advanced Dungeons &amp; Dragons: Dragons of flame', '31st December, 1989', 'This game is a sequel to Heroes of the Lance. It is arcade oriented, with RPG elements. The player utilizes both a top-down view of map travelling, as well as side-view scrolling combat.', 'A', 246, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm2.jpg'),
(11, 'Advanced Dungeons &amp; Dragons: DragonStrike', '1st August, 1992', 'The game is set in Krynn, world of the Dragonlance saga, during the War of the Lance. DragonStrike combined elements of computer role-playing games and flight simulators. The player character is a knight who flies on the back of a metallic dragon equipped with a lance and various magic items (among other things a magic orb that acts as a radar in the game).', 'A', 247, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmd.jpg'),
(11, 'Advanced Dungeons &amp; Dragons: Heroes of the Lance', '31st December, 1988', 'Heroes of the Lance is a side-scrolling action game. The game used actual Dungeons &amp; Dragons statistics, with statistics for the characters exactly as they were in the rule books. Eight heroes from the Dragonlance novels series must be assembled for the quest, and only one is visible on the screen at a time; when one on-screen hero dies, the next in line appears.', 'A', 248, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qme.jpg'),
(11, 'Advanced Dungeons &amp; Dragons: Hillsfar', '31st December, 1989', 'Hillsfar is a role-playing video game released for MS-DOS, Amiga, Atari ST, Commodore 64 in 1989, and NES in 1993. It features a combination of real-time action and randomly generated quests. It also includes standard gameplay elements of the Advanced Dungeons &amp; Dragons fantasy role-playing game, upon which the game is based.', 'A', 249, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xub.jpg'),
(11, 'Advanced Dungeons &amp; Dragons: Pool of Radiance', '1st October, 1988', 'Pool of Radiance was the first adaptation of TSR\'s Advanced Dungeons &amp; Dragons (AD&amp;D or D&amp;D) fantasy role-playing game for home computers, becoming the first episode in a four-part series of D&amp;D computer adventure games. The player starts by building a party of up to six characters, deciding the race, sex, class and ability scores for each.', 'A', 250, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/catzshgsd4ggwyo96goi.jpg'),
(11, 'Adventure Island III', '30th July, 1992', 'Adventure Island is a side-scrolling platform game published by Hudson Soft that was originally released for the Nintendo Entertainment System in 1992. It is the third game in the Adventure Island released for the NES, following Adventure Island II.', 'A', 251, 0, 3.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmc.jpg'),
(11, 'Adventure Island II', '31st December, 1991', 'Adventure Island II is a side-scrolling platform game developed by Now Production and published by Hudson Soft that was released for the Nintendo Entertainment System in 1991. It is the sequel to Adventure Island and the second game in the series for the NES. While the first game was an adaptation of Westone\'s Wonder Boy arcade game, Adventure Island II is an entirely original work, as were all the subsequent Adventure Island games.', 'A', 252, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm5.jpg'),
(11, 'Adventures in the Magic Kingdom', '1st June, 1990', 'Adventures in the Magic Kingdom is a game developed by Capcon where the player explores various rides in Disney theme parks. The player must complete five different stages, modeled after rides, as well as a trivia quest in order to retrieve the set of keys. Players choose which stage to play by walking around the park in the game\'s overworld map.', 'A', 253, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm7.jpg'),
(11, 'The Adventures of Bayou Billy', '12th August, 1988', 'The Adventures of Bayou Billy is an action game released by Konami for the Nintendo Entertainment System in North America in 1989. It is a revised version of the 1988 Family Computer game Mad City. The game employs various play styles that were popular at the time such as beat-\'em-up, gun shooting and racing. The majority of the game follows a beat-\'em-up format in which the player character (Billy) must engage in hand-to-hand combat against every enemy he encounters in order proceed from one area to the next until reaching the end of each stage before his health runs out. Billy\'s basic attacks consists of a punch, a kick and a jump kick performed by pressing the A and B buttons simultaneously. The player can also arm Billy with one of three melee weapons dropped by certain enemies: a throwing knife, a club and a whip.', 'T', 254, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dv8mcrdfgfjastskigzr.jpg'),
(11, 'Adventures of Dino Riki', '10th February, 1987', 'Adventures of Dino Riki is an overhead shooter created by Hudson Soft, similar to games like 1943: The Battle of Midway, where the object is to dodge on-screen enemies. Dino Riki can jump or shoot weapons (rocks, axes, boomerangs, and torches) to kill the various enemies around him. Dino Riki can pick up power-ups including speed boosts and wings that enable him to fly over hazards on the ground, as well as weapon upgrades.', 'A', 255, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm8.jpg'),
(11, 'The Adventures of Gilligan\'s Island', '1st July, 1990', 'The Adventures of Gilligan\'s Island is a game developed by Bandai for the Nintendo Entertainment System, based off of the famous 1960s sitcom &quot;Gilligan\'s Island&quot;. The player controls Skipper, who is followed around by the computer-controlled Gilligan.', 'T', 256, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qsip9h0nyqc40pwc1g9f.jpg'),
(11, 'Adventures of Lolo', '20th April, 1989', 'Adventures of Lolo is a puzzle game released in 1989 by HAL Corporation for the Nintendo Entertainment System. It is based on the Japanese Eggerland video game series.', 'A', 257, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm9.jpg'),
(11, 'Adventures of Lolo 2', '6th January, 1990', 'Our hero Lolo has charmed and enchanted puzzle-loving game players around the world with his unfailing courage and plucky persistence - and now he\'s off for his second quest! \n \nJoin forces with Lolo and his faithful sidekick Lala for another journey full of puzzles and pitfalls. The whole crew is back - Snakey, Leeper, Medusa, Gol, Don Medusa, Rocky, and of course our favorite, Alma. \nImproved graphics, increased difficulty, and a few new tricks and techniques will keep you guessing through every fun-filled moment. A game for mental giants of all ages!', 'A', 258, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f8pc8jncvjvynyxnun51.jpg'),
(11, 'Adventures of Lolo 3', '26th December, 1990', 'The journey continues! The game preferred by the best and the brightest is back with a brand new installment. See if you qualify! \n \nSeventeen levels, one hundred rooms. Play as either Lolo or Lala. Underwater levels with new challenges. Lolo\'s Grandpa teaches you the tricks of the game. New tactics, techniques and characters.', 'A', 259, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qma.jpg'),
(11, 'The Adventures of Rad Gravity', '1st December, 1990', 'The Adventures of Rad Gravity is a video game for the Nintendo Entertainment System developed by Interplay and published by Activision in 1990. The game is a platformer with a wacky storyline in which the eponymous main character explored multiple planets and fought enemies while jumping through levels. The game was notable for the planet Turvia, where gravity works in reverse. In that level the protagonist was drawn upside down, as were the enemies and the entire screen. The main character has a comically large head and strongly resembles actor Bruce Campbell. His early game attack consists of a sort of a lightsaber.', 'T', 260, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rhpiqskwmsgnndzb7dop.jpg'),
(11, 'The Adventures of Rocky and Bullwinkle and Friends', '31st December, 1992', 'The Adventures of Rocky and Bullwinkle and Friends was a game released for the Nintendo Entertainment System based after the famous Rocky and Bullwinkle show. It was a platform game that took the player through seven different levels, as well as a number of mini-games.', 'T', 261, 0, 2.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ks1dsixjziqlmrlwaty3.jpg'),
(11, 'Adventures of Tom Sawyer', '1st February, 1989', 'Tom Sawyer\'s famous literary exploits come to life in this adventure where you play Tom Sawyer (or Huck Finn in a 2 player game). The adventure begins in Tom\'s dream while he sleeps in school. \n \nControl in this typical platform game consists of jumping and throwing rocks. Avoid many obstacles such as rolling barrels; defeat persistent enemies such as pirates, mice, and even a giant octopus. Help Tom navigate down the Mississippi River, through forests, haunted houses, and the sky above.', 'A', 262, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yt4oe4lalcyhco6hpj26.jpg'),
(11, 'After Burner II', '31st December, 1987', 'After Burner II is an arcade-style flight game released by Sega in 1987. It is the second game in the After Burner series. In the game, players fly a F-14 Tomcat jet fighter, gunning down enemies while avoiding incoming fire.', 'A', 263, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mxidfojppnsodzj03bnv.jpg'),
(11, 'Ai Sensei No Oshiete: Watashi No Hoshi', '26th April, 1993', 'Ai Sensei No Oshiete: Watashi No Hoshi is a horoscope simulation game that heavily revolves around the love thematics of fortune-telling. The title roughly translates as Love Teacher Oshiete: My Star, which suggests the game focuses on the astrological aspects of fortune-telling and horoscopes.', 'A', 264, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dqqvqbl5rrpdr9tcgxmb.jpg'),
(11, 'Air Fortress', '17th August, 1987', 'Air Fortress is a video game published in Japan for the Nintendo Entertainment System released in Japan in 1987 and later in North America in 1989. Only a total of 385 copies of the game were shipped to the United States in 1987, and it is believed that only 20 were shipped beforehand as a test run for the system. Within PAL-A regions, it was only released in Australia. This makes the American version of the game very rare.', 'A', 265, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmf.jpg'),
(11, 'Airwolf', '24th December, 1988', 'Airwolf was originally designed as an Arcade game, based loosely on the television series of the same name. It was later released for the Nintendo Entertainment System.', 'A', 266, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qms.jpg'),
(11, 'Akagawa Jirou no Yuurei Ressha', '8th March, 1991', 'Akagawa Jirou no Yuurei Ressha is an Adventure game, developed by Mighty Craft and published by King Records, which was released in Japan in 1991.', 'A', 267, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/exnwrs8ngfgpagwczvk1.jpg'),
(11, 'Uninvited', '31st December, 1986', 'What a pity about your automobile. And your sister, she came to our mansion for help. But now, I\'m afraid she desperately needs yours! Welcome to our humble abode... I regret you\'ll have to carry on your search alone. It seems we\'re down to a skeleton staff. Oh my! Is that your sister screaming? I hope you\'re not too late to save her. Horrors! It\'s becoming grotesquely obvious why all our guests feel so... Uninvited!', 'U', 268, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/h3ymgelvnnt7hgwysncb.jpg'),
(11, 'Akuma-kun: Makai no Wana', '24th March, 1990', 'Akuma-kun: Makai no Wana is a Role-Playing game, developed by TOSE and published by Bandai, which was released in Japan in 1990.', 'A', 269, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xqwy0wp6uv37sfvjilvk.jpg'),
(11, 'Akumajou Special: Boku Dracula-kun', '18th November, 1990', 'The self-proclaimed Demon King, Kid Dracula, has awoken from a long sleep, only to discover that the demon Galamoth has challenged him. Swiping his father\'s cape, it is then up to Kid Dracula to set out on an adventure to destroy the monster, and retake his throne. After battling through dangers and demons, Kid Dracula defeats Galamoth. This causes him to become famous throughout the land, with all the monsters in Transylvania showing up at his castle wanting to be his friend.', 'A', 270, 0, 2.5, ''),
(11, 'Al Unser Jr.\'s Turbo Racing', '31st January, 1989', 'Al Unser Jr.\'s Turbo Racing is a racing video game for the Nintendo Entertainment System console released in 1990. It is an adaptation of the 1989 Japanese-market Famicom game World Grand Prix - Pole to Finish, with the most notable changes being the addition of Unser as an in-game coach, the number of laps, sound and interface design. This game features a season mode and two time trial modes.', 'A', 271, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xun0skqqmz9wby2ywdyv.jpg'),
(11, 'Disney\'s Aladdin', '21st November, 1993', 'Disney\'s Aladdin is a 1993 video game developed by Capcom for the Super Nintendo Entertainment System (SNES). Based on the film of the same name, Disney\'s Aladdin is a 2D side-scrolling video game in which the player characters are Aladdin and his monkey Abu. The game was released in November 1993, the same month that another game with the same title was released by Virgin Games for Sega Genesis. The two games vary in several respects, including the fact that Aladdin carries a sword in the Virgin game but does not in the Capcom game, a fact that Shinji Mikami, the Capcom game\'s designer, said made the Virgin game better. The Capcom game was ported to Game Boy Advance (GBA) on March 19, 2004.', 'D', 272, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wcj.jpg'),
(11, 'Alfred Chicken', '31st December, 1993', 'Alfred Chicken is a side-scrolling adventure game created by Twilight for a number of different platforms, including the Nintendo Entertainment System, the Amiga, and Gameboy. It has since been redeveloped and released on the Playstation.', 'A', 273, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmh.jpg'),
(11, 'Alien ³', '31st December, 1992', 'AlienÂ³ was released after the Alien 3 film. After success on the Super Nintendo and Genesis platforms, the game was built and ported to other systems, including the Commodore 64 and Game Gear. The game is set on the world of the film, Fury 161, but the gameplay has more in common with the film Aliens, throwing wave after wave of enemies at the player.', 'A', 274, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmq.jpg'),
(11, 'Alien Syndrome', '31st December, 1986', 'The time bomb is set. \n \nIt\'s the only sure way to get rid of these aliens. For good. \n \nThey\'re vile. Vicious. And villainous. \n \nAnd they\'ve infested our outcolony. \n \nThey\'re holding hundreds of inhabitants hostage. Some of them your friends. \n \nSo get in there. And get blasting. \n \nInside, you\'ll find state-of-the-art weaponry. It\'s yours for the taking. \n \nThere\'s sector after sector to purge. Each more intricate than the one before it. \n \nAnd there are Super Aliens to confront. Each more hideous than the one before it. \n \nGet the hostages out. And get as many aliens as you can. Before the blast gets all of you.', 'A', 275, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmr.jpg'),
(11, 'All-Pro Basketball', '1st January, 1990', 'All-Pro Basketball is a Nintendo Entertainment System game that simulated the game of basketball. The player could choose between eight different teams, completing individual matches. No seasonal play was available. The game was developed by Aicom.', 'A', 276, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s1l8xlyp8bxluntedkqr.jpg'),
(11, 'Alpha Mission', '1st November, 1985', 'Alpha Mission was developed by SNK and G1M2 for the Famicom and Nintendo Entertainment System after success as an Arcade installation. It is a vertical scrolling shooter that has similarities to Xevious, with the use of air-to-air and air-to-ground weapons.', 'A', 277, 0, 3.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/chk0xw2zdqmsamtjgkrn.jpg'),
(11, 'Amagon', '2nd December, 1988', 'Amagon is a Nintendo Entertainment System platform side-scroller developed by Aicom in 1988. It was subject to a high level of criticism, and never reached a high level of recognition among game critics.', 'A', 278, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mc8dxvq7qxnliirc7z17.jpg'),
(11, 'America Daitouryou Senkyo: United State Presidental Race', '27th November, 1988', 'America Daitouryou Senkyo: United State Presidental Race is a Strategy game, developed and published by Hect, which was released in Japan in 1988.', 'A', 279, 0, 2.5, ''),
(11, 'America Oudan Ultra Quiz: Shijou Saidai no Tatakai', '29th December, 1991', 'America Oudan Ultra Quiz: Shijou Saidai no Tatakai is a Miscellaneous game, developed by Pixel and published by Tomy Corporation, which was released in Japan in 1991.', 'A', 280, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dxmwm6gdk7m0itzy56s6.jpg'),
(11, 'American Dream', '23rd October, 1989', 'The player must earn money in order to become the wealthiest gambler in the world. The game, set in New York City, is considered a spin-off from the Pachio-kun franchise. Al Capone has a cameo role in this game even though he lived about one thousand miles to the west (Chicago) in real life. \nRoads, taxis and automobiles are not portrayed in the game. However, a black limousine that escorts the player from the air force base to the final casino is portrayed as driving on grass. This is in direct opposition to the real New York City where the majority of the surface is concrete (either as roads, parking lots, or as foundations for the buildings). Only parks and some older residential districts use grass in their design in the real world. Buildings are either shown as dilapidated tenements, shiny towers, or as flashy casinos. \nAn English language translation was made in 2007 by a ROM hacker who goes by the nickname of &quot;Pale Dim.&quot; Using the game\'s upper case letters that resemble the Joystix font, the English translation allows players in English-speaking countries to better understand the game. One of the changes made was to change the explosion sound from the Japanese Bom to the English Boom.', 'A', 281, 0, 2.5, ''),
(11, 'American Gladiators', '31st December, 1991', 'American Gladiators was developed by Incredible Technologies for the Amiga, Sega Mega Drive, Genesis, Super NES, and NES. It is based off of the popular American TV show and allows the player to participate in a number of the typical events that were included in the show.', 'A', 282, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zm8jze3260ndpjnh4q7y.jpg'),
(11, 'Ankoku Shinwa: Yamato Takeru Densetsu', '24th April, 1989', 'The game is based on old Japanese legends about Yamato Takeru, a legendary hero of ancient Japan. The game starts when Yamato Takeru is a thirteen-year-old boy. His father was killed under mysterious circumstances. Searching his things, the boy found a postcard that gave him his first clue for the investigation. From that moment, his adventure begins.', 'A', 283, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u5bepltptulidadstqjo.jpg'),
(11, 'Anticipation', '1st November, 1988', 'Anticipation was marketed as Nintendo\'s &quot;first video board game&quot;, and was developed by Rare for the Nintendo Entertainment System in 1988. It allowed for single player against computer-controlled opponents, as well as multiplayer with support for up to four players.', 'A', 284, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dqvz2moc0a95xexabggb.jpg'),
(11, 'The Magic of Scheherazade', '3rd September, 1987', 'Magic of Scheherazade is a mixture of action- and turn-based combat RPG styles. Wandering through Arabia, you\'ll encounter enemies whom you\'ll fight in real time, using various weapons. You\'ll also be attacked by enemies with whom you\'ll engage in strategic, party-vs.-party combat. You can choose from three character classes: Fighter, Saint, and Magician. Each class has its own special abilities that you\'ll use in battles as well as during your exploration of the game world.', 'T', 285, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/aygiwunplhhxmkkwabju.jpg'),
(11, 'Arch Rivals: A Basketbrawl!', '1st February, 1990', 'The full-court action between the Arch Rivals is really hot tonight. Here\'s Mohawk, taking it to the hoop... POW! He just got nailed in the alley with a right cross! FOUL! FOUL! FOUL! \nWhat?! No Foul? That\'s right. No Fouls. This is basketball where breaking the rules is part of the rules! If you can\'t block a shot - knock your opponent\'s block off. If you can\'t steal the ball - steal his shorts! But don\'t think these tactics are enough to win. Arch Rivals still requires real B-ball skills like passing, shooting, ball handling, slam dunks, and 3 point shots. \nBased on the arcade smash hit, Arch Rivals brings all of its hard-hitting &quot;in your face&quot; action into your home. Whether you\'re going for a fast break, dodging food on the court, or crashing the boards \'til they shatter, Arch Rivals isn\'t just basketball... it\'s a basketbrawl!', 'A', 286, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmi.jpg'),
(11, 'Archon', '31st December, 1983', 'Archon: The Light and the Dark was a game developed by Free Fall Associates which loosely modeled the game of Chess, with a number of additions to the gameplay. It was programmed by Anne Westfall, and released originally for Atari 8-bit computers in 1983. It was quickly ported to a number of different systems, and was well-received.', 'A', 287, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmg.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Arctic', '31st December, 1989', 'Arctic is an action puzzle game that describes itself as &quot;active rail playing&quot;. Each of more than two-dozen stages consists of a set of rails in various arrangements, often looping around each other and splitting in various directions. Each stage contains a number of colored balls which begin in corresponding slots, and after launching them the goal is to return the balls to the matching-colored slots. The only interaction the player has with the board is switching two sets of splits; there are yellow and blue splits, which will redirect any balls moving through them, and the player can only turn all of one color as a group. Many stages also contain bumpers and gates which will affect the speed and direction of the balls. Completing a puzzle often requires strategic use of the stage\'s features to bounce balls onto the correct paths.', 'A', 288, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zq3hwn8rflhuvcg7tudq.jpg'),
(11, 'Arkanoid', '1st December, 1986', 'Arkanoid (ã‚¢ãƒ«ã‚«ãƒŽã‚¤ãƒ‰ Arukanoido) is an arcade game developed by Taito in 1986. It expanded upon Atari\'s Breakout games of the 1970s by adding power-ups, different types of bricks, and a variety of level layouts. The title refers to a doomed &quot;mothership&quot; from which the player\'s ship, the Vaus, escapes.', 'A', 289, 0, 4.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmj.jpg'),
(11, 'Arkanoid: Revenge of Doh', '1st June, 1987', 'Arkanoid - Revenge of Doh (a.k.a. Arkanoid 2) is an arcade game released by Taito in 1987 as a sequel to Arkanoid. \n \nThe mysterious enemy known as DOH has returned to seek vengeance on the Vaus space vessel. The player must once again take control of the Vaus (paddle) and overcome many challenges in order to destroy DOH once and for all. Revenge of Doh sees the player battle through 34 rounds, taken from a grand total of 64. \n \nNEW FEATURES: \nRevenge of Doh differs from its predecessor with the introduction of &quot;Warp Gates&quot;. Upon completion of a level or when the Break (&quot;B&quot;) pill is caught, two gates appear at the bottom of the play area, on either side. The player can choose to go through either one of the gates - the choice will affect which version of the next level is provided. The fire-button is only used when the Laser Cannons (&quot;L&quot;) or Catch (&quot;C&quot;) pill is caught. \n \nThe game also features two new features for bricks. Notched silver bricks, like normal silver bricks, take several hits to destroy. However, after a short period of time after destruction, they regenerate at full strength. Fortunately, clearing a level does not require that any notched bricks be destroyed. Also, some bricks move from side to side as long as their left and/or right sides are not obstructed by other bricks. \n \nThe US version features an entirely different layout for Level 1 that feature an entire line of notched bricks, with all colored bricks above it moving from side to side. \n \nThe game features a mini-boss in the form of a giant brain, which will help you practice for DOH. \n \nHome versions of Revenge of DOH also featured a level editor, where players could create their own levels or edit and replace existing levels, with the exception of two levels: the mini-boss and DOH.', 'A', 290, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bt7iov57pv42yzqoswz6.jpg'),
(11, 'Arkista\'s Ring', '1st June, 1990', 'Arkista\'s Ring is a game developed by American Sammy for the Nintendo Entertainment System in 1990. It utilizes the familiar top-down perspective featured in many action-adventure games, such as The Legend of Zelda, Final Fantasy, and Shining Force. What sets it apart is the linear style of the game, as well as the limitation of one primary character. Interestingly, Arkista\'s Ring is an example of an early game with a female protagonist-an elf named Christine. The game is now considered to be a particularly rare NES title.', 'A', 291, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmk.jpg'),
(11, 'Asmik-kun Land', '20th January, 1992', 'Recently, monsters began to invade the peaceful country of the dragons. The only way to stop this invasion is to contact the six Dragon Gods. Unfortunately, those gods seem to be asleep. Asmik-kun must travel all over the world to find six magical splitters, that will help him to awaken the dragons and to defeat the monsters.', 'A', 292, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hsy1tfbsgf1dducclm9x.jpg'),
(11, 'Asterix', '31st December, 1993', 'Asterix was developed by Bit Managers and Infogrames for a number of different consoles. It was based after the comic book series Asterix, which maintained a high level of popularity in Europe, but never took off in North America. For this reason, the game was only released in PAL format, and was never released in North America.', 'A', 293, 0, 3.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/csxctel73oavxy9exblg.jpg'),
(11, 'Astro Fang: Super Machine', '26th November, 1990', 'Astro Fang: Super Machine (ã‚¢ã‚¹ãƒˆãƒ­ãƒ»ãƒ•ã‚¡ãƒ³ã‚° Asutoro Fangu) is a Family Computer video game that was released for an exclusively Japanese market in 1990. \n \nSomewhere in the galaxy lies the planet RS-121 â€“ a desolate planet that has suffered terrible disasters which made life impossible. \n \nOnly one construction still remains on the planet â€“ a highway called the Black Line. It is said than an ancient legend is somehow connected to this highway. Players must knock enemies off the road by using missiles before they can knock him off the same highway. Automobile repair shops can be found where cars can be repaired and re-supplied with much-needed weapons. The playable vehicle resembles a 1982 DeLorean DMC-12 while the unplayable enemy vehicles resemble dune buggies. \n \nThe game has an infinite amount of continues and a meter appears on the bottom left-hand side of the screen to remind how close the player is to achieving the goal.', 'A', 294, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fx2bddhddy2fvo5y6a1e.jpg'),
(11, 'Astro Robo SASA', '9th September, 1985', 'Sasa, is an arcade video game released for the MSX1 in 1984 and later for the Family Computer titled as Astro Robo SASA (ã‚¢ã‚¹ãƒˆãƒ­ãƒ­ãƒœSASA?) in 1985. \n \nThis video game involved obtaining capsules with an \'E\' on them, sometimes suspended by balloons. The main character could only use bullets to propel himself, and when the bullet count reaches 0, the game ends. A player can also lose bullets by colliding with an enemy, the other player, or the other player\'s bullets.', 'A', 295, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hspliwm1s91sftbhpmiz.jpg'),
(11, 'Astyanax', '21st December, 1989', 'The Astyanax, referred to as simply Astyanax in the NES version, is a side-scrolling action-adventure game designed by Aicom for arcades and the Nintendo Entertainment System. Although the plots differ in the two versions, gameplay remains relatively similar. The player has a life gauge, a strength gauge that fills automatically, and a magic gauge for spells. The arcade version incorporated co-operative play, which the NES version did not.', 'A', 296, 0, 3.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qml.jpg'),
(11, 'Athena', '31st December, 1986', 'Athena is a platformer arcade game, also released on a number of consoles. It was developed by SNK for the arcade, and was ported to the NES by Micronics, and a number of other platforms by Ocean Software. The game featured a female protagonist, although explicitly utilizing the female body as a selling-feature for the game.', 'A', 297, 0, 2.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmm.jpg'),
(11, 'Athletic World', '12th November, 1986', 'Athletic World can be regarded as the precursor to popular titles such as Nintendo Fit and Dance Dance Revolution, which utilize pad sensors to track the player\'s movement. Athletic World was developed by Bandai in 1986, and released for the Nintendo System using the Family Fun Fitness pad. It was marketed as a fun way to engage in exercise and physical fitness. The game was originally released in a box that featured the Family Fun Fitness logo. When Nintendo later purchased the rights to the FFF pad, the game was re-released with a different label-featuring the Athletic World name. This has made the original release a collector\'s item, and fairly rare.', 'A', 298, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hojhos9yejt1cga72foz.jpg'),
(11, 'Atlantis no Nazo', '17th April, 1986', 'Several years ago, a gigantic island arose from the southern Atlantic Ocean due to sudden shifts on the Earth\'s surface. Numerous adventurers made their way to the island to investigate, but none of them were able to return home safely. This island was named Atlantis, and nobody approached it out of fear. The game\'s main character is an amateur adventurer named Wynn, who decides to go to the island after learning that his master disappeared on the island over half a year ago. Armed with the special dynamite invented by the master, Wynn heads over to Atlantis all by himself to face an evil emperor who seeks to revive an ancient empire.', 'A', 299, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wsfgdrbti9wog53tmzxt.jpg'),
(11, 'Attack Animal Gakuen', '26th January, 1988', 'Attack Animal Gakuen is an Action game, developed by Scitron &amp; Art and published by Pony Canyon, which was released in Japan in 1987.', 'A', 300, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lmxwhevf2syzwrzytpub.jpg'),
(11, 'Attack of the Killer Tomatoes', '31st December, 1991', 'Attack of the Killer Tomatoes is a platformer game released for the Nintendo Entertainment System, and later ported to the Gameboy. It was developed by Imagineering and based on the children\'s cartoon Attack of the Killer Tomatoes: The Animated Series, which in kind was based off of the movie franchise Attack of the Killer Tomatoes.', 'A', 301, 0, 2.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmn.jpg'),
(11, 'Aussie Rules Footy', '31st December, 1991', 'Aussie Rules Footy was developed by Beam Software as the first Australian Football League simulation game for the NES. It was exclusively released in Australia, and was never released anywhere else in the world. The game allowed for one player and two player in versus.', 'A', 302, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hhsqnfytncqxi48cvzvc.jpg'),
(11, 'Auto-Upturn', '1st February, 1991', 'Auto-Upturn is a Puzzle game, developed and published by Sachen, which was released in Asia in 1991.', 'A', 303, 0, 2.5, ''),
(11, 'Babel no Tou', '18th August, 1986', 'In the beginning, an archaeologist and explorer known as Indiana Borgnine (ã‚¤ãƒ³ãƒ‡ã‚£ãƒ¼ãƒ»ãƒœãƒ¼ã‚°ãƒŠã‚¤ãƒ³?), is in search of the fabled Hanging Gardens of Babylon. After reading some lost scriptures, he determines that the only way to see them is to travel to the very top of the 64-story Tower of Babel. Upon reaching the Tower, he discovers that the only way to access the floors above him are to solve some challenging puzzles involving loose L-shaped blocks that he finds throughout the Tower. To his great surprise, the blocks are capable of balancing very well on top of one another, in order to form staircases.', 'B', 304, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s8vn3nx78lc5s1yogcgt.jpg'),
(11, 'Baby Boomer', '1st February, 1989', 'One day while nobody was looking, Baby Boomer climbed out of his crib and headed into the woods. Little did he realize that while he\'s enjoying this adventurous journey into the unknown, there are many dangers awaiting him! Your job is to use your Zapper to protect Baby Boomer and help him find his way home to his mother. Unlike other Zapper games, you can shoot just about anything you see in Baby Boomer. Some things give extra points, while others give extra lives, open secret passages, control something in another part of the world or clear a safe route for Baby Boomer to follow.', 'B', 305, 0, 2.5, 'http:'),
(11, 'Back to the Future', '20th September, 1989', 'Back to the Future is a Nintendo Entertainment System game developed by Beam Software and loosely modeled after the popular film of the same name. It was followed by a sequel game which covered the second and third films in the Back to the Future movie franchise.', 'B', 306, 0, 1.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmo.jpg'),
(11, 'Back to the Future Part II &amp; III', '1st September, 1990', 'Back to the Future Part II &amp; III is the sequel to the original Back to the Future game, and is based loosely off of the second and third films of the popular Back to the Future movie franchise. The game was developed by Beam Software for the Nintendo Entertainment System. The game was received fairly negatively when released-with many complaining in particular about the game\'s length coupled with lack of a save feature.', 'B', 307, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmp.jpg'),
(11, 'Bad Dudes', '31st December, 1988', 'The game starts in New York City, where President Ronnie (based on former U.S. President Ronald Reagan) has been kidnapped by the nefarious DragonNinja. The intro says: &quot;Rampant ninja related crimes these days... Whitehouse is not the exception...&quot;. As soon as that occurs, a Secret Service agent (who resembles Arnold Schwarzenegger as he appears in The Terminator) asks two street-smart brawlers, named Blade and Striker: &quot;President Ronnie has been kidnapped by the ninjas. Are you a bad enough dude to rescue Ronnie?&quot;, which this quote became an infamous meme and is often lampooned on the Internet. In the Japanese version, however, the words are completely different. After they heard that, the Bad Dudes confirmed it by pursuing the DragonNinja through the city streets, highway, sewers, transport train, forest, cave and into the secret ninja base, in order to save President Ronnie.', 'B', 308, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmt.jpg'),
(11, 'Bad News Baseball', '15th December, 1989', 'Bad News Baseball was developed and published by Tecmo for the Nintendo Entertainment System in 1989, and released in North America in 1990. It followed the rules of baseball for the most part, with the addition of some cartoonish features that made the game more attractive to kids.', 'B', 309, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmu.jpg'),
(11, 'Bad Street Brawler', '31st December, 1987', 'Bad Street Brawler was developed by Beam Software in 1987 for the Amiga, Commodore 64, MS-DOS, and the Nintendo Entertainment System. It was one of two games that were designed for the Power Glove, which was manufactured by Mattel for the Nintendo Entertainment System.', 'B', 310, 0, 2.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rn2zfafosjxmixestl8x.jpg'),
(11, 'Baken Hisshou Gaku: Gate In', '24th June, 1990', 'Baken Hisshou Gaku: Gate In is a Sports game, developed by Graphic Research and published by K Amusement Leasing, which was released in Japan in 1990.', 'B', 311, 0, 2.5, ''),
(11, 'Bakushou!! Ai no Gekijou', '29th January, 1991', 'Bakushou!! Ai no Gekijou (&quot;A Hearty Laugh! Theater of Love&quot;) is a virtual life board game developed and published for the Nintendo Entertainment System by Coconuts Japan Entertainment on Dec 29th, 1990 in Japan. \n \nCapitalizing on the popularity of simulation and dating games from the late eighties, specifically the Bakushou!! Jinsei Gekijou series developed by Taito, this game follows many of the genre\'s tropes from chance rolls dictating life events, to gathering money and physical traits that benefit the player\'s life. Unlike the Jinsei Gekijou series however, Ai no Gekijou opts to focus on teenage life and romance in particular, rather than the wider scope seen in other life-simulation titles.', 'B', 312, 0, 2.5, ''),
(11, 'Bakushou!! Jinsei Gekijou', '17th April, 1989', 'The first game in the Bakushou!! Jinsei Gekijou series and is a four-player NES board game simulation that plays like Milton Bradley\'s The Game of Life. It was only released in Japan on March 17th 1989. \n \nBakushou!! Jinsei Gekijou (&quot;Hearty Laugh! Theater Life&quot;) is the first game in a long-running series developed and published by Taito for the Nintendo Entertainment System in Japan that allows players to live an entire lifetime, moving through various stages of life and accruing as much wealth as possible. It is based on the Jinsei Game, or The Game of Life as it is known in the west. Up to four human players take turns moving around a board by a number of squares as indicated by dice rolls and make various life decisions, or are passively shown events happening to them, which determine their success. \n \nThe game was followed by two sequels for the NES and four for the SNES.', 'B', 313, 0, 2.5, ''),
(11, 'Bakushou!! Jinsei Gekijou 2', '22nd June, 1991', 'Bakushou!! Junsei Gekijou 2 (&quot;A Hearty Laugh! Theater Life 2&quot;) is a virtual life board game developed and published for the Nintendo Entertainment System by Taito on May 22nd, 1991 in Japan. It is the second installment in the Bakushou!! Jinsei Gekijou series and similarly follows the previous game by allowing up to four players to take part and travel around a virtual board through chance rolls, playing out a virtual life in its entirety from childhood to senior citizenship making important decisions along the way. Introduced in this version was the concept of going to prison for crimes, and gambling in a casino.', 'B', 314, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vsugchx2lqkexw7bynhn.jpg'),
(11, 'Bakushou!! Jinsei Gekijou 3', '20th January, 1992', 'Bakushou!! Junei Gekijou 3 (&quot;A Hearty Laugh! Theater Life 3&quot;) is a virtual life board game developed and published for the Nintendo Entertainment System by Taito on December 20th, 1991 in Japan. It is the third installment in the Bakushou!! Jinsei Gekijou series and follows in the same tradition by allowing up to four players to take part and travel around a virtual board through chance rolls, playing out a virtual life in its entirety from childhood to senior citizenship making important decisions along the way.', 'B', 315, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pgkkts7gpsnw9mz2pqjm.jpg'),
(11, 'Ballblazer', '31st December, 1985', 'Ballblazer is a 1984 computer game created by Lucasfilm Games (later LucasArts Entertainment). It was originally released for the Atari 8-bit systems, such as the Atari 800 and the Atari 5200. It was also ported to other popular platforms of the day, such as the Apple II, ZX Spectrum (by Dalali Software Ltd), Amstrad CPC, Commodore 64, Atari 7800, and the NES. The Atari 800 version was called Ballblaster during development - pirated versions of the game went by this name as well.[2] The principal creator and programmer of Ballblazer was David Levine.[3] \n \nIn 1990, LucasArts and Rainbow Arts released a remake and follow-up to this game, called Masterblazer. This game was released for the Amiga, Atari ST, and PC DOS. A similar game inspired by Ballblazer called Space Football: One on One was developed and released by Triffix for the Super NES in 1992. Years later on March 31, 1997, a remake of the original titled Ballblazer Champions was released for the Sony PlayStation.', 'B', 316, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jlsfheamkuhgjudmszae.jpg'),
(11, 'Balloon Fight', '22nd January, 1985', 'Balloon Fight was developed and released by Nintendo, originally for an Arcade cabinet-and shortly after for the Nintendo Entertainment System. It was ported onto numerous other systems, and has more recently been released on the Nintendo Wii U. The game allowed for 1 player and 2 player gameplay, providing cooperative play to get past each stage.', 'B', 317, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmv.jpg'),
(11, 'Baltron', '19th April, 1986', 'Baltron is an Action game, developed by Shouei and published by Toei Animation, which was released in Japan in 1986.', 'B', 318, 0, 2.5, ''),
(11, 'Banana Prince', '20th December, 1991', 'Banana Prince was developed by KID and released in Japan by Takara on December 20, 1991. It was also released in Germany in February 1992, with slightly different graphics and gameshow questions based on the region. It is a single player platform game designed for the Nintendo Entertainment System.', 'B', 319, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ibcuyybswt2pzazyympm.jpg'),
(11, 'Bandai Golf: Challenge Pebble Beach', '1st February, 1989', 'Bandai Golf Challenge Pebble Beach was developed and released by Bandai for the Nintendo Entertainment System in 1989. It is named after the famous California golf course, Pebble Beach-which has since played a prominent roll in a number of golf games, including the Tiger Woods line.', 'B', 320, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmw.jpg'),
(11, 'Bandit Kings of Ancient China', '31st December, 1989', 'Bandit Kings of Ancient China is a turn-based strategy role-playing simulation game developed and published by Koei for MS-Dos, the Amiga, and the Apple II. It was later ported to the Nintendo Entertainment System and a number of other platforms, including a re-release in 1996 on the Sega Saturn and Sony PlayStation. It was well-received at its inception, and was considered to be a significant step forward in the complexity of strategy gaming.', 'B', 321, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gtcfk5lphamt1v5zhjyk.jpg'),
(11, 'Barbie', '31st December, 1991', 'Barbie is a video game developed by Imagineering Inc based after the famous Barbie doll, created by Mattel Inc. It was created specifically as an attempt to entice more girls to play video games, and was one of the very few Nintendo Entertainment System games with girl-oriented themes. It was not a particularly well-received game at the time, but has received some recognition for having some quality puzzles and gameplay style. Others have criticized it for being an example of &quot;pink&quot; software; which refers to software that was designed for male audiences that is re-skinned for female gamers, without taking into account true female gamer preferences.', 'B', 322, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qujyipirakscizwhwvs4.jpg'),
(11, 'Barcode World', '18th January, 1993', 'A strategy game released in Japan on December 18th, 1992. \n \nUsed in conjunction with the Barcode Battler II peripheral, Barcode World made a strategy game out of scanning a large number of Japanese consumer products.', 'B', 323, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tiyjjoluguu7lsskazsk.jpg'),
(11, 'The Bard\'s Tale II: The Destiny Knight', '31st December, 1986', 'When the going gets even tougher... \n \nAnother wolf! Your magic sword cleaves him mid snarl, and he drops in a fur pile at your feet. There\'s a slime ball conjurer just out of reach who\'ll keep summoning these slobbering missiles until your sword arm drops off. Unless you can figure out a way to get at him. \n \nWhen you put Mangar out to pasture, all you really wanted was a bottomless mug and an ace up your sleeve. So what are you doing out here in the gnarly wilderness, knee deep in wolf meat, itching to put an arrow through the Adam\'s apple of some spell caster? \n \nIt must be your destiny. \n \nBetween the six cities lies an immense wilderness. It\'s a mapping challenge never before seen in a fantasy game, and a whole new way to get lost. \n \nA new class of magic user, the Archmage has 8 powerful spells like Heal All, Fanskar\'s Night Lance, and the legendary Mangar\'s Mallet. \n \nThere are 25 different full-color scrolling mazes like Fanskar\'s Castle.', 'T', 324, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u8vqzsdb6gld02vwr4ir.jpg'),
(11, 'Tales of the Unknown: Volume I - The Bard\'s Tale', '31st December, 1985', 'Tales of the Unknown: Volume I, better known as &quot;The Bard\'s Tale&quot;, is an RPG developed by Interplay Productions in 1985 originally for the Apple II. It was quickly ported to numerous other platforms and became widely successful. This was partly because it incorporated unprecedented 3D graphic design, featuring partly animated character portraits and engaging gameplay. It also helped that the game was available on the Commodore 64-the most successful game console at the time, whereas the main competitor-the Ultima series, was not.', 'T', 325, 0, 4.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/naldhheigngcltvfrzy7.jpg'),
(11, 'Barker Bill\'s Trick Shooting', '1st August, 1990', 'Barker Bill\'s Trick Shooting was developed and published by Nintendo for the NES in 1990. It was loosely based on the cartoon show &quot;Barker Bill\'s Cartoon Show&quot;, popular in the 1950s. The game is essentially a shooting gallery taking place in a carnival, utilizing Nintendo\'s Zapper gun. It was relatively successful, but was not regarded as a breakthrough game.', 'B', 326, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ljfjtf3dlz8by7xd6exw.jpg'),
(11, 'Baseball', '7th December, 1983', 'The simply titled game &quot;Baseball&quot; was developed by Nintendo in 1983 for the Nintendo Family Computer, and was one of the very first games released for the Famicon. It was also included as one of the 18 games released for the Nintendo Entertainment System\'s original launch in the United States.', 'B', 327, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oxrhblllicwukcmiwekg.jpg'),
(11, 'Baseball Fighter', '4th August, 1991', 'Baseball Fighter is a Sports game, developed by Graphic Research and published by Vap, which was released in Japan in 1991.', 'B', 328, 0, 2.5, ''),
(11, 'Baseball Simulator 1.000', '27th October, 1989', 'Baseball Simulator 1.000 was made by Culture Brain exclusively for the Nintendo Entertainment System. Released in 1989, it was praised by Electronic Gaming Monthly as the &quot;Best Sports-Themed Video Game&quot; of 1989. This was largely due to some unique gameplay features that helped it to set itself apart from the many other baseball games released.', 'B', 329, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/n1sjci2oyjwg5okhnyxp.jpg'),
(11, 'Baseball Stars', '19th May, 1989', 'Baseball Stars has become one of the most influential games in the development of sports video games since it was first released in 1989 by SNK. it was released for the Nintendo Entertainment System, as well as the PlayChoice 10 Upright Arcade Cabinet, and became a huge success throughout the world. It is often referred to as the best baseball game on the NES platform, and introduced a number of key features that have become standard in modern sports games, such as &quot;create player&quot; and &quot;create team&quot; functions.', 'B', 330, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kyihq0rylzxbkotzxp9p.jpg'),
(11, 'Baseball Stars II', '31st January, 1992', 'Baseball Stars 2 is a 2-player baseball arcade game released by SNK in 1992 for the Neo-Geo console. A less cartoony console version was released for the NES by Romstar the same year. Baseball Stars 2 for the Nintendo Entertainment System was distributed by Romstar in 1992. Changes made from the original Baseball Stars, released by SNK in 1989: Female players are no longer included in any form. Two additional batting stances. These additional stances are never used for players on custom teams. They will only appear on the pre-made teams\' players. Enhanced pitch control. Ability to shift field formations when playing defense. Ability to view your team roster and ratings while in-game. Sidearm-style pitchers are never generated on custom teams. They can only be hired. Easier bunting controls; bunts are now retractable. (Hold Down+A to bunt instead of stopping the swing partway through.) Ability to see lead-offs while pitching/batting. Six pitchers and four bench players instead of five each. New music and home run animations. These include the &quot;Power connect&quot; graphic for a two-run home run, an animated graphic of the batter rounding the bases and pumping his fist for a 3-run home run or grand slam, and a similar (yet very rare) graphic including a Yorkshire terrier following the batter for a come-from-behind (usually game-ending) home run in a dramatic situation. Can no longer name custom teams or rename players on custom teams. You can still upgrade player using the same 15-point system introduced in the original Baseball Stars. However, the random points you get to disperse to various skills each time you purchase a player upgrade changed from between 1 and 6 to between 1 and 5. Player upgrades overall are much more expensive while the money received during play has remained about the same. This makes it much more time-consuming to upgrade players to maximum. You can still fire players and hire players. However, due to the fact you cannot change the names of hired players your hired player will always be named generic names given by the game (examples \'STAR 5\', \'ROOK 2\', etc.). This can also lead to multiple players sharing the same name throughout the custom teams, even conceivably multiple players on the same team with the same name. Players can still create leagues of up to 125 games (6 teams playing each other 25 times) and view statistics such as League Standings and Top 10 in Average, Home Runs, Runs Batted In, Earned Run Average, Wins and Saves. (A peculiar glitch occurs when viewing league leaders. The last pitcher listed on any user-created team in &quot;View Team&quot; does not appear in any of the Top 10 leaderboards.)', 'B', 331, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/khz7jepwfx8jdjwr8xpf.jpg'),
(11, 'Bases Loaded', '26th June, 1987', 'Bases Loaded is a baseball game that was released for Arcade and the Nintendo Entertainment System in 1987. It was developed by Jaleco and TOSE, and was the first installment in the Bases Loaded series, which was followed by seven sequels for three generations of consoles. The game tried to focus on the confrontation between the pitcher and the batter, putting emphasis on the face-off between the two. Unfortunately, this made the perspective fairly limited in determining where to hit the ball, or even where the ball was during a pitch.', 'B', 332, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmx.jpg'),
(11, 'Bases Loaded 3', '27th July, 1990', 'Bases Loaded 3 is the third entry in the Bases Loaded series published by Jaleco for the Nintendo Entertainment System. It was released in 1990 in Japan, and 1991 in North America and was exclusively on the NES. The game departed from the two previous installments by removing seasonal play, focusing instead simply on individual exhibition games. It was noteworthy due to the endorsement of Ryne Sandberg, the famed baseball player.', 'B', 333, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qwizikitg8g0uip5m2ss.jpg'),
(11, 'Bases Loaded 4', '22nd November, 1991', 'Bases Loaded 4 is the fourth installment in the Bases Loaded series, published by Jaleco exclusively for the Nintendo Entertainment System. The game continued the popular series with fairly similar gameplay, and a more concrete ending with a credits screen revleaing the five faces of the game designers.', 'B', 334, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qsjqcby0cyuicwuai5eo.jpg'),
(11, 'Bases Loaded II: Second Season', '10th August, 1988', 'Bases Loaded II: Second Season was released by Jaleco in 1988 as the second in the Bases Loaded series. It was only ever released for the Nintendo Entertainment System, and continued where Bases Loaded had finished as a successful baseball game on the NES console.', 'B', 335, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmy.jpg'),
(11, 'Batman: Return of the Joker', '20th December, 1991', 'Batman: Return of the Joker was developed and published by Sunsoft as the second in their Batman series on the Nintendo Entertainment System. It departed from the original game by focusing on the comic-book version of Batman instead of the movie-inspired conception. The story itself was self-contained, and did not depict a pre-existing storyline. The game is a side-scrolling platformer with beat \'em up features.', 'B', 336, 0, 3.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qmz.jpg'),
(11, 'Battle Chess', '31st December, 1988', 'Battle Chess was developed by Interplay as their first project after severing ties with Electronic Arts. They designed it for the Amiga in 1988, and it was released on the majority of the other systems in the late 1980s and early 1990s as well. It was widely successful, and resulted in two follow-ups, many copy-cat games, and a remake for Steam on PC. The only significant criticism the game received was the weak chess AI, as it was not until the mid 1990s that chess ai began to consistently win against strong opponents.', 'B', 337, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1u4y.jpg'),
(11, 'Battle Fleet', '22nd July, 1990', 'Battle Fleet is a Strategy game, developed by Atlus and published by Namco, which was released in Japan in 1990.', 'B', 338, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ev6dgmfyttelljolqv6y.jpg'),
(11, 'Super Spy Hunter', '27th September, 1991', 'The Super Spy Hunter has a super spy car. It\'s actually a well-armed car that can turn into a boat or a plane at opportune times. The action is fast vertical scrolling as the vehicle faces all manner of powerful vehicle threats from a well-funded terrorist enemy -- cars, trucks, helicopters, etc. Luckily, there are many powerups to collect along the way, both defensive and offensive.', 'S', 339, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wbge35ykd7f8kagl7qlm.jpg'),
(11, 'The Battle of Olympus', '23rd March, 1988', 'The Battle For Olympus was developed by Infinity and Radical Entertainment for the Nintendo Entertainment System and Nintendo GameBoy. It was released in 1988, the year after Zelda II was released. The game borrowed many concepts from the popular Zelda game, utilizing various special weapons and tools as the game progresses.', 'T', 340, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/recb9i29scfkvxue3x2d.jpg'),
(11, 'Battle Stadium: Senbatsu Pro Yakyuu', '18th January, 1991', 'Battle Stadium is a baseball game for the Famicom with the ability to create a custom team. It is a fun time, so come play ball!', 'B', 341, 0, 2.5, ''),
(11, 'Battle Storm', '21st January, 1992', 'The game allows players to do combat strategies with tanks, airplanes, military bases, and non-nuclear missiles. \n \nThese advanced weapons allow players to stage a fictional World War III and to simulate modern warfare. Players can assume the persona of various clichÃ©d Hollywood action film stars like Rambo (ã‚¸ãƒ§ãƒ³ãƒ©ãƒ³ãƒœãƒ¼), Chuck Norris (ãƒãƒ£ãƒƒã‚¯ãƒŽãƒªã‚¹), Eddie Murphy (ã‚¨ãƒ‡ã‚£ãƒžãƒ¼ãƒ•ã‚£ãƒ¼), Bruce Lee (ãƒ–ãƒ«ãƒ¼ã‚¹ãƒªãƒ¼), and Arnold Schwarzenegger (ã‚¢ãƒ¼ãƒŽãƒ«ãƒ‰ã‚·ãƒ¥ãƒ¯ãƒ«ãƒ„ã‚§ãƒãƒƒã‚¬ãƒ¼). Stages include a jungle, forest, the swamp, and urban terrain. \n \nThe player must choose a tank with his or her directional pad. Once there, the player must decide either to move a unit or destroy the enemy on sight. Destroyed units can be rebuilt for money and the first person to run out of cash loses the war. Both players can enjoying the fun and games with more $250 million of virtual game currency to spend on cool military toys to fire at each other.', 'B', 342, 0, 2.5, ''),
(11, 'Battletoads', '1st June, 1991', 'Battletoads is the first game of the Battletoads series. It is developed by Rare and published by Tradewest. It was originally released for Nintendo Entertainment System in 1991, with ports for the Sega Genesis, Sega Game Gear, Amiga CD32 and Nintendo Game Boy (with the subtitle Battletoads in Ragnarok\'s World so as to separate it from the earlier-released Game Boy sequel). \n \nBattletoads is considered to be a game that shows the true potential of the NES\' graphics, mainly due to the year of its release, when developers were focusing more on 16-bit consoles. \n \nNot only is it graphically-advanced, but it is also considered to be one of the hardest games of all time, appearing in possibly every listing of difficult video games. It is currently listen at 8th place in IGN\'s &quot;Top 10 Most Difficult Games to Beat.&quot;\n\nIt was re released in 2015 on the Xbox One as part of the Rare Replay Collection.', 'B', 343, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qn4.jpg'),
(11, 'Bee 52', '8th August, 1992', 'You\'re about to find out just what\'s involved for a young bee with a day-job. Gigantic spiders, sneaky ants and loathsome slugs are just a few of the meanies who\'ll get in your way when you\'re bee number 52. You\'re hardly defenseless though, and with enough speed, skill and firepower you may get through the day - despite being heavily outnumbered. Let your nose, or rather proboscis, lead the way to the flowers and don\'t let anyone - or anything - get in your way! B52 - you\'re cleared for take off!', 'B', 344, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pvsvdyp1wdpwifmwkuly.jpg'),
(11, 'Beetlejuice', '31st December, 1990', 'In the game you control Beetlejuice through various side-scrolling and overhead view levels in an effort to scare the yuppie Deetz family and friends that have taken over the house. You stomp on cockroaches in order to gain points that you used to buy various scare tactics that you use to defeat various enemies and bosses. Although the initial levels of the game are based upon the film, with Beetlejuice venturing through the Maitland House to find and scare away Otho, the later levels are original and involve Beetlejuice fighting mythical creatures in such locations as a sewer system and the afterlife.', 'B', 345, 0, 2.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xsflkf09j33a95o8uhke.jpg'),
(11, 'Best Keiba Derby Stallion', '21st December, 1991', 'Best Keiba Derby Stallion (&quot;Best Race Derby Stallion&quot;) is a simulation game where the player has a stable and starting money and must raise champion racehorses. As well as training horses, they can breed them and, eventually, sell them once they grow too old to race. The player can also hire jockeys to ride their horses for races, and can gamble on races to earn a little extra funds. \n \nBest Keiba Derby Stallion began a long-running Derby Stallion franchise that persists to the present. It was only released in Japan.', 'B', 346, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ulrqhf0kpkecfipvg3ix.jpg'),
(11, 'Best of the Best: Championship Karate', '31st December, 1992', 'Best of the Best: Champion Karate is an earlier fighting-style game developed by Loriciels &amp; Movie Software for the Nintendo Entertainment System. It focused on the kick-boxing style of fighting, and incorporated a championship-style linear play.', 'B', 347, 0, 1.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hnin6pwh9ajrwf4g5jol.jpg'),
(11, 'Best Play Pro Yakyuu', '15th June, 1988', 'A Japanese baseball sim developed by ASCII for the NES. It focuses more on team management than playing the sport itself.', 'B', 348, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z25q51sryqp3vglrrayx.jpg'),
(11, 'Best Play Pro Yakyuu Special', '15th November, 1992', 'Best Play Pro Yakyuu Special is a Sports game, developed and published by ASCII Entertainment, which was released in Japan in 1992.', 'B', 349, 0, 2.5, ''),
(11, 'Bible Adventures', '31st December, 1990', 'Bible Adventures is an unlicensed religious game released for the Nintendo Entertainment System in 1990. It was developed and published by Wisdom Tree in 1990. It was later ported to the Sega Mega Drive in 1995.\nIn this Single or Multiplayer game, there are three different stories that can played throughout, including Baby Moses, Noah\'s Ark and David and Goliath, all being from the Old Testament of the Bible. The game has a gameplay style similar to Super Mario Bros. 2 itself.', 'B', 350, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tsjejinrdldmwf0qfjku.jpg'),
(11, 'Bible Buffet', '1st October, 1993', 'Bible Buffet is an unlicensed game created by Wisdom Tree for the Nintendo Entertainment System. It is a single player or multiplayer game. The primary goal is to stop the oil drums and the silverware whose goal is to kill the player.\nSimilar to Candy Land, this game has the player spin a spinner to move a specified amount of spaces told by the spinner to move. The regular space is the player\'s own space, red space indicates another spin, a red circle connected to another red circle has the player move one step forward or backward. If the space has a red circle with a question mark in it, the player can take a pop quiz of three trivia questions and then, if succeeded, gets to select either a key, a heart or move ahead one-four spaces, along with the prize of winning a star. If the player lands on the happy face, something rewarding happens such as moving ahead ten spaces, getting a key, heart etc. If the sad face is landed on, something unrewarding happens, including a loss of a turn, moving back a space, etc. At the end of the game, a bonus is awarded to the player who got to the end first and/or got the most pop quiz stars aside collecting the most food. After that, the entire amount of points is shown to each player.', 'B', 351, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xjmzjcbbgrgdcevkxndv.jpg'),
(11, 'Big Nose Freaks Out', '1st February, 1992', 'Big Nose Freaks Out is a platform game for the NES, produced by Codemasters and published by Camerica. The player controls a cave man character who has had all his bones stolen from a prehistoric bank by a dinosaur. Bignose sets off on an adventure through numerous prehistoric settings. Bignose defeats enemies using a club, however he also has access to a primitive skate board device (stone-boarding), via his invention - the wheel. The game is essentially a platform game in which the player collects bones and other items, while travelling from left to right until reaching the goal. B.N.F.O also had a two player mode and the addition of numerous secret levels and bonuses. Big Nose Freaks Out has become popular as more people have access to the ROM file through emulation websites.', 'B', 352, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ahjwtb8sgl8yue7rfegr.jpg'),
(11, 'Big Nose the Caveman', '31st December, 1991', 'You control the &quot;Big Nose&quot; character, who is running through many islands to find his dinner, because he is very hungry. Along the way, Big Nose collects bones, that he can use to buy items from the various shops that include spells, upgrades to his abilities and items. \nThis game is also very difficult because you cannot restart from where you left off once all your lives are gone. It is also very long with four islands (Paradise Island, Monster Island, Terror Island, and Chaos Island) each containing several levels. Big Nose the Caveman dies in a single hit unless he has stones. The stones can shoot out of his club, killing enemies. As many as three stones can come out of the club. There are also many pitfalls, traps and deadly lava/water since Big Nose can\'t swim. \nIt was followed by a sequel in 1992.', 'B', 353, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nwmnqa1pj61kf86xsk2t.jpg'),
(11, 'Bigfoot', '1st July, 1990', 'Bigfoot is a monster-truck racing game developed by Beam Software Company for the Nintendo Entertainment System.', 'B', 354, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wfvdigridb0asx2jxu0k.jpg'),
(11, 'Bikkuri Nekketsu Shin Kiroku! Harukanaru Kin Medal', '25th July, 1992', 'Toudou Mamoru\'s plan that tried to crush the other schools in the athletic meet, ended in failure. While his team played decent, he underestimated the strength of Nekketsu High. Toudou doesn\'t take the loss lightly, and goes back to the drawing board in his quest for complete domination. \n \nWith his wealth and influence, Kounosuke Todou is set on making things right and announces another event! Fight back, Kunio-Kun!', 'B', 355, 0, 2.5, ''),
(11, 'Bikkuriman World: Gekitou Sei Senshi', '27th August, 1992', 'Bikkuriman World: Gekitou Sei Senshi is a Role-Playing game, developed by Atlus and published by Hudson, which was released in Japan in 1990.', 'B', 356, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/q74ewril0p6gtecnucur.jpg'),
(11, 'Bill Elliott\'s NASCAR Challenge', '31st December, 1990', 'Do you have racing in your blood and ice in your veins.\n\nKonami introduces the only NASCAR endorsed stock car simulation that turns your disk drive into a pit pass to the most authentic racing environment available. Co-designed by Winston Cup Champion Bill Elliott and Distinctive Software- developed or Test Drive and The Duel- this is a test of your mettle and milliseconds on the banked ovals of six official, perfectly scaled NASCAR tracks like Daytona, Talladega, Bristol, Darlington, Michigan and Atlanta. Or the two twisting road courses of Sears Point or Watkins Glen. All with bit map graphics plus a scaling technique, creating graphics so detailed you can actually read the car\'s make when you go bumper to bumper.\n\nOn-screen statistics tell you course length, maximum banking and the total number of laps in each race. With this vital data, adapt your car to each unique track by adjusting gear ratio, transmission, spoiler angle and tire stagger. Depending on whether you\'re racing or qualifying for pole position, you must also decide which type of engine to use. But &quot;dial in&quot; your car carefully. One miscalculation could send you reeling into the wall.\n\nWhen you think you have the right stuff, drop the hammer on NASCAR\'s finest field of racers- including Bill Elliott himself- in single races or compete for the Cup in the Championship Season.', 'B', 357, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m1wpb2ted9epqzodu3wu.jpg'),
(11, 'Bingo 75', '31st December, 1990', 'Bingo 75 is a Miscellaneous game, developed by Thin Chen Enterprises and published by Sachen, which was released in Asia in 1990.', 'B', 358, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/notbiqis5bm0p79jzu0x.jpg'),
(11, 'Bio Force Ape', '31st December, 1992', 'Originally slated for release in 1991, Bio Force Ape allows you to play as a pet chimpanzee who must rescue his family by taking the mysterious Bio Force serum and mutating into a pro wrestler. It was the recipient of an extremely positive profile in Nintendo Power â€” â€œextremely positiveâ€ being NPâ€˜s default setting back in the day â€” but then vanished, presumably never to be seen again. Last week, though, the archivists at Lost Levels not only acquired the long-lost prototype cartridge, but uploaded a playable version of it to the Internet.', 'B', 359, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/owputxfrufax8qc9ohfe.jpg'),
(11, 'Bionic Commando', '20th July, 1988', 'In terms of story and level design the NES version differs considerably from the original arcade game and its home computer conversions.', 'B', 360, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qn6.jpg'),
(11, 'Bird Week', '13th July, 1986', 'The player plays as a bird and can either play the normal game or the single level practice game. The player must feed butterflies to the baby birds so that they can grow big and eventually leave the nest. It is suggested that they eventually become the &quot;new mother birds&quot; that take care of their offspring in the subsequent levels. Finishing all 999 levels of Bird Week actually results in the beginning of an endless loop instead that ends when the players loses all of his lives. \n \nEach level represents a season in the ecosystem of a bird. The game starts out in early spring. As the virtual year progresses, the season evolves into summer and eventually into autumn. After autumn, the game repeats itself by portraying the following spring. If the proper amount of butterflies are not fed to the babies, then the babies end up starving to death. The player will automatically lose a life if any of the baby birds die. In addition to this, the player also loses a life when a predator catches the player trying to deliver butterflies to whose baby.', 'B', 361, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/j1sy8bf9y6y6tdzyyx6i.jpg'),
(11, 'The Black Bass', '18th October, 1988', 'The Black Bass is a fishing game designed for the Nintendo Entertainment System by HOT B games and released in 1988. Although not presented as a sequel, this game is the second in the Black Bass series-the first game being a Japan-exclusive.', 'T', 362, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ubhplcepfprklyw68zzi.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Blades of Steel', '1st October, 1987', 'From the opening Face-Off it\'s six on six pro-style hockey at its best. Their are eight teams for you to captain: Los Angeles, New York, Vancouver, Montreal, Edmonton, Minnesota, Toronto and Chicago. You can challenge a friend, or take on a multi-talented computer squad. You can also choose from three difficulty levels - Junior, College and Pro. \nThroughout the game, you\'ll constantly be tested by every intense element of championship hockey, from Penalty and Overtime Scenes to Knockout Smash-Hit Fight Scenes. Speed, strength, quickness and instinct are talents you must possess if you plan to prevail, especially when the anger flares, gloves come off and fists start flying. \n \nIt\'s hard hitting action at its toughest. And you\'ll soon learn that in this league nothing\'s ever given to you, and before you can reach your goals - you have to score them. You\'ve gotta master the artful skill of a finesse player and the bone crushing brutality of an enforcer. You\'d better be versatile as well, because you must skillfully control your forwards, centers, defensemen and even the goalie, who\'ll defend the net against unrelenting Power Plays (which will occur if you lose a fight and have your battered carcass banned to the Penalty Box).', 'B', 363, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u4iofo1odxnrihocx0gl.jpg'),
(11, 'Blaster Master', '17th June, 1988', 'You\'ve fallen down a hidden manhole into a world of creatures so terrifying they\'d scare the rats away. You can panic and perish, or blast your way through an endless maze of tunnels, searching for the secret passages to your escape. And that\'s the easy part. Because the Masters of the Caverns lay waiting - prehistoric creatures so powerful, so gigantic, they literally fill your screen! So load your arsenal and get ready for Blaster Master.', 'B', 364, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qn7.jpg'),
(11, 'De-Block', '9th September, 1991', 'De-Block is a Puzzle game, published by Athena, which was released in Japan in 1991.', 'D', 365, 0, 2.5, ''),
(11, 'Blodia Land: Puzzle Quest', '10th September, 1990', 'Blodia Land: Puzzle Quest is a Puzzle game, developed by TOSE and published by Tonkin House, which was released in Japan in 1990.', 'B', 366, 0, 2.5, ''),
(11, 'The Blue Marlin', '27th December, 1991', 'The Blue Marlin was developed by Hot B in 1991 for the Nintendo Entertainment System. Following their earlier release The Black Bass, Hot B built on some of the original features for this fishing game. With the abilty to gradually increase attributes in muscle power, body strength, and skill; the player has more control over how the game is played compared to Black Bass.', 'T', 367, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oesjsugifm2043ml6rne.jpg'),
(11, 'Shadow of the Ninja', '10th August, 1990', 'Shadow of the Ninja, originally released in Japan as Yami no Shigotonin Kage, and later released in Europe as Blue Shadow, is a 1990 futuristic ninja-themed side-scrolling action game by Natsume for the Nintendo Entertainment System.', 'S', 368, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/h4kqv42bu2gcln6uboqb.jpg'),
(11, 'The Blues Brothers', '31st December, 1991', 'The Blues Brothers video game was designed by Titus Software and is based on the comedic sketch band of the same name. The platformer-style game was released in 1991 for MS-DOS. It was subsequently ported to a number of other platforms, including the Amiga, Atari ST, and NES.', 'T', 369, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ev82ujsepoanaiod7vvr.jpg'),
(11, 'TV Sports Baseball', '31st December, 1990', 'TV Sports: Baseball, known as Bo Jackson Baseball in the US and Canada, was released for the Nintendo Entertainment System and ported to the Amiga and IBM PC in 1990. The game is named after and features Bo Jackson, a professional baseball player in the 1980s.', 'T', 370, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dfmwnwwahojwonyo142m.jpg'),
(11, 'Bokosuka Wars', '14th January, 1986', 'This game revolves around a leader who must lead an army in phalanx formation across a battlefield in real-time against overwhelming enemy forces while freeing and recruiting soldiers along the way, with each unit able to gain experience and level up through battle. The player must make sure that the leader stays alive, until the army reaches the enemy castle to defeat the leader of the opposing forces. \n \nThe game was responsible for laying the foundations for the tactical role-playing game genre, or the &quot;simulation RPG&quot; genre as it is known in Japan, with its blend of role-playing and strategy game elements. The game has also variously been described as an early example of an action role-playing game, an early prototype real-time strategy game, and a unique reverse tower defense game. In its time, the game was considered a major success in Japan.', 'B', 371, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ollhgtv3ntlpqmbzhjn5.jpg'),
(11, 'Bonk\'s Adventure', '31st December, 1989', 'Bonk\'s Adventure was developed by Red Company and Atlus and released on the TurboGrafx-16 in 1989 before being ported to the NES, Game Boy and Amiga. It is a 2D platform game that became quite popular, with subsequent remakes and sequels spawning from the game. It was later included in Nintendo\'s Virtual Console service as well as the PlayStation Store.', 'B', 372, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yq9labghmlkshdatwkl0.jpg'),
(11, 'Boulder Dash', '1st October, 1984', 'Boulder Dash was originally released in 1984 for Atari 8-bit computers. It was developed and published by First Star Software, and spawned a series of sequels, re-releases, and spinoffs. It also did a great deal to establish and influence the mining genre of video games, which can be seen in modern games such as Minecraft, Spelunky, and Terraria. \n The game is still available as a freemium mobile title developed by SoMa Play Inc for Android and iOS.', 'B', 373, 0, 3.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1vx6.jpg'),
(11, 'Perfect Bowling', '25th July, 1989', 'Perfect Bowling is a Japan-only Famicom bowling game, in which the player competes with other computer opponents. Each of the opponents has their own name, appearance and style of play. The game seems to take place in the future, with lanes restocking pins with lasers and certain characters dressed in strange, futuristic (or at least an 80s interpretation of futuristic) fashions. This is a complete departure from its box art, which seems more reminiscent of the 1950s and 60s. \n \nThe game allows for a lot of precision-based options in order to bowl effectively. This includes rotating the ball to put spin on it, selecting the power and hitting the power gauge just right. The player can also select which hand they favor and the weight of the ball during the character creation process.', 'P', 374, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vgopifm2ymnixfs8yerh.jpg'),
(11, 'Bram Stoker\'s Dracula', '31st December, 1993', 'Bram Stroker\'s Dracula is a side-scroller platform game loosely based on the 1992 film of the same name. Players take the role of Jonathan Harker whose mission is to destroy Count Dracula by first heading to Transylvania and then London.', 'B', 375, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nzecgtsjnuonenlgg6vh.jpg'),
(11, 'Break Time: The National Pool Tour', '1st February, 1992', 'Break Time: The National Pool Tour is a pocket billiards (pool) video game released for the Nintendo Entertainment System. There are four unique challenges in the game, eight-ball, nine-ball, rotation and straight pool. All four are allegedly played according to the professional (i.e. world standardized) rules.', 'B', 376, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/negq7m3oayitszntqs2j.jpg'),
(11, 'BreakThru', '31st December, 1986', 'Accomplish your mission with your highly sophisticated assault vehicle to BREAK THRU each of the five enemy strongholds! Travel through the mountains, bridges and cities to reach the airfield. Impenetrable enemy forces impede your progress; tanks, helicopters, jeeps, landmines and more stand in your way. Press on, for all is lost if you fail to BREAK THRU!', 'B', 377, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xhvrrij2ndpvd6cmfrsb.jpg'),
(11, 'Brush Roller', '1st February, 1990', 'Brush Roller is a clone of Make Trax (an arcade game by Kural Samno in 1981) made by Hwang Shinwei in 1990. This game can often be found on multicarts and was sold in Brazil as a stand-alone cart by CCE.', 'B', 378, 0, 2.5, ''),
(11, 'Bubble Bath Babes', '1st February, 1991', 'Far below, from the dark and murky depths, another shiny bubble cluster rises. Though very beautiful, the strangely quivering bubbles are part of a sinister plan, concocted by the evil Emperor O-Dinten. With the patented Dura-Bubble, he plans to profit from fun itself by controlling all the games under the sea. Can you stop him and restore &quot;The Freedom to Have Fun&quot; to the undersea world of Atlantis? It\'s a brain-bursting bubble battle to pop thousands of beautiful bubbles before they overflow to the open sea!', 'B', 379, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/utoylv1qke661eqzo0sr.jpg'),
(11, 'Bubble Bobble', '31st December, 1986', 'In the game, each player controls one of the two Bubble Dragons, Bub and Bob. The player can move along platforms, as well as jump to those above and to the side, similar to most platform games. \n \nThe player can also blow bubbles. These can trap enemies, who are defeated if the bubble is then burst by the player\'s spiny back. Bubbles that contain enemies can be popped at the same time resulting in different foods being projected around the level. Each enemy trapped in a bubble equates to a different food. Food is consumed and transferred to points (an increasing scale of 1000 points is awarded for each enemy burst in tandem with another meaning: one enemy burst equals one food item worth 1000 points, two enemies burst equals two food items worth 1000 and 2000 points, three enemies burst equals three food items worth 1000, 2000 and 4000 points, and so on), which results in earning lives. These same bubbles also float for a time before bursting, and can be jumped on, allowing access to otherwise inaccessible areas. Players progress to the next level once all enemies on the current level are defeated. \n \nEnemies turn &quot;angry&quot; â€” becoming pink-colored and moving faster â€” if they are the last enemy remaining, escape from a bubble after being left too long or a certain amount of time has been spent on the current level. A monster will also become angry if either player collects a skull (the only negative item in the game), and the monster is hit by the resulting comet crossing the screen (however, this is a rare occurrence). \n \nAfter a further time limit expires, an additional invincible enemy appears for each player, actively chasing them using only vertical and horizontal movements. These do not need to be defeated to complete the level, and disappear once a player\'s life is lost. \n \nContact with enemies and their projectiles (rocks, lasers, fireballs, etc.) results in death.', 'B', 380, 0, 3.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qna.jpg'),
(11, 'Rainbow Islands: Story of the Bubble Bobble 2', '30th December, 1988', 'The basic premise of the game is that each level is an island which is slowly sinking into the sea. The player must therefore get to the top of each level, by jumping on platforms and making use of the game\'s most distinctive feature: the ability to produce solid rainbows, which are used both as platforms to stand on, and as a weapon.', 'R', 381, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tsmxehc8irsqo8nbas22.jpg'),
(11, 'Bubble Bobble Part 2', '31st December, 1993', 'A new breed of heroes! Cubby and Rubby, descendants of the famous Bubby, must battle the Skull Brothers and their army of fiends to rescue a friend in danger. Fortunately, our dinosaur heroes can blow bubbles that will destroy their foes. They will rain fire, floods and tornado!', 'B', 382, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnb.jpg'),
(11, 'Bucky O\'Hare', '31st January, 1992', 'This video game is based on the cartoon television series Bucky O\'Hare and the Toad Wars under license from Hasbro, Inc. While it is generally classified as a scrolling fighting game, utilizing a Final Fight-esque landscape, the player\'s character is also armed with a laser gun, adding in elements of a scrolling shooter. However, if the character is extremely close to an enemy, he will throw out his fists to attack - a precursor to the characters featured in Metal Slug, who use knives in close combat. \n \nMuch like the cartoon, Bucky O\'Hare features colorful animation, and voice actors from the series were hired to participate in the game\'s cut scenes. \n \nThe player chooses from five protagonists: Bucky O\'Hare, the heroic rabbit captain of the space ship Righteous Indignation; Jenny, an &quot;Aldebaran cat&quot; and telepath; Dead-Eye Duck, a four-armed mallard; Willy, a kid from earth that replaced their engineer, and Blinky, a one-eyed android. As in the television series, the characters must stop the Toad Empire from invading extraterrestrial planets and enslaving their peoples; to do so they must shoot their way through an army of brainwashed toads to destroy their evil leader, a computer program known as &quot;Komplex&quot; and release the &quot;Interplanetary Life Force.&quot; \n \nThe enemies, among them Al Negator, Toadborg, Total Terror Toad, a &quot;Cyborg Spider&quot;, the various varieties of Toad Storm Troopers, the Toads\' Air Marshall, and &quot;Komplex-2-Go&quot; who featured in the comic book and cartoon series continuities.', 'B', 383, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnc.jpg'),
(11, 'Bump \'n\' Jump', '31st December, 1982', 'Bump \'n\' Jump, known in Japan as Burnin\' Rubber (ãƒãƒ¼ãƒ‹ãƒ³ãƒ©ãƒãƒ¼ BÄnin RabÄ?), is a 1982 Japanese arcade game created by Data East Corporation, released as both a dedicated board and as part of their DECO Cassette System. The game was published in certain regions by Bally Midway. \n \nIn Bump \'n\' Jump the goal is to drive from the beginning of a level to the end while bumping enemy vehicles into obstacles and jumping over various large obstacles such as bodies of water.', 'B', 384, 0, 3.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1pk2.jpg'),
(11, 'The Bugs Bunny Birthday Blowout', '1st September, 1990', 'The game is a side-scrolling adventure game where you control the famous Warner Brothers cartoon character Bugs Bunny on a quest to get to his 50th birthday party. He is armed with a mallet that he can swing at various enemies to defeat them, deflect certain projectiles or destroy bricks. He can also collect hearts to restore his health and carrots for bonus points. At the end of each level, Bugs Bunny had to use his mallet to defeat a Warner Brothers cartoon character such as Foghorn Leghorn, Sylvester, or the Tasmanian Devil. These other Looney Tunes characters are trying to stop Bugs because they are all jealous that Bugs gets all the attention. \nLevels: \n1: Grass land (Daffy Duck, Tweety Bird, Daffy, Wile E. Coyote) \n2: Desert (Daffy, Tweety, Yosemite Sam) (Level 2-3 has no boss) \n3: Evening Canyon (Daffy, Elmer Fudd, Daffy, Sylvester Cat) \n4: Night Caves (Daffy, Tweety, Daffy, Pepe le Pew) \n5: Jungle (Daffy, Elmer Fudd, Daffy, Foghorn Leghorn) \n6: Temple (Daffy, Elmer Fudd, Daffy, Tazmanian Devil)', 'T', 385, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bjb7wpjsr3viimnnsfem.jpg'),
(11, 'The Bugs Bunny Crazy Castle', '16th February, 1989', 'The Crazy Castle series is an action-puzzle game series created by Kemco and released on the Famicom Disk System, NES, Game Boy, Game Boy Color and Game Boy Advance. It stars different popular cartoon characters, most notably the Warner Bros. cartoon character, Bugs Bunny, and the Walt Disney cartoon character, Mickey Mouse.', 'T', 386, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pl7goonqtoimtq2rhysr.jpg'),
(11, 'Burai Fighter', '1st March, 1990', 'In a remote corner of the galaxy, there lives a race of super-brains known as the Burai. For thousands of years, their vast mental capabilities have been focused upon one goal: the conquest of the universe! To accomplish this, they are creating huge armies of robo-mutants - bizarre creatures, half robot and half living flesh. With their seven manufacturing bases producing thousands of robo-mutants each day, the Burai armies will soon overrun the galaxy - unless you can stop them! Strap on your proton pack, charge up your laser cannon, and prepare to do battle with the deadliest army of mutant rogues in the universe. You must somehow penetrate the seven bases of the Burai, where you will confront a super-mutant guarding each base - monstrous creatures like the Giganticrab, Jawsipede, and Fangskull - until finally, you face the terrifying Slimedragon! But with the awesome arsenal of weapons at your command, victory may still be within your reach. It\'s up to you to rid the universe of the evil Burai once and for all!', 'B', 387, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnd.jpg'),
(11, 'BurgerTime', '31st December, 1982', 'BurgerTime (ãƒãƒ¼ã‚¬ãƒ¼ã‚¿ã‚¤ãƒ  BÄgÄtaimu) is a 1982 arcade game created by Data East for its DECO Cassette System. The game\'s original title, Hamburger (ãƒãƒ³ãƒãƒ¼ã‚¬ãƒ¼), was changed to BurgerTime before its introduction to the US. The player is chef Peter Pepper, who must walk over hamburger ingredients located across a maze of platforms while avoiding pursuing characters. The game was popular in arcades. In the US, Data East USA licensed BurgerTime for distribution by Bally Midway. The Data East and Midway versions are distinguished by the manufacturer\'s name on the title screen and by the marquee and cabinet artworks.', 'B', 388, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qne.jpg'),
(11, 'Business Wars', '24th January, 1992', 'Business Wars is an Adventure game, developed and published by Hect, which was released in Japan in 1992.', 'B', 389, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oqisewxpiufibmcento7.jpg'),
(11, 'Cabal', '31st December, 1988', 'Originating in the arcades, Cabal is a shooter where the protagonist runs back and forth along the bottom of the screen, ducking and dodging bullets and grenades from the enemy. The roll maneuver from the arcade was not implemented in the PC version. The player returns fire by moving a target around the screen which also moves the player character and may expose him to enemy fire.', 'C', 390, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ve2rql3bxiwwakdsy3sq.jpg'),
(11, 'Caesars Palace', '31st December, 1991', 'Caesars Palace is a 1992 Virgin Interactive gambling video game developed by Realtime Associates for the Nintendo Entertainment System and Magnin and Associates for the Game Boy; also there is Game Gear (1993) version.', 'C', 391, 0, 1.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/h1nyngirhc4vfqiqbtk5.jpg'),
(11, 'California Games', '31st December, 1987', 'Introducing the gnarliest bunch of games under the sun. Games invented on the beaches by sun-baked beach bums with a fondness for ripping, grinding, and shredding. With six radically thrilling events intended to bring you to the edge and blow your mind. And make adrenaline California\'s most plentiful natural resource. \n \nWish they all could be California Games. \nGet ready to shred the face off an awesomely tubular wave. Turn a &quot;berm&quot; on a BMX bike and spray up a wall of dirt. Launch a few feet off-the-lip with your skateboard tucked high. And while you\'re up there, dance for the crowd. Or if you\'re feeling like kicking back a bit, float a flying disk, juggle a foot bag with your heels, or just slalom the boardwalk on skates. \n \nWhen the going gets weird, the weird turn pro. \nBut this ain\'t beach blanket bingo. In fact, before you even set foot on California turf, you\'ll choose an on-screen sponsor from among the heaviest names on the circuit. Then, hit the competition route. Prizes include trophies for a single event and a top prize in overall competition. \n \nSo get air. Go crazy. Welcome to a new state of intensity.', 'C', 392, 0, 2.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ltslwdd98letnne1n5mm.jpg'),
(11, 'The California Raisins: The Grape Escape', '1st February, 1990', 'Cancelled. \n \nIn the single-player side-scrolling action game the player controls a California Raisin through five stages in an effort to rescue the band and their band\'s musical notes that were stolen by the gang of jealous musicians. The player walk, jump, climb on vines, moonwalk (by pressing the &quot;select&quot; button) and shoot an unlimited supply of grape jelly beans as projectiles. As was the case with other Capcom games, such as Mega Man and DuckTales, one can play the first four levels in any order that you want, but the final level is only available after you have collected the musical notes from each of the four levels. \nThe first four levels include The Grape Vine, The Factory, The Maize Maze and The Juicery. The final level takes places in The Clouds. During each level you can collect \'I\' icons that give you temporary invincibility, regular black musical notes for bonus points, \'Sunshine\' icons to restore your health, and \'Raisinette\' icons to give an extra life to the player. One can also locate items by shooting at the thin air or at columns.', 'T', 393, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xbnii1loqtvk7hugtuxs.jpg'),
(11, 'Capcom\'s Gold Medal Challenge \'92', '5th July, 1992', 'Catch the spirit of world-class competition with Capcom\'s Gold Medal Challenge \'92! Train and compete with up to seven friends in 18 pulse-pounding events. Now\'s the time to really pump up and get physical! Out muscle your friends in Weightlifting and leave them in the dust in the 100 Meter Dash. Make a huge splash in the swim meets and leave everyone else in your wake. Earn a perfect 10 in the Vault and watch as the crowd goes wild! With Capcom\'s Gold Medal Challenge \'92, all the thrills and excitement of world-class competition are right at your fingertips!', 'C', 394, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wkku0sqylihlbi7avxeb.jpg'),
(11, 'Captain America and the Avengers', '31st December, 1991', 'Captain America and the Avengers is an arcade game released by Data East in 1991. It features the Marvel Comics characters The Avengers in a side-scrolling brawling and shooting adventure to defeat the evil Red Skull.', 'C', 395, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnf.jpg'),
(11, 'Captain Comic: The Adventure', '31st August, 1988', 'Captain Comic: The Adventure is a classic 1988 MS-DOS platform game which is known for being one of the first side-scrolling games made for IBM PC. It was developed entirely by Michael Denio. The PC version of the game was distributed as shareware. Later a version for the NES was published by Color Dreams as an unlicensed title. An unofficial conversion for the SAM CoupÃ© also exists. It was also cloned as &quot;The Adventures of Pioneer Ksenia&quot; in 1990 by a team of Ukrainian programmers. Gameplay of Captain Comic: In the game, the player takes control of Captain Comic who is on a mission to the planet Tambi to recover three treasures stolen from the planet Omsoc.', 'C', 396, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hlotzgytivy7yz50u4ji.jpg'),
(11, 'Captain Ed', '25th September, 1989', 'Captain Ed is an Action game, developed by Graphic Research and published by CBS Sony Group, which was released in Japan in 1989.', 'C', 397, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/g9lkplcgo145wzqu6sku.jpg'),
(11, 'Captain Planet and the Planeteers', '31st December, 1992', 'Play as Captain Planet and his Planeteers is this platform game.', 'C', 398, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u4exjzfjofc8jyjtk94q.jpg'),
(11, 'Captain Silver', '1st February, 1987', 'Captain Silver is a side-scrolling action game released for the arcades by Data East in 1987. In the game, the player control a young sailor named Jim Aykroyd who goes on a journey to seek the lost treasure of Captain Silver, facing various perils along the way. Home versions were released for the Master System by Sega and for the NES by Tokuma Shoten.', 'C', 399, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jkv5wr9hze1txvsbots6.jpg'),
(11, 'Captain Skyhawk', '31st December, 1990', 'The player takes a role of a fighter pilot working to repel an alien invasion. Aliens have invaded Earth, and have built four land bases. These bases are designed to drain Earth\'s energy and feed it to their mother space station. If the space station is allowed to obtain enough energy, it will destroy the Earth with a massive laser blast. The player must destroy the enemy bases, then go after the space station itself. Scientists, during the course of the game, are working on a top-secret Neutron Cannon. During several missions, the player must make supply drops to the scientists working underground. Sometimes, the aliens will have a scientist captive. Then the player must defeat the alien base and take the scientist to safety.', 'C', 400, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m1qqlmwuhxyhlrfhobfw.jpg'),
(11, 'Captain Tsubasa II: Super Striker', '19th August, 1990', 'Captain Tsubasa II: Super Striker is a Soccer Sim game, developed and published by Tecmo, which was released in Japan in 1990.', 'C', 401, 0, 2.5, ''),
(11, 'Casino Derby', '18th April, 1993', 'Casino Derby (ã‚«ã‚¸ãƒŽãƒ»ãƒ€ãƒ¼ãƒ“ãƒ¼) is a game, developed by Outback and published by Party Room 21, which was released in Japan in 1993 for the Nintendo Famicom.', 'C', 402, 0, 2.5, ''),
(11, 'Casino Kid', '1st November, 1989', 'Casino Kid is a video game on the NES platform released in 1989. It was published and developed by Sofel. In Japan, it was released as 100 Man Dollar Kid: Maboroshi no Teiou Hen. The game takes place in the fictional town of Lost Wages (a pun on the real city of Las Vegas, Nevada) where the object is to earn lots of money and to defeat the evil King of the Casino. Games at the casino include blackjack and five-card draw poker. In the Japanese version, it was possible to travel to other casinos like New York City and Japan for a substantial airfare cost.', 'C', 403, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mxjqqljcwkyip9bqopyz.jpg'),
(11, 'Casino Kid II', '1st May, 1993', 'Casino Kid 2 is the sequel to Casino Kid, released in 1992 and released by the same company. In Casino Kid 2, the Casino Kid, after having defeated the top players in Las Vegas, is issued a challenge by the top gamblers around the world. The matches are organized by a mysterious leader and to unveil the leader, the Casino Kid must defeat nine opponents from around the world in the games of roulette, poker and blackjack. Gameplay in Casino Kid 2 differs in that players no longer venture around the casino looking for rival gamblers, though the card games still operate in the same fashion as in the original Casino Kid.', 'C', 404, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/synrh678xygzpmd3y1kg.jpg'),
(11, 'Castlequest', '1st November, 1985', 'The object of the game is to navigate through Groken Castle to rescue Princess Margarita. The player can push certain objects throughout the game to accomplish progress. In some rooms, the prince can only advance to the next room by aligning cement blocks, Honey Jars, Candle Cakes, and Elevator Controlling Block.', 'C', 405, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tqhfsyzggpw8nwqci1z9.jpg'),
(11, 'Castle of Deceit', '31st December, 1990', 'Castle of Deceit is a sidescrolling game for the NES where the player takes control of a wizard trapped in the titular castle with only one spell to defend himself. The game was often considered frustrating for its length and lack of a save or password system. Phfax, a mystic being and wielder of the Emerald Magic, consented to offer his life to protect the stones of Rune. For centuries he dwelled within the plasma of energies of the stones where the Runes were hidden. Until at last it drove him insane. Such was the power of the stone that even the bitter hallucinations of his madness were given life. Six deadly beings appeared stealing the Rune Stones. You, Cebo, the most promising of the young Magicians of Dace, must enter the castle, exploring the realities. But do not trust your senses - what you see, what you hear may all be a lie!', 'C', 406, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bn3h8vsrsnnnwgdqqrhy.jpg'),
(11, 'Castle of Dragon', '1st July, 1990', 'The Dragon Master, Darklarza, has been terrorizing the kingdom for numerous years. The king was forced into exile by this threat. He retreated, with the bravest knight in the kingdom. \nThis knight, named Geraden, must hold his fort. Darklarza stages an attack on the king\'s fortress, breaks in and manages to abduct the royal princess. Now it is up to the brave Geraden to journey throughout the kingdom, rescue the captive princess, and put an end to Darklarza\'s evil reign once and for all.', 'C', 407, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xqrlydbrr2ian8nct6p8.jpg'),
(11, 'Castlevania', '26th September, 1986', 'Step into the shadows of the deadliest dwelling on earth. You\'ve arrived at Castlevania, and you\'re here on business: To destroy forever the Curse of the Evil Count. \n \nUnfortunately, everybody\'s home this evening. Bats, ghosts, every kind of creature you can imagine. You\'ll find \'em all over the place, if they don\'t find you first. Because you\'ve got to get through six monstrous floors before you even meet up with the Master of the House. Your Magic Whip will help, and you\'ll probably find a weapons or two along the way. But once you make it to the tower, you can count on a Duel to the Death. The Count has waited 100 years for a rematch.', 'C', 408, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qng.jpg'),
(11, 'Castlevania II: Simon\'s Quest', '28th August, 1987', 'Castlevania was a cakewalk compared to this bloody curse. You thought you had the Prince of Darkness defanged - eh, Simon Belmont? Well think again, \'cause according to a damsel in distress, evil Count Dracula has left a horrifying curse in his wake. And the only hope you have of ending the terror is to destroy his missing body parts! Talk about your frightening quest, searching a maze of mansions, graveyards and dark, eerie forests - each guarded by man-eating werewolves, fire-throwing zombies and other devilish demons. Your grim chances are kept alive in Transylvania, where cowardly villagers offer clues to the whereabouts of Dracula\'s remains. And where you\'ll purchase magic weapons, including silver knives and flame whips. But beware the night. For when the sun disappears, Dracula\'s curse grows deadlier. And your chances grow dimmer and dimmer.', 'C', 409, 0, 2.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnh.jpg'),
(11, 'Castlevania III: Dracula\'s Curse', '22nd December, 1989', 'Led by the immortal Count Dracula, the greatest army of evil ever assembled is poised to bury mankind in a Tomb of Terror. Destroying this legion of Swamp Dragons, Slasher Skeletons and Forces of the Undead will be the supreme challenge for the mightiest of warriors. Your place in history is 100 years before Simon Belmont\'s birth. Dracula is young at heart, and it will take more than a stake to penetrate his evil. Luckily, you command the role of Trevor - Simon\'s forefather and the origin of the Belmont Warlord Chromosomes. Trevor has a power never before seen by human eyes - the power to transform into three different spirits: Grant DaNasty, the ferocious Ghost Pirate. Sypha, the Mystic Warlord. And Alucard, Dracula\'s forgotten son. You must perfectly time Trevor\'s body transformations to match up his different fighting spirits against Ultimate Evils. Trevor also has the strength and wisdom to command the Battle Axe, Invisibility Potion and Mystic Whip. But the most important weapon Trevor has is your cunning to choose the correct Paths of Fate and your bravery to lead him past 17 possible levels of never-ending doom, including the Haunted Ship of Fools, the Sunken City of Poltergeists, the Clock Tower of Untimely Death and Curse Castle. Never before have so many dangers confronted you at one time. And if by some miracle you triumph, you\'ll no longer be a mere mortal. You\'ll be a legend who\'ll live forever!', 'C', 410, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnk.jpg'),
(11, 'kyatto ninden teyandee', '19th August, 1991', 'Players take the role of the three main cats and otasuke (rescue team) members, who can be switched to at any time and have special abilities to progress through the game. The game features most of the characters in the series as well as an additional villain, a mysterious scientist named Dr. Purple (Dr. ãƒ‘ãƒ¼ãƒ—).', 'K', 411, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pkvwam4mzvvu5cb6yhej.jpg'),
(11, 'Caveman Games', '1st February, 1990', 'Olympic Games set in the stone age. Events include clubbing, dino-racing, fire-making, mate-tossing, saber racing and the dino vault. \n \nSupporting up to six players, you must select your caveman from a total of six different characters with different backgrounds, all with different skills and drawbacks.', 'C', 412, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/maywxtfm6mnlpqrortut.jpg'),
(11, 'Challenge of the Dragon', '1st February, 1990', 'Are you the savior spoken of in the ancient legend? Only your Dragon Style blend of sword and martial arts can save you now... Your girlfriend has been kidnapped by the dark necromancer. Lightning sears the skies and leaves blow in the wind as you fight your way through 7 perilous worlds of Valkyries, Ninja, Dragons and even pesky fireflies waiting to feed on your carcass. Use your incredible acrobatic abilities to outsmart your enemies. Be brave... for ahead lies the Challenge of the Dragon!', 'C', 413, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qpbhqyxngdsxgcumlvwd.jpg'),
(11, 'RacerMate Challenge II', '31st January, 1997', 'Racermate Challenge II is not a game that was readily available to the public. As a specially-ordered game from Computrainer, it was used to help increase bikers\' performance for marathons and races. It came in an oversized Computrainer shipping box and typically included a top loader NES, multiple manuals (all different), Racermate Challenge II cart, and several accessories in which you used to hook your bike up to the NES. The game would keep track of your speed and endurance and let you know how well you were doing. A rather odd game and extremely tough to find anywhere especially complete since many would have thrown the box and manuals away.', 'R', 414, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nullg0zehlxsbojmzawg.jpg'),
(11, 'Championship Lode Runner', '31st December, 1984', 'The object of the game is to pick up all the gold pieces (which appear as piles of gold) and get them to the top. Using non-violent methods, enemies had to be overcome. Bumping into enemies cost the player a life and all of his hard-earned gold pieces. Fifty of the hardest levels ever designed are used and they had to be tackled in proper sequential order. While games can be saved, the player automatically loses a life for restoring his game.', 'C', 415, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/twpyrww2iuknj4zcnytj.jpg'),
(11, 'Championship Pool', '1st October, 1993', 'Championship Pool is a pool game where players can 8-ball or 9-ball pool tournament that starts off with the BCA Regional Championship where the player must defeat 32 opponents in a first to four games match. If the player loses against any of the 32 opponents, they are then eliminated from the tournament. The winner of that then goes onto the World Championship.', 'C', 416, 0, 2.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hcspoaslugkoftqqj6k1.jpg'),
(11, 'Cheetahmen II', '31st December, 1996', 'Cheetahmen II wasn\'t completed and was never officially released. In 1996, however, 1,500 copies of the game were located in a warehouse, and eventually put on sale on the secondary market. All copies of the game were reused Action 52 cartridges, some with a small gold sticker reading &quot;Cheetamen II&quot;. This cartridge is now very rare and hard to find, though numerous ROM images exist on the Internet.\n\nIn Cheetahmen II the player again assumes the role of one of the three Cheetahmen (Aries, Apollo and Hercules); after defeating a boss at the end of the second level, they switch to the next Cheetahman for the following two levels, as in the Action 52 version. Due to a bug, it is impossible to get to the levels in which one plays Cheetahman Aries without altering the ROM image or experiencing a glitch that very rarely starts the game on these two levels.', 'C', 417, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/holztaaneodlwgchav2g.jpg'),
(11, 'Chester Field: Ankoku Shin e no Chousen', '30th July, 1987', 'Chester Field: Ankoku Shin e no Chousen is an Action game, developed and published by Vic Tokai, which was released in Japan in 1987.', 'C', 418, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mrajzs6ltq6r0rif9evt.jpg'),
(11, 'Saint Seiya: Ougon Densetsu', '8th November, 1987', 'Saint Seiya: Ougon Densetsu is an RPG based around the anime and manga series known as Saint Seiya. It was developed and published by Bandai in 1987 for the Famicom. \n \nThe story of the game draws heavily from the first story arc of the series, from the beginning of the story to the fight with the Gold Saints. The game remains faithful to the original story while introducing some original elements. When the game came out, the story line was in the middle of the Gold Saints story arc. As a result, the last boss of the game is an original character. The actual final fight of the Gold Saints arc was carried over into this game\'s sequel, Saint Seiya: Ougon Densetsu Kanketsu Hen. \n \nThe gameplay mixes side scrolling action scenes to transport the character from place to place where he may have to jump over obstacles and fight basic enemies, with a turn based combat system against bosses and other significant battles. In order to be successful at these turn based battles, the player must distribute his power, or Cosmos, to various attributes before each attack. Failure to do so typically results in no damage dealt to the opponent, and a lot of damage received. When Life is lost, the main character can be revived, but if all Cosmos is lost, then the game is over.', 'S', 419, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ajxztdn1m9jvy1stpyob.jpg'),
(11, 'Chibi Maruko-Chan: Uki Uki Shopping', '4th November, 1991', 'Chibi Maruko-Chan: Uki Uki Shopping is a Miscellaneous game, developed and published by Namco, which was released in Japan in 1991.', 'C', 420, 0, 2.5, ''),
(11, 'Chiisana Obake: Acchi Socchi Kocchi', '3rd January, 1993', 'Chiisana Obake: Acchi Socchi Kocchi is a Puzzle game, developed by Atlus and published by Vap, which was released in Japan in 1992.', 'C', 421, 0, 2.5, ''),
(11, 'Chiller', '31st December, 1986', 'One of the most controversial games of the 1980\'s, Chiller was an arcade and bootleg NES light-gun game. Banned in the UK, the player was tasked with torturing and murdering victims in various settings.', 'C', 422, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pkqobqko8fxiz9jovqja.jpg'),
(11, 'Chinese Checkers', '31st December, 1991', 'Sachen\'s Sternhalma simultator.', 'C', 423, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mn9qovoq6257hziohd9k.jpg'),
(11, 'Chip \'n Dale Rescue Rangers', '8th June, 1990', 'Chip \'n Dale Rescue Rangers (ãƒãƒƒãƒ—ã¨ãƒ‡ãƒ¼ãƒ«ã®å¤§ä½œæˆ¦ Chippu to DÄ“ru no Daisakusen?, lit. &quot;Chip \'n Dale\'s Mission&quot;) is a platformer video game developed and published by Capcom based on the Disney animated series of the same name. Originally released for the Nintendo Entertainment System in Japan and North America in 1990, it came to Europe the next year, and was ported to the Nintendo PlayChoice-10 arcade system. It sold approximately 1.2 million copies worldwide.', 'C', 424, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qni.jpg'),
(11, 'Chip \'n Dale Rescue Rangers 2', '10th December, 1993', 'Chip and Dale, those tiny but daring detectives, have learned of some terrifying news: The notorious criminal cat has escaped from prison and he\'s stolen the Urn of the Pharaoh. The Rescue Rangers must once again assemble to help crack the case of the missing urn and return the feline felon, Fat Cat, back to the slammer. Join Chip and Dale and the rest of the Rangers in their wacky new adventure. Help them explore the dangerous levels of the downtown restaurant and meet the exploding personality of Water Rabbit. Aid them on their escape through the freezing floors of the giant refrigerator. Search the ghostly walls of the haunted warehouse and find the final clue to unravel the secret headquarters of Fat Cat.', 'C', 425, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnj.jpg'),
(11, 'Chiyonofuji no Ooichou', '7th January, 1991', 'The player is able to customize their own sumo wrestler by giving him a unique appearance. Characters have a chibi appearance to them. \n \nItems that can be added include are the eyes, ears, mouth, and nose. Once the customized wrestler is created, he must fight against other sumo wrestlers for the title of Yokozuna. There are two bars for each player that allow the player to fend off and deliver attacks. A tutorial mode is added that allows players to practice their moves against an AI opponent that is lower in intellect that the actual game\'s AI.', 'C', 426, 0, 2.5, ''),
(11, 'Choplifter', '31st December, 1982', 'Choplifter is a 1982 Apple II game developed by Dan Gorlin and published by BrÃ¸derbund. It was ported to other home computers and, in 1985, Sega released a coin-operated arcade game remake, which in turn received several home ports of its own. While many arcade games have been ported to home computers and consumer consoles, Choplifter was one of the few games (Lode Runner is another) to take the reverse route: first appearing on a home system and being ported to the arcade.', 'C', 427, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ca2jt1qcgtwlsrtyz7en.jpg'),
(11, 'Choujikuu Yousai - Macross', '10th December, 1985', 'The game is based on the popular anime TV series of the same name. The player controls a transformable VF-1 Valkyrie variable fighter in an unending battle against an invading race of giant humanoid aliens known as the Zentradi.', 'C', 428, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hd3gdr6mz4nhgqzrxv6r.jpg'),
(11, 'Choujin Sentai Jetman', '21st January, 1992', 'In the year 199X, Earth Defense Sky Force orbits the planet. They survey the Earth 24 hours a day to maintain world peace. When problems arise they send in agents to help out. SF-W6 and SF-W3 are two such agents. Upon completing a mission they are promoted to J-project status. Aboard the ship, The Chief explains that when hit with Birdronic waves, they will turn into Choujin Sentai. Immediately after Tendou Ryu\'s conversion into a Jetman, the enemy Vyram attack. Radiguet, the leader of the Vyram, announces that they have conquered other detentions and now plan to conquer the 3rd dimension. \n \nDuring this attack, Ryu loses his girlfriend Rie through a hole in the ship. The Birdronic wave machine shatters and the remaining 4 waves are sent down to Earth at random. After the attack Ryu and The Chief search the Earth to find the remaining members of the group.', 'C', 429, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yz2cf4ycfy1p2mndbllx.jpg'),
(11, 'Chris Evert &amp; Ivan Lendl in Top Players\' Tennis', '1st February, 1990', 'Top Players Tennis is a Tennis game, developed by Home Data and published by Asmik Corporation of America, which was released in 1990. \nIn single-player mode, the player may compete in the four Grand Slams: the Australian Open, the French Open, Wimbledon, and the US Open. To compete in the Grand Slams, the player must first win the qualifying tournament, the Asmik Open. \nWith a multiplayer console accessory such as the NES Satellite or NES Four Score, Top Players\' Tennis accommodates up to four simultaneous players. Singles, doubles, or mixed doubles are all available for play.', 'C', 430, 0, 2.5, ''),
(11, 'Chubby Cherub', '1st February, 1985', 'Q-tarÅ\'s friends are kidnapped by several burglars. Q-tarÅ has to save them, however many dogs are in the wayâ€”Q-tarÅ\'s one fear as a ghost. Q-tarÅ the Ghost (Chubby Cherub in the English version) has to cross 12 levels, at the end of each, the protagonist will find his friends. Eating food maintains Chubby Cherub\'s flight. If the flying meter goes all the way down, the character will have to stay on ground. The character will bark at the dogs before they bark at the character; if a bark hits the character, the character may die.', 'C', 431, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z1bfv573sx512fo4zatr.jpg'),
(11, 'Chuugoku Senseijutsu', '29th November, 1988', 'A fortune-telling simulator for the NES developed by Sanritsu and Aicom and published by Jaleco. \n \nA fortune-telling game that uses Eastern mysticism to prognosticate on the player\'s future, based on their year of birth. Though fortune-telling devices weren\'t unheard of, this was the first NES &quot;game&quot; to provide such a service. It would, however, be followed almost immediately with Induction Produce\'s \'89 Dennou Kyuusei Uranai; another fortune-telling interactive simulator. \n \nThe player can choose to receive their fortune in distinct areas of their lives, including romantic prospects, the best time to marry their partner and the outcome of their future business dealings. Due to the minimal impact and relative obscurity of Eastern horoscopes in the west, the game was never released outside of Japan, though the US would eventually receive their own equivalent with Taboo: The Sixth Sense.', 'C', 432, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ju7bi1doolesr9ysmtds.jpg'),
(11, 'Chuuka Taisen', '21st October, 1989', 'The player controls Mike Chen floating on a cloud, maneuvering around the screen and shooting balls of energy at flying enemies. Powerups can be collected for stronger and faster firepower. Some parts of the game stage have doors that give the player the opportunity to buy special bomb types with collectible credits. Each stage has its own mini-boss and big boss. Throughout the stages, the player restarts at certain checkpoints after losing a life.', 'C', 433, 0, 2.5, ''),
(11, 'Circus Caper', '1st August, 1990', 'The single-player, side-scrolling action game takes the player through various levels, each with a circus theme, fighting various enemies and bosses until he finally defeats the ringmaster and save his sister. The player start out in the game with little life and few weapons, but he can collect various icons to increase how many direct hits that he can withstand, keys to open doors, along with various circus items to shoot as projectiles. \nMany of the levels can be avoided altogether by just walking backwards and back through the curtain from where the player begins. This will take him right to that level\'s boss battle. \nBonus levels include such fun things as guiding a bear to jump over flames, avoiding boulders in a car, using Rodan as target practice and meeting Godzilla at the circus grounds.', 'C', 434, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/psczgj4ueb9k3kdc1qgz.jpg'),
(11, 'Circus Charlie', '31st December, 1984', 'An action/platform game in which the player controls a clown named Charlie who partakes in various circus attractions.', 'C', 435, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1tt7.jpg'),
(11, 'City Adventure Touch: Mystery of Triangle', '14th April, 1987', 'CITY ADVENTURE touch MYSTERY OF TRIANGLE is an action game for the Famicom and NES system that was published by Toho in 1987. The game is based on the high school and baseball team themed manga Touch. City Adventure Touch is somewhat notorious in Japan for bearing absolutely no resemblance to the source material. A comic book concerning the Mystery of Triangle is included in the manual. The story appears to revolve around a character\'s dog who disappears into an alternate dimension, and the three children who attempt to rescue it, one of which attacks by throwing baseballs.', 'C', 436, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hvbquhb0tawawcawgwge.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'City Connection', '1st July, 1985', 'City Connection (ã‚·ãƒ†ã‚£ã‚³ãƒã‚¯ã‚·ãƒ§ãƒ³ Shiti Konekushon) is a video game developed and published in 1985 by Jaleco for the arcade in Japan and published by Kitcorp as Cruisin\' outside of Japan. \n \nThe game supports up to two players (playing alternatively). It\'s a platform game in which the player controls a car that can never be stopped. The car normally moves at the same speed, although the player can push in the direction the car is moving to make it drive slightly faster. It can only 180Â° handbrake turn or jump (normal jump or high jump). The object of the game is to drive through a series of cities and paint every part of the roads in each city as proof of the player\'s visit to that city. City Connection was remarkable for its time in that each location had its own background and music which was a variation on the main theme of the game. There are twelve locations: Manhattan, the Grand Canyon, Easter Island, Paris, Neuschwanstein Castle, London, Sydney, Egyptian temples, and cities in India, Holland, China and Japan.', 'C', 437, 0, 3.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sqcibubeqpxfn9usfdc8.jpg'),
(11, 'Clash at Demonhead', '27th January, 1989', 'Clash at Demonhead is an open-ended platformer. The player takes control of Billy &quot;Big Bang&quot; Blitz, who is capable of running, jumping, and shooting. He is initially armed with a handgun, though various upgrades can be purchased from a shop. He later gains the ability to perform various powers by collecting Force, including shrinking, teleportation to previously-visited areas, flight, healing, and invincibility. The player chooses levels from a world map that consists of over forty routes. Various objectives must be met to complete the game.', 'C', 438, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qny.jpg'),
(11, 'Classic Concentration', '1st October, 1990', 'Concentration was a popular game show in the mid-to-late 1980s and this game was adapted from that television program. Two players can play against each other, or one person can play against a computer generated opponent. The answer to the puzzle is hidden by tiles. The tiles have words denoting game prizes (&quot;Mexico&quot;, &quot;Camera&quot;, &quot;Telescope&quot;, for example) and your object is to find the two matching worded tiles. Exposing two at a time, your memory is taxed as more prize tiles are revealed and then covered over again. As more tiles are matched, the hidden puzzle is revealed. Solve the puzzle and you win the game.', 'C', 439, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/urhmwjkd3wfb0vre9aoi.jpg'),
(11, 'Cliffhanger', '1st November, 1993', 'Standard side-scrolling fighter based off of the Stallone film of the same name. Sly must fight thugs and the elements as he tracks down suitcases of stolen cash dropped around the peaks of the Rockies. Combat follows the Final Fight standard, broken up by some mountain climbing and running (or 3-D snowboarding on the Sega CD) from avalanches. \n \nEnemies are the standard brawler crooks, occasionally carrying guns and knives the player can pick up. The game tends to follow a pattern of having you deal with a natural hazard (scaling a cliff, leaping over gaps), then locking the screen down for a fighting segment, nature again, fighting again, etc. The available fighting moves is limited, compared to other games of this type, and the ability to hit an enemy character is noticeably less accurate. \n \nThe plot is identical to the film, with levels based off of, or inspired by, scenes in the movie. Animated cutscenes move the story along on the cartridge systems, while brief clips from the film play between levels on the Sega CD.', 'C', 440, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vt4a1gwgvt88td3atuvb.jpg'),
(11, 'Clu Clu Land', '22nd November, 1984', 'Are you clever enough to unravel the mystery of Clu Clu Land? The evil Sea Urchin has hidden all the gold in Clu Clu Land in an underground mystery maze. It\'s up to you to find the gold before time runs out! But beware. The Sea Urchin will do everything in his power to stop you. He\'ll set up traps to trick you, like inviting you into his house where you\'ll be swallowed alive! Or bounce you against the Rubber Trap and land you flat on your back! But if you, or you and a friend, can control the Sea Urchin by stunning him with electric shockwaves, you just might find out where he\'s hidden the gold and move on to an exciting bonus round! \n \nThis version of Clu Clu Land was released for Nintendo\'s Versus series arcade hardware as Vs. Clu Clu Land. It also received a home release in Japan under the name Clu Clu Land: Welcome to New Clu Clu Land.', 'C', 441, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnz.jpg'),
(11, 'Cobra Command', '21st October, 1988', 'A horizontal helicopter shoot \'em up for Arcade and NES, where the player is tasked with both eliminating enemy forces as well as rescuing hostages.', 'C', 442, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/itf9y9ditwlnrwypvg5g.jpg'),
(11, 'Mission Cobra', '1st February, 1989', 'Searing gunfire inflicts heavy damage on both sides as you slice into a murderous squadron of enemy fighter jets. As the commander of a fast and powerful helicopter, you must face an intense struggle against a pair of patrolling choppers before you are allowed to turbo-boost through enemy defenses to reach the motherships. Only with fast reaction and uncanny accuracy can you defeat the motherships which launch a seemingly endless arsenal of weapons.', 'M', 443, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zs8kr4gra9tye0efuduu.jpg'),
(11, 'Cobra Triangle', '1st July, 1989', 'in Cobra Triangle the player controls a weapon-equipped speedboat through 25 levels. Objectives include winning races, saving swimmers, and defusing bombs. The game also includes power-ups and is displayed from a 3D isometric perspective with automatic scrolling that follows the player\'s movement.', 'C', 444, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnm.jpg'),
(11, 'Cocoron', '3rd June, 1991', 'Tapir, an enigmatic blue wizard in spotted pajamas from the Dream World, sends the player on a quest to rescue princess Rua. But things quickly become more complicated and the player soon has to rescue other characters along the way, such as Santa Claus, the king of Trump castle and the blue fairy Cocoron. Tapir can manipulate people\'s dreams and this ability gives Cocoron an unique twist - the player can assemble his own character by combining one of the eight available heads to one of the eight available bodies (which both include several designs to choose from, resulting in literally hundreds of combinations! ). More than a mere physical appearance, each part also defines the character\'s attributes, such as his health, speed, how high he can jump and so forth.', 'C', 445, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fvi1vpum3rxx4bzew6tg.jpg'),
(11, 'Code Name: Viper', '23rd March, 1990', 'The player takes the role of Kenny Smith, an agent of the 98th Special Forces, also known as &quot;Code Name: Viper&quot;, who is assigned by his commander, Director Jones, to investigate a large drug syndicate that covers all of South America. Smith\'s objective is to rescue a missing Viper agent in each of the syndicate\'s seven hideouts and uncover clues of the Syndicate\'s true mastermind.', 'C', 446, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnn.jpg'),
(11, 'Color a Dinosaur', '30th September, 1993', 'Color a Dinosaur is an electronic coloring book designed for kids ages 3 to 6. The game provides 16 different dinosaurs which can be colored in with a variety of colors and patterns. There are two coloring modes available: free form mode where you control a pencil and select the region to be colored, or automatic mode where the computer selects a region and you only have to select a color.', 'C', 447, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nebdp1axqowbnac4ma6x.jpg'),
(11, 'Columbus: Ougon no Yoake', '19th December, 1992', 'A nautical strategic RPG hybrid action in the vein of Uncharted Waters. You follow the life of Christopher Columbus as he goes from rookie captain to his landing in America. After a few tutorial missions, you get turned loose on an open world to build fame for yourself by doing quests, slaying rare monsters holed up in dungeon areas, etc., until a King of a prominent country can be convinced to support your expedition to the New World.', 'C', 448, 0, 2.5, ''),
(11, 'Commando', '1st May, 1985', 'Several levels await your super-tough Commando in this arcade conversion. Armed with only a standard rifle and a few grenades you must take on hordes of Nazis. Some are wandering around in the open, while others have picked out hiding places, which you must approach from certain angles. Trees, rivers and bridges create a varied combat-like terrain and must be incorporated into your thinking. Extra grenades can be collected, and will definitely be required, as they allow you to kill form distance and thus avoid some enemy shots.', 'C', 449, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qno.jpg'),
(11, 'Myth: History in the Making', '31st December, 1992', 'In this platform game, you are a mere mortal who has been called by the Gods to defeat several mythological creatures that have been turned bad by the evil Dameron. \n \nMyth: History in the Making is a platform game with a lot of fighting. The levels of this game deal with different mythologies, from ancient Greece to the Vikings, over to Valhalla (where none other than the hammer-wielding Thor awaits you), and more.', 'M', 450, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kfbhzqkk5bjppq1vp5i1.jpg'),
(11, 'Conflict', '1st April, 1990', 'Conflict is a hex-based NES war game where the player is a three-star general who must accompany his troops to the ultimate victory. The player can earn or lose victory points by occupying cities and destroying units of the opponent\'s army. The player controls the Western Bloc while the computer (or second player) controls Eastern Bloc troops. A sequel was released for the Super NES entitled Super Conflict.', 'C', 451, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/howav5hl50zijiqd6vqt.jpg'),
(11, 'Conquest of the Crystal Palace', '24th September, 1990', 'Return to the once beautiful Crystal Palace where your father\'s kingdom was brutally overthrown by Zaras, king of the infernal plateau. Call upon your guardian dog. Zap and battle your way through the peaks of Mount Crystal. Find Kim at the astral-mart, she will help you along your way with tools and food needed to make this awesome journey. Step into the Realm of the Guardian, the walkway to impending doom. Acid rain is forecasted by QNN... so keep your eyes on the road ahead. Beware! You will fight the biggest, meanest enemies ever seen on the NES! Investigate the Lair of Hungry Ghosts, gather special weaponry and gold. Enter the Gateway of Flame. Look out! The pathway has disappeared and there\'s only a moment between you and a sea of lava. These tasks and much more must be accomplished if you wish to regain your rightful throne!', 'C', 452, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnx.jpg'),
(11, 'Contra Force', '30th September, 1992', 'Contra Force is an action shooting game released by Konami for the Nintendo Entertainment System in 1992 in North America. It is a spinoff of the Contra series, being the third game in the series released for the NES following the original Contra and Super Contra, although the game\'s plot and setting are unrelated to previous entries, as the villains in the game are human terrorists instead of an alien menace', 'C', 453, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnp.jpg'),
(11, 'Corvette ZR-1 Challenge', '1st February, 1991', 'The game involves at driving on America\'s roads at approximately 200 miles (320 km) per hour from Boston to Los Angeles - a whopping 2,990 miles (4,810 km) from start to finish. Each player must try to gain personal glory by competing against eight computer-controlled players who can race their way across the United States of America. However, the drivers have fictional names and are neither based on the Formula One or the NASCAR Winston Cup (now Sprint Cup Series) racers of that era. If the game was based on real world physics, it would take at least fourteen days to get from Boston to Los Angeles (providing that only fuel stops were made and no attempts were made to get some sleep).', 'C', 454, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/essyth1j0okwxnvagy7v.jpg'),
(11, 'Cosmic Epsilon', '24th November, 1989', 'An alien menace from the Epsilon Empire threatens to destroy life on Earth as you know it! Take flight and blast your enemies down in this rail shooter that is reminiscent of Space Harrier. Cosmic Epsilon puts the NES through its paces with a stereoscopic 3D mode and advanced background scaling.', 'C', 455, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sqbmouxbbe4gvnogtwpj.jpg'),
(11, 'Cosmic Spacehead', '31st December, 1993', 'Cosmic needs your help! He has no money, no car, and no respect from his fellow Cosmonaut\'s! The trouble is, no one believed his tale of discovering a far away planet called &quot;Earth&quot; so it\'s your job to help him get back there and take some handy snaps! Starting from his home town Old Lino Town, it\'s Cosmic gameplay all the way in a unique blend of adventure and arcade action plus a whole galaxy of surprises thrown in!', 'C', 456, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pamddzwd1njhyzyo51an.jpg'),
(11, 'Cosmic Wars', '4th September, 1989', 'Cosmic Wars (ã‚³ã‚ºãƒŸãƒƒã‚¯ã‚¦ã‚©ãƒ¼ã‚º Kozumikku WÅzu?) is a turn-based strategy video game produced by Konami in 1989 which is based upon the characters and conflicts of the popular Gradius series. It was released only in Japan. The game received a sequel in 1997, with Paro Wars, which is the Parodius equivalent of this game. \n \nThe object of Cosmic Wars is to utilize an army composed of Gradius characters (Vic Vipers, and Big Cores) and battle enemies in various star systems. The player can be either the Bacterion Empire or the forces of Gradius. There are many different unit types, ranging from small fighters to large capital ships.', 'C', 457, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qlgqibkcdpzj4sekvesq.jpg'),
(11, 'Cosmo Police: Galivan', '11th December, 1985', 'Cosmo Police Galivan puts the player in control of a human being armed with a beam blade, which is only able to attack monsters in close proximity. As the game continues, the player character can use different powers - some ranged - to take out enemies and progress further. Eventually, the player will have the option of becoming a metal-armored officer with considerably more fire-power, though this power-up state will vanish if too much damage is taken. The player character will also level-up after destroying so many enemies, improving their health and &quot;cosmo points&quot; - a stat similar to mana that is used to power the player character\'s special attacks. \n \nThe game\'s world is a network of caves that the player can explore for necessary items and bonus areas. The NES version expands this aspect, providing some Metroidvania-esque exploration. Some impediments are in place to restrict further exploration until the right item is found, as well.', 'C', 458, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zn3yaoezjpvrkalkjjog.jpg'),
(11, 'Cosmos Cop', '19th July, 1992', 'Cosmos Cop is a pseudo-3D into-the-screen shoot \'em up that is similar to Sega\'s Space Harrier. However, the game experiences a lot of image breakup on the screen due to the NES\'s limited capability of handling first-person scaling.[2]', 'C', 459, 0, 2.5, ''),
(11, 'Cowboy Kid', '1st February, 1992', 'Sheriff Sam and Little Chief are coming to town in this delightful western adventure. COWBOY KID is a two player simultanious action adventure for the entire family. COWBOY KID has 4 MEGS of action packed into this NES cartridge. Players must learn to be appointed sheriff so they can rid the West of the scourge of evil. Can you bring these dudes to justice? \n \nCOWBOY KID rounds up arcade and adventure action for the wildest showdown in the West. Beware rustlers, There\'s a new sheriff in town!', 'C', 460, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnq.jpg'),
(11, 'Crackout', '1st February, 1991', 'Crackout is a video game that was released for the Nintendo Entertainment System by Konami in 1991. It is based upon Atari\'s Breakout games of the 1970s. The object of the game is to clear levels by either destroying all bricks or defeating the enemies. \nThere are four zones of eleven levels each. The zones are Cubic Zone, Mirror Zone, Tube Zone and Final Zone. This game differs from the original Breakout as it contained enemies on screen that could be hit to gain power ups. Powerups included a parachute to slow the ball down, multiple balls, or projectiles. There were also level warps in the form of &quot;Konami Man&quot;, who would fly from top to bottom of the play area. There were typically 1 - 3 enemies on screen at once, appearing out of a trapdoor in the top corners, or let in through the side walls. Every few levels there was also a boss, ranging from a small dragon to a centipede. The bosses changed colour from Green to Blue to Pink, each time increasing in speed. Each level also contained a hidden letter which made up a password presented at the end of the game (Zone 4 Level 11). If this was not input correctly, the player restarted the game from the beginning. If the player input the password correctly, they were shown the end credits which consisted of a procession of the enemies from the game. The password is MERRYCHRISTMAS.', 'C', 461, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uqpyhyrspjk5qaigxqkr.jpg'),
(11, 'Crash \'n\' the Boys: Street Challenge', '26th June, 1992', 'Theodore &quot;Todd&quot; Thornley IV has had enough. After being humiliated once again by his rival, Jeff &quot;Crash&quot; Cooney and his blue-collar buddies from Southside High School at the All-City Track Meet, he has decided to issue a challenge to Crash. Inviting two of the other elite high schools to participate in the challenge, plus an additional team sponsored by his wealthy father, Todd has seemingly stacked the deck against Crash and his boys. The game has four different teams to choose from, as well as a fifth computer-controlled team. Each team have five members each with their own strengths and weaknesses, making some better suited to certain events than others. Before each event, players have the opportunity to go shopping in the mall to buy power-ups for their characters. These items are paid for through the various medals that each team achieve as they progress through the challenge, but since the winner of the challenge is the team that collects the most medals overall, players must be fairly judicious in how much they spend. There are two types of events in the game: individual events (Hammer Throw and Roof Top Jumping) and head-to-head events (400 Meter Hurdles, Swimming and Fighting). In individual events, each team takes turn individually and ranking is determined by who gets the most points. The head-to-head events take place under a single elimination tournament format, in which one player against another in a series of heats. The player who successfully defeats both of his opponents will get to compete against a member of Team Thornley for first place. The game can be played by up to four players. Since there\'s never more than two teams competing at the same time, the third and fourth player can play simply by alternating between the two controllers. Thus, a four player adapter is not required, unlike other Kunio-kun games.', 'C', 462, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/djldtl8ypa9emztoakkc.jpg'),
(11, 'Crayon Shin-Chan: Ora to Poi Poi', '27th August, 1993', 'The game is a simple card game with a Tetris element. The layout is similar to a Tennis court with both players on either sides defending their goal, while stacks of cards are positioned in the center. Players must move Shin up and down sliding cards, in two\'s, to the center pile matching up symbols and push each stack back to the opponent\'s side in an attempt to over take their goal.', 'C', 463, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hzrrmdwckw19i0hthofb.jpg'),
(11, 'Crime Busters', '31st January, 1989', 'Crime Busters is an Action game, developed and published by Bit Corp., which was released in Asia in 1989.', 'C', 464, 0, 2.5, ''),
(11, 'Crisis Force', '27th September, 1991', 'The denizens of Atlantis have arisen after a slumber of 10,000 years, and only Asuka and Maya can save the world from destruction in their Aurawing aircraft! Crisis Force was Konami\'s last shoot-\'em-up game for the Famicom, and it pushes the hardware to its absolute limits.', 'C', 465, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b7lnzvfwgabzcd7lkrwb.jpg'),
(11, 'Crystal Mines', '1st February, 1989', 'You control a CM-205 mining robot, your goal is to retrieve &quot;Starla&quot; crystals from various mines on a remote planet. Using the robot you need to locate your quota of crystals while avoiding the many dangers present in the mines, including lava, rock slides, and unfriendly creatures. The robot is equipped with explosives to help reach remote locations in the mine, or destroy any creatures getting in the way (be careful with explosives, you could set off a rock slide and crush the robot!) Once your crystal quota is met, quickly locate the exit and move on to the next, more challenging mine. Crystal Mines is part action and part strategy. There is a time limit to locate the crystals in each mine, plus avoiding falling rocks and monsters will keep you on your toes, but before long you will need to figure out how to locate crystals by properly removing obstructions and navigating tricky mazes.', 'C', 466, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qhh2u7gcm9xxcdwvlfba.jpg'),
(11, 'Crystalis', '13th April, 1990', 'You must save the world from evil magic by finding the four powerful swords that form Crystalis. \n \nAfter the apocalypse, magic returns to Earth. \n \nA blessed group of good-intentioned sorcerers have used their new magical powers to rebuild the Earth, but an evil sorcerer named Dragonia has combined his supernatural forces with man-made technology to devastate the rebuilt Earth. It is your mission to recover four mystical swords, and combine them to form the ultimate blade: the Sword of Crystalis. This legendary weapon is the only tool which can put an end to Dragonia\'s black reign.', 'C', 467, 0, 3.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnr.jpg'),
(11, 'Cyber Stadium Series: Base Wars', '1st June, 1991', 'Cyber Stadium Series: Base Wars was developed by Konami as a futuristic baseball game for the Nintendo Entertainment System. It was released in 1991, and was intended to bring a new dynamic to the baseball genre in gaming.', 'C', 468, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nl5czbghkwjmflnbho9x.jpg'),
(11, 'Cyberball', '1st September, 1988', 'Cyberball is an Atari Games arcade game of 7-man American football, using robotic avatars of different speeds, sizes, and skill sets. The game replaced the standard downs system with an explosive ball that progresses from &quot;cool&quot; to &quot;warm&quot;, &quot;hot&quot;, and &quot;critical&quot; status as it is used. Players can only defuse the ball, resetting it from its current state back to &quot;cool&quot; by crossing the 50 yard line or by change of possession, whether through touchdown, interception or fumble. A robot holding a critical ball while being tackled is destroyed along with the ball. The robots also possess finite durability. As offensive units are tackled, they wear down, finally issuing smoke and then flames after a number of hits. A flaming robot will explode when hit, thereby fumbling the ball. Players can upgrade robots with faster and more durable units using money bonuses they earn during play.', 'C', 469, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gzfzslsvahpvroxaco2y.jpg'),
(11, 'Cybernoid: The Fighting Machine', '31st December, 1988', 'Cybernoid: The Fighting Machine is a shoot \'em up developed and published in 1987 by Hewson Consultants for the ZX Spectrum, and was then ported to the Amstrad CPC, Atari ST, Commodore 64, NES, and Amiga. It was programmed by Raffaele Cecco. The Sinclair ZX Spectrum and Atari ST versions featured a main theme by Dave Rogers, while the Commodore C64 version (later released on the Wii\'s Virtual Console service) featured a completely different theme by Jeroen Tel.', 'C', 470, 0, 1.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ivxthbcdtx4vlzil2fmg.jpg'),
(11, 'Cycle Race: Road Man', '17th January, 1989', 'It is the player\'s ultimate objective to make it all the way around Japan. If the player ends up completely damaging the bicycle, running out of energy, or falling behind a certain ranking, then he or she will automatically lose the race. Players can choose a representative from either Team USA, Team Japan, Team France, or Team Italy. As long as the player has at least one spare bicycle in the inventory, games will never end on a completely damaged bicycle. Passwords are used to save the game. \n \nThe race is 4,000 kilometers long (2485.5 miles). Players must traverse the countryside that separates major Japanese cities along the coastline during the course of these 4,000 kilometres. Interesting scenery includes forests and cattle farms. \n \nPlayers are always given the exact altitude of each section; they are also shown how far in a stage the player has to advance in order to reach the finish line.', 'C', 471, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zq22gf6giy4ifnzm53e3.jpg'),
(11, 'Dai-2-Ji Super Robot Taisen', '19th January, 1992', 'Dai-2-Ji Super Robot Taisen is a Strategy game, developed by WinkySoft and published by Banpresto, which was released in Japan in 1991.', 'D', 472, 0, 2.5, ''),
(11, 'Daikaijuu Deburas', '14th July, 1990', 'Scientists discover a giant egg in the ocean, but before it can be studied a Giant Monster (Kaiju) erupts from the sea bent on destroying the egg. Can you battle the monster, limit your losses and ultimately rescue the egg? Tokyo is depending on it!', 'D', 473, 0, 2.5, ''),
(11, 'Daiku no Gen-San 2: Akage no Dan no Gyakushuu', '22nd November, 1993', 'Daiku no Gen-San 2: Akage no Dan no Gyakushuu is an Action game, developed by Micronics and published by Irem, which was released in Japan in 1993.', 'D', 474, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/og9gsraognbzfxeccq9n.jpg'),
(11, 'DAIVA Story 6: Imperial of Nirsartia', '4th January, 1987', 'Daiva Story 6: Imperial of Nirsartia is an Action game, developed by T&amp;E Soft and published by Toshiba EMI, which was released in Japan in 1986.', 'D', 475, 0, 2.5, ''),
(11, 'Dance Aerobics', '1st February, 1987', 'Dance Aerobics is a chance to get fit by following the movements of an aerobics instructor. \n \nPlayers use side B of the Power Pad accessory (a floor mat with 12 pads in a 4 by 3 grid) to follow the movements of an aerobics instructor. To succeed the player must press the pads with their feet and hands at the same time as the on screen aerobics instructor. Any missed movements are recorded on a mistake counter and 10 missed movements will fail the level. The routines (a set of repeated movements) start slow and simple with a bit of no-penalty practise time however as the player gets better the routines get more complex with less practices time. Each level has a set number of routines that increase with each level from 4 at the start to a total of 32 on the final level (level 7). At the successful completion of each level the player will get a pass stamp which they can enter later to skip that level.', 'D', 476, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lvvylwhmx38qvakf5oed.jpg'),
(11, 'Danny Sullivan\'s Indy Heat', '31st December, 1991', 'A 3-player, Indy style racing game with 5 cars that each race around 15 of Danny Sullivan\'s favorite tracks. Players can turbo, crash, catch fire, and lose fuel, but they may pit stop for repair. Danny himself always races (yellow car) and players can earn money for more turbo, faster pit crew, acceleration, brakes, and tires.', 'D', 477, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qne2ofyoro0cw0eooukw.jpg'),
(11, 'Miracle Warriors: Seal of the Dark Lord', '1st November, 1986', 'Japanese RPG. Two editions exist, one for the MSX1 on cartridge, and one for the MSX2 on 3.5&quot; diskette. \n \nThe seal of the Dark Lord Terarin has been broken and Terarin has been unleashed into the world again. She has stolen the Golden Seal and opened pandora\'s box, unleashing evil creatures into the world. A young hero is tasked by a king to stop Terarin. He must step into footsteps of Iason, a shepherd that once accidentally unleashed Terarin and fought to seal the Dark Lord again. The hero must enlist the aid of three companions, Guy the warrior, Medi the amazon and Treo the pirate (called Turo in the manual) and find the three keys to Terarin\'s lair. To face the Dark Lord, they must find the mystical weapons and armor of old and then defeat Terarin and seal the Dark Lord from the world.', 'M', 478, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/patsi3m8fhtjfb05ewne.jpg'),
(11, 'Darkwing Duck', '1st June, 1992', 'Darkwing Duck is a 2D platformer based on the Disney cartoon of the same name. \nThe game was re-released in 2017 as part of the Disney Afternoon Collection.', 'D', 479, 0, 4.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qns.jpg'),
(11, 'Dash Galaxy in the Alien Asylum', '1st April, 1990', 'Dash Galaxy in the Alien Asylum was an action game for the Nintendo Entertainment System released in 1990 exclusively in North America. Players take the role of Dash Galaxy, a space scout who has been captured by a hostile civilization. Gameplay involves a series of floors with several rooms each. Keys must be collected to progress to higher floors and, eventually, an escape ship. Dash\'s only weapons are a limited supply of bombs and remote detonators. Good timing is crucial to completing the game, requiring navigation of trampoline jumps and roaming enemies. While the rooms are side-scrolling action puzzles, the floors have a overhead view and include more difficult block-moving puzzles which can fatally trap a player.', 'D', 480, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xeuv4oi3oca3kbeolnm1.jpg'),
(11, 'Rally Bike', '1st May, 1988', 'Rally Bike is a bird\'s eye viewed motorcycle road racing game, where the player controls a motorcycle and must cross the finish line before an established number of competitor bikes. Fuel is a major obstacle, as running out of it results in game over. Any accident will cause great reduction of fuel, and stopping to refuel will cause competitor bikes to take advantage. Competitors never run out of fuel.', 'R', 481, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d8me4a4ls3hojepjygki.jpg'),
(11, 'J. League Super Top Players', '21st May, 1994', 'The game itself is interesting, with ten teams to choose from, and multiple game modes including an actual tournament or penalty kick practicing. \n \nFor the PK Battle modes, each player must select a different team. He must then scan a player card (not a team card), and then that player will have a chance to kick a penalty kick (if it is his turn). For all other modes, the player must scan a team card and that will be the team that he will play as for the game(s). The main mode of play is the J.LEAGUE mode, of course. It is set up in a season/tournament setting, with 18 games per team. There are ten teams total in this version of J.League, and they are randomly sorted to play against a different team each day. The games are split into two periods with three minutes (3:00) apiece. Prior to starting a game, the player can choose the formation of his eleven active players, from one of three layouts that he can see on the small screen (4-4-2, 4-3-3, or 3-5-2).', 'J', 482, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1hc4.jpg'),
(11, 'Day Dreamin\' Davey', '1st July, 1992', 'The game starts out with the main protagonist, Davey, arriving at school. Then a bully (Lumpy) takes his pencil. Now all throughout class Davey is daydreaming of being in several different locations revolving around Medieval Times, the Wild West and Ancient Greece and each level contains at the end something Davey must collect that will always resemble the shapes of school items (e.g., a pencil, a ruler or a trophy).', 'D', 483, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ijcvn5gnu0h07s6klbs0.jpg'),
(11, 'Deadly Towers', '15th December, 1986', 'On the moonlit eve of his coronation ceremony, pensive Prince Myer sits at the lakeside to ponder the future of the kingdom. Suddenly, a shadowy kami called Khan rises from the lake and coalesces into the form of a man. Although he doesn\'t identify himself, the figure greets Prince Myer by name, and informs him that the wizard Rubas, the &quot;Devil of Darkness&quot;, is preparing to overtake Willner Kingdom by using seven magic bells capable of', 'D', 484, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bi9hzkyccz1vgv7a28iy.jpg'),
(11, 'Deathbots', '31st December, 1990', 'The Mutech Corporation has created their Gamma Base on what used to be Alcatraz Island. Their attempts at creating computer intelligence has backfired, as the AI they\'ve created has taken over the computer systems and is threatening the world! Deep in the fortress is a gamma bomb, and your goal is to penetrate the fortress to destroy the bomb before it can be used. But be careful, for many Deathbots are guarding the maze-like passageways leading to the bomb! \n \nGameplay is from an overhead point of view; you\'ll need to find your way through the various passageways to reach the gamma bomb (located on the 8th level) and diffuse it. In addition to doorways and walls, transporters can also be found in the maze. These will instantly teleport you to a new location, and on many levels you will need to figure how to use them correctly to get past otherwise dead ends. Different types of Deathbots guard the passages; and you\'ll need to use the various weapons you find lying about to get past them, before they destroy you. You have a limited amount of energy. Each time you are hit by enemy fire or by a Deathbot, your energy depletes. Lose all of of your energy and a life is lost. And of course, each level ends with a large boss Deathbot. Good luck on your mission!', 'D', 485, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/e0ch1np0v0d0e1ygtx1m.jpg'),
(11, 'Deep Dungeon IV: Kuro no Youjutsushi', '6th May, 1990', 'Deep Dungeon IV: Kuro no YÅjutsushi (ãƒ‡ã‚£ãƒ¼ãƒ—ãƒ€ãƒ³ã‚¸ãƒ§ãƒ³IV é»’ã®å¦–è¡“å¸«?, lit. Deep Dungeon IV: The Black Sorcerer) is the fourth and final installment in the Deep Dungeon series. \n \nUnfortunately this game has removed the custom character feature of the previous game. Through the game, the player will meet up to two additional playable characters with predetermined class. This game also reverts to the standard practice or randomizing characters\' stat growth when gaining an experience level. New to this engine is that the player can eventually learn to summon two monsters to function as a temporary additional party member for a single battle. It also removed the feature that stops random battles when the player is significantly more powerful than the enemies. This isn\'t as bad as it seems as the maps in this game are also much smaller (whereas the previous games used multi-floor dungeons up to 32x32 tiles, the dungeons in this game are either single floor, or multiple floors that can fit within a single 32x32 map) In this game, the player can accept &quot;requests&quot; from the non-player characters. These are optional tasks that will reward the player with bonus items, experience or money when finished.', 'D', 486, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p62b5swysgxqejy0luvb.jpg'),
(11, 'Defender II', '31st December, 1981', 'Arcade shooter where you protect humans from being captured by aliens.', 'D', 487, 0, 2.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zwvjedozox4nsayxywxx.jpg'),
(11, 'Defender of the Crown', '1st January, 1986', 'The Age of Chivalry! A time of lusty wenches and black hearted villains. King Richard has been murdered and England is thrown into civil war! Amidst the ringing clash of steel and the thunder of charging steeds the bold Saxon knights have chosen you to lead them into battle against the hated Normans. Victory will not come easy. To save England your skills as swordsman and military leader will be severely tested. But should you succeed youâ€™ll win the Crown of England and the love of many a beautiful damsel!', 'D', 488, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p4rcvqo3hrk8tydqagfe.jpg'),
(11, 'Defenders of Dynatron City', '1st September, 1992', 'The game centers on a team of superheroes who protect a futuristic metropolis from Dr. Mayhem and his robotic henchmen.', 'D', 489, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/t9n5jah8i1f3lev7vzqs.jpg'),
(11, 'Demon Sword', '1st February, 1990', 'The game starts out with an evil demon ruling over the world and its inhabitants, who live in fear of it. However, a man named Victar, who comes from a small village, has a sword that can destroy the demon. The blade had previously been split up into pieces, though, and Victar must travel through three worlds to get back the three broken pieces in order to restore the sword to defeat the demon', 'D', 490, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnt.jpg'),
(11, 'Wizards &amp; Warriors', '1st December, 1987', 'You are Kuros, a powerful knight who enter the woods of Elrond. Legend says that a powerful wizard named Malkil has has gone completely mad during his years and turned his powerful magic to the dark side. Malkil has his base on the castle IronSpire where he has imprisoned a young and beautiful princess. It is up to Kuros to save the princess once and for all.', 'W', 491, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mudxyvdkja2cyxxzhrse.jpg'),
(11, 'Desert Commander', '28th April, 1988', 'The player\'s force consists of nine different types of units and one headquarters unit (which is a unit by itself and also can be used to attack). Each scenario gives a different set number of units to use, which the player can mix and match between the different typese without going over that limit. When in a one-player game, the second controller can be used to modify the CPU forces. When playing against the CPU, the computer will be given a different ratio of units to command than the player. On the easiest scenario both the player and the CPU have the same amount of units, on all others the CPU will have more than the player. There is no variance in artificial intelligence, so the only thing that makes the later maps harder is the larger number of units the CPU has. The game is turn-based with no time limit. The object of the game is to destroy the enemy\'s headquarters unit. The player that does so first wins. Units have different mobility range, which varies according to the unit type and (except for aircraft) the terrain. They also have different shooting range, though this is fixed and not depends of the terrain. All unit types have limited ammunition and fuel. In order to replenish them the player must land them at the appropiate buildings; for example, all aircraft must stop at an airport in order to recharge their fuel and ammo supply. A certain unit is particularly strong or weak against a particular opponent, performing average against every other unit types.', 'D', 492, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xcqzu6xaxopnyb7rotn7.jpg'),
(11, 'Destination Earthstar', '1st February, 1990', 'A starfighter emulation game with a first-person cockpit view, like Wing Commander. Certain portions of the game require assaults on the enemy\'s planetary bases. These segments are played as 2D side scrolling shoot-em-ups, like R-Type.', 'D', 493, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uiovuczqnod10w3orqhf.jpg'),
(11, 'Destiny of an Emperor', '15th June, 1989', 'Liu Bei, Zhang Fei, and Guan Yu form a small militia to defend their village from Yellow Turban rebels, followers of the sorcerer Zhang Jiao. Liu Bei gathers peasants and farmers from nearby villages and camps, eventually defeating Zhang Jiao and his people. Tao Qian, the governor of the region, falls ill and requests that Liu Bei assume his position. Liu Bei hesitantly agrees, thus beginning the events depicted in the novel, albeit with significant alterations. Upon successfully completing the game, the player successfully unites China under the Shu Han banner.', 'D', 494, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnu.jpg'),
(11, 'Devil World', '5th October, 1984', 'Devil World (ãƒ‡ãƒ“ãƒ«ãƒ¯ãƒ¼ãƒ«ãƒ‰ Debiru WÄrudo) is a maze video game developed and published by Nintendo for the Nintendo Entertainment System. It was released in Japan on October 5, 1984 and in Europe on July 15, 1987. The game was also released on the Wii\'s Virtual Console in Japan on January 22, 2008 and in Europe and Australia on October 31, 2008. The game has similar gameplay to that of Pac-Man. It is the only game designed by Shigeru Miyamoto that has not been released in North America, despite the fact that the game is simple and in English. This was due to Nintendo of America\'s strict policies on the use of religious icons in games, which were at their strictest level at the time of the game\'s original release.', 'D', 495, 0, 3.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qnv.jpg'),
(11, 'Die Hard', '1st February, 1990', 'This PC Engine Die Hard game starts out outside, making you wonder if the people who made it ever even saw the movie.', 'D', 496, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uxt2tvegf3olliap1z5b.jpg'),
(11, 'Dig Dug', '19th April, 1982', 'Dig Dug is a 1-2 player arcade game in which you have to use your shovel to dig your way through the earth. Stopping you from doing this are two monsters, called Pooka and Fygar, who will continually chase you around. The only weapon that you carry is an air pump, which you can use to inflate the monsters to the point where they explode. (if you start to inflate them but stop doing so, the monsters will get turned back to their normal selves). Furthermore, rocks are scattered throughout the earth, and you can use these rocks to squash them. If the monsters do not find you for several seconds, they will eventually get turned into ghosts, which are able to walk through the earth. They are invincible and cannot be killed. From time to time, vegetables will appear in the center, and you can get these for points.', 'D', 497, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1pjp.jpg'),
(11, 'Dig Dug II: Trouble in Paradise', '1st March, 1985', 'DIG DUG has decided to chill out from the pressures of the real world by taking a long overdue vacation on a beautiful Caribbean island. &quot;At last,&quot; he thinks to himself, &quot;sun, sand, surf, and no more hassles from those miserable pests Pooka and Fygar!&quot; Lying in a hammock between the graceful palm trees, he drifts off into a blissful dream of beautiful bikini clad native girls catering to his every wish. But just when he thinks he\'s got it made in the shade, along come his troublesome enemies to turn his peaceful paradise into a tropical nightmare. Help DIG DUG rid the island of these irritating intruders and bring tranquility back to his vacation by the sea!', 'D', 498, 0, 3.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ccwezdbc48fwmr92lud7.jpg'),
(11, 'Digger T. Rock: The Legend of the Lost City', '1st December, 1990', 'The game centres around the miner Digger T. Rock, as he spelunks various caves and catacombs whilst searching for the mythical Lost City.\n\nThe game was the first game to be developed by the newly re-branded Rare, whereas the first game to be released under the company was Solar Jetman, earlier in 1990. Digger T. Rock is also the first Rare game released for a Nintendo console. \n\nIt was later included in Rare\'s 2015 Xbox One retrospective compilation, Rare Replay.', 'D', 499, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tijof3gckejblesn4xlb.jpg'),
(11, 'Digital Devil Monogatari: Megami Tensei II', '6th May, 1990', 'Digital Devil Story: Megami Tensei II is the sequel to Digital Devil Story: Megami Tensei. It was published by Namco in 1990 for the Family Computer and is the second video game in the Megami Tensei series. This is the first game in the series to not be based on the original novels by Aya Nishitani, but it retains much of the gameplay aspects of its predecessor. The music in the game is enhanced by an eight-channel Namco 163 WSG sound chip on the cartridge. \n \nDigital Devil Story: Megami Tensei II retains several gameplay aspects of the first game, including demon catching and fusing and first-person dungeons. \n \nThere is a world map that features overhead graphics. The player controls the party through the world map and dungeons, fighting enemies in random encounters with turn-based combat. Transportation such as rail and highway that existed at the end of the 20th century does not exist; movement by foot is the most common activity in the game. There is a big hole in the ground that limits the player\'s explorations. Underground passage appear in the guise of former subway tracks. 3D dungeons have been adopted in this game for beginning player. However, there were many glitches and disruptions that occur under auto pilot, causing it to hang under certain conditions. \n \nWhen both the hero and his partners are dead, the game over screen consists of the underworld ferryman Charon picking up a soul.', 'D', 500, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xnpyc9hw8dxjpsypo6cg.jpg'),
(11, 'Dirty Harry', '31st December, 1990', 'Dirty Harry is based on the popular Clint Eastwood movie character of &quot;Dirty&quot; Harry Callahan (rather than the specific movie &quot;Dirty Harry&quot;), a cop famous for his use of a .44 magnum for doing away with evildoers, and for his catchphrase, &quot;Go ahead, make my day.&quot; In fact, the game begins with a digitized sample of that quote. The game play consists primarily of side-scrolling action. Dirty Harry can punch and kick the copious thugs that assault him using their own fists, guns, baseball bats, nets, and dynamite. The hero can also pull is .44 and aim it in 5 directions in order to pick off enemies, but the ammo is limited. Further, Dirty Harry has a number of other tools at his disposal, provided he collects them.', 'D', 501, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/btn04bhdkbcx7u3rm3qs.jpg'),
(11, 'Dizzy the Adventurer', '9th January, 1992', 'Grand Dizzy was feeling very down one day, so Dizzy and Daisy decided to cheer him up by baking him his favourite food, cherry pie! So off went Daisy to get some cherries from her cupboard and there were none to be seen! &quot;Pogie\'s pinched the cherries!&quot; she cried, as she saw Pogie\'s pawprint in the cupboard. &quot;That darned fluffle. Come here you!&quot; and Pogie promptly darted off into the enchanted forest to escape Daisy\'s rage. Dizzy and Daisy decided to go into the forest to catch Pogie and gather some more cherries at the same time. Whilst searching for Pogie they got lost and found a castle, where they thought they would find help, but it seemed deserted. They looked in the castle for Pogie, but Daisy caught herself on a mystic spinning wheel. She started feeling really sleepy, so she found a bed and went to sleep. &quot;Wake up Daisy, wake up!&quot; shouted Dizzy. But before he could wake her up, Rockwart the troll caught him and locked him up in an underground prison! Now Dizzy must escape, wake up Daisy from her enchanted sleep, defeat Rockwart, and find the cherries along the way.', 'D', 502, 0, 2.5, ''),
(11, 'Don Doko Don 2', '2nd March, 1992', 'Similar to the original Don Doko Don, the player controls a bearded dwarf wielding a hammer to flatten enemies and throw them. But unlike the original, this version is a side-scroller. The game consists of five stages, plus the final boss battles. The player\'s goal is to reach the end of each stage, defeat a boss, and collect a bag,(antidote ingredient,) to advance to the next.', 'D', 503, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wg0ef4hbdkhkxnjf8dax.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Donald Land', '29th February, 1988', 'When the Gumon Family takes over McDonaldland and captures Ronald\'s friends including Grimace, Birdie, the Fry Guys, and others, it\'s up to the jolly clown himself to put an end to their vile machinations and eat hamburgers across numerous locales leading up to the final castle headquarters of the Gumon Family.', 'D', 504, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p5dnswnbatokhab9znoi.jpg'),
(11, 'Donkey Kong', '9th July, 1981', 'The player controls Jumpman or Mario in home versions. His objective is to reach the top of the stage to save the Lady (Pauline in home versions), although he must jump over barrels and avoid fire, springoboads and sand piles. It became one of the best selling arcade games of its time and set the basics of the platform subgenre \n \nVersion differences: \n- The NES versions features less levels. However, there are two difficulty settings: Game A and Game B. Game A is easier than Game B', 'D', 505, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1vvp.jpg'),
(11, 'Donkey Kong 3', '31st December, 1983', 'Stanley is a bugman. Donkey Kong has taken refuge in his greenhouse and it is now up to Stanley to stop the ape from stirring up any more insects that will soon destroy his flowers. Stanley saves the flowers by spraying bug spray on Donkey Kong.', 'D', 506, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wk3.jpg'),
(11, 'Donkey Kong Classics', '1st November, 1988', 'What\'s more fun than a barrel of monkeys? A Donkey Kong double feature! In DONKEY KONG you\'ll duck barrel bombs and flaming fireballs as you help Mario save his girlfriend Pauline from the clutches of Donkey Kong. In DONKEY KONG JR., you\'ll join forces with these madcap monkeys to help Donkey Kong Jr. rescue his father from Mario\'s prison. Are you ready for laughter? You\'d better be. Because this double dose of monkey business will have you rolling in the aisles!', 'D', 507, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wk6.jpg'),
(11, 'Donkey Kong Jr.', '1st August, 1982', 'Mario has gone mad! He\'s turned the tables on Donkey Kong and locked him in a cage. It\'s up to you, as Donkey Kong Jr., to rescue your father by stealing Mario\'s set of keys. But it won\'t be easy. You\'ll have to fight off ape-eating Snapjaws, jump onto moving islands and break through a jungle of vines to get to the keys that will free Donkey Kong. Can you handle the action? Because this off-the-wall monkey business will have you going bananas!', 'D', 508, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1pjq.jpg'),
(11, 'Donkey Kong Jr. Math', '12th December, 1982', 'The game features one and two player modes, both of which are single screen. In the first mode, the objective is to enter math answers in order to receive points. These questions include addition, subtraction, multiplication, and division. \nIn the two player mode, two players control two characters as they race to create a math formula to reach the number shown by Donkey Kong, incorporating platform gameplay. The mechanics are similar to Donkey Kong Junior; players climb vines to reach higher areas in order to collect numbers scattered around the area. In order to complete mathematics problems, players must collect at least three things: the first number, the symbol necessary to reach the number shown by Donkey Kong, and the second number. When the game features a high number, such as 66, players must collect multiple numbers and mathematics symbols in order to reach this. For example, players could choose a nine, a multiplication symbol, and a seven, followed by an addition symbol and a three to reach the number 66. The two player game have two different levels, Calculate A and Calculate B. Calculate B is more challanging, not only the goal is a negative number, but giving players the set number.', 'D', 509, 0, 2.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wk5.jpg'),
(11, 'Doraemon: Giga Zombie no Gyakushuu', '14th October, 1990', 'Doraemon: Giga Zombie no GyakushÅ« (ãƒ‰ãƒ©ãˆã‚‚ã‚“ ã‚®ã‚¬ã‚¾ãƒ³ãƒ“ã®é€†è¥² Doraemon Giga Zonbii no GyakushÅ«?, lit. Giga Zombie\'s Counter Attack) or known as Doraemon: The Revenge of Giga Zombie in English is a game released only in Japan by Epoch for the Famicom console in 1990. The second video game outing for the popular Japanese children\'s character is a Final Fantasy style role-playing game. The player takes the role of Doraemon the robot cat and leads him on an adventure through time to stop the evil Giga Zombie.', 'D', 510, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/twbwiamqmxqcpexe7f7c.jpg'),
(11, 'Double Dare', '31st December, 1988', 'Double Dare is the computer version of the game show originally hosted by Marc Summers. Like the TV show, the game is basically a trivia game with the added enhancement of being able to answer the question, or take a dare. Dares consist of the Toss-up Challenge, the Physical Challenge, and in the last round, the Obstacle Course. Questions are varied, and in large enough number to avoid excessive repetition even over several games worth of play.', 'D', 511, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hwqkekmch2z7wzj1cr2m.jpg'),
(11, 'Double Dragon', '1st August, 1987', 'The player character has a repertoire of martial art techniques which they can perform by using the joystick and three action buttons (kick, jump, and punch) individually or in combination. Techniques range from basic punches and kicks, to more elaborate manoeuvres like hair grabbing moves and elbow strikes. When playing with another player, one can assist the other by grabbing their partner\'s opponent from behind. Caution should be taken, though, as some enemies are able to do the same thing to the players. The player begins the game with a certain number of extra lives and a life gauge which depletes as the player takes hits. If the life gauge runs out or the time limit reaches zero, the player will lose a life. \n \nThere is a small variety of enemy characters that the player will face through the course of the game. Certain enemies carry melee weapons, which can be knocked out of their hands and picked up to use against them. Available weapons include baseball bats, whips, throwing knives, and dynamite; in addition, rocks, oil drums, and boxes can be found in certain places. \n \nThe game is divided into four different stages or &quot;missions,&quot; which consist of a city slum, a factory, the woods, and the gang\'s hideout. The game normally ends if a single player defeats the final boss alone. However, if two players manage to complete the game together, they are then forced to fight each other in order to determine who will win Marian\'s affections.', 'D', 512, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w1t5vvitjelnspq4rmy7.jpg'),
(11, 'Double Dragon 2: The Revenge', '31st December, 1988', 'The arcade version of the game is essentially an improved version of the original title. The biggest change in the game\'s controls are in the replacement of the original\'s punch and kick buttons with two directional-based attack buttons (Left Attack and Right Attack) similar to Renegade. Pressing the attack button of the player\'s current direction will do a standard series of punches, while pressing the opposite attack button will perform a back kick. A few new moves are added as well, including a Hurricane Kick. \n \nLike in the original game, the arcade version of Double Dragon II is divided into four missions: a heliport, a lumber storehouse, a wheat field, and the new hideout of the boss. Each stage has its own boss character with his own theme. After defeating Willy (the final boss from the original game) in the fourth stage, the player will confront a double of their own character for the game\'s final battle. If two players reach the end together, then both will each to have to face their own clone for the final battle.', 'D', 513, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mjriph67ihwncvpgnfn4.jpg'),
(11, 'Double Dragon III: The Sacred Stones', '31st December, 1990', 'Billy, Jimmy, and the whole Double Dragon gang fight for the Sacred Stones to save in the world in yet another beat-em-up.', 'D', 514, 0, 4.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tfgefdirmoonz50hyjst.jpg'),
(11, 'Double Dribble', '31st December, 1986', 'Double Dribble, known in Japan as Exciting Basket (ã‚¨ã‚­ã‚µã‚¤ãƒ†ã‚£ãƒ³ã‚° ãƒã‚¹ã‚±ãƒƒãƒˆ Ekisaitingu Basuketto), was the second basketball arcade game developed and released in 1986 by Konami. It was the second basketball arcade game by Konami, following Super Basketball. Much of the game\'s popularity came from its animation sequences showing basketball players performing slam dunks, as well as The Star-Spangled Banner theme during attract mode, which was the first arcade game to feature the national anthem. These were uncommon in video games at the time of Double Dribble\'s release. While successful in the arcades, the game became and remained popular and remembered when it was ported to the Nintendo Entertainment System in 1987. \nDouble Dribble was followed by a sequel titled Double Dribble: The Playoff Edition, which was released in 1994 for the Sega Genesis/Mega Drive. A remake titled Double Dribble Fastbreak was released for iOS in 2010, being based mostly on the NES version; however, the animation sequences were ripped from the arcade version.', 'D', 515, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ji5zqgxhgqacmsc4csup.jpg'),
(11, 'Double Moon Densetsu', '30th November, 1992', 'Double Moon Densetsu (ãƒ€ãƒ–ãƒ«ãƒ ãƒ¼ãƒ³ä¼èª¬?) is a 1992 role-playing video game for the Family Computer published by Masaya. It is based on an earlier play-by-mail RPG also titled Double Moon Densetsu, serialized in Marukatsu Famicom and eventually Marukatsu Super Famicom; in addition to this computer game, there was also a tabletop RPG system produced based on the work. \n \nA deity named Fatima created a world with two different continents; that divided the world of sorcery from the world of swordsmanship. An evil demon plans to destroy this world by bringing forth a dark dragon from a demonic dimension.', 'D', 516, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/caxae1zq11ivbgbtwnlv.jpg'),
(11, 'Downtown Nekketsu Koushinkyoku: Soreyuke Daiundoukai', '12th October, 1990', 'This Japan-exclusive prequel to Crasn\'n the Boys: Street Challenge sees Kunio-kun competing in four not-so-traditional athletic events.', 'D', 517, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jaoivdfogozpegqbqp7j.jpg'),
(11, 'River City Ransom', '25th April, 1989', 'Hear the message from Sick, the meanest ganglord in town: &quot;I hold your high school captive, and some of the students will have a trying moment, if they\'re ever fool enough to cross my path!&quot; But you aren\'t afraid of anybody! Face the terrible gangs and neutralize their bosses, in order to deliver the city from terror!', 'R', 518, 0, 4.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qks.jpg'),
(11, 'Downtown Special: Kunio-kun no Jidaigeki Dayo Zenin Shuugou!', '26th July, 1991', 'Kunio has to go see his master, Bunzo, because he is in some kind of trouble. Kunio\'s brother, Tsuu, tells him to wait. Right in front of the dojo, Kunio meets Asaji and Okoto. Apparently, Asaji and Okoto are fiances and Kunio appears to be jealous. Kunio enters Bunzo\'s Dojo. Tora, a local ruffian, has cursed Bunzo! To get rid of the curse, he needs some Kanpou. So begins Kunio\'s quest! Assemble everyone! It\'s time for a story!', 'D', 519, 0, 3.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bq6a1nz01bas8sbbr7vs.jpg'),
(11, 'Dr. Chaos', '19th June, 1987', 'The player assumes the role of Michael Chaos, brother of mad physicist Dr. Ginn Chaos, who has been doing Warp Zone experiments in his mansion and gone missing. Armed with only a Knife in the beginning, as Michael moves through the house, he can pick up Handgun Bullets, Machine Gun Bullets, Grenades and life-replenishing Yellow Vitamins and Red Vitamins. There is a menu which has four options, open, get, go, and hit. There are 11 Warp Zones in all. At the end of each of the first 10 Warp Zones, Michael must fight a large monster that carries a piece of the Laser and guards a valuable piece of equipment, the latter consisting of the Ultra Space Sensor, four Life Bottles, the Air Helmet, the Jump Boots, two Blue Vitamins and the Shield Suit. Once Michael fully assembles the Laser, he\'ll be able to challenge the final boss, Canbarian.', 'D', 520, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hefq6bojmxekp0e33uyl.jpg'),
(11, 'Dr. Mario', '27th July, 1990', 'Dr. Mario is a falling block tile-matching video game,[13] in which Mario assumes the role of a doctor, dropping two-colored medical capsules into a medicine bottle representing the playing field. This area is populated by viruses of three colors: red, yellow, and blue. In a manner and style considered similar to Tetris,[14] the player manipulates each capsule as it falls, moving it left or right and rotating it such that it is positioned alongside the viruses and any existing capsules. When four or more capsule halves or viruses of matching color are aligned in vertical or horizontal configurations, they are removed from play. The main objective is to complete levels, which is accomplished by eliminating all viruses from the playing field. A game over occurs if capsules fill up the playing field in a way that obstructs the bottle\'s narrow neck.[15] \n \nPlayers can select the degree of starting difficulty any time a new game is started. The initial level chosen is a value between zero and twenty that determines the number of viruses to clear, and the three game speed options change how fast the capsules fall in the bottle. The player\'s score is based solely on the elimination of viruses, not on the time taken to complete the level or the number of capsules used. If players complete the highest difficulty level, they can continue playing to accumulate a higher score, but the number of viruses to clear remains the same. Additional points are awarded when multiple viruses are eliminated at once, but no additional points are awarded for initiating chain reactions, in which the elimination of one set of objects triggers the elimination of another set. The game speed is also a factor in how the game calculates scoring; higher speed levels yield more points.', 'D', 521, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1tfz.jpg'),
(11, 'Drac\'s Night Out', '1st February, 1991', 'An unreleased video game developed by Mark Lesser and Rex Bradford of Microsmiths that was produced for the Nintendo Entertainment System. The game featured the sponsorship of the Reebok Pump shoe. \n \nIn the game the player controlled the infamous Count Dracula who, while wearing Reebok Pumps, had to first work his way down his castle while avoiding the hostile villagers. This could be accomplished by hypnotizing the villagers with your vampiric gaze, or by pulling a lever to spring one of many Rube Goldberg-esque hidden traps.', 'D', 522, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nbionyez2wvkvzx9ugjd.jpg'),
(11, 'Dragon Power', '27th November, 1986', 'Dragon Power is an action-adventure game developed and published by Bandai for the Nintendo Entertainment System on March 3, 1988. It is a heavily localized version of the Japanese game Dragon Ball: Shenron no Nazo (translated to Dragon Ball: Mystery of the Dragon God), originally released on November 27, 1986. Although some of the European releases retain the Dragon Ball assets (under the title Dragon Ball), the North American release removes most references to the franchise. The game follows the first two volumes of the Dragon Ball manga, as the young monkey-tailed boy Goku (along with his teenage friend, Bulma, known in the North American version as Nora), embark on a quest to find all seven Dragon Balls (Crystal Balls in the NA version), in which it is believed that collecting them grants the user any wish they desire. Along the way, they encounter various characters, including turtle hermit Master Roshi (Hermit in the NA version), shapeshifting anthropomorphic pig Oolong (Pudgy in the NA version) and desert bandit Yamcha (Lancer in the NA version).', 'D', 523, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zi6mequis9gnoklfye56.jpg'),
(11, 'Dragon Ball Z: Kyoushuu! Saiya Jin', '26th November, 1990', 'Dragon Ball Z: KyÃ´shÅ«! Saiyan (ãƒ‰ãƒ©ã‚´ãƒ³ãƒœãƒ¼ãƒ«Z å¼·è¥²!ã‚µã‚¤ãƒ¤äºº Doragon BÅru Zetto KyÅshÅ«! Saiyajin?, Dragon Ball Z: Fierce Attack! Saiyan) was the first Dragon Ball Z game to be released for the Famicom system. It was released by Bandai on October 27, 1990 in Japan. The game features Brocco, Pumpkin (two illusion Saiyans who fight Yamcha and Tien in the anime) and Onion (an original who transforms into a Giant Ape).', 'D', 524, 0, 2.5, ''),
(11, 'Dragon Ball Z II: Gekishin Frieza!!', '10th September, 1991', 'Dragon Ball Z II: Gekishin Freeza!! is a role playing video game released only in Japan by Bandai on August 10, 1991, for the Nintendo Famicom. Gekishin Freeza!! is also one of the games downloadable in the game compilation J Legend Retsuden for Nintendo 3DS.', 'D', 525, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gngoqxeboynzszsxkqrp.jpg'),
(11, 'Dragon Ball Z III: Ressen Jinzou Ningen', '7th August, 1992', 'Dragon Ball Z III: Ressen Jinzou Ningen is the sequel of Dragon Ball Z II: Gekishin Freeza. The game starts off in the Frieza Saga as Super Saiyan Goku fighting Frieza, and it ends in the Imperfect Cell Saga in the battle of Piccolo against Imperfect Cell. The game also features characters from the movie Dragon Ball Z: Cooler\'s Revenge.Is the first game in the Gokuden series where power levels are not stated. Its sequel in the series is Dragon Ball Z Gaiden: Saiyajin Zetsumetsu Keikaku.', 'D', 526, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y8htjqf06zozcplciluc.jpg'),
(11, 'Dragon Buster II: Yami no Fuuin', '27th May, 1989', 'Centuries ago, Dragons and Demons roamed the country and brought terror into the lives of all people. However, a local legend states that the Sword of Thruth can restore peace to the land. It turns out that the almighty weapon is kept by the most ferocious dragon who ever lived but this doesn\'t stop the young Carl from willing to take on the challenge. He is small but the best archer the land has ever seen!', 'D', 527, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xugxmqoemclhepbcxapt.jpg'),
(11, 'Dragon Quest', '27th May, 1986', 'The player takes the role of a namable Hero. The Hero\'s name has an effect on his statistical growth over the course of the game. Battles are fought in a turn-based format and experience points and gold are awarded after every battle, allowing the Hero to level-up in ability and allows them to buy better weapons, armor, and items. Progression consists of traveling over an overworld map and through dungeons, fighting monsters encountered via random battles along the journey. \n \n&quot; As a whole, Dragon Warrior has been credited with establishing the basic template for the Japanese console RPGs that followed. &quot; -Wikipedia', 'D', 528, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xah.jpg'),
(11, 'Dragon Scroll: Yomigaerishi Maryuu', '4th January, 1988', 'Dragon Scroll: Yomigaerishi Maryuu (ãƒ‰ãƒ©ã‚´ãƒ³ã‚¹ã‚¯ãƒ­ãƒ¼ãƒ« ç”¦ã‚Šã—é­”ç«œ? lit. Dragon Scroll: Resurrection of the Demon Dragon) is an adventure game developed by Konami in 1987 for the Famicom. It is often compared to The Legend of Zelda in terms of game play, but it is considerably more difficult due to the lack of clues or information on how to proceed. \n \nThe game is non-linear, and you must explore different territories in search of the eight stolen magical artifacts that maintain a sleep spell over a large and dangerous dragon. Enemies roam the overworld and dungeons, and must be defeated in order to earn experience points. Experience points are used to increase the player\'s level, which makes him stronger and gives him access to stronger weapons and magic. Most useful items are well hidden and, even when obtained, are difficult to determine their appropriate use. The game features a password system which allows you to continue play where you left off.', 'D', 529, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wbpt8obnvqfxb8xatggv.jpg'),
(11, 'Legacy of the Wizard', '9th July, 1987', 'Play as five members of a family that set out to kill a dragon hidden within a giant maze.', 'L', 530, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lvjl6qzi03ccp866oce7.jpg'),
(11, 'Dragon Spirit: The New Legend', '14th April, 1989', 'Dragon Spirit: The New Legend is a fantasy-themed overhead shoot-\'em-up. It is a remixed port of the 1987 arcade game Dragon Spirit.', 'D', 531, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y67bofsj3dxdl6urrvgx.jpg'),
(11, 'Dragon Quest IV', '11th February, 1990', 'Dragon Quest IV differs from the rest of the series by breaking up the game into five distinct chapters, each of which focuses on a different protagonist or protagonists. The first four are told from the perspective of the Hero\'s future companions and the fifth one, from the hero\'s perspective, brings all the characters together as they begin their journey to save the world.', 'D', 532, 0, 3.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xau.jpg'),
(11, 'Dragon Quest II: Luminaries of the Legendary Line', '26th January, 1987', 'This game allows the player to control more than one character, and it is the first one in the Dragon Quest series to do so. The player controls his or her characters as they move in the game world. They can search treasure chests, talk and trade with villagers, equip weapons and armor, and cast spells.', 'D', 533, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xai.jpg'),
(11, 'Dragon Quest III', '10th February, 1988', 'Dragon Quest III is noted for greatly expanding upon the original Dragon Warrior and Dragon Warrior II. The game uses basic console role-playing game conventions, such as leveling up by gaining experience points and equipping items. Battle is turn-based like the other games in the series. \nDragon Warrior III features a class system, in which each character has a certain class. While the Hero always keeps the Hero class, the other characters can choose among the following: Soldier (Warrior in the GBC version), Fighter, Pilgrim (Cleric), Wizard (Mage), Merchant (Dealer), Goof-Off (Jester), Sage, and Thief which was available only in the later versions. The choice of class greatly affects the character\'s stats and spells he or she can learn. Furthermore, upon reaching experience Level 20, a character has the option of changing classes at the temple of Dhama, found halfway through the game. The game starts with just the Hero in the party, who then is able to recruit a party of three at the local tavern. Unlike most Dragon Quest parties, aside from the Hero, the party is not made up of characters involved in the story. Although only four characters can be in the party at a time, extra members of the party can be kept at the tavern, allowing room for new recruits. Another innovation is an arena where the player can place bets on the outcome of monster battles. \nThe remakes incorporated some interface changes from later games in the series, such as simplified door opening; the bag, which replaced bank item storage; the item sorting &quot;Tidy Item&quot; and &quot;Tidy Bag&quot; commands; and the &quot;Full HP&quot; command, which can be used outside of combat to automate the process of casting healing and status restoring spells. \nWhile the earlier Dragon Quest games were also non-linear, Dragon Quest III was the most substantial example of open-world gameplay among the early Dragon Quest games. It also allowed the player to swap characters in and out of the party at will, and another &quot;major innovation was the introduction of day/night cycles; certain items, characters, and quests are only accessible at certain times of day.&quot;', 'D', 534, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xaj.jpg'),
(11, 'Dragon Wars', '31st December, 1989', 'The designers of the Bard\'s Tale series, Wasteland, and Battle Chess pooled their talents to create the ultimate role-playing fantasy. They knew it had to be a first-rate story with sophisticated graphics. The result was Dragon Wars. \n \nSailing across uncharted seas, you and your party are in search of a legendary paradise called Dilmun â€” a place where the streets are paved with gold and no one wants for anything. \n \nHowever, King Drake of Phoebus has declared all magic illegal - magickers have been slain or fled into exile. In retaliation, enemy islands have threatened to unleash their guardian dragons, the most destructive force in the world. While docked at a harbor in Dilmun, you are arrested on suspicion of spellcasting. \n \n  Imprisoned and stripped of everything but your wits, you are sentenced to life in a cesspool called Purgatory. Magic is your only salvation - a worldly possession in a world possessed.', 'D', 535, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/najxqo4tlz8aow8bdw2c.jpg'),
(11, 'Dragon\'s Lair', '1st December, 1990', 'Dragon\'s Lair is a side-scrolling platform game based on the laserdisc game of the same name released for the Nintendo Entertainment System and developed by the MotiveTime group. Plotwise, the game is identical to the original.\n\nThe game is a side-scroller with the character walking slowly. Dirk can walk, crawl, or jump forward, and he has an array of weapons that he can discover and use to dispose of enemies. The controller layout is reversed from other mainstream NES titles, with Select functioning as the Pause-button while Start is used for the Candle object (which helps reveal hidden weapons). Also, B is used for jumping, and A for attacking (the input of the A &amp; B buttons is almost always the opposite in similar NES games).', 'D', 536, 0, 2.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eel5c9tpb60pvsfy8reh.jpg'),
(11, 'Dreamworld Pogie', '27th March, 2017', 'Travel through 15 sugarcoated levels of arcade action with everybody\'s loveable pet fluffle - Pogie \n \nAnother rediscovered classic game from The Oliver Twins.', 'D', 537, 0, 2.5, ''),
(11, 'Dropzone', '31st December, 1984', 'Dropzone is a side scrolling shooter.', 'D', 538, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kgphjj73bg95djm2lpm4.jpg'),
(11, 'Duck Hunt', '21st April, 1984', 'Itâ€™s duck season, and your trusty hunting dog is ready to scour the open fields. Test your sharpshooting skills as your targets take flight. Be quick to knock them out of the skies, or your canine companion wonâ€™t hesitate to make you the laughingstock of hunters! Need a change in scenery? Best your score against clay-pigeon targets instead! \n \nWith three fun modes to choose from, get your trigger finger ready for some fast-paced action! You only have three shots to hit your target before it zooms offscreen. Things might get a bit hairy when you advance to the next round, because those ducks and clay pigeons are going to fly faster and faster! Play solo, or challenge a friend as you test your dogged determination and feathered speed in this NES classic!', 'D', 539, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1hp1.jpg'),
(11, 'Duck Maze', '1st February, 1990', 'Jack the duck is no ordinary quacker. He is witty and rather clever, but this is not enough to get his precious egg to safety. He needs your help and ingenuity to get through the 20 mind-boggling mazes! Beware of the hidden dangers: the foxes, the traps. But most of all, let those sleeping bulldogs lie. Start your adventure in level 1 and challenge your way through to level 20, or if you are feeling vigorous, go straight into a higher level. But whatever you do, DON\'T CRACK THE EGG!', 'D', 540, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/o0nghseoeq6jgzwsfjii.jpg'),
(11, 'DuckTales', '1st September, 1989', 'Duckcity, today... \n \nbecause of a smart move from Magica, the lucky dime of Dagobert has vanished. Dagobert counts on YOU! \n \nA game full of adventure, confrontations and loadsa money!', 'D', 541, 0, 4.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qus29ubhwfggrhawymvu.jpg'),
(11, 'DuckTales 2', '23rd April, 1993', 'Scrooge McDuck is hot on the trail of the richest adventure ever. Pieces to the map of the Lost Treasure of McDuck have been scattered across the globe, and Scrooge must find them before the greedy Flintheart Glomgold grabs them. It\'s going to be a race to the finish as both of them try to find the treasure and become the richest duck in the world! Join Scrooge and his nephews as they explore the ancient pyramids of Egypt and do battle with swash-buckling pirates in the Bermuda Triangle. Help them search the haunted halls of an ancient Scottish castle and scale the watery heights of Niagara Falls. Aid Scrooge in his quest for the secret of the island of Mu and you\'ll gain the final clue to unravel the hidden location of the Lost Treasure of McDuck!', 'D', 542, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hn5yoqa8edk9ss8wsfy0.jpg'),
(11, 'Dudes with Attitude', '1st January, 1970', 'The player controls a &quot;dude&quot; and tries to collect treasures while avoiding obstacles.', 'D', 543, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/unmgn234f5uesld8nfcn.jpg'),
(11, 'Dungeon Magic: Sword of the Elements', '1st August, 1990', '500 years ago, the Kingdom of Granville fought a terrible war with Darces the Dark Overlord. A great hero, the warrior &quot;Magi&quot;, rose to challenge Darces. He owned six magical swords and a powerful suit of armor that was impervious to all but the most powerful of magic. Five of his six swords were Elemental blades, each created from the rarest metals on earth. The sixth blade, &quot;Tores&quot;, used an even more powerful metal. Using his powers, Magi defeated Darces, and exiled him to a far away land. After defeating Darces, Magi grew old and died. Now, on a dark, stormy night in the Kingdom of Granville, Darces the Dark Overlord returns to the land. According to an old saying, &quot;When the shadowed veil returns to mask the midday sun, the Fire of Serpents will rise again; Five shall become the One. The elements now heed his call, and hope is born alive; We will have our peace once more when One becomes the Five.&quot;', 'D', 544, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gxnfjq2xdmin0lvuqpa0.jpg'),
(11, 'Dungeon Kid', '30th September, 1990', 'Dungeon Kid is a Role-Playing game, developed by Pixel and published by Quest, which was released in Japan in 1990.', 'D', 545, 0, 2.5, ''),
(11, 'Dusty Diamond\'s All-Star Softball', '1st February, 1990', 'Dusty Diamond\'s All-Star Softball (released in Japan as Softball Tengoku) is a one- or two-player NES video game where players can pick and choose various fictional softball players and customize their own team to take to the championship.', 'D', 546, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p3b6scvtozn1dsqzwtud.jpg'),
(11, 'Dynamite Bowl', '24th May, 1987', 'The general concept is that up to five players can play on any of the 30 bowling lanes available; simulating the concept of being in a bowling league. Players can change their lane positioning, determine how strong the throw is, and even make the ball go through various curves (or even through a straight ball into the pins). Each player character can be either male or female with options for bowling ball weights ranging from 7 pounds or 3.2 kilograms to 15 pounds or 6.8 kilograms.', 'D', 547, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/numknrxkuj2sfu2xf41t.jpg'),
(11, 'Dynowarz: Destruction of Spondylus', '1st May, 1989', 'Something was terribly wrong in the distant man-made Spondylus Solar System. One by one the planet\'s central life support computers had been infected with a life threatening virus while the planet surfaces had been overrun with computerized dinosaurs known as Robosaurs. Under attack in his laboratory on Alpha Planet, Professor Proteus, the mastermind of the Spondylus System and the founder of the Robosaur project suddenly realized that this deadly sabotage could only be the work of his former partner, the deranged Dr. Brainius.', 'D', 548, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pbvbbgbg2gtfybgw9htq.jpg'),
(11, 'Eggerland: Meikyuu no Fukkatsu', '9th August, 1988', 'Eggerland: MeikyÅ« no Fukkatsu (ã‚¨ãƒƒã‚¬ãƒ¼ãƒ©ãƒ³ãƒ‰ è¿·å®®ã®å¾©æ´» Eggerland: Revival of the Labyrinth?) is a puzzle video game developed by HAL Laboratory for the Family Computer. It was released in 1988 in Japan as the fourth game in the Eggerland series following Eggerland Mystery, and is the third in the series not counting the port of Eggerland 2 made for the Famicom Disk System. The game contains roughly 162 stages (or maps), which are arranged on an 8-by-16 grid (with some stages hidden).', 'E', 549, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zd8xajs0aehi7k7kjnpe.jpg'),
(11, 'Elevator Action', '31st December, 1983', 'Elevator Action (ã‚¨ãƒ¬ãƒ™ãƒ¼ã‚¿ãƒ¼ã‚¢ã‚¯ã‚·ãƒ§ãƒ³ ErebÄ“tÄ Akushon) is a 1983 arcade game by Taito. It debuted during the &quot;Golden Age of Arcade Games&quot;. Innovative in gameplay, the game was very popular for many years. \n \nIn the game, the player assumes the role of a spy who infiltrates a building filled with elevators. He must collect secret documents from the building and traverse the 30 floors of the building using an increasingly complex series of elevators. The player is pursued by enemy agents who appear from behind closed doors. These agents must be dealt with via force or evasion. Successful completion of a level involves collecting all the secret documents and traversing the building from top to bottom. In the lower floors of the building, the elevator systems are so complex that some puzzle-solving skills are needed. \n \nThe game was available as a standard upright cabinet The controls consist of a 4-way joystick and two buttons, one for &quot;shoot&quot; and the other for jumping and kicking. The maximum number of players is two, alternating turns. The graphics are extremely simple, 2D color graphics and in-game music was composed by musician Yoshio Imamura. The game was followed by a sequel, Elevator Action II (also known as Elevator Action Returns).', 'E', 550, 0, 3.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wetouxyeywtx5qaggu8z.jpg'),
(11, 'Eliminator Boat Duel', '1st February, 1991', 'Drivers earn thousands of dollars by competing in hydroplane races, setting track records, rescuing stranded people, and collecting cash bonuses. With these winnings they can repair or upgrade various components of the hydroplane to improve racing performance and remain competitive in the increasingly-difficult races. Eliminator Boat Duel offers three difficulty levels: Easy, Normal, and Expert. Completing a race at a lower difficulty level advances the player to the next higher one. At each difficulty level, the player\'s hydroplane can be damaged from impact with animals, the opponent\'s hydroplane, and various stationary objects. A false start is penalized with a $2,000 fine. For most of a race, players control their hydroplanes from a bird\'s-eye view, and the screen scrolls in multiple directions; but in one segment of the race, the graphical perspective changes to a third-person tracking mode. In a single-player game, the player competes first with Seasick Sidney (in Easy mode), with Aquarius Rex (in Normal mode), or with Surfer Bob (in Expert mode). The player then competes against Vicious Vicky, Weird Willy, Mangler Mike, Veronica Alabaster, and Disaster Don (the reigning World Champion), respectively. To win, the player must defeat each opponent one-against-one on three unique race courses. Eliminator Boat Duel has 24 unique race courses.', 'E', 551, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/drwm2r7ztjfaavj1kd8f.jpg'),
(11, 'Elite', '20th September, 1984', 'Elite is a space trading video game, written and developed by David Braben and Ian Bell and originally published by Acornsoft for the BBC Micro and Acorn Electron computers in September 1984.Elite\'s open-ended game model, and revolutionary 3D graphics led to it being ported to virtually every contemporary home computer system, and earned it a place as a classic and a genre maker in gaming history. The game\'s title derives from one of the player\'s goals of raising their combat rating to the exalted heights of &quot;Elite&quot;. \n \nElite was one of the first home computer games to use wire-frame 3D graphics with hidden line removal. It added graphics and twitch gameplay aspects to the genre established by the 1974 game Star Trader. Another novelty was the inclusion of The Dark Wheel, a novella by Robert Holdstock which gave players insight into the moral and legal codes to which they might aspire.', 'E', 552, 0, 4.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fjfvqpxdzmo9ariuhy8y.jpg'),
(11, 'Elnark no Zaihou', '10th September, 1987', 'Elnark no Zaihou (ã‚¨ãƒ«ãƒŠãƒ¼ã‚¯ã®è²¡å®? lit. Riches of Elnark) is an adventure game developed and published by Towachiki. It presents the action from an overhead perspective, similar to many of the traditional 2D Zelda games. \n \nIt is unusual in that it tracks the player\'s behavior and adjusts a meter which indicates whether the player is generally more good (Light) or more evil (Dark). Though a more evil player has stronger abilities, players must air on the side of good in order to make significant advances through the game. \n \nAs a result, this game is considered extremely difficult, due to the unknown nature of how one should behave in order to proceed. If the player does not perform the correct actions, levels typically repeat themselves, and players find themselves stuck in the game with no clear method to advance. In fact, it was one believed that the only way to beat the game was to exploit a bug, however that has since been proven false.', 'E', 553, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b6yzg4epyqzqfyrv6r5e.jpg'),
(11, 'Elysion', '28th May, 1988', 'Elysion, though a fairly traditional 8-bit JRPG in many respects (the first thing the player does is talk to the local King for exposition, for example), draws its influences from a lot of very different games within the RPG family: It superficially resembles the first Dragon Quest, it allows the player to select between multiple protagonists when starting the game as is the case in Final Fantasy, the combat system is real-time combat without screen transitions such as something like Hydlide or Ys and the enemies have an odd habit of only moving when the player does, such is the case in many strategic Roguelike dungeon crawlers like the Mystery Dungeon series. \n \nThe goal of the game is to defeat the evil demon Baal. However, the King first tests the player character by having them enter the dungeon beneath the castle and find a group of important quest objects. After completing this large dungeon, the protagonist officially becomes the Hero of God and can go defeat Baal by exploring the rest of the continent for some necessary magical scrolls and, eventually, special God-like equipment. \n \n&quot;Elysion&quot; refers to the Elysian Fields, an ancient Roman underworld for honorable souls that died in battle.', 'E', 554, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rd9wu8z37vledrnw1fms.jpg'),
(11, 'Emoyan no 10 Bai Pro Yakyuu', '19th January, 1990', 'Emoyan no 10-bai Pro Yakyuu is a Sports game, published by Hect, which was released in Japan in 1989.', 'E', 555, 0, 2.5, ''),
(11, 'Esper Dream 2: Aratanaru Tatakai', '26th July, 1992', 'Esper Dream 2: Aratanaru Tatakai is a Role-Playing game, developed and published by Konami, which was released in Japan in 1992.', 'E', 556, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ynf.jpg'),
(11, 'Excitebike', '30th November, 1984', 'Excitebike (ã‚¨ã‚­ã‚µã‚¤ãƒˆãƒã‚¤ã‚¯ Ekisaitobaiku) is a motocross racing video game franchise made by Nintendo. It first debuted as a game for the Famicom in Japan in 1984 and as a launch title for the NES in 1985. It is the first game of the Excite series, succeeded by its direct sequel Excitebike 64, its spiritual successors Excite Truck and Excitebots: Trick Racing, and the WiiWare title Excitebike: World Rally. 3D Classics: Excitebike, a 3D remake of the original game, was free for a limited time to promote the launch of the Nintendo eShop in June 2011, and has since been available for $5.99.', 'E', 557, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qnxgsxijvvejjrjrgxdf.jpg'),
(11, 'Exciting Boxing', '16th January, 1988', 'Exciting Boxing is a Sports game, developed by Human Entertainment and published by Konami, which was released in Japan in 1987.', 'E', 558, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qxljfnrhcmldfvxutgue.jpg'),
(11, 'Exerion', '1st November, 1983', 'xerion (ã‚¨ã‚¯ã‚»ãƒªã‚ªãƒ³ Ekuserion?) is a vertical shoot \'em up released by Jaleco in 1983 and licensed to Taito for distribution in the United States. \n \n \nScreenshot from arcade version \nExerion is a shoot \'em up game featuring parallax effects and inertia simulation, something notable for 1983. The player travels around strange scenarios shooting aliens. The player has two types of guns: fast single shot (limited) or slow double shot (unlimited). \n \nIn 1984, along with the MSX1 port of the original, a sequel was released titled Exerion II: Zorni for the MSX1, with similar gameplay to the original. There were plans for an NES release of this game. In 1987, the game was followed by the semi-sequel titled Exerizer, also known as Sky Fox.', 'E', 559, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vly0fy1lerpqv2jyuys1.jpg'),
(11, 'Exodus: Journey to the Promised Land', '31st December, 1991', 'Exodus: Journey to the Promised Land is an unlicensed NES game made by Wisdom Tree in 1991.\nAccording to the game\'s instruction manual, the player controls the biblical figure Moses as he leads the Israelites to the promised land. Moses has the ability to shoot glowing &quot;W\'s&quot;, which signify the word of God, to defeat enemies and remove obstacles. To finish each level, Moses must acquire five question marks as well as a certain amount of manna while avoiding enemies such as magicians and soldiers. After a level is completed, the player must answer five bible-related questions before advancing to the next level. Exodus, like many Wisdom Tree games, is a rehashed version of a Color Dreams game, in this case Crystal Mines.', 'E', 560, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rtxnqiczpzrvvlden9hg.jpg'),
(11, 'Exploding Fist', '17th May, 2012', 'EXPLODING FIST is as close to the real thing as you\'ll ever see! Become a master of this mysterious ancient art; progress from novice to Tenth Dan and test your strength and discipline. 18 different manoeuvres including blocks. flying kicks. leg sweeps. roundhouse and even somersaults! Unreleased until leaked in 2012.', 'E', 561, 0, 2.5, ''),
(11, 'NightHawk F-117A Stealth Fighter 2.0', '31st December, 1991', 'Slice through the dark and own the night in your Lockheed F-117 Nighthawk, the first operational aircraft to utilize stealth technology in its design. This isnâ€™t your typical attack fighter, youâ€™ll be flying sorties under the cover of night, avoiding detection by enemy radar and striking high-value targets with precision weaponry. Youâ€™ll want to haunt the battlefield like a ghost, menacing the enemy with earth-shattering ordnance before vanishing in your airborne apparition as suddenly as you appeared.\n\nWith a hardcore devotion to authenticity, F-117A brings you unprecedented night combat action. Youâ€™ll go through every phase of mission planning, from requesting a specific assignment during briefing to choosing your own munitions during armament, before then climbing into your cockpit and experiencing the thrill of dropping 1,000 lbs. of laser-guided destruction on enemy troops, tanks and bunkers. This is your chance to fly one of the most technologically impressive warplanes ever made.', 'N', 562, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oramvgpqexw6zkoao7nl.jpg'),
(11, 'F-15 Strike Eagle', '31st December, 1984', 'F-15 Strike Eagle is an F-15 Strike Eagle combat flight simulator first released in 1985 by MicroProse. It is the first in the F-15 Strike Eagle series comprising also the sequels F-15 Strike Eagle II and F-15 Strike Eagle III.', 'F', 563, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bdz77ncg6k6olnu3xqkl.jpg'),
(11, 'F1 CIRCUS', '14th September, 1990', 'The first game in Nichibutsu\'s Formula One top-down racing series. \n \nF1 Circus is a top-down Formula 1 racing game and the first game in Nihon Bussan\'s F1 Circus series. It was first released on the PC Engine in 1990, but a modified version - also partially based on this game\'s sequel, F1 Circus \'91 - would later be released on the Famicom in 1992. As with every other game in the series, the game was never localized in North America or Europe. \n \nThe game uses the real life names of drivers and teams from Formula 1, like Nigel Mansell and Ferrari. The series would continue to acquire the various licenses needed to use real names from Formula 1.', 'F', 564, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/luqsv8zw8tv7tnqneal4.jpg'),
(11, 'Famicom Doubutsu Seitai Zukan! Katte ni Shirokuma: Mori o Sukue no Maki!', '14th January, 1990', 'Famicom Doubutsu Seitai Zukan! Katte ni Shirokuma: Mori o Sukue no Maki! is an Adventure game, published by CBS Sony Group, which was released in Japan in 1989.', 'F', 565, 0, 2.5, ''),
(11, 'Famicom Igo Nyuumon', '28th December, 1991', 'Famicom Igo Nyuumon is a Miscellaneous game, developed by Home Data and published by I\'Max, which was released in Japan in 1991.', 'F', 566, 0, 2.5, ''),
(11, 'Famicom Top Management', '11th January, 1991', 'Famicom Top Management is a Strategy game, developed and published by Koei, which was released in Japan in 1990.', 'F', 567, 0, 2.5, ''),
(11, 'Ring King', '19th July, 1987', 'Challenge your friends or your computer to the Data East Championship Title Bout! Challengers from around the globe, each with his own style of boxing, knuckle up to take the title. Win by knock-out or points using a wild assortment of hooks, jabs, uppercuts, and combinations!', 'R', 568, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vx3o5icnrqqubgiaxtry.jpg'),
(11, 'Family Circuit \'91', '18th August, 1991', 'Family Circuit \'91 is a Racing game, developed by Game Studio and published by Namco, which was released in Japan in 1991.', 'F', 569, 0, 2.5, ''),
(11, 'Family Circuit', '6th February, 1988', 'Family Circuit is a Racing game, developed by Game Studio and published by Namco, which was released in Japan in 1988.', 'F', 570, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d09lnjvzturecpritnh5.jpg'),
(11, 'Family Jockey', '24th April, 1987', 'A horse racing simulator for the Famicom developed and published by Namco.', 'F', 571, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hmizpqlutduijs54z39r.jpg'),
(11, 'Family Mahjong', '11th September, 1987', 'A mahjong game by Nihon Bussan and published by Namco for the Famicom. \n \nFamily Mahjong is another in a long line of mahjong games for the Famicom. Uniquely, at least for the time, it does include a full tutorial mode that will teach the player how to actually play mahjong. It also includes rules for mahjong gambling, which is another feature included in the game. After the player has learned how to play, they can compete against a series of CPU opponents in one-on-one matches, most of whom are attractive blonde women for whatever reason.', 'F', 572, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f0ysayug1ojligdli4fw.jpg'),
(11, 'Rock \'n\' Ball', '24th April, 1989', 'Nostalgic pinball is back with some very modern concepts! Enjoy seven different games with six different characters such as Twister Tom for Pinball, Rock \'n\' Roller Billy for Sports Pinball, and more! Team up with your favorite Rock \'n\' Ball character and reach for higher and higher scores! Pinball is famous in video game history. Challenge your skills against Rock \'n\' Ball\'s brand new twists on this popular game!', 'R', 573, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lyhze7y2gwosihazcyi2.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Family Quiz 4-nin wa Rival', '16th November, 1988', 'Family Quiz 4-nin wa Rival (ãƒ•ã‚¡ãƒŸãƒªãƒ¼ã‚¯ã‚¤ã‚º 4äººã¯ãƒ©ã‚¤ãƒãƒ«? lit. Family Quiz 4 Man Rivalry) is a Japanese trivia game devloped by Athena for the Famicom, and published in Japan in November of 1988. This game was Athena\'s first console release. With a focus on family play, the game allows for four players to compete simultaneously. The goal is to beat the other opponents in four mini-games, each requiring that the player answer some Japanese trivia questions in order to proceed. The four mini-games are based on a game show, a board-game, the game of Othello, and a memory match game. In the game show, the only version that allows for just one player, answering questions correctly raises that player\'s podium towards a balloon. The other versions require at least two players, and turns may only be taken after players have answered a trivia question correctly.', 'F', 574, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zcxrzentirv3rxoql1f2.jpg'),
(11, 'Family Trainer 4: Jogging Race', '27th June, 1987', 'An exercise game created for the Family Trainer (the Japanese name for the NES Power Pad) developed by Human and published by Bandai. \n \nJogging Race is the fourth game created by Bandai for the Family Trainer (US: Power Pad) accessory for Famicom systems. It was one of the many games that used the peripheral that did not see a release outside of Japan. As with other Family Trainer games, the emphasis was on receiving a work out using the Famicom, a conceit that would later find greater success with the Nintendo Wii and the Wii Fit games. \n \nSpecifically, Jogging Race is about jogging through areas of a simulated Tokyo using the pad to simulate the exercise. The background scrolls by slowly, accurately matching the scale of the distances found in the real location, and will occasionally include additional details like other joggers. \n \nThere is also a second mode named Marathon, in which the player competes in a long distance race with other CPU runners.', 'F', 575, 0, 2.5, ''),
(11, 'Famista \'89 Kaimaku Ban!!', '28th July, 1989', 'Famista \'89: Kaimaku Han!! is a Sports game, developed and published by Namco, which was released in Japan in 1989.', 'F', 576, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m6zgnp1ifh4pxnu0ffnu.jpg'),
(11, 'Fantasy Zone', '20th March, 1986', 'The Fantasy Zone is a solar system consisting of eight brightly colored, fantastic planets. The evil Menons are trying to take over all of the planets in the Fantasy Zone by using misappropriated foreign currency to build their forces. It is the player\'s job to recover all of the coins and save the solar system! \n \nFantasy Zone is an arcade style shooter for one or two players. The goal is to destroy all of the creatures on each planet and collect as many of the lost coins as possible. At the end of each level is a large enemy that will have to be defeated before moving on to the next world. At various points in the game, the player will be able to find a parts shop, which allows purchasing improvements for his spaceship, including better weapons and faster engines.', 'F', 577, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gjywiwgar1gcfs89nxzj.jpg'),
(11, 'Fantasy Zone 2: Opa-Opa no Namida', '19th December, 1988', 'Opa-Opa is at it again in this zany return to his original homeland some ten years later. Welcome to Fantasy Zone II where perils are great and rewards even greater. During your visit you\'ll discover that peace is at stake once again and those who threaten it are more cunning and wicked than before. So beware, the evil Blackhearts are near and they\'re not alone. Scores of unusual and seemingly innocent creatures will enthusiastically approach you. But don\'t be fooled. They\'re not here to help. They\'re henchmen for the dark powers of the Blackhearts. And they\'ll sabotage every chance you\'ve got to protect the warp gates from total ruin. So fight valiantly, because just when you think you\'ve made it, the Blackhearts will be waiting. \n \nThis game is a port of the original Arcade game of the same name, made by Sega.', 'F', 578, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nfkotrzckypj3bn90u4t.jpg'),
(11, 'Faria: A World of Mystery and Danger!', '21st August, 1989', 'The player controls a female character throughout most of the game. A male character is played towards the end of the game. The game uses &quot;Levels&quot;, HP, items, and upgrades. Three game saving slots are used, rather than passwords. Overhead view action oriented battles. Randomly generated battles while traversing the overworld.', 'F', 579, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/znsmauglb3w4gbvz8lnq.jpg'),
(11, 'Faxanadu', '17th November, 1987', 'Faxandu is for the Famicom and NES. The name was licensed by Falcom and was developed and released in Japan in 1987. Nintendo also released the game to the world market in 1990. It can be considered a side-story of Xanadu, which is the second installment of Falcom\'s long-running RPG series, Dragon Slayer. The title is a combination of &quot;Famicom&quot; and &quot;Xanadu&quot;', 'F', 580, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wf1xioiwt0y6wixjowqg.jpg'),
(11, 'Felix the Cat', '1st October, 1992', 'The game involves the player controlling Felix the Cat as he sets out to defeat the evil mad Professor who has kidnapped Felix\'s lovely girlfriend, Kitty. The Game Boy version plays virtually the same as the NES version, but features fewer levels.', 'F', 581, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fhdjo4qjrvoznkhd74sj.jpg'),
(11, 'Ferrari Grand Prix Challenge', '1st February, 1992', 'The Nintendo Entertainment System version of the game is a simplified version that allows players to practice up to six laps or qualify for every Formula One race of the season using metric units (kilometres per hour instead of miles per hour). It was one of the few 8-bit Formula One video games to adequately represent the Circuit Gilles Villeneuve as having an urban background along with several other urban race tracks represented in the 1992 Formula One season. Tire wear is possible resulting in trips to the pit crew for maintenance and repairs. A radio allows communication with the crew chief; he will advise whether repairs are necessary. The top speed of the vehicle is 325 kilometres per hour and turbo is not used in the game. \nBefore the first qualifying session can take place, the player must insert his name and his nationality. The name can be up to 10 characters long and the country has to fit into a three-character field. Since the game doesn\'t verify if the three-letter code matches up to a real nationality, it doesn\'t matter if the player makes up a nationality for a fictional country.', 'F', 582, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ilq.jpg'),
(11, 'Field Combat', '9th July, 1985', 'Field Combat (ãƒ•ã‚£ãƒ¼ãƒ«ãƒ‰ã‚³ãƒ³ãƒãƒƒãƒˆ Firudo Konbatto) is a 1985 arcade video game in which the player fights as a single commanding officer in a generic futuristic battlefield. The Family Computer version of Field Combat was later released for the Wii\'s Virtual Console service exclusively in Japan on June 12, 2007.', 'F', 583, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hjdajsacjifxof5djmfu.jpg'),
(11, 'Lee Trevino\'s Fighting Golf', '24th April, 1988', 'Lee Trevino\'s Fighting Golf is a Golf Sim game, developed and published by SNK, which was released in 1988.', 'L', 584, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pb5eci52oi9dpoxwxa3w.jpg'),
(11, 'Fighting Hero', '1st February, 1991', 'Fighting Hero is an unlicensed fighting game, based off Street Fighter.', 'F', 585, 0, 2.5, ''),
(11, 'Fighting Hero III', '1st February, 1993', 'Fighting Hero III is a fighting game, created by NTDEC and released in 1993. While ostensibly a sequel to Fighting Hero, the two games share little in common besides their genre.', 'F', 586, 0, 2.5, ''),
(11, 'Fighting Road', '13th January, 1989', 'Fighting Road is an Action game, developed and published by Toei Animation, which was released in Japan in 1988.', 'F', 587, 0, 2.5, ''),
(11, 'Final Combat', '1st February, 1992', 'Johnson and Berry are good fellows in the battlefield. They have experienced numerous small and large battles without fail. But this time they\'ve been given the most difficult mission ever: their commander asked for reinforcement support for the war emergency, but the enemy\'s frontier military post is located along the shortcut of the reinforced army\'s movement. Time is urgent! The commander decided to send a guerilla soldier to destroy the enemy\'s frontier military post in order for the reinforcements to pass through. Johnson and Berry are the storm-troopers who are the only team with a chance for success and survival!', 'F', 588, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tjt6ykccck48goietw62.jpg'),
(11, 'Final Fantasy', '18th December, 1987', 'Final Fantasy, also known as Final Fantasy I in re-releases, is a role-playing game developed and published by Square Co., Ltd. for the Nintendo Entertainment System in Japan in December 1987, and the first title in Square\'s flagship Final Fantasy series. \n \nThe game puts players in control of four characters known as the Warriors of Light, and begins by asking the player to select the classes and names of each. The Warriors of Light can traverse the maps of dungeons and towns, which are connected by a world map, and will run into random encounters with enemies or fight bosses. \n \nFinal Fantasy takes place in a fantasy medieval setting with three major continents, and the four Warriors of Light begin in Cornelia. They are tasked by the King of Cornelia to rescue Princess Sarah from Garland, and after defeating him, the king opens up a bridge enabling them to pass to the town of Pravoka. This sets them off on an adventure to defeat the Four Fiends and rescue the world.', 'F', 589, 0, 3.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1oa5.jpg'),
(11, 'Final Lap', '31st December, 1987', 'Final Lap is a racing video game produced by Namco,[2] and released by Atari Games for the United States in 1987. It was the first game to run on Namco\'s then new System 2 hardware, and is a direct successor to Namco\'s two earlier Pole Position games (1982-1983). \n \nFinal Lap was the first racing game to allow up to eight players to simultaneously race on the Suzuka Circuit, in a Formula One race. This was, at the time, considered a revolutionary feature and was implemented by linking together up to four two-player sitdown-style arcade cabinets.[2][3] It was also arguably the first racing game to implement &quot;rubber banding&quot; to ensure that less talented players were never too far behind the leader, a concept that would be taken much further by the Mario Kart series.[3] There was also a single player mode, in which the player\'s score was based on how far the car travelled until time ran out or if the player completed four laps (on default settings; the arcade operator can set the lap number to be as low as three or as high as six).', 'F', 590, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bujn9jvwiyqscqjirso6.jpg'),
(11, 'Fire \'n Ice', '24th January, 1993', 'The aim of the game involves players extinguishing all fires in a level in order to proceed. They do this by creating and melting ice (in a Lode Runner style) or kicking ice onto the fires. This game also has a level editor (which may expose some bugs that substantially affect the game mechanics).', 'F', 591, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gnests941y1zlqcbkntk.jpg'),
(11, 'Fire Emblem: Shadow Dragon and the Blade of Light', '20th April, 1990', 'Fire Emblem: The Dark Dragon and Sword of Light is the first game in the Fire Emblem series, developed by Intelligent Systems and published by Nintendo. It was first released on the Famicom (known internationally as the Nintendo Entertainment System) on April 20, 1990. It takes place on the continent of Archanea. It stars Marth, a character who later appeared in Super Smash Bros. Melee. It has never been officially released outside of Japan.', 'F', 592, 0, 4.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ht4cmbqxe9bzgrdbhvff.jpg'),
(11, 'Fire Emblem Gaiden', '14th March, 1992', 'The Continent of Valencia is split into two territories. To the north is the Kingdom of Rigel, home to followers of the Dark God Doma. To the south is the Kingdom of Sofia, where the Earth Goddess Mila is worshipped. When Rigel invades Sofia, two heroes, Arum and Cellica, raise an army to topple Rigel and the Dark God that is backing the conflict.', 'F', 593, 0, 3.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iubkbxt2xrnye3hc0neu.jpg'),
(11, 'Fisher-Price: Firehouse Rescue', '1st February, 1988', 'In Fisher-Price: Firehouse Rescue, the player controls a fireman driving a firetruck. Both the fireman and the firetruck bear the familiar style of the popular Fisher-Price toy line. The object of the game is to rescue pets from trees and people from houses in the immediate neighborhood. There are 2 parts to this task: the first part involves navigating the maze-like streets from an overhead perspective in order to find the troubled residence. Once the house is reached, the second part of the job is to maneuver the firetruck\'s ladder underneath the person or animal in need of rescue, from a side perspective, and letting them down to safety.', 'F', 594, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/r6pghbuqumab91hk0ejx.jpg'),
(11, 'Fisher-Price: Perfect Fit', '1st April, 1990', 'Dropping down the Perfect Fit game chute are familiar, everyday objects such as letters, numbers, figures, and lots of familiar Fisher-Price toys. Inside the game board are outlines of these same objects, just waiting for you to move the pictures into their correct outlines. Play at your own level, from simple matches to matches requiring up-down or side-to-side flips. Play alone and better your time, or play against a friend or even the computer to see who\'s quicker. Whichever way you do it, it\'s great fun!', 'F', 595, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qix4zqaszaydqmoegsb7.jpg'),
(11, 'Hokuto no Ken 3 : Shin-Seiki Sozo Seiken Retsuden', '19th October, 1989', 'Hokuto no Ken 3 : Shin-Seiki SÅzÅ Seiken Retsuden is the third Hokuto no Ken video game developed by Shouei Systems and released by Toei Animation for the Family Computer (the Japanese version of the Nintendo Entertainment System) on October 19, 1989. Unlike the first two Hokuto no Ken video games for the platform, which were side-scrolling action games, Hokuto no Ken 3 is a role playing game which adapts the storyline of the original manga from the beginning to the Kingdom of Shura story arc. It was the first in a trilogy of RPGs based on the franchise.', 'H', 596, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uz5mo58wlniyjittb2td.jpg'),
(11, 'Fleet Commander', '29th April, 1988', 'Fleet Commander is a strategy game developed and published by ASCII Entertainment for the Famicom in 1988. It is the first naval battle game ever released for the system. While it supposedly depicts a battle between two fictional countries, the game is largely recognized to be a recreation of one of the crucial naval battles that occurred between Japan and the United States near the end of World War II. Players control a Japanese fleet of heavy cruisers, battleships, submarines and aircraft carriers. \n \nA couple of things set this game apart from typical Famicom games. First, in addition to the cartridge and the manual, the game also came packaged with a large map and plastic models which represented ships and airplanes. The game never shows the entire state of the water, so it is up to the player to use the information that he or she has to update the representation of battle on the map using the plastic models. Second, no background music is heard while playing this game. Finally, this game makes use of a device known as the &quot;Turbo File,&quot; which was manufactured and sold by ASCII as well. This device was a hardware add-on for the Famicom which was used to save game progress. It was compatible with a number of other titles.', 'F', 597, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/updbvu7iolbex0laxd2z.jpg'),
(11, 'Flight of the Intruder', '31st December, 1990', 'The player configures each plane\'s loadout for your mission, plans the mission package, then fly your missions. The player\'s task is to configure the planes and to plan and execute each mission, commanding multiple sections of each plane.', 'F', 598, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qe1o3eanciw2wpimfwiq.jpg'),
(11, 'The Flintstones: The Rescue of Dino &amp; Hoppy', '1st December, 1991', 'It\'s prehistoric pandemonium as your favorite cave family, the Flintstones, get a visit from the 30th century. The clever scientist, Dr. Butler, needs some dinosaurs for the Orbit City Zoo, and he\'s invented a time machine to capture Dino and Hoppy. Can Fred find all the pieces that the Great Gazoo needs to build a time machine of his own? Can he make a jump into the future with the help of Wilma, Barney and Betty and rescue his prehistoric pals? Who says history has to be boring?', 'T', 599, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iw7ymstnsjsqpljogii7.jpg'),
(11, 'The Flintstones: The Surprise at Dinosaur Peak!', '26th September, 1994', 'Pebbles and Bamm-Bamm have wandered away from home and it looks like Fred and Barney found them. Unfortunately, an active volcano stands in the way. Now, Fred and Barney must travel across the pre-hysterical world of Bedrock to rescue the kids! Fred swings a mean club and Barney\'s sling carries a nasty sting in this adventure for the whole family. Scale the side of a cliff, use crocodiles as trampolines, and leap into action as Bedrock\'s most famous citizens go looking for their children. Collect the hidden five fabled fire gemstones to pay a greedy Pterodactyl to return Pebbles and Bamm-Bamm to their homes!', 'T', 600, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/klzg2fc5jtjbdlhd7kis.jpg'),
(11, 'Flipull: An Exciting Cube Game', '15th January, 1990', 'Flipull: An Exciting Cube Game is a Puzzle game, developed by Daiei Seisakusho and published by Taito Corporation, which was released in Japan in 1989.', 'F', 601, 0, 3, ''),
(11, 'Flying Dragon: The Secret Scroll', '14th February, 1987', 'In a mysterious region of China, Ryuhi, was born and raised in high mountain tops. There he received instruction from his wise teacher, Juan. At a young age he became a master of Kempo. One day, his teacher Juan was attacked and robbed of the Secret Scrolls of Hiryu-no-Ken, of which he was the author. Ryuhi possessed the 6th volume of the Secret Scrolls, the Shingan No Sho, or Book of the Mind\'s Eye which Juan had managed to save. Ryuhi begins his journey to Shorinji as a last request from a dying Juan. Gengai, the bishop of Shorinji welcomed the little Ryuhi, and begins to train him in Shorinji Kempo. Six years later, they received a letter of challenge from the Tusk Soldiers, a mysterious organization of enemies of the Shorinji. Ryuhi is determined to take part in the upcoming &quot;World Tournament of Contact Sports&quot; as a representative of Shorinji. His motive is to prevent the Tusk Soldiers from becoming champions of Contact Sports at the tournament. After learning from Gengai that it was the Tusk Soldiers who attacked his teacher and robbed him of the Secret Scrolls, he leaves for the World Tournament. There are two different types of gameplay. Journey levels are side-scrolling levels where Ryuhi must defeat five bosses and find certain items valuable to the mission. The tournament levels are where the player gets to fight one-on-one against enemies in the same way as the first game in the series released in 1985, Shanghai Kid. The player must go through the game twice to get the true ending. All six scrolls must be collected the first time through to get the first ending. The second time through the player needs to collect all six scrolls again, along with four crystal balls. The crystal balls can only be found in the second quest. However, players can miss one of these items and finish the game, but the true ending will not be received.', 'F', 602, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gi3m3j1jijaaassfs8je.jpg'),
(11, 'Flying Hero', '17th February, 1989', 'An action game involving trampolining firefighters, developed for the Famicom by Aicom. A US version named Blazebusters was announced but later cancelled.', 'F', 603, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/arq5x93pcan930sagtmz.jpg'),
(11, 'Flying Warriors', '31st December, 1991', 'In an unexplored region of China wrapped in mystery, Ryuhi, a boy, was born and brought up in high mountain tops. There he received instruction from his wise teacher, Juan. Though he was young, he made himself a master of Kempo. One day, his teacher Juan was attacked and robbed of the Secret Scrolls of Hiryu-no-Ken, of which he was the author. Ryuhi possessed the 6th volume of the Secret Scrolls, the Shingan-no Sho, or book of the mind\'s eye which Juan had managed to save. Ryuhi begins his journey to Shorinji in compliance with Juan\'s last request. Gengai, the bishop of Shorinji welcomed the little Ryuhi, regarded as one of the titans of Shourinji Kempo. Six years later, they received a letter of challenge from the Tusk Soldiers, a mysterious organization of enemies of the Shorinji. Ryuhi is determined to take part in the upcoming &quot;World Tournament of Contact Sports&quot; as a representative of Shorinji. His desire is to prevent the Tusk Soldiers from becoming champions of Contact Sports at the tournament. Ryuhi heard from Gengai that in truth it was the Tusk Soldiers who attacked his teacher and robbed him of the Secret Scrolls. As he leaves for the World Tournament, his thoughts are on his teacher Juan and keeping the fighting spirit burning. The game features combat in a variety of formats, such as kicking and using fireballs to repel monsters in scrolling stages, a system during one-on-one duels against Tusk Soldiers or a pair of martial arts tournaments where the player must attack a mark that appears on their opponent\'s body, or defend the area when it appears on them (this system is similar to Culture Brain\'s original Flying Dragon for the NES), and RPG-style command battles against monster bosses. When confronted by a Tusk Soldier or other otherworldly villain, Rick can change into a costumed superhero form or switch with one of his teammates. The player must switch to Flying Warrior form to use the characters\' magic powers and defend themselves from the Tusk Soldiers\' magic spells.', 'F', 604, 0, 1.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wjk5d03pokhxodfyynig.jpg'),
(11, 'Formation Z', '1st September, 1984', 'The player competes in a marathon continuous scrolling horizontal shoot-em-up game across land, sea, air and outer space. You can hold down the fire button for a burst of Charged fire, which is especially essential to defeat the bosses. \n \nThe player can hold down the Jump button to transform back and forth between a Mobile Robot or an Aero Fighter. Some sections have confrontations on both ground and air; others insist on aerial battling. Your time in the Aero Fighter is limited by its fuel requirement.', 'F', 605, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kjwjlsvxm1bo3kv4mbyl.jpg'),
(11, 'Formula 1 Sensation', '1st March, 1993', 'Formula 1 Sensation is an arcade-style racing game for the NES. Race against up to eleven other rivals in either a single race or the grand prix! Each race unfolds at blistering speeds on tracks influenced by the 1992 Formula One season. Players have access to a wide assortment of customizations to optimize their vehicles.', 'F', 606, 0, 2.5, ''),
(11, 'Formula One: Built to Win', '6th December, 1990', 'Formula One: Born To Win is a career racing game. The player begins with a Mini Cooper and claws up the ranks of the racing circuit starting with the lowest ranked races in the eastern part of the United States. By winning races, the player can upgrade parts on the Mini and have a better shot at more races. Win enough races and eventually earn the opportunity to race using faster cars. The other cars available in the game are the Vector W2, Ferrari F40, and of course, the Formula 1. The first races take place in New York City, Detroit, and Miami. The other locales to visit are Yellowstone, Denver, Dallas, Las Vegas, Los Angeles, San Francisco, and finally Hawaii.', 'F', 607, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ofej3ztaovhdxcxtyims.jpg'),
(11, 'Four Players\' Tennis', '13th February, 1990', 'Play the game of your dreams with Top Players\' Tennis - the only game where you &quot;become&quot; Ivan Lendl or Chris Evert. \n \nBut first, you\'ve got four major tournaments to play; the Australian Open, the French Open, Wimbledon and the U.S. Open. Play singles against a friend, or the computer; double up with Lendl or Evert to beat the computer; or play with a friend against the computer. There\'s excitement, action and sweat as you play game... set... match - and win! \n \nTop Players\' Tennis gives you total command of the ball. Hit a passing shot cross-court or down-the-line; play deep from the baseline; serve and volley or take the game with an overhead smash. You set the speed of the serve and the spin on the ball, giving it a top spin, slice, drop shot or side spin - just like the pros. When you\'re ready, hit a &quot;Miracle shot,&quot; where the ball can zig-zag or soar right up in the air! \n \nWhile you play, Evert and Lendl are by your side, with adviCe at the touch of a button. So put yourself on the court with a pro. With Top Players\' Tennis, the only thing between you and the Grand Slam is...you!', 'F', 608, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/a5eol9bbsy5onhz9z3gj.jpg'),
(11, 'Frankenstein: The Monster Returns', '9th August, 1991', 'For years the monster lay in the grave, and the villagers went peacefully about their business trying to forget the horrible nightmare days when HE had spread terror throughout the countryside. For years the sun seemed to shine brighter and the crops grew taller than anyone could ever remember. Surely, their troubles were far behind them, and life was one blissful long walk through paradise. But, their wonderful world would be shattered in one mighty flash from the heavens. For lightning had struck the old tombstone that lay battered and overgrown with weeds in a dark corner of the ancient cemetary. And just as fiendish life had once been given to the dead, it would be given again. First a twitch of a finger, a flutter of a heartbeat, then a powerful surge of energy to the twisted criminal brain that so long ago had terrorized the land in the powerful body of the hideous monster. The horror was about to begin again... Frankenstein had risen from the dead!', 'F', 609, 0, 2.5, ''),
(11, 'Freedom Force', '1st April, 1988', 'Mission: Neutralize Extremist Element! The fate of the airport is in your hands. Standing in your way are two deadly units of extremist guerillas. Four stunningly lifelike - and deadly - airport scenarios, and a climatic one-on-one duel with the most feared anarchist in the world today. Your assignment is to terminate the enemy element with extreme prejudice. You, and you alone, are freedom\'s last hope!', 'F', 610, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sh4mevfgce7vtdefoagp.jpg'),
(11, 'Friday the 13th', '1st February, 1989', 'Based on the popular movie franchise, Friday the 13th casts you as one of six camp counselors (three girls or three boys) at the infamous Camp Crystal Lake, and you are tasked with destroying Jason Voorhees once and for all.', 'F', 611, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pgrorkwkyqrzlx6h1ktf.jpg'),
(11, 'Front Line', '31st December, 1982', 'Front Line is a vertically scrolling action game. Your mission is to infiltrate enemy territory and destroy their fortress. To reach the fortress, you will have to make your way through varied and dangerous terrain. Jungles, deserts, brush, and rocks all slow your progress, plus each area has numerous enemy fighters and tanks trying to stop you. To help get past these obstacles, you are armed with a machine gun and grenades; at some points in the game you may even come across an abandoned tank which you can control to increase your odds of survival. When you reach the end of the level and successfully destroy the fortress, the game will repeat at a higher level of difficulty. Gameplay is for one or two players, and four different skill levels are available.', 'F', 612, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fyohi3oase4ylorzx4ws.jpg'),
(11, 'Fun House', '1st February, 1990', 'The general gameplay concept is that each level is like a child\'s version of The Running Man with a basic top-down view. Players must throw tomatoes skillfully at a series of easy-to-hit targets. Some elements of the game are indirectly taken from the classic arcade game Pole Position (except that the player does not have the option to play as a Formula One vehicle). \nIn order to make it to the next level, the player must make it from the starting line to the finish within the time limit with a young child on inline skates. Otherwise, the player loses a chance and the player must start the stage over again. The host of the televised game show, J. D. Roth, congratulates players for winning a stage while taunting the player with late 1980s/early 1990s sarcasm when he loses a &quot;chance.&quot; Icy floors and slime colored ramps offer an additional challenge to the player. There are 72 rooms in the entire Fun House; with targets that are either numbered or given a generic target graphic. Each room has a name that usually gives a clue about how the room\'s design is implemented. Although the player is given three chances to successfully navigate the entire Fun House, collecting 25 silver coins acts as a 1-up. Warp zones will allow players to access the more difficult levels of the Fun House at an earlier time; thus allowing gamers who are pressed for time a chance to beat the game with a higher level of risk.', 'F', 613, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wg3ayshx8hxiwqtjwj4a.jpg'),
(11, 'Fushigi no Umi Nadia: The Secret of Blue Water', '14th April, 1991', 'Fushigi no Umi Nadia: The Secret of Blue Water is a Strategy game, developed by Advance Communication Company and published by Toho, which was released in Japan in 1991.', 'F', 614, 0, 2.5, ''),
(11, 'Fuzzical Fighter', '17th June, 1991', 'The Dimensional Stone, which is required to maintain balance in the world of starship pilot Mark was stolen. The king finds a hero to retrieve the stone; using the &quot;Fuzzical Fighter&quot; to transport the player\'s character into enemy territory. \n \nTowns are visited in-between stages to provide the player with weapons and artificats that are bought with the in-game gold currency. Players can choose to backtrack to either to previous stage while staying at the inn or to a stage that he has not yet explored. They also have access to three different kinds of healing spells: Riken (minor healing), Rikento (normal healing) and Rikentaru (major healing). \n \nDespite being a mechanical object and not a creature, the Fuzzical Fighter has magic points that can be replenished while in the towns. The Fuzzy Fighter itself resembles a spaceship with a mechanical tail at the end.', 'F', 615, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hydzwfky3ixjjpz16dvd.jpg'),
(11, 'G.I. Joe', '1st January, 1991', 'G.I. Joe is a NES game from 1991 published by Taxan which later spawned a sequel called G.I Joe the Atlantis factor.', 'G', 616, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lzozrywdeadongkd6fmq.jpg'),
(11, 'G.I. Joe: The Atlantis Factor', '1st March, 1992', 'GI Joe\'s squad of mean, lean combat experts moves into action! Cobra Commander has raised the ancient island of Atlantis from the ocean depths, and is using it as a base. With a nearly indestructible army, and powerful space weapons, the power-crazed Cobra is about to take over the world! Advance through the lethal mazes of Cobra\'s weapons complex, battling soldiers, gunships, laser orbs, and skin-shredding birds of prey. Infiltrate secret storerooms where Cobra Commander carries out his deadly schemes. At each level, find an ally of even greater strength and skill to join your combat team. \n \nAt last, face Cobra Commander himself in a treacherous duel for world dominance! This is a fight only G! JOE can win!', 'G', 617, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eueeagzpfvfuwrffidx3.jpg'),
(11, 'Galactic Crusader', '1st February, 1990', 'Your starship is alive - a metamorphic creature that can transform from a huge flying insect into a metallic destroyer! Penetrate squadron after squadron of bizarre alien fortifications. March onward to a final confrontation against an all-powerful enemy!', 'G', 618, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/clejhrs6jp7pbrjg2ajl.jpg'),
(11, 'Galaga', '1st September, 1981', 'The objective of Galaga is to score as many points as possible by destroying insect-like enemies. The player controls a starfighter that can move left and right along the bottom of the playfield. Enemies swarm in groups in a formation near the top of the screen, and then begin flying down toward the player, firing bombs at the fighter. The game ends when the player\'s last fighter is lost, either by colliding with an enemy or one of its bullets, or by being captured. \nGalaga introduces a number of new features over its predecessor, Galaxian. Among these is the ability to fire more than one bullet at a time, a count of the player\'s &quot;hit/miss ratio&quot; at the end of the game, and a bonus &quot;Challenging Stage&quot; that occurs every few levels, in which a series of enemies fly onto and out of the screen in set patterns without firing at the player\'s ship or trying to crash into it. These stages award a large point bonus if the player manages to destroy every enemy. \nAnother gameplay feature new to Galaga is the ability for enemies to capture the player\'s fighter. While the player is in control of just one fighter, a &quot;boss Galaga&quot; (which takes two shots to kill) periodically attempts to capture the fighter using a tractor beam. If successful, the fighter joins the enemy formation. If the player has more lives remaining, play resumes with a new fighter. The captured fighter flies down with the enemy that captured it, firing upon the player just like normal enemies, and can be shot and destroyed. The player can free the fighter by destroying the boss Galaga while in flight, causing the captured fighter to link up with the player\'s current fighter, doubling his or her firepower but also making a target twice as large. \nGalaga has an exploitable bug that can cause the attackers to stop firing bullets at the player, due to a coding error. In addition, similar to the famous &quot;Split-Screen bug&quot; in Pac-Man, a bug exists in Galaga in which the game &quot;rolls over&quot; from Level 255 to Level 0. Depending on the difficulty setting of the machine, this can cause the game to stall, requiring that the machine be reset or power-cycled in order to start a new game.', 'G', 619, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zitthttboio7oyovnqmu.jpg'),
(11, 'Galaxian', '1st October, 1979', 'Galaxian is a shooter arcade game developed by Namco in 1979. It was released by Namco in Japan and a few months later by Midway Games in North America. The game was developed to compete with Taito Corporation\'s Space Invaders, released a year earlier, and featured a similar space theme. The player controls a space ship in the bottom part of the screen and shoots at enemies descending from the top of the screen. \n \n \nThe game was received very well by the public and has continued to be a game with a competitive community to this day. It was followed by a successful sequel called Galaga in 1981 and two less known sequels called Gaplus in 1984 and Galaga \'88 in 1987. Galaxian was one of the most popular games in the golden age of arcade video games.', 'G', 620, 0, 4.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vpqeloulji2z3xksyaeg.jpg'),
(11, 'Galaxy 5000', '1st February, 1990', 'The future of Grand Prix racing is in outer space. And you\'re one of the hottest turbo-racers in the solar system. But are you tough enough to win the ultimate racing challenge, the GALAXY 5000? Dozens of track objects, including land mines, gun turrets, speed zappers, warp doors and deadly solar spikes! Awesome digitized sound effects. Hear the driver scream as he falls off the track. Use your winnings to repair damage, or upgrade to a more powerful turbo-craft!', 'G', 621, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/enptjx9yij70stsjtub4.jpg'),
(11, 'Ganbare Goemon Gaiden 2: Tenka no Zaihou', '3rd February, 1992', 'Ganbare Goemon Gaiden 2: Tenka no Zaihou is a Role-Playing game, developed and published by Konami, which was released in Japan in 1992. \n \nThis game is the first title that really defined the Goemon (Legend of the Mystical Ninja) series. It is a virtual atmosphere of a Japan where every myth and legend that ever came to exist are brought to life in this game, be it amazing clockwork machinery, Ice spirits that are out to haunt the player, or a trip down to hell for harming the Ojisan statues.', 'G', 622, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1yng.jpg'),
(11, 'Ganbare Goemon Gaiden: Kieta Ougon Kiseru', '5th February, 1990', 'Ganbare Goemon Gaiden: Kieta Ougon Kiseru is a Role-Playing game, developed and published by Konami, which was released in Japan in 1990.', 'G', 623, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ql3.jpg'),
(11, 'Ganbare Pennant Race!', '28th February, 1989', 'The ultimate showdown in baseball! \n \nTake to the field and batter up, and direct your team to Pennant glory. This is Konami\'s greatest sports event! Become the worlds greatest!', 'G', 624, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xinskc9y6vnkkt3uvbiz.jpg'),
(11, 'Ganso Saiyuuki: Super Monkey Daibouken', '21st November, 1986', 'Sun Wukong must assist the Buddhist monk Xuanzang with his task of collecting some sÅ«tras as they make the treacherous voyage from China to India. Other guardians can be asked to join the adventuring party after meeting up with them. Most of the storyline in this video game is based on the Chinese novel Journey to the West. Players can enter a code that allows them to return to any stage at any time.', 'G', 625, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vfj0h2fkgvim4hwrtazi.jpg'),
(11, 'Garfield no Isshukan: A Week of Garfield', '6th May, 1989', 'A Week of Garfield (ã‚¬ãƒ¼ãƒ•ã‚£ãƒ¼ãƒ«ãƒ‰ã®ä¸€é€±é–“ GÄfirudo no Isshukan?) is a 1989 Family Computer title based on the comic character Garfield. It was only released in Japan due to issues with using the Garfield license in North America and Europe. It is the third video game to be based on Jim Davis\' Garfield Comics \n \nThe game is a sidescrolling action game in which enemies can be mice, spiders, birds and other assorted animals. Garfield\'s default attack is a low judo-style kick when he is standing on his hind feet. There are also several powerups that are limited to how many Garfield has the ability to pick up. A time limit prevents players from wandering aimlessly throughout the level looking for power-ups.', 'G', 626, 0, 2.5, ''),
(11, 'Gargoyle\'s Quest II', '17th July, 1992', 'The Law of the Claw! \n \nBefore Man ruled the world there were the monsters of Etruria. One such beast Firebrand the Gargoyle. must act to \nrestore the magic that quickly fades from the Ghoul Realm. Join him on his perilous journey as he looks for the origin of a mysterious dark beam of light. \n \nThis epic quest features a hero with leathery wings and the claws of a lion. Breathe fire at hideous creatures that hunger for your essence. Dodge magical assaults. deadly traps and cunning opponents that will stop at nothing to protect their ghastly secret! See if you have what it takes to solve riddles while battling for your very life! \n \n-State-of-the-art Graphics with incredible Music and Sound! \n-Collect magical items to boost your awesome powers! \n-From the sensational hit that set the standard for Game Boy!', 'G', 627, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kafzxpttiugh2q7sn43e.jpg'),
(11, 'Garry Kitchen\'s Battletank', '31st December, 1990', 'Tank simulator for the NES.', 'G', 628, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fztnmfltw30pvohadzyc.jpg'),
(11, 'Gauntlet II', '1st January, 1986', 'The gameplay is very similar to the original Gauntlet, a topdown dungeon crawl supporting up to four players. The biggest difference from the original game is that players can choose identical classes, instead of being limited to a particular one for each joystick; each player is differentiated by color. Thus, instead of having a &quot;warrior&quot;, &quot;wizard&quot;, and &quot;valkyrie&quot; (for instance), in Gauntlet II there could be a &quot;red wizard&quot;, a &quot;blue elf&quot; and a &quot;green warrior&quot;. \n \nIn addition to the new &quot;class&quot; system, new level designs were added, including the possibility of encountering them in altered ways by having the play-field turned in steps of 90Â°. Other new features included the enemy &quot;It&quot;, which upon contact would make a player &quot;It&quot; and draw all enemies towards him/her. The only way to release this curse is by touching another player or entering the exit, turning any level containing &quot;It&quot; into a fantasy filled game of tag. Other notable additions include the ability to ricochet shots off walls by means of a special pick-up, acid puddles that caused large, predetermined amounts of damage and a large dragon which would occupy multiple squares and require multiple hits to destroy. \n \nNew level elements were also added, adding more variety to the original game. These included &quot;all walls are invisible&quot;, &quot;magic walls&quot; which changed into monsters or items when hit, &quot;stun tiles&quot; which stunned the player, and fake exits. \n \nAnother challenge in the game is the possibility to find a &quot;secret room&quot;. This can be found by completing specific achievements within the level (e.g., &quot;don\'t be fooled&quot;, means that you must find the real exit first). The secret room contains items such as food and magic potions (extra shot power, extra shot speed, extra magic power, extra speed, extra armor and extra fight power). \n \nThis sequel was also the first to feature what is now known as the Gauntlet theme tune, which resembles a simplified Baroque fugue.', 'G', 629, 0, 3.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qmc41mlrcnh6b4ov80gk.jpg'),
(11, 'Ninja Kid', '17th April, 1986', 'Ninja Kid (Gegege no Kitarou) is a NES platformer published by Bandai. As with Super Mario Bros 2, Ninja Kid went through some significant changes for its US release.', 'N', 630, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fr81fcyqh8ftaqltlzzu.jpg'),
(11, 'Gegege no Kitarou 2: Youkai Gundan no Chousen', '22nd December, 1987', 'Gegege no Kitarou 2: Youkai Gundan no Chousen (ã‚²ã‚²ã‚²ã®é¬¼å¤ªéƒŽ2 å¦–æ€ªè»å›£ã®æŒ‘æˆ¦ ? Spooky Kitaro 2: Kitaro vs. Yokai Army) is a RPG game based on a manga and anime from Japan about a boy who is a youkai, a class of spirit-monster to which all of the main characters belong. The main character, Kitarou, is the last living member of a Ghost tribe. He is missing his left eye, but his hair usually covers the empty socket. He fights for peace between humans and yÅkai, which generally involves protecting the former from the wiles of the latter. While the game follows the release of Gegege no Kitarou: Youkai Daimakyou (released in the U.S as Ninja Kid), it is not a direct sequel to the original game, which is an action side-scroller. \n \nGegege no Kitarou 2 plays very much like a simplified traditional RPG. Fights are turn-based, where the player must input his command, and then watch the sequence of event play out until the round is over and the next round begins. However, even though it is simplified, it is actually a rather difficult and challenging game. In the very beginning of the game, Kitarou struggles to survive more than two fights against monsters before needing to return home and rest until he reaches level 2. A majority of the enemies only provide experience points in the single digits until much later in the game, although to compensate, the amount of experience needed to reach each level is low by comparison as well. Kitarou maxes out at Level 10 when he reaches 999 experience points. \n \nThe map of the game\'s overworld is a fairly faithful representation of Japan, along with part of Korea and a small unidentified island. Kitarou must explore the island nation to rescue his girlfriend and the rest of the world from the onslaught of evil Youkai that threaten to take over the world of the living. He must locate several homes, castles, and cave entrances to make his way through Japan, which suffers from spirit storms that prevent him from exploring new regions on the island until some task has been completed first.', 'G', 631, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lipqn8udnmlqfulywqoz.jpg'),
(11, 'Geimos', '31st December, 1985', 'An early pseudo-3D shoot-em-up for the Nintendo Famicom developed by Micronics and published by ASCII.', 'G', 632, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rlarkjc9p9bvlbqb58km.jpg'),
(11, 'Gekitotsu Yonku Battle', '17th December, 1989', 'Gekitotsu Shiku Battle (æ¿€çªå››é§†ãƒãƒˆãƒ«?, &quot;Four Wheel Drive Battle Clash&quot;) is a Japan-exclusive video game of the vehicular combat game genre released in 1989 by Irem for the Family Computer.', 'G', 633, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wvfcdcfrvsohw1jqn49o.jpg'),
(11, 'Tecmo World Wrestling', '1st May, 1990', 'It\'s your call from the opening bell to the final pin. Select your wrestler and take on any challenge. Every bodyslam, every cobra twist and piledriver brings you closer to victory. Will you be the one receiving the Tecmo World Wrestling Championship Belt?', 'T', 634, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vgetolje7nsfboi9nd8v.jpg'),
(11, 'Genghis Khan II: Clan of the Gray Wolf', '31st December, 1993', '&quot;Genghis Khan II: Clan of the Gray Wolf&quot; was released in 1992, the third in the series and the second to be released outside Japan. The wolves of the Great Plains become the rulers of the world. Engage in culturally rich battles using fighters, horsemen, elephant riders and more.', 'G', 635, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jtadrsija2ufyoedtvsa.jpg'),
(11, 'George Foreman\'s KO Boxing', '24th January, 1992', 'You\'re &quot;Big George&quot; Foreman - the people\'s champion - and you\'ve got an appetite for big action that only KO boxing can satisfy. It\'s a full menu of hard-hitting, real-ring action! Take on a roster of heavyweight contenders as you go for the World Championship. Rock your opponents with stinging left-right combos and pound your way to the title with a spectacular &quot;Big George&quot; Super Punch, while the computer tracks the action. George Foreman\'s KO Boxing puts the power of the greatest knockout artist in your hands!', 'G', 636, 0, 2.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1pa4.jpg'),
(11, 'Getsu Fuuma Den', '7th August, 1987', 'In the distant future of 14672 A.D., the first year of the Demon Age, the demon lord Ryoukotsuki escaped from hell and plotted to conquer the surface world ruled by the three Getsu brothers. The Getsu brothers fought against Ryoukotsuki, each wielding one of the three spiritual Pulse Blades that have been passed within the clan for generations. However, the brothers were ultimately defeated by the demon and only Fuuma, the youngest of the three, survived. Vowing to avenge his slain brothers, FÅ«ma ventures into Kyouki-tou to recover the three stolen Pulse Blades and summon the spirits of his brothers to defeat Ryoukotsuki.', 'G', 637, 0, 2.5, ''),
(11, 'Ghost Lion', '13th August, 1989', 'How high are your Hopes? How powerful are your Dreams? How strong is your Courage? You\'ll need them all to help Maria find her parents in the caverns of the Ghost Lion. Use your magic Bombs, Storms and Thunder wisely against Zombies, Goblins, and Kobold, the monster with the face of a dog. Keep your companions close. Centaur, the half-man, half-horse. Twana, Spirit of the Lamp. And faithful Mojo, the Spirit of the Spear. It\'s the easiest way to get into role playing. And only the biggest supply of Courage will get you and Maria through!', 'G', 638, 0, 2.5, '');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Ghosts \'n Goblins', '1st September, 1985', 'Ghosts \'n Goblins is a platform game where the player controls a knight, named Sir Arthur, who must defeat zombies, ogres, demons, cyclops, dragons and other monsters in order to rescue Princess Prin Prin, who has been kidnapped by Satan, king of Demon World. Along the way the player can pick up new weapons, bonuses and extra suits of armor that can help in this task. \n \nThe game is often considered very difficult by arcade standards and is commonly regarded as one of the most difficult games ever released. The game is considered by Gametrailers.com to be the world\'s second most difficult game ever made. The player can only be hit twice before losing a life (the first hit takes away Arthur\'s armor, and the player must continue on in his underwear until completing the level, or finding replacement armor). If the player loses a life, he is returned to the start of the level, or the halfway point if he has managed to get that far. Furthermore, each life can only last a certain length of time (generally around three minutes), the clock being reset at the start of a level. If the clock does run out, the player instantly loses that life. After defeating the final boss, but only with the cross weapon (if the player does not have the cross weapon, they will be prompted that it is needed to defeat the boss and restart at the beginning of level 5 and must repeat round 5 and 6 again regardless if the weapon is obtained immediately or not) for the first time the player is informed that the battle was &quot;a trap devised by Satan&quot;. The player must then replay the entire game on a higher difficulty level to reach the genuine final battle.', 'G', 639, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1r1w.jpg'),
(11, 'Ghostbusters II', '31st December, 1989', 'Re-live the movie as you bust ghosts, collect slime, find the proper mixture, break outta jail and hunt down Vigo, the Scourge of Carpathia.', 'G', 640, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sm4wbsxqexr9dc5sdyz8.jpg'),
(11, 'Ghoul School', '1st February, 1991', 'One day Spike O\'Hara, a senior from the academic institution of Cool School High found a glowing skull in the local cemetery, a finding that would prove to be a disaster. Spike brought the skull to his teacher and it is from here that our ghostly tale unfolds...The skull ended up being a beacon, a homing device for all the spirits and monsters from the realm of the dead. These ghouls from a land downunder have sort of captured your dream girl Samantha Pompom, the beautiful head cheerleader of the school. She\'s being held somewhere in the school and you\'ve got to find her. (Everyone before you has failed -- but don\'t let that discourage you.)', 'G', 641, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/a5w63iyxxrjbysufksgn.jpg'),
(11, 'Mr. Gimmick', '31st January, 1992', 'A young girl receives a doll named Yumetarou (ã‚†ã‚ãŸã‚ãƒ¼) for a birthday present. She quickly favors the new doll over her previous five toys, who felt abandoned and unloved. While she was sleeping, they suddenly came to life and took her to another dimension. Yumetarou, as the protagonist, must track down his new owner and retrieve her from the toys\' world.', 'M', 642, 0, 4.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/os8jfe1qb1ejo2wvdcfe.jpg'),
(11, 'Ginga Eiyuu Densetsu', '21st January, 1989', 'Ginga Eiyuu Densetsu is a Strategy game, developed by Tokuma Shoten and published by Kemco, which was released in Japan in 1988.', 'G', 643, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jscivjy8gp31vh7dpmyn.jpg'),
(11, 'Ginga no Sannin', '15th January, 1988', 'In the year 2300, the human race created an Earth federation government and spread out into space to begin colonizing the surrounding planets. However, an alien species from the far reaches of outer space began attacking the human forces, putting the very survival of the human race at stake. Though it was only a matter of time before Earth fell to the enormous power of the enemy forces, the Earth\'s army commander issued an order calling all of the units dispersed around the colonized planets to return to Earth. The player takes the role of a young soldier who was stationed with the Rayieza unit on the planet Mars. The journey begins as he makes his way back to Earth along with the other members of his unit.', 'G', 644, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fh6bxmwajmqbqdjg7c0q.jpg'),
(11, 'Gluk The Thunder Warrior', '31st January, 1992', 'The ARCA DORADA, the most valuable relic of the people of Tibet, has been stolen during the celebration of the new year. \n \nThis relic contains the spirit of strength - The population is in the hands of the ruthless thieves. GLUK must retrieve the relic. The sacred monks of Tibet have given the power of thunder to help him succeed in his mission. There is no time to lose. The adventure begins. \n \nGOOD LUCK!', 'G', 645, 0, 2.5, ''),
(11, 'Goal! Two', '1st December, 1992', 'Get ready for the ultimate rematch! It\'s too real! Too fast! Too good to be anything less than the best soccer game ever created for the NES! It\'s GOAL! TWO, the long-awaited sequel to the original title that set the standard for world class soccer simulation. It\'s living proof that you can never get too much of a great thing!', 'G', 646, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kipafimnqmiivityapgl.jpg'),
(11, 'Godzilla: Monster of Monsters', '9th December, 1988', 'The invaders from Planet X attack earth as part of their plan to conquer the entire universe, using a legion of space monsters. The earth sends Godzilla, the strongest monster on the earth, and Mothra, to defend itself. Godzilla advances through 8 battle stages to defeat a legion of space monsters controlled by Planet X. For the sake of the future of the earth, Godzilla\'s fierce battle now begin...', 'G', 647, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/udp01khzidm9flijvelo.jpg'),
(11, 'Godzilla 2: War of the Monsters', '1st February, 1992', 'The earth is besieged by Godzilla and monsters, and is in a critical situation. Who will be the ultimate winner, human wisdom or the instincts of the monsters? A highly challenging yet simple simulation game to play! Just choose the commands from the &quot;pop-up&quot; menu and all operations can be done easily. Concentrate on your battle strategy and destroy all the enemy monsters on the earth. Popular monsters are up against the newest &quot;smart&quot; weapons! As the commander of the Allied Defense Forces, you place those controversial smart weapons on the map. Fire and attack as you see fit. There are even some monsters that come to the aid of the Allied Defense Forces!', 'G', 648, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/aodghhqtomb8zjhrdkym.jpg'),
(11, 'The Golf \'92', '3rd August, 1992', 'There are three difficulty levels and the game is almost completely in Japanese. There are also three modes: leaderboard (similar to major PGA events), tournament (using a format found in most sports playoffs), and stroke play. Players have a crowd to play their round of golf into front of.', 'T', 649, 0, 2.5, ''),
(11, 'Golf', '1st May, 1984', 'The original golf game for the Nintendo Entertainment System.', 'G', 650, 0, 2.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1lfb.jpg'),
(11, 'Golf Club: Birdie Rush', '9th January, 1988', 'Golf Club: Birdie Rush is a golf game developed by Data East and published for the Famicom towards the end of 1987. It employs a far off bird\'s eye view throughout the game. It features 18 holes and allows players to play in a stroke game, or a tournament, and allows players to play alone, or head to head. It was only released in Japan, and it was followed up with a sequel for the Super Famicom called Super Birdie Rush in 1992.', 'G', 651, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/frikmi1auognqozugb5x.jpg'),
(11, 'Golf Grand Slam', '3rd March, 1991', 'Now, in Golf Grand Slam, you\'ll face all the conditions you would on a real golf course! Learn more about using each of the 14 golf clubs, how to choose a strike point on the ball, and setting up putts - all while you\'re contending with wind resistance, sloping greens, complex faiways and more. Two training modes have been specifically designed to help you sharpen your golf techniques. Then, after you\'ve mastered those, you can take on the Golf Grand Slam Top 30 Pros in a tournament that will push you to the limit! So if you\'re ready to enjoy golf and improve your game without leaving home, let\'s go!', 'G', 652, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iikqxgtmc3j21ll7p4ja.jpg'),
(11, 'Golgo 13: Top Secret Episode', '26th March, 1988', 'The player takes on the role of Golgo 13 (also known as Duke Togo), an assassin whose objective is to destroy the leader of the Drek group. On the way, Golgo 13 must pass through several areas, including East Berlin, Athens, and Alexander Island, which is located off the coast of Antarctica. It is necessary to navigate several mazes in order to win, but one maze is a fake base with no way out. The mazes account for a large amount of the frustration players encounter with this game. The instruction manual contains maps for the mazes.', 'G', 653, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/thaogwuji16pjg8kfdol.jpg'),
(11, 'Gomoku Narabe Renju', '27th August, 1983', 'A board game simulation for the Famicom. The goal is to line up five pieces in a row. \n \nGomoku Narabe Renju is a video game simulation of a traditional Eastern board game that uses the board and pieces from the popular board game Go. It plays a lot like the American board game Connect Four, in which the goal is to line up a series of five tiles horizontally, vertically or diagonally before the other player can do the same. Two players take it in turns to place a single Go tile on the board, attempting to craft their own lines while strategically placing tiles that blocks the opponent from finishing theirs. \n \nWhile the normal board game is simply referred to as &quot;Gomoku Narabe&quot; (Five Pieces in a Row, occasionally translated as Gobang), the Renju modifier is an additional rule that makes it harder for the player with the black pieces to win. Because the black player always begins each game (like how the white player always begins each game of Chess), this additional rule is thought to even the playing field. The rule is that the black player will lose if they build a line of six or more pieces: this counts as going &quot;overlong&quot; and counts as a loss. \n \nGomoku Narabe Renju is the joint-fourth video game ever released on the Famicom, and the joint-first original game produced for the system (the previous three - Donkey Kong, Donkey Kong Jr. and Popeye - were all ports of Arcade games). It was released the same day (August 27th, 1983) as the Famicom version of Mahjong, another board game adaptation.', 'G', 654, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yxzblhthxihexhfsgz1t.jpg'),
(11, 'The Goonies', '21st February, 1986', 'The Goonies (ã‚°ãƒ¼ãƒ‹ãƒ¼ã‚º GÅ«nÄ«zu) is a 1986 platform game based on the film of the same name produced by Konami for the Nintendo Family Computer in Japan. It was later ported to the Disk System in 1988. While the game was never officially sold in North America, arcade ports were released there for both the PlayChoice-10 and the Vs. System (coin-operated arcade machines which played NES games). A sequel was released titled The Goonies II and it was later released overseas, outside Japan.\n\nThe main theme for most of the game is a chiptune rendition of Cyndi Lauper\'s &quot;The Goonies \'R\' Good Enough&quot;.', 'T', 655, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pz1dijmrd7ckd2kyilgu.jpg'),
(11, 'The Goonies II', '18th March, 1987', 'The Goonies II features two modes of play: platform and first-person. Most of the game is played as the former as the player works through a non-linear map. The player moves Mikey to new areas of the map by ladders or doors that may act as warp zones. Several different types of zones are found in the game, each with distinct enemies, graphics and music.', 'T', 656, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nlzsb6ioznwqlxzbsgoc.jpg'),
(11, 'Gorby no Pipeline Daisakusen', '11th May, 1991', 'In this falling-block puzzle game, a small girlâ€”wearing a Russian national costume of sarafan, kokoshnik, and valenkiâ€”pushes tiles representing segments of water pipe down a two-dimensional, vertical shaft; this shaft is the field of play. A second girl, also in national costume, waves semaphore flags to give the impression that she guides the placement of the tiles. \n \nThe player must quickly rotate and place the tiles to catch and conduct a continuously-flowing stream of water from pipes on one side of the shaft to the other. When the player successfully links an inflow pipe on one side of the shaft to an outflow pipe on the other side, a row of tiles disappears, and the player earns points. If the player routes the water to a dead end, the game adds a layer of pipe segments for the player to clear. If the accumulating pipe segments stack to the top of the shaft, the game ends. By clearing the requisite number of rows, the player proceeds to the next game level.', 'G', 657, 0, 2.5, ''),
(11, 'The Gorilla Man', '28th May, 1993', 'The Gorilla Man is a Miscellaneous game, developed by Pixel and published by Yonezawa PR21, which was released in Japan in 1993.', 'T', 658, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1iy5.jpg'),
(11, 'Gotcha! The Sport!', '1st November, 1987', 'Gotcha! is an NES Zapper title based on the &quot;sport&quot; of paintball, and loosely tied into the paintball-themed movie caper of the same name. You are required to traverse three different battle zones, grab the opposing teams\' flag from the opposite end of the field, and make it back to your flag without getting shot. One hand controls the Zapper while the other must hold the controller, since the D-Pad controls your movement up and down the field. Limited ammo is also a concern, as is the ability for the computer team to snag your flag and return it to their base to win. You can chase down and tag the flag carrier yourself to prevent this.', 'G', 659, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ygzoldtee9be4mnfpzwg.jpg'),
(11, 'Gozonji: Yaji Kita Chin Douchuu', '17th November, 1989', 'Gozonji: Yaji Kita Chin Douchuu is an Adventure game, developed by Hyperware and published by HAL Labs, which was released in Japan in 1989.', 'G', 660, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m4vhpslqgfledyfluh1l.jpg'),
(11, 'Gradius', '29th May, 1985', 'One of the defining characteristics of the Gradius series is the use of a &quot;power meter.&quot; The power meter is powered by a power-up item, whose purpose, when collected, is to move a highlight to the next power-up on the power meter. When a power-up that the player wants becomes highlighted, he or she may activate it, also causing the highlight to reset.', 'G', 661, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tluxw8dby0owbdl15jox.jpg'),
(11, 'Gradius II: Gofer no YabÅ', '24th March, 1988', 'The player returns as the role of the pilot of the Vic Viper spaceship to battle the second onslaughts of the Bacterion Empire, under the new leadership of Gofer, the giant head.', 'G', 662, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ac92s2k3lsgl6j6rlqnk.jpg'),
(11, 'Grand Master', '26th March, 1991', 'A grand and magnificent castle towers over the Central Plains of the Continent of Astral. This is the castle of the brave hero Kaizer who bore the title of &quot;Grand Master.&quot; He was the one who sealed the Devil known as Dante and brought peace to the whole world. \n \nBut when Dante came back to life, the seal weakened. For starters, the Devil obliterated all the humans inside the castle and populated it with monsters. They say the monster that abducted Siren is inside this castle too. \n \nWithout having a clue as to Dante\'s whereabouts, Rody went to the Kaizer Castle in search of a mere trace.', 'G', 663, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dnefzedo3cnijfqwb9ml.jpg'),
(11, 'Great Battle Cyber', '25th January, 1993', 'Great Battle Cyber is an Action game, developed by Arc System Works and published by Banpresto, which was released in Japan in 1992.', 'G', 664, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/felh4zidqae6ura760je.jpg'),
(11, 'Iron Tank: The Invasion of Normandy', '1st July, 1988', 'In 1944 the United Forces are preparing their final assault on the Normandy coast. The mission is to break through the front lines and destroy enemy headquarters. To spearhead the invasion, they have chose Paul from Command Unit 88, also known as Iron Snake. To succeed in his mission, Paul will need all the firepower of the mightiest fighting vehicle, the Iron Tank. Iron Tank is played from an overhead view with a scrolling screen. You need to control the Iron Tank and it\'s varied weapons and power ups to rescue hostages and defeat enemy forces.', 'I', 665, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/x4dww2orlpllr8mck2r4.jpg'),
(11, 'The Great Waldo Search', '1st February, 1992', 'The pictures are slightly animated images of Waldo scenes, the player has to scroll along the long picture to survey the scape while searching for Waldo and other objects. The directional buttons control a magnifying glass and is used in order to &quot;find&quot; objects. Waldo\'s dog Woof is also in each level and by finding him the player gets to play a small bonus game to collect points while controlling Woof on a flying carpet.', 'T', 666, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mjdz8rqktdqaj44pmvyy.jpg'),
(11, 'Greg Norman\'s Golf Power', '1st August, 1992', 'Close your eyes and imagine the perfect golf course. Whether you conjure up an image of a real-life, world famous course or visualize a championship course all of your own design - if you can dream it, you can play it with Greg Norman\'s GOLF POWER. Our exclusive course designer with battery back-up allows you to customize your own 18-hole championship course and then save it in memory. Create a dream course, play one of the pre-set courses in England, Scotland, the USA or Japan, or rejoin a saved game right where you left off. Just like the Great White Shark, you\'ll need total concentration, strategy and control to make the leader board.', 'G', 667, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pfmjnommyguqe947rok7.jpg'),
(11, 'Gremlins II: The New Batch', '31st December, 1990', 'WE TOLD YOU REMEMBER THE RULES \n \nDONâ€™T EXPOSE THEM TO BRIGHT LIGHTS \n \nDONâ€™T GET THEM WET, AND UNDER NO CIRCUMSTANCES FEED THEM AFTER MIDNIGHT! YOU DIDNâ€™T LISTEN!! \n \nHERE THEY GROW AGAIN!', 'G', 668, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iv7i6uk496x1pw4k5mxy.jpg'),
(11, 'The Guardian Legend', '5th February, 1988', 'In The Guardian Legend, the player controls the female guardian of Earth, a &quot;highly sophisticated aerobot transformer&quot;. The player\'s mission is to infiltrate Naju, a large planet-like object which aliens sent hurtling towards the Earth. While inside, the player must activate ten safety devices in order to initialize Naju\'s self-destruct mechanism and destroy the alien world before it reaches Earth. Five hostile tribes of alien lifeforms are vie for control of territories within Naju,and the player needs to fight through them to successfully activate the switches and escape.', 'T', 669, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/utcnbcchkynv5bqp3eoq.jpg'),
(11, 'Guerrilla War', '1st February, 1987', 'Guerrilla War is an overhead run and gun game produced by SNK. Originally released for arcades in 1987 as a coin-operated arcade game, Guerrilla War followed the adventures of two unnamed rebel commandos (Che Guevara and Fidel Castro in the Japanese version) as they raid an unnamed Caribbean Island in order to free it from the rule of an unnamed tyrannical dictator. Along the way the players vanquish hordes of unnamed enemy soldiers while attempting to rescue hostages (with large score deductions for any hostages killed in the crossfire), collecting weapons from troopers and operating tanks.', 'G', 670, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tgdl9y1f4inrtx2sk3d0.jpg'),
(11, 'Gumshoe', '6th June, 1986', 'Jennifer\'s been kidnapped! Now\'s your chance to prove you\'re a sharp-shooting detective by helping Jennifer\'s father find the five diamonds that will pay her ransom. You\'ll use your Zapper light gun to blow away anything that gets in your way. But even with the Zapper, this case will be hard to crack. Because not only are the diamonds hard to find, but you only have 24 hours to find them! What\'s more, you\'ll have to think fast and shoot even faster, because ferocious monsters, diving airplanes and hungry man-eating sharks will stop at nothing to prevent you from getting to the diamonds. Think you\'re a sharp-shooting detective? Well, you better be. Because if you\'re not, it\'s curtains for you in this quick-on-the-trigger Nintendo Light Gun game!', 'G', 671, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/i88zrxy1nen1qyy2rxsc.jpg'),
(11, 'Gun Nac', '10th October, 1991', 'The most happening place in the universe is the trendy, upscale solar system of IOTA Synthetica, part of the Galactic Federation of artificial stars. It\'s as far from dirty old Earth as can be... But don\'t sign up to go yet! A strange cosmic energy field with a major attitude has engulfed the system, and the most outrageous things are happening. Ordinary inanimate objects are coming to life - harmless little animals are becoming rabid giants - and the freaked-out residents are under attack! The only Galactic Commander who can handle this ordeal is the eccentric renegade called Gun-Nac. He can oust this aura that\'s threatening the destruction of comfortable artificial life as we know it. But where in the universe is he? He could be as far away as Earth, searching for a new Game Pak. Commander Gun-Nac, if you read this, call H.Q., A.S.A.P., O.K.? We N.E.E.D. you!', 'G', 672, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jbjwvtk7ic4q5nhpkcgd.jpg'),
(11, 'Vice: Project Doom', '1st December, 1991', 'Vice: Project Doom is a game that features side-scrolling platform sequences, overhead driving modes and rail-shooter stages. In driving stages Hart\'s vehicle can accelerate or slow down and fire his weapon straight ahead. During side-scrolling sequences, Hart can jump, duck, climb or use his selected weapon. Weapons that can be selected include a Katana sword, a pistol and a grenade-type weapon. These weapons feature limited ammunition with the exception of the katana. Power-ups include ammunition, coins, and health. In rail-shooting stages, similar to Operation Wolf, Hart can shoot enemies with his gun or throw grenades and pick up items by shooting at them.', 'V', 673, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zlgkoacl3odm4lpqf77n.jpg'),
(11, 'Gun.Smoke', '1st November, 1985', 'Gun.Smoke is very similar to Commando, another Capcom game, but with several differences. Whereas Commando is a run and gun game, this game is a scrolling shooter in which the screen scrolls upward automatically and players only have three ways to shoot, using three buttons for left, right, and center shooting. However, a player can also change the way the gunman shoots through button combinations. A player can still die by getting shot or struck by enemies like in Commando but improve protection by getting special items, including a horse, for protection up to three hits; boots, for speed of movement; bullets, for faster shots; and rifles, for shot length. These items are found by shooting barrels and rifles, boots, and bullets can stock up to five. \n \nIt was brought to the Sega Master System in South Korea without a license by Prosoft in 1990.', 'G', 674, 0, 3.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gdvyrspcvwdhtf6k9b6n.jpg'),
(11, 'GunHed: Aratanaru Tatakai', '12th May, 1990', 'GunHed: Aratanaru Tatakai is a Strategy game, developed by Toho and published by Varie, which was released in Japan in 1990.', 'G', 675, 0, 2.5, ''),
(11, 'Gyromite', '13th August, 1985', 'Gyromite is a video game released in 1985 for the Nintendo Entertainment System, designed for use with the Robotic Operating Buddy (R.O.B.). Gyromite is one of two games in Nintendo\'s Robot Series, the other being Stack-Up', 'G', 676, 0, 3.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jg4nlm32e9bsvbazpc1j.jpg'),
(11, 'Gyruss', '1st March, 1983', 'Gyruss (ã‚¸ãƒ£ã‚¤ãƒ©ã‚¹ Jairasu?) is a shoot \'em up video arcade game developed by Konami, and released in 1983. \n \nIt was designed by Yoshiki Okamoto, who had earlier created Time Pilot for Konami. Gyruss was licensed to Centuri in the United States, and was ported to numerous games consoles and home computers. It follows in the tradition of space war games such as Space Invaders and Galaga. \n \nGyruss was the second and last game Yoshiki Okamoto designed for Konami, after Time Pilot. Due to pay disputes, he was fired after the release of this game, and soon joined Capcom, where he would write 1942 and the first Street Fighter game. \n \nThe game\'s background music is an electronic, fast-paced arrangement of J. S. Bach\'s Toccata and Fugue in D minor, BWV 565; this particular arrangement is similar in sound to &quot;Toccata&quot;, a rock arrangement by the UK-based instrumentalist group Sky. \n \n Gyruss is notable for using stereo sound, which according to the bonus material for Konami Arcade Classics, was achieved by utilizing discrete audio circuits. The game used three microprocessors: two Z80 microprocessors and one 6809, as well as an 8039 microcontroller. For the sound, five AY-3-8910 PSG sound chips and a DAC. \n \nGyruss was released in both upright and cocktail cabinets. \n \nR.Hirst &quot;KOO&quot;, M.Jones, &quot;BOX&quot; and the Elliott Brother\'s are arguably considered some of the best Gyruss players of the 1990\'s.', 'G', 677, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mfrmdsa3cun7rqx2iel1.jpg'),
(11, 'Haja no Fuuin', '12th November, 1987', 'The seal of the Dark Lord Terarin has been broken and Terarin has been unleashed into the world again. She has stolen the Golden Seal and opened pandora\'s box, unleashing evil creatures into the world. A young hero is tasked by a king to stop Terarin. He must step into footsteps of Iason, a shepherd that once accidentally unleashed Terarin and fought to seal the Dark Lord again. The hero must enlist the aid of three companions, Guy the warrior, Medi the amazon and Treo the pirate (called Turo in the manual) and find the three keys to Terarin\'s lair. To face the Dark Lord, they must find the mystical weapons and armor of old and then defeat Terarin and seal the Dark Lord from the world.', 'H', 678, 0, 2.5, ''),
(11, 'Hammerin\' Harry', '1st February, 1990', 'Hammerin\' Harry, known in Japan as Daiku no Gen-san (å¤§å·¥ã®æºã•ã‚“?), is a series of platforming video games developed and published by Irem in 1990. The titles were developed and published for the arcades, Famicom, Game Boy, Super Famicom and Sony PSP platforms.', 'H', 679, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lip7m7oflbj5umrgzhve.jpg'),
(11, 'Hana no Star Kaidou', '17th March, 1987', 'Hana no Star Kaidou (which can be loosely translated as &quot;Blossoming Star Highway&quot;) is an action game for the Famicom that was developed and published by Victor Musical Industries in 1987. It is about two musicians who dream of obtaining a recording contract and becoming big stars. The player must control both Moero and Goro on the screen at one time. They run, jump, and attack simultaneously. Each one has their own life count, and the game is over as soon as one of them loses all of their lives. Because of the unituitive controls, and unforgiving game mechanics, this game is considered quite difficult and generally not fun to play.', 'H', 680, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y2xdus9opkjyr3furbel.jpg'),
(11, 'Happily Ever After', '12th June, 2016', 'The classic fairly tale is back... with all new enchantment and a new twist!!! Snow White\'s beloved prince has been captured by the evil Lord Maliss, the evil brother of Snow White\'s equally evil stepmother, the wicked queen. Helping Snow White rescue the prince are the magical Seven Dwarfelles, the female cousins of the original Seven Dwarfes. Guide Snow White along her perilous journey through Lord Maliss\' sinister kingdom to save the prince as he once saved her. Turn about is fair play... and FUN play!!! Based on the hit feature film &quot;Happily Ever After&quot;. \n \nUnreleased prototype ROM published online by Nintendo Player', 'H', 681, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rsmaisqhceceopvj6avl.jpg'),
(11, 'Hatris', '31st December, 1992', 'Hatris is a puzzle video game developed by Alexey Pajitnov, creator of famous video game Tetris.', 'H', 682, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nzzgo2tnniqtxdbgbjyz.jpg'),
(11, 'Heavy Barrel', '1st February, 1987', 'Heavy Barrel is a 1987 overhead run and gun arcade game by Data East. \n \nTerrorists have seized the underground control complex of a nuclear missile site, and it is up to the player to infiltrate the base and kill the enemy leader. Players begin armed with a laser gun with unlimited ammunition and a limited supply of grenades. Improved weapons and grenade powerups are made available within the game, either in plain sight or within crates that must be unlocked using keys. Additionally, crates may contain orbs or one of the six pieces of the Heavy Barrel superweapon. Like SNK\'s Ikari Warriors, the original arcade version featured 8-way rotary joysticks. \nThe name of the game is from an in-game weapon. The Heavy Barrel is found in six pieces and is an energy cannon capable of destroying any enemy in the game with a single shot (except the final enemy, and possibly one other boss that may have required two shots). The weapon has a wide arc of fire and can be fired as fast as the player\'s trigger finger permits, but after thirty seconds its use is exhausted, at which point the bearer reverts to his previous weaponry. Best used to get past tough bosses, the weapon could be built several times in a single game (probably three or four times). In a two-player game, whoever collects the sixth piece is equipped with the Heavy Barrel.', 'H', 683, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/obas0j69dusqk6sbklew.jpg'),
(11, 'Heavy Shreddin\'', '1st July, 1990', 'Heavy Shreddin\' is a Snowboarding game, developed by Imagineering Inc and published by Parker Bros., which was released in 1990.', 'H', 684, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vk3jraapuplkxac3vvxw.jpg'),
(11, 'Ufouria: The Saga', '20th September, 1991', 'This game is set in a free-roaming environment. The game\'s world comprises interconnected areas which consist of outdoor sections, caves, water, and other thematic places with platform structures and wandering enemies. Similarly to The Dragon\'s Trap, the player is theoretically able to explore this world from the beginning; however, many areas are too hazardous or impossible to traverse when the player controls only one character with his limited abilities.', 'U', 685, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lhgna7kgcb6nrjjxrbgt.jpg'),
(11, 'Starship Hector', '1st July, 1990', 'Your ship is equipped with both a standard laser and an independently fired ground weapon, which you must coordinate to defeat ground and aerial enemies. A shield bar keeps track of your damage and you can replenish it by defeating certain enemies, but otherwise its just you, your ship and several stages of alien enemies that alternate between top-down and side-scrolling perspectives.', 'S', 686, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mtk1ucr7y2wonxwtzwry.jpg'),
(11, 'Heisei Tensai Bakabon', '6th December, 1991', 'A former genius has now become very eccentric and senile. His family deals with all the crazy problems he and his old friends cause around the neighborhood.', 'H', 687, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qhkbh1pz7cjzf8f1iq2h.jpg'),
(11, 'Hello Kitty World', '26th April, 1992', 'This game is based on &quot;Balloon Kid&quot; for Game Boy but with characters and plot changed. It was released only in Japan for the Nintendo Famicom.', 'H', 688, 0, 2.5, ''),
(11, 'Heracles no Eikou II: Titan no Metsubou', '23rd January, 1990', 'This Dragon Quest-styled game unfolds in ancient Greece, where the hero must traverse the land and do battle with great beasts and monsters of mythology! This game is part of a larger series of Heracles games that have seldom been released outside of Japan.', 'H', 689, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jop5szqhutaxxcoh6u6j.jpg'),
(11, 'High Speed', '27th May, 1994', 'The hottest pinball game ever has been converted to video! All the action and excitement of the original HIGH SPEED is here - Freeway Frenzy, Ramp Race and Running the Red - plus excellent new features like Lightning Bombs and attacking enemies! It\'s a real-life adventure. The screen flashes and a siren shrieks when you run the red light! Police car radio messages and original chase music both add to the thrills. Go for the burn - grab the jackpot and get away at HIGH SPEED!', 'H', 690, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/srynbc6e9mdmzvkusxk3.jpg'),
(11, 'Rad Racer', '7th August, 1987', 'This is no ordinary game pak. This is Rad Racer. Nintendo\'s thrilling 3-D video game Rad Racer comes action-packed with revolutionary 3-D technology and 3-D glasses (they\'re free inside) that will have you really believing you\'re in the middle of a cross-country rally race - cruising along at 200 miles per hour! Rad Racer takes you through 8 treacherous race courses including the Los Angeles Nightway, the San Francisco Highway and the Grand Canyon. Choose the Ferrari and you\'ll enter a Super Machine competition where you\'ll race against Corvettes and Lamborghinis. Select the F-1 Machine and you\'ll compete against incredibly fast cars. Whether it\'s Ferrari or F-1, 3-D or regular mode, Rad Racer\'s hairpin curves, daredevil turns and realistic action will bring home all the fun and excitement of real rally racing. Think you\'re up to it? Then drivers, start your engines. It\'s Rad Racer!', 'R', 691, 0, 3.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ccz3mn0ehdfbjyb9zxdm.jpg'),
(11, 'Hirake! Ponkikki', '16th May, 1992', 'Hirake! Ponkikki is a Miscellaneous game, developed by Minato Giken and published by Takara, which was released in Japan in 1992.', 'H', 692, 0, 2.5, ''),
(11, 'Hissatsu Doujou Yaburi', '18th August, 1989', 'An RPG/Fighter hybrid developed and published by Sigma for the Famicom. It was never released outside of Japan. \n \nHissatsu Doujou Yaburi is an RPG where players fight opponents in Yie Ar Kung-Fu style martial arts battles. The player needs to train for tournaments by encountering and defeating various foes, gaining XP all the while. When strong enough, they can fight a group of enemies one after the other in the tournaments that take place in towns. The player can also walk around towns interacting with friendly NPCs. \n \nThis was Sigma Ent Inc.\'s first Famicom game: Previously, they had only worked on Arcade games.', 'H', 693, 0, 2.5, ''),
(11, 'Hissatsu Shigoto Nin', '15th January, 1991', 'Hissatsu Shigotonin (Translated: Deadly Work People] was released December 15, 1990 exclusively in Japan for the NES. It is an RPG biased off of the popular historical drama TV show of the same name. The Story focuses on a group of ordinary work people who have double lives as assassins.', 'H', 694, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wxcfowa7v20pa47yp6cq.jpg'),
(11, 'Hit Marmot', '31st January, 1991', 'Hit Marmot is an Action game, developed by Mega Soft and published by NTDEC, which was released in Asia in 1991.', 'H', 695, 0, 2.5, ''),
(11, 'Hitler no Fukkatsu: Top Secret', '19th August, 1988', 'The Nazis are back - they have survived the war and, led by their supreme leader Weizmann, they have now come up with the most evil and horrific plan in history! Hitler, the man who the allies thought was dead, has been revived and his fractions of hell are about to take over the world once again. The allies decide to send one of their best men, Super Joe, to counter the threat - but he is soon captured and Radd Spencer is dispatched to rescue him and complete the primary mission.', 'H', 696, 0, 2.5, ''),
(11, 'Hogan\'s Alley', '12th June, 1984', 'Hogan\'s Alley (ãƒ›ãƒ¼ã‚¬ãƒ³ã‚ºã‚¢ãƒ¬ã‚¤ HÅganzu Arei) is a 1984 video game by Nintendo. It was one of the first games to use a light gun as an input device. The game presents players with &quot;cardboard cut-outs&quot; of villains and innocent civilians. The player must shoot the villains and spare the innocent people.', 'H', 697, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/j0f9nzihocbdhcdcov36.jpg'),
(11, 'Hokuto No Ken 2', '17th April, 1987', 'Hokuto no Ken 2 Seikimatsu KyÅ«seishu Densetsu is a side-scrolling action game for the Family Computer released by Toei Animation on April 17, 1987. It served as a tie-in to the anime series of the same name, being released a few days after the airing of its fifth episode. A version for the Nintendo Entertainment System was released by Taxan in North America under the title of Fist of the North Star on April 1989, making it the earliest Hokuto no Ken tie-in product released outside Japan. Before release, the NES version was shown in the Summer Consumer Electronics Show in 1988 under the title of Ken the Great Bear Fist, Toei\'s proposed localized title for the series. \n \nBecause the game was produced at the same time as the Hokuto no Ken 2 anime series entered production, certain plot details differ from both, the manga and anime. Most notably, the renegade Gento KÅ Ken masters from the anime, Taiga and Boltz, co-exists as enemy characters alongside JakÅ\'s sons from the manga, Jask and Sheeno, while Bronza, a character exclusive to this game, serves as the General of the Red Light in place of Shoki, who filled the same role in the anime. While Shoki himself never appears in the game, his death at the hands of Sheeno is acknowledged in the official strategy guide. The game only covers the Tentei story arc, with a bonus stage featuring the Nameless Asura as a hidden final boss.', 'H', 698, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xv7uhikexj7obaw8g7zk.jpg'),
(11, 'Hollywood Squares', '1st October, 1989', 'Hollywood Squares is a NES puzzle game based on the television game show of the same name. Players have to either agree or disagree with fictitious celebrities to earn squares and make tic-tac-toe. Much like the TV series, winning one of the first two games is worth $500, the third game is worth $1,000 and the second game is always the &quot;Secret Square&quot; game. The winner then goes on to the bonus round, where they have to choose one of five keys and insert it into the proper car among the five offered. This version was based on the 1980\'s version hosted by John Davidson', 'H', 699, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xcgbanastrnewzy3dlaf.jpg'),
(11, 'Home Alone', '8th February, 1991', 'Harry and Marv, the bumbling &quot;Wet Bandits,&quot; have paid their debt to society and are now ready to get revenge on the youngster that caused them their humiliating defeat Kevin McCallister. They have arranged for Kevin\'s family to be out of the house when they come calling again, leaving him home alone for their rematch. This time, the sneaky thieves have beefed up their gang with robbers and crooks that are more than eager to help themselves to the McCallister valuables. Only the resourceful Kevin stands between the new Wet Bandit gang and his family\'s fortune.', 'H', 700, 0, 2.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/umz0b0ttfrb8hu4kbwe3.jpg'),
(11, 'Home Alone 2: Lost in New York', '1st October, 1992', 'Kevin ends up in New York City Alone. The &quot;Wet Bandits&quot; are in New York City too. Harry and Marv tried to rob Kevin\'s house last Christmas. But Kevin\'s excellent traps foiled their plans. Now they\'re out for revenge. And Kevin\'s got plenty of hilarious plans to stop them.', 'H', 701, 0, 2.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u5bmswmpuwteckwpfo4f.jpg'),
(11, 'Hoops', '22nd December, 1988', 'Gym rats, beware! HOOPS takes you out to the asphault, where basketball is a half-court game of fast hands, faster moves and slam-jam-thank-you-Sam dunks! The legends of the Playground are all here: Mr. Doc, Jammer, Legs, Bomber, Wiz, eight players in all. You can pit them one-on-one or two-on-two. You pick the court - Eastern or Western - and you pick the rules, too. You can play against the computer or one other player. Or you can even team up with another player against the computer. You can block shots, make steals, pass off or go strong to the hoop - in fact, you control just about everything in this ultra-realistic rendition of the playground game. Except, of course, the final score. But win or lose, you know you\'ve been in a game after you\'ve played a game of HOOPS!', 'H', 702, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/c6gtuxzuee1lmwz2ftrn.jpg'),
(11, 'Kirby\'s Adventure', '23rd March, 1993', 'Not everything is well in Dream Land. For some mysterious reason, the Dream Spring, a magical well that is the reservoir for all the dreams of the citizens of Dream Land, is no longer working. Everyone is being subjected to their worst nightmares every time they go to sleep. Upon reaching the Dream Spring, Kirby finds out that evil King Dedede has stolen the Star Rod, thus depriving Dream Land of the magical energy that feeds its spring. Using 20 unique tricks and your ability to steal your enemies\' powers by swallowing them, you\'ll have to make your way through a horrific land filled with all kinds of nightmares. Recover the broken pieces of the Star Rod, and everyone in Dream Land will sleep peacefully once again. If you fail, the citizens of Dream Land will be subjected to a lifetime of terrible nightmares.', 'K', 703, 0, 4.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1w9s.jpg'),
(11, 'Rescue: The Embassy Mission', '1st January, 1990', 'A diplomatic mission in a foreign city is seized by political fanatics. Innocent lives are in jeopardy. Outrageous demands are being made for their safety. Only you and your elite crisis intervention team can rescue the ambassador and his helpless staff. Position your sharpshooters around the embassy\'s perimeter. Focus your sights on the curtained windows. Squeeze off rounds of cover fire to protect your assault squad. Once your men are inside, an electronic diagram of the building\'s floor plan provides your only guide down to the captives - and the awaiting enemy. Look sharp. Stay frosty. Rescue is an interactive action-adventure game that lets you control each member of your strike team through three different game scenarios. Avoid searching spotlights, dodge enemy gunfire, rappel down walls, and smash through windows. Neutralize your adversaries and liberate the embassy personnel!', 'R', 704, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jvvt4xquyahpjwukgyep.jpg'),
(11, 'Hototogisu', '19th August, 1988', 'A Sengoku-era war simulation game developed by Tamtex for the Famicom in 1988. It was never released outside of Japan.', 'H', 705, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/itodrdkool24dk1wod8t.jpg'),
(11, 'Adventure Island', '12th September, 1986', 'Hudson\'s Adventure Island, also known simply as Adventure Island and released in Japan as Takahashi Meijin no BÅken Jima (é«˜æ©‹åäººã®å†’é™ºå³¶ lit. &quot;Master Takahashi\'s Adventure Island&quot;), is a side-scrolling platform game produced by Hudson Soft that was first released in Japan for the Famicom and MSX on September 12, 1986. It was later released in North America for the Nintendo Entertainment System on September 1988 and in the PAL region in 1992 under the title of Adventure Island Classic. \n \nAdventure Island is an adaptation of the arcade game Wonder Boy, originally published by Sega for developer Escape (now known as Westone Bit Entertainment). Adventure Island was followed by a series of sequels that were independently developed by Hudson Soft.', 'A', 706, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qm3.jpg'),
(11, 'Hyaku no Sekai no Monogatari: The Tales on a Watery Wilderness', '8th September, 1991', 'This Famicom title by ASK combines the mechanics of a tabletop board game with the battle style and character progression of a role-playing game to create an interesting hybrid. One to two players can embark on a great adventure to explore the realm of Yukiria and complete quests for its inhabitants, with multiple endings possible!', 'H', 707, 0, 2.5, ''),
(11, 'Hydlide', '1st December, 1984', 'An evil demon named Varalys casts a curse upon the princess Ann, turning her into three fairies. You control Sir Jim and set out to find the fairies, and then slay Varalys. Only by vanquishing Varalys can the curse be lifted. Once the princess is restored the kingdom will be saved. The fighting is a little more in-depth than hack and slash. You can either fight with a defensive or offensive stance, or you can use magic spells.', 'H', 708, 0, 2.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w0osqesznw98yrstygha.jpg'),
(11, 'Hydlide 3: Yami Kara no Houmonsha', '16th March, 1989', 'A long long time ago, longer than anyone can remember, evil decended upon the \ngood and peaceful people of Fairyland. Old legends tell of a lone brave hero who \nsaved Fairyland from the imminent threat of doom. Since then, the people of \nFairyland have lived through centuries and centuries of peace, and all memories \nof evil faded away. \n \nBut one especially dark evening, a huge column of fire exploded out of the \ndeepest depths of Fairyland, lighting the night sky. The next morning, strange \ndoors began to appear from nowhere. Many who were curious entered these doors, \nbut were never seen again. \n \nFrom that day on, unusual events and catastrophes began to take place. Huge \ncracks opened in the ground, scarring the beautiful lands. Floods wiped out \nentire villages, and the people of Fairyland experienced famine. And then the \nmonsters came. \n \nThe Fairyland council feared that the same evil in the legends was back again. A \nwise old oracle predicted the second coming of evil. He also spoke of a young \nman who could save Fairyland from its gravest crisis. \n \nA young man was chosen to find the reason and source of the evil. As the people \ngathered to bid him farewell and good luck, they couldn\'t help but wonder if \nthey had chosen the right one.', 'H', 709, 0, 2.5, ''),
(11, 'Hyper Sports', '31st December, 1984', 'Six tough events await in this joystick-waggling action game. The full sequence of events is - swimming, skeet shooting, gymnastics, archery, triple jumping and weightlifting. You must complete each event in order to be allowed onto the next one. \n \nSwimming involves moving left and right as fast as possible, while pressing fire when a breath is required. Skeet shooting and archery both come down to timing - though elevation and wind factors affect the latter. Gymnastics involves timing a succession of presses to ensure that the jump is long and the landing graceful. The triple jump involves one press for each part of the jump, whereas the weightlifting involves merely brute strength.', 'H', 710, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xahav4987nwctcqczybe.jpg'),
(11, 'I Love Softball', '19th December, 1989', 'The object is to win the championship using female softball players. Players must choose between the six major high schools from all of the regions of Japan. \n \nAfter winning the Japanese high school championship, the player must take on the American women\'s softball team before becoming a professional softball player. \n \nIf the player loses one game, play starts over unless the player uses a password to return to the previous round. The game\'s password feature allows games to be replayed and maintains total memory of which teams have already been defeated. However, the passwords and long and very difficult to remember.', 'I', 711, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/usugeyilo2hiksgi3m0f.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Ice Climber', '31st December, 1984', 'If you can break through 8 levels of treacherous arctic ice, you\'ll reach the top of the mountain! But watch out. The Nitpickers, Condors, and Ploar Bears don\'t want you up there. And they\'ve got a bag of tricks that will test every ounce of your strength and courage. Are you going to let them stop you? No way! There are 32 mountains to choose from and endless thrills as you fight these arctic creatures alone or with a friend, and ascend to the top of the mountain in ICE CLIMBER!', 'I', 712, 0, 3.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pf7nygobxkp77ufko1pg.jpg'),
(11, 'Ice Hockey', '21st January, 1988', 'It\'s fast skating\', hip checkin\', high scoring action. Lead your team into center ice, over the opponent\'s blue line. Pass over to the point and set up for the tip in - Score! Choose a country for you and your opponent, select a level of play and face off at center ice to become the top goal scorer in Nintendo\'s Ice Hockey! Get charged with a penalty and test your defense. Or attack on a power play and use your puck handling skills to catch your opponents off guard.', 'I', 713, 0, 3.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/g0lcb5mddta5nnmeel7e.jpg'),
(11, 'Idol Hakkenden', '14th September, 1989', 'Idol Hakkenden (ã‚¢ã‚¤ãƒ‰ãƒ«å…«çŠ¬ä¼?) is a Japan-exclusive text adventure video game developed by Natsume and published by Towa Chiki in 1989 for the Family Computer. \n \nErika, an aspiring musician and pop idol, must foil a plot that could ruin her music career. As a Japanese adventure game, players must select through menus of dialogue in order to determine her future. Friends (and sometimes rivals) of Erika give her advice on what to do next. \n \nThere are six songs in the game; all of them belonging to the J-pop genre. Erika must master them all in order to become the greatest idol in all of Japan. Lyrics are not sung by a voice actor; they are shown on the bottom of the screen instead.', 'I', 714, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gsrwjnmh2aadz7k9l4pr.jpg'),
(11, 'Igo-Shinan \'92', '10th March, 1992', 'The third release in the popular Famicom Go series.', 'I', 715, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/smbtv5mwucjt3kmc5k6k.jpg'),
(11, 'Igo-Shinan \'93', '20th November, 1992', '1993 edition of the popular go teaching game.', 'I', 716, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jhqpzn84ifyxwyup4siz.jpg'),
(11, 'Igo-Shinan \'94', '17th December, 1993', 'The final Igo-Shinan game for Famicom.', 'I', 717, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/edpuykiaeriodvlofwgt.jpg'),
(11, 'Igo Shinan', '14th July, 1989', 'A Go simulator from Hect for the NES. It would be followed with four annualized sequels.', 'I', 718, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gvwk2tjnge9kgsogvh1b.jpg'),
(11, 'Ikari III: The Rescue', '1st February, 1991', 'The presidential candidate\'s daughter has been kidnapped! It is your job to get past enemy lines and rescue her. This is the third game in the Ikari Warriors series, and features similar arcade/action gameplay. The screen is a top down view which scrolls vertically, with numerous bad guys to defeat. You start the game with just your fists, and as the levels progress you can find weapons and other objects to help you out.', 'I', 719, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/j5yo4g2cnuev8ebefnke.jpg'),
(11, 'Ikari Warriors II: Victory Road', '31st December, 1986', 'When we last saw Paul and Vince, they had saved the Colonel and were about to head for home in a special plane given to them by the General. But then, while in flight over the ocean, the sky suddenly blackens - the ocean begins to churn - and the plane goes spinning! A booming voice fills the cockpit: &quot;Hear me, Warriors! Zang Zip, the War Dog, has enslaved the people of Earth. Only you can save us from his grip of evil!&quot; Caught in a time warp, hurled thousands of years into the future, Paul and Vince know they have no choice but to meet this impossible challenge head-on. After all, they are professionals... they are the Ikari Warriors!', 'I', 720, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tlwqpiuep8hvgqjjjutx.jpg'),
(11, 'Ikari Warriors', '1st March, 1986', 'A conversion of the arcade game, Ikari Warriors is a vertically scrolling action game. One or two players fight their way through a variety of terrain, such as jungles, rivers, and ruins. Along the way different weapons can be found, including machine guns, grenades, and rocket launchers.', 'I', 721, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tzptrromvdd2dkahp0zz.jpg'),
(11, 'Ikinari Musician', '5th March, 1987', 'Ikinari Musician provides a piano-like keyboard, a treble clef on the staff to show note location, a 5-channel Backing track, 4 timbre choices, and controllers to manipulate common synthesizer parameters such as release and attack, LFO, etc. It also provides recording and play back function. \n \nThe player has many choices of styles of the backing track, from popular styles such as Rock, Techno, and Jazz, to various ethnic flavors such as Bossa, Rio, Japan, India, Arabia, etc. \n \nThe backing tracks representing the styles use familiar elements to make the game more accessible to the general audience. For example, in the Scotland style Cadence to Arms, a familiar bagpipes tune, is used. \n \nMost backing tracks loop around one or two chords, allowing an open improvisation on the main keyboard. Once the style is chosen, the main keyboard is masked in the way that only the scale that easily fits into the style is available, e.g. blues scale, pentatonic scale, etc. \n \nThe keyboard is controlled by the UP-DOWN or LEFT-RIGHT d-pads on the game controller so there is no way to play leaps in the scale. \n \nDue to the hardware limitation, the sound produced is the typical 8-bit chiptune music.', 'I', 722, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vlj7ipmjgycfnfng8azo.jpg'),
(11, 'Ikki', '28th November, 1985', 'Ikki is a Japanese arcade game developed by Sunsoft. It was also released for the Nintendo Famicom.', 'I', 723, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zvapdp5xtvcenkcyroxw.jpg'),
(11, 'Image Fight', '31st December, 1988', 'On a fateful day in 20XX, the Earth\'s moon exploded into four large fragments and a multitude of meteors. Aliens from afar had succeeded in destroying the West\'s moon base. One after another, mankind\'s other military industrial space complexes were being lost. What mankind dreaded had come to pass. Scores of unidentified fighters were in the area. In addition, the moon\'s main computer, still intact after the explosion, had a strange vegetation coiled around it. Their trademark evil exploits being a dead giveaway, invaders from the Boondoggle Galaxy had arrived to take over the Earth. To counter these evil forces, leading scientists from all over the globe created the &quot;OF-1&quot; Fightership. Combat pilots depart the Earth to fend off the invaders and earn everlasting glory.', 'I', 724, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qs0zlk1u8cyyhfqiccpa.jpg'),
(11, 'The Immortal', '31st December, 1990', 'When nightmares come to life... You discover you\'re not immortal! You\'re a mighty wizard in search of your lost master, Mordamir. Venture into the dungeon and slove the mysteries of each level. Unravel the secrets of The Immortal! \n \nThe Immortal is an isometric action-adventure game. \n \nYour old mentor Mordamir has disappeared. Probably kidnapped. You\'re not too sure where he might be, but a dungeon is always a good place to look, so you seek out the nearest one and plunge into its depths. Beware: 8 levels of isometric death await. \n \nThe Immortal is the prototype of a trial-and-error game. Progress is made by encountering a hazard, dying, solving the problem, encountering the next hazard. To solve a level, you have to know its traps and their patterns by heart. As frustrating as this may sound (it is), The Immortal quite cleverly balances annoyance with curiosity and graphical rewards.', 'T', 725, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vlgyk1s9mnwvswyj659v.jpg'),
(11, 'Impossible Mission II', '31st December, 1988', 'You have 8 hours to prevent Elvin, a psychotic genius from destroying the world in this sequel to the highly successful Impossible Mission. Enter Elvin\'s tower fortress, avoid his robots, assemble security combinations for each tower, recover musical sequences and tie them together into a full melody to reach Elvin\'s central control room.', 'I', 726, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nfuxv8lbp2e6wf43lqkq.jpg'),
(11, 'The Incredible Crash Dummies', '1st November, 1992', 'At a time when computer games were being blamed for violence, bad language, epilepsy and everything else the â€˜moral majorityâ€™ needed a scapegoat for, Virgin gave us: The Road Safety Game. Or not, as this is a standard platform game with a twist of questionable taste and purpose. \n \nYou play a crash test dummy, trying to progress through levels filled with hazards such as cars and fireballs, within the time limits. Contact with each of these loses you a limb, and once you have none left, contact means game over. Since the character isnâ€™t handicapped by missing limbs in any way, in practical terms you can think of these as hit points especially as there are screwdrivers to pick up which restore one limb.', 'T', 727, 0, 3.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lmdxpfmdm36ltdrd5p8v.jpg'),
(11, 'Indiana Jones and the Temple of Doom', '1st August, 1985', 'As Indy, the player must complete several cycles of the following three types of levels: \n \n1.Mine level: Whip your way through a mine in order to free children that are held captive. Use your whip to swing across chasms, climb ladders, ride along conveyor belts and defend yourself against attacks from Thuggee guards, bats, snakes and the fireball-throwing Mola ram. Escape with the mine cart after you\'ve freed all children. \n2.Mine cart level: Pick the right route through a network of tracks while riding in a mine cart. Avoid potholes, broken tracks &amp; guards in carts and safely reach the end of the track. \n3.Temple level: Make your way to the altar and grab the Sankara stone while Mola Ram, bats and Thuggee guards attack you. Watch out for that lava.', 'I', 728, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hu6nna6ouxbknepw8lfl.jpg'),
(11, 'Indora no Hikari', '20th November, 1987', 'Around the year 2000, mankind departs a depleted earth and travels through space to the plant Ibaru some 8,500 light years away. There, people live peacefully under the protection of a god whose power source is the Light of Indora. However, a demon siphons the light away from the planet and the god begins to slumber. The surface of the planet transforms into a vast desert and monsters begin to appear. The player must quest to put an end to the demon and restore the Light of Indora to the god that protects the planet.', 'I', 729, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p7czveciwriq2r252byy.jpg'),
(11, 'Ironsword: Wizards &amp; Warriors II', '31st December, 1989', 'In Ironsword, the hero of the series, Kuros, must face off once again against the evil wizard Malkil, who has taken control of the four elementals of the worldâ€”wind, water, fire and earth. Each of the four elemental realms consists of two stages. In the first stage, Kuros must find a golden artifact which belongs to the Animal King of the realm; once accomplished, the path to the second part of the realm will appear. In the second stage, the goal is to find the magic spell which can be used to fight the elemental boss. Without the spell, it is impossible to damage the boss. Once the elemental in each stage has been destroyed, Kuros obtains a piece of the legendary Iron Sword, which is needed for the final battle on Icefire Mountain.', 'I', 730, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cco5jyf2rami8xoatgjq.jpg'),
(11, 'Isaki Shuugorou no Keiba Hisshou Gaku', '19th April, 1990', 'Isaki Shuugorou no Keiba Hisshou Gaku is a Sports game, developed by C-Lab and published by Imagineer, which was released in Japan in 1990.', 'I', 731, 0, 2.5, ''),
(11, 'Isolated Warrior', '15th March, 1991', 'They\'re coming to your town! Isolated Warrior is a high-speed, uniquely developed game based on a 3-D concept that features over 40 types of enemy creatures, realistic graphics and explosive sound effects! Become Max Maverick, a lone warrior, who must defeat the awesome creatures that attack his highly civilized planet!', 'I', 732, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/o4kmy2tftgfk29qx7dfx.jpg'),
(11, 'Ivan \'\'Ironman\'\' Stewart\'s Super Off Road', '31st December, 1989', 'Enter the world of off-road racing as 4 vehicles will face each other, on a series of tracks which are based around flipped and reversed versions of a core selection. Fame, glory and bikini clad women await your victories and the taste of dirt awaits if you fail. Let a computer car beat you and you lose one of your 3 credits. \n \nSuccessful races bring more money, which can be used to soup up their machine. Boosts to top speed, grip and acceleration can be purchased, and your nitro boost must be kept topped up. If you are desperate for upgrades, you can buy into your spare credits. \n \nOnly your off-road driving abilities will be enough to pull you to first place in these races. Play alone or with up to 3 other players (depending on the version) in this classic arcade game.', 'I', 733, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tsdxypwirvedyi5oocto.jpg'),
(11, 'Jack Nicklaus\' Greatest 18 Holes of Major Championship Golf', '31st December, 1988', 'Jack Nicklaus\' Greatest 18 Holes of Major Championship Golf is a golf-simulation video game developed by Sculptured Software, and published by Accolade in 1988. \nThe game features simulations of eighteen holes from renowned golf courses in the United States, Scotland, and England: Four from Augusta National Golf Club, three from Pebble Beach Golf Links, three from the Old Course at St Andrews, two from the Riviera Country Club, two from Baltusrol Golf Club, one from Oakmont Country Club, one from Merion Golf Club, one from Muirfield, and one from Royal Lytham &amp; St Annes Golf Club. In addition, the game contains simulations of two complete Nicklaus-designed 18-hole courses: The Castle Pines Golf Club and The Golf Club at Desert Mountain. \nIt also bears the name and likeness of American professional golfer Jack Nicklaus. Less than two years before the game\'s publication, Nicklaus won the final major golf championship of his career: the 1986 Masters Tournament. Augusta National Golf Club hosted the tournament. Players can compete against Nicklaus as a computer opponent, or any of eight other computer opponents of varying skill levels. \nJack Nicklaus\' Greatest 18 Holes of Major Championship Golf was a commercial success for Jack Nicklaus Productions and Accolade. The two companies developed it into a video game franchise, and Accolade published numerous adaptations and sequels for more than ten years.', 'J', 734, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s3sktqgfvnyadjmkmphu.jpg'),
(11, 'Jackal', '1st October, 1986', 'Overhead run\'n gun-style shoot-\'em-up. You play as jeep driver and gunner rescuing POWs.', 'J', 735, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ak5dwlj6izs0dlaoias8.jpg'),
(11, 'Jackie Chan\'s Action Kung Fu', '31st December, 1990', 'Jackie and his sister, Josephine, are tough on tyrants. As China\'s supreme kung fu champs, they guard their country against the Prince of Sorcerers, who lurks just beyond the Great Wall. It comes as no surprise when this fiend and his ghouls try yet again to seize China for themselves. But this time they\'re clever, casting a spell over Josephine which causes her to vanish into thin air! Jackie is in shock! How can he save his country without his sister? The two have been an unbeatable team! Meanwhile, a demon horde led by the Sorcerer storms the Great Wall and prepares to establish a fierce empire. At the urging of his revered Master, Jackie must now battle the dreaded Sorcerer and rescue Josephine. Maybe he can learn a little magic on his own, because he\'s going to need all the help he can get!', 'J', 736, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nbkwkc65hz7zkustfplp.jpg'),
(11, 'Jajamaru Gekimaden: Maboroshi no Kinmajou', '29th June, 1990', 'JaJaMaru Gekimaden is an action role-playing game, with gameplay similar to The Legend of the Zelda. Players control the protagonist character through towns, dungeons, and a world map. Each different type of map features top-down exploration. When moving through a dungeon, the protagonist will gradually recover health. The protagonist can equip different types of weapons and items that he can buy or find and use them during combat. Dungeons are made up of several rooms with enemies inside. Occasionally, an enemy will drop money when defeated, which can be used to buy items or heal health points at an inn.', 'J', 737, 0, 2.5, ''),
(11, 'Jajamaru Ninpou Chou', '28th March, 1989', 'JaJaMaru: NinpÅ ChÅ (ã˜ã‚ƒã˜ã‚ƒä¸¸å¿æ³•å¸³?) is an role-playing video game released in Japan on March 28, 1989 by Jaleco for the Family Computer. It is part of Jaleco\'s Ninja JaJaMaru-kun series and was originally scheduled for a North American release under the name Taro\'s Quest, although it was never released. Ninja Taro, another game in the series, was localized for America instead.', 'J', 738, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ynh.jpg'),
(11, 'JaJaMaru no Daibouken', '22nd August, 1986', 'JaJaMaru no Daibouken (ã˜ã‚ƒã˜ã‚ƒä¸¸ã®å¤§å†’é™º?, &quot;JaJaMaru\'s Great Adventure&quot;) is a Family Computer video game that was released exclusively for a Japanese market in 1986. \n \nThe concept of the game is that the player controls a red ninja as he progress through a series of Japanesque levels defeating evil spirits that have spread across the land. The player can even ride his faithful frog if he can recover it from hiding.', 'J', 739, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kgqu1wkgqocob60nv1vu.jpg'),
(11, 'James Bond Jr.', '31st December, 1991', 'James Bond Jr. was also a 1991 video game developed by Eurocom and published by THQ for the Nintendo Entertainment System and the Super Nintendo Entertainment System.', 'J', 740, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wul6lfxuysqihaeq589w.jpg'),
(11, 'Jarinko Chie: Bakudan Musume no Shiawase Sagashi', '14th August, 1988', 'Jarinko Chie: Bakudan Musume no Shiawase Sagashi (ã˜ã‚ƒã‚Šãƒ³å­ãƒã‚¨ ã°ãã ã‚“å¨˜ã®å¹¸ã›ã•ãŒã—? lit. Chie the Brat: Bomb daughter finding happiness) is a graphical text-adventure game developed by Konami for the Famicom and published in Japan in 1988. It is a game based on the Jarinko Chie anime and manga about a dependable girl who struggles to help her troublesome father run a small tavern in Osaka. Unbeknownst to her dad, she occasionally visits her mother who left him not too long ago. She plans on trying to reunite them, but not until her father gets a job. The game follows the plotline of several episodes of the anime. Though it is largely text driven, there are moments where the player must play a mini-game in order to advance to the next chapter of the story. Much of the text in the game is presented in traditional Japanese orientation, written top to bottom, and right to left. The game was only released in Japan, and never translated from the original Japanese.', 'J', 741, 0, 2.5, ''),
(11, 'Jeopardy! 25th Anniversary Edition', '1st July, 1990', 'For the last quarter of a century, some of the smartest people in the world have been competing for cash prizes on Jeopardy!, the high-pressure answers and questions television game show. Now It\'s your turn. Share the excitement with thousands of TV winners. Test your memory against even more challenging &quot;Answers&quot; In this all-new edition especially created to commemorate Jeopardy\'s Silver Anniversary. You\'ll be amazed at the things you know!', 'J', 742, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ncdpkzo7uy9riq24g4xl.jpg'),
(11, 'Jeopardy! Junior Edition', '1st February, 1989', 'A conversion of the popular TV game show for younger players ages 7 and up. \n \nUp to three players can take part in the three-round trivia contest where the answers are given and the contestants must supply the correct question.', 'J', 743, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fjldt3magorxh2xxqje2.jpg'),
(11, 'JESUS: Kyoufu no Bio Monster', '17th April, 1989', 'In the year 2061, a manned space mission was planned for Halleyâ€™s Comet, which would once again be nearing Earth. A team was assembled from eight countries around the world, and split into two spaceships for the mission, dubbed the â€œNebulaâ€ and the â€œCorona.â€ They would depart from the Space Station Jesus. \n \nA primary objective of the mission was to collect gas samples from the tail of Halleyâ€™s Comet. These samples were to be gathered not only for the advancement of materials science or astronomy, but also to test the theory that life on Earth may have been seeded by comets. The knowledge the crew gained had the potential to solve one of the last enigmas of biology. \n \nImmediately after extracting the gas from the comet, however, communications from the spaceship Nebula mysteriously stop', 'J', 744, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b5bwyi878kbferfeqcta.jpg'),
(11, 'The Jetsons: Cogswell\'s Caper', '23rd May, 1993', 'George must save Planet M38 from Cogswell\'s destruction! Elroy, Jane, Judy, Astro and Rosie the Robot will give George the things he needs to meet the challenge. Using his anti-gravity boots, glider, and jet board, George will be walking on ceilings, dodging aliens and flying through danger on his way to stop Cogswell. Leap into the future and rescue another world with the JETSONS!', 'T', 745, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/txnllbc9b2fcxkyibadc.jpg'),
(11, 'Kabuki: Quantum Fighter', '21st December, 1990', 'Kabuki: Quantum Fighter is a 2D action platformer released exclusively for the Nintendo Entertainment System.', 'K', 746, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/n6ifu94evm0qlspw7w10.jpg'),
(11, 'Jikuu Yuuden: Debias', '27th November, 1987', 'Jikuu Yuuden: Debias is a Role-Playing game, developed by Now Production and published by Namco, which was released in Japan in 1987.', 'J', 747, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mir7jdt2jqbtaqmvty5z.jpg'),
(11, 'JJ: Tobidase Daisakusen Part II', '7th January, 1988', 'JJ (ã‚¸ã‚§ã‚¤ ã‚¸ã‚§ã‚¤ Jei Jei?) is an action game developed and published by Square for the Famicom in 1987. In English, it is sometimes referred to by its long form, Jumpin\' Jack, or by its subtitle, Tobidase Daisakusen Part II. The game was only released in Japan. \n \nThe sequel to Tobidase Daisakusen (known in North America as 3-D WorldRunner), JJ is a typical scrolling shooter, but it incorporates a third-person view, where the camera angle is positioned behind the main character. As in the previous title, the main character Jack must travel through various worlds, armed with his laser cannon and jumping ability, to defeat the serpentbeasts who have overrun the planets. \n \nJJ was the last game by Square to utilize the &quot;3D mode&quot; and 3D glasses, and was Square\'s last work before the inception of the popular Final Fantasy franchise. The soundtrack of JJ consists of eight tracks, and all of them are either remixed or reused from the game\'s prequel, 3-D WorldRunner. The game was scored by Nobuo Uematsu, and is Uematsu\'s 16th work of video game music composition.', 'J', 748, 0, 2.5, ''),
(11, 'Joe &amp; Mac: Caveman Ninja', '6th December, 1991', 'Back in the distant past (way back - like when â€œrock and rollâ€ was just rock and fast food was dinner you couldnâ€™t catch), lived two cave dudes named Joe and Mac. Whether it was dinosaur demolition or pterodactyl hang-glidinâ€™, life for the boys was pretty cool. \n \nCool, that is, until a bogus bunch of neanderthal nerds crashed their village and scared off all the cave-babes. Now the cave-babes are out there - SOMEWHERE, lost and reeeeally lonelyâ€¦ so what are you waitinâ€™ for? Itâ€™s up to Joe and Mac to get â€˜em back. \n \n* Fight flying pterodactyls in one or two-player simultaneous play. \n* 12 cliff-hanginâ€™ levels with more than 6 bonus levels to findâ€¦ \n* Amazing arcade graphics will keep you clubbinâ€™ to find your babesâ€¦ \n* Joe &amp; Macâ€™s pre-hysterical escapades will keep you cominâ€™ back for more!', 'J', 749, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/j1e2ynftwmtpw3dqeuld.jpg'),
(11, 'John Elway\'s Quarterback', '1st April, 1989', 'John Elway\'s QUARTERBACK is the home video game you\'ve been waiting for. So real you can see the game like a quarterback does, from the line of scrimmage. You call the plays, you throw the passes, run the ball, and make the tackles. It\'s third down and a long four long yards to the first down that will stop the clock. No time-outs left. The weak side linebacker is lined up inside his defensive end. They\'re coming! You check-off the play at the line of scrimmage and call for a quick pass to the tight end. He breaks it for a T.D.! Named for the quarterback who twice won the AFC Player of the Year Award, this is the game made for every kid who ever wanted to play the game as well as John Elway!', 'J', 750, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wpiclmlwwkiu5av3sylx.jpg'),
(11, 'Jordan vs. Bird: One on One', '31st December, 1988', 'Michael Jordan of the Chicago Bulls and Larry Bird of the Boston Celtics were the only two characters in the game, which allowed the player to participate in a one on one basketball game. Mini-games included a slam dunk contest (utilizing Jordan) and a three point contest (utilizing Bird).', 'J', 751, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/knktb7eus8wolenqzgha.jpg'),
(11, 'Journey to Silius', '31st December, 1990', 'Journey to Silius, known in Japan as Rough World is a side-scrolling run and gun video game developed by Tokai Engineering and published by Sunsoft for the Nintendo Entertainment System in 1990.\nJourney to Silius was originally based on the 1984 film The Terminator, but the licensing rights to the film were lost during development. As a result, the graphics and storyline were altered to accommodate this change, but remnants of the earlier version still remain in the game. For example, the final boss has a striking resemblance to the titular terminator in the film.\nJourney to Silius was originally conceived as a game based on the 1984 film The Terminator. However, Sunsoft lost the license during development and as a result the plot and graphics were altered before release.', 'J', 752, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1t7e.jpg'),
(11, 'Joust', '16th July, 1982', 'Joust is an arcade game developed by Williams Electronics and released in 1982. It is a platform game that features two-dimensional (2D) graphics. The player uses a button and joystick to control a knight riding a flying ostrich. The object is to progress through levels by defeating groups of enemy knights riding buzzards.', 'J', 753, 0, 2.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tzoopj1w4iqxwwttod4e.jpg'),
(11, 'Jovial Race', '31st January, 1989', 'It was an ordinary bright and sunny day, then something out of the ordinary happened, since, with that &quot;Jovial Car,&quot; anything can happen! I\'m not going to tell you everything. You better come with me to experience this once-in-a-lifetime trip. If you collect all the flags in a round, then you will advance to the next world. You can drive to the shopping mall for shopping, but don\'t forget to press your &quot;Start&quot; button before you make your purchase! \n \nAsia release', 'J', 754, 0, 2.5, ''),
(11, 'Joy Mech Fight', '21st May, 1993', 'One of the last Famicom games before the shift to the Super Famicom, Joy Mech Fight brings the full fighting game experience to the NES with top-notch controls, visuals and audio! Players can enjoy a single player campaign and fight against the computer, or go head-to-head in a two-player versus mode.', 'J', 755, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ung.jpg'),
(11, 'Jumbo Ozaki no Hole in One Professional', '1st March, 1988', 'A golf sim for the NES developed by HAL Laboratory and released in 1988 in Japan only. It uses the likeness of prolific Japanese professional golfer Masashi &quot;Jumbo&quot; Ozaki. \n \nHAL Laboratory, after creating many of Nintendo\'s golf games as a second party developer, decided to develop and publish their own golf title. Jumbo Ozaki no Hole in One Professional features the likeness of Japan\'s most prominent golf player, Masashi &quot;Jumbo&quot; Ozaki - the Jumbo nickname comes from his unusual height for a Japanese male: almost 6\'. Though featured on the box art and in the title, Jumbo Ozaki makes no obvious appearance in-game. \n \nThough by all practical metrics a perfectly standard overhead golf simulator - players take it in turn to get the ball to the hole in as few shots as possible, selecting the direction, club used and power of each shot - the game does do things a little differently than usual. Specifically, the visual cue for the power of the shot comes from the depiction of the golfer himself: The player must monitor the character as he swings, hitting the button at both the apex and nadir of the swing for maximum effect. This replaces the usual sliding power bar that most golf games have. Failure to hit the swing precisely will lead to slices and hooks. \n \nThe game can be played as a single player Stroke Match, which allows the player to practice on each of the game\'s 36 holes across two different courses. The player can also play against another human, or rate their score against CPU opponents in the 1 Day and 4 Day modes. The player can also adjust the difficulty, which makes wind speed a much more important factor.', 'J', 756, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mztbxaldorcaqstwwgli.jpg'),
(11, 'Jumpin\' Kid: Jack to Mame no Ki Monogatari', '19th January, 1991', 'The evil Giant has kidnapped Jack\'s girlfriend and now he must travel up the beanstalk and return to the Giant\'s castle in the sky to save her! Jack must use all his jumping ability and wits to climb the dangerous beanstalk without getting hurt. Many wildlife creatures and the minions of the Giant stand in his way.', 'J', 757, 0, 2.5, ''),
(11, 'The Jungle Book', '31st December, 1993', 'The Jungle Book game is based on a Disney movie hero Mowgli. It\'s a scrolling arcade action game. You play as Mowgli and your goal is to gather all gems and return to one of your friends or your mother. The jungle is full of the nasty animals and you have to make your way through it safely.', 'T', 758, 0, 4.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vx4nojbychdmjmxjcpy8.jpg'),
(11, 'Jurassic Boy', '25th February, 1994', 'Sachen\'s infamous dinosaur platformer. Oddly titled &quot;Jurassic Boy 2&quot; on the title screen of the NES version, as well as the box and title screen of the Game Boy Color version.', 'J', 759, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uralzexmcjpjm0cpojjv.jpg'),
(11, 'Jurassic Park', '31st December, 1993', 'Jurassic Park is a rail shooter arcade game developed and released by Sega in 1994. It is based on the 1993 film of the same name. The game cabinet resembles the rear of the Ford Explorer tour vehicles used in the film. The player, equipped with a joystick, must shoot dinosaurs that appear on-screen throughout the game.', 'J', 760, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gypphhcju5omr0qkegit.jpg'),
(11, 'Altered Beast', '1st August, 1988', 'Unleash metamorphic power. &quot;Awaken, dead warrior!&quot; cries Zeus, God of Thunder. And you rise. Called upon to live again, you kick, punch, grapple and tear at the inhuman and monstrous flesh of horrible, dangerous underworld henchmen out to do you wrong. Savagely intent upon rescuing Athena, daughter of Zeus, from the demon god Neff, you stalk the bowels of Hades and beyond. \n \nWhat you are now you will not be. You are the Altered Beast - bestowed with five formidable forces of transformation - each more ferocious, more overwhelming, than the last. By battling, conquering and capturing spirit balls, your metamorphic powers will grow. But to what end? \n \nThe final confrontation. Your triumph over crocodile worms, hammer demons and grave masters brings on the horror of Neff himself. But boldness and cunning will be rewarded - in the ultimate Altered Beast! \n \nTransformation is the ultimate power.', 'A', 761, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s4sb9fhddx31kd7rfhcq.jpg'),
(11, 'Metal Storm', '28th March, 1991', 'Battle station cyberg\'s massive computer that keeps peace throughout the solar system is no longer user friendly. It\'s gone wildly out of control. The LaserGun it operates has already destroyed Neptune. Earth is its next target. As a high-tech hot shot, you must enter Cyber\'s core and activate the system\'s self-destruct mechanism. Mankind is reyling on your know-how and toughness to see this thing through. But time is running out...', 'M', 762, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zupsxlxdbcxyd61kdkom.jpg'),
(11, 'Juvei Quest', '4th February, 1991', 'Juvei Quest is a Role-Playing game, developed by Birthday and published by Namco, which was released in Japan in 1991.', 'J', 763, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/my04itbnttw5vjdvp8lk.jpg'),
(11, 'Kabushiki Doujou: The Stock Speculation', '2nd May, 1989', 'A stock market simulation game from Hect for the NES. Like most, but not all, NES stock market simulators it was never released outside of Japan. \n \nKabushiki Doujou: The Stock Speculation (&quot;Kabushiki&quot; is the Japanese stock market, and &quot;doujou&quot; is, of course, dojo) is a stock trading simulation game, where the aim is to invest wisely in the stock market and develop a bountiful portfolio. The player is given regular money goals to reach before the next target is due and can buy, sell and manage their stocks to achieve as much wealth as possible. \n \nThe game uses a lot of public domain classical music, such as the title screen\'s 8-bit rendition of Bach\'s Air on a G String.', 'K', 764, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lypgrzk4kqxwxrqzup1f.jpg'),
(11, 'The Legend of Kage', '1st October, 1985', 'The Legend of Kage (å½±ã®ä¼èª¬; Kage no Densetsu) is a 1985 arcade game by Taito and was released for several contemporary video game home systems in 1986. \n \nThe player is armed with a kodachi shortsword and an unlimited amount of shuriken. Grabbing a crystal ball causes the player character\'s Kage\'s clothes to change to the next level in colour and thereby attain certain powers (bigger shuriken and/or faster speed); if Kage is hit while in green or orange clothes, he does not die but revert to his normal red clothes. Grabbing a scroll causes Kage to stand still and meditate for several seconds while approaching enemies drop to the ground dead (although the scrolls appear in the arcade version, the crystal balls do not). \n \nThis MSX version was brought without a license to the SG-1000 in Taiwan.', 'T', 765, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ozkw4nsly3t3sjtvte2s.jpg'),
(11, 'Kagerou Densetsu', '10th June, 1990', 'Kagerou Densetsu is a Role-Playing game, developed by ITL and published by Pixel Multimedia, which was released in Japan in 1990.', 'K', 766, 0, 2.5, ''),
(11, 'Kaguya Hime Densetsu', '16th January, 1989', 'Kaguya Hime Densetsu is an Adventure game, developed by Micronics and published by Victor Interactive Software, which was released in Japan in 1988.', 'K', 767, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gvhrtccybivs7cyp3ryg.jpg'),
(11, 'Kaijuu Monogatari', '18th December, 1988', 'KaijÅ« Monogatari (è²ç£ç‰©èªž?) is a role-playing video game developed by Birthday and published by Namco for Famicom, in November 1988 in Japan.', 'K', 768, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/utr2rfrn1eclzuklyel6.jpg'),
(11, 'Kaiketsu Yancha Maru 2: Karakuri Land', '30th September, 1991', 'Kaiketsu Yancha Maru 2: Karakuri Land is an Action game, developed and published by Irem, which was released in Japan in 1991.', 'K', 769, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tzqhtbe07oabeayspmuv.jpg'),
(11, 'Xexyz', '26th September, 1988', 'The game centers around the main character of Apollo (no relation to the Greek sun god) who progresses through the game in an alternating format that switches between platform, side-scrolling action (similar to the Super Mario Bros. series) and side-scrolling shooter action (similar to Konami\'s Gradius series). The goal of the series is, stereotypically, to destroy an evil boss â€” Goruza â€” rescue a princess â€” in this case, Princess Maria â€” and save the planet.', 'X', 770, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/owpiwyoez3jaoxuuey8d.jpg'),
(11, 'Kamen no Ninja: Akakage', '20th June, 1988', 'Kamen no Ninja: Akakage is an Action game, developed by Shouei and published by Toei Animation, which was released in Japan in 1988.', 'K', 771, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jcavop2m0btprepmrhui.jpg'),
(11, 'Yo! Noid', '16th March, 1990', 'Yo! Noid, known in Japan as Kamen no Ninja Hanamaru (ä»®é¢ã®å¿è€… èŠ±ä¸¸ Kamen no ninja Hanamaru?, lit. &quot;Masked Ninja Hanamaru&quot;) is a 2D action platform game developed by Now Production and published by Capcom for the Nintendo Entertainment System. The game was first released in Japan on March 16, 1990 and was localized in the United States to promote the Noid, the claymation mascot of Domino\'s Pizza in the late 1980s. The game is also released as part of Nintendo\'s PlayChoice-10 series and featured in the Japanese TV show GameCenter CX.', 'Y', 772, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xk1ffnbof5laoxtakxfu.jpg'),
(11, 'Kamen Rider Club: Gekitotsu Shocker Land', '3rd February, 1988', 'Kamen Rider Club: Gekitotsu Shocker Land is an action adventure game developed for the Famicom and published by Bandai in Japan on February 3, 1988. It is based on Bandai\'s Kamen Rider franchise, a weekly science fiction story created by Japanese manga artist Shotaro Ishinomori which was published in ShÅnen Magazine, as well as being aired on television. \n \nThe story takes place in a world plagued by Shocker, a mysterious terrorist organization. To further its plans for world domination, Shocker recruited its agents through kidnapping, turning their victims into mutant cyborgs and, ultimately, brainwashing them. However, one victim named Takeshi Hongo escaped just before the final brainwashing. With his sanity and moral conscience intact, Hongo battled Shocker\'s minions as the grasshopper-themed altered human superhero Kamen Rider. Another of Shocker\'s victims, freelance photographer Hayato Ichimonji, had also been given cyborg implants, but was saved by Kamen Rider from the brainwashing process to become Kamen Rider #2. Assisted by motorcycle race team manager Tobei Tachibana and FBI agent Kazuya Taki, the Kamen Riders fought in both solo and partnered missions against both Shocker and its successor organization Gel-Shocker.', 'K', 773, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vrtymtiiteblyrqnhy4d.jpg'),
(11, 'Kamen Rider SD: GranShocker no Yabou', '22nd January, 1993', 'Kamen Rider SD is a tokusatsu-themed board game., developed and published by Angel (Bandai), which was released in Japan in 1993.', 'K', 774, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ow3lqrened8dsab0poui.jpg'),
(11, 'Kanshakudama Nage Kantarou no Toukaidou Gojuusan Tsugi', '3rd September, 1986', 'Although commonly referred to as Tokaido Gojuusan Tsugi, the full name of the game is Kanshakudama Nage Kantarou no Toukaidou Gojuusan Tsugi, which can be roughly translated as &quot;explosive throwing Kantarou and the 53 stations of the Tokaido&quot;. To further explain, the main character\'s name is Kantarou, and he throws bombs at his enemies. He is attempting to travel from Kyoto back to Edo (known today as Tokyo) to see his girlfriend Momoko. To get there, he is traveling through the Tokaido highway which is composed of 53 checkpoints along the way. However, an unscrupulous merchant is attempting to capture Kantarou and steal his explosive technique secrets. \n \nTokaido Gojuusan Tsugi is a horizontally scrolling action game developed by Sunsoft in 1986. It was never released outside of Japan. On June 29, 2001, the game was released for the Windows platform as part of Sunsoft Classic Games 2 along with Ikki (which was itself rereleased as a budget title in 2004). On December 27, 2001, the game was released on the PlayStation as part of Memorial Series: Sunsoft Vol. 3 along with The Wing of Madoola.', 'K', 775, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dewwlxw0loqaclkwij0c.jpg'),
(11, 'Karate Champ', '31st December, 1984', 'Single players compete against a computer opponent while two players fight each other in this Karate game. Players each use two joysticks which allow for a variety of different moves. The best two matches, out of three, wins.', 'K', 776, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nr41yptzscnn7ltucg0l.jpg'),
(11, 'The Karate Kid', '31st December, 1987', 'The Karate Kid was a game published by LJN for the NES. It is loosely based on The Karate Kid, Part II.', 'T', 777, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qythtgamngyouajhqanu.jpg'),
(11, 'Karateka', '31st December, 1984', 'Karateka is a 1984 beat\'em up video game by Jordan Mechner, and was his first game created while attending Yale University. It was originally programmed for the Apple II, and was later ported to several other home computers and early gaming consoles. The game was published in North America by BrÃ¸derbund, and in Europe by Ariolasoft. \n \nThe player controls an unnamed protagonist who is attempting to rescue his love interest, the Princess Mariko, from Akuma\'s castle fortress. The game exhibits a combination of a side-scrolling platform and fighting game elements. The player uses punches and kicks to defeat Akuma and his guards and make his way deeper into the fortress. The game, as with most at the time of development, lacked checkpoints or the ability to save the game, making it a challenge to complete in a single sitting. \n \nKarateka has been well-received, particularly for its realistic animations used for the game\'s characters. The game was considered a breakthrough success for Mechner, and would eventually result in his development of the Prince of Persia franchise. A high-definition remake, spearheaded by Mechner, was released as a downloadable title for the Xbox 360, Microsoft Windows, PlayStation 3, with planned ports for the iOS and Wii U systems.', 'K', 778, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/txwbitgflyteqdukqrnt.jpg'),
(11, 'Karnov', '1st January, 1987', 'Karnov is a 1987 platform arcade game. It is the debut of Data East\'s mascot of the same name. After Data East became defunct due to bankruptcy in 2003, Paon, a company comprising former Data East staff, acquired the rights to Karnov, along with multiple other Data East games. \nIn the game, players take control of the title character Jinborov Karnovski, or &quot;Karnov&quot; for short. Karnov is a strongman popularly illustrated as being from an unspecified part of the Soviet Union\'s Central Asian republics as shown on the original arcade flyer and again in Karnov\'s Revenge.', 'K', 779, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uu9wjxbdfl60hqpranxv.jpg'),
(11, 'Kawa no Nushi Tsuri', '10th August, 1990', 'Kawa no Nushi Tsuri is a Role-Playing game, developed by Yuu Yuu and published by Pack-In-Video, which was released in Japan in 1990.', 'K', 780, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b07elum1bjbycyk9ilaj.jpg'),
(11, 'Keiba Simulation: Honmei', '28th May, 1989', 'A horse racing simulation game from Nichibutsu, developed for the NES in Japan only. \n \nKeiba Simulation: Honmei (&quot;keiba&quot; is the Japanese word for horse-racing, and &quot;honmei&quot; is a term meaning a favorite to win) is a Famicom horse-racing simulation game from Nichibutsu, often known as Nihon Bussan. In fact, the box art states the former as developer and the title screen states the latter. \n \nAs a true simulation game, there is no racing (at least that the player can control) or gambling. The player instead can fiddle with the parameters for each race and the horses competing, changing their stats such as fatigue, age and the weight of the jockey. Then players can watch a race with these settings play out and observe the winner. It is possible the goal of this game is to recreate the likely output of an actual race based on as much information as the player is able to muster in order to assist them with their gambling, though its more likely the game is for racing enthusiasts.', 'K', 781, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cj3blsxr5x1vmrc2kihv.jpg'),
(11, 'Antarctic Adventure', '31st December, 1983', 'Antarctic Adventure, known in Japan as Kekkyoku Nankyoku DaibÅken (ã‘ã£ãã‚‡ãå—æ¥µå¤§å†’é™º) is a video game developed by Konami in 1983 for MSX, and later for video game consoles, such as NES. The player takes the role of an Antarctic penguin, racing to disparate research stations owned by different countries in Antarctica.\n\nThe gameplay is similar to Sega\'s Turbo, but plays at a much slower pace, and features platform game elements. The penguin, later named Penta, must reach the next station before time runs out while avoiding sea lions and breaks in the ice. Throughout the levels, fish jump out of ice holes and can be caught for bonus points. The game, like many early video games, has no ending â€“ when the player reaches the last station, the game starts from the first level again, but with increased difficulty.', 'A', 782, 0, 2.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uewtckys3csdr8zfybyb.jpg'),
(11, 'Kero Kero Keroppi no Daibouken', '29th April, 1991', 'Kero Kero Keroppi no Daibouken (ã‘ã‚ã‘ã‚ã‘ã‚ã£ã´ ã®å¤§å†’é™º Keroppi\'s Big Adventure?) is based on the popular Sanrio character Keroppi. Released on the Nintendo Family Computer console in Japan in 1991. \n \nBig Adventure is a children\'s puzzle game where Keroppi must rescue his girlfriend Keroleen who is locked up in a castle. To do so, he must solve the action based puzzles in seven differently themed worlds with four different types of stages (the surface of the maze, flying a plane, a Reversi-like level, and through a field of lava). All the items in the game are pre-determined; there is a need to memorize the pattern for each playthrough so that a player may advance through the levels more quickly once they have achieved a degree of expertise in the game.', 'K', 783, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y1ymgzrdylqow7anrwxd.jpg'),
(11, 'Keroppi to Keroriinu no Splash Bomb!', '31st December, 1993', 'Keroppi to Keroriinu no Splash Bomb! is an Action game, developed by Geo Factory and published by Character Soft, which was released in Japan in 1993.', 'K', 784, 0, 2.5, '');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'The Quest of Ki', '22nd August, 1988', 'The Quest of Ki (ã‚«ã‚¤ã®å†’é™º Kai no BÅken?) is a 1988 video game developed by Game Studio and published by Namco for the Family Computer. It is the third game in Babylonian Castle Saga series which started with the 1984 arcade game, The Tower of Druaga. \n \nThe story of The Quest of Ki is actually a prequel to the original Tower of Druaga. It occurs shortly after the demon Druaga has stolen the Blue Crystal Rod and taken it to his tower. The goddess Ishtar sends the priestess Ki to the tower in order to retrieve it. The game then follows her doomed quest to the top of the tower, and leads directly into the story of the original game. \n \nThe game is a side-scrolling platformer with one hundred levels. In each level, the player\'s goal is to pick up a key and open the door leading to the next area. Various enemies, including slimes, ghosts, and wizards, appear on each floor, and any contact with them results in death. \n \nKi has no weapons, and thus can not damage or defeat any of the enemies. Her only abilities are to dash and jump. As long as the player holds the jump button down, Ki can rise indefinitely into the air. However, contact with the ceiling will cause her to drop to the ground and become stunned for several seconds. \n \nMany of the levels consist of puzzles in which the player must carefully regulate the height and direction of Ki\'s jumps. Each stage in the game contains one or more treasure chest, which hold various items. Although many of the items bestow helpful abilities, the effects only last for the floor on which they were found. \n \nAfter completing the game, players can gain access to forty bonus stages. These stages contain cameos from the Pac-Man ghosts and the enemies from Dig Dug.', 'T', 785, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uwoc6nlfteyvbalxrr0u.jpg'),
(11, 'Kick Master', '1st February, 1992', 'The King and Queen are dead, Princess Silphee kidnapped, and the King\'s Knights destroyed. Belzed, an evil wizard, wants the Kingdom of Lowrel for his own, and has hidden Silphee deep in his lair. Only Thonolan remains, the youngest, most talented Kick Master ever born. If he were any less powerful, he\'d never survive. He must use every ounce of his fighting strength and summon up all of his magical skill to overcome Belzed\'s army of fanatics. For the adventure of a lifetime - and the salvation of Lowrel - come challenge fate with Thonolan!', 'K', 786, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gwqxltid4czneyo3qf5z.jpg'),
(11, 'Kickle Cubicle', '1st February, 1990', 'It once was a peaceful kingdom of friendly, kind people. Unfortunately, this land didn\'t stay so serene as a wicked wizard king wanted everything for himself. Using his magic powers the wizard quickly overpowered the helpless people, put everybody including Princess Mira, into &quot;dream bags&quot;, and turned the entire kingdom into a frozen wasteland. \n \nIt is your job as Kickle to progress through all of the areas within each of the four lands in the country and eliminate all of the Wizard\'s henchmen and rescue your friends who are held captive in a dreamless sleep. \n \nKickle Cubicle is a captivating puzzle game much on the lines of the old coin-op game Pengo. More recently though, it contains similar concepts seen in the Lolo series of NES carts where planning and strategy is more important than quick moves. \n \nYour main weapon is your \'chilling\' ice breath. Breathe on the enemy and they instantly freeze! Give them a kick and they\'re out of your way! Clear a couple dozen mazes and you come to the end of the land you\'re in where you must then beat one of the Boss creatures. \n \nThrow in springs, hammers, bonus stages and secret traps and the game quickly turns into a puzzle game with levels which start easy but increase in difficulty as you get better!', 'K', 787, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wacbhkmsubz7f0nba5h0.jpg'),
(11, 'Kid Icarus', '19th December, 1986', 'Kid Icarus is an action platform video game for the Family Computer Disk System in Japan and the Nintendo Entertainment System in Europe and North America. \nThe plot of Kid Icarus revolves around protagonist Pit\'s quest for three sacred treasures, which he must equip to rescue the Grecian fantasy world Angel Land and its ruler, the goddess Palutena. The player controls Pit through platform areas while fighting monsters and collecting items. Their objective is to reach the end of the levels, and to find and defeat boss monsters that guard the three treasures.', 'K', 788, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ztpcbo23qtgrwrgsgswe.jpg'),
(11, 'Kid Klown in Night Mayor World', '30th October, 1992', '&quot;Hi kids. I\'m Kid Klown. And you know what? It looks like that mean old magician, the Night Mayor (get it? Nightmare?) has klown-napped my funny family. So I\'m going to play a joke on the dude. But I really need your help. Because he lives in a wild klown-dominion, with a bunch of real goons. And all I have is some magic balloons. So c\'mon and give me a hand. I just &quot;nose&quot; you can\'t wait to get started!&quot;', 'K', 789, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/v1qxt3tj9ctarclgc8kl.jpg'),
(11, 'Kid Kool and the Quest for the Seven Wonder Herbs', '22nd July, 1988', 'Kid Kool and the Quest for the Seven Wonder Herbs is a 2D Platformer game, developed and published by Vic Tokai, which was released in 1988.', 'K', 790, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/a5nnmvcnvbli2ulaqnnc.jpg'),
(11, 'Kid Niki: Radical Ninja', '1st December, 1986', 'One day in Feudal Japan, Kid Niki, the most radical of ninjas, is training at his Ninja School. Suddenly, a passing bird is struck down by an arrow and lands at Niki\'s feet. Attached is a note explaining that Niki\'s girlfriend, Princess Margo, has been kidnapped by the evil Stone Wizard. With the cry of &quot;Will help you!&quot; Niki bursts through the wall of his school and sets off on his quest to save Margo.', 'K', 791, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zuytmfbxr0wschps6qft.jpg'),
(11, 'King Kong 2: Ikari no Megaton Punch', '17th January, 1987', 'Ikari no Megaton Punch is based on the movie King Kong Lives (called King Kong 2 in Japan). The player takes control of King Kong in a quest to rescue Lady Kong from evil forces. This is an action game where the protagonist must travel to several different worlds in order to defeat bosses and earn keys that are needed to save Lady Kong from her imprisonment. King Kong\'s main attacks are either punching, hopping on, or throwing boulders at all his various enemies.', 'K', 792, 0, 2.5, ''),
(11, 'King Neptune\'s Adventure', '1st February, 1990', 'One thousand years ago, on the equinox of the new star of Tritan, the golden crown of Polaris was stolen. And so it has been every 100 years, no matter what precautions were taken, no matter where the treasure was hidden, when the Star of Tritan appears, another treasure disappears. With the spirit of the seven seas to guide him, King Neptune must find the 8 stolen treasures and return the orb of peace to his undersea kingdom!', 'K', 793, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hmvm7leqqjj83nihwfpc.jpg'),
(11, 'King of Kings: The Early Years', '31st January, 1991', 'Experience the majestic birth and childhood of Christ as you proclaim His honor and endevor to experience the prophecies. Collect gifts for Baby Jesus; escape to Egypt to avoid the wrath of King Herod; and search for young Jesus in the holy city of Jerusalem. Test your Bible skills by answering scores of Bible questions designed to compliment the game play.', 'K', 794, 0, 2.5, ''),
(11, 'King\'s Knight', '1st February, 1986', 'King\'s Knight is a fantasy-themed top-down shooter where four heroes have to unite to defeat a dragon and rescue a princess in despair. It was one of the first games published by Square Soft (now one-half of Square Enix). King\'s Knight is a variation on Konami\'s Knightmare which sold extremely well. \n \nThe first four stages involve you powering up your characters as far as they can go, picking up shields (to increase defense), boots (to increase speed), swords (to increase attack power), and spell icons (which will be required to be held by everyone for the final storm on the castle), defeating monsters along the way. The power-ups are hidden underneath mountains, rocks, and houses. Nearly everything can be shot at and destroyed. The heroes are, in order: \n \nRay Jack, the Knight, who possesses strong attacking power; Kaliva, the Wizard, who is good with magic and jumping; Barusa, the Monster, who has a strong defense; and Toby, the Thief, who can move swiftly. \n \nIt is necessary to keep all four heroes alive for the fifth and final stage, because there are certain points that the group cannot get past if one of the party members has died.', 'K', 795, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ykahx7jgitsrrqs7okqy.jpg'),
(11, 'King\'s Quest V: Absence Makes the Heart Go Yonder!', '9th November, 1990', 'Journey into danger. The greatest adventure in the history of Daventry is about to begin...\n\n...as you embark with King Graham on the most thrilling and perilous adventure of his career - the quest for the missing Royal Family of Daventry.\n\nExperience the magical world of King\'s Quest V, and discover why more people have played King\'s Quest than any other computer game series in history.\n\nRoberta Williams has been designing graphic adventure games since 1980, beginning with the groundbreaking Mystery House, the first computer game to combine text and graphics. She has gone on to become the best-selling interactive adventure author in the world; her King\'s Quest series has sold more than a million copies worldwide, making it the bestselling computer adventure ever.', 'K', 796, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/memsntoqqoeftmconog9.jpg'),
(11, 'Kiteretsu Daihyakka', '23rd March, 1990', 'Kiteretsu Daihyakka is an Action game, published by Epoch, which was released in Japan in 1990.', 'K', 797, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1s6v.jpg'),
(11, 'Kiwi Kraze: A Bird-Brained Adventure!', '31st March, 1991', 'When Wally the Walrus kidnaps 20 of your your kiwi pals, you rush to the rescue. As Tiki the kiwi bird, that\'s not so easy - you can\'t fly and you wouldn\'t hurt a flea. But Wally\'s stashed your friends in dangerous spots all over New Zealand and it\'s up to you to save them. Beak up, Tiki! Just rely on your quick wit and fast footsies. And keep your bow and arrow on the draw, because every Kiwi Kraze creature you meet will try to do you in - from playful penguins to ornery octopi. Hurry up! Better find your birdie buddies in time. Wally\'s got himself a kiwi cookbook, and your friends are the main ingredient!', 'K', 798, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rwiuglcyd3kgzmewom0e.jpg'),
(11, 'Klax', '1st February, 1990', 'Klax is a 1989 computer puzzle game designed by Dave Akers and Mark Stephen Pierce. The object is to line up colored blocks into rows of similar colors to make them disappear, to which the object of Columns is similar. Atari Games originally released it as a coin-op follow up to Tetris, about which they were tangled in a legal dispute at the time.', 'K', 799, 0, 3.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/j3eh3204xhmkybb2u62l.jpg'),
(11, 'Konami Hyper Soccer', '1st February, 1992', 'There is a lot more to this soccer game than meets the eye... Compete in a tournament, play against the computer or your friend, or even watch the computer play both teams. In the event of a tie, you get to do a real penalty kick play-off. You can choose your team from among 24 different countries, and give the team the qualities you like. Figure out your strategy before the game and set your formation. Winning depends on your skill... and a little bit of luck!', 'K', 800, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/okbscewpv9ybofuj9hnw.jpg'),
(11, 'Koushien', '6th October, 1989', 'A Famicom baseball game based on Japanese highschool baseball. It saw multiple sequels for the Super Famicom. \n \nKoushien is the first game in K Amusement\'s Koushien series of baseball games that focuses on the highschool level of competition. Koushien refers to the stadium where the final of the national highschool league takes place. It takes a leaf from the book of many other NES/Famicom baseball games, like Namco\'s Family Stadium, by depicting the batsman at the bottom of the screen and the pitcher at the top. Though it has realistically proportioned athletes, the presentation and idle animations are somewhat comical and the game overall leans on an arcade experience rather than being super realistic. \n \nKoushien was followed by multiple sequels, however the first game was the only one in its series to be released on the original Famicom. Future games would appear on the Super Famicom and PlayStation as well as other, newer consoles. This game would go on to be the basis of SNK\'s Little League Baseball: Championship Series.', 'K', 801, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mkb2vv99of7bnoq7ynek.jpg'),
(11, 'Krazy Kreatures', '31st December, 1990', 'Here they come. And there they go. They just keep coming, you gotta make \'em go away. When you signed on as an intergalactic immigration officer you figured it was an easy way to make some money. You were wrong. Transporting wave after wave of weird wild life from all over the universe is anything but easy. You gotta line \'em up to move \'em out. Up and down, left and right, or diagonally you gotta make the clumps of critters move out faster than they move in. If the room fills to capacity, that\'s it, the entire system will be shut down. One of the most exciting games of the year, it\'s more fun than a barrel full of creatures!', 'K', 802, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/aj03mcpspzhbfnw28d9h.jpg'),
(11, 'The Krion Conquest', '14th January, 1991', 'Once upon a time, long long ago, the world was experiencing great ruin. Enormous animals were bestowed upon the earth to create terrible pain and hardship for the people. The people were desperate, so they called upon the Old Witches\' World for help. \nThence came Francesca, a gracious witch with great powers. She fought and saved the world from these terrible creatures. The land began to flourish again and the people worked peacefully together to rebuild their wonderful cities. All was well. \nNow, we too are experiencing serious turmoil. Terrible horrid beings called Krions have decended upon our planet. We are prisoners and we are losing hope. Francesca, we need you. If you are out there, please come.', 'T', 803, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tjtiho1kr4tezrgo9kml.jpg'),
(11, 'Krusty\'s Fun House', '1st September, 1992', 'Krusty the Clown\'s Fun House has been overrun by rats. You must help him to herd the rats into trap machines to clear them out. In order to do so, Krusty must manipulate his environment to set up pathways so that the rats are headed in the right direction. Objects that Krusty move around include blocks, fans, and pipe pieces.', 'K', 804, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dmvpmjnngwzhgfhbbytn.jpg'),
(11, 'Kujaku Ou', '20th October, 1988', 'Kujaku Ou is an Adventure game, developed by Graphic Research and published by Pony Canyon, which was released in Japan in 1988.', 'K', 805, 0, 2.5, ''),
(11, 'Kujaku Ou II', '20th September, 1990', 'Kujaku Ou II is an Adventure game, developed by Atelier Double and published by Pony Canyon, which was released in Japan in 1990.', 'K', 806, 0, 2.5, ''),
(11, 'Kung-Fu Master', '1st December, 1984', 'Kung-Fu Master, known in Japan as Spartan X (ã‚¹ãƒ‘ãƒ«ã‚¿ãƒ³X Suparutan X), is a 1984 beat \'em up arcade game developed and published in Japan by Irem. It was later published in North America by Data East. The Japanese version was based on the Jackie Chan movie Wheels on Meals, known as Spartan X in Japan, and credited &quot;Paragon Films Ltd., Towa Promotion&quot;, who produced the film upon which it was based. The game is considered by many to be the first beat \'em up video game, and contains elements of Bruce Lee\'s Game of Death.', 'K', 807, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/svi6tzomplrswk1rykdl.jpg'),
(11, 'Kunio-Kun no Nekketsu Soccer League', '23rd April, 1993', 'Hi, I am Misako of Nekketsu High. I am the manager of our local soccer team. Finally, we can prove that Nekketsu FC is the greatest team in the world. If we work hard and qualify, the Technos Japan Cup will determine who is the greatest in the world. After Nekketsu FC was formed, I was supposed to lead the team to victory, but I haven\'t been able to keep my promise. But Kunio is here, and he will guide us to victory. I won\'t meddle in, but I will offer my advice if you want it. Nekketsu FC, let\'s go!', 'K', 808, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rd0kragmrlbf3fwepisr.jpg'),
(11, 'Kurogane Hiroshi no Yosou Daisuki! Kachiuma Densetsu', '19th May, 1990', 'Kurogane Hiroshi no Yosou Daisuki! Kachiuma Densetsu is a Sports game, developed by Make and published by Nihon Bussan, which was released in Japan in 1990.', 'K', 809, 0, 2.5, ''),
(11, 'Kyonshies 2', '25th October, 1987', 'A Famicom adventure game developed by Taito and based on an obscure Japanese movie of the same name. Kyonshiizu is the Japanese name for Jiang Shi, the Chinese hopping vampire. \n \nKyonshis 2 is an action adventure game by Taito and is based on the movie in the same name, which in turn was a sequel to a movie known in the west as Mr. Vampire. The game itself does not have a predecessor: while Phantom Fighter is based on the previous movie in the series, the game came after this one and is unrelated. \n \nThe game plays like a graphical adventure game with menu commands, a popular Famicom genre at the time, with additional action sequences. The player must walk around town hunting for clues about the roaming Jiang Shi (Kyonshi) while occasionally fighting said creatures and other enemies.', 'K', 810, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/asl1a5iipxlrlltajpv0.jpg'),
(11, 'Kyouryuu Sentai Zyuranger', '6th November, 1992', 'A group of astronauts from Japan accidentally free Bandora and her gang while exploring Nemesis. Baaza, who had been watching over the sleeping volunteers, sees Bandora and her minions terrorizing the people, and awakens the five warriors placed to sleep 170 million years ago to fight Bandora with the power of the Guardian Beasts as the Kyouryuu Sentai ZyuRanger.', 'K', 811, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eyzvefq5zi7i65cgu5hm.jpg'),
(11, 'Yamamura Misa Suspense: Kyouto Hana no Misshitsu Satsujin Jiken', '11th February, 1989', 'The second in the Yamamura Misa Suspense series of murder mystery adventure games. It was published by Taito for the Famicom in Japan only. \n \nYamamura Misa Suspense: Kyoto Hana no Misshitsu Satsujin Jiken is the second game based on the work of Japanese mystery novelist Misa Yamamura (the first being Yamamura Misa Suspense: Kyouto Ryuu no Tera Satsujin Jiken) and, like the first, concerns a murder in the picturesque Japanese city of Kyoto. \n \nAs with the first game, and conversely to other Famicom adventure games around at the time, Hana no Misshitsu Satsujin Jiken has a dynamic bar of commands the player can perform; it changes to reflect what actions are currently possible for the player character in that area, so that they don\'t waste too much time trying every action in every location to find the next clue. These actions are also represented with symbolic icons, rather than typed out as words.', 'Y', 812, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/clebqqkjbb1vxi3h9nze.jpg'),
(11, 'Yamamura Misa Suspense: Kyouto Ryuu no Tera Satsujin Jiken', '10th January, 1988', 'The first in a series of murder mystery games by Taito penned by and named for Japanese mystery writer Misa Yamamura. The game was released only in Japan for the Nintendo Famicom on December 11, 1987. \n \nYamamura Misa Suspense: Kyoto Ryuu no Tera Satsujin Jiken (roughly &quot;Yamamura Misa Suspense: Murder Case of the Kyoto Buddhist Temple Dragon&quot;) is the first in a series of murder mystery games from Taito, based on the work of prolific Japanese mystery writer Yamamura Misa. \n \nLike many of its Famicom crime adventure game peers the goal is to track down a killer using the provided detective skills: examining crime scenes, collecting evidence and talking to suspects and other helpful NPCs. \n \nThe game, and its sequels, were never localized or released outside of Japan.', 'Y', 813, 0, 2.5, ''),
(11, 'Kyuukyoku Harikiri Stadium', '28th June, 1988', 'Kyuukyoku Harikiri Stadium (ç©¶æ¥µãƒãƒªã‚­ãƒªã‚¹ã‚¿ã‚¸ã‚¢ãƒ ? lit. Ultimate Harikiri Stadium) is a baseball game developed by Taito Corporation. It was published in Japan for the Famicom in 1988. It is the first of the series of baseball games that was informally known as &quot;Harisuta&quot;, which saw four games published for the Famicom, and two more for the Super Famicom. The starting entry contains 13 teams, 12 of which are modeled after real Japanese teams, while a 13th team (the I team) consists of a team of women players who represent various idols or models who were popular at the time. The game features a single player mode against the computer, a head-to-head mode for two players, or a home run mode where you compete to see who can hit the most home runs. Before the end of 1988, a version of the same game was released with an updated player roster, under the title Kyuukyoku Harikiri Stadium \'88 Senshuu Shin Data.', 'K', 814, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yh3yhcsf10ax14aucmyw.jpg'),
(11, 'Kyuukyoku Harikiri Stadium: Heisei Gannen Ban', '21st July, 1989', 'Kyuukyoku Harikiri Stadium Heisei Gannenhan is a Sports game, developed by WinkySoft and published by Taito Corporation, which was released in Japan in 1989.', 'K', 815, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/brchieflmxgw9xiptkcu.jpg'),
(11, 'Kyuukyoku Harikiri Stadium III', '1st March, 1991', 'Kyuukyoku Harikiri Stadium III is a Sports game, developed and published by Taito Corporation, which was released in Japan in 1991.', 'K', 816, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sipbgp9je2ru6cuw2dbz.jpg'),
(11, 'Twin Cobra', '1st October, 1987', 'A helicopter themed shoot Ã©m up action game from a birds eye view.', 'T', 817, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/v3gsgelomx0pfzmfcdgr.jpg'),
(11, 'Lagrange Point', '26th April, 1991', 'In the 22nd century, mankind has begun to emigrate into outer space. Constructed at a lagrange point were three huge space colonies: the Isis Cluster (two artificial biospheres, named Land-1 and Land-2, and a satellite). In the year Isis 0024 (55 years after the cluster was constructed), however, a biohazard outbreak occurred on Land-2. All attempts at contact were met with nothing but static. Now a research team led by pilot Jin approaches Land-1', 'L', 818, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eaqqn0hkuhdnznkniqds.jpg'),
(11, 'LaSalle Ishii no Child\'s Quest', '23rd July, 1989', 'LaSalle Ishii no Child\'s Quest is a Role-Playing game, developed and published by Namco, which was released in Japan in 1989.', 'L', 819, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dwrdmunqalwyofudeagk.jpg'),
(11, 'Laser Invasion', '15th April, 1991', 'A summer offensive in the year 1999. Never in your military career have you been in such a hot spot, as the world\'s most threatening power, Sheik Toxic Moron, deploys his arsenal of TechnoScorch Weapons. To achieve total victory over 4 intense levels, you must possess numerous skills, including precision reflexes for air combat, a cut throat mentality for land assaults, the brains to gather secrets from underground informants, and a keen sense for surviving 3-D battle mazes. If you\'ve got the guts to match those skills, then prepare for action. Because it\'ll really heat up the second you blast across the Sheik\'s firing line, piloting the world\'s most advanced super weapon - the Mach 4 Laser Invasion Helijet, which can go from hovering to a six &quot;G&quot; vertical climb in a heartbeat. From the moment you activate your Vulcan Cannons and Sidewinder Missiles, you\'ll take dead aim on an insane assault, featuring Anti-Copter Rocket Launchers, High-Altitude Bombers and Aerial Mines. But the battle\'s just begun, and there\'s no time to kill between firefights!', 'L', 820, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cvgpbgk9la2epnglxvgv.jpg'),
(11, 'Last Action Hero', '1st October, 1993', 'Last Action Hero is a series of action video games based on the film of the same name. Versions were released for the NES, SNES, Sega Genesis, Game Boy, Sega Game Gear, Amiga and MS-DOS. Versions for the Sega Master System and Sega CD were also announced, but never released.', 'L', 821, 0, 2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yepacrqxf5cmemsxjwjc.jpg'),
(11, 'Last Armageddon', '10th December, 1990', 'The humans who breathed the toxin-filled air on the Earth\'s surface became one with the Earth and kept dissolving. The history of humanity ended and dominion of the planet returned to the demons. These mutant creatures did not depend on oxygen to survive. Therefore, they were able to breathe the air and use the land.Meanwhile, an army of robots wage World War IV against the demons in order to conquer what is now known as Makai - the Demon World. These robots came to the planet on a wave of energy that created an explosion that turned the world into a wasteland. Much later in the game, concurrent themes including Adolf Hitler, war, creating a perfect race of people, and the destruction of humanity in the year 1999 are revealed to the player inside one of the robot\'s main bases. \n \nCan the demons gain dominion on the humans\' old planet or will robots enforce impose a millennium of logic and dictatorial force throughout Makai? Playing as the robots is not an option that is open to the player. Therefore, the player must take advantage of his or her mutant army and crush the robot invaders. This game builds on the fear of robot domination of the world that has been featured greatly in movies from The Terminator to Terminator Salvation. The gameplay is similar to Final Fantasy as the turn-based fights are viewed from a third-person perspective.', 'L', 822, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dcgptuhvs18usf3mdxfu.jpg'),
(11, 'Last Ninja 2: Back with a Vengeance', '31st December, 1988', 'Once beaten, but not destroyed, the evil Shogun Kunitoki used all his mystic powers to transport himself through time and establish a new empire of tyranny in modern day Manhattan. Only you can stop him!', 'L', 823, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uofptbcqogepivd8hkvh.jpg'),
(11, 'Law of the West', '31st December, 1985', 'The West is out of control and a new sheriff is in town. As you wander through the dusty streets of this cowboy town keeping law in order, you are encountered by many characters ranging from gunslingers to the ladies. \n \nYou must use your conversation skills to get through each character and if that\'s unsuccessful, you may have to use your quick draw skills and lay the law down.', 'L', 824, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yjcqlbft0hkrdrwj2cob.jpg'),
(11, 'The Legend of Prince Valiant', '19th December, 1992', 'The quest to find the legendary Viking Ring of Peace begins in treacherous marshland, where every step is potentially lethal. Armed with a mere crossbow, the prince must fight his way through a vast forest, inhabited with cut throats and thieves, down into the underground caverns, through the deadly maze to the ring\'s resting place. Now he must cross the stormy sea and battle the hostile viking armada to reach Camelot. Arthur\'s Hall lies beyond the labyrinthine maze of corridors and passageways...will Prince Valiant make it and fulfil his dream of knighthood?', 'T', 825, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dmj34r67qk6okid5tkrt.jpg'),
(11, 'The Legend of Zelda', '21st February, 1986', 'Set in the fantasy land of Hyrule, the plot centers on a boy named Link, the playable protagonist, who aims to collect the eight fragments of the Triforce of Wisdom in order to rescue Princess Zelda from the antagonist, Ganon. During the course of the game, the player sees Link from a top-down perspective and must navigate him through the overworld and several dungeons, defeating enemies and finding secrets along the way.', 'T', 826, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1uii.jpg'),
(11, 'Legendary Wings', '1st December, 1986', 'Legendary Wings (Aresu no Tsubasa, &quot;The Wings of Ares&quot;) is a fantasy-themed shoot-\'em-up game released by Capcom as a coin-operated video game in 1986. The player takes control of a young soldier equipped with magical wings who must save the world from a malfunctioning supercomputer. \n Legendary Wings is set in a distant future where an alien supercomputer named &quot;Dark&quot;, which has been helping human civilization achieve a new state of enlightenment since ancient times, has suddenly rebelled against mankind. Two young warriors are given the Wings of Love and Courage by the God of War Ares in order to destroy Dark and ensure mankind\'s survival. \n The coin-op version of Legendary Wings can be played by up to two players simultaneously, with a second player being allowed to join the game at any time or even continue after a game over. The game\'s controls consists of an eight-way joystick and two buttons which changes depending on the context. The game consists of five areas with two different playing styles: the first segment in each stage is a top-view vertical scrolling segment in which the player flies across the sky, shooting at airborne enemies with their gun while dropping bombs at ground enemies, in order to reach the palace at the end of segment. When the player defeats the guardian and gains entrance to the palace, the game switches to a side-scrolling perspective, in which the player moves towards their goal on foot (by walking, crouching, and climbing ladders, as well jumping) until reaching the boss at the end, in which the player character will begin to fly with their wings again. In addition to the regular levels there are two optional levels that are accessible from the vertical-scrolling segment: a trap level in which the player is forced to escape from if they\'re sucked by the giant mechanical face on each area; and a hidden bonus level where the player can obtain various treasure chests to increase their score.', 'L', 827, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/o3dtitffof2js0yngtkf.jpg'),
(11, 'Lemmings', '14th February, 1991', 'A unique mindboggling game of multiple skill levels. Take command of the wackiest collection of misdirected rodents ever seen on your screen.', 'L', 828, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hpwjcwfee90tvvkmsr6u.jpg'),
(11, 'Linus Spacehead\'s Cosmic Crusade', '31st January, 1991', 'Linus needs your help! He has no money, no car and no respect from his fellow Linomen! The trouble is, no one believed his tale of discovering a far away planet called &quot;Earth&quot; so it\'s your job to help him get back there and take some handy snaps!', 'L', 829, 0, 2.5, ''),
(11, 'The Lion King', '8th December, 1994', 'The Lion King brings to life the majesty and mystery of Africa thruogh the tale of Simba, a lion cub faced with the challenging transition to maturity. Believing himself to be responsible for his father\'s death, Simba enters the wilderness - where he finds salvation with Pumbaa the warthog and Timon the meerkat, and his education begins. \n \nTake control of the youg cub Simba and, through interaction as detailed as the lust terrain, guide him safely through.', 'T', 830, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1y7u.jpg'),
(11, 'Little League Baseball: Championship Series', '1st August, 1990', 'Little League Baseball! It\'s the game every kid in America loves to play... And now you can experience the fun and excitement of Little League Baseball at any time of the year, rain or shine, day or night - right in your own living room! \nCreate your own winning team of players with batting, fielding, pitching, and running characteristics you can tailor to your own specifications. Then challenge a friend or the computer to a worldwide Championship Series tournament. \nYou are in full control of your players: Jump or dive for a tricky catch... Choose a full swing or a bunt for your batter... Shift fielders at will... Send in a pinch hitter or runner... Select a fast ball, slow ball, or curve ball for your pitcher... Steal a base if you dare... Or you might even try a squeeze play! \nLittle League Baseball has been an American institution for 50 years - and you can be a part of it. If you\'re a Little League fan or a Little League player - or if you ever wanted to be - here\'s your chance to go for the glory!', 'L', 831, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ykfglmqwkyxw1dnesoxj.jpg'),
(11, 'The Little Mermaid', '19th July, 1991', 'In this version of Disney\'s The Little Mermaid you play as Ariel the mermaid. \n \nAriel has already met Eric, and they plan to wed, but the sea-witch Ursala has taken control of the ocean! So Ariel (After explaining what\'s going on to Eric) becomes a mermaid once more and sets off to rescue the sea. \n \nThe game takes place from a side view and Ariel (Swimming most of the time, but hopping around on the land occasionally) can shoot bubbles to trap her foes and can then throw them at each other. She can also dig through sand to find treasure and pick up sea shells to help her break chests open.', 'T', 832, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1vyv.jpg'),
(11, 'Little Nemo: The Dream Master', '1st September, 1990', 'Little Nemo receives a royal invitation to visit the castle in Slumberland. Is he dreaming? It seems the princess is looking for a new playmate. When he arrives he is told that King Morpheus has been kidnapped. Nemo sets off on a wild adventure to rescue the good king and restore peace to the land. Anything can happen in this realm of imagination. Little Nemo even learns how to get a ride from the local creatures so he can pass through the roughest parts of Slumberland. Rescue the King of good dreams and thwart the Master of Nightmares!', 'L', 833, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/h52fovoe5ngjlqcmc5mz.jpg'),
(11, 'Little Ninja Brothers', '26th May, 1989', 'Little Ninja Brothers, known in Japan as Super Chinese 2 (ã‚¹ãƒ¼ãƒ‘ãƒ¼ãƒãƒ£ã‚¤ãƒ‹ãƒ¼ã‚º2?), is a 1989 video game developed and published by Culture Brain for the Nintendo Entertainment System in 1989 in Japan, 1990 in the United States, and 1991 in Europe. It is the second game in the Super Chinese series. The plot follows two young ninjas, Jack and Ryu, attempting to find out the mysterious reason for the invasion of Chinaland by Blu Boltar. It was the second game in the series, preceded by Kung-Fu Heroes, and followed up by a sequel Super Ninja Boy, released on the Super NES. There were also two Ninja Boy spin-off games released for the Game Boy in both regions. A manga adaption of the game was serialized in early issues of video game magazine GamePro.', 'L', 834, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jx49o7hxahjn7shmynhm.jpg'),
(11, 'Little Red Hood', '31st December, 1989', 'This is no ordinary forest. Then again, this is no ordinary Little Red Riding Hood. She can sure throw a kick, and let me tell you, she needs it to get to grandma safely. The forest is filled with wicked goblins, snakes, scorpions, bears and of course, the WOLF. Team up with her faithful dog and help LITTLE RED RIDING HOOD collect fruit, candy and magic potions so that she can fight these evil beasts and save grandma!', 'L', 835, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/epvdu2bjtxolayd3nmgj.jpg'),
(11, 'Little Samson', '26th June, 1992', 'The Imperial Forgy has been invaded by Ta-Keed the Prince of Darkness! Only the owners of the Magic Bells can stop his forces from destroying the realm. Led by the mountaineering youth, Samson, a force of unlikely heroes sets out to banish evil forever! Become a fire-breathing dragon, a living statue of solid stone or a nimble and crafty mouse. Soar the skies and belch fire balls as Kikira the Dragon Lord! Crush enemy troops with fists of granite as Gamm the Rock Lord! Scurry past dangerous monsters while setting time bombs as K.O. the mouse! These creatures join Little Samson to form a unique and powerful alliance as the last hope for the Imperial Forgy!', 'L', 836, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zlww37kcjjtlp2siawfy.jpg'),
(11, 'Locksmith', '1st February, 1991', 'Unbelievable! Someone created the most complicated locks in the world. Captain Red-Hat Jack was assigned to grab the enemy\'s defense information centre\'s distribution plan, but firstly he must to resolve the series unbelievable locks to achieve his assignment. So time, intelligence, nervous and exciting will come with Jack always during the spy\'s war. Do you think he will finish this impossible mission? The answer is &quot;you\'re better to help Jack!&quot;', 'L', 837, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1khh.jpg'),
(11, 'Lode Runner', '1st September, 1987', 'This updated take on the original Lode Runner is essentially an entirely new game, but it keeps the core of Douglas Smith\'s original ideas intact.', 'L', 838, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sflb8olvlsyjhlwbeuqf.jpg'),
(11, 'The Lone Ranger', '1st September, 1991', 'Evil arch villain Butch Cavendish has been a burr on your saddle ever since he did in your dad. Now he\'s kidnapped the President just to lure you to your doom, and there\'s nothing but a trail of doom between you. In fact, kemosabe, there\'s eight wild west stages of pistol packin\' danger to run, shoot, and gallop through, including first person 3-D stages that put peril in a whole new perspective. So hop on your fiery horse Silver, track down that cad Cavendish, and rescue the President. Or with the speed of light and a cloud of dust you\'ll wind up a mere tumbleweed in time!', 'T', 839, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mzdlnpheuwc1lgsisfaw.jpg'),
(11, 'Lost Word of JeNnY: Ushinawareta Message', '25th April, 1987', 'Jennyâ€™s on her way to the theater to practice for an upcoming role. Her script gets stolen though and has to track the pages down in different stages which are entered through the hub world. Once you collect a key and memorize letters and numbers, you go to the theater and use them to unlock the combination lock. Jenny has 2 abilities: punching and kicking, and after picking up powerups, throwing stars and bug spray', 'L', 840, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/st9vbah56idjbkaiejo4.jpg'),
(11, 'Low G Man: The Low Gravity Man', '1st October, 1990', 'You are the Low Gravity Man! When powered up, you can jump one and three quarters screens high. Capture and use enemy vehicles, including the spider vehicle which can crawl on ceilings. Catch and power up enemy weapons, and much, much more. Your mission is to take back the robot-producing exploration planet from the evil aliens before they reprogram all of the robots for the destruction of the human race. Includes password, infinite continue, and multiple quests for long-term enjoyment!', 'L', 841, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lvlw12iofp64zh4c7us8.jpg'),
(11, 'Lunar Pool', '31st December, 1987', 'Lunar Pool is the first advanced home video billiards game ever. Never before has the player been able to choose among 60 different &quot;tables.&quot; Jump around to your favorite, or master each stage consecutively. Your score is kept automatically. You set up the electronic cue stick, aim the cue ball, choose the power you need and shoot! Then watch the ball ricochet around the &quot;table&quot; and land in the pocket. Learn to be a &quot;hustler&quot; by mastering all 60 stages!', 'L', 842, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/h1vrzcicpzsxeisvqqct.jpg'),
(11, 'M.C. Kids', '1st February, 1992', 'Meet Mick and Mack - the coolest kids in McDonaldland. Now that Hamburglar has run off with Ronald\'s magic bag, the M. C. Kids need your help to find him. You\'ll need to move pretty fast to dodge creatures like Goferit and I. Psycho, solve tricky puzzles and explore the secret levels of McDonaldland. If you\'re going to help the M.C.Kids track down Hamburglar, you\'re going to have to make some totally fresh moves of your own. Oh yeah - once you\'ve figured out how to play this game right side up - try it upside down!', 'M', 843, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z8hbdesibdmhyt7zcgr4.jpg'),
(11, 'M.U.L.E.', '31st December, 1983', 'M.U.L.E. is about four hopeful explorers trying to make a fortune on a virgin planet. This is done by producing various goods (Food, Energy, Smithore, Crystite). Each of these goods have their uses: if you don\'t have enough food, you will have less time during your turn. If you don\'t have enough energy, your output will be lower. If enough smithore isn\'t produced, there will be a shortage of M.U.L.E.s. Crystite is the big earner that can make or break your game. \n \nYou start the game by selecting your race. Some are easier to play, some harder. There are three levels of difficulty, in the easiest the game only lasts 6 turns, but the real game is 12 turns. Crystite is not available at the easiest level. \n \nEach turn starts with land claim. Each player gets to choose a spot of land for themselves from the map. If two players choose the same spot, the player with less money wins. The map consists of different landscape. River is best for producing food, plains for energy, mountains for smithore. Crystite is hidden and must be first found by taking a land sample to the town. \n \nAfter the land claim each player takes turns in cultivating their land and do other tasks. They can buy M.U.L.E.s to start production on their land, sabotage other players by buying M.U.L.E.s and letting them loose, try to catch the Wumpus for cash and try to find crystite veins. The time to do these things depends on if the player has enough food. Finally the player goes to the casino and wins a small amount of money, depending on how much time was left.', 'M', 844, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ike.jpg'),
(11, 'Tag Team Match: MUSCLE', '8th November, 1985', 'Tag Team Match: M.U.S.C.L.E. (ã‚­ãƒ³è‚‰ãƒžãƒ³ ãƒžãƒƒã‚¹ãƒ«ã‚¿ãƒƒã‚°ãƒžãƒƒãƒ Kinnikuman: Massuru Taggu Matchi, &quot;Kinnikuman Muscle Tag Match&quot;) is based on characters from Yudetamago\'s manga and anime series Kinnikuman. \n \nIt has eight playable characters, each with his own special move. The game was followed by a 1987 Japan-only sequel for the Famicom Disk System titled Kinnikuman: Kinniku-sei ÅŒi SÅdatsusen (ã‚­ãƒ³è‚‰ãƒžãƒ³ ã‚­ãƒ³è‚‰æ˜ŸçŽ‹ä½äº‰å¥ªæˆ¦ Kinnikuman: Scramble for the Throne).', 'T', 845, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1l8e.jpg'),
(11, 'Mach Rider', '21st November, 1985', 'Mach Rider (ãƒžãƒƒãƒãƒ©ã‚¤ãƒ€ãƒ¼ Mahha RaidÄ) is a futuristic driving video game created by Nintendo. It was first released on October 18, 1985 for the Nintendo Entertainment System, as one of the 18 initial launch games. A month later, on November 21, the title was released in Japan. On March 15, 1987 it was released in Europe and Australia. In July 2007 a modified version was released on the Wii\'s Virtual Console, which allowed designed tracks to be saved.', 'M', 846, 0, 2.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gxjhdlgtnf1sjcoamk7q.jpg'),
(11, 'Mad Max', '1st July, 1990', 'Open world game based on Mel Gibson movies.', 'M', 847, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xbeaatdmutjdnp8zj2gl.jpg'),
(11, 'Madoola no Tsubasa', '18th January, 1987', 'Once upon a time, in the Kingdom of Badham, there was a statue of a bird known as the Wing of Madoola. Whoever possessed the wing would possess the power to rule the world, and many wars were fought between nations to obtain it. A wise king, one of the members of the Rameru family, managed to get a hold of the wing, and ordered that a deep cave be constructed where the wings would be hidden so that the wars would cease. The knowledge of the cave would be recorded and locked away, accessible only to the rulers of the land. Peace soon returned to the world. \n \nSeveral centuries later, a young member of the Rameru family known as Darutos learned of the location of the wing through the kingdom\'s secret archives. He betrayed the family and stole away with the Wing of Madoola. Using the power of the wing, he summoned demons to attack and take over castle Arekusu. He constructed an underground labyrinth beneath the castle, built a dangerous fortress, and planned to rule the world.The few survivors of Arekusu\'s military, and the remainder of the Rameru family fled the castle. They regrouped and devised a desperate plan to overthrow Darutos and regain control of the kingdom. Lucia, a brave warrior, was selected to accompany a member of the Rameru family who was uniquely capable of wielding magic known only to his family. \n \nAs they approached Arekusu, they were beset upon by two powerful demons. While one distracted Lucia, the other attacked the Rameru family member. Lucia battled both demons and defeated them, but not before her partner received a fatal wound. Knowing what had to be done, Lucia bravely pressed forward, knowing that only she could stop Darutos, and regain possession of the Wing of Madoola.', 'M', 848, 0, 2.5, ''),
(11, 'The Mafat Conspiracy', '27th August, 1990', 'A &quot;Star Wars&quot; satellite has been snatched out of orbit, the world edges toward nuclear oblivion, and the CIA and KGB are blaming each other. Golgo 13 is back just in time. The Mafat Conspiracy is a phantasmagora of action and interaction. Your eyeballs will stretch from their sockets as you speed through Europe in Golgo\'s Ferrari. Your bones will rattle as you leap across the cars on the Orient Express. And if you think you\'ve seen bad dudes, wait till you feel the power of Duke Togo\'s wicked karate kick. The Mafat Conspiracy is for those who demand the very best in video games!', 'T', 849, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/itnd1zlulgnqwtxbng5v.jpg'),
(11, 'Magic Block', '31st January, 1991', 'Magic Block is a Puzzle game, developed by Mega Soft and published by NTDEC, which was released in Asia in 1991.', 'M', 850, 0, 2.5, ''),
(11, 'The Magic Candle', '31st December, 1989', 'The Magic Candle is best described as an Ultima clone. Its a top-down party-driven RPG. \n \nThe plot revolves around you (Lukas) and your party of intrepid adventurers, whose task it is to seal the demon Dreax within the Magic Candle (which is burning down, and when it does, he gets released). \n \nThe game has 3 difficulty levels (changing the number of \'days\' you get to complete the game in.) A lot of travelling, dungeon-crawling, town-exploring, and especially, lots of conversing with NPCs.', 'T', 851, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xjrseqphnm3zqurpaiwm.jpg'),
(11, 'Magic Cube', '31st January, 1991', 'Have you ever played with &quot;Russian Blocks?&quot; And have you played with &quot;Magical Stone?&quot; If yes, we\'d like to tell you now that these games are out of date. The newest &quot;Magic Cube&quot; will bring you to the new world! Break through the traditional routing and combine with the new idea. Play it and you will know how fantastic it is!', 'M', 852, 0, 2.5, ''),
(11, 'Magic Darts', '26th May, 1991', 'Darts is one of the most popular leisure games of all time. MAGIC DARTS has tournament style action which brings the excitement of real competition into your home. Up to four players can compete using standard NESÂ® controllers. Get yourself on target and play MAGIC DARTS.', 'M', 853, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/itizydjvl6niltuvmlqq.jpg'),
(11, 'Magic Jewelry', '31st December, 1990', 'Magic Jewelry is a tile-matching puzzle video game for the NES. It was programmed by Hwang Shinwei in Taiwan and released in 1990 by RCM,[1] without a license from Nintendo.', 'M', 854, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rxbkif5jo4glwqwxilaz.jpg'),
(11, 'Magic Jewelry 2', '31st January, 1990', 'Magic Jewelry is a Puzzle game, developed by Hwang Shinwei and published by RCM, which was released in Asia in 1990.', 'M', 855, 0, 2.5, '');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Totally Rad', '1st April, 1991', 'Totally Rad is an action game in which you play Jake, a magician wannabe being trained by the Master Magician Zebediah. One day, during his training, Jake is attacked by surprise by unknown foes who kidnap Allison, his girlfriend. Then, Jake has to save her and discover what lies behind that attack.', 'T', 856, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/egguylgpa6lfmdbymz0l.jpg'),
(11, 'Magic Johnson\'s Fast Break', '1st April, 1990', 'DRIVE, PASS, SHOOT, SCORE! Now you can slam dunk like the pros!Magic Johnson\'s Fast Break is slammin\' jammin\' basketball action. Play against the computer or an opponent. Up to four players can play simultaneously. Head for the hoop and slam dunk the ball! The better you get the better your salary gets! Simple enough for beginners, challenging enough for pros. Shoot free throws, 3-pointers, execute special plays, and more! Master all five levels of this ultimate basketball contest!', 'M', 857, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bg3bg98uma3btrytsv4z.jpg'),
(11, 'Magical Kid\'s Doropie', '14th January, 1991', 'The year is 1999. When the Akudama Empire attacks the Earth with his army of robots. No conventional weapon in existence is efficient against this opponent. The robots are, however, totally vulnerable to magic. An hired mercenary, Kagemaru, summons the only non-sealed witch, Doropie, to stop the Akudama Empire\'s offence. The imperial army, led by an old nemesis of Doropie, Empress Elysia, does not surrender though. Elysia captures Kagemaru and blackmails Doropie into breaking her seal and setting her free. It seems that the mercenary lost his life, and Doropie sets out to stop the now-free Empress. After the battle, the dying Empress Elysia confesses the reasons behind the invasion and apologizes. The imperial warship explodes shortly thereafter, but not before Doropie escapes it. She is contacted by Kagemaru, who apparently has survived the wounds that Elysia inflicted on him. Doropie comes back to Earth shortly afterwards.', 'M', 858, 0, 2.5, ''),
(11, 'Magician', '31st December, 1990', 'Magician is a 2D, side-scrolling action RPG. As Paul, you must travel through towns, have conversations with non-player characters, acquire and manage inventory (food, water, weapons, potions, etc.), learn magic spells, fight battles, and solve puzzles. Your ultimate goal: collect each of the four elemental vials -- earth, air, fire, and water -- and combine them to create the Ultimate Potion. Only then can you hope to vanquish the evil wizard Abadon!', 'M', 859, 0, 2.5, ''),
(11, 'MagMax', '18th March, 1986', 'A horizontal scrolling shooter, players control the title hover ship in an attempt to completely construct the ship into a giant robot and to destroy any enemies attempting to stop it. \n \nThe three-headed mechanical dragon found as a boss character in the game, known as Babylon, strongly resembles Mecha-King Ghidorah from the Godzilla franchise.', 'M', 860, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s4nzekkeelovrs5a0fpq.jpg'),
(11, 'Namcot Mahjong III: Mahjong Tengoku', '7th April, 1991', 'Namcot Mahjong III: Mahjong Tengoku is a Miscellaneous game, developed and published by Namco, which was released in Japan in 1991.', 'N', 861, 0, 2.5, ''),
(11, 'Mahjong Taikai', '31st October, 1989', 'The first installment in Koei\'s mahjong series. \n \nMahjong Taikai (&quot;Mahjong Tournament&quot;) is a 1989 Famicom mahjong game from Koei and an unknown developer. It features multiple historical figures as possible CPU opponents, including Masamune Date and Napoleon Bonapart. \n \nAs with any mahjong game, the goal is to complete a winning hand before any of the other players can, and the player earns an amount of points dependent on the &quot;strength&quot; of their winning hand. They might also lose points depending on who won and how. \n \nKoei would continue making Mahjong Taikai games for other platforms, including Super Mahjong Taikai for the Super Famicom in 1992.', 'M', 862, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vetl8wxbv3xdxe38zzbm.jpg'),
(11, 'Mahjong Taisen', '19th June, 1992', 'Mahjong Taisen is a Miscellaneous game, developed by Nihon Bussan and published by Nichibutsu, which was released in Japan in 1992.', 'M', 863, 0, 2.5, ''),
(11, 'Mahou no Princess Minky Momo: Remember Dream', '29th July, 1992', 'A 1992 Famicom game published by Yutaka based on the Minky Momo magical girl anime.', 'M', 864, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wfljkmklpkucc2fjx0ru.jpg'),
(11, 'Majaventure: Mahjong Senki', '18th November, 1990', 'Majaventure: Mahjong Senki is a Miscellaneous game, published by Tokuma Shoten, which was released in Japan in 1990.', 'M', 865, 0, 2.5, ''),
(11, 'Major League', '27th October, 1989', 'This standard baseball game from Irem has the movie license for Major League, but doesn\'t actually use it much in-game.', 'M', 866, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rgaqqqxdyg7bqrdqlrk0.jpg'),
(11, 'Majou Densetsu II: Daimashikyou Galious', '10th September, 1987', 'Majou Densetsu II: Daimashikyou Galious is a Role-Playing game, developed and published by Konami, which was released in Japan in 1987.', 'M', 867, 0, 2.5, ''),
(11, 'Makai Island', '21st July, 1987', '1987 was a big year for Capcom, it was the year that mega man came out, and the year that Makai Island ..... didn\'t. Developed by Capcom, Licensed by Nintendo, this game was never officially released. \n \nThis game was released in japan. but it was never released in the America\'s. \n \nMakai Island is played by steering a ship in the oceans. \n \nAs you play you can go on different boats and ships, talk to other people, go on land, and even do some missions. This game seems to take a while to start off. But once you get going you\'ll be hooked. The world map is rather big and confusing, and chances are you will get lost. But i am sure you can find a map somewhere on the internet.', 'M', 868, 0, 2.5, ''),
(11, 'Maniac Mansion', '1st October, 1987', 'Maniac Mansion is a 1987 graphic adventure video game developed and published by Lucasfilm Games. It follows teenage protagonist Dave Miller as he attempts to rescue his girlfriend from a mad scientist, whose mind has been enslaved by a sentient meteor. The player uses a point-and-click interface to guide Dave and two of his six playable friends through the scientist\'s mansion while solving puzzles and avoiding dangers. Gameplay is nonlinear, and the game must be completed in different ways based on the player\'s choice of characters. Initially released for the Commodore 64 and Apple II, Maniac Mansion was Lucasfilm Games\' first self-published product.', 'M', 869, 0, 4.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ptxskbfno9g21wgddc8t.jpg'),
(11, 'Mappy', '1st March, 1983', 'The player guides Mappy the police mouse through the mansion of the cats called Mewkies (Meowky in the U.S. version) to retrieve stolen goods. The player uses a left-right joystick to move Mappy and a single button to operate doors. The mansion has six floors of hallways in which the stolen items are stashed.', 'M', 870, 0, 3.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/x4r9hc97zh6hetkcfoy1.jpg'),
(11, 'Mappy Kids', '22nd January, 1990', 'The player controls the son of Mappy in a platformer game. He wants to find a wife but she won\'t marry him until Mappy can become a provider for his family. At the end of each level, there is a slot machine. Pulling the lever to the slot machine may allow the player to earn extra lives. After the mini-games, players access a shop, where they can buy various things with the money that they find during the game. \n \nThis game was released for the Nintendo Famicom in Japan only.', 'M', 871, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ibjp2nazsdwrymbrr3j7.jpg'),
(11, 'Mappy-Land', '26th November, 1986', 'Mappy, who is a policeman, prepared all kinds of wonderful birthday presents for his girlfriend, Mapico. But, Nyamco and his child Mukies have hidden them in the eight towns of Mappyland. What a pity! Mappy must hurry to get the presents back before Mapico\'s birthday party. The problem is that there are so many mysterious towns where Mappy must search, while fighting off his enemies. Can you accept the challenge and help Mappy to succeed?', 'M', 872, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w2zluvkcnkqjqkbiqzrv.jpg'),
(11, 'Marble Madness', '31st December, 1984', 'Marble Madness is an isometric platform game in which the player manipulates an onscreen marble from a third-person perspective. The player controls the marble\'s movements with a trackball, though most home versions use game controllers with directional pads. The aim of the game is for the player to complete six maze-like, isometric race courses before a set amount of time expires. When a player completes a race, the remaining time is added to the next race\'s allotted time. The game also allows two players to compete against each other. \n \nCourses are populated with various objects and enemies designed to obstruct the player. As the game progresses, the courses become increasingly difficult and introduce more enemies and obstacles. Each course has a distinct visual theme. For example, the first race, titled &quot;Practice&quot;, is a simple course that is much shorter than the others, while the fifth race, named &quot;Silly&quot;, features polka-dot patterns and is oriented in a direction opposite from the other courses', 'M', 873, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ryvunixvrbibtedtwl4m.jpg'),
(11, 'Mario &amp; Yoshi', '14th December, 1991', '&quot;Yoshi is an action/puzzle game starring Mario\'s dinosaur buddy Yoshi who has been imprisoned in an egg. Now it\'s raining Goombas, Bloopers, and Boo Buddies, and you have to help Mario stop the airborne invasion. As the critters fall, catch them on trays. Stack two of a kind and they both disappear, or capture the whole bunch in between eggshells. When the eggshells match, out hatches Yoshi and up goes your score! The action heats up as the characters fall faster and faster. To save the day, switch and shuffle, and don\'t let your piles get too high!&quot;', 'M', 874, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wo8.jpg'),
(11, 'Mario Bros.', '14th July, 1983', 'Mario Bros. is an arcade game published and developed by Nintendo in 1983. It was developed by Shigeru Miyamoto. \n \nMario Bros. features two plumbers, Mario and Luigi, having to investigate the sewers of New York after strange creatures have been appearing down there. The objective of the game is to defeat all of the enemies in each phase. The mechanics of Mario Bros. involve only running and jumping. Unlike future Mario games, players cannot jump on enemies and squash them, unless they were already turned on their back. Each phase is a series of platforms with four pipes at each corner of the screen (in the old version along with an object called a &quot;POW&quot; block in the center). Both sides of every phase feature a mechanism that allows the player to go off-screen to the left and appear on the right and vice versa. \nThe player gains points by defeating multiple enemies consecutively and can participate in a bonus round to gain more points. Enemies are defeated by kicking them over once they have been flipped on their back. This is accomplished by hitting the platform the enemy is on directly beneath them. If the player allows too much time to pass after doing this, the enemy will flip itself back over, changing in color and increasing speed. Each phase has a certain number of enemies, with the final enemy immediately changing color and increasing its speed to maximum. There are three enemies in all: the Shellcreeper, which simply walks around; the Sidestepper, which requires two hits to flip over; and the Fighter Fly, which moves by jumping and can only be flipped when it is touching a platform. Players may also make use of the above-mentioned &quot;POW&quot; block, which flips any enemy touching a platform or the floor when a player hits it from below. This item can be used three times before it disappears. Coins appear whenever enemies are defeated and may be collected for bonus points. \nAs the game progresses, elements are added to increase the difficulty. Fireballs either bounce around the screen or travel directly from one side to the other, and Slipices can freeze platforms, causing Mario and Luigi to skid. In addition, icicles start to form under the platforms and fall loose. Bonus rounds give the players a chance to score extra points by collecting coins without having to deal with enemies; the &quot;POW&quot; block regenerates itself on each of these screens.', 'M', 875, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1tg0.jpg'),
(11, 'Mario is Missing!', '31st December, 1993', 'Don\'t look now, but Bowser\'s back, and this time he\'s in your world! But where is that mastermind of reptilian trouble doing his dastardly deeds? And what has he done with Mario? Welcome to Mario is Missing! Take a trek with your travel agent, Luigi, and see the world! Track down troublesome turtles. Figure out where in the world you are, and what on earth happened to Mario. If your grasp of geography is good enough, you\'ll get the goods, stomp the hoods, and grab Mario out of Bowser\'s ghastly guest house. A learning adventure that the whole family can share! This is no Koopa-stomping mayhem. It\'s a fun way to learn about our world!', 'M', 876, 0, 1.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iistcudp2walrniclnbl.jpg'),
(11, 'Mario\'s Time Machine', '23rd June, 1994', 'YOU AND MARIO MAKE QUITE A PAIR. Especially when you\'re battling the common enemy: Bowser. \n \nSeems Bowser\'s sneaky Koopas have been, throughout time, stealing objects belonging to famous people who, without these valuable objects, wouldn\'t have been able to help and inspire mankinds. \n \nBut Mario is on to Bowser and his crew. He\'s persuaded the greatest minds in the world to build him a time machine - so that you and he can go anywhere in the world, during and century, in order to find those precious objects and return them to their rightful owners. \n \nYou\'ll visit Cleopatra in the Alexandria of 48 B.C., Plato in the Athens of 369 B.C. and even Thomas Edison in New Jersey in 1879. \n \nSo get ready for an incredible, easy-to-take adventure. Not only will you help the human race, but you\'ll meet the most famous people who ever lived. And you\'ll travel all over the globe and back, back, back into history. WHAT A TRIP! \n \nGrab your backpack for the learning adventure of your life!', 'M', 877, 0, 1.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wwm.jpg'),
(11, 'Marusa no Onna', '19th September, 1989', 'Marusa no Onna is an Adventure game, developed and published by Capcom, which was released in Japan in 1989.', 'M', 878, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pawdyyguqfiddtomtayl.jpg'),
(11, 'Master Chu and the Drunkard Hu', '1st February, 1989', 'Return to a mythical time in the Far East, when the legendary Siamese-Twin Shiva, God of Destruction, cursed your village with fearsome evil spirits. Despaired by repeated failures to drive out Shiva\'s evil demons, your best friend, Master Hu, has turned into a drunkard. You, Master Chu, must search through hostile palaces and temples to find and destroy this four-armed incarnation of Shiva. If you would like, just ask your teammate, the Drunkard Hu, to help out. Playing together can be a lot of fun!', 'M', 879, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/urscz3vq4yuqbkjm4ccn.jpg'),
(11, 'Masuzoe Youichi: Asa Made Famicom', '16th May, 1992', 'Masuzoe Youichi: Asa Made Famicom is an Adventure game, published by Coconuts Japan, which was released in Japan in 1992.', 'M', 880, 0, 2.5, ''),
(11, 'McDonaldland', '31st December, 1992', 'M.C. Kids is a 1992 platform game developed and published by Virgin Interactive. It was initially released for the Nintendo Entertainment System in February 1992 in North America, and by Ocean Software in May 1993 in Europe. As a licensed product for the McDonald\'s fast food franchise, the game occasionally features the various logos and characters from McDonald\'s restaurant signage and television advertisements, for the purposes of plot advancement and power-ups. It stars two children who venture into the fantasy world of McDonaldland in order to return Ronald McDonald\'s magical bag, which has been stolen by the Hamburglar. \n \nM.C. Kids was also released for the Commodore 64, Amiga, Atari ST, and MS-DOS, though all of these home computer versions were only sold in Europe.[1] Additionally, a different version of the game was released for the Game Boy, as McDonaldland. This version was released outside of Europe as Spot: The Cool Adventure, themed upon the Cool Spot franchise. Virgin Interactive would release another game based on the McDonald\'s franchise for the Sega Mega Drive/Genesis called Global Gladiators that is more of a traditional side-scrolling action-adventure game.', 'M', 881, 0, 2.5, ''),
(11, 'Mega Man 3 / Rockman 3', '8th September, 1990', 'It\'s robot rebellion, and nobody\'s safe! Least of all, Mega Man! This time the superpowerful cyborg takes on a horde of metal maniacs who\'ve had it with being obedient! And they use every android-annihilator ever invented to make you believe it! Mega Man goes berserk, blasting through a galaxy of mining stations in search of energy crystals. But it takes more than guts to battle the phenomenal robot masters who control these worlds. It\'s a wrenching job, the worst - and the best - that Mega Man\'s faced so far!', 'M', 882, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1y72.jpg'),
(11, 'Mega Man 4 / Rockman 4', '6th December, 1991', 'For a year the city has been quiet, but a new robotic terror has gripped the city! That scheming scientist, Dr. Cossack has arrived in town with eight new metal maniacs who are bigger and badder than anything Dr. Wily dreamed of. It\'s going to be a cybernetic showdown as the streets of the city erupt with the sizzling sounds of molten metal! Armed with the new Mega Buster, Mega Man runs, jumps and dodges his way through mazes of metallic munchkins on his way to the Siberian citadel of Dr. Cossack for the final cataclysmic clash!', 'M', 883, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1r4c.jpg'),
(11, 'Mega Man 5 / Rockman 5', '4th December, 1992', 'This particular Mega Man game is one of the most challenging with very interactive sprite powers. Three items are of absolute importance: The Air Dash sprite sheet, the N (Chimera) armor, and the Dual Buster. The last two are needed to get items, but the Air Dash is essential to even reach some of the bosses, making it the first item you should ever attempt to get. I\'m am not an avid advocator of entering a board to get an item, and dying to exit the stage, but some beginners may want to consider doing this to get the Buster and N sprites. I mention this because the path I suggest following puts off getting these items until later into the game, which in turn forces you to get other items even later.\n\nMega Man Sprite order is important, as it always is. It wouldn\'t be a Mega Man game without and boss order to follow. However, in MMX3, the correct weapon doesn\'t do tons of damage like you would expect. What\'s important in MMX3 is that the correct weapon cancels the bosses\' attacks. Some of the bosses attack you in such a way that they nail you with a barrage and don\'t allow you to retaliate. That is why following the order is a lot wiser to do than before. Only certain weapons will give you the opportunity to press your attack on the sprite.\n\nTherefore, the best Mega Man sprite sheet to rip first is Blizzard Buffalo. Not only is he the (possibly only) easiest Mega Man sprite to finish off with your normal X-Buster, but housed in his stage is the essential Air Dash power up capsule. I will proceed to each stage here. I will list how to reach all the items within each stage, as well as how to beat that particular boss. The listing of each stage will be in the proper sequence one should take to get through them. Listed in brackets will be what is needed to get that item. A weapon name with a star next to it means the powered up version of that weapon (requiring the Dual Blaster).', 'M', 884, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u7bhvazvzwwulcimpx6q.jpg'),
(11, 'Mega Man 6 / Rockman 6', '5th November, 1993', 'From the United States, Canada and Japan they came. The world\'s premier designers and their finest robotic warriors traveled to do battle in the First Annual Robot Tournament. But what began as a game suddenly took a terrifying twist! On the eve of the Grand Championship, the sponsor of the event announced that the entire tournament was just an elaborate scheme to get his hands on the world\'s most powerful robots! Now faced with an army of metallic mercenaries, Mega Man must fight a ferocious new foe - The Mysterious Mr. X!', 'M', 885, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1hqh.jpg'),
(11, 'Meiji Ishin', '29th September, 1989', 'A Famicom adventure game set during the Meiji Restoration era. It features strategy and action elements as well. \n \nMeiji Ishin (&quot;Meiji Restoration&quot;) is an adventure game for the Nintendo Famicom that allows the player to take an active role in one of the most important historical movements in Japanese history: the Meiji Restoration era of the late 19th century, which wrested control of the country from the Shogunate and back to the Emperor. \n \nThe first half of the game is spent gathering allies which involves moving from region to region, conversing with leaders and samurai, and occasionally fighting enemies in duels. The second half gives way to a tactical strategy sim similar to Nobunaga\'s Ambition, as the player\'s recruited forces march on Edo (Tokyo) to take on the Shogun.', 'M', 886, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vf7fz1iqotrjdocfyrpg.jpg'),
(11, 'Meimon! Daisan Yakyuubu', '8th August, 1989', 'A Famicom baseball game developed by Human and published by Bandai. It superficially resembles Namco\'s Famista series. \n \nMeimon! Daisan Yakyuubu (&quot;Meimon! The Third Baseball Club&quot;) is a baseball sim for the Famicom that is based on a manga and anime of the same name about an underdog highschool baseball team and the drama that surrounds them. The player can access the game\'s story mode, which depicts scenes from the manga, by selecting &quot;Dramatic Mode&quot; from the title screen menu. This also adds character portraits to the main game mode. \n \nThe game itself is a fairly standard NES baseball game. The pitching/batting perspective is from directly behind the batter, and the player moves the entire group of fielders simultaneously whenever the ball is hit. Graphically, the many super-deformed athletes resemble those of Namco\'s Famista (the series upon which RBI Baseball was based), which was very much the leading baseball franchise at the time.', 'M', 887, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ykfilgilila0b3vkbnc4.jpg'),
(11, 'Meitantei Holmes: Kiri no London Satsujin Jiken', '13th May, 1988', 'An adventure game starring Sir Arthur Conan Doyle\'s Sherlock Holmes developed for the NES by Towa Chiki. \n \nMeitantei Holmes: Kiri no London Satsujin Jiken (&quot;Great Detective Holmes: Fog of London Murder Case&quot;) is a murder mystery adventure game where the player directs Sherlock Holmes around London, finding clues and interrogating witnesses and suspects. Like its many NES adventure game contemporaries, it adheres to the Portopia formula of text adventure whodunits. \n \nIt is the sequel to Towa Chiki\'s earlier Sherlock Holmes game (Sherlock Holmes: Hakushaku Reijou Yuukai Jiken) and received a sequel (Meitantei Holmes: M-Kara no Chousenjou). None of these games were ever released outside of Japan.', 'M', 888, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dtbkmvx4kr0fweouv941.jpg'),
(11, 'Menace Beach', '31st December, 1990', 'Menace Beach is a video game that was released for the Nintendo Entertainment System by Color Dreams in 1990. Like all Color Dreams games, Menace Beach was not officially licensed by Nintendo. It was also re-released as part of the Maxivision 15-in-1 multicart.\nAccording to the game\'s instruction manual, the player controls a skateboarding hero whose girlfriend, Bunny, has been kidnapped by Demon Dan. An introduction screen shows a shackled Bunny pleading for the player\'s help. In the game, the hero must use his skateboard and any objects he finds, such as balloons, frogs, bombs and bottles, to defeat ninja, clowns and disgruntled dock workers before finally confronting the villainous Demon Dan. The game was somewhat infamous because in-between levels the girlfriend\'s clothes &quot;rot&quot; away, by when the first level is completed, parts of her clothes rot away until the girl is in nothing else but in her bra and panties.', 'M', 889, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fku7yn0hg2bouwxgecsv.jpg'),
(11, 'Mendel Palace', '27th July, 1989', 'Candy needs your help! She\'s fallen fast asleep and may never wake up--because she\'s trapped in her own dream! \nAll her harmless dolls are suddenly out to get her! So who will rescue Candy? Someone must brave her wild nightmare world. With 20 areas and 200 levels!', 'M', 890, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vrmj2fupofrv7o0ctwck.jpg'),
(11, 'Mermaids of Atlantis: The Riddle of the Magic Bubble', '1st February, 1991', 'Far below, from the dark and murky depths, another shiny bubble cluster rises. Though very beautiful, the strangely quivering bubbles are part of a sinister plan, concocted by the evil Emperor O-Dinten. With the patented Dura-Bubble, he plans to profit from fun itself by controlling all the games under the sea. Can you stop him and restore &quot;The Freedom to Have Fun&quot; to the undersea world of Atlantis? It\'s a brain-bursting bubble battle to pop thousands of beautiful bubbles before they overflow to the open sea!', 'M', 891, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b3b89tkqvrhkbsdtiki5.jpg'),
(11, 'Metal Fighter', '30th September, 1991', 'Returning from three centuries of intergalactic missions, MCS-920 is surprised by an alien-infested planet. Whatever few lifeforms survived were driven underground or transformed into battling bionic mutants. You must escape the tentacles of these mutants, seek out and destroy alien ships, then overpower grotesque alien guards to steal their fiendish and bizarre weapons. From barren landscapes and colorful coral reefs to abandoned and frozen cities, you will yet come face to face with the alien tyrant in each world!', 'M', 892, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vz0eebmllozgxaq4ybjq.jpg'),
(11, 'Metal Force', '17th July, 1994', 'A vertically strolling shooter for the PC-98.', 'M', 893, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/osvoolesdvudyjt7ujj8.jpg'),
(11, 'Metal Gear', '13th July, 1987', 'Metal Gear is considered to be the progenitor of the stealth game genre, it was also the first video game designed by Hideo Kojima, who also directed many of the later Metal Gear sequels. A heavily altered port was produced for the Famicom/NES (without Kojima\'s involvement). A remade version based on the original MSX2 game was released as a bonus game in Metal Gear Solid 3: Subsistence for the PlayStation 2 and, as a result, is also included in Metal Gear Solid HD Collection and Metal Gear Solid: The Legacy Collection. \n \nThe game revolves around a special forces operative codenamed Solid Snake who goes into a solo infiltration mission into the fortified state of Outer Heaven to destroy Metal Gear, a bipedal walking tank capable of launching nuclear missiles from anywhere in the world. \n \nThe player must navigate the main character, a military operative codenamed Solid Snake, through various locations, while avoiding visual contact and direct confrontation with patrolling guards. If the player is seen, the game enters the &quot;Alert Mode.&quot; In this situation, Snake must escape from enemy\'s sight in order to resume infiltration. The method of escaping varies depending on the circumstances behind discovery: \n \nIf Snake is seen and only a single exclamation mark appears over an enemy\'s head, only the enemies in the player\'s present screen will attack and Snake can escape by simply moving to an adjacent screen. \nHowever, if two exclamation marks appear over the enemy (or the player triggers an alarm by being spotted by a camera, infrared sensor or by using an unsuppressed weapon), reinforcements from off-screen will appear as well. Snake can only escape by eliminating all incoming enemies, going outdoors, or by entering an elevator. \nThe player starts the game unarmed, but eventually acquires firearms such as a Beretta 92F and an M79 grenade launcher, as well as explosives such as remote control missiles and landmines. Ammo and supplies for weapons are limited, but are replenished by picking up ammunition caches or additional supplies. Weapons can not only be used to kill enemies, but also to clear obstacles such as hollow walls and electrified floors. Snake can also use his fists to punch and defeat patrolling enemies. Occasionally, if the player defeats a guard with punches without alerting anyone, the defeated guard will yield a single unit of rations or an ammo box that can be picked up. In addition to enemy guards, the player will also be confronted by mercenaries who will challenge the player to combat, serving as the boss characters. \n \nThe enemy base consists of three different buildings, with multiple floors (including basement levels) within them. The player uses key cards and other items to unlock doors and explore new areas. Each door will only open to its corresponding key cards. Information can be obtained by rescuing hostages being held within the buildings. After rescuing five hostages, the player\'s rank will increase by one star (with the maximum rank being four stars), allowing for increased carrying capacity and maximum health. However, if a hostage is killed, the player is demoted to the previous rank. \n \nA transceiver is available for the player to communicate with their commanding officer, Big Boss, or one of the resistance members operating covertly near Outer Heaven (Schneider, Diane, and Jennifer). Each of Snake\'s allies specializes in a specific subject. The player must keep track of their allies\' frequency numbers in order to contact them. All of the radio messages are dependent on the rooms where the player is located.', 'M', 894, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pd9u2f5zmlzh6jvfrhha.jpg'),
(11, 'Metal Mech: Man &amp; Machine', '14th January, 1991', 'It can save mankind, but beware... this machine has a mind of its own! Welcome to the all-terrain attack vehicle of the future. It\'s what you need in a world gone to the dogs! You can beat \'em into the ground, or blast \'em underground, or fight \'em alone!', 'M', 895, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zzkmhlpc69m2yuwwnnbf.jpg'),
(11, 'Metal Slader Glory', '30th September, 1991', 'Eight years after a great war was waged between colonies in outer space, peace has finally settled back onto the Earth. Tadashi Himukai, a 17-year-old war orphan, purchases a used worker-mech in order to start a construction business with his girlfriend, Elina Furfa. However, when he first activates it, the worker-mech disguise falls away, revealing a combat model Metal Slader, which were all supposedly dismantled after the war, and an enigmatic message is displayed in the cockpit: &quot;EARTH IN PERIL... SEEK THE CREATOR&quot;. Prompted by this warning, Tadashi, his sister Azusa, and Elina head out into space to find the answers behind it.', 'M', 896, 0, 2.5, ''),
(11, 'Metro-Cross', '31st December, 1985', 'Metro-Cross is a platform arcade game that was released by Namco in 1985. It runs upon Namco Pac-Land hardware (but with a video system like that used in Dragon Buster, modified to support a 2048-color palette). It uses a Motorola M6809 microprocessor, with a Hitachi HD63701 sub-microprocessor (both running at 1.536 MHz) and Namco 8-channel waveform PSG for audio. \n \nThe player must take control of a man known only as Runner, who is given a time limit to run through each of the game\'s thirty-two rounds while avoiding obstacles and collecting drink cans. The actual running happens automatically: the job of the player is to avoid the obstacles and collect the cans by moving the Runner with the stick and adjusting his speed accordingly. \n \nIf the Runner finishes the round within the time limit, the remaining time will be awarded to him as bonus points and he will proceed to the next round. Every fourth round is special, using the remaining time from the three previous ones as additional time. However, if the Runner has not finished the round by the time the time limit runs out, he will be electrocuted and the game will immediately be over.', 'M', 897, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z4uliwfrxzhc1jh61chz.jpg'),
(11, 'Metroid', '6th August, 1986', 'It\'s you against the evil Mother Brain in the thrilling battle of Metroid! You\'re inside the fortress planet Zebes. The planet of endless secret passageways where the Metroid are multiplying. Left alone the Metroid are harmless. But in the wrong hands they could destroy the galaxy. It\'s up to you to prevent the Mother Brain that controls Zebes from using the Metroid for evil purposes. But that won\'t be easy. You\'ll have to use your spacesuit to absorb valuable energy for your search to gain the use of power items like the Ice Beam, Wave Beam, High Jump Boots and Varia. If you survive, it will be you and your acquired powers against the Mother Brain.', 'M', 898, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xe8.jpg'),
(11, 'Mezase! Top Pro Green ni Kakeru Yume', '4th April, 1993', 'Mezase! Top Pro Green ni Kakeru Yume is a Sports game, developed and published by Jaleco Entertainment, which was released in Japan in 1993.', 'M', 899, 0, 2.5, ''),
(11, 'Michael Andretti\'s World GP', '9th January, 1989', 'Superstar Michael Andretti personally guides you through the perilous and exciting world of Grand Prix Racing! Four of the most powerful racing machines are your to command on 16 famous international Grand Prix courses from around the globe! Hone your driving skills or challenge the best - it\'s all up to you in this amazing simulation of Formula One racing!', 'M', 900, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ojttblt3wqiplnrfipjp.jpg'),
(11, 'Mickey Mousecapade', '6th March, 1987', '&quot;Help! Help!&quot; echos a mysterious voice. Mickey Mouse, the famous world explorer, has heard the cries of one of his friends and he\'s off on a rescue mission... This adventure starts in a zany Fun House. Join Mickey and Minnie as they turn it inside out looking for their missing friend. A mischievous creature may fly off with Minnie, and you\'ll have to get her back. Now that Minnie is safe, you must help our heroes make it across a vast ocean - on foot! Even the feisty flying fish can\'t stop Mickey from his search, but what about the cantankerous crocodile waiting at the shore? Enter the world of fantasy, mystery and excitement with Mickey and Minnie as you solve the mystery of Mickey\'s missing friend!', 'M', 901, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cjwfbbwxj1sgvgpzeosw.jpg'),
(11, 'Mickey\'s Adventure in Numberland', '31st March, 1994', '&quot;Oh no&quot;, cried Donald the Sheriff. \n&quot;Pete\'s done it again!&quot; \n&quot;He\'s stolen our numbers-from 1 up through 10!&quot; \n&quot;Search the whole city-every street every house.&quot; \n&quot;Look high and low-and call Mickey Mouse!&quot; \n \n&quot;You can count on me,&quot; declared Mickey Mouse. &quot;Don\'t worry!&quot; \n&quot;I\'ll find all the numbers. I\'ll foil Pete\'s plot!&quot; \n&quot;I\'m set for adventure. I\'m hot on the trail.&quot; \n&quot;With my friends to help guide me, there\'s no way I can fail!&quot; \n \nImmensely entertaining, Mickey\'s Adventure in Numberland helps improve early number identification and counting skills as it invites children to join Mickey on his quest to locate and return Numberland\'s stolen numbers. The game features 5 imaginative worlds of fun and fantasy-each with two levels and a seemingly endless supply of animated surprises.', 'M', 902, 0, 2.5, ''),
(11, 'Mickey\'s Safari in Letterland', '15th April, 1993', 'Endlessly entertaining, MICKEY\'S SAFARI IN LETTERLAND is a delightful way to help children improve important early recognition skills as they have fun with Mickey and his Disney pal, Goofy! 6 Exciting animated worlds of adventure await all who join Mickey on his safari to find the lost letter tablets and return them to the museum. Hidden surprises are scattered throughout each level--including rare &quot;alphabet jewels&quot; that spell out words and add extra challenge to the fun.', 'M', 903, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/r40ytavohu66fxf2tjqn.jpg'),
(11, 'Micro Machines', '31st December, 1991', 'Micro Machines is a classic racing game. Simple, fast-paced and lots of fun. You are given the control of miniature cars, choppers, speedboats, racecars, tanks, jeeps, formulas and many more vehicles to choose and about 20 different tracks to drive on. You\'ll have to race AI opponents or your friends on various locations such as kitchen desks, pool tables, workshops, school desks, gardens, bathtubs etc.', 'M', 904, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/acgmkiuatjpwroyxysjz.jpg'),
(11, 'Might and Magic Book One: The Secret of the Inner Sanctum', '1st June, 1986', 'Feel the power... Experience the magic! Lead your party of hand-picked adventurers into the enchanted Land of Varn. From dark, moldy caverns through corridors of majestic castles, you\'ll travel in search of clues to unlock the Secret of the Inner Sanctum. Daring exploits of heroism and sorcery will keep you riveted for hours. Choose from a variety of extraordinary personalities and lead them on an adventure of a lifetime. Over 250 weapons and items and more than 92 mystical spells to use in your search for the Inner Sanctum. Battle legions of ravenous monsters as you travel through forests and islands shrouded in mystery.', 'M', 905, 0, 3.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wmfe2xcqrzwjcqnkjdfu.jpg'),
(11, 'Mighty Final Fight', '11th June, 1993', 'The Mad Gear Gang has spread crime and violence throughout the streets of Metro City. Only one man has enough guts to take the streets back from them, Mayor Mike Haggar. Now the Mad Gear Gang has kidnapped his daughter Jessica to bring him under their control. But they\'ve made one mistake: Haggar\'s furious and he wants someone\'s head! Guy and Jessica\'s boyfriend, Cody, are joining Haggar to clean up the slime-filled streets and rescue Jessica. Along the way you\'ll find food to replenish your health, or better yet, search for weapons to knock the living daylights out of your enemies. So join Haggar and his friends as they try to free the city from the evil clutches of the Mad Gear Gang!', 'M', 906, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cnqdu2zb62mabki8egqo.jpg'),
(11, 'Mike Tyson\'s Intergalactic Power Punch', '13th May, 2009', 'Mike Tyson is the undefeated heavyweight champion of the world, with an Olympic gold medal and a 33-0 (30 KO) record to his claim. After knocking out another opponent with ease, Tyson and his manager taunt the world by saying that no one can stop him. However, the broadcast is picked up far from Earth in the outer reaches of the universe by an alien boxing promoter for the Intergalactic Boxing Federation (IGBF). The promoter decides to accept Tysonâ€™s challenge that he can beat â€œanyoneâ€. Thus Tyson is brought into the throes of the universe to compete against the best boxers in the universe and defend his earthly title.', 'M', 907, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d4orezobh9ip5nuzwmsd.jpg'),
(11, 'Punch-Out!!', '21st November, 1987', 'Punch-Out!!, originally released in North America as Mike Tyson\'s Punch-Out!!, is a boxing sports fighting video game for the Nintendo Entertainment System (NES) developed and published by Nintendo in 1987. Part of the Punch-Out!! series, it is a port of both the Punch-Out!! and Super Punch-Out!! arcade games (particularly the latter) with some variations. \nPunch-Out!! features a boxer known as Little Mac working his way up the professional boxing circuits, facing a series of colorful, fictional boxers, leading to a final fight with real-life boxer, the then-World Heavyweight Champion, which is Mike Tyson in the original version and Mr. Dream in the later version. \nLittle Mac has a limited repertoire compared to most of his opponents. His punches are limited to left and right jabs, left and right body blows, and a powerful uppercut. The uppercut can only be used once the player earns a star, which is typically accomplished by counter-punching the opponent directly before or after certain attacks are launched. The player can acquire up to three stars. To perform the uppercut, the player needs to press the start button once a star is earned. To defend, Mac can dodge left or right, duck, and block punches by putting up his guard. \nLittle Mac also has a heart meter, which decreases by three upon being struck by an opponent and one upon blocking an attack or an opponent blocking/dodging the player\'s attack. When the heart meter decreases to zero, Little Mac temporarily turns pink and appears exhausted, leaving the player unable to attack but still able to dodge or block. At this point, Mac can regain some hearts (and his normal color palette) only by avoiding the opponent\'s punches. He immediately loses all of his hearts upon being knocked down, but can regain some by getting up. \nA bout can end by knockout (KO), if a fighter is unable to get up within ten seconds after being knocked down; by technical knockout (TKO), if a fighter is knocked down three times in one round; or by decision, if the bout lasts three full rounds without a clear winner. In order to win by decision, the player must accumulate higher than a certain point total by punching the opponent and/or knocking him down (different boxers require different point totals to win by decision). However, some bouts cannot be won in this manner and will automatically result in a loss for the player if the opponent is not knocked out. Mac can only get up three times during any one bout; if he is knocked down a fourth time, he will be unable to rise and thus lose by knockout. \nWhen Mac loses his first bout to a ranked opponent, he will have a chance to fight a rematch. However, if he loses a Title Bout, he will fall in the rankings - one place for the Minor or Major Circuits, two places for the World Circuit. Losing a rematch causes him to fall one place (unless he is already at the bottom of his circuit), forcing him to fight his way back up. A third loss (not necessarily a consecutive one) ends the game. The exception is the final fight against Mike Tyson/Mr. Dream; a loss to them automatically results in a game over.', 'P', 908, 0, 4.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1hrk.jpg'),
(11, 'Millipede', '1st November, 1982', 'Millipede is a 1982 arcade game by Atari, Inc. and is the sequel to the arcade hit, Centipede. The objective of the game is to score as many points as possible by destroying all segments of the millipede as it moves toward the bottom of the screen, as well as destroying and avoiding other enemies. The game is played with a trackball and a single fire button, which can be held down for rapid-fire. The game is over when the player\'s last life is lost.', 'M', 909, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/toif3tbonf16p0lqqw3j.jpg'),
(11, 'Milon\'s Secret Castle', '13th December, 1986', 'Guide Milon through the four levels of Garland Castle in his quest to reach the top floor and vanquish the big boss! The journey is a difficult one though, because the castle is locked up tight and Milon doesn\'t have the keys. You will have to use your bubble attacks to fend off the castle baddies while busting up every block in sight trying to find all of the hidden treasure and other secrets throughout the game. Unlike most platformers, Milon\'s Secret Castle is less about defeating all of the enemies in an area, and more about scouring every bit of each room to find the secrets that lie within Garland Castle! Milo can uncover practically anything in the game. This includes: items, power-ups, money, shields, keys, level exits, even shops! The only way to get to each level boss is to find the right secret items!', 'M', 910, 0, 2.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/thl8iqjnhm6rqke3ywag.jpg'),
(11, 'Mindseeker', '18th April, 1989', 'Mindseeker is an Adventure game, developed and published by Namco, which was released in Japan in 1989.', 'M', 911, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cb3juw7meyhfxdr111ot.jpg'),
(11, 'Minelvaton Saga: Ragon no Fukkatsu', '23rd October, 1987', 'In the kingdom of Palmeccia both the King and Queen have been murdered by the hands of a servant of Ragon, son of the Zuhl. Take control of the Prince of Palmeccia in a quest for revenge and to kill the evil Ragon.', 'M', 912, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vsyabrckoxltpg22ayi3.jpg'),
(11, 'Miracle Piano Teaching System', '31st December, 1990', 'The Miracle Piano Teaching System is an educational program from Software Toolworks that teaches users how to play the piano through a keyboard peripheral which was included in the package. Users simply followed the on-screen instructions to learn how to play the piano, tapping keys indicated by the screen. Eventually, the user would learn to recognize the various notes and learn the musical notation, and could progress to playing the music without the use of indicators.', 'M', 913, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gykjvprujkb2k8paxtwa.jpg'),
(11, 'Mirai Shinwa Jarvas', '30th July, 1987', 'Mirai Shinwa Jarvas (æœªæ¥ç¥žè©±ã‚¸ãƒ£ãƒ¼ãƒ´ã‚¡ã‚¹? lit. Future Legend Jarvas) is a RPG developed and published by Taito. It is about a man named Jarvas who travels back in time from the future to conquer the world of the past and become the leader. You must get people to join your side and take over enemy castles. \n \nThis game is generally considered pretty bad by most. When you begin the game, you are given no information about where you are and where you should attempt to go. Once you find a town, you must join a guild. You can only increase your level by returning to the guild once you have accumulated enough experience.', 'M', 914, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b29uozvuh5fqqjhmm8aq.jpg'),
(11, 'Mission: Impossible', '30th September, 1990', 'NES game from Konami based on the 1980s TV Series. It used the same game engine as Metal Gear.', 'M', 915, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p1ix82nlx17pjywjmqnl.jpg'),
(11, 'Mississippi Satsujin Jiken: Murder on the Mississippi', '30th November, 1986', 'Muder on the Mississippi is a mystery game initially released in 1986 for the Apple II, Commodore 64 and Commodore 128. It was later ported to the Famicom and MSX2 in Japan. \n \nMurder on the Mississippi, known as Mississippi Satsujin Jiken in Japan, is a menu-driven adventure game loosely based on Sir Arthur Conan Doyle\'s Sherlock Holmes character. Sir Charles Foxworth and his manservant Regis (Watson in some versions) are on board a Mississippi steamboat heading to New Orleans when a sudden murder forces them to determine who the killer is before Sir Charles becomes their next target. \n \nPlayers move from room to room interrogating suspects and witnesses while looking for clues, occasionally having to avoid a pitfall or trap that will end the game early with the death of Sir Charles. The player needs sufficient evidence to condemn the correct culprit as well, otherwise the game ends on a bad note. \n \nThe game was originally released on the Apple-II, Commodore 64 and Commodore 128 by Activision. Jaleco acquired the rights to license the game in Japan and released their own version for the Japanese MSX and Famicom, which was developed by contract developers TOSE. Some aspects of the Japanese version, including character names and the intro, are different from the Activision version.', 'M', 916, 0, 2.5, '');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Mito Koumon II: Sekai Manyuu Ki', '11th August, 1988', 'A NES action game developed by SunSoft and the sequel to Mito Koumon. It was never released outside of Japan. \n \nMito Koumon II: Sekai Manyuuki is the sequel to Mito Koumon and is very similar in appearance and gameplay. As in that game, the player controls one of Mitsukini Tokugawa\'s retainers as they gather clues and evidence of crimes in the area while either avoiding or fighting off hostile NPCs. \n \nUnlike the first game, which was set entirely within Japan, Tokugawa is crossing the world solving issues instead. The first stage is America (specifically the Wild West, as would be chronologically accurate for the 17th century) though there are plenty of other locations to visit across the world as well, including even Transylvania.', 'M', 917, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/t45d2qyx2rbohlf6rshf.jpg'),
(11, 'Mitsume Ga Tooru', '1st June, 1991', 'To learn about his roots, Sharaku must investigate the mysterious ruins that a long lost civilization called the Three-Eyed Ones bequeathed to him. In his worldwide search, which takes both he and Chiyoko Wato to locations like Arizona, Easter Island, and Mexico, Sharaku deciphers ancient scriptures and uses gadgets he invents to help solve (or start) problems and mysteries.', 'M', 918, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jx4egi6lzseixt4lwu1w.jpg'),
(11, 'Mizushima Shinji no Daikoushien', '25th November, 1990', 'Mizushima Shinji no Daikoushien is a Sports game, published by Capcom, which was released in Japan in 1990.', 'M', 919, 0, 2.5, ''),
(11, 'Moai Kun', '9th March, 1990', 'Moai Kun (ãƒ¢ã‚¢ã‚¤ãã‚“ Mr. Moai?) is a puzzle video game developed and published by Konami for the Family Computer in Japan in March 1990. The game derives its themes from Easter Island; the player controls a sentient moai statue that must rescue other moai and escape each stage via a door before the timer expires. Although platforming elements are present, the primary challenge is to find a way to manipulate the objects in each stage to reach the distressed moai and rescue them while still leaving an avenue of escape to the exit door.', 'M', 920, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/htarypy5mdwyzgcsmo6n.jpg'),
(11, 'Qwak', '31st October, 1989', 'In this game, you play a duck and the object of the game is to get the highest score without losing all your lives. This can be achieved by getting all the fruit and gems in the level, or killing off enemies. There are 80 levels to complete and once you complete all of them, the levels are repeated. \n \nYou exit each level by collecting all the gold keys then entering through the door that opens. You have a certain amount of time to complete the level before spikes fall down the level. There are eight areas, all consisting of ten levels. At the end of each area, there is a guardian waiting for you, and again, you have a certain amount of time to defeat them.', 'Q', 921, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hji0dxyoxlsq8tob8fjo.jpg'),
(11, 'Racket Attack', '15th April, 1988', 'This is no amateur hour. This one\'s for keeps. The national finals. Will you play tough enough to hear the umpire call &quot;point, set, match!&quot; A million eyes bore into you from the stands. Moments to start... RACKET ATTACK has made you a pro, the toughest, most awesome champ ever to hit center court. You\'ve a power serve and a ferocious backhand. You\'re fearsome at the net and in the backcourt. On clay or grass you attack. But your opponent knows your game. And he\'s ready. Screams go up as you step to the base line. It\'s 100 degrees. Your service. You launch it like a rocket. Ace... Let... Fault! The umpires\' call reminds you to hang tough and be consistent. 15 love... 30 love... 40 love... MATCH POINT. Sweating, you grip your racket. The crowd hushes. Can you deliver an ace? Bear down. Psych up. Get tough!', 'R', 922, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hihisghf4zpmurfnffow.jpg'),
(11, 'Shin Moero!! Pro Yakyuu', '27th July, 1989', 'The third game in TOSE/Jaleco\'s NES Baseball series and the sixth Moero game overall. Though most of the Moero!! Pro Yakyuu games were released in the US as Bases Loaded, this one was not. \n \nShin Moero!! Pro Yakyuu (New Burning!! Pro Baseball) is the sixth of Jaleco/TOSE\'s Moero!! series of sports games (it\'s occasionally referred to as Moero 6!! Shin Moero!! Pro Yakyuu) and the third in the series to be associated with baseball. The first two Moero!! Pro Yakyuu games saw localizations in the US as Bases Loaded and Bases Loaded 2, but Shin Moero!! Pro Yakyuu was skipped. What eventually became Bases Loaded 3 was instead the fourth Moero!! Pro Yakyuu game, Moero 8!! Pro Yakyuu \'90 Kandouhen. \n \nThe biggest difference between the previous Moero!! Pro Yakyuu/Bases Loaded games and this one is the slanted perspective for batting and pitching. Instead of the camera being behind the batter or pitcher, the player can see both from an angle, with the two situated diagonally from each other. Likewise, the baseball diamond is shown at an angle making it appear more like a square, with the rest of the field stretching outwards. Despite this new perspective, the game controls similarly to previous Bases Loaded games. \n \nA curious addition is that of the biorhythms, which tells the player how each athlete is feeling: If the athlete is having an off-game, one or more of these biorhythms will be low and the player will need to strategize around these dips. Though big in 70s sports punditry, the idea of mathematical biorhythms predicting an athlete\'s prowess in any upcoming game was all but discredited as pseudoscience by the time when this game came out.', 'S', 923, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hnlkwfenycbjbqg2rpqe.jpg'),
(11, 'Momotarou Densetsu: Peach Boy Legend', '25th November, 1987', 'Momotarou Densetsu: Peach Boy Legend is a Role-Playing game, published by Hudson, which was released in Japan in 1987.', 'M', 924, 0, 2.5, ''),
(11, 'Momotarou Dentetsu', '2nd January, 1989', 'The first in Hudson\'s series of train-themed video board games which was released on the Famicom in Japan only on December 2nd 1988. \n \nMomotaro Dentetsu (&quot;Momotaro\'s Railway&quot;) is a train-themed board game featuring the folklore hero of Momotaro, the Peach Boy. It is the first in Hudson\'s long-running series of the same name. The goal is for each player to drive a train around a board by rolling a die and trying to make as much money as possible, a la board games like Monopoly or the Game of Life. \n \nThe game and its series is not to be confused with Momotaro Densetsu, an earlier RPG from Hudson featuring the same characters.', 'M', 925, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hs82bcf0nlnuwhvs4nju.jpg'),
(11, 'The Money Game', '10th August, 1988', 'A Stock Market/life-sim game where the player must manage their stocks in order to achieve a happy life. It was developed by SOFEL for the NES and released in Japan only. \n \nThe Money Game is a stock market simulation game where the goal is to raise money through the wise purchasing and selling of various types of stock. Coupled to this is a life-sim aspect where raising a sufficient amount of money at certain checkpoints allows the player to gain and keep a girlfriend, who later becomes their wife and provides children. As well, the player can upgrade from their initial studio apartment to a terraced house to a mansion with its own Olympic-sized swimming pool. \n \nThe game is densely packed with Japanese script and requires both literacy in that language and a fairly good understanding of dealing in the stock market itself (though the game does provide tutorials for the latter). It would be followed by a sequel, The Money Game 2: Kabutochou no Kiseki, which in turn would be the basis for SOFEL\'s Wall Street Kid.', 'T', 926, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xckdf9ruahnnp5spm5jg.jpg'),
(11, 'Monopoly', '31st December, 1991', 'Monopoly is a video game based on the board game Monopoly, released on Game Boy, Genesis, NES, and SNES. Developed by Sculptured Software and published by Parker Brothers (the Game Boy version was published by Majesco Sales), this title was one of many inspired by the property.', 'M', 927, 0, 2.5, ''),
(11, 'Monster in My Pocket', '1st February, 1992', 'Thousands of history\'s famous monsters gather for the meeting of the century. But their volcanic convention center erupts, mysteriously turning them into terrors of pint-size proportions. They escape to the home of Jack, the teenage &quot;Captain of Cool.&quot; There begins a battle between the good ghouls and The Warlock\'s band of evil beasts. You must become The Vampire or The Monster and lead the forces of right through a humongous, human-size world six levels deep, featuring Jack\'s house, a scummy sewer, a hazardous construction site, and an odd oriental palace. Don\'t get burned on the kitchen stove or crushed by runaway golf balls. Meanwhile you\'ll have to punch and zap at all your fiendishly favorite monsters including the head-rolling Skeleton, the rock candy throwing Goblin, the bone-crushing Cyclops, and dozens more! Every monster you mash is worth points. Score enough and you\'ll get an extra life. Something you\'ll really need when you finally face the powerful Warlock and his magic lightning jolts. So be a pocket-size peacemaker and conquer the smallest threat to monsterdom the world has ever known!', 'M', 928, 0, 4.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eq8rv4vzymr6sr7y6qzm.jpg'),
(11, 'Monster Maker: 7-tsu no Hihou', '19th January, 1992', 'Monster Maker: 7-tsu no Hihou is a Role-Playing game, developed and published by Sofel, which was released in Japan in 1991.', 'M', 929, 0, 2.5, ''),
(11, 'Monster Party', '1st June, 1989', 'Walking home from a baseball game one evening, Mark gazed up at the misty sky. Suddenly, a blazing star plummeted to earth with a blinding light. When Mark regained his sight, a mysterious creature was standing before him. The creature told an eerie tale about his home planet, the Dark World, where evil monsters were terrorizing the helpless population. He was searching the galaxy for a warrior capable of freeing them from their terrible plight. The creature explained that Mark\'s bat was the perfect weapon for defeating the evil monsters. Mark considered the creature\'s proposal for a minute, then agreed to undertake the dangerous mission. After all, he thought, it sure beats going to school!', 'M', 930, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/etcs0sxsvl3bdozilsfb.jpg'),
(11, 'Monster Truck Rally', '1st October, 1991', 'You\'ve never experienced anything like the incredible action of MONSTER TRUCK RALLY! Compete against the computer - or against up to three of your friends at once - in nine grueling, gear-grinding events: hill climb, drag race, car crush, sled pull, monster rally, drawbridge, donuts, tug-o-war, and bog! Whether you build your own custom course, or have the computer build one for you randomly - out of millions of possible combinations - every event is sure to be an awesome new challenge, every time!', 'M', 931, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hqw069hrpvgqntlaw3ps.jpg'),
(11, 'Moon Crystal', '28th September, 1992', 'As Ricky Slater, the player must rescue Ricky\'s family and confront the evil forces of Count Crimson, who wields the powerful Moon Crystal! Owing much inspiration to Prince of Persia, this game boasts colorful graphics and vivid animations coupled with non-linear exploration and gameplay.', 'M', 932, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fxgqnqtrhmqooixzwa3b.jpg'),
(11, 'Moon Ranger', '1st February, 1990', 'Moon Ranger is an Action game, developed by Odyssey Software Inc. and published by Bunch Games, Inc., which was released in 1990.', 'M', 933, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rnbi9gpnt29tvnigmnpn.jpg'),
(11, 'Motocross Champion', '27th January, 1989', 'A NES Motocross racing game developed and published by Konami and released in Japan only.', 'M', 934, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/x6b9e12nw6cprephqwe0.jpg'),
(11, 'Mottomo Abunai Deka', '5th March, 1990', 'Mottomo Abunai Deka is an Action game, developed by Micronics and published by Toei Animation, which was released in Japan in 1990.', 'M', 935, 0, 2.5, ''),
(11, 'Moulin Rouge Senki: Melville no Honoo', '11th September, 1989', 'Moulin Rouge Senki: Melville no Honoo is a strategy game released in 1989 for the Nintendo Famicom. \n \nMoulin Rouge Senki: Melville no Honoo (&quot;Record of Moulin Rouge War: Melville\'s Flame&quot;) is a strategy war sim with RPG elements for the Famicom. The player controls a party of heroes with an entire army under their control, and fights other armies and random encounters with monsters. To begin the game, the player must purchase and equip their army before setting out. \n \nThe game\'s battles play out in turn-based formations, and each formation acts separately and can target different formations on the enemy\'s side. For instance, the archers can aim for any of the four rows of enemy forces, though front-line melee fighters are far more limited.', 'M', 936, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/c7umdlkgg1voenqkusjm.jpg'),
(11, 'Mouryou Senki Madara', '30th April, 1990', 'Mouryou Senki Madara is a Role-Playing game, developed and published by Konami, which was released in Japan in 1990.', 'M', 937, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ngxxa9zqr1wh2yfmtmur.jpg'),
(11, 'Ms. Pac-Man', '3rd February, 1982', 'In 1982, a sequel to the incredibly popular Pac-Man was introduced in the form of his girlfriend, Ms. Pac-Man. This sequel continued on the &quot;eat the dots/avoid the ghosts&quot; gameplay of the original game, but added new features to keep the title fresh. \n \nLike her boyfriend, Ms. Pac-Man attempts to clear four various and challenging mazes filled with dots and ever-moving bouncing fruit while avoiding Inky, Blinky, Pinky and Sue, each with their own personalities and tactics. One touch from any of these ghosts means a loss of life for Ms. Pac-Man. \n \nMs. Pac-Man can turn the tables on her pursuers by eating one of the four Energizers located within the maze. During this time, the ghosts turn blue, and Ms. Pac-Man can eat them for bonus points. The Energizer power only lasts for a limited amount of time, as the ghost\'s eyes float back to their center box, and regenerate to chase after Ms. Pac-Man again. \n \nSurvive a few rounds of gameplay, and the player will be treated to humorous intermissions showing the growing romantic relationship between Pac-Man and Ms. Pac-Man, leading all the way up to the arrival of &quot;Junior&quot;.', 'M', 938, 0, 4.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1y4v.jpg'),
(11, 'Muppet Adventure: Chaos at the Carnival', '1st November, 1990', 'Yipes! The awful, evil Dr. Grump has pignapped the lovely Miss Piggy and taken her to his secret carnival hideout! Now Kermit and the whole crazy Muppet crew need your help! Jump! Leap! Hop! And charge into action! But watch out! Dr. Grump\'s Carnival of Clamorous Confusion is a rollicking roller coaster of thrills, spills, and chills! Join Kermit as he faces the fearsome challenge of the Raging River Ride. Help Fozzie lick the Amazing Ice Cream Maze. (But beware of those Canine Carnival Barkers!) Blast off with Gonzo on the Lost in Space Ride. Then let Animal drive you crazy on the incredible Crash Car Course. And if you dare, enter the ultimate challenge - the Cave of the Grumpasaurus! Only your quick wrist, sharp wit - and some help from Kermit and the gang - can defeat Dr. Grump and rescue the still-lovely Miss Piggy! It\'s Muppet mayhem! You\'ll want to play again and again!', 'M', 939, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lefsy1q7kooyohot6erc.jpg'),
(11, 'Musashi no Bouken', '22nd January, 1991', 'Musashi lives somewhere in medieval Japan in the village of Arima . He is the son of the famous swordsman Miyamoto Musashi and a skilled fighter himself. One day he hears of a rumor that the evil wizard Kojiro, his father\'s archenemy, has apparently reared up his ugly head once again! Kojiro\'s demons invade the land, and threaten death and destruction. &quot;I shall defeat Kojiro!&quot; - says Musashi, - &quot;and maybe even get the girl&quot;...', 'M', 940, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uq5xmmnqrfwplj6nknad.jpg'),
(11, 'Musashi no Ken: Tadaima Shugyou Chuu', '8th September, 1986', 'Musashi no Ken - Tadaima ShugyÅ ChÅ« (å…­ä¸‰å››ã®å‰£ ãŸã ã„ã¾ä¿®è¡Œä¸­ lit. &quot;Sword of Musashi - Now in the Middle of Training&quot;?) is a 1986 video game software developed and published by Taito exclusively in Japan. It is based on a Japanese sports manga series written and illustrated by Motoka Murakami that focuses on kendo, simply titled Musashi no Ken. The gameplay and design in the one-on-one fighting parts resemble Taito\'s other fighting game, Great Swordsman, especially its kendo mode. \n \nThe game\'s plot is about the son of two Kendo champions named Musashi. He strives to become as great at Kendo as his parents. The entire story centers around the world of Kendo and its up and coming competitors. The anime is broken up in to two parts. The first part follows Musashi\'s early years in grade school while the second part follows his high school years. In the first episode, Musashi befriends an Akita puppy who is by his side throughout the series.', 'M', 941, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b5hiriskxbs9vnghivbb.jpg'),
(11, 'The Mutant Virus: &quot;Crisis in a Computer World!&quot;', '1st May, 1992', 'Ron Trainer, the hottest of the elite corps of Computer Master Debuggers is enjoying his first week of vacation in over two years. He\'s been busy keeping CPI running errorfree. CPI, the Central Programing Institute, is what allows the world to exist the way it does. It controls everything; from global databases and grids to holographic theater software as well as the simple timing of the traffic signals. But something is terribly wrong tonight... cities around the globe have lost their power and data feeds. There have been several major aerial collisions between passenger liners and heavy freighters and the skyways have been closed until global traffic control is back on-line. All power and light have been lost and the atmospheric control system can only continue to function on auxiliary power for the verge of collapse. There is rioting reported in several areas. What\'s going on??? This appears to be more than a simple system\'s bug... but how much more?', 'T', 942, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tsdytocmmfzpmh46wpza.jpg'),
(11, 'My Life My Love: Boku no Yume Watashi no Negai', '2nd September, 1991', 'My Life My Love: Boku no Yume Watashi no Negai is a Miscellaneous game, developed by WinkySoft and published by Banpresto, which was released in Japan in 1991.', 'M', 943, 0, 2.5, ''),
(11, 'Mystery Quest', '31st December, 1988', '&quot;As my apprentice, you have been studying a long time to master the secrets of magic. Now the time has come to prove yourself. You must journey to the four Mystery Castles in search of four magic talismans. You will face many perils along the way: the castles are riddled with underground passages and intricate mazes, where you may become lost forever! And strange creatures prowl the castles, ready to pounce upon you when you least expect it! But you will find magic powers hidden along the way, to help you in this Mystery Quest. The magic talismans you seek are the greatest gifts known to man: wealth, wisdom, happiness, and peace. Go now, complete your quest, and prove that you are as great a wizard as I!&quot;', 'M', 944, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ylenuobhhmswuahd8hte.jpg'),
(11, 'Mystery World Dizzy', '6th May, 2017', 'Join Mega-Star DIZZY and the YOLKFOLK in their latest Adventure in Mystery World! Incredible Dragons\' Lairs, Wizard\'s Cloud Castle, the Evil King\'s Palace and Dungeons, Mysterious new Worlds, Volcanoes and more! Featuring over 50 rooms to explore!', 'M', 945, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zleuzxiqtezlqsv3yqpu.jpg'),
(11, 'Puss \'n Boots: Pero\'s Great Adventure', '1st February, 1990', 'Pero is Puss N\' Boots of storybook fame and he\'s caught up in a whirlwind adventure, traveling through time and around the world! True-blue Pero has been &quot;cat-apulted&quot; back through time by the terrible Count Gruemon. Now Pero must cross many dangerous lands to defeat Count Gruemon and recover the Time Machine which will return Pero home. It\'s a &quot;cat-astrophe!&quot;', 'P', 946, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/aahjewjosfapceapjbt6.jpg'),
(11, 'Nakajima Satoru: F-1 Hero', '9th January, 1989', 'Superstar Nakajima Satoru (Michael Andretti in Western versions) personally guides you through the perilous and exciting world of Grand Prix Racing! Four of the most powerful racing machines are your to command on 16 famous international Grand Prix courses from around the globe! Hone your driving skills or challenge the best - it\'s all up to you in this amazing simulation of Formula One racing!', 'N', 947, 0, 2.5, ''),
(11, 'Nakayoshi to Issho', '10th January, 1994', 'Nakayoshi to Issho is an Adventure game, published by Yutaka, which was released in Japan in 1993.', 'N', 948, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mvlrukhe0ng4ngjqsnsg.jpg'),
(11, 'Namco Classic', '27th June, 1988', 'Namco Classic (ãƒŠãƒ ã‚³ã‚¯ãƒ©ã‚·ãƒƒã‚¯?) is a golf game developed by Namco and published for the Famicom in 1988. The game features Round Play, which you can use to practice the course in the game or compete with friends, or Tournament mode, where you play against a computer opponent in an effort to win a large amount of prize money. The game was also released for the Game Boy in 1991. The Game Boy version features a different course but is very similar in many respects. In 1996, that version was also included in the compilation title, Namco Gallery Vol. 1.', 'N', 949, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wb4iifjvonagsjwsdlek.jpg'),
(11, 'Namco Classic II', '13th April, 1992', 'Namco Classic II is a Sports game, developed by TOSE and published by Namco, which was released in Japan in 1992.', 'N', 950, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jcxalnfqqmm9ncdc0ckl.jpg'),
(11, 'Nantettatte!! Baseball', '26th November, 1990', 'A baseball game by Sunsoft released on the Family Computer in 1991. \n \nNantettatte!! Baseball is a baseball game with the innovative feature of being able to update team rosters without needing to buy a brand new full price game. This is done by inserting a mini-cartridge that updates the roster into the main game.', 'N', 951, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qg3ngsxlk1umy9gl9dwl.jpg'),
(11, 'Napoleon Senki', '18th March, 1988', 'Napoleon Senki (ãƒŠãƒãƒ¬ã‚ªãƒ³æˆ¦è¨˜?, &quot;Battles of Napoleon&quot;) is a real-time tactics strategy video game developed by Lenar and published by Irem in March 1988 for the Family Computer. In August that same year, BrÃ¸derbund announced that it would be released for the North American NES console as The Battlefields of Napoleon; which was eventually cancelled. \n \nThis video game allows the player to re-enact the Napoleonic Wars using a bird\'s-eye view. Starting with earliest battles against the Holy Roman Empire to grab territory for the fledging French Republic during the French Revolutionary Wars in the year 1796, Napoleon would guide the French Revolutionary Wars until they ended in 1802. All the nations that were a participant in the Napoleonic Wars were included like Czarist Russia, Great Britain, and the Spanish Empire. Napoleon\'s first in-game battle would located in present-day Italy; making the battle equally important in Italian history as it was in French history. There are also battles in what would now considered to be the Arab Republic of Egypt against the Ottoman Empire along with various other conquests in Europe.', 'N', 952, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ukj3vcjlqe9f55wjhoia.jpg'),
(11, 'Narc', '31st December, 1988', 'Narc is a 1-2 player game, where your mission is to infiltrate the Mr. Big Corporation, the scourge of the underworld. To do this, you must get through the game\'s eight stages, with over ten sectors like the junkyard, subway, drug lab, nursery, downtown, Sunset Strip, and even the corporation, where Mr. Big resides. In order to get through the stages, you are required to collect a number of safe cards, and insert them in the slot next to the stage exit. Each sector includes a map, and should be easy to read. For example, the blue or red dots represent you, and the white dots are the missile launchers, while the &quot;E&quot; indicates the exit.', 'N', 953, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z66lcetikwhpsrtqhmxg.jpg'),
(11, 'Navy Blue', '13th March, 1992', 'Navy Blue is a Strategy game, developed by Use and published by I\'Max, which was released in Japan in 1992.', 'N', 954, 0, 2.5, ''),
(11, 'Nekketsu Kakutou Densetsu', '23rd December, 1992', 'One day at school, Kunio was minding his own business when suddenly, he found a note on his locker. The note says their is a fighting tournament hosted by the &quot;Double Tiger&quot; twins. Seeing it as a challenge he could not refuse, Kunio runs off to participate. When Riki sees Kunio running and read his note, he decides to enter as well. Many other fighters will join in to see who is the strongest.', 'N', 955, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gpnyca7vwmzco6nhtpfy.jpg'),
(11, 'Renegade', '31st December, 1986', 'Unlike Technos\' subsequent game Double Dragon, the playing field is limited to one two-screen-wide area (a subway platform, a harbor, an alley, a parking lot and the hideout of a gang) and does not scroll continuously. Out of the four stages in the game, the first, second and third each begin with the player fighting a group made up of two different types of small fry enemies: one with fewer hit points and a stronger attack (usually armed with a weapon) and one with more hit points, but with a weaker attack and the ability to grab the player from behind, making him vulnerable to other enemies\' attacks. \n \nWhen only three underlings remain (in any combination of the two) their boss will come in from the sidelines and join the fight. When the boss is defeated, any remaining enemies retreat off the bottom of the screen, and the stage ends. The second stage follows this same formula, but begins with a series of enemies riding motorcycles trying to run the player down, and brings in the normal enemies once the bikers have been defeated. The third stage is a gang of women; their boss is a very large woman who cannot easily be knocked to the ground. The fourth stage features a single type of knife-wielding enemy who can kill the player with one hit. Once the player has defeated this first wave of enemies, the main character proceeds to enter a building at the far right of the stage. There, he faces three more knife-wielding enemies and the final boss, a mobster whose gunfire is also deadly with one hit. Once the final boss is defeated, the main character exits the building and is greeted by his rescued girlfriend, who proceeds to give him a kiss. The game then begins the next cycle with an increased difficulty. \n \nIn addition to an eight-direction joystick, there are three buttons; left attack, right attack, and jump. Pressing the attack in the direction the character is facing will punch, while attacking in the opposite direction will perform a rear kick. Jumping, followed immediately by one of the attack buttons, which will perform a jumping kick in the direction of the attack. \n \nPressing the joystick twice quickly either left or right will cause the player to run, at which point attacking in the direction of the run will perform a running punch, jumping will automatically perform a flying kick, and attacking in the opposite direction will bring the player to a sudden halt and perform a back-kick. Pressing down over a downed enemy will make the player sit on top of the enemy, at which point attacking toward the enemy will cause the player to pummel him. The bosses can only be sat on if all normal enemies have been defeated, and unless the boss\' energy level is low enough, he\'ll throw the player off.', 'R', 956, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wc0txeyvwcxfwvkj46ug.jpg'),
(11, 'Nekketsu Street Basket: Ganbare Dunk Heroes', '17th December, 1993', 'To our amazement, Kunio entered the Downtown Quiz and won. Thanks to him, we got a journey to the United States for 15 days as a victory prize. First thing first, Kunio went to see &quot;Johnny&quot; at the Oklahoma high school that he had befriended while in an exchange program. Along for the trip was also Riki, and thanks to him, he entered us into a street basket tournament. Lead us to victory even overseas, Kunio!', 'N', 957, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/k0nu9uehhmilnje8r7jj.jpg'),
(11, 'NES Open Tournament Golf', '29th September, 1991', 'Whether you\'re an aspiring amateur or a professional-class golfer, NES Open Tournament Golf puts you right in the thick of a world-class golf tournament. Select your club, check the wind and the lay of the turf, and then drive your way toward winnings worth over one million dollars! Pick from three tough courses: one in the US, one in Japan, and one in the UK. Practice your strokes, then compete against a friend. For the ultimate challenge, tee off against 36 computerized golfers and compete for top ranking. It\'s all here in NES Open Tournament Golf! So warm up on 18 holes and move up to tournament play. The better the golfer, the bigger the prize. Give it your best shot and go for the big money!', 'N', 958, 0, 2.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pakapvioctqzqpgs04dw.jpg'),
(11, 'NES Play Action Football', '1st February, 1990', 'Nintendo takes its game to the gridiron with NES Play Action Football. While Nintendo did not get the NFL license for this one, it did secure the license of the NFL Player\'s Association, so the 8 teams to choose from (all named after the appropriate NFL cities) are all stocked up with real pro players from the 1989 season. You can even substitute second-stringers for the &quot;skill&quot; positions (QB, RB, WR, TE, and FS/SS) when your starters get tired.', 'N', 959, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wmfrjx799pzg6ez6mmh8.jpg'),
(11, 'New Ghostbusters II', '26th December, 1990', 'The world-wide hit movie is now available on the Nintendo Entertainment System! Capture the ghost that haunted New York City in this comedy-action-adventure. Six stages in all, including a Courtroom, the Subway, the Art Museum and more!', 'N', 960, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/paryllpws45ccby3te5b.jpg'),
(11, 'The NewZealand Story', '31st December, 1988', 'Tiki, a sneaker-wearing kiwi who must save his lover Phee Phee and several of his other kiwi chick friends who have been kiwi-napped by a large blue leopard seal. The player has to navigate a scrolling maze-like level, at the end of which they release one of Tiki\'s kiwi chick friends trapped in a cage.', 'T', 961, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wyh.jpg'),
(11, 'Mahjong G-Men: Nichibutsu Mahjong III', '20th August, 1990', 'Mahjong G-Men: Nichibutsu Mahjong III is a Miscellaneous game, published by Nihon Bussan, which was released in Japan in 1990.', 'M', 962, 0, 2.5, ''),
(11, 'Nigel Mansell\'s World Championship', '31st December, 1992', 'Timing smiled on Gremlin with this licensed Formula 1 simulation, as Nigel\'s long quest for a championship had finally come good. The game was pitched somewhere in between a full-blown simulation like F1 GP and action games like Continental Circus. Only 12 cars were in each race, which could last from between 3 and 20 laps. \n \nBefore each race you can customize wing downforce, gear ratio, tyre selection and fuel load choices â€“ pitstops are a standard feature of the longer races. The 16-bit versions include a unique \'Improve With Mansell\' mode, in which a digitized version of Nigel\'s head appears in the top corner of the screen, offering instructions and praise.', 'N', 963, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dvizt0kte2erddi3hdru.jpg'),
(11, 'A Nightmare on Elm Street', '31st December, 1989', 'A Nightmare on Elm Street is a video game released on the Nintendo Entertainment System in October 1989 and 1990, loosely based on the Nightmare on Elm Street franchise. It was developed by Rare and published by LJN.', 'A', 964, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1yni.jpg'),
(11, 'Wrath of the Black Manta', '17th November, 1989', 'In the game, the player goes through five levels, using throwing stars and special ninjutsu abilities called the &quot;ninja arts&quot;, to stop a gang and the evil mastermind behind a slew of kidnappings, El Toro. One of the kidnapped is a student of the Black Manta\'s sensei, Taro.\n\nThe Black Manta has many powers, which he gets after beating a level. The player can choose which power to use by pressing start. These powers can help the Black Manta defeat enemies and bosses more quickly. The Black Manta can save kidnapped children hidden throughout each level, however, it plays no role in completing the game and does not warrant any kind of special bonus.\n\nPart of the last level is seen through a first person perspective. Towards the end of this stage, the Black Manta has to defeat one of the bosses from the previous levels before he goes face-to-face with El Toro himself.', 'W', 965, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/n4zqf1tj1etkih4lmhon.jpg'),
(11, 'Ninja Crusaders', '14th January, 1991', 'They struck without warning, wiping out the Earth\'s defenses in one master stroke. Cities were crushed, and the invading aliens showed no mercy! A small resistance force of Ninja, refusing to be conquered, still remained to fight the evil Inimicus. A daring plan was devised by the Ancient Ones to send out two special Ninja, and annihilate the alien threat once and for all!', 'N', 966, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fuldmfjkknbwfpul1ipl.jpg'),
(11, 'Ninja Gaiden / Shadow Warriors', '9th December, 1988', 'Ninja Action! The stage is set for conspiracy, mystery and evil in America. Come with Ninja Ryu as he takes you on his fateful journey. Tecmo\'s unique cinema display system develops the story stage by stage. You piece together the puzzle, while watching the movie-like graphics. Decide what action to take. Use the secret sword and items collected during the action scenes to fight your way to the goal!', 'N', 967, 0, 4.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ho0.jpg'),
(11, 'Ninja Gaiden II: The Dark Sword of Chaos', '6th April, 1990', 'The Ninja Ryu is back to avenge the death of his father, and stop the Evil Ashtar.\n\nA year has passed since Ryu last faced his arch enemy, and still the activity down at the bottom of the realm of darkness continues. Ashtar, the evil lord who secretly controls Jaquio, is again on the move, and it is up to Ryu, the &quot;Ninja Dragon&quot; to put a stop to it. Use all of the secrets of the real Ninjitsu, along with the exciting audio and visual special effects and be drawn into the fantasy world of Ninja Gaiden II The Dark Sword Of Chaos.', 'N', 968, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1ki1.jpg'),
(11, 'Ninja Gaiden III: The Ancient Ship of Doom', '21st June, 1991', 'Thrilling new cinema screen! Follow the story of Ryu\'s epic adventure through Tecmo\'s movie-like Cinema Screen Animation. As you complete each level, a new part of the story unfolds. Exciting new powers and weapons! Over the years Ninja Ryu\'s fighting skills have improved to include fantastic new powers and weapons. Action-packed Ninja adventure! Can you get Ryu through his most challenging adventure as he battles the hideous ancient forces of darkness to save mankind? The Ultimate Ninja Challenge!', 'N', 969, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1l1g.jpg'),
(11, 'Ninja Hattori-kun: Ninja wa Syugyou de Gozaru', '4th April, 1986', 'Ninja Hattori-kun (å¿è€…ãƒãƒƒãƒˆãƒªãã‚“?, lit. &quot;Little Ninja Hattori&quot;) is a 1986 video game software developed and published by Hudson Soft for the Nintendo Family Computer exclusively in Japan. It is based on Fujiko Fujio A\'s (the pen name of Motoo Abiko) Japanese manga series of the same name, which later became an anime series and Asian franchise. The game was released around the same time the anime was aired. It was the fifth best selling Famicom game released in 1986, selling approximately 1,500,000 copies in its lifetime. \n \nThe plot begins when a young ninja name Kanzo Hattori was in search of his master in order to complete his training. While searching for his master, he encountered a young 10-year old boy name Ken (Ken\'ichi) Mitsobahis and made him his temporary replacement master, in order to develop Ken\'s confidence, while they went on many adventures together. It was aimed at a young audience the same way as the manga and anime it is based on.', 'N', 970, 0, 2.5, ''),
(11, 'Ninja Jajamaru: Ginga Daisakusen', '21st April, 1991', 'Ninja Jajamaru: Ginga Daisakusen is an Action game, developed and published by Jaleco Entertainment, which was released in Japan in 1991.', 'N', 971, 0, 2.5, ''),
(11, 'Ninja JaJaMaru-kun', '15th November, 1985', 'The game stars the brother of Ninja-kun (from Ninja-Kid). Princess Sakura has been kidnapped by Damazu-Dayuu, and because Ninja-Kun is away on a journey, the task falls to young JaJaMaru-kun. \n \nIn the game, the player starts with three lives and can only run, jump and throw shurikens. The game is divided into stages, each with four floors and eight enemies. Sakura-Hime and Damazu are placed, unreachable, at the top of the screen. Enemies use various projectiles, one of which will cause the player to lose a life. If JaJaMaru-kun lands on top of an enemy, it will simply be temporarily stunned and vice versa. Once an enemy is defeated and offscreen, a spirit will appear and ascend to the top of the screen. It can be collected before it has disappeared to receive points, which vary depending on the enemy. Sakura will sometimes drop petals that the player can collect, and Damazu will sometimes run around, dropping bombs. To advance to the next stage, the player must defeat all eight enemies by using shurikens. \n \nSome bricks yield items. They include: \n \n A cart that temporarily makes JaJaMaru-kun invincible and faster. Projectiles and enemies will also be destroyed if touched. \n A bottled substance that makes JaJaMaru temporarily invincible and able to walk through enemies. \n A red ball that increases speed. \n Bombs (which must be avoided). \n Coins that yield various amounts of points. \n An extra life. \n \nIf all three types of power-ups are collected, Gamapa-kun, a giant frog, will be summoned, which is completely invincible and able to eat all enemies. If three of Sakura\'s petals are collected, the player will go to a bonus stage in which JaJaMaru-kun is on the bottom and Damazu at the top. Damazu drops bombs, and the player throws shurikens upward. If the player manages to hit Damazu, bonus points are awarded. If the JaJaMaru-kun is hit by a bomb, he goes on to the next stage.', 'N', 972, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/q7dzf9wngkoiri9v12xa.jpg'),
(11, 'Ninja-kun: Ashura no Shou', '1st February, 1987', 'The game tells another story in Ninja-kun series. This time itâ€™s a platform game with some twists. There are two tasks alternating through levels: you are required either to kill every enemy in the level (as in the previous games) or simply to reach the exit. Running into enemies usually wonâ€™t kill you, however if you are hit by a single projectile, youâ€™ll have to start from a checkpoint. Enemies vary from plain ninjas to giant skeletons or killer fish. Each level has a time limit, and when this limit is close to an end a fire wheel of death will appear on the screen, chasing Ninja-kun. \n \nNinja-kun has some techniques for successful progression though the levels: many enemies can be temporarily stunned by jumping on them or hitting them from below; and ninja can obtain some power-ups including boomerang, bombs, a devastating fire attack or invincibility. Ninja-kun is capable of wall climbing and wall jumping, the latter requiring some practice from the player. \n \nThe levels (called â€œscenesâ€ in-game) are scattered through mountains, caves, beaches and underwater locations. You can choose which set of levels youâ€™ll start in by playing a mini-game at the beginning.', 'N', 973, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/piczhzhzo6s0aurfpyot.jpg'),
(11, 'Ninja-Kun: Majou no Bouken', '30th September, 1984', 'Ninjakun is on a mission. He alone must climb the mountain and enter Demon Castle and clear out its evil inhabitants. He will face enemies along the way, and must eliminate them before he can progress to the second mountain, and on to the castle. When he succeeds, he must start over at the bottom of the mountain against a tougher group of foes.', 'N', 974, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ko4md0dbkujzslsad4k3.jpg'),
(11, 'Ninjara Hoi!', '7th September, 1990', 'Ninjara Hoi! is a Role-Playing game, developed and published by ASCII Entertainment, which was released in Japan in 1990.', 'N', 975, 0, 2.5, ''),
(11, 'Nintendo World Championships 1990', '31st December, 1990', 'Nintendo World Championships 1990 is a Compilation game, developed and published by Nintendo, which was released in 1990.', 'N', 976, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kwevxeuawbuc0pjcc75k.jpg'),
(11, 'Nintendo World Cup', '18th May, 1990', 'The eyes of the world are upon you. National pride is at stake. Only seconds left and the crowd rises in anticipation of the greatest upset in soccer history. The horn sounds and you\'ve won it all! The coveted world cup trophy is yours! Pick your team and plan your game strategy. Use advanced super moves like the Bicycle Kick or the Super Header. Choose from 13 teams, representing countries from around the world. Defeat your opponents and you\'re on your way to the prestigious world cup final. Bring the excitement of international soccer home with Nintendo World Cup!', 'N', 977, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nmgib2xl9xkplfeebpti.jpg'),
(11, 'Nishimura Kyoutarou Mystery: Blue Train Satsujin Jiken', '20th February, 1989', 'Nishimura Kyoutarou Mystery: Blue Train Satsujin Jiken is a mystery game released for the Nintendo Famicom in 1989. \n \nNishimura Kyoutarou Mystery: Blue Train Satsujin Jiken (&quot;Kyoutarou Nishimura Mystery: Blue Train Murder Case&quot;) is the first game in a series of murder mystery adventure games based on novels by famed Japanese mystery author Kyotaro Nishimura. It was developed by TOSE and published by Irem on the Famicom in Japan only. Along with other similarly themed franchises such as Tantei Jinguuji Saburo and Yamamura Misa Suspense, it invites players to solve the mystery by talking to witnesses and suspects and interacting with the environment to discover who is behind the murder. \n \nKyotaro Nishimura\'s novels tend to focus on murders that occur on or around trains with this game being no exception. A body is found on a Blue Train - the name given to Japanese cross-country sleeper trains, i.e. those built to accommodate sleeping passengers - and the player character is brought in to solve the mystery.', 'N', 978, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fj9bhgakatyuqzrro7dl.jpg'),
(11, 'Nishimura Kyoutarou Mystery: Super Express Satsujin Jiken', '1st April, 1992', 'Nishimura Kyoutarou Mystery: Super Express Satsujin Jiken is an Adventure game, developed by TOSE and published by Irem, which was released in Japan in 1990.', 'N', 979, 0, 2.5, ''),
(11, 'Noah\'s Ark', '31st December, 1983', 'Noah has been commanded by God to put two of each animal aboard his ark to save them from the flood. However unhappy people from around the world have captured different animal species, preventing Noah from doing his job. Noah will need to visit these different locations and free the animals from the people holding them captive.', 'N', 980, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dji7oav9eztgyllsgfta.jpg'),
(11, 'Nobunaga\'s Ambition', '1st December, 1986', 'Nobunaga\'s Ambition, the first of the series, was released in 1983. Players assume the mantle of either Nobunaga Oda or Shingen Takeda and strive to conquer the entire land (17 areas in the Kansai and central Japan region). They manage their country to make it rich, then prepare their military forces. These then attack and defeat surrounding Clans in battle.', 'N', 981, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bjembdjc0lwow2dvqjzl.jpg'),
(11, 'Nobunaga\'s Ambition II', '1st December, 1988', 'Nobunaga\'s Ambition II is the sequel to Nobunaga\'s Ambition. The setting is 16th century feudal Japan, a period when ruthless daimyo (feudal lords) contended with each other for dominance. Ultimately, the winner in this struggle will become Shogun and hold actual power over the islands, while being nominally subject to the Emperor. \n \nThe game casts the player as one of the daimyo, allowing them freedom to decide the fate and future of feudal Japan, through diplomacy and ultimately war. The objective is to unify Japan under the player\'s rule. If the player fails through death on the battlefield, assassination at the hands of a ninja, or through natural causes, they can choose a successor and play on. Functionally, the first job is to let prosper the fief (province) under the player\'s control through agricultural development and town investment.', 'N', 982, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ky6bmddjjsskuexkfps2.jpg'),
(11, 'North &amp; South', '31st December, 1989', 'Your objective is ensure victory for your side by eliminating all the enemy armies. You will be controlling armies across all the combat zones of the Civil War. You may respect history or not, as you like. North and South does not try to reconstitute history and places playability over realism, it only tries to emulate the atmosphere and overall strategic conditions of the Civil War. Thus, as in reality, the player may choose to advance deep into the South or North, to attack in the center or to attempt a turning movement. \n \nThis game can be played against computer or between two human opponents. You can also choose between a full strategic mode without the arcade parts or use the arcade mode during the fights, which allows you to directly control your own units.', 'N', 983, 0, 3.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/slkayo7b2vifl5m4zm9j.jpg'),
(11, 'Oeka Kids: Anpanman no Hiragana Daisuki', '26th April, 1991', 'An educational game to teach children Hiragana. \n \nOeka Kids: Anpanman no Hiragana Daisuki is a Miscellaneous game, developed by TOSE and published by Bandai, which was released in Japan in 1991.', 'O', 984, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/etkzjig6nyd6uqnhssvz.jpg'),
(11, 'Oeka Kids: Anpanman to Oekaki Shiyou!!', '25th October, 1990', 'Tablet-based drawing game. \n \nOeka Kids: Anpanman to Oekaki Shiyou!! is a Miscellaneous game, developed by TOSE and published by Bandai, which was released in Japan in 1990.', 'O', 985, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mzrxipvjelk1lrkzdccs.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Onyanko Town', '21st November, 1985', 'Players must play the role of a mother cat called Milky who lives in a dangerous metropolis full of dogs. The dogs want to kill Milky before she can rescue her son Michael who wandered out into the city on his own (and became lost). Players must catch the fish for temporary invincibility. However, the other enemies can still kill the mother cat like the fish merchant (who is the only humanoid bad guy in the game), the automobiles on the road, along with the manholes and the pylons. The city is divided into roads for automobile traffic and sidewalks for roaming pedestrian dogs in overalls. The fish merchants completely replace the dogs after the 30th level; causing the invincibility icon (fish) to become redundant. \n \nUnlike the Teenage Mutant Ninja Turtles series of video games (especially the first NES release which would come out four years later in 1989), open manholes kill the player instead of helping her evade the roaming dogs. Sewer snakes also come out to kill the player with its poisonous venom. Triangle cones can momentarily block progress for the player. The game was targeted to a much younger audience than was considered to be &quot;average&quot; in the Nintendo Entertainment System community during that era. Using the classical music song Ballet des poussins dans leurs coques (composed by Modest Mussorgsky) as the background music, there is a common theme throughout the game of &quot;dog catches cat; cat catches fish&quot; - emulating the food chain.', 'O', 986, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hl3jzc1xvrhpidkkfyzs.jpg'),
(11, 'Operation Secret Storm', '31st December, 1992', 'After a briefing of the Gulf War situation, Agent George, a Top CIA agent, is being sent to the Middle East. Your mission is to save all oil refineries in the Gulf, and stop further production of CBW (Chemical and Biological Warfare) weapons. You are expected to engage in combat with Saddam and his men. To complete the mission, you must use every skill and determination to defeat Saddam. Remember, many lives are at stake.', 'O', 987, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d97w7n6roxmmaprhb96i.jpg'),
(11, 'Operation Wolf', '1st November, 1987', 'In the steamy jungles of South America, heavily armed extremists are holding innocent civilians prisoner. Little do these terrorists know that real terror is about to land on their front porch! The sound of rotor blades and staccato bursts of gunfire echo through the valleys. Terrorists be warned! Operation Wolf is going to teach you what terror is all about! \n \nOperation Wolf consists of six missions, which are displayed on the Operations Map Screen. A mission is completed when all enemy forces are reduced to zero. The current level is completed when you escape from the airport with the prisoners. Your injury level increases when the enemy hits you. The game automatically ends if the injury indicator on the right side of the screen becomes completely red. You can reduce your injury level by getting power drinks.', 'O', 988, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xisdlkszld0lwoese2za.jpg'),
(11, 'ORB-3D', '1st November, 1990', 'You are about to face the challenge of your lifetime. The evil wizard, Krohn, has threatened to engulf the galaxy in an enormous Black Hole. Your best hope for survival lies with the Millenium Orb, the only ship capable of withstanding the Black Hole\'s gravitational forces. Dive into the Black Hole and battle Krohn, face to face. But to reach the Wizard, you must master 30 mystical puzzles that test your skill, wits, cunning and courage at every turn. You\'ll battle the power of black magic as you attempt to reach Krohn\'s lair for the ultimate confrontation. Mind-boggling challenges await you as you fly the Orb into the depths of the Black Hole and the very face of destruction.', 'O', 989, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/apuqem0yx4dhndb9m3ef.jpg'),
(11, 'Osomatsu-Kun: Back to the Me no Deppa no Maki', '8th January, 1990', 'The second game based on the Osomatsu-kun anime and manga, released in 1989 for Famicom. \n \nOsomatsu-Kun: Back to the Me no Deppa no Maki is an Adventure game, developed by TOSE and published by Bandai Shinsei, which was released in Japan in 1989.', 'O', 990, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eqiujyaznawhnln5bqwq.jpg'),
(11, 'Otaku no Seiza: An Adventure in the Otaku Galaxy', '31st August, 1991', 'Otaku no Seiza tells the story of Fuyuu City, a place built in space far in the future. Aurora, a group of five attractive and powerful women, control the city. Men in the city are treated poorly compared to women, until the protagonist finds himself in the middle of the city with amnesia. Outraged, the protagonist decides to defeat Aurora and gain rights for the discriminated men of the city.', 'O', 991, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gj2gavk0towozuhsg2ad.jpg'),
(11, 'Othello', '13th November, 1986', 'Othello is a conversion of the board game. It was developed by Kawada and published by HAL Laboratory for the Famicom Disk System in Japan.', 'O', 992, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s12vwohzy6jg9ychx38k.jpg'),
(11, 'Outlanders', '4th December, 1987', 'In the midst of a violent invasion of Earth by unknown alien forces, photojournalist Wakatsuki Tetsuya comes across a scantily-clad alien woman, cutting a swath of death through the Terran ranks with her sword. After a chaotic struggle, Tetsuya is knocked unconscious, only to awaken aboard her starship. To his surprise, she turns out to be Kahm, the invaders\' princess - and she has picked Tetsuya for a starring role in her upcoming wedding. As the groom....', 'O', 993, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/v89cbez17gwiximkieft.jpg'),
(11, 'Over Horizon', '26th May, 1991', 'Over Horizon is a Shoot-\'Em-Up game, developed by Pixel and published by Hot-B, which was released in Europe in 1991.', 'O', 994, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/or5mp3uc2paphfvxspar.jpg'),
(11, 'Overlord', '31st December, 1992', 'Overlord is a real-time strategic warfare game where the player must manage large standing armies, economic capital, and political stability throughout a number of extra-dimensional star systems. \n \nAs the dictatorial ruler of the Epsilon Galaxy, the player has obtained complete, indisputable authority. However, during a scientific experiment in hyperdrive technology, Epsilon scientists discovered four &quot;buffer&quot; dimensions, each containing a number of barren planets that exist between the Epsilon Galaxy and another alien dimension. Unfortunately, the most powerful empires from these alternate dimensions have also just discovered these zones through their own experiments. The player must battle these alien species for control of these buffer worlds, to ensure that their rule in the Epsilon Galaxy remains intact. \n \nTo make the new planets useful in the player\'s campaign, they can purchase terraforming equipment which can transform them into tropical Gaian-esque worlds which are ideal for agriculture, mineral-rich and heavily volcanic worlds, desert planets capable of producing vast amounts of energy, or ecologically balanced planets that can support large cities which are readily able to generate significant income through taxation. In addition, the player can mine for resources and tax their citizens to raise money, construct spaceship-buildings to feed the populace, enlist soldiers and equip them, buy battle cruisers or other craft to move from planet to planet, and so on. The player can fight battles, colonize planets, and even spy on alien races. The end goal is to ensure that the other alien races do not gain the upper hand by conquering these four new dimensions before the player can. \n \nThe player cannot retreat from battle, as the only way to shut down the hyperspace link from their universe to Epsilon would be by vaporizing the player\'s homeworld, which is where the hyperspace generator is located. Politically (at the very least), this is not an option. \n \nBlood will have to be shed for supremacy of the hyperspace planets, and for the player to become Overlord of these four new dimensions plus their own.', 'O', 995, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1nul.jpg'),
(11, 'P.O.W. Prisoners of War', '31st December, 1988', 'The arcade version of Prisoners of War can be played by up to two players simultaneously, In La Havana, Cuba Player 1 controls a prisoner dressed in blue named Snake, while Player 2 controls one in red named Bart. The objective is to escape from the enemy\'s base by fighting their way through four stages filled with numerous soldiers trying to impede the player\'s escape. The stages consist of a POW camp, a warehouse, a jungle, and the enemy\'s base. Enemies includes foot soldiers, commandos, and green berets. \n \nThe controls consists of an eight-way joystick for moving the character and three action buttons for punching, kicking, and jumping. here are also three special attacks performed by pressing two buttons in combination: a jump kick (jump, and then kick), a back punch (jump and punch simultaneously), and a headbutt (punch and kick simultaneously). \n \nThe player can also pick up one of two weapons dropped by defeated enemies: a throwing knife and a machine gun. When wielding the machine gun, the player can fire it by pressing the kick button or conserve its ammo by pressing the punch button to gun whip enemies.', 'P', 996, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mwp9mftpl4mwem9amvnj.jpg'),
(11, 'Pac-Land', '1st August, 1984', 'Pac-Land itself is split into trips. In each of these trips the objective is to get the fairy (that is kept under Pac-man\'s hat) to Fairyland and also to return home to Pac-Man\'s house. The majority of the trip involves moving from left to right avoiding various obstacles such as the enemy ghosts, water spurts and quicksand traps. Each trip is divided into a number of rounds, the end of which provides Pac-Man with bonus points depending on how much time he has left and also his position in jumping at the end of each round. If the player runs out of time before finishing the round, Sue, the purple ghost, will speed up rapidly. \n \nThe penultimate round of a trip ends with Pac-Man entering Fairyland and returning the fairy under his hat to the Fairy Queen. In return the Fairy Queen gives Pac-Man magic boots. For the final round of the trip, Pac-Man has to travel from right to left back home. For assistance he uses the magic boots, which allow him to jump repeatedly while in mid-air. Once Pac-Man completes the trip, he is greeted by Ms. Pac-Man and Baby Pac-Man. In the US release of the game, Pac-Man\'s cat and dog in the cartoon series, Sour Puss and Chomp-Chomp, are also there to welcome Pac-Man home. Pac-Man then begins his next trip following the same objectives as before, although the difficulty increases. \n \nAs in the original Pac-Man, there are fruit which appear to eat for bonus points and power pellets to turn the ghosts blue and vulnerable. A hidden item (sometimes accidentally dropped by the ghosts) is a Flagship from Galaxian, which rewards 7650 points when collected (a reference to Namco\'s goroawase number of 765). The Galaxian Flagship is a long running cameo that appears in the Namco-made Pac-Man games. There are also hidden bonuses in the game, eating ghosts in a certain order will give extra time and pushing an obstacle in the opposite direction can give extra lives, invincibility, and balloons to collect for points and warps.', 'P', 997, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fnqptyfczupyp0xyj5qg.jpg'),
(11, 'Pac-Mania', '30th November, 1987', 'Pac-Mania is a variation on the game Pac-Man. You need to guide Pac-Man around a maze and eat all of the dots on the board in order to proceed on to the next round. Numerous, multi-colored ghosts also roam the maze trying to stop you. If you eat one of the power pellets in the maze, the ghosts will temporarily turn blue and run from you. Pac-man can earn bonus points by eating the ghosts when they are in this state. The maze is now in 3-D and is larger than screen which will scroll to follow the action. To help get out of tight spots, Pac-Man now has the ability to jump. But be careful, because some of the ghosts have learned this trick as well and you could end up in a mid air collision!', 'P', 998, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1mu7.jpg'),
(11, 'Pachi-Slot Adventure 3: Bitaoshii 7 Kenzan!', '12th June, 1994', 'Pachi-Slot Adventure 3: Bitaoshii 7 Kenzan! is a Miscellaneous game, developed by Aisystem Tokyo and published by Coconuts Japan, which was released in Japan in 1994.', 'P', 999, 0, 2.5, ''),
(11, 'Pachinko Daisakusen 1', '19th August, 1991', 'Pachinko Daisakusen 1 is a Miscellaneous game, developed by Color Dreams and published by Coconuts Japan, which was released in Japan in 1991.', 'P', 1000, 0, 2.5, ''),
(11, 'Pachinko Daisakusen 2', '19th August, 1992', 'Pachinko Daisakusen 2 is a Miscellaneous game, developed by Color Dreams and published by Coconuts Japan, which was released in Japan in 1992.', 'P', 1001, 0, 2.5, ''),
(11, 'Palamedes', '6th July, 1990', 'Juego de puzle del desarrollador Taito.', 'P', 1002, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vsohu63vxco6zctwab1x.jpg'),
(11, 'Panic Restaurant', '24th May, 1992', 'Hot dogs on legs, jumping eggs, flying apple slices, hungry hamburger buns, pans shooting fried shrimp - WHAT\'S GOING ON?? Ever since the mad chef, Ohdove, stole the Eaten Restaurant from Cookie, strange things have been happening! To win back the Eaten, Cookie must face a restaurant that has come to life! Mutant food and appliances are just eager to cook Cookie! But Cookie knows his way around a restaurant, so armed with just a few simple kitchen tools, he is going to challenge Ohdove and the army of mutants!', 'P', 1003, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dsyojsq7ybpm970iybqk.jpg'),
(11, 'Paperboy', '31st December, 1985', 'Paperboy is a 1985 arcade game by Atari Games originally developed in 1984 . The players take the role of a paperboy who delivers newspapers along a suburban street on his bicycle. The game was ported to numerous video game consoles and personal computers. The Nintendo Entertainment System (NES) version represented the first NES game developed in the United States and coincidentally, the Sega Master System version represented the first SMS game developed in the United Kingdom. Paperboy was innovative for its theme and novel controls. \n \n \nGAMEPLAY: \nThe player controls a paperboy on a bicycle delivering newspapers along a suburban street which is displayed in a cabinet perspective (or oblique projection) view. The player attempts to deliver a week of daily newspapers to subscribing customers, attempts to vandalize non-subscribers\' homes and must avoid hazards along the street. Subscribers are lost by missing a delivery or damaging a subscriber\'s house. \n \nThe game begins with a choice of difficulty levels: Easy Street, Middle Road and Hard Way. The object of the game is to perfectly deliver papers to subscribers for an entire week and avoid crashing (which counts as one of the player\'s lives) before the week ends. The game lasts for seven in-game days, Monday through Sunday. \n \nControlling the paperboy with the handlebar controls, the player attempts to deliver newspapers to subscribers. Each day begins by showing an overview of the street indicating subscribers and non-subscribers. Subscribers and non-subscribers\' homes are also easy to discern in the level itself, with subscribers living in brightly colored houses, and non-subscribers living in dark houses. \n \nDelivering the papers \nThe paperboy begins his route at the start of the street (bottom of the screen) and progresses towards the end. The player can control the paperboy\'s speed, but the paperboy is in constant movement and cannot stop moving forward until the level (day of the week) has ended. Should he slow down or stop for more than a few seconds, a swarm of bees will appear (arcade version only). For each paper that is delivered to a subscriber\'s mailbox, the player receives 250 points. If the paper is delivered to the subscriber\'s doorstep, the player receives 100 points. Points are multiplied x2 for playing \'Middle Road\', and x3 for playing \'Hard Way\'. Points can be gained for breaking plants, running over flowers, or throwing papers into windows of the non-subscriber houses. \n \n \nIn Paperboy, the player attempts to deliver newspapers to subscribers along a suburban street. \nThe primary objectives of the game are to keep as many subscribers as possible and to stay alive. Secondary objectives include vandalizing non-subscribers\' homes and hitting nuisances with newspapers. \n \nKeeping subscribers is fairly straightforward: the player must deliver a paper to them. While the player may deliver more than one paper to each customer, they have to avoid accidentally damaging their homes, such as by throwing a paper through a window. Delivering a newspaper directly into the customer\'s newspaper box (or mailbox, as the voiceover calls it) earns bonus points. Accidentally damaging a customer\'s home or failing to deliver a paper causes the customer to cancel his subscription and may cause him to set traps for the paperboy the next day. In more advanced rounds, the homeowner may immediately run after the paperboy after the house is damaged. \n \nThe player must stay alive by avoiding obstacles that appear along the street. Some obstacles include everyday nuisances such as fire hydrants, storm drains, break dancers, cars, skateboarders, drunks, kids with radio controlled toys and even rather bizarre foes such as a tornado, oversized house cats, and even the Grim Reaper himself. The player must also cross street intersections successfully (which gets harder each day). Some obstacles can earn the player bonus points. For example, the breakdancer and some men brawling in the street can be &quot;smacked&quot; with a newspaper for extra points. Running into any of the obstacles with the bike results in the loss of a life. \n \nThere are two types of collisions possible from running into obstacles, &quot;%#@*!&quot; and &quot;SMACK!&quot; The former results from hitting obstacles that are integral parts of the landscape, such as fire hydrants, fences, and signposts. The latter collision type comes from obstacles not integral to the landscape: cars, people, dogs and bees. \n \nAlong the way, the paperboy can pick up extra bundles of papers since he can carry only a limited number. These are sometimes located in difficult to reach spots. \n \nA \'Perfect Delivery\' is achieved by successfully delivering to all current subscribers. This award doubles bonus points for each house delivered to, as well as reinstating one lost subscriber - up to a maximum of 10 out of the 20 houses being subscribers. If a \'Perfect Delivery\' is achieved when the player already has 10 subscribers, double bonus points are still', 'P', 1004, 0, 2.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y1ad39sesw16yhq8w2zw.jpg'),
(11, 'Paperboy 2', '31st December, 1991', 'You\'re a paper boy. Get on your bicycle. Avoid obstacles on the road, such as dogs, cars, and basically everything you can imagine. Hell, some people shoot cannon balls at you! And you\'d better be very sure to only throw papers at the right houses! (and at people, that\'s fun :)', 'P', 1005, 0, 3.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ubkupgmpujcritucyvc5.jpg'),
(11, 'Parallel World', '9th September, 1990', 'Parallel World (ã±ã‚‰ã‚Œã‚‹ãƒ¯ãƒ¼ãƒ«ãƒ‰?) is a puzzle video game developed by EIM and published by Varie. It was released in Japan for the Family Computer on August 10, 1990. \n \nThe player and his girlfriend must find their way back home after being sucked into an alternate universe. \n \nA magnificent castle full of 25 different game worlds block their progress, however, and they are filled with enemies on every stage. The player has an overhead view to destroy the enemies for extra loot. Given a strict time limit of 100 seconds to solve each puzzle, the game rewards fast puzzle solvers. The first player controls the male while the second player controls the female. Players only start with three lives and lose them when time runs out or when a monster comes into contact with him/her. \n \nEnemies in the game include springs, rollers, witches, and zombies.', 'P', 1006, 0, 2.5, ''),
(11, 'Parasol Stars: Rainbow Islands II', '1st February, 1991', 'Get ready for some finger-searing action as Bub and Bob blast their way onto your computer screen. Use four kinds of elements - Fire, Water, Lightning and Star - to overcome wave upon wave of nasties bent on ending your quest to rid the universe of the evil mastermind Chaostikahn! Whether you play alone or with a friend, stay alert! Your only hope of reaching the final showdown is to unlock the secret of Parasol Stars!', 'P', 1007, 0, 3.45, ''),
(11, 'Paris-Dakar Rally Special!', '1st March, 1988', 'A NES game based on the famed Paris-Dakar Rally, developed by ISCO. While ostensibly a racing game, the style of gameplay tends to change per level. \n \nParis-Dakar Rally Special! is an unusual racing game in which the player must successfully win the Paris-Dakar Rally. However, in order to do so, the player is faced with a wide variety of odd challenges to overcome, a scant number of which actually involve racing. \n \nDeveloped by ISCO for the NES, Paris-Dakar Rally is notorious for its bizarre structure. Depending on who is asked it is either a testament to the NES library\'s occasionally creative and off-beat ingenuity, or a legendary &quot;kusoge&quot; (crap game). \n \nStage 1 - Preparation \nIn the first stage the player is without vehicle. In order to race in the Paris-Dakar Rally, the player must first acquire a sponsor, some money, a car and a navigation partner. In order to achieve these objectives, the player must walk around town and talk to the right order of sponsors, executives, bank tellers and rally co-ordinators to begin. Once the car has been purchased and a navigation partner chosen (which is resolved with a fast reactions mini-game), the player can take a plane to Paris to begin the rally. \n \nStage 2 - First Day \nThe first day races most closely resemble an actual racing game. The player has a top-down view of a vertically-scrolling track and must control the car\'s speed and direction with the D-pad. In order to qualify for the next stage of the event, the player must make it through the course within a time limit while dodging hostile vehicles from behind and in front. Losing three lives restarts the stage. \n \nStage 3 - Second Day \nThis mode more closely resembles the Arcade game Rally-X. The player must maneuver and corner around the Parisian streets in order to avoid rival drivers. They can distract pursuing CPU opponents by dropping rubber balls (possibly tires) behind the player\'s car to deter them. \n \nStage 4 - Third Day \nThe action changes to a side-scrolling perspective and now the player must contend with birds dropping deadly eggs, bridges that collapse once driven on, rolling boulders, fires and other obstacles on the racecourse. Occasionally, the player will need to leave the vehicle in order to hit a switch to extend a bridge before they can continue. \n \nStage 5 - Fourth Day \nAs the player is on a variant of the Paris-Dakar course that will inconveniently cross a major sea, the player must steer their car-boat over and under the ocean and avoid various hostile sea creatures and jagged rocks. \n \nStage 6 - Fifth Day \nInto the Dakar desert, the player must drive vertically up the screen while avoiding vicious desert animals like snakes, scorpions, spiders, camels and other hostile racers. The player must also contend with some narrow walls and a section where they must cross between two rafts. \n \nStage 7 - Sixth Day \nAt some point between starting the race and the sixth day, World War 3 broke out and the player must use their newly mounted machine guns to take down the enemy aircraft and tanks between them and the finishing line. \n \nStage 8 - Final Day \nThe Dakar finish line is just ahead, all the player must do is survive a gauntlet similar to that of the First Day. As with that stage, the player must be alert for other racers all around them and make it to the end within the time limit.', 'P', 1008, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dvfvzrjnzwgmo4nmccyr.jpg'),
(11, 'Parodius! From Myth to Laughter', '30th November, 1990', 'A shoot\'em up arcade game and the second title in the Parodius series.', 'P', 1009, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/clsylvwqsx1ygvokbk0g.jpg'),
(11, 'Parody World: Monster Party', '12th August, 2014', 'Parody World: Monster Party is the Japanese release of Monster Party, and was originally intended to be much darker and more morbid than the relatively light-hearted version that was ultimately released to American gamers. No version of the game was ever released in Japan. The unreleased Japanese Famicom version was leaked online in 2014.', 'P', 1010, 0, 2.5, ''),
(11, 'Peek-A-Boo Poker', '2nd June, 1990', 'FULL HOUSE FRANCINE \nPOKER PENNY \nDOUBLE DEALING DEBBIE \n \nRelax while you step into a world of game and women. The poker gremlin will help you find satisfaction from a game of cards. Carefully make your calls, for they determine everything you can possibly imagine.', 'P', 1011, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ojfqjisyani3fo6subzl.jpg'),
(11, 'Peepar Time', '9th September, 1990', 'Peepar Time is a Puzzle game, developed and published by Sanritsu Denki, which was released in Japan in 1990.', 'P', 1012, 0, 2.5, ''),
(11, 'Arctic Adventure: Penguin &amp; Seal', '1st February, 1989', 'Go North to the Arctic and meet Mr. Penguin. He is one of the great pioneers of the icy climate and if I may say so, a survivor. \nHis game is collecting diamonds scattered in the coldest corners of the globe. Guide Mr. Penguin through each round and help him with his diamond collection. \nYou must collect all the diamonds and stash them safely in your igloo. Watch out! Those nasty seals have tusks as sharp as blades. If you can\'t crush them with a block of ice I suggest you dive out of their way. \nHang on! This is only round No. 1. Now let\'s try getting through to round No. 50. If you manage to get through all of that, how about constructing your own personal custom-tailored round. Good luck!', 'A', 1013, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kcvb9yh2fz5bte7xwppf.jpg'),
(11, 'Home Run Nighter: Pennant League!!', '1st May, 1989', 'Home Run Nighter: Pennant League!! is a Sports game, developed and published by Data East, which was released in Japan in 1989.', 'H', 1014, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uwideayqf4p1cqm6jv3i.jpg'),
(11, 'Home Run Nighter \'90: The Pennant League', '23rd August, 1990', 'Home Run Night \'90: The Pennant League is a Sports game, developed and published by Data East, which was released in Japan in 1990.', 'H', 1015, 0, 2.5, ''),
(11, 'Perman Part 2: Himitsu Kessha Madoodan wo Taose!', '20th January, 1992', '&quot;Paaman (or quite possibly Parman) is a comic in Japan which is done by the same guy who did Doraemon. Like that wasnâ€™t already obvious just by looking at â€˜em. All of the four characters that you have the choice of controlling have the amazing ability to fly in an amazingly awkward fashion. I donâ€™t think thereâ€™s any difference in who you want to pick though. Whatâ€™s awkward about flying is, if youâ€™re flying Up and want to go Left, you donâ€™t just automatically go Left when you hit the control padâ€¦ you go diagonally, then you go left. And you donâ€™t sit still if you let go of the control pad, you have to hit A to stop. And then you have to hit A again to fall to the ground and walk around like normal. Which is all very weird. But you can jump REALLY high, so thatâ€™s cool. \n \nThereâ€™s a side view, where you can fly, like what I was just talking about, and thereâ€™s a top view, where you walk around inside of buildings and stuff. You canâ€™t fly though, but you can jump, which is pretty useless. Whatâ€™s cool about this game is the sheer amount of fun crazy bonus rooms you can go into. Iâ€™ve found the â€œfly-around-and-break-crates-for-a-whileâ€ fun bonus room, and the â€œjump-around-on-these-tiles-but-they-break-after-you-jump-off-so-you-can-only-jump-on-each-tile-onceâ€ fun bonus room. And sometimes at the end of these rooms you can earn neat stuff, like new weapons or weapon upgrades. Sure beats your crappy punch.&quot;', 'P', 1016, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jgudfxqvnyuosuoucrmj.jpg'),
(11, 'Pesterminator: The Western Exterminator', '1st February, 1990', 'Have a smashing good time! When you\'re bugged by nasty pests, it\'s time to call Kernal Kleanup, the familiar character from Western Exterminator. Ronnie, the super rat, and his friends are pushing for a hostile takeover and their territories cover Houses, Office Buildings, Warehouses, Hotels, Swamps, and even the Moon. Watch out bugs, PESTERMINATOR has a big surprise waiting for you!', 'P', 1017, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pbpod5t5yjmabzccevog.jpg'),
(11, 'Phantom Fighter', '16th September, 1988', 'Wacky Chinese phantoms, Kyonshies, are on the loose, wreaking havoc in eight villages. Phantom Fighter and his incompetent assistance are the only ones who can save the villagers from these zombie ghosts that get bigger and stronger as you get better. Answer tricky quizzes to acquire special skills from the Kung Fu Master. Then you can chop and kick your way to victory! \nBased on the movie &quot;Mr. Vampire&quot;. \n \n-Over 15 types of powerful enemies \n-Sophisticated animation with smooth movement \n-Password memory feature for continuing play \n-Exciting full sound effects \n-Fun-filled dialogue and bonus quizzes \n-Eight villages filled with mysterious ghost-filled houses, cemeteries and academies', 'P', 1018, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ln1urcdksmyjm2lfnbya.jpg'),
(11, 'Pictionary: The Game of Video Quick Draw', '1st August, 1990', 'The excitement of one of the America\'s most popular party games comes to the NES with Pictionary. Not only are the elements of the board game there, but so are several picture-based mini-games. Additionally, this version can be played solo, whereas the board game requires at least three people. \n \nThe basic objective of Pictionary is for a person on a team to try and illustrate a word he or she has been given using only drawings. The team must guess what is being illustrated within a certain amount of time. As a reward for guessing the puzzle correctly, the team gets to advance on a board. The team that makes it to the end of the board first wins. \n \nIn addition to the classic drawing aspect to the game, there are also four mini-games to be played in order for a team to win. These include &quot;Attack of the Paint Zombies&quot; (similar to Space Invaders), &quot;The Warehouse Shuffle&quot; (moving crates from one side of a warehouse to another as gremlins try to steal them), &quot;Four Alarm Rescue&quot; (catching people as they jump out of windows), and &quot;Leapin\' Energy Casules!&quot; (capturing energy balls to fuel your spaceship). \n \nThere are also other game modes that enable you to use cards you may have for an actual Pictionary board game or a practice mode enabling you to simply draw.', 'P', 1019, 0, 2.5, ''),
(11, 'Pinball', '2nd February, 1984', 'This cute pinball simulator was one of the first video games of the genre and still holds dear to many NES owners. Just as on a real pinball table, your goal is to flip the ball up and never let it fall off the bottom. How many points can you get?', 'P', 1020, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f7twcmvcbgfkjt1blpgx.jpg'),
(11, 'Pinball Quest', '30th July, 1990', 'Don\'t let the name fool you - Pinball Quest is much more than video pinball. In fact, it\'s the first-ever multi-screen fantasy in a pinball format! Every move you make tells a story; every shot takes you another step closer in your quest to rescue the captive princess of the castle. Along the way you\'ll meet ghosts, goblins, witches and demons, in an endless labyrinth of treacherous passages and deadly doorways. It takes a fearless heart and a fast mind to conquer Pinball Quest. It also takes the skills of a true pinball wizard... which you can hone on the three other video pinball games included on this cartridge! So before you pour any more money into your NES library, get the one title that\'s a library all by itself! No matter how hard you try, you can\'t get enough of Pinball Quest!', 'P', 1021, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/afyhyz9hccqdbk5gs46e.jpg'),
(11, 'Pipe Mania', '1st June, 1989', 'Your goal in this game is to build pipes. The water flows in the pipes and you have to build them as fast as possible to prevent the water to leak out. When you can manage to keep water in pipes for a defined period of time, you progress to a next level.', 'P', 1022, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bpw1bfqp2qfes3xpthz2.jpg'),
(11, 'Sid Meier\'s Pirates!', '31st December, 1987', 'You\'ll criss-cross your way along the 17th century Spanish Main in search of all-new adventures. \n \nYou\'ll lead a crew of hot-blooded buccaneers into rollicking harbour towns. And risk your booty and your life plundering enemy ships! \n \nHunt for magnificent treasures! Unravel the mysteries and clues of your adventure! Even battle your way through enemy waters on grueling rescue missions! \n \nWill you win your rightful place in history? Or will you end up shipwrecked on a distant island? The answer can only be found in the swashbuckling Pirates! Gold.', 'S', 1023, 0, 3.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yjfqp6bmtnucf51bj9o5.jpg'),
(11, 'Pizza Pop!', '7th January, 1992', 'The Pizza Boy must deliver pizzas to various dangerous locations in order to make enough money to buy his girlfriend an engagement ring. He is thwarted by many enemies, including his romantic rival who appears frequently to take him down. Points are scored at the end of each stage based on completing stages quickly, defeating enemies and recovering extra pizzas.', 'P', 1024, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wfbbcskmx41pgf2z3fzk.jpg'),
(11, 'Plasma Ball', '26th April, 1992', 'Plasma Ball is an Action game, developed and published by Jaleco Entertainment, which was released in Japan in 1992.', 'P', 1025, 0, 2.5, ''),
(11, 'Platoon', '31st December, 1987', 'The film Platoon featured a squad of five soldiers on their mission for the US Army in Vietnam. In this action game based around the film, you take control of these five guys in turn, with the chance to switch between them as they each take one of the 3 hits that would kill them. \n \nThe game recreates each of the sections of the film, starting with a side-scrolling journey through the jungle, with paths to cross both horizontally and vertically, and the ability to jump or duck hazards. You will need to blow up a bridge and then locate a village, which contains a torch, a map and a trap-door. The enemy has booby-trapped the area and are launching airstrikes, so the danger is not all from enemy ground soldiers.', 'P', 1026, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vikwmo7ti8wopf6jgwie.jpg'),
(11, 'Pocket Zaurus Juu Ouken no Nazo', '27th March, 1987', 'A young man is changed into a lizard and must chase his aggressor through time in this Famicom platformer from Bandai.', 'P', 1027, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tyyjxbib2acshojaplut.jpg'),
(11, 'Pooyan', '31st December, 1982', 'Pooyan (ãƒ—ãƒ¼ãƒ¤ãƒ³) is a classic arcade game manufactured by Stern Electronics under license from Konami in 1982. In it, the player controls &quot;Mama&quot;, a pig whose babies have been kidnapped by a group of wolves.', 'P', 1028, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xxbdh7e5ckdepqqihf0k.jpg'),
(11, 'Popeye', '31st December, 1982', 'Popeye (ãƒãƒ‘ã‚¤ Popai) is a 1982 arcade game developed and released by Nintendo based on the Popeye cartoon characters licensed from King Features Syndicate. \n \nThe Family Computer (Famicom) saw an educational sequel on November 22, 1983: Popeye no Eigo Asobi, an English teaching game akin to the later Donkey Kong Jr. Math. \n \nIn Popeye, two players can alternate playing or one player can play alone. The top five highest scores are kept along with the player\'s three initials. Popeye was available in standard and cocktail configurations.', 'P', 1029, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1pge.jpg'),
(11, 'Popeye no Eigo Asobi', '22nd December, 1983', 'A English learning game starring Popeye and friends, based on the Popeye arcade game. \n \nWord Puzzle is a version of the classic word game Hangman, where you have to guess the word in the category by choosing letters with a limited number of attempts. In Word Puzzle A, you receive a clue in Japanese while Word Puzzle B offers no clues other than the category. \n \nWord Catcher is a multiplayer challenge where Player I is Popeye and Player II is Bluto as both compete to catch the letters Olive Oyl throws in a certain order using the clues that appear.', 'P', 1030, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bkrqiyutcas5qs5addjr.jpg'),
(11, 'Power Blade', '23rd February, 1992', '22nd CENTURY WARRIOR! When New Earth\'s Master Computer is attacked by aliens, only NOVA, lord of the ancient Power Blade, can hope to battle through to Control Center and restore the Database!', 'P', 1031, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/savxvww1rl2h5dckyed8.jpg'),
(11, 'Power Blade 2', '29th October, 1992', 'Time to sharpen the blade! NOVA is suddenly called to take action against a cyborg army. The Delta Foundation has developed a line of fighting robots that pose a threat to national security. NOVA has been picked to eliminate the danger by destroying the Delta Foundation - all five locations. Fortunately, he will be using different suits which give him the ability to walk on ceilings, swim long distances, and fly - not to mention the latest top secret suit. And of course, NOVA will be wielding the ancient Power Blade, a weapon of art and science. He must draw on all his skills and cunning to defeat these near-perfect fighting machines!', 'P', 1032, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w5q73gv1vhkb0oehrdhp.jpg'),
(11, 'Power Blazer', '19th May, 1990', 'The player takes control of Steve Treiber, a highly trained soldier on a lone mission behind enemy lines. He is the only one capable of taking Brain Master offline and to save the world. Our young hero is armed with a powerful combat-boomerang called the \'Power Blazer\'.', 'P', 1033, 0, 2.5, ''),
(11, 'Power Punch II', '1st July, 1992', 'It\'s the year 2006. You\'re Mark &quot;Tough Guy&quot; Tyler and you\'ve just defended your Heavyweight title for the 9th consecutive time. After demolishing the best boxers on the planet, it\'s now time to face off with the best in the universe. The Intergalactic Boxing Federation (IGBF) has invited you to go head-to-head with 12 of their greatest fighters. From metallic cyborgs, to heavy hitting mutants, you\'ll trade punches with opponents whose strength, stamina and speed are like nothing you\'ve ever seen. If pure technique doesn\'t stop these sluggers (and with the best of them it won\'t), get hold of those Power Punches. They\'ll guarantee to send your tin-coated opponent to the junkyard and you to a new title; undisputed Heavyweight Champion of the Universe!', 'P', 1034, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tdyzcyifiurzf8fj5kgh.jpg'),
(11, 'Power Soccer', '30th April, 1990', 'Power Soccer is a Sports game, developed by Kitty Group and published by Tokuma Shoten, which was released in Japan in 1990.', 'P', 1035, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/g824vgczjojwyxmfru4k.jpg'),
(11, 'President no Sentaku', '1st April, 1990', 'President no Sentaku is a Strategy game, developed by Another and published by Hot-B, which was released in Japan in 1990.', 'P', 1036, 0, 2.5, ''),
(11, 'Prince of Persia', '3rd October, 1989', 'The game is set in ancient Persia. While the sultan is fighting a war in a foreign land, his vizier Jaffar, a wizard, seizes power. Jaffar\'s only obstacle to the throne is the Sultan\'s daughter (although the game never specifically mentions how). Jaffar locks her in a tower and orders her, under threat of execution, to become his wife. The game\'s nameless protagonist, whom the Princess loves, is thrown into the palace dungeons. The player must lead the protagonist out of the dungeons and to the palace tower, defeating Jaffar and freeing the Princess in under 60 minutes. In addition to guards, various traps and dungeons, the protagonist is further hindered by his own doppelgÃ¤nger, an apparition of his own self that is conjured out of a magic mirror.', 'P', 1037, 0, 4.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1vww.jpg'),
(11, 'Princess Tomato in the Salad Kingdom', '27th June, 1988', 'Valiant Sir Cucumber must rescue Princess Tomato from evil Minister Pumpkin in this offbeat adventure game for NES. Static scenes are viewed from a first-person perspective inside a window, with a description of the area appearing underneath. Actions such as &quot;move,&quot; &quot;talk,&quot; &quot;give,&quot; and &quot;fight&quot; are initiated by selecting individual buttons positioned along the view window\'s edges. You\'ll interact with an assortment of personified fruits and vegetables throughout your travels across Salad Kingdom, all while acquiring various items to solve puzzles. Pursue Tomato\'s captors across nine locales to restore peace to the land.', 'P', 1038, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kxcjpzrbnwy3iu1pq4os.jpg'),
(11, 'Pro Sport Hockey', '6th April, 1993', 'Pro Sport Hockey is an Ice Hockey game, developed by TOSE and published by Jaleco Entertainment, which was released in 1993.', 'P', 1039, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/krnryjucxwrqn9iamyop.jpg'),
(11, 'Pro Wrestling', '20th July, 1986', 'Pro Wrestling is a professional wrestling video game released for the Sega Master System in 1986 by Sega. It centers around tag team wrestling, with four duos that players can select and guide to various championship titles around the world.', 'P', 1040, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cpib8axeemftpw3tpaae.jpg'),
(11, 'Pro Yakyuu Family Stadium \'87', '22nd December, 1987', 'Not so much a sequel to Pro Yakyuu Family Stadium than an enhanced rerelease with updated rosters. It was published by Bandai for the Famicom in late 1987. \n \nPro Yakyuu Family Stadium \'87 is the second game in Namco\'s long running Family Stadium series, also known as Famista. It\'s a traditional baseball game that allows one human player against the CPU, two competing human players and two competing CPU players in a &quot;Watch&quot; spectator mode. \n \nRather than being a full sequel to Pro Yakyuu Family Stadium the game is instead an updated version of the original, which was reflected in its lower price at release. It adds a few features and updates the official rosters for the athletes, but is functionally identical to the original Family Stadium. This specific type of annualization would become common practice for sports game franchises such as Madden NFL and NHL. \n \nIt\'s worth noting that this game is unrelated to R.B.I. Baseball 2 from Tengen. The original R.B.I. Baseball and Family Stadium were one and the same, the former receiving a name change to appeal to a Western audience, but after that initial game both franchises diverged. R.B.I. Baseball specifically favored more realistic looking athlete sprites while Family Stadium would persist with the cartoonish &quot;super deformed&quot; sprites.', 'P', 1041, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kkdooslw6ngurje9cdqd.jpg'),
(11, 'Pro Yakyuu Family Stadium \'88', '20th December, 1988', 'Pro Yakyuu Family Stadium \'88 is the third in Namco\'s Pro Yakyuu Family Stadium series. As with its immediate predecessor, Pro Yakyuu Family Stadium \'87, it is a slightly revamped version of the original with updated rosters. As with EA Sports\'s present-day practice, Namco released these games annually with little to distinguish each new iteration. Most notable of the smattering of minor new additions is allowing the player to choose their venue from four options, ranging from a fully-packed stadium to a park. \n \nThough this is the second sequel to Pro Yakyuu Family Stadium, which was released in the US by Tengen as R.B.I. Baseball, Pro Yakyuu Family Stadium \'88 is not to be confused with R.B.I. Baseball 3. Though the first R.B.I. Baseball was a direct localization, subsequent R.B.I. Baseball games were created in the US and are entirely independent from Namco\'s series.', 'P', 1042, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w08bbbo9bp7o2r1qezds.jpg'),
(11, 'Pro Yakyuu? Satsujin Jiken!', '24th December, 1988', 'A comedic adventure game that satirizes the heavy number of baseball and murder mystery games for the Famicom. It was developed and published by Capcom in Japan only. \n \nPro Yakyuu? Satsujin Jiken! (&quot;Pro Baseball? Murder Case!&quot;) is a slightly tongue-in-cheek parody of the Famicom\'s overabundance of Portopia style murder mystery adventure games and baseball simulators, especially the annual Pro Yakyuu Family Stadium releases. The player controls a professional baseball player that\'s been framed for a murder and must solve the case while on the lam. Capcom inserted various additional modes into the game, such as mini-games and a shoot-em-up sequence whenever the protagonist is caught by the cops. \n \nThis game is perhaps notable for being released on the same day in Japan - December 24th 1988 - as another Capcom game: Rockman 2. One of these sort of overshadowed the other.', 'P', 1043, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/k1rmoyd0sofxyasa0mcl.jpg'),
(11, 'Quiz Project Q: Cutie Project &amp; Battle 10000', '28th June, 1992', 'Quiz Project Q: Cutie Project &amp; Battle 10000 is a Miscellaneous game, developed and published by Hect, which was released in Japan in 1992.', 'Q', 1044, 0, 2.5, ''),
(11, 'The Punisher', '1st November, 1990', 'The Punisher is a 1990 video game developed by Beam Software and released by LJN, which stars the Marvel Comics anti-hero, the Punisher. It is one of the few NES rail shooters. \n \nIn the same year, there was also The Punisher computer game for Amiga and DOS systems, unrelated to this one and released by MicroProse.', 'T', 1045, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/c5vlskkel1aawxz1ljk0.jpg'),
(11, 'Qix', '31st December, 1981', 'Draw boxes to claim as much screen as possible without getting in the path of the &quot;Qix&quot; and &quot;Sparx&quot;. Draw slower for more points and hope that you have enough coins. Simple but very addicting!', 'Q', 1046, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lhc8cfr1izwzewr6vmrd.jpg'),
(11, 'Quarter Back Scramble: American Football Game', '18th January, 1990', 'Quarter Back Scramble: American Football Game is a Sports game, developed by Natsume and published by Pony Canyon, which was released in Japan in 1989.', 'Q', 1047, 0, 2.5, ''),
(11, 'Quattro Adventure', '1st February, 1991', 'BOOMERANG KID: Amazing gameplay starring the Boomerang Kid and a host of weird creatures - snapping alligators, cute koalas, knights in armor, Toby the dog, plus castles, secret switches, crumbling platforms, hidden caves and world warps. The fun never stops! SUPER ROBIN HOOD: Adventure through Nottingham castle conquering troll guards, patrolling dwarves, vampire bats, fanged spiders, fire breathing gargoyles, spiked cannonballs and more. Discover keys, secret passages, dungeons, torture chambers and collect stolen treasures including chests, crowns, diamonds, shields, goblets and rubies. All the action of the famous legend successfully captured in this amazing game. TREASURE ISLAND DIZZY: Dizzy\'s cartoon adventure on Treasure Island. Explore the mysterious island\'s treehouse, village, fabulous gold mines and dragon\'s lairs. Find secret treasure maps, encounter strange magicians, wizards, trolls, pirates and many other weird and wonderful creatures. LINUS SPACEHEAD: &quot;Planet Earth!? I hope the natives are friendly!&quot; thought Linus Spacehead as his spacecar spiralled out of control toward the strange planet - and what a strange place &quot;Planet Earth&quot; turns out to be! Weird and wonderful &quot;aliens,&quot; frantic platform action and some of the zaniest gameplay ever seen takes Linus through an escape plan that is out of this world!', 'Q', 1048, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bxcrgnggyzzbvxgbyiwk.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Quattro Arcade', '1st February, 1992', 'Quattro Arcade is a Compilation game, developed by Codemasters and published by Camerica, which was released in 1992.', 'Q', 1049, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y8hpx7e8eqmuwdchg6lf.jpg'),
(11, 'Quattro Sports', '1st February, 1991', 'BASEBALL PROS: The ultimate baseball simulation that has everything. Features include base stealing, overhead view during plays and time outs, fast balls, curve balls and even bean balls. Every player has his own unique stats so you can choose the best hitters and pitchers at those crucial moments! SOCCER SIMULATOR: This simulation covers every aspect of the game including passing, shooting, throw-ins, penalties and fouls. Fast-paced non-stop excitement right from the first whistle! PRO TENNIS: Grass, clay and gravel courts, full 3D movement, 3 skill levels. Every kind of shot from the real game is available in this simulation - smashes, lobs, volleys, passing shots and many more! BMX SIMULATOR: Against-the-clock bike racing at its best. 15 all-action circuits across three different terrains - dirt biking, desert racing and quarry racing. The burns, bumps and ramps really work - get pedalling!', 'Q', 1050, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/slejzzcxge6ztnlrws68.jpg'),
(11, 'R.B.I. Baseball', '31st December, 1986', 'No other baseball game gets you closer to playing in the big time than R.B.I. Baseball. Because every one of the ten teams in R.B.I. Baseball contains the rosters and player stats officially licensed from the MLB Players Association. Like real baseball, these skills and stats affect the outcome of every play. Like a real manager, you\'ll need to make good use of this vital information - and wise strategy decisions - if you want a winning record. R.B.I. Baseball is so intensely realistic, we\'ve added amusing animation and a touch of humor to keep the action light-hearted and fun. You can play against the computer in a nine game season or compete against a friend in your own best-of-seven series. Stop playing with no-names and step up to the plate with real superstars in R.B.I. Baseball!', 'R', 1051, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tmnif4rwyz6tl3sxalsu.jpg'),
(11, 'R.B.I. Baseball 2', '22nd January, 1988', 'R.B.I. Baseball first set the standard as the only baseball game for play on the NES to use real players and their stats. R.B.I. Baseball 2 raises the standard to a new level: You get all 26 pro teams, each with a roster of 24 real players. Every player comes with his actual 1989 stats. There\'s instant replay, as well as new and improved animation, graphics, music and sound effects to make the game come alive. As the manager, you get the designated-hitter rule, switch-hitting, and your own lineup of starters and subs. It\'s so great, it\'s approved by the Major League Baseball Players Association!', 'R', 1052, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tek0ji0e06xiunwvcyia.jpg'),
(11, 'R.C. Pro-Am', '1st February, 1988', 'Presented in an overhead isometric perspective, a single player races a radio-controlled car around a series of tracks. The objective of each track is to qualify for the next race by placing in the top three racers. Players collect items to improve performance, and they must avoid a variety of hazards such as rain puddles and oil slicks. It is an example of a racing game which features vehicular combat, in which racers can use missiles and bombs to temporarily disable opposing vehicles. \n \nThe game distanced itself from earlier racing titles by using an overhead, instead of a first-person, perspective. Reviews have cited it as inspiration for future games such as Super Off Road, Rock n\' Roll Racing, and the Mario Kart series. It has appeared in many &quot;top games of all time&quot; lists and is regarded as one of the best titles in the NES library.', 'R', 1053, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/golbljtqjpaujrr314aj.jpg'),
(11, 'R.C. Pro-Am II', '31st December, 1992', 'Play with up to 4 racers simultaneously\nRace through 24 unique levels of competition\nCollect track prizes to increase car\'s performance\nTrade winnings in the R.C. model shop for better gear\nAvoid track obstacles and weapons for your opponents\n\nIt was released in Rare\'s 2015 Rare Replay compilation for Xbox One.', 'R', 1054, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f13w2x4ijbbkblbb6wsu.jpg'),
(11, 'Race America', '31st May, 1992', 'Race coast-to-coast across the U.S.A. in the most exciting race ever! Pit your consummate driving skills and the power of your Corvette against eight great computer opponents. Or drive in a one-to-one challenge against a friend. Either way, you\'ll thrill to the dangers of exciting drag racing and wild road racing. And if you can avoid the hazards, the wipe-outs and the spins, you\'ll score high!', 'R', 1055, 0, 2.5, ''),
(11, 'Racer Mini Yonku: Japan Cup', '25th September, 1989', 'A board game/racing game hybrid based on a miniature RC car toyline. It was developed and published by Konami exclusively for the Japanese Famicom. \n \nRacer Mini Yonku: Japan Cup (&quot;Yonku&quot; refers to four-wheel drive vehicles) is a board game with racing game sections, in that the player has to construct their own RC 4WD car and then race them against their CPU opponents in various events, often taking terrain handling into account. It was based on the then-popular mini RC car toy fad in Japan. The title screen credits Tamiya, a Japanese toy manufacturer that focuses on model kits and RC vehicles, and their logo frequently appears in-game. \n \nThe game was developed by Konami for the Famicom, and was never released outside of Japan. \n \nThe player and the CPU opponents take turns moving over a board and acquiring money and parts for their RC car. Money collected can also be spent on new parts. The players\' vehicles then race, an automatic process, with the one with the best upgrades usually coming out on top.', 'R', 1056, 0, 2.5, ''),
(11, 'Rackets &amp; Rivals', '31st January, 1993', 'Rackets &amp; Rivals is a typical tennis game in which the player controls an athlete on the court. A variety of actions like volley or lob can be performed by pressing buttons with the correct timing in relation to the ball movement. Besides a tournament with several matches against more and more experienced opponents and the training mode, the player can also participate in a free match. Here the match parameters can be set beforehand, e.g. the court surface or the number of sets (one or best of three). One special feature is that the player can complain to the referee.', 'R', 1057, 0, 2.5, ''),
(11, 'Rad Racer II', '1st July, 1990', 'Speed, Thrills and Glory! \n Feel the exhilaration of road racing with lightening fast Turbo Boost acceleration to 250 miles per hour. Plus the sensational ups and downs of zooming over ruggeg terrain in the hottest cars on the road today. All it takes to handle the action is skill, reflexes and nerves of steel. \nDrive to Win! \n Rad Racer II gives you all-out access to 8 of the most challenging race courses ever! Including the streets of New York City, Las Vegas and San Francisco. You\'ll feel more sense of speed and more responsiveness than ever before. And you can test your skills in both nighttime and daytime driving conditions. With realistic new graphics, dynamic new music and perilous new challenges -including dizzying spinouts that make Rad Racer II the most fun you\'ve ever had behind the wheel!', 'R', 1058, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p1qzkotzplyqdtca7zs1.jpg'),
(11, 'Rad Racket: Deluxe Tennis II', '1st February, 1991', 'Six of the best international players have gathered to compete for a fortune in cash, plus the prestige that comes with winning the RAD RACKET trophy. The competition is fierce. You\'ve fought long and hard to get this far. You\'re gonna have to keep on winning tomake it to the top. Play singles or team up with a friend and play doubles. Either way you will experience the thrill of victory or the agony of defeat as you face off in a test for the best.', 'R', 1059, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ufxlwuyadqiw5muwv7cu.jpg'),
(11, 'Raid 2020', '1st February, 1989', 'The year is 2020 A.D. The evil drug kingpin Pitbull and his army of robots and brainwashed servants have crippled the law enforcement agencies of the world. You must seek out and destroy his communication and computer centers thus putting an end to his evil network of shipping and distribution. As you confront Pitbull\'s dealers and robotic &quot;Cyborg&quot; servants you will seize their drugs and money. The money will enable you to purchase the tools needed to overcome the obstacles in your path. Don\'t let the beauty of the streets fool you, for you are about to enter a world of laser beams, exploding mines and secret entrances. Engage your enemies as you traverse through the Pier, the Streets of Technopolis, and the Warehouse searching for clues. You will encounter more danger as you pilot a boat across the Swamp and travel through Space to an eventual confrontation with Pitbull himself in the Computer Center!', 'R', 1060, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yudwz5c0k1mhnerp9ki3.jpg'),
(11, 'Raid on Bungeling Bay', '31st December, 1984', 'Raid on Bungeling Bay has the player controlling a helicopter which is on a mission to destroy everything that moves. The only ally is the carrier, which is where the player begins at each level and may return to for repair and pick up bombs, as long as the player manages to protect it from being destroyed. The main goal in each level is to destroy a factory, which requires a steady increasing amount of bombs. Enemy forces include ships, planes, tanks, anti-air guns, and eventually, a large battleship.', 'R', 1061, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/t4a5frrvjtjwuslzcxju.jpg'),
(11, 'Rainbow Islands', '31st December, 1987', 'Rainbow Islands (ãƒ¬ã‚¤ãƒ³ãƒœãƒ¼ã‚¢ã‚¤ãƒ©ãƒ³ãƒ‰?) is a 1987 arcade game developed and published by Taito.[1] The arcade version was licensed to Romstar for North American manufacturing and distribution. The game is subtitled &quot;The Story of Bubble Bobble 2&quot; and is the sequel to Taito\'s hit game Bubble Bobble from the previous year. It is the second of four arcade games in the Bubble Bobble series (followed by Bubble Symphony and Bubble Memories, but itself has two direct sequels: Parasol Stars and Bubble Bobble Part 2). The game was ported for numerous home computers and game consoles. \n \nThe main characters are Bubblun and Bobblun, the protagonists of Bubble Bobble (known as &quot;Bub and Bob&quot; in the western releases). However, in this game they appear in their human forms as &quot;Bubby&quot; and &quot;Bobby&quot;, as opposed to the &quot;bubble dragons&quot; of the first game (following on from the first game\'s true ending). Also unlike the first game, players must now &quot;alternate&quot; (i.e., take turns), with player one as Bubby (green shirt), and player 2 as Bobby (blue shirt) (the same color scheme as in the first game).', 'R', 1062, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sn8xmskexbioosqgxjuf.jpg'),
(11, 'Rambo', '4th December, 1988', 'Rambo is a side scrolling platform game where the player controls Rambo with his mission to Vietnam. The game starts at the military base before getting sent to Vietnam. In Vietnam, Rambo has to fight animals in the jungles, swamps, and caves like wasps, snakes, fish, tigers, bats, spiders, birds, apes and flamingos. Before making his way to the POW camp he has to fight guards and mercenaries that can kick and shoot him, all wearing different color shirts depending on how powerful they are. The game also requires the player to navigate a complex map requiring the player to find North and South points on the ground to go up and down levels as well as East and West by moving Rambo to the edge of the screen. There are 6 different weapons that Rambo can pick up that are knife, throwing knife, bow and arrow, bow and exploring arrow, gun, and hand grenade. All the weapons but the knife has limited ammo which is collected from killed enemies. There is also health vile that restores health as well as mission specific items that Rambo must find to complete some missions. The game uses password save that can be retrieved when talking to any person.', 'R', 1063, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/q5ykxxaqjpqjnxwdkhhu.jpg'),
(11, 'Rampage', '1st December, 1986', 'Rampage is a game where players control giant monsters/mutated humans. Players must smash buildings while destroying vehicles such as tanks, planes, and trains to advance to the next level. Smashing windows will sometimes reveals items of interest that the player may use.', 'R', 1064, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iqb9ica0wj52t8yjxpzd.jpg'),
(11, 'Rampart', '31st December, 1990', 'Rampart is a game combining strategy and artillery action. Build your castle from Tetris-style pieces, place your cannons, bombard the enemy, try to repair, do it all over again. The original arcade release has a single-player and a two-player mode; later revisions incorporate three-player gameplay.', 'R', 1065, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1rur.jpg'),
(11, 'The Ren &amp; Stimpy Show: Buckeroo$!', '1st December, 1993', 'Stimpy invents the Gametron 5000 Moneymaker which is the first video game machine in the world that rewards the player with money. Ren, who is always on the lookout to get rich, eagerly gets to playing with the video game system on the quest to earn big bucks. \n \nIn the game, you control Ren &amp; Stimpy through various side scrolling levels which are based on different episodes of the cartoon show. Episodes the levels are based on are Space Madness,Out West, and Robin Hoek.', 'T', 1066, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/v75pzfp8szoqndmbzajs.jpg'),
(11, 'Road Fighter', '1st December, 1984', 'Road Fighter (ãƒ­ãƒ¼ãƒ‰ãƒ•ã‚¡ã‚¤ã‚¿ãƒ¼ RÅdo FaitÄ) is a car-based arcade game developed by Konami and released in 1984. It also was the first car racing game from Konami. The goal is to reach the finish line within the stages without running out of time, hitting other cars or running out of fuel (fuel is refilled by hitting a special type of car). The game also spawned two sequels in its time, Midnight Run: Road Fighter 2 in 1995 and Winding Heat in 1996, respectively. A Japan-only rebooted sequel was also released in 2010, 14 years after Winding Heat. \n \nJumbo ported the MSX version of the game to the SG-1000 in Taiwan as HuÇ’jiÃ n chÄ“ (ç«ç®­è»Š) .', 'R', 1067, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kbf6bbechhk3wto6focy.jpg'),
(11, 'Road Runner', '1st July, 1986', 'The player takes on the role of the Road Runner - from the much-loved Warner Bros. cartoon series - and must outrun and outsmart the villainous Wile E. Coyote, in this abstract sideways-scrolling racing game from Atari. A variety of traps and pitfalls await the Road runner (such as a cannon, land mines, cliff-top drop etc.) which must be carefully avoided. It is possible, however, to lure Wile E. Coyote into these traps to put some valuable distance between the Road Runner and his pursuer. Road Runner must also eat the piles of seed that appear at various points throughout the stages, as missing five bird seeds will cause Road Runner to faint and result in the player losing a life. \n \nRoad Runner\'s colourful, beautifully-drawn graphics capture the spirit and humour of the legendary cartoons perfectly. The music and sound effects are also faithful to the cartoon series.', 'R', 1068, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xmt4gi64pdynubxcdul7.jpg'),
(11, 'RoadBlasters', '31st December, 1987', 'The objective of the game is to complete all 50 rallies without running out of fuel. There is no limit to how many vehicles a player can receive to complete a rally, as long as they have fuel. However, the destruction of the vehicle will subtract a small amount from the player\'s fuel tank. In the arcade, Genesis and Lynx versions, players could start the game at a higher rally, with additional opportunities to jump several levels from time to time. Players can continue their game from where they left off; however, the player has only one chance to complete the 50th and final rally. For completing the final rally the player gets one million points as a bonus. Players can get fuel in four ways: green globes, red globes, a checkpoint, and the rally point. \n \nSource: https://en.wikipedia.org/wiki/RoadBlasters', 'R', 1069, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vndpo5pahnoezgh6arvv.jpg'),
(11, 'Robin Hood: Prince of Thieves', '31st December, 1991', 'England is in turmoil! While King Richard the Lion-Hearted is off fighting the Crusades in Jerusalem, the relentlessly greedy Sheriff of Nottingham rises to power by running roughshod over the poor folk of Britain. Now you are Robin Hood: Prince of Thieves, the only man with enough cunning, agility and courage to combat the Sheriff and his evil witch, Mortianna. First, you must battle cutthroat guards and escape the Saracen dungeon where you, your friend, Peter Dubois, and your new companion, the mysterious, but loyal, Azeem, are held prisoners of the Crusades. Back in England, you\'ll explore the treacherous Sherwood Forest where you\'ll muster your band: Little John, Friar Tuck and Will Scarlett. But remember, they will only follow you if you prove yourself worthy enough to lead them, rescue the lovely Maid Marian and free England from tyranny.', 'R', 1070, 0, 2.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qvow4jiquqz6q6z7ompj.jpg'),
(11, 'Robo Warrior', '7th September, 1987', 'You\'re Zed, half man, half cyborg. The one-man battalion with a human heart and a computer\'s brain. Can you blast your way alone through 27 battle zones to liberate the desperate people of the planet Altile from the evil invader Xur? Xur has seized the weather control station; it\'s bitter cold, and the people have fled underground. He knows you\'ve landed. No turning back. You must recover an arsenal of 12 different weapons and 6 powers hidden on Altile. Megaton bombs, life vests, hyper missiles, super boots, cross-fires, super bombs, energy capsules, life pods, power balls... Master each to save yourself from a continuing barrage of 20 deadly enemies. Wisps, Wanes, Tracers, Strinkers, Skraugs, the Globula, Gholem, Viripides... They\'re mean, they\'re ugly, and they\'re after you. Flying. Dive-bombing. Writhing. Grabbing. Find the keys, or you\'re blocked in a battle zone forever. Find the hidden chalice and be saved from eternal doom. Hit the switch. This is war!', 'R', 1071, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nuvsxcy1av8eqg36qrlo.jpg'),
(11, 'RoboCop 2', '31st December, 1990', 'RoboCop 2 is a series of video games published in the 1990s by Ocean and Data East for various home computers and video game consoles. They are based on the movie of the same name. Three different games were produced, each produced on two systems.\n\nThe version for the Commodore 64 and NES was a simple left-to-right scrolling platformer, in which RoboCop was required to collect/destroy at least two-thirds of the drug &quot;nuke&quot; in each level and arrest two-thirds of the suspects by running into them (in contrast to shooting them). If RoboCop does not manage to attain the required amounts of nuke or number of arrests then he has two chances in the game to prove his efficiency at a shooting range. If he succeeds, he may continue onto the next level. If he fails, or if both chances at the shooting range are already used up, he must repeat the level.\n\nThe version for the ZX Spectrum and Amstrad CPC was also a platform game, but one that offered movement in both directions (vertically and horizontally) as well as into various areas providing an element of exploration. There were also a number of puzzle sub-games that had to be completed to progress in the game.\n\nThe version for the 16-bit Commodore Amiga and Atari ST was similar in nature to the 8-bit Spectrum and Amstrad CPC versions, but contained completely different levels to take advantage of the extra power offered by these computers.\n\nThere was also an arcade-only version of RoboCop 2, developed and published in 1991 by Data East (who still held the rights to create arcade games based on the franchise), which allowed up to two players at once (one controlling the original RoboCop, the other controlling a slightly purple-hued clone). The game followed the basic premise of the movie, but had some major sequential differences.', 'R', 1072, 0, 2.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gy4ybuqh5pffvp8pyeki.jpg'),
(11, 'RoboCop 3', '1st August, 1992', 'RoboCop 3 is a side-scrolling platform shooter. You get missions (such as rescuing your colleagues who are being kept hostages), which are divided into several smaller levels. The levels usually consist of several platforms, and are heavily populated by enemies who shoot at you. You can gather special repair kits, which will be used to restore your health after you\'ve completed a level. &quot;RoboCop 3&quot; is more of a shooter than its predecessors, having more and tougher enemies.', 'R', 1073, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sjiyzu3gv74jruqaoubb.jpg'),
(11, 'Robodemons', '1st January, 1990', 'A splendid adventure of terror, struggle, and danger! The evil demon King Kull has created a machine to transplant the souls of demons into the body of machines. With his army of ROBODEMONS he has cast a dark shadow over the region of Earth. You are a great warrior armed with your magical Boomerang. With it, you must penetrate the 7 gates of Hades that lead you to a confrontation with this demon king. Along the way you will free the condemned soul captives of Kull, wipe out his demons in their own living quarters, and destroy his Robodemon machine!', 'R', 1074, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iimxv3pqrrqxyqyklfs1.jpg'),
(11, 'Rocket Ranger', '31st December, 1988', 'A Master Race from Outer Space Threatens the Free World! With the zapping of ray guns and the cries of Zombie Women, Rocket Ranger brings all the action, romance, thrills, and spills of the Saturday morning serial! The action begins with an urgent message from the future. . . a future that saw the Nazis win Word War II! An underground group of scientists in the 21st century risk their lives to send you a jet propelled rocket suit, ray gun and secret decoder wheel. Skillfully used against a cunning and ruthless foe, these devices help you change history and save mankind!', 'R', 1075, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/atrho2ieong9xtzo7ua8.jpg'),
(11, 'The Rocketeer', '1st June, 1991', 'California, 1938. It had been one heck of a week for ace air racer and stunt pilot Cliff Secord, a week that had drastically changed his life. After his stunt plane was wrecked accidentally in a shootout between a couple of thugs and G-Men, the hoods had stashed an amazing stolen device in his cockpit. It didn\'t take long to figure out it was a rocketpack. And it took even less time for Cliff to become a target for half the city. The hoods wanted the stolen device back. So did its inventor, the famous, but eccentric American industrialist, not to mention the FBI, the U.S. Army, and the most menacing force of all, the Nazis! Even famous film star Neville Sinclair wanted the rocketpack. He had kidnapped Cliff\'s girlfriend, the gorgeous Jenny Blake, and was offering to exchange her for the device. Cliff had no time to ponder his desperate situation. There was only one course of action; he must become THE ROCKETEER!', 'T', 1076, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ecutrspmjci4sarigp6k.jpg'),
(11, 'Rockin\' Kats', '5th May, 1991', 'It\'s a Dance with Danger when Willy tries to rescue Jill! \n \nThe hippest cool Kat in New York, Willy, is hot on the tail of local crime boss, Mugsy. The fur\'s gonna fly \'cause Mugsy just cat-nabbed Willy\'s girl, Jill, and stashed her away. To find her, Willy has to face hoods on the streets of the Big Apple, duel desperados in the wild west, dog-fight Ace Pilots at 40,000 feet, and avoid being de-railed at an amusement park. But he\'s not called the Rockin\' Kat for nothing, and when he starts break dancin\' and body slammin\' his enemies, make room on the dance floor!', 'R', 1077, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bki7tp2geakqn7bgtwwg.jpg'),
(11, 'Rod-Land', '31st December, 1990', 'En el juego interpretamos el papel de un hada con una varita que debe eliminar a todos los enemigos a golpes. TambiÃ©n contamos con una escalera que nos permite subir y bajar plataformas. \n \nHay que destacar que la versiÃ³n arcade de mÃ¡quina recreativa (coin-op) realmente eran dos juegos en uno. Cambiando una de las opciones de configuraciÃ³n de la mÃ¡quina los grÃ¡ficos y la historia del juego cambiaban, pasando de un mundo de fantasÃ­a a un mundo futurista. \n \nTambiÃ©n era posible acceder a ese &quot;mundo paralelo&quot; terminando el juego. Entonces se mostraba en pantalla una combinaciÃ³n secreta de movimientos del joystick y botones que daban acceso al nuevo mundo.', 'R', 1078, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lxqqiyn5jduhmg8muuu3.jpg'),
(11, 'Roger Clemens\' MVP Baseball', '1st November, 1991', 'Join one of the most dominant pitchers in baseball history for Roger Clemens\' MVP Baseball. While the game does not come with the license of Major League Baseball or the MLBPA, there are still 26 similar teams with rosters resembling those of their actual MLB counterparts, including 1991 statistics. Though player names could not be used, the fictional ones make it apparent who each player represents. For instance, you can strike out one of Oakland\'s Bash brothers (M. Bash or J. Bash) with Texas\' R. Nolan or hit a home run with Detroit\'s C. Fieldman off of Chicago\'s M. Gaddox. \n \nThe gameplay of Roger Clemens differs from that of most NES baseball games. Though the batting scenes may resemble those typified by R.B.I. Baseball and Major League Baseball, the view switches to what one might see from the outfield stands once the ball is hit. This results in different controls from most baseball games as well. \n \nA player can challenge a friend or the computer, and one-player games may be exhibition or part of a 33-game season, complete with playoffs once the season is complete. In order to help make your season a successful one, Roger Clemens himself is there to offer advice.', 'R', 1079, 0, 2.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/azsovuir2miwmy3yzrco.jpg'),
(11, 'Rokudenashi Blues', '15th May, 1994', 'An RPG brawler released for the Family Computer and Super Famicom based on the anime and manga of the same name. Both were developed by TOSE and published by Bandai. \n \nRokudenashi Blues (&quot;Good-for-Nothing Blues&quot;) is a RPG brawler based on the manga of the same name, which also saw two anime movie adaptations close to its release. The player character, Taison Maeda, is a delinquent student who is training to be a professional boxer. He has a reputation as a powerful fighter among delinquent gangs as a result, though despite being violent he has a code of honor. \n \nThe Famicom and Super Famicom versions of the game are subtly different due to console differences, but both share their genre, developer and publisher. The Famicom game was released in October 1993, with the Super Famicom version following in April 1994. \n \nCharacters from this game have appeared in Jump crossover games, specifically Famicom Jump II and Jump Ultimate Stars.', 'R', 1080, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/v3sntkrhpml8pebbnt1z.jpg'),
(11, 'Rollerball', '1st January, 1984', 'Pinball is a game loved by people all over the world. And now you can enjoy four of them all rolled into one game! Four different sets of obstavles put a lot of cariety into the game. You have never seen such complicated bounding of the ball. Where will it go? And can you control it? Try your hand at becoing the first player to score a million ppoints, today!', 'R', 1081, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dbrrfwduysiczdalwoju.jpg'),
(11, 'Rollerblade Racer', '1st March, 1993', 'The Most RADICAL Race on WHEELS \n \nGet ready to Skate, Rattle and Roll with the wildest set of wheels to ever hit the streets! Just strap on your skates, get into gear and take off with ROLLERBLADE RACER, the official in-line skating video game developed in partnership with those radical racers at Rollerblade! \n \nHere\'s speed and excitement like you\'ve never experienced it before - an incredible adventure that captures all the thrills, chills and spills of in-line skating action at its best. Every even is filled with unexpected twists, turns and hazards, each designed to challenge your agility and test your skill. Add bonus rounds, like the Barrel Jumping and Half-Pipe Events, and you\'re in for the ride of your life! \n \nSo become a ROLLERBLADE RACER. \'Cause, in this game, getting there is all the fun!', 'R', 1082, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iedtbdbksi7k718cekkh.jpg'),
(11, 'Rolling Thunder', '1st December, 1986', 'Rolling Thunder is a run and gun/action arcade game that was released by Namco in 1986 and licensed to Atari Games for US manufacture and distribution. It runs upon Namco System 86 hardware, and was later converted for the Sinclair ZX Spectrum, the Commodore 64, the Amstrad CPC, the Atari ST, the Commodore 64, and the Nintendo Family Computer. It was also featured in Namco Museum Encore. \n \nThe player takes control of &quot;Albatross&quot;, a member of the WCPO\'s (World Crime Police Organization) &quot;Rolling Thunder&quot; espionage unit. Albatross\'s mission is to save a missing female agent named Leila Blitz from a secret society named Geldra located in New York City. Albatross must travel through two different segments or &quot;stories&quot;, both comprised of five stages, for a total of ten game stages. On each stage, Albatross can enter doors, to hide and take cover from enemies, as well jump over to higher or lower floors with rails, including stairs. Albatross begins this game armed with a standard-issue pistol, which can be substituted with a fully automatic assault rifle that allows for continuous firing by holding down the firing button. Albatross can gain ammunition for either weapon, by entering doors which are marked &quot;bullets&quot; or &quot;arms&quot;. Despite the presence of a life meter, Albatross can only take two physical hits from the enemy: a single hit drains half of the meter, and he will be killed instantly when struck by a projectile attack such as enemy bullets or lasers. (However, all bullets can be blocked by your own).', 'R', 1083, 0, 3.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wm7cs1hvvxhz5yxfsykz.jpg'),
(11, 'Romance of the Three Kingdoms', '31st December, 1985', 'The player takes control of a master, a general capable of commanding as many states as he can acquire, and, if successful, unifies China. As many as eight may play, but only one can succeed. There are five chronologically arranged scenarios. The first has China in its most disorganized period and the last has virtually all of China controlled by one of three generals. The precise requirements for success in each of these scenarios differs, but in all cases the goal is to rule as many states as possible. After the completion of any scenario but number five the game will automatically advance to the next. You may start the game at any scenario.\n\nKoei\'s Romance of The Three Kingdoms is based on an historical novel of the same name written in the Fourteenth Century, which was in turn based on a more serious official work of history by Ch\'en Shou (233-297 A.D.), who chronicled major historical events in China from 220 to 265 A.D. Your master strives to unite China. You must enlist the help of others, fight well and negotiate shrewdly. Without able and loyal subordinates you will not be able to win the game. Choosing good people and winning their loyalty will not be easy and all the able and loyal subordinates in the world will not help if diplomatic and military resources are not used well.', 'R', 1084, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qg3lpldmcmqgmhxsxvxk.jpg'),
(11, 'Romance of the Three Kingdoms II', '2nd November, 1990', 'The player takes control of a master, a general capable of commanding as many states as he can acquire, and, if successful, unifies China. As many as eight may play, but only one can succeed. There are five chronologically arranged scenarios. The first has China in its most disorganized period and the last has virtually all of China controlled by one of three generals. The precise requirements for success in each of these scenarios differs, but in all cases the goal is to rule as many states as possible. After the completion of any scenario but number five the game will automatically advance to the next. You may start the game at any scenario.', 'R', 1085, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rmcoq9jexyeovigqnfhu.jpg'),
(11, 'Romancia: Dragon Slayer Jr.', '1st October, 1986', 'This game exists in two editions, one for the MSX1 and one for the MSX2 with better graphics. \n \nIn Romancia: Dragon Slayer Jr., you are a young warrior whom the king sends on a mission to rescue a lost princess. You must leave the town and enter the dreadful monster-infested catacombs in order to complete your quest. \n \nThe game is a departure from Dragon Slayer RPG-oriented gameplay style. It tends more towards medieval-themed platformer action. The hero has hit points, can buy items and weapons, use magic, and stay in inns to recover health. However, instead of receiving experience points and becoming stronger, you simply must attack quicker (by bumping into your opponent on platform levels) and jump higher.', 'R', 1086, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/o4nbzieywlow875dcxaq.jpg'),
(11, 'Route-16 Turbo', '3rd November, 1985', 'Route-16 Turbo is an updated version of an older arcade game entitled Route 16, developed jointly by Tehkan (later Tecmo) and Sunsoft (in a manner similar to the way Namco\'s Warpman is an updated version of Warp &amp; Warp.) Route-16 Turbo takes the concept established in Route 16, and updates the quality of the graphics, but keeps the goal of the game the same. The game play is a near perfect combination of Rally-X and Venture. The player drives a car through several zoomed in blocks collecting bags of money and other items, and travels between blocks along a zoomed out view of the world.', 'R', 1087, 0, 2.5, ''),
(11, 'RPG Jinsei Game', '26th December, 1993', 'RPG Jinsei Game (ï¼²ï¼°ï¼§äººç”Ÿã‚²ãƒ¼ãƒ ?, &quot;RPG Life Game&quot;) is a Japan-only role playing game for the Family Computer that is similar to Jinsei Game, which is the Japanese version of The Game of Life. \n \nThe object is to explore a city full of stores, places of employment, and learning places. Starting from home, the player must earn money and statistics in order to unlock the better features of the game. \n \nUnlike most games based on the Jinsei Game series, RPG Jinsei Game doesn\'t use a spinner system. Instead, the controller pad is used for movement and random encounters are featured like in Dragon Quest. The player can also talk to strangers who might either give him/her advice or do something malevolent to him/her. As in the actual Game of Life board game, the player has to choose from a series of careers ranging from a musician to a photographer and even a professional wrestler. Most of these tasks are mundane while one of the quests directly involves chasing down unidentified flying objects. Buildings that are crucial to the quest (other than shops and learning places) can be fully explored; otherwise the player simply talks to the resident. \n \nFights can occur like in a real role-playing game. However, the players stats are used instead of hit points and magic points.', 'R', 1088, 0, 2.5, ''),
(11, 'Rush\'n Attack', '1st July, 1985', 'A run &amp; gun shooter by Konami, also known by the title Green Beret, in which the player takes the role of a soldier infiltrating a military base.', 'R', 1089, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1xfe.jpg'),
(11, 'Rygar', '17th April, 1987', 'An open-world action-adventure game for the Nintendo Entertainment System that features a barbarian warrior with a distinctive &quot;diskarmor&quot; weapon. It is distinct from the original 1986 Arcade game Rygar, which saw numerous home console ports.', 'R', 1090, 0, 3.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/igfyyxijnbq2fovnfuus.jpg'),
(11, 'Saint Seiya: Ougon Densetsu Kanketsu Hen', '30th June, 1988', 'Saint Seiya: Ougon Densetsu Kanketsu Hen is an RPG based around the anime and manga series known as Saint Seiya. It was developed and published by Bandai in 1988 for the Famicom. It is the sequel to the first Famicom Saint Seiya game, Saint Seiya: Ougon Densetsu. \n \nAs with the original game, the story draws heavily from the first story arc of the series. This version picks up where the original left off, with the Bronze Saints about to take on all twelve of the Gold Saints in order to save Saori before time runs out. The game remains faithful to the original story, to the extent that your options are limited if you try to choose match ups that didn\'t occur in the show. \n \nThe gameplay mixes side scrolling action scenes where a saint must survive long enough to reach a particular Gold Saint\'s temple, with a turn based combat system against the Gold Saints. In order to be successful at these turn based battles, the player must distribute a pool of Seven Senses to a Saints Life and Cosmos. When Life is lost, certain Saints can be revived under certain conditions, but many are taken out of play. Other Saints and characters become available at particular points along the story.', 'S', 1091, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pdxjh4b48lbjzs4ucujl.jpg'),
(11, 'Saiyuuki World', '11th December, 1988', 'Saiyuuki World is an Action game, developed by NMK and published by Jaleco Entertainment, which was released in Japan in 1988.', 'S', 1092, 0, 2.5, ''),
(11, 'Sakigake!! Otoko Juku: Shippuu Ichi Gou Sei', '3rd March, 1989', 'Sakigake takes place at a school called Otokojuku, which is a private boy school that teaches Oendan to student delinquents. Oendan is basically a cheering squad that is somewhat similar to cheerleaders, except they focus mostly on noise and atmosphere than being acrobatic. The school is run by the principal Heihachi Edajima, who uses martial arts to train his students to be better people for society.', 'S', 1093, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cmfivc9zhswagsvzxwxb.jpg'),
(11, 'Salamander', '31st December, 1986', 'The first player controls Vic Viper and the second player takes the reins of debuting spacecraft Lord British, which is sometimes referred as &quot;Road British&quot; due to the ambiguity of Japanese-to-English romanization. The game features six stages which alter between horizontal and vertical scrolling.', 'S', 1094, 0, 3.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1w4r.jpg'),
(11, 'Sanada Juu Yuushi', '27th June, 1988', 'An RPG published by Kemco for the Famicom. It was never released outside of Japan. \n \nSanada Juu Yuushi (roughly &quot;Sanada Ten Braves&quot;) is a Sengoku era themed RPG featuring ninjas. The Sanada in question is Yukimura Sanada, the second son of one of the more important daimyos (feudal lords) of that era, who is purported to have had ten legendary ninjas helping his war efforts - the same ten braves referred to by the game\'s title. \n \nThe game\'s general plot has Sanada finding and recruiting the titular ten braves, usually with the caveat that the player helps them with a task before they\'ll agree to join the party. The menu-driven RPG battles are a little unusual as each is a one-on-one battle with a singular opponent - however, the player is free to choose from any of the characters they\'ve already recruited, changing the character in the subsequent round if they so wish.', 'S', 1095, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/izial7dch02imiyoyynq.jpg'),
(11, 'Sangokushi: Chi Bi Zhi Zhan', '1st July, 1993', 'A country ruled by murder and violence under the iron fist of dark lord Cao Cao. \n \nHaving driven his own country into ruin and despair, Cao Cao now casts his covetous eyes on his neighboring countries. \n \nAs his conquering shadow spread, one man rose up against this black tide. His name was Liu Bei, and with the aid of the five greatest warriors and the one wisest mind in his realm, Liu Bei would fight to defend his people and lands. \n \nThe battle begins...', 'S', 1096, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xjeibi88tzmznhgifson.jpg'),
(11, 'Sangokushi: Chuugen no Hasha', '29th June, 1988', 'A war strategy game that focuses on the Ancient Chinese Three Kingdoms conflict. It was developed by TOSE and published by Namco for the NES.', 'S', 1097, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1m5g.jpg'),
(11, 'Sanrio Carnival', '22nd December, 1990', 'Help Hello Kitty find her way through many stages of different puzzles.', 'S', 1098, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w0zaq7afusnprusy9b9n.jpg'),
(11, 'Sanrio Carnival 2', '14th February, 1993', 'Sanrio Carnival 2 is a Puzzle game, published by Character Soft, which was released in Japan in 1993.', 'S', 1099, 0, 2.5, ''),
(11, 'Keisan Game: Sansuu 1 Nen', '25th April, 1986', 'An educational math game for young Japanese students. The first in a series of five games released in 1986 by magazine giant Tokyo Shoseki.', 'K', 1100, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bcri0vsclwpom3qy7qua.jpg'),
(11, 'Keisan Game: Sansuu 2 Nen', '25th April, 1986', 'An educational math game for young Japanese students. The second in a series of five games released in 1986 by magazine giant Tokyo Shoseki.', 'K', 1101, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/exmr0bsonynnpyj4qnih.jpg'),
(11, 'Keisan Game: Sansuu 3 Nen', '25th April, 1986', 'An educational math game for young Japanese students. The third in a series of five games released in 1986 by magazine giant Tokyo Shoseki.', 'K', 1102, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/x1kfg2sytrqe2oxm3ost.jpg'),
(11, 'Keisan Game: Sansuu 4 Nen', '30th October, 1986', 'An educational math game for Japanese students. The fourth in a series of five games released in 1986 by magazine giant Tokyo Shoseki.', 'K', 1103, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nian4h8hjggxptlazmvm.jpg'),
(11, 'Satomi Hakkenden', '20th February, 1989', 'A Famicom RPG based on a famous Japanese novel series of the same name. It was developed by Alpha Denshi and published by SNK. \n \nSatomi Hakkenden (usually translated as &quot;The Eight Dog Chronicles&quot;) was a long-running 19th century novel series about eight samurais from the Sengoku period and their various adventures. It was in some ways partly inspired by the ancient Chinese epic The Water Margin, which has itself seen video game adaptations in the form of the Suikoden games. Receiving numerous TV and film adaptations, including the 1983 film known in the west as Legend of the Eight Samurai, Satomi Hakkenden would be its first video game adaptation. Makai Hakkenden Shada for the Turbografx-16, also released in 1989, would be a later adaptation. \n \nThe game itself plays much like Dragon Quest; a common source of inspiration for 8-bit RPGs. The player can walk around towns conversing with NPCs, equipping themselves with weapons and armor and receiving quests and directions to new areas before leaving the safety of the town to fight random encounters on the overworld map that links locations together. Combat follows the tactical turn-based pattern, allowing the player input their characters\' desired actions before watching each turn play out. Most of the enemies in the game are based on classical Japanese monsters, usually youkai.', 'S', 1104, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ugy7tuucqnl7wkzmidrs.jpg'),
(11, 'SD Battle Oozumou: Heisei Hero Basho', '20th May, 1990', 'SD Battle Oozumou: Heisei Hero Basho is a sumo wrestling game starring characters from Gundam, Kamen Rider, and Ultraman.', 'S', 1105, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f6sdldfqixnljaqarmq3.jpg'),
(11, 'SD Gundam World: Gachapon Senshi 2 - Capsule Senki', '23rd June, 1989', 'The second game in the Famicom series of turn-based strategy games based on the SD Gundam universe. \n \nSD Gundam: Gachapon Senshi 2 - Capsule Senki is the second of five SD Gundam World games for the Famicom, published by Bandai using the Gundam license from Sunrise Studios. As with its predecessor, Scramble Wars, the game is a tactical turn-based war simulation in which each side uses their Gundam mechas to defeat the other and are occasionally aided by a &quot;gachapon&quot; - or capsule machine - that dispenses additional Gundams in a manner similar to their toy counterparts. \n \nThe game was the first of the series to be released on a Famicom cart, as Scramble Wars was a Famicom Disk System-only game. Capsule Senki was also rereleased on the Japanese Wii Shop\'s Virtual Console.', 'S', 1106, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/byuekvv5byeszsuyhiq4.jpg'),
(11, 'SD Gundam Gaiden: Knight Gundam Monogatari 2 - Hikari no Kishi', '11th September, 1991', 'SD Gundam Gaiden: Knight Gundam Monogatari 2 - Hikari no Kishi is a Role-Playing game, developed by TOSE and published by Bandai, which was released in Japan in 1991.', 'S', 1107, 0, 2.5, ''),
(11, 'SD Gundam Gaiden: Knight Gundam Monogatari 3 - Densetsu no Kishi Dan', '22nd November, 1992', 'SD Gundam Gaiden: Knight Gundam Monogatari 3 - Densetsu no Kishi Dan is a Role-Playing game, developed by TOSE and published by Bandai, which was released in Japan in 1992.', 'S', 1108, 0, 2.5, ''),
(11, 'SD Keiji: Blader', '19th August, 1991', 'SD Keiji: Blader is a Role-Playing game, developed by NMK and published by Taito Corporation, which was released in Japan in 1991.', 'S', 1109, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1nb8.jpg'),
(11, 'SD Sengoku Bushou Retsuden: Rekka no Gotoku Tenka o Nusure!', '7th October, 1990', 'SD Sengoku Bushou Retsuden: Rekka no Gotoku Tenka o Nusure! is a Strategy game, developed by Arc System Works and published by Banpresto, which was released in Japan in 1990.', 'S', 1110, 0, 2.5, ''),
(11, 'Secret Scout in the Temple of Demise', '1st February, 1991', 'Separated from your troops by unexplainable events, you are tring to find your way back to civilization. Just when you think you are going to be saved, the rescuing team turned out to be part of Dr. Demise\'s organization. In order to sever his hold on the jungle region, you must search the ruins of an ancient temple in the hope of finding and destroying Dr. Demise.', 'S', 1111, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m1vbn5fo4ovthbvyceqw.jpg'),
(11, 'Seicross', '1st June, 1984', 'The player rides a motorcycle-like craft, bumping other riders, collecting \'power\' modules and shooting blue coins.', 'S', 1112, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zmhwu4b7sqdejfjoghgq.jpg'),
(11, 'Seikima II: Akuma no Gyakushuu', '24th January, 1987', 'Seikima II Akuma no GyakushÅ«! (è–é£¢é­”II æ‚ªé­”ã®é€†è¥²ï¼?, lit. &quot;Seikima II The Wrath of Satan!&quot;) is a video game that was released in Japan in 1986. \n \nThe game is based on a then-popular Japanese heavy metal band formed by Damian Hamada called Seikima-II. This band lasted from its creation in 1982 to its dissolution on December 31, 1999. Their history, as it has been prophesized, is that they are a group of demons preaching a religion in order to propagate Satan through the use of Heavy Metal. Each member is a demon of a different hierarchical class with His Excellency Demon Kogure being leader of demons and His Majesty Damian Hamada being crown prince of hell. In accordance to the prophecy and after completing the world conquest, the band would disband at the end of the century on December 12, 1999 at 23:59:59 Japan Standard Time (09:59:99 Eastern Standard Time).', 'S', 1113, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ki1855xisra9azwsn9kw.jpg'),
(11, 'Seirei Gari', '8th January, 1990', 'Seirei Gari is an Adventure game, developed by Advance Communication Company and published by Hudson, which was released in Japan in 1989.', 'S', 1114, 0, 2.5, ''),
(11, 'Seiryaku Simulation: Inbou no Wakusei: Shancara', '26th July, 1992', 'Seiryaku Simulation: Inbou no Wakusei: Shancara is a Strategy game, published by IGS (Japan), which was released in Japan in 1992.', 'S', 1115, 0, 2.5, '');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Sesame Street: Big Bird\'s Hide &amp; Speak', '31st January, 1990', 'Sesame Street: Big Bird\'s Hide and Speak is a game for the Nintendo Entertainment System. It was one of the simplest-to-play NES games ever released commercially. This game stars Big Bird and co-stars Little Bird, and features Bert, Ernie, The Count, Grover, and Elmo. This game was developed by RSP Inc. and published by Hi Tech Expressions. All 4 sides of the D-pad move little bird to the next window clockwise; A and B Buttons both choose a window. The center buttons (Start and Select) exit to the game select screen. The game\'s objective was to choose the correct character or letter, with six different levels. The first two levels are based on simply choosing the window instructed by Big Bird, while the next two needed memorizing since the windows close. In the fifth level the player had to spell the three-letter word instructed by choosing the right letters and the last level the player must attempt to spell the most number of different words before a time limit, the letters in the windows changing after a new word is created.', 'S', 1116, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1h9r.jpg'),
(11, 'Sesame Street Countdown', '1st March, 1992', 'Sesame Street: Countdown is an Edutainment game, developed by RSP and published by Hi-Tech, which was released in 1992.', 'S', 1117, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/g5dwlb0nyjq5tktklbpx.jpg'),
(11, 'Shadow Brain', '21st April, 1991', 'Shadow Brain is a Role-Playing game, developed by Scitron &amp; Art and published by Pony Canyon, which was released in Japan in 1991.', 'S', 1118, 0, 2.5, ''),
(11, 'Shadowgate', '30th July, 1987', 'Thrust into the role of &quot;The Seed of Prophecy,&quot; players travel deep into the living castle, in hopes of defeating the evil that dwells within â€“ the dreaded Warlock Lord.', 'S', 1119, 0, 4.25, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1qer.jpg'),
(11, 'Shanghai', '31st December, 1986', 'Shanghai is a computerized version of mahjong solitaire. After winning a game, the tiles reveal the three-dimensional blinking eye of a dragon behind the game screen. The Macintosh and Sega Master System version shows an animated dragon spitting fire.', 'S', 1120, 0, 4.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iw337grsrs5lz8ms2ssw.jpg'),
(11, 'Shanghai II', '8th December, 1989', 'Shanghai II is a Puzzle game, developed and published by SunSoft, which was released in Japan in 1990.', 'S', 1121, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cbtmaqokherplbidjkcs.jpg'),
(11, 'Shatterhand', '1st January, 1992', 'Imagine packing the power of 100 strategic missiles in every punch. Imagine needing every single megaton just to hold your own against a cybernetic army of metallic monstrosities. That\'s the guts of SHATTERHAND, the game that redefines hand-to-hand combat in the 21st century... along with all the standards for single-player action games for the NES. Seven levels of programmed adventure - you choose the action! State-of-the-art graphics featuring 8-direction scrolling! &quot;Anti-gravity&quot; levels force you to fight upside-down! Armed &quot;satellite robots&quot; assist you in battle. No arms on Earth can withstand the power in your hands!', 'S', 1122, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lfgvyofkqc6qqcagd6np.jpg'),
(11, 'Sherlock Holmes: Hakushaku Reijou Yuukai Jiken', '11th December, 1986', 'Sherlock Holmes: Hakushaku Reijou Yuukai Jiken (loosely translated as Sherlock Homes: Kidnapping of the Young Countess) is an adventure game developed for the Famicom by Towachiki, and released in 1986. The game puts the player in the role of Sherlock Holmes, who must travel throughout England (by train) while trying to solve the mystery of a kidnapping. In this unusual portrayal of Holmes, his only means of interrogating anyone to obtain information is by attacking them with jump kicks until they run out of stamina and reveal clues. The game alternates between a zoomed out view of England streets, where every bystander can damage Holmes simply by running in to him, to a zoomed in side scrolling view of buildings or sewers or parks. Besides interrogating people for information, or simply beating them up for train fare, Holmes must search seemingly random cracks or trees in order to find important clues, or inventory items.', 'S', 1123, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/e24xokztvfmkcgqqxdlm.jpg'),
(11, 'Shingen the Ruler', '1st July, 1989', 'Shingen Takeda was one of the most powerful warlords of medival Japan. You being with two small city states and attempt to conquer the country as Shingen did back in the 16th Century. Control all aspects of your territories from social, economic, and military in attempt to spread your influence. If you are good enough, you can do it faster than the real Shingen himself!', 'S', 1124, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qfwzsqlldmvoc1yrpz76.jpg'),
(11, 'Shinobi', '31st December, 1987', 'The five missions in the game are each three or four stages long. Several hostages are being held in each stage; Joe must rescue all of them before he is allowed to finish the stage. The last stage in each mission has no hostages, but instead features a powerful boss character whom Joe must defeat. After completing each of the first four missions the player is taken to a bonus stage, where he can earn an extra life if he is able to kill all of the ninjas leaping towards him. Completing the fifth mission ends the game. Also, once the fifth mission begins, continues are no longer allowed; the player has to finish the game with however many lives he has left at that point. If the player earns a place on the high score board, the number of credits it took him to get that score is displayed along with his score. \n \nJoe\'s standard weapons are an unlimited supply of shuriken, along with punches and kicks when attacking at close range. One hostage per stage gives him a power-up. When powered-up, his throwing stars are replaced by a gun that fires large, explosive bullets, and his close-range attack becomes a katana slash. Joe can also perform &quot;ninja magic,&quot; which may be used only once per stage and kills (or damages, in the case of bosses) all enemies on the screen. The game also allows the enemies to hide behind boxes or use shields to block Musashi\'s shurikens.[4] \n \nJoe can be killed with one hit, provided he is hit by a projectile or melee attack, but if he does not find himself in those situations, the player can touch regular enemies and just be pushed back without being damaged. Since most enemies appear in the same place on each level, it is possible to master the game by memorizing their locations and devising patterns to defeat them. \n \nAt the end of each stage, the player receives score bonuses based on performance. Completing the stage without using ninja magic or without using any throwing stars or bullets earns the player a point bonus. The player has three minutes to complete each stage; remaining time at the end of the stage is also converted to bonus points and added to the player\'s score.', 'S', 1125, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xgggd4jywxcg4ajvlvdg.jpg'),
(11, 'Shisen Mahjong', '31st December, 1990', 'Unlicensed NES Mahjong game.', 'S', 1126, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1jig.jpg'),
(11, 'Shockwave', '1st February, 1990', 'In Shockwave you need to retrieve powerful crystals left behind by the Tarian race. The Rastons are after the crystals also, which places a short time limit on the mission. You are armed only with a spacesuit and a shockwave pistol. To retrieve the crystals, you will need to find your way through numerous mazes. Blocks in the maze can be moved with the shockwave pistol. When you hit a block with the pistol, this will move blocks adjacent to the block hit rather than the block itself. If numerous blocks are lined up, the shockwave will continue to travel through the blocks until the path is clear and a block can be moved. Some blocks are indestructable and immovable, while others can be moved, and some completely destroyed. Teleportation doors, force fields and other special items can be found in some mazes. To complete most of the levels the blocks will need to be moved about in the proper order to avoid leaving a critical path permanently blocked. If you do get stuck, there is an option to restart a maze (this feature becomes more and more useful as the game progresses.) Wandering about many of the levels are FireStars which will weaken your spacesuit and eventually destroy it. Each level has a time limit in which to solve the maze and retrieve all of the crystals.', 'S', 1127, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qdpjzslw5h8mb9wxrn7h.jpg'),
(11, 'Shooting Range', '1st June, 1989', 'The aim is to shoot the discs on the screen so that you can acquire enough points to pass the clearing point score of that particular stage without your time or energy running out. You can choose between different difficulty levels. They affect the time you have to complete the stages. For difficulty level 1 you get 300 game time, difficulty level 2 gives you 250 and the 3rd difficulty level only 200. Items you can shoot during the game include an hourglass which extends time by 50, an E which gives you 100 points + 1 Energy bar, an E in a white square which gives you 100 points + 2 Energy bars, a Reverse E which gives you 1 Energy bar and C or W symbol which both give only 100 points each. Each disc you shoot above an enemy is worth between 100-500 points. The game contains three stages that involve a western, ghost house, and a space theme. There is also a bonus stage where you try to shoot as many bottles as possible. In the party game mode, you compete to have the highest score.', 'S', 1128, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/krr4l3i1uekafmcdnl5v.jpg'),
(11, 'Short Order - Egg-splode!', '1st February, 1989', 'This cartridge used the power pad and contained two games: &quot;Short Order&quot;, is a Simon-like game in which you are given an order and need to make the burger exactly as the order says. &quot;Eggsplode&quot; is a game in which you must destroy bombs that a fox is placing underneath chicken nests before they explode without destroying the chickens or their eggs.', 'S', 1129, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rdsmnsvxznc5jbit3kgq.jpg'),
(11, 'Shogi Meikan \'92', '1st March, 1992', 'Shogi Meikan \'92 is a Miscellaneous game, developed and published by Hect, which was released in Japan in 1992.', 'S', 1130, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1jih.jpg'),
(11, 'Shounen Ashibe: Nepal Daibouken no Maki', '15th December, 1991', 'Shounen Ashibe: Nepal Daibouken no Maki is an Adventure game, developed by Advance Communication Company and published by Takara, which was released in Japan in 1991.', 'S', 1131, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1jii.jpg'),
(11, 'Shufflepuck Cafe', '6th July, 1989', 'Shufflepuck CafÃ© is a computer air hockey game developed by Christopher Gross, Gene Portwood and Lauren Elliott for BrÃ¸derbund. \nThere are two game modes. The player can compete in a tournament, playing against opponents who visit the CafÃ©, or can practice against each opponent to find out his/her/its weakness in a single-player match. \n \nThere is a general storyline behind the Amiga version of the game in which the player is an inter-galactic salesman whose spaceship has broken down. He needs to find a telephone to call the breakdown service and get the spaceship fixed. Shufflepuck CafÃ© is the nearest place for miles, so he goes in to use their telephone. The main eight Shufflepuck players are standing in his way and will not let him get to the phone until he has beaten them all. Once all are defeated, the player gets in his spaceship and flies off into the distance.', 'S', 1132, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qk3b59wdkufu2cveaiwy.jpg'),
(11, 'Side Pocket', '31st December, 1986', 'Side Pocket is a pocket billiards video game originally released into arcades by Data East in 1986. The arcade version was eventually ported to six home console platforms and two sequels to the game were produced, as well as a spin-off series called Pocket Gal. G-Mode currently owns the intellectual property rights to the Side Pocket series, and licenses these games globally.', 'S', 1133, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gix5tmkrolablyzhonhu.jpg'),
(11, 'Silent Assault', '1st February, 1990', 'A deadly alien force has taken control of all of the Earth\'s military forces. For some reason, the alien power is unable to control you, leaving you as the only one who can fight back. To be victorious you will need to battle both military forces and alien creatures in a variety of different landscapes. Along the way different weapons can be found to help your assault, along with temporary invincibility and energy replenishing power ups after destroying certain enemies. There are eight different worlds with numerous, deadly enemies to conquer.', 'S', 1134, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pzm8bggnto1vm6u4eoco.jpg'),
(11, 'Silent Service', '31st December, 1985', 'Exciting World War II Submarine Action in the South Pacific by Sid Meier.\n\n0400 hours, Tuesday 1942... BATTLE STATIONS!! BATTLE STATIONS!! Enemy convoy identified on radar!!\n\nSILENT SERVICE, The Submarine Simulation, brings exciting action, great strategy, detailed graphics and an ultra-realistic simulation of a World War II U.S. submarine in the South Pacific.\n\nSILENT SERVICE\'s outstanding features include: all the critical battle stations 0 engine room, conning tower and ship\'s bridge; challenging and realistic combat versus single ships and heavily escorted convoys; and an infinite variety of situations using complete maps and charts for the entire South-west Pacific and a sophisticated and realistic attack plotting system.\n\nSILENT SERVICE is the most detailed and realistic submarine simulation for home computers. Player selected &quot;reality levels&quot; allow the player to customize complexity, and time scaling ensures that the actions and decisions are constantly required. SILENT SERVICE provides a wide selection of historical scenarios from individual attacks to patrol missions that bring challenge and fun to both the first time player and the experienced submarine veteran. Will you, as submarine captain, select a quiet patrol sector in the Marianas Islands, or choose the dangerous waters off the coast of Japan? Is the submerged daylight periscope attack best, or do you charge in on the surface at night using only radar bearing to guide you? Do you pick off the enemy with a single torpedo shot? These decisions and many more are yours to make as you take your place among the elite ranks of the SILENT SERVICE!', 'S', 1135, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b6nzlced4dhwqlopyx3u.jpg'),
(11, 'Silva Saga', '24th August, 1992', 'Silva Saga is a Role-Playing game, developed by Yuto Ramon and published by Seta Corporation, which was released in Japan in 1992.', 'S', 1136, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qnypuc6vuklehklcpudi.jpg'),
(11, 'Silver Eagle', '13th July, 1990', 'Silver Eagle is an Action Adventure game, developed by Thin Chen Enterprises and published by Sachen, which was released in Asia in 1994.', 'S', 1137, 0, 2.5, ''),
(11, 'Silver Surfer', '1st November, 1990', 'The Silver Surfer roams throughout space as herald to Galactus, looking for new planets for him to feed on. However his mission is interrupted by a summon from Galactus. Silver Surfer learns that creatures from the Magick Dimension are trying to break through into the universe and their coming will end all life. Vowing to stop them, Silver Surfer must assemble the pieces of a mysterious Cosmic Device and use it to push them back. The pieces of the Device are currently in the hands of some malicious creatures: Reptyl, Mephisto, Skrull Emperor, Possessor and Firelord. Silver Surfer must travel to their domains and defeat them in order to obtain pieces of the device. \n \nSilver Surfer is a shooter game, with some levels taking place vertically and some horizontally. The Surfer\'s only ability is to move around on the screen and to shoot directly in front of him. Power-ups that can be picked up include: the letter &quot;F&quot; (Firepower) which will increase the number and power of his projectiles, Smart bombs which destroy everything on the screen, the letter &quot;S&quot; (Speedup) which increases the surfer\'s movement and Orbs which will also fire the Surfer\'s weapon. Orbs are special in that two can be obtained (only 1 is shown on horizontal scrolling levels) and they can be positioned to fire forwards, backwards or sideways.', 'S', 1138, 0, 1.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lyo1quzezgppzocajj9b.jpg'),
(11, 'The Simpsons: Bart vs. The Space Mutants', '31st December, 1991', 'Bart vs. The Space Mutants is a platform game where the player goes into the role of Bart Simpson (from the TV show The Simpsons) and must stop the Space Mutants from invading Springfield. On each of the five levels, Bart must collect (or get rid of) the ingredients that the Space Mutants are planning to use to build their machine, such as purple objects or balloons. He also has to collect enough &quot;proof&quot; of the aliens existence (brown coins left behind when they are jumped on), so his family members will help him when he meets a boss (characters such as Nelson and Sideshow Bob). This won\'t be easy since the Space Mutants are &quot;using&quot; human bodies as disguise. In order to discover who are the real Space Mutants, Bart must use his X-ray Specs.', 'T', 1139, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s4w5btzs7yjozxdrqgld.jpg'),
(11, 'The Simpsons: Bart vs. the World', '31st December, 1991', 'Yo! Here\'s the deal! I won the Krusty the Clown art contest so my family and I get to go on this really cool Worldwide Treasure Hunt to China, Egypt, the North Pole and Hollywood. And I need you to help to collect Krusty faces and Krusty products if I want to reach my final destination: a guest appearance on the Itchy &amp; Scratchy Show! Any questions? Good. I\'m outta here. Your friend, Bart Simpson.', 'T', 1140, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fkoabwhqga3cvvdbbwmv.jpg'),
(11, 'The Simpsons: Bartman Meets Radioactive Man', '1st December, 1992', 'LISTEN UP, CRIME FIGHTERS! \n \nThe greatest comic book hero of all time, Radioactive Man, has been kidnapped...and it\'s up to yours truly to save the R-Man. \n \nI\'ll put all my awesome super-powers to the best when I battle the slimy Swamp Hag, the evil Dr. Crab and the bad-tempered Lava Man. Once I wipe these villains out and restore Radioactive Man\'s powers, we\'ll take on the brains behind this ugly scheme, Brain-O The Magnificent. \n \nSo quit reading and buy this game OR ELSE. That\'s an order from Bartman, man!!! \n \n-THIS LOOKS LIKE A JOB...FOR BARTMAN! \n-WILL A BLAST OF COLD BREATH PUT THE FREEZE ON SWAMP HAG? \n-THE TERRORS OF THE DEEP ARE NO MATCH FOR THE MIGHTY BARTMAN! \n-DANGER LURKS EVERYWHERE IN THE JUNKYARD! \n-IT\'S FIST AGAINST CLAW IN THE EVIL DR. CRAB\'S LAIR!', 'T', 1141, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iswp5egdnbg57ucbvue1.jpg'),
(11, 'Skate or Die 2: The Search for Double Trouble', '1st October, 1990', 'The good, the rad, the airborne! Get into double trouble! The twisted adventure. The ultimate ramp. Newspaper headlines scream: &quot;Punk flattens Mayor\'s poodle... Ramp demolished... Local skateboarding suffers!&quot; Now whaddaya do? Scour sewers and alleys. Score hot moves and boards from Rodney and Lester. Scrape together the ramp plans blowin\' down the beach. Nail the homeboys with stink-eggs and paint pellets. If you skate, you can relate.', 'S', 1142, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mnze0fp8xkqlo0s6ifes.jpg'),
(11, 'Ski or Die', '31st December, 1990', 'Ski or Die is a 1990 winter sports game by Electronic Arts for the Amiga, NES, MS-DOS and Commodore 64. It consisted of 5 minigames which could be played individually or in a set sequentially. Up to 6 players could compete against each other via hotseat in 4 of the minigames, and semi-hotseat in 1 of them (up to two players at a time).\n\nThe sports and activities depicted in the minigames are halfpipe-snowboarding, inflatable sled racing, aerial skiing, downhill skiing and snowball fights.\n\nThe DOS port featured Roland MT-32, AdLib and beeper music and sound effects and ran at 15 FPS.', 'S', 1143, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cka3lgsbjdanlkolss40.jpg'),
(11, 'Sky Kid', '1st December, 1985', 'Aces from The Great War become birds in cartoon biplanes. Don\'t worry about it, just keep shooting!', 'S', 1144, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/b5gjifers2xbsq2eijsl.jpg'),
(11, 'Flying Shark', '31st December, 1987', 'Flying Shark (é£›ç¿”é®« HishÅzame?), released in North America as Sky Shark, is a 1987 vertical scrolling shooter arcade game developed by Toaplan and published by Taito in Japan, Electrocoin in the United Kingdom, Model Racing in Italy, and Romstar in North America. \n \nIn 1989, the game received a sequel titled Zame! Zame! Zame!.', 'F', 1145, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fn5hbvi7kwkmmksdzk7g.jpg'),
(11, 'Slalom', '1st August, 1987', 'Slalom is a skiing video game in which the player races in a series of downhill slalom runs while navigating past flags and obstacles before time expires. \n \nSlalom was the first NES game developed outside Japan and the Stamper brothers\' first game released under the Rare brand. \n \nSlalom was released in Rare\'s 2015 Rare Replay compilation for Xbox One.', 'S', 1146, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/doqclq1zynmndxifi02b.jpg'),
(11, 'Smash T.V.', '31st December, 1990', 'Moving from one room to the next within the studio/arena, players have to shoot down hordes of enemies as they advance from all sides, while at the same time collecting weapons, power-up items, and assorted bonus prizes until a final show down with the show\'s host where you are finally granted your prizes, your life and freedom. One of the enemies is fat and is named Mr. Shrapnel who roams aside of the walls of some rooms and after a short period of time he explodes. In the NES version, he is replaced by a giant rolling bomb.', 'S', 1147, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d8gi6iepz0ukld5oxqwk.jpg'),
(11, 'The Smurfs', '31st December, 1994', 'Smurf to the rescue! Gargamel has already captured 4 Smurfs, Jocky Smurf, Greedy Smurf, Brainy Smurf and Smurfette. To free them you will have to smurf the Angry Smurfs and BUZZ flies before smurfing the mountain by sled, then smurfing the maze mine galleries, smurfing on the back of a stork to smurf Azrael and finally smurf Gargamel from his mansion! \nGood Smurf!', 'T', 1148, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p1tahy0cidaizkca4rls.jpg'),
(11, 'Snake Rattle N Roll', '1st July, 1990', 'Snake Rattle N Roll features two snakes, Rattle and Roll, as they make their way through eleven 3D isometric levels. The object is to navigate the obstacles in each level and eat enough &quot;Nibbley Pibbleys&quot; to ring a weigh-in bell located in the level, which will allow the snakes to exit. The game can be played by a single player or by two players simultaneously.\n\nIt was later re released as part of Rare Replay collection on Xbox One.', 'S', 1149, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u0qtxkallauxgyw7we9b.jpg'),
(11, 'Snake\'s Revenge', '1st April, 1990', 'After his ironclad plan to rule the world rusted away, crazed Colonel Vermon CaTaffy went psycho. Unfortunately, your two best friends took the brunt of his frenzy and lost their fight to live. As nutty as ever, CaTaffy has sought asylum from the world\'s premiere bad guy - Higharolla Kockamamie. Grateful to this \'Rolla Radical, the Colonel has donated the biggest, baddest Ultra-Sheik Nuclear Attack Tank to his fellow madman\'s world dominating cause. \n \nNow your mission is to not only save Earth, but to inflict revenge. It\'s a job you\'ll definitely take personally as you infiltrate a nation of armed lunatics. Blow up a battleship. Hijack a train. Locate dozens of weapons and a truth serum that\'ll force enemy commanders to spill their guts. Then, destroy Vermon, Higharolla and the Earth Threatening Device with one lethal blow. All this, while staying in radio contact with a foxy spy named Jennifer and a Stealth copter pilot who\'ll be hovering nearby. So whaddaya think, Snake - are you commando enough to handle this Kockamamie scheme?', 'S', 1150, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ctzp6mwmcn8he8qio8vv.jpg'),
(11, 'Snoopy\'s Silly Sports Spectacular!', '22nd September, 1988', 'This video game is a collection of six events that uses various characters from the Peanuts series as opponents. Events include boot throwing (similar to hammer throwing), pizza balancing, and sack racing, among others. In the background, landmarks unique to Italy are shown (i.e., Leaning Tower of Pisa) and the structures using Roman architecture (i.e., the Colosseum) are shown while the player competes at the six events. A majority of the game seems to be ported from the Commodore 64 video game Alternative World Games by Gremlin Interactive.', 'S', 1151, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ctwkfjlb0bcskqepymvx.jpg'),
(11, 'Snow Bros.', '31st December, 1990', 'The gameplay of Snow Bros is similar to Bubble Bobble, released in 1986. The game supports up to two players, with each player taking the part of one of two snowmen Nick and Tom. Each player can throw snow at the enemies. The player must throw snow at each enemy until it is completely covered, when it turns into a snowball. An enemy partially covered in snow cannot move until it shakes it off.\n\nOnce an enemy has been turned into a snowball, the player can roll it. The snowball will re-bound off walls, until eventually shattering against a wall. Any enemies the snowball rolls into are eliminated and other stationary snowballs start rolling when the rolling snowball touches them. If the player manages to take out all of the enemies with kicking one snowball (this one snowball may be used to make others bounce around as well and increase the chances to pull this trick off), money in the form of large green bills will fall from the sky. These disappear in a very short amount of time but are worth 10,000 points each, the most the player can get as a bonus.\n\nEvery tenth level there is a boss. Each boss can sustain being hit a number of times. In Sega Genesis port, after the 50th level, you play as one of the snow castle princesses.\n\nWhen a player bowls an enemy over, it may drop a potion bottle. The color of the potion lets the player know what special power-up he or she will acquire.', 'S', 1152, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vdqwx27ja5elpyql2ild.jpg'),
(11, 'Soccer', '9th April, 1985', 'Experience the first ever football game for the NES. Enjoy \'real football\' as you direct your team up and down the field. Pick from seven international teamsâ€”USA, Great Britain, France, Germany, Brazil, Japan, and Spainâ€”and perform all the kickoffs, throw-ins, goal kicks, and corner kicks seen in a real friendly match. You can choose the skill level of the opposing team on a scale from one to five, so as your team improves, so do your opponents. Select a computer team or play against a friend. You even choose the length of the match, and as time ticks down, do your best to score the winning goal!', 'S', 1153, 0, 2.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1j2r.jpg'),
(11, 'Soccer League - Winner\'s Cup', '12th August, 1988', 'Soccer League - Winner\'s Cup (ã‚µãƒƒã‚«ãƒ¼ãƒªãƒ¼ã‚° ã‚¦ã‚£ãƒŠãƒ¼ã‚ºã‚«ãƒƒãƒ—?) is a soccer game developed by SAS Sakata for the Famicom, and published by Data East in 1988. During game play, field scrolls horizontally across the screen. Players select one of eight international teams and attempt to win the World Cup. The teams that the player can select include: Japan, Germany, Brazil, France, South Korea, England, Argentina, and the USA. Players may choose to play solo against the computer, or compete head to head with another player. Although the game was never released outside of Japan, most of the options are written in English.', 'S', 1154, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/n3bdk7ln4yrg6x1m6lka.jpg'),
(11, 'Softball Tengoku', '26th November, 1989', 'With 60 characters with different abilities and appearance, this is softball unlike you ever experienced before. Batter, pitch, catch, get the team you create to the big leagues. \n \nWith different stages and unique abilities, no match is ever the same!', 'S', 1155, 0, 2.5, ''),
(11, 'Solar Jetman: Hunt for the Golden Warpship', '1st October, 1990', 'Blasting off through the cosmos and into hostile alien terrain, Jetman has returned in his most ambitious adventure yet! After the most powerful spacecraft in the known Universe, the Golden Warpship, is disassembled by a band of ruthless Space Pirates and scattered throughout the galaxy, Solar Jetman is tasked with rebuilding the ship to its former glory. Aided only by the gargantuan Federation Mothership for refuelling, Jetman will have to explore twelve labyrinthine planets solo in his Jetpod, where opposition is hidden inside every cavern and beyond every crater. With survival running as thin as his fuel, Solar Jetman will need to ward off every potential invasion and escape with the Golden Warpship intact â€“ only then can he face off against his largest interstellar foe yet!\n\nSolar Jetman was re released as part of the Rare Replay Collection on Xbox One', 'S', 1156, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ozxzkfixb0hy7h2fealj.jpg'),
(11, 'Solomon\'s Key', '30th July, 1986', 'Solomon\'s Key is a puzzle game developed by Tecmo in 1986 for arcade release on custom hardware based on the Z80 chipset. The game is generally recognized as one of the most difficult games to appear on the NES. The player, controlling a sorcerer known only as Dana must overcome unlimited enemy spawning, challenging level designs, a countdown timer, instant death from any physical contact with enemies, and limited ways to dispatch enemies.', 'S', 1157, 0, 3.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jwmax11wyt9cgxqui5jy.jpg'),
(11, 'Solomon\'s Key 2', '14th April, 1993', 'Some levels contain pipes through which Dana can go, burning jars that melt ice or moving monsters instead of flames. There are ten worlds plus five secret worlds that contain ten levels. The first nine worlds can be played in any order. The tenth level of a world usually features a special challenge like moving flames or monsters and lava that is slowly rising from the bottom.', 'S', 1158, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qqlhwrosgs74qhmy46ik.jpg'),
(11, 'Solstice: The Quest for the Staff of Demnos', '1st July, 1990', '&quot;From Out of the Darkness... Shall Arise a Challenge To Your Wisdom&quot; Join Shadax\'s quest as he searches through the deadly fortress of Kastlerock for the six pieces of the magical Staff of Demnos, in a brave attempt to save Princess Eleanor from the evil magician Morbius! Over 250 challenging rooms to explore. Brilliant 3-D graphics, music and sound effects. Powerful potions and magical keys. Fearless evil characters to defeat. Non-violent fun for the entire family!', 'S', 1159, 0, 2.5, ''),
(11, 'Son Son', '31st December, 1984', 'The game is a 2-D sidescrolling platformer. The screen scrolls automatically, only stopping to fight major enemies. The screen features six continuous platforms that occasionally feature small gaps. Sonson and Tonton walk automatically across these platforms. Pressing up or down will cause them to jump up or down to the next platform. Pressing left causes them to move more slowly than the screen scrolls, essentially continuing to move forward but at a reduced pace. Pressing right does the opposite - SonSon and TonTon will move across the platforms faster than the screen scrolls. The duo have only one attack - the ability to fire energy blasts from their stalves. Touching an enemy or an unfriendly projectile causes the player to lose a life. If a player has any additional lives, they will return to the screen riding on a cloud that will give them temporary invincibility. If the player presses the control stick in any direction, the cloud will disappear and the character will resume its usual walking mode. The cloud will eventually disappear on its own if the control stick is not used. \n \nPower-ups come in the form of various fruits which produce points (with enough points giving the player an extra life). Gathering certain fruit will cause all enemies currently on a screen to turn into point-bearing fruits. Walking across certain platforms will randomly cause a bamboo shoot to sprout, yielding many extra points. \n \nIt is possible to play the game co-operatively with partner who plays as TonTon (who is Zhu Wuneng in the original story).', 'S', 1160, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fig8pj4tyct588cm09fa.jpg'),
(11, 'Soreike! Anpanman: Minna de Hiking Game!', '19th April, 1992', 'Anpanman travels around the world helping people. But what is Anpanman? Heâ€™s a superhero whose head is made out of sweet rolls filled with bean jam. Soreike! Anapanman is a fun board game for the Famicom, based on a cartoon by the same name. It is relatively straightforward and simple to play, with no \ncomplex features or obstacles to overcome. There are eight maps and a ninth to unlock, and up to three human players can participate. Join Currypanman and Shokupanman as you try to beat Baikinman!', 'S', 1161, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y1mqltkqied0qipcj2d3.jpg'),
(11, 'Space Harrier', '31st December, 1985', 'Runâ€¦ flyâ€¦ dodge those obstacles, but return fire on wave after wave of attacking aliens. Armed with a really big gun, you have to defend yourself against the alien hordes using your wits to navigate around the screen. But watch out for those end of level bosses! \n \nOriginating in the arcades, Space Harrier is a third-person rail shooter with pseudo-3D graphics, set in the same world as Fantasy Zone. The lone titular hero fights aliens with a fireball-launching cannon, which can also be used to transform the hero into a flying rocket. The protagonist is constantly in motion, but the speed of his movement can be regulated by the player.', 'S', 1162, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jj3psqxcwdq6ea8togkz.jpg'),
(11, 'Space Hunter', '31st December, 1985', 'Space Hunter (ã‚¹ãƒšãƒ¼ã‚¹ãƒãƒ³ã‚¿ãƒ¼?)[2] is a Japan-exclusive video game that was released in 1986 for the Family Computer. The game was published by Kemco; which was then known as Kotobuki System. \n \nThe plot apparently revolves around a robotic revolt led by a robot named De Gaulle. It is the year 2199 AD. By the explosions of global nuclear war, society has broken up into nine small expulsions, one of them disappeared and Venus collided with another celestial object. Humanity only slightly survived. Its thread of life barely connected to a body; which was rebuilt into a cyborg. The heroine is named Al Tiana and is also apparently a robot who does not support the rebellion. She is out to prove her loyalty to the humans.', 'S', 1163, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/i73rvegdphjxknxkh84t.jpg'),
(11, 'Space Invaders', '1st June, 1978', 'Space Invaders is an arcade video game developed by Tomohiro Nishikado and released in 1978. It is one of the earliest shooting games and the aim is to defeat waves of aliens with a laser cannon to earn as many points as possible.', 'S', 1164, 0, 3.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1hov.jpg'),
(11, 'Space Shadow', '15th February, 1989', 'A sci-fi Light Gun game from Bandai that came packaged with the Hyper Shot Light Gun for the Famicom. \n \nSpace Shadow is an on-rails sci-fi Light Gun game from Bandai that takes its inspiration from the claustrophobic killer aliens movie Aliens. The player walks down an octagonal hallway and shoots any hostile extra-terrestrial life that bursts forth from one of the side-passages or the ceiling. \n \nSpace Shadow was the pack-in game for the Bandai Hyper Shot, a sub-machine gun shaped Light Gun for the Famicom. Despite the fact that Light Gun games tended to do far better in the US, neither the Hyper Shot nor this game were ever released outside of Japan.', 'S', 1165, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rqoth8q2i5enp1dbpoqm.jpg'),
(11, 'Space Shuttle Project', '1st December, 1991', 'The object of this video game is to successfully launch and fly one of NASA\'s historic Space Shuttles. Gameplay is composed of several different types of missions, each broken up into short mini-games. \nThe first part of the game requires the player to activate oxygen and hydrogen pumps as well as get additional crew members into the shuttle within a strict time limit by moving an elevator up and down and avoiding moving bumpers. Then, the player must successfully launch the shuttle into space by performing quick time events that correspond to particular shuttle launch maneuvers such as booster rocket separation. Once in space, one of several missions will be played where the player must control the astronaut by maneuvering him around hazards, replenish his air supply before the timer runs out, and deliver components for the International Space Station to their correct locations. A cosmonaut from the Soviet Union must also be rescued in the game. \nFinally, the player must land the shuttle by again performing Quick Time Events that correspond to landing maneuvers before finally landing at Edwards Air Force Base.', 'S', 1166, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ay4eyrngqawvueysga7s.jpg'),
(11, 'Spartan X 2', '27th October, 1991', 'Slums, subways and a smugglers\' ship lead Johnny to microchips and the evil Satine \n \nThe police are corrupt. The gangs are vicious. And an evil microdiip has turned a decent father into a mindless beast. \n \nYoung Johnny Thomas seardies alone for the distributors of the mind-bending microchips. From slum to subway to smugglersâ€™ ship he follows a torturous path that leads to the ultimate battle with the evil Satine.', 'S', 1167, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ipv68u9gg7bm9tmkknmm.jpg'),
(11, 'Spelunker', '31st December, 1983', 'A miner has to find the exit to a world of wonders that is deep in the ground. During his journey he has to collect bombs to destroy rocks in his way, collect keys to open doors and pick up little potions that refresh his timer. Treasure chests can be opened for bonus items.', 'S', 1168, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/owd1pbnzjzagaxfw3z6n.jpg'),
(11, 'Spider-Man - Return of the Sinister Six', '1st October, 1992', 'Spider-Man: Return of the Sinister Six is a side-scrolling game which puts you in the role of Spidey throughout six levels against Electro, Sandman, Mysterio, Vulture, Hobgoblin and Doctor Octopus respectively. Some puzzle solving (like finding a key) is necessary to beat some levels. Spidey can duck jump, climb walls, punch, shoot webs to swing (by pressing punch and jump together) and perform a jump kick (by pressing the punch button twice). Collecting web cartridges allows Spidey to shoot limited web projectiles. \n \nAlthough hard to die, Spidey has only one life, there are no items to recharge life (but killing some guys will do so) and only one continue.', 'S', 1169, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kc2wpd2cyvbbvzqruchu.jpg'),
(11, 'Splatterhouse: Wanpaku Graffiti', '31st August, 1989', 'Revived by his girlfriend\'s grief and a flash of lightning, Rick must chase down the Pumpkin king and save his beloved Jennifer once and for all! A parody of the bloody horror beat-\'em-up Splatterhouse, Wanpaku Graffiti assumes a much cuter appearance but retains the same fast-paced action of the original.', 'S', 1170, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lscegdkikpbvobjqve0a.jpg'),
(11, 'Spot: The Video Game', '1st October, 1990', 'A puzzle game loosely featuring licensing from the 7Up soft drink. The gameplay involves up to 4 players, which can be either human or computer, each taking on spots of a particular colour. Starting from opposite corners, they take it in turns to move, either by \'reproducing\' one of their spots to form another one in an adjacent square, or by making a jump, losing the square you did have but taking one two spaces away.', 'S', 1171, 0, 2.6, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uf8syvvgzuyv3e6f3msi.jpg'),
(11, 'Spy Hunter', '31st December, 1982', 'Originating in the arcades, Spy Hunter is a driving action game played from an overhead point of view. Your car is equipped with machine guns to help you get past the numerous enemies out on the road (be careful not to shoot any civilians, though!) Occasionally you will come across a weapons van, and if you drive into the back of the van your car becomes equipped with a second weapon (such as smoke screen, oil slick, or missiles). At several points the road splits and you can enter a boathouse which transforms your car into a boat temporarily. If you drive far enough the seasons change as well (watch out for icy conditions during winter!). The enemy cars will do anything to stop you, including running you off the road, firing guns from the back of a limo, or dropping bombs from a helicopter.', 'S', 1172, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/iqfooyt1cqmnhjiqzn4i.jpg'),
(11, 'Spy vs Spy', '31st December, 1984', 'The black spy and the white spy are out to outsmart each other before the time bell rings. Find the needed objects (money, passport, secret plans and airport door key) by searching rooms in the embassy, which include desks, file cabinets and other furniture. Foil your opponent by setting creative booby traps in the various rooms (a bomb in a dresser drawer, for instance). Traps can be disarmed with objects found in rooms (a water bucket from a firebox on the wall will disarm the bomb in the prior example). When all the items are together in the secret briefcase, head for the airport door.', 'S', 1173, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rxly0kzdxgl7sebqobth.jpg'),
(11, 'Sqoon', '26th June, 1986', 'Sqoon (ã‚¹ã‚¯ãƒ¼ãƒ³ SukÅ«n) is a side-scrolling shooter game published in 1986 by Irem for the Nintendo Entertainment System. The game is considered somewhat obscure and did not have a big impact on the gaming community.', 'S', 1174, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f9da0mahgpot3ogaknaq.jpg'),
(11, 'Stack-up', '26th July, 1985', 'Stack-Up is a video game released in 1985 for the Nintendo Entertainment System, designed for use with the Robotic Operating Buddy (R.O.B.) Stack-Up is one of two games in Nintendo\'s Robot Series, the other being Gyromite (Robot Gyro in Japan). While Gyromite is a pack-in game with the R.O.B. itself and therefore comes with all the parts needed to play the game, Stack-Up comes in a large box containing additional bases and colored discs. The game\'s retail box comes with many small, plastic parts, which may contribute to difficulty in maintaining a complete set. Stack-Up is considered by collectors to be one of the rarest first-party games for the NES.', 'S', 1175, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/psrng7p5yh0yc1u9hohs.jpg'),
(11, 'Stadium Events', '23rd December, 1987', 'This actioin-packed game is controlled by your body movements. \n \nStadium Events Game Pak, which turns your home into an exciting stadium, dares you to increase your physical ability and better your athletic record. \n \nYou\'ll compete against a runner in the Tournament Mode, and in 4 events for a total score in the Olympic Mode. The top 6 winners\' names and their scores will appear on the electronic billboard. \n \nThe top 3 winners will stand on the winners platform! \n \nTo be used exclusively with the Family Fun Fitness Control Mat and the Nintendo Entertainment System. \n \nCompete and test your physical ability in 4 different events. \n100 METERS DASH. \n110 METERS HURDLES. \nLONG JUMP. \nTRIPLE JUMP.', 'S', 1176, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ne86zpcxezz23kuuyohx.jpg'),
(11, 'Stanley: The Search for Dr. Livingston', '30th November, 1992', 'DANGER \nDanger lurks behind every turn and every tree as you seek out the ancient temple of wisdom, the legendary lost temple of &quot;Am-Zutuk&quot; while hot on the trail of the absent-minded Dr. Livingston deep in the heart of the mysterious Congo jungle. \n \nADVENTURE \nAdventure overtakes you as you battle under mountain and over hill against cunning natives, giant spiders and psychedelic specters. Discover hidden items and maps; recover lost ancient weapons and armor. \n \nEXPLORE \nExplore dark mysterious caverns and brave hundreds of levels of uncharted wilderness as you risk your life for fame, wisdom and adventure. Hurry, find the lost Dr. Livingston and the mysterious temple. Who knows, your exploits may someday be famous. Dr. Livingston I presume? \n \nSpecial password feature included!', 'S', 1177, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zdsvulfgpiittemzqd0v.jpg'),
(11, 'Star Force', '31st December, 1984', 'In the game, the player pilots a starship called the Final Star, while shooting various enemies and destroying enemy structures for points. \n \nUnlike later vertical scrolling shooters, like Toaplan\'s Twin Cobra, the Final Star had only two levels of weapon power, and no secondary weapons like missiles and/or bombs. Each stage in the game was named after a letter of the Greek alphabet. In certain versions of the game, there is an additional level called &quot;Infinity&quot; (represented by the infinity symbol) which occurs after Omega, after which the game repeats indefinitely.', 'S', 1178, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wg2rosbfogcez9uaia2w.jpg'),
(11, 'Star Luster', '1st June, 1985', 'A first-person 3-D space shooter from Namco.', 'S', 1179, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/okznhydfqgeihroxooaj.jpg'),
(11, 'Star Soldier', '13th June, 1986', 'A strange and evil presence is lurking in space. Crushing everything in its path, destroying spaceships full of innocent people, the brutal Starbrain is threatening the entire Galactic Empire. Starbrain, a giant computer programmed only for destruction, inhabits an enormous space station, guarded by enemy ships and robot creatures. To penetrate the station is a job for the most skillful and experienced Star Soldier - you! You\'ll be piloting Caesar, the fastest fighter ship in the Galactic Fleet, with an awesome arsenal of weapons at your finger-tips. Only you can end the fearsome Starbrain\'s spree of destruction, and restore peace to the galaxy! \n \nThe MSX version of the game was brought to the SG-1000 in Taiwan.', 'S', 1180, 0, 2.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pp01vff9wzhgmmtnzsqq.jpg'),
(11, 'Star Trek: 25th Anniversary', '1st February, 1992', 'Fasten your seat belts, bring your seat back to an upright position, you are about to pilot a Federation Starship on a wild roller coaster ride through the final frontier.\nStar Trek: 25th Anniversary is a point-and-click adventure with multiple solutions and moral choices, combined with a first person starship simulator. As Captain Kirk, you\'ll control phasers, photon torpedoes, shields, and communications during eight separate space and ground missions. Visit different worlds and then join a landing party sent down to map and interact with alien races and artifacts.\n\nPiloting the U.S.S. Enterprise is a thrill in itself, but the actual voices of William Shatner, Leonard Nimoy, DeForest Kelley, James Doohan, George Takei, Walter Koenig and Nichelle Nichols will make your adventure truly out of this world.', 'S', 1181, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/x7e3lkxvboa6t3ayqb70.jpg'),
(11, 'Star Trek: The Next Generation', '1st October, 1993', 'Star Trek: The Next Generation is divided into a series of missions. Players will start on the main screen of the bridge and from there can access Navigation, Tactical, Operations, Engineering, Transporter Systems and Mission Control. Mini-games are sometimes used to complete certain ship functions (such as rerouting power to the shields).', 'S', 1182, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/veaaulneusezvez6ehey.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Star Trek V: The Final Frontier', '26th November, 2006', 'Sybok; Spockâ€™s former classmate at the Vulcan School of Thought has used his mind-melding powers to cause the settlers on the planet nimbus to join his force. A Vulcan whose can show emotions, he has taken control of paradise. \n \nUnpublished game ROM leaked by Lost Levels in 2006.', 'S', 1183, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/i10odo3sxkepsslarw7l.jpg'),
(11, 'Star Wars', '4th December, 1987', 'Star Wars is a Family Computer video game released in 1987 by Namco. Despite being based on the first Star Wars film. \n \nIt is the only game in the Star Wars franchise that was released exclusively in Japan. The game is a common side-scrolling platformer where the player controls Luke Skywalker (appearing with black hair due to color limitations), as he travels to join the Rebellion against the Empire.', 'S', 1184, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nnjvjtn128lthkgjyxz0.jpg'),
(11, 'Star Wars: The Empire Strikes Back', '1st March, 1992', 'From Wikipedia: &quot;Star Wars: The Empire Strikes Back is a video game released for the Nintendo Entertainment System in 1992. It is the sequel the original Star Wars for the NES. This is the second of three video games released under the Empire Strikes Back title for home video game systems. It was preceded by a version for the Atari 2600 and succeeded by Super Star Wars: The Empire Strikes Back for the SNES. \n \nThe NES version was released the same year as JVC\'s Super Star Wars for the Super Nintendo Entertainment System. As Empire was released towards the end of the NES\'s lifecycle, a corresponding sequel to the film Return of the Jedi was never developed, nor released. \n \nA version of the game was released for the Game Boy. That product was reprinted and distributed by several publishers over the course of three years.&quot;', 'S', 1185, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nyyirsswiiktpsdutalq.jpg'),
(11, 'StarTropics', '1st December, 1990', 'Find out just how resourceful you can be in this classic game, with its mixture of adventure and RPG elements. Step into the shoes of Mike Jones, a teenage star pitcher from Seattle who has come to the tropics to visit his famous archeologist uncle, Dr. Jones. After being told that his uncle has been abducted, Mike begins a perilous quest in order to rescue him and figure out the mysterious plot behind his disappearance.', 'S', 1186, 0, 4.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d39l6q4vmvxmc4gglqzs.jpg'),
(11, 'Stealth ATF', '1st October, 1989', 'Stealth ATF is a flight simulator in which you pilot a F-117A, a.k.a. Nighthawk in several missions. \n \nIn every mission\'s beginning and ending you have to take off and land your plane respectively, from a side view. If you fail to land after completing the target objectives, you fail to succeed in mission and thus have to replay it.', 'S', 1187, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p1y833psnh1zldyih2np.jpg'),
(11, 'STED: Iseki Wakusei no Yabou', '27th August, 1990', 'STED: Iseki Wakusei no Yabou (&quot;STED: Starfield of Memorable Relics&quot;) is a science-fiction roleplaying game developed for the Nintendo Entertainment System by Alpha Denshi and published by K. Amusement Leasing on July 27th, 1990 in Japan. The game takes place during &quot;Star date 0991&quot; and has the player take control of a group of heroes as they track down a distress signal sent from a distant planet just as a significant rise in &quot;monster activity&quot; has been detected.', 'S', 1188, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hxmvhvanfwdoqpowptzh.jpg'),
(11, 'Stick Hunter: Exciting Ice Hockey', '18th January, 1988', 'Stick Hunter: Exciting Ice Hockey is a game for the Famicom released only in Japan in 1987. It was never released in North America. Stick Hunter was the first actual ice hockey game created for a Nintendo gaming system. \n \nThe game was designed so that 1 player could play against the computer, or 2 players could play simultaneously against each other. The length of the periods and difficulty level could both be adjusted. \n \nPlaying as a character who has possession of the puck, the character could not only skate faster, but could only shoot the puck forward. So if the player wanted to pass to a teammate, the character on screen would have to be facing the person to which he\'s passing. The same applied to shooting at the net and attempting to score a goal. The character would have to be facing the opposing net. A player without the puck could only skate faster. If the goalie had control of the puck, he could only pass to a teammate. \n \nAs in the real-world sport of hockey, the object is to score more goals than the opposing team.', 'S', 1189, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kfwkbjqlm2y8d2kep2ek.jpg'),
(11, 'Stinger', '21st November, 1986', 'Stinger is a shoot-em-up developed by Konami. It is the North American version of the sequel to Twinbee.', 'S', 1190, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jgzmjgldwxjts2lves5g.jpg'),
(11, 'Street Cop', '1st August, 1987', 'One of the few NES games that uses the Power Pad. You play a cop who must chase down and catch the criminals. The game takes you through the streets of a city, where you must turn corners and keep running to catch the bad guys. You use the NES power pad to run through the streets, faster you run faster the cop will give chase. You use the controller to use your nightstick to apprehend the criminal.', 'S', 1191, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ibmhznhbl1ajkpkxtmnv.jpg'),
(11, 'Street Heroes', '31st December, 1994', 'Far away in the Aotis continent, a powerful sword exists, imbued with magic. People there all have unimaginable power, so it attracts lots of warriors. Now, the best warriors - Rex, Malcolm, Roger, Big Whale, Daphne, Ned, Rock Tiger and Dark Moon - get together for a race. However, there is some scheming behind the race...', 'S', 1192, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lfuvghnrumx6s7pp0wjp.jpg'),
(11, 'Strider', '31st December, 1989', 'The Striders are a global organization of infiltration specialists who work to combat villainy and keep the world safe. From their orbital space station, the Blue Dragon, they are able to quickly reach anywhere in the world.', 'S', 1193, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/zns5yhmdsw6pic8gedib.jpg'),
(11, 'Famicom Study Box', '1st February, 1991', 'The StudyBox, released by Fukutake Publishing Co, Ltd., was much like a tape player for the Famicom. The accessory was small enough to fit on top of the Famicom, to plug into the connector. Also like a tape player, the top of the StudyBox would open to reveal the compartment where tapes were played. \n \nThe StudyBox itself did not have the standard Play, Stop, Pause, Fast Forward and Rewind buttons on the system, as would be expected with a tape player. Instead, the student (presumably) would use the Famicom controller and on-screen cues to play the tapes. \n \nWe donâ€™t exactly know what the tapes would do. The purpose of the StudyBox was to make the Famicom more educational, giving students the ability to learn about whatever information was contained on the tapes. The tapes were, of course, only sound and voice, without visuals to accompany the studying.', 'F', 1194, 0, 2.5, ''),
(11, 'Stunt Kids', '1st February, 1992', 'Stunt Kids is an unlicensed head-to-head dirt bike racing game featuring a pair of helmeted, yet clearly wide-eyed children. Two human players can compete head to head, or a computer can control the second player, as the kids race dirt bikes through increasingly difficult obstacle courses whilst collecting power-ups. The dirt bikes can jump and lean and the player needs to take advantage of the bike\'s abilities in order to avoid being thrown clear.', 'S', 1195, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/k1puk7nzqrekacyuggws.jpg'),
(11, 'Sukeban Deka III', '22nd January, 1988', 'Yui Kazama, a delinquent schoolgirl, is taken in by the government and forced to fight crime to redeem herself. She is given the codename &quot;Saki Asamiya&quot; and a metal yo-yo that doubled as a badge and made to infiltrate high schools around Japan to investigate and stop criminal activities.', 'S', 1196, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sz9vwindipvfo49j5zqz.jpg'),
(11, 'Summer Carnival \'92: Recca', '17th July, 1992', 'Conceived as an entry for a game development competition, this game would later be published by Naxat Soft in 1992. This frenetic shoot-\'em-up taxes the Famicom system and the player\'s reflexes with huge quantities of enemies while maintaining smooth, fast gameplay! In addition to a single player campaign, there are also score attack and time attack modes available.', 'S', 1197, 0, 3.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wtydegrvcwjdjkamli5d.jpg'),
(11, 'Sunday Funday: The Ride', '31st December, 1995', 'Sunday Funday: The Ride is a Christian video game that was released for the Nintendo Entertainment System by Wisdom Tree, formerly a subsidiary label of Color Dreams, in 1995. The game was the last to be released by any company for the American NES. Like all Wisdom Tree games, Sunday Funday was not officially licensed by Nintendo. According to the game\'s instruction manual, the player controls a skateboarding hero who is late for Sunday school. In the game, the hero must use his skateboard and any objects he finds, such as balloons, grapefruits, and newspapers, to defeat bullies, clowns, and businessmen who are attempting to impede his path to Sunday school. The Sunday Funday game cartridge included two features other than the game itself - an arcade-style game titled Fish Fall and a sing-a-long of a song by Christian pop band 4Him. Sunday Funday is a ripped-off version of Menace Beach, also released by Color Dreams, excepting a few graphics and a complete story change. While the hero in Menace Beach fights ninjas and evil clowns on his way to rescue his girlfriend from Demon Dan, the hero in Sunday Funday fights bullies and businessmen on his way to Sunday school. Additionally, the hero carries a bible in Sunday Funday but not in Menace Beach. Finally, in Menace Beach, the hero\'s girlfriend appears wearing less and less clothing between levels, but she is replaced by a fully clothed Sunday school teacher in Sunday Funday.', 'S', 1198, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pyrzufdtf87hii3oevp5.jpg'),
(11, 'Sunman', '14th December, 2003', 'Sunman is an unreleased action video game developed by EIM and planned to be published by Sunsoft for the Nintendo Entertainment System in 1992. Despite being mostly complete, it was never commercially released. Also, unlike most video games of this time, it was never even announced. Most cancelled games saw months\' worth of publicity in video game magazines before fading off the game-watch radars. The gameplay is very similar to Sunsoft\'s Batman games, Batman and Batman: Return of the Joker, in that the character can run, jump, punch and duck, although in this game the player can also fly simply by pushing up. There are also some side scrolling flying levels where you can shoot laser/heat vision from your eyes. The game is divided into five scenes with one-four areas with a boss at the end of each area.', 'S', 1199, 0, 2.5, ''),
(11, 'Super Arabian', '25th August, 1985', 'Super Arabian is an Action game, developed and published by SunSoft, which was released in Japan in 1985.', 'S', 1200, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/itz8lgqbsluloshwkxdy.jpg'),
(11, 'Super Black Onyx', '13th May, 1988', 'Super Black Onyx (ã‚¹ãƒ¼ãƒ‘ãƒ¼ãƒ–ãƒ©ãƒƒã‚¯ã‚ªãƒ‹ã‚­ã‚¹?) is an RPG developed by Bullet Proof Software for the Famicom and published in Japan in 1988. It is an expanded version of the game The Black Onyx, which includes the ability to cast spells, more monsters, and a larger dungeon to explore. It also enhances the presentation of the graphics beyond what was standard for the computer versions at the time, and simplified the controls to be played with a control pad.', 'S', 1201, 0, 2.5, ''),
(11, 'Super Cars', '31st December, 1990', 'Super Cars is a top-view racing game from Gremlin Interactive, who later produced the Lotus series of games. Stylistically, the game is influenced by Super Sprint. \n \nThere are 9 tracks at each of the 4 difficulty levels, which can be raced in any order (although the last track you race is made harder than usual). In the races you win money, which can be spent on temporary handling and power upgrades, plus armour plating and front/rear shooting missiles that can knock out other racers. The player must finish in the top 3 of each race to progress - initially there are 4 computer opponents, but more are added as you progress through the game. \n \nThe car can be upgraded throughout the game via the shop section. The player is given an initial price, but also a number of options of things to say to the salesman - with the right combination, the price will drop.', 'S', 1202, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dbys7yhkutgvg1r6wihw.jpg'),
(11, 'Super Chinese 3', '1st March, 1991', 'Super Chinese 3 is a Role-Playing game, published by Culture Brain, which was released in Japan in 1991. \n \nFinal Famicom game in the series.', 'S', 1203, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hnjhbfu4xlwv2rzxnkeq.jpg'),
(11, 'Super Contra', '8th January, 1988', 'Super Contra is a Run and Gun-style action game produced by Konami, originally released as a coin-operated arcade game in 1988. It is the sequel to the original Contra and the second game in the Contra series released for the arcades. Like in the original game, the game centers on soldiers Bill Rizer and Lance Bean, who are once again assigned to protect the Earth from an army of alien invaders. The game features standard side-scrolling stages, as well as all new overhead stages in lieu of the original game\'s &quot;3D&quot; stages. \n \nLike its predecessor, a modified console version was made for the Nintendo Entertainment System, which saw release in North America as Super C and in Europe and Australia as Probotector II: Return of the Evil Forces. Both the arcade game and the NES game, have been re-released in various other platforms since their original releases.', 'S', 1204, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/t06qzvoaqyowmf6olmhv.jpg'),
(11, 'Super Dodge Ball', '1st November, 1987', 'Team USA is on its way to a Cinderella success story in the Super Dodgy Ball World Cup Championships. From out of nowhere, this scrappy bunch of rookies is advancing to the final round of competition. Seven powerful teams still stand between Team USA and their ultimate challenge; the long awaited grudge match with the undefeated, defending world champions, Team USSR. Only you can lead the U.S. to victory over the highly-favored competition, and give them the chance to crush the mighty Soviets. \n \n-1 or 2 players \n-Multi-dimensional, high-resolution graphics \n-3 increasing levels of challenge \n \nThrash, Bash, and Smash the Competition', 'S', 1205, 0, 4.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/heee1k0ucrvbtljtydcl.jpg'),
(11, 'Super Dyna\'mix Badminton', '26th September, 1988', 'Super Dyna\'mix Badminton is the first game for the Famicom to cover the sport of badminton. It was created by the developer/publisher team Pax Softnica and Vap Inc., previously behind Super Real Baseball \'88. \n \nThe game is depicted by a side-view, more commonly associated with volleyball video games than tennis video games, the latter favoring a viewpoint from behind one of the competitors. This comparison is also true for the sport of badminton itself, which has a similar focus on performing hard-to-counter spike attacks close to the net in order to score points. Because of the irregular flight path of a shuttlecock, the player needs to focus more on its shadow than the projectile itself in order to play effectively. \n \nThough the game has options for both male and female characters every character sprite is the same androgynous black-haired person. The only real change is that games are shorter for female competitors as they would be in real life. The game also allows for four different &quot;coats&quot; on the main menu - as these change the venue the competitors are playing in, this is presumably a mistranslation of &quot;courts&quot;.', 'S', 1206, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/cznxwesbwbderi2e68jg.jpg'),
(11, 'Super Glove Ball', '1st November, 1990', 'Your shuttle commander has been trapped in a dimensional maze in space, and you must use your glove to throw an energy ball at the walls in order to advance. \n \nThe walls in each maze room you encounter are filled with blocks. Using your Power Glove, you have to entirely break down a wall before being allowed to advance to the next room.', 'S', 1207, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/p4yuch2u6lneqtfuchxg.jpg'),
(11, 'Super Momotarou Dentetsu', '19th April, 1992', 'A train-based boardgame for the PC Engine, Famicom, and Game Boy. \n \nSuper Momotarou Dentetsu is a train and conveyance-based board game with financial elements that features Hudson\'s Momotarou character, based on the Japanese folklore hero of the same name. It is the second game in the Momotarou Dentetsu series and the first to be released on a 16-bit console - the PC Engine - hence the &quot;Super&quot; in the title. Several years after its PC Engine release, Super Momotarou Detetsu was also released on the Nintendo Famicom and Game Boy. It received a sequel in Super Momotarou Dentetsu II and a large number of successors. \n \nThe goal of the game is to travel the map and acquire territory through business deals, similar to Monopoly or Itadaki Street. Players have to contend with each other for limited resources, as well as CPU threats like the God of Poverty.', 'S', 1208, 0, 2.5, ''),
(11, 'Super Pang II', '31st December, 1992', 'Famicom sequel to Super Pang/Super Buster Bros. released only in Asian regions.', 'S', 1209, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ebw96v5267garuno8nzh.jpg'),
(11, 'Super Pitfall', '5th September, 1986', 'Pitfall Harry returns to adventuring in this &quot;Super&quot; sequel to Pitfall! and Pitfall II: Lost Caverns. Harryâ€™s mission: to recover the famed Raj Diamond, and also to rescue his niece Rhonda and loyal lion sidekick, Quickclaw. \n \nNow armed with a gun, Harry must navigate some 270 screens of 8-bit action-platforming. Valuable items will be collected along the way to aid your quest, but beware: dangers also abound, from snakes and spiders to falling rocks and boiling lava!', 'S', 1210, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xette3rn2mfnumremiec.jpg'),
(11, 'Super Real Baseball \'88', '30th August, 1988', 'Super Real Baseball \'88 (ã‚¹ãƒ¼ãƒ‘ãƒ¼ãƒªã‚¢ãƒ« ãƒ™ãƒ¼ã‚¹ãƒœãƒ¼ãƒ« \'88?) is a baseball game developed by Pax Softonica for the Famicom and published in Japan by Vap in 1988. After Namco excited the market for baseball games with the release of Pro Yakyuu Family Stadium, many other companies attempted to meet the demand for more baseball games. \n \nThis title differentiated itself from other baseball games by obtaining permission from the Professional Baseball Organization of Japan to use the official names of the 12 Japanese baseball teams and their players. This was a groundbreaking feature at the time. It was also the first game to depict an existing stadium with it\'s actual name, the Tokyo Dome, which had just opened shortly before the game\'s release. Outfielder and first baseman Warren Cromartie, formerly with the Montreal Expos, and playing for the Yomiuri Giants at the time, was chosen to help promote the game. \n \nTo further distinguish the game, the developers chose to use a more realistic approach when depicting the players on the field, as opposed to the more cartoonish look utilized by Pro Yakyuu Family Stadium and many other baseball games. Additionally, the view remains fairly close to the ball after the batter hits the ball, as opposed to zooming out to a bird\'s eye view of the field. Despite these changes, and efforts to promote the game, it was considered very difficult to play, as it employed rather complex controls for batting, pitching, and fielding that were not easy for many players to perform.', 'S', 1211, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ahfjuff8s6xnvchb2gfc.jpg'),
(11, 'Super Rugby', '27th January, 1990', 'Super Rugby is a Sports game, developed by Zap and published by TSS, which was released in Japan in 1989.', 'S', 1212, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ch6wc0mqoa9jobk1vh0m.jpg'),
(11, 'Super Spike V\'Ball', '1st March, 1990', 'Warm up with a few exercise games then face contenders in the American Circuit. For the ultimate challenge play against the best in the World Cup. Jump and block opponent\'s spikes, dive to dig a cross court spike, or set one up for a smash that only the best player can return. Kabooom! Your Super Spike blasts your opponent off his feet! &quot;X&quot; marks the spot so you can track the ball. Pick players with speed, strong defense, or killer offense. Your quick reflexes and competitive spirit complete the team. Play against the computer, by yourself or challenge a friend. With the NES Satellite or the NES Four Score any combination of one to four can play - even two vs. two! Now you can play on sand courts from Daytona to Los Angeles. Face off international teams in Hawaii or challenge the hot Navy team aboard an aircraft carrier. Watch the sand fly! Hear the applause. Soak up the rays! It\'s Super Spike V\'Ball for World Class fun!', 'S', 1213, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oo2dluzar48kyhgnfdjm.jpg'),
(11, 'Super Sprint', '31st December, 1986', 'Super Sprint is a 1986 arcade game by Atari Games. The player drives a Formula One-like car on a circuit that is viewed from above.', 'S', 1214, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/abfa4h0hmmkfnmspltle.jpg'),
(11, 'Super Star Force: JikÅ«reki no Himitsu', '11th November, 1986', 'Super Star Force: JikÅ«reki no Himitsu (ã‚¹ãƒ¼ãƒ‘ãƒ¼ã‚¹ã‚¿ãƒ¼ãƒ•ã‚©ãƒ¼ã‚¹ æ™‚ç©ºæš¦ã®ç§˜å¯†?, lit. &quot;Secrets of the Space-Time Calendar&quot;) is a video game developed and published by Tecmo on November 11, 1986 for the Family Computer only in Japan. \n \nThe game was featured in episode 111 (14th Season) of GameCenter CX. \n \nWhile this video game was originally assigned by Hudson Soft to be the publisher, Tecmo (then known as Tehkan) decided to both develop and publish the game as they were the official copyright owners', 'S', 1215, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u1c9h7motd0r9olzp0u4.jpg'),
(11, 'Super Team Games', '1st December, 1988', 'Super Team Games is a side scrolling game where two players compete in races on an obstacle course. The game utilizes the Nintendo Power Pad; to control your on screen character you will need to run in place on the Power Pad to make your character run, and actually jump to make him jump. In the basic game you need to run and jump your way to the finish line as fast as possible. Some additional game variations are available, such as the belly bump ball (you need to roll a giant ball through the obstacle course by running into it), the crab walk (make it to the finish line walking like a crab!), the water cross (water is found on the track; if you mistime your jump and land in the water you need to swim to get out costing you valuable time), the bubble run (racing through the course inside a giant bubble), or the skateboard race. Several cooperative games are included as well, including a tug of war, relay race, and six legged race.', 'S', 1216, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bimygqgt5yomdsrzurrv.jpg'),
(11, 'Super Xevious', '31st December, 1984', 'The gameplay is very much like that of the original Xevious except this time it is a little more difficult. Several new enemies have also been introduced (including a silver Galaxian flagship, a rare silver Galaga &quot;scorpion&quot; ship, two jet planes, a helicopter, and a dark yellow Tank Battalion tank). Some of these enemies will reset the player\'s score back to 0 if they are destroyed - and the hidden &quot;Sol Citadel&quot; towers and Rally-X Special Flags are also located in different places.', 'S', 1217, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hpt29c85ynnr7pgvze8f.jpg'),
(11, 'WCW: World Championship Wrestling', '1st February, 1990', 'Challenge the world\'s greatest wrestlers in the grappling action game that puts you in the toughest competition of all! Choose which wrestler you want to be or make up your own tag team from top NWA stars including: &quot;Nature Boy&quot; Ric Flair, Sting, &quot;Total Package&quot; Lex Luger, Ricky &quot;The Dragon&quot; Steamboat, Road Warriors &quot;Hawk&quot; and &quot;Animal,&quot; and &quot;Dogface Gremlin&quot; Rick Steiner. Become your favorite wrestler as you battle it out in the ring! \n \nÂ» Twelve top stars of the NWA \nÂ» Pair up your own tag team with any two wrestlers \nÂ» 1 or 2 player \nÂ» Wrestlers are thrown over the ropes and continue fighting out of the ring \nÂ» On-screen statistics of each wrestler \nÂ» Exciting animated graphics and realistic sound effects', 'W', 1218, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wzvobxtqi6n8caboqllq.jpg'),
(11, 'Swamp Thing', '2nd December, 1992', 'Part Man. Part Monster. Defender of the Earth! \n \nDr. Alec Holland, once a brilliant bio-chemist, has been transformed into the gigantic creature known as Swamp Thing. His bio-restorative formula saved him from the explosion that leveled his bayou research lab. Only now, his arch enemy - Dr. Anton Arcane - wants to capture him to unlock the secrets of the Green Guardian. \n \nJoin Swamp Thing on his mission to stop the powerful forces of Arcane from conquering the world! Dodge mechanical beasts and deadly traps as you make your way to the hidden lairs of the Un-Men! Battle these genetically altered henchmen of Dr. Anton Arcane in non-stop fighting frenzy. Can you stop Arcane from discovering the lost bio-restorative formula before it\'s too late? \n \n-Hurl shattering seed-bombs to disable your robotic foes! \n-Locate portions of the formula to restore vital energy supplies! \n-Based on the comic book hero, as seen on the TV show!', 'S', 1219, 0, 1.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ok7ysxicn7pltihhu10x.jpg'),
(11, 'SWAT: Special Weapons and Tactics', '11th October, 1987', 'SWAT: Special Weapons and Tactics is a role-playing game developed by Shouei and published by Toei Animation. This game was only ever released in Japan for the Famicom and was never translated from the original Japanese language. \n \nThe player takes control of a five member team of special anti-terrorist agents as they break into a building where a hostage situation is taking place. Their goal is to take out the villains and free the hostages. Battles with gunmen take place in a traditional RPG style turn-based battle. Players enter the commands for each surviving member of the team, including what weapon to attack with, and which target to attack. When not in battle, the player views the building in a traditional 3D dungeon perspective, moving through the hallways, choosing which rooms to investigate, which traps to disarm, and how to proceed to the end of the game within a given time limit.', 'S', 1220, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/chldpgw4dv492tzrhiso.jpg'),
(11, 'Sweet Home', '15th December, 1989', 'Thirty years prior to the story in 1959, famous artist IchirÅ Mamiya hid several precious frescos in his huge mansion before he mysteriously disappeared. In the present day, a team of five documentary filmers seek to recover the paintings from the abandoned, dilapidated mansion. Upon entering, they are trapped inside by the ghost of an unknown woman, who threatens to kill all trespassers. \n \nThe team decides to split up and find a way out, but the mansion is both in danger of collapsing and is occupied by countless monsters.', 'S', 1221, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tpojitimlfdbvow87vrj.jpg'),
(11, 'Swords and Serpents', '1st September, 1990', 'Step into a new world of gaming, where you not only play, you become. Embark on a quest to slay the evil serpent lurking in the inner most depths of the dungeon. Create a mighty band of adventurers, each having unique powers: A fearless warrior, a cunning thief, a wizard with mystical powers, and an enchanting mystic. While fighting skills are vital, Swords and Serpents will stretch your mind and your imagination. As you explore the dungeons, searching for the trappings of the legendary Ruby Warrior, you\'ll confront challenges and decisions at every turn. Will you fight? Will you run? Which of your inventory of strength, experience and magical powers will you use? The serpent is coiled, ready to strike. But you are the master of your destiny. Will you rise to the challenge? No NES game has gone this far before!', 'S', 1222, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/s8wvgw7o76hix0jgo8in.jpg'),
(11, 'Taboo: The Sixth Sense', '1st April, 1981', 'Taboo: The Sixth Sense is a Tarot card reading simulation developed by Rare Ltd. and published by Tradewest for the Nintendo Entertainment System (NES) in 1989.\nThis video game gives users a tarot reading where the &quot;dealer&quot; automatically shuffles the cards. It is the only NES game to carry two warnings; that it is intended for players ages fourteen and older and the game is intended for entertainment purposes only. Taboo was marketed as a party game that multiple adults could enjoy simultaneously.', 'T', 1223, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gtpqiynskbzdnvc8t3a4.jpg'),
(11, 'Tag Team Wrestling', '1st December, 1983', 'You are challenged to match the awesome skills of your opponents...to gain the Title in the World Super Championships of TAG TEAM WRESTLING \n \nTeamwork and stamina are the keys, as you and your partner battle your way through the Title Matches on your quest for the Belt. Attack your opponents with Body Slams, Drop Kicks, Backbreakers, Flying Head Butts, or even throwing them out of the ring! To win, its a pin for a count of three. Nothing can match the super excitement as the crowd cheers over this mania on the mat. Prepare yourself for Tag Team Wrestling!', 'T', 1224, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xwe9copzgxhhvcgaplv2.jpg'),
(11, 'Tagin\' Dragon', '1st February, 1989', '20 challenging levels! Play tag with maze after maze full of dragons. Only a dragon\'s tail is vulnerable, so sneak up from behind and munch till they turn to bones! If you are fast enough to snatch the magic lantern, you can discover the secrets buried within the walls of each maze.', 'T', 1225, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/n42voef4za8thhvauzom.jpg'),
(11, 'Taito Chase H.Q.', '8th January, 1990', 'The fastest, most thrilling, 3D driving game yet! Take the wheel of your turbo-charged Porsche as you and your partner go in pursuit of dangerous criminals all driving an evil array of souped-up roadsters. TURBO BOOST! Need to catch up in a hurry? Well, just one press of your Turbo Button will leave your eyes in the back of your head! Barrelling through the city streets, along the roughest of dirt tracks and through busy tunnels - if you can hold the line!', 'T', 1226, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jiacjcw0oq319cx7ildk.jpg'),
(11, 'Tombs &amp; Treasure', '1st July, 1991', 'In Tombs &amp; Treasure, you\'ll have to use your wits in order for your party to successfully make its way through the ruins. As you enter such sites as El Castillo and the Ball Court, you\'ll have to use collected items in innovative ways in order to attain vital clues and progress. Each screen you encounter will feature items and peculiarities that must been looked at, taken, pushed, pulled, moved, smashed, joined, and/or washed in order to advance. Occasionally, you will confront monsters and engage in a classic RPG-style fight, your final battle versus the demon Tentacula. Be sure to refer to Professor Imes\' journal in order to gain essential clues. You\'ll need them in order to survive the Tombs &amp; Treasure.', 'T', 1227, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xfsduzz1nzjpceondhzl.jpg'),
(11, 'Taiyou no Yuusha Fighbird', '11th February, 1992', 'Taiyou no Yuusha Fighbird is an Action game, developed by Tamtex and published by Irem, which was released in Japan in 1992.', 'T', 1228, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/u4jfq78sxj70xnjpfffd.jpg'),
(11, 'TAKEDA SHINGEN', '28th March, 1988', 'A side-scrolling brawler for the Arcade and PC Engine featuring the titular Japanese Sengoku warlord. Not to be confused with the NES strategy game of the same name.', 'T', 1229, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kkevl8nlxbcbwz8kysxo.jpg'),
(11, 'Tantei Jinguuji Saburou: Toki no Sugiyuku Mama ni', '28th October, 1990', 'Tantei Jinguuji Saburou: Toki no Sugiyuku Mama ni is an Adventure game, published by Data East, which was released in Japan in 1990. \n \nThe 4th installment of the Tantei Jinguuji Saburo (Jake Hunter) series where Jinguji investigates a simple burglary while Yoko searches for a young boy\'s home.', 'T', 1230, 0, 2.5, ''),
(11, 'Tao', '1st December, 1989', 'Tao is a quirky role-playing game with heavy religious themes.', 'T', 1231, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oh3bvccmozyw2jknhaqv.jpg'),
(11, 'Target: Renegade', '1st February, 1988', 'Target: Renegade is a scrolling beat\'em up (or flip-screen on certain versions) computer game released on the Amstrad CPC, Commodore 64 and ZX Spectrum systems in the late 1980s by Ocean Software on their &quot;Imagine&quot; label, as well as a Nintendo Entertainment System version published by Taito. The game is a sequel to Renegade and was followed by Renegade 3. When acquiring the license to convert the original arcade game Renegade to home computers, Ocean acquired the option to produce and release their own home-computer-only sequels to the game, and Target Renegade was the first of these sequels. \n \nOn most formats, the game caters for one or two players and concerns itself with the adventures of a streetfighter (or a pair of identical streetfighters) known only as &quot;Renegade&quot;, who seek(s) revenge against a local crime kingpin named &quot;Mr. Big&quot; for murdering his or their brother Matt. The player character varies, depending on the format, but is usually represented as topless apart from a leather vest and wearing jeans. \n \nRegardless of the format, the cover of the game and the title screen (as seen on the image to the right) portrays a topless street fighter performing a flying kick through a window. In keeping with video game box art and advertising of the era, the character shown in this illustration bears little relation to any character in the game itself. The actual picture is based on Martial Arts Legend Joe Lewis from the cover of his book The World\'s Greatest Fighter Teaches You How To Master Bruce Lee\'s Fighting System, but has been adjusted so as to fit in with the character of Renegade. \n \nThe game comprises five levels, though details of enemies and weapons vary from one version to another (the NES version in particular is more like Double Dragon than the home computer versions). The NES and C64 versions of the game do not have a two-player co-operative mode.', 'T', 1232, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/aziowasl1htvqxj8l9yg.jpg'),
(11, 'Taro\'s Quest', '27th April, 1989', 'A ninja-themed RPG by Jaleco for the NES. A US release was planned, but canceled. \n \nJajamaru Ninpou Chou is part of Jaleco\'s Ninja Jajamaru-Kun series. Jajamaru-Kun (sometimes spelled JaJaMaru-Kun) is the younger brother of the original Ninja-Kun, who starred in a couple of UPL arcade games known in the west as Ninja-Kid and Ninja-Kid 2. When Jaleco ported the original arcade game to NES, they created the character of Ninja Jajamaru-Kun and continued making games that featured the character. Jajamaru Ninpou Chou is his third Famicom game. \n \nHowever, unlike the two previous Ninja Jajamaru-Kun games, which were action platformers, Ninpou Chou is a traditional JRPG. The player walks around a world map visiting towns and dungeons and occasionally fighting random encounters using a separate turn-based combat screen. \n \nWorth noting is that this game was slated for a 1990 US release with the name Taro\'s Quest, though it was later canceled. However, an incomplete prototype version of the ROM exists. As well as an English localization, the game appeared to have had its graphics almost entirely redrawn in order to appear more realistic than the cartoonish original.', 'T', 1233, 0, 2.5, ''),
(11, 'Tasac', '31st January, 1992', 'In A.D. 20XX, humans are engaged in fierce warfare with TASAC - the alien bionic mutants. Landsy and Dagrel, commanders of Earth Defense Arms, are encountering the toughest enemies known to man. They must destroy TASAC to rescue the Earth, otherwise humans will be turned into slaves under the TASAC terrorism!', 'T', 1234, 0, 2.5, ''),
(11, 'Tashiro Masashi no Princess ga Ippai', '26th June, 1989', 'The story is about the hero Masashi Tashiro who has to rescue the four princesses in distress. One happy ending and four unhappy endings were used in the game; becoming one of the first video games to have multiple endings. The game was not very successful, but it started appearing frequently and getting high prices on online auction sites like Yahoo! after 2000, when Masashi Tashiro was arrested and convicted several times in connection with voyeurism and drug abuse.', 'T', 1235, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kqdm6yrkdwe3rrvtf2pt.jpg'),
(11, 'Tecmo Baseball', '1st February, 1989', 'Gameplay is similar to the many other baseball released for the NES. The camera angle when batting or pitching is from behind the pitcher. The pitcher can pitch the ball high and low, as well as curve it. Tecmo Baseball includes digitized voices for the umpire.', 'T', 1236, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/amkvwgri5emjrargqyug.jpg'),
(11, 'Tecmo Bowl', '31st March, 1989', 'A side-scrolling, four-player American football game that can be played as two-on-two, one-on-two, etc. The game is somewhat primitive in that there is no play pattern selection; only the receiver can be selected before play begins. One player controls the QB, the other plays the wide receiver/running back.', 'T', 1237, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yvgfrobdjtxfnfis3uui.jpg'),
(11, 'Tecmo Cup Soccer Game', '1st October, 1992', 'Tecmo Cup is a soccer simulator combined with RPG elements. As the game progress, Robin and his teammates will get better. The matches themselves consist of numerous choices what to do at each moment. If you are attacking, you have options to pass, shoot or to dribble. And when you are defending, you can either tackle, cut pass/shoot, or mark the opposition player with ball.', 'T', 1238, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rpd9y9dhmgbj8w9trzf6.jpg'),
(11, 'Tecmo NBA Basketball', '1st December, 1992', 'This basketball game is very similar to Tecmo Super NBA Basketball with the main difference being their rosters. The game has 27 NBA teams with a roster of 324 Players. Each player has a rating for his shooting ability, stamina, jumping power, running speed, stealing ability, and blocking ability. The game allows for pre-season and season modes. In the season modes the game tracks team &amp; player statistics throughout the season.', 'T', 1239, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/piewgumjp4uccpkb0wam.jpg'),
(11, 'Tecmo Super Bowl', '13th December, 1991', 'The teams, the players, and the halftime shows are ready for the ultimate football season, and you\'re in control. From the first pre-season game to the playoffs, it\'s your call, your skill, and your team. Can you get to and win the Super Bowl? Tecmo Super Bowl is the only football game to feature onside kicks, blocked passes and kicks, fumbles, pitchout to the running back, player injuries, time-outs, and much, much more! For 1 or 2 players. All 28 NFL teams! Four running plays, four passing plays. Team stats and data. Create your own Pro Bowl. Coach Mode, where you call the plays!', 'T', 1240, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kwg8jfkkkjnwvuq0gytt.jpg'),
(11, 'Tecmo World Cup Soccer', '1st February, 1991', 'Tecmo World Cup Soccer is a simple soccer game with an overhead view. Only one mode (World Cup) is available, playable by either one player against the computer AI or two players against each other. Any of the sixteen available national teams can be selected by the player; the opponent cannot be chosen manually if controlled by the AI. The game itself allows only basic moves such as passing, shooting, and side-sliding during defense. There is no team management or strategy available, and no options for game rules and conditions.', 'T', 1241, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/js2ldjaxvwvvblwuvyep.jpg'),
(11, 'Teenage Mutant Ninja Turtles: Tournament Fighters', '24th March, 1994', 'Trash the surf board and heave the \'za. It\'s a whole new breed of Turtles and they\'re fixated on fighting. We\'re dead serious, Tournament Fighters takes dude-on-dude demolition to new heights of intensity with 4 modes of pain-producing battles, deadly warriors, secret arenas, astounding graphics and sound effects that\'ll make you cringe! Clash with Krang-created clones of the Turtles, Casey Jones, April O\'Neil, Ray Filet and Sisyphus, plus bosses Triceraton, Krang\'s Android and Karai. There\'s flying body presses, knee drops, head butts, rocket punches, elbow smashes, somersault throws, you\'ll feel and inflict them all. And the settings include Magma Ocean Planet, Jungle Planet, and every other bizarre corner of Dimension X!', 'T', 1242, 0, 2.85, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dmbxicopa4s5sufn1dzz.jpg'),
(11, 'Teenage Mutant Ninja Turtles III: The Manhattan Project', '13th December, 1991', 'Teenage Mutant Ninja Turtles III: The Manhattan Project is a side-scrolling beat-\'em-up released by Konami for the Nintendo Family Computer in Japan in 1991 and for the Nintendo Entertainment System in North America in 1992.[1] It is the third video game iteration of the Teenage Mutant Ninja Turtles for the NES. The game features play mechanics similar to the previous game, Teenage Mutant Ninja Turtles II: The Arcade Game, but it is an original title for the NES without any preceding arcade version.', 'T', 1243, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tbf1nyos1qq8mdomftyg.jpg'),
(11, 'Teenage Mutant Ninja Turtles II: The Arcade Game', '31st December, 1991', 'This version includes two new levels (the first part of Scene 3 and all of Scene 6), which feature new enemy characters, including two new bosses: Tora (a dog-like &quot;blizzard beast&quot;) and Shogun (a robotic samurai), both characters created for the game. Most of the original stages from the arcade version were extended as well and the second half of Scene 3, the parking garage stage, replaces the arcade version\'s end battle with Bebop and Rocksteady with a battle against the mutated fly form of Baxter Stockman.', 'T', 1244, 0, 4.4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qmipn3cczuom0k5ivdb9.jpg'),
(11, 'Tenka no Goikenban: Mito Koumon', '11th September, 1987', 'An adventure game by SunSoft for the Famicom. The game is based on a TV show about a retired governor and his retainers going around solving problems in Edo period Japan. \n \nMito Koumon is a long-running Japanese TV show that follows the elderly Tokugawa Mitsukuni, legendary law-maker and former daimyo of the Mito region, and his two retainers Sasaki SukesaburÅ and Atsumi Kakunoshin as they enter towns incognito and solve problems regarding political corruption, crime bosses and other problems plaguing the common folk. Only after solving the problem would Tokugawa reveal his identity. He and his retainers would then move on. \n \nThe game is an adaptation of the TV show, allowing players to assume the role of one of the retainers as they go around investigating the town. Occasionally this involves fights with corrupt officials, evil samurai and gangsters. There\'s also a female ghost that will drain the player character\'s life if it comes into contact with them. \n \nThe game is noted for its many instances of speech samples. It also has a considerable amount of text. \n \nPlayers move around towns from a top-down perspective, going left or right as well as up and down. They can fight other characters on the screen (not all of which are hostile) as well as enter houses and stores to talk to NPCs or purchase items from them. The goal is to hunt down clues to ascertain what problems are plaguing the town, then go fix them.', 'T', 1245, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pqhs3rnvtyscplw22lsx.jpg'),
(11, 'Tenkaichi Bushi: Keru Naguuru', '21st August, 1989', 'Become the strongest warrior in the world! With the support of your mother and amazing martial arts skills, roam the world to find quests and opponents to hone your skills and become the legend of fighting.', 'T', 1246, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rjaljbdkloh8mpxwgce1.jpg'),
(11, 'Tennis', '14th January, 1984', 'Tennis (ãƒ†ãƒ‹ã‚¹ Tenisu) is a sports game developed and released by Nintendo for the NES. In North America and Europe, Tennis was one of 18 launch games for the NES. A Game Boy version was also released. \n \nThe game features single-player and two-player modes for singles and doubles matches, with either competitive or cooperative gameplay. A computerized opponent\'s artificial intelligence can be set to one of five difficulty levels. Mario referees the matches.', 'T', 1247, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wmrct65feksbsdqiqrsn.jpg'),
(11, 'Terao no Dosukoi Oozumou', '24th November, 1989', 'Terao no Dosukoi Oozumou is a Sports game, developed by TOSE and published by Jaleco Entertainment, which was released in Japan in 1989.', 'T', 1248, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yznl4hsoa9njwharvxdi.jpg'),
(11, 'Terra Cresta', '1st November, 1985', 'Terra Cresta is a vertically scrolling shoot \'em up. The player controls a ship, initially with limited firepower. Numbered pods appear containing further parts of the ship that will increase firepower. These additional parts combine with the player\'s ship to increase its firepower, and the final module transforms it into a fiery phoenix which is invulnerable for a certain period of time. Once the ship has multiple sections, the player may also split it, allowing it to fire in multiple directions. \n \nThe player begins with three lives and it is possible to play with either one or two players.', 'T', 1249, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jkzpwdkq14sd4zcuztub.jpg'),
(11, 'Tetrastar: The Fighter', '24th June, 1991', 'Tetrastar The Fighter is a 3D shooter by Home Data and published by Taito. In the year 2089, humanity forms an alliance with the intergalactic Baal empire but soon Earth finds out about the alien\'s true intentions. A group of resistance assembles the project Tetrastar to prepare for the potential upcoming threat. But the project lead by the general Nelson is soon put on hold and a short lived peace settles in. But the whole thing was nothing more than a hostile invasion and the Baal empire finally breaks the alliance and attacks Earth. The player\'s first mission is to prevent New York to be destroyed and then to retrieve Omega, the faithful robot navigator, to warp to the alien\'s mother world. The Tetrastar super fighter can move around the screen and fire a standard Vulcan gun. Special weapons become available later in the game from Bombs (WID), Homing Missiles (AAM), Napalm Bombs (NAP) and the powerful Bio Cannon (BIO) - they are accessible via the Select button and triggered by pressing A. They all come in limited quantities and must be refilled by picking up power-pods along the way. Tetrastar features nice stages and cutscenes between them unfold the game\'s episodic story.', 'T', 1250, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ji2hg1pe05wtnafqvolo.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Tetris', '31st December, 1986', 'Tetris is an electronic puzzle game that was created by Alexey Pajitnov in 1984, while working in the USSR as a computer programmer. Pajitnov often programmed games to test new equipment using simple tasks, and in his spare time, developed a computer game inspired by his favorite puzzle board game Pentominos. The objective of Pentominos was to fit 12 different geometric-shaped pieces formed out of five squares into a box. \n \nPajitnovâ€™s vision was to create an electronic game where players arranged puzzle pieces in real time by having them â€œfallâ€ faster and faster from the top of the screen. Pajitnov designed the game using seven distinctive playing pieces made from four squares. He called it Tetris, after â€œtetra,â€ the Greek word for four, and tennis, his favorite sport. After giving the game to his colleagues, it became an instant, hugely addictive hit, and shortly thereafter spread like wildfire throughout the Soviet Blocâ€™s computer literate. His subsequent friendship with game designer, Henk Rogers, now Blue Planet Software Chairman and Managing Director of The Tetris Company, brought the Tetris game out of the Soviet Union to become one of the most widely played electronic games of all time.', 'T', 1251, 0, 4.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1tnp.jpg'),
(11, 'Tetris 2', '21st September, 1993', 'The mesmerizing fun of Tetris returns - and the challenge escalates to new heights! Test your dexterity, tease your brain and rack up points with Tetris 2. Your split-second decisions lead you to a new dimension in puzzle-solving action! Play alone or challenge a friend in simultaneous split-screen action. A tougher Tetris with more shapes, more components, 30 levels - and unlimited solutions! If you loved the international game sensation Tetris, you\'ll be wild for the newest dimension in puzzle fun: Tetris 2!', 'T', 1252, 0, 3.2, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jzfuwyalganoepmzufkc.jpg'),
(11, 'Tetsuwan Atom', '26th March, 1988', 'Tetsuwan Atom (é‰„è…•ã‚¢ãƒˆãƒ ?) is an action game developed by Home Data and published by Konami for the Famicom in Japan early on in 1988. The game stars Tetsuwan Atom, a popular early anime character who is better known as Astro Boy outside of Japan. Tetsuwan Atom was originally created in 1951 by Osamu Tezuka. The successful series started as a comic strip and was turned into a black and white animated series in 1963. It was one of the first (if not the first) animated TV series produced in Japan, and has influenced countless Japanese animated series that followed. The little robot-boy is one of Japan\'s most recognizable character. The story takes place in the future, at a time where humans and robots live together in harmony. The powerful robot-boy Atom lives with Professor Ochanomizu, an old scientist who takes good care of the little robot, and helps him fight crime and injustice. One day, burglars break into Professor Ochanomizu\'s lab and steal all of his money. It is now Atom\'s duty to recover the stolen loot.', 'T', 1253, 0, 2.5, ''),
(11, 'Thexder', '1st August, 1985', 'Thexder is a robot capable of transforming into a jet whose job is to destroy the central computer to save the planet.15 stages are waiting you for in this shooting game.', 'T', 1254, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mscg0uppgvqvmohzrffi.jpg'),
(11, 'The Three Stooges', '31st December, 1987', 'Can THREE Stooges save ONE orphanage from FOREclosure? Moe, Larry &amp; Curly starring in their own Cinemaware Interactive Movie?  Why coitanly! Nyuk. Nyuk. Nyuk.  Join those zany masters of mirth as they try to save an old lady and her 3 beautiful daughters from the clutches of an evil banker.  Youâ€™ll love the eyepopping graphics and animation.  And the voices and sound effects digitized from their classic films!  Youâ€™ll maneuver the Stooges through prizefighting, pie throwing and medical madness in the famous â€œCalling Dr. Howard, Dr. Fine, Dr. Howardâ€ scene.  Itâ€™s like starring in a Stooges movie!', 'T', 1255, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/g6jagofr3x2zczhfanh9.jpg'),
(11, 'Thunder &amp; Lightning', '1st February, 1990', 'A &quot;Breakout&quot; type game with interesting characters such as Mr. Chin and the Thunder Warrior. Mr. Chin holds a stick over his head that acts as the paddle. If your ball hits one of the power-up carriers (Flying Saucer, Submarine or Airplane) you have to try and pick up the released power-up while continuing to keep the ball in play.', 'T', 1256, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qngxjslaxajinmjv8c7w.jpg'),
(11, 'Thundercade', '1st October, 1987', 'A nuclear powerplant has fallen into the hands of terrorists and you pilot a motorcyle equipped with machine guns that can be improved along the way. Make your way through difficult terrain and battle against loads of terrorists on foot, in cars, tanks and submarines who will try to stop you. Reach the plant and shoot all the terrorists to save the day.', 'T', 1257, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/i7rfgvnq4srpovo24pj0.jpg'),
(11, 'Tiles of Fate', '1st February, 1990', 'In Tiles Of Fate the object of the game is to clear the screen of all the tiles within the given time limit. This is done by selecting two tiles with matching symbols which will cause them to disappear due to the force of symmetry. However, the force of symmetry can only make two right angles at most, and can not pass through other tiles. To clear all the tiles, you will need to plan your moves carefully. To help out, you may discover one of three forces of fate under a tile which can be saved and used when you\'re stuck. The forces are The Flash of Chance (allows symmetry to affect any matching tiles on the board, even those surrounded by other tiles), The Force of Balance (will eliminate brick walls that block the path of symmetry) and The Flag of Knowledge (this will make your next move for you in case you can\'t spot what the best move is.) Also included is a level editor which lets you create your own tile challenges.', 'T', 1258, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bh3jed5ckse9tubdrsow.jpg'),
(11, 'Time Diver: Eon Man', '10th April, 2010', 'Earth, 60 years into the future. The world is virtually crime free thanks to the Clear System invented by Kane Nelson, scientist extraordinaire. That is, until a secret organization called Romedrux decides to challenge the system by unleashing a plague of crime. In order for them to succeed, they\'ll need to prevent the Clear System from ever being invented, and that means eliminating Kane or his ancestors. Los Angeles, 1993. Dan Nelson thought he was an ordinary student living in LA until the day he found himself under attack by Romedrux warriors. During the attack, Dan learns about his future son, Kane, and vows to protect his family past, present, and future. It\'s a race through time in this new sci-fi thriller from Taito!', 'T', 1259, 0, 2.5, ''),
(11, 'Time Lord', '6th September, 1990', 'It is the year 2999, and warriors from the planet Drakkon are launching a savage attack on Earth. Their weapon: a powerful time travel device. Their objective: to control us by changing the course of our history. To win this war, we must meet the Drakkons on a unique and dangerous battleground: our own past! You are a fearless fortune-hunter, hired by desperate scientists for an experimental journey into the 4th dimension. Your code name is Time Lord. Your mission: blast into the past to save the present from certain doom! Battle the aliens in four historical time zones. Search for weapons sent back by the scientists - and decide when to use them. Solve puzzles to collect the mysterious Orbs that hold the secret of time travel. Be cautious yet quick, Time Lord. You have one short year to free history or be history! And the evil Drakkons have all the time in the world...', 'T', 1260, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bnznspqpztyjjbohlzx4.jpg'),
(11, 'Times of Lore', '31st December, 1988', 'Times of Lore is a pleasant RPG set in the land of Albareth. You play either a Knight, a Barbarian, or a Valkyrie on a quest to search for the magical artifacts that will restore High King Valwyn to power. The game is played in real-time, similar to the Ultima series. The storyline, game play and battle system are simple. The graphics and sound are decent as well. This is a good little game that does not have too many puzzles and is just enjoyable to play with not much thinking.', 'T', 1261, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/i261l5mdhba0xtzjuf54.jpg'),
(11, 'Tiny Toon Adventures', '20th December, 1991', 'Tiny Toon Adventures is a platform video game for the NES. It was published and developed by Konami and released in 1991. It was the first Tiny Toon Adventures-related video game to be released for any video game console device.', 'T', 1262, 0, 3.7, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tcix0lgzclegaayg58km.jpg'),
(11, 'Tiny Toon Adventures 2: Trouble in Wackyland', '27th November, 1992', 'There is a new amusement park in Acme Acres, and everyone has been invited to visit by a &quot;Secret Admirer&quot;. \nThere are five areas which the player can explore, each one starring a different character. Plucky rides a bumper car. Hamton rides a tricky train trip. Babs rides the rollercoaster. Furrball dodges Sweetie as he goes for a wild log ride. And Buster faces the thrills and chills of the Funhouse. \nEach ride costs a certain amount of tickets, but as the player racks up points on the various rides, more tickets are earned. Eventually, when enough tickets have been earned, they can be saved until the player has enough to afford the entrance fee to the Funhouse, where Buster Bunny must then navigate numerous obstacles before squaring off with the &quot;Secret Admirer&quot;, who turns out to be Montana Max. \nJust like in the first game, Roderick Rat is there to try to interfere, plus other villain characters. Other Tiny Toon characters also make appearances in varying degrees.', 'T', 1263, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lt7q9x02pdvxj3oakh9q.jpg'),
(11, 'Tiny Toon Adventures Cartoon Workshop', '1st December, 1992', 'Create a cartoon featuring Buster, Babs, Plucky, Furrball, Calamity, and Little Beeper! You pick the backgrounds, settings, and situations, then add in music, sound effects, and captions to tell the story!', 'T', 1264, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d2cakkuyahvvswgkrrqt.jpg'),
(11, 'Titan', '31st December, 1988', 'Titan takes the Breakout concept and adds another dimension by allowing the object the player controls to be able to move on the Y-axis in addition to the old X-axis. The display will follow the small square which the player controls as it moves on a map where there are objects whom your goal is to make a ball hit. The player controls a small rectangle only slightly larger than the size of the ball itself and in addition to hitting the &quot;bricks&quot; to destroy them has to keep the ball away from dangerous hazards which will kill the ball if it hits.', 'T', 1265, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ofcl49fiymdm3raelmu1.jpg'),
(11, 'Titan Warriors', '30th December, 1988', 'Titan Warriors is a cancelled shoot â€™em up that was developed by Capcom for the NES / Famicom, in 1988. The game was meant to be a sequel of Vulgus, an arcade shooter developed and published by Capcom in Japan in 1984.', 'T', 1266, 0, 2.5, ''),
(11, 'TM Network: Live in Power Bowl', '22nd January, 1990', 'TM Network: Live in Power Bowl (TMãƒãƒƒãƒˆãƒ¯ãƒ¼ã‚¯ ãƒ©ã‚¤ãƒ– ã‚¤ãƒ³ ãƒ‘ãƒ¯ãƒ¼ãƒœã‚¦ãƒ«?)[2] is a Japanese-only Nintendo Family Computer game featuring the J-Pop group TM Network. The song used as the background music is &quot;Come On Everybody&quot; from their album Carol -A Day In a Girl\'s Life 1991- (using the 8-bit sound chip of the Family Computer). Interestingly, the game uses Atlus NES sound engine by Tsukasa Masuko.', 'T', 1267, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/apnaa7lqxtoe8veecjqc.jpg'),
(11, 'To the Earth', '1st November, 1989', 'In the year 2050 the Earth has been attacked by the villainous Raggosians and it is your job to save the planet! You will need to pilot your ship, The Tempest, to the planets Uranus, Saturn, Jupiter, and Earth in order to retrieve certain minerals which can be used to fight the Raggosians. The Raggosians will be trying to stop you from reaching these destinations, though, so you need to use the Nintendo zapper to fight back. Numerous (and very fast!) enemy ships will fly by on the screen and attempt to destroy your ship. You need to shoot the ships and incoming missiles before your ship takes too much damage. From time to time a comet will fly by, and if you shoot this a temporary barrier will be formed that protects your ship from enemy fire. Occasionally you can also earn a smart bomb which appears in the bottom of the screen and destroys all enemies if shot. Each level ends with a large boss which will take multiple hits to destroy.', 'T', 1268, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bs6tu7dxr0honwoojyij.jpg'),
(11, 'Toki no Tabibito: Time Stranger', '26th January, 1987', 'An adventure game based on an anime film of the same name, published for the Famicom by Kemco. \n \nToki no Tabibito &quot;Time Stranger&quot; is an adventure game with a heavy emphasis on text commands and dialogue, similar to other NES adventure games like Portopia Serial Murder Case or Hokkaido Serial Murders: Fade to Okhotsk. \n \nUnlike Portopia and its sequels, there is very little detective work to be done. The player simply visits important people throughout Japanese history as a time-travelling cop, answering their questions and incrementally moving forwards through time towards the present. Most of the game is depicted in a first-person mode where the other person sits across from the main character, who then asks and answers questions. There are a few third-person sequences where the player must get back inside their spaceship-like time machine before it leaves. \n \nWhile there are a few branching paths depending on dialogue choices taken, the game\'s narrative is fairly linear.', 'T', 1269, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jdmfbo5q5olllsmzzwgh.jpg'),
(11, 'Tokoro-san no Mamoru mo Semeru mo', '27th July, 1987', 'An action platformer game by Sony label Sony Epic Records that was only released in Japan on June 27th, 1987. It is named for and features the real-life Japanese celebrity Tokoro Jouji. \n \nTokoro-san no Mamorumo Semerumo is an action platformer that stars real-life Japanese musician/comedian/voice-actor Tokoro Jouji, a.k.a. George Tokoro. Armed with a water pistol with a finite supply of water, Toroko-san must make his way across various levels either shooting or avoiding the various enemies along the way. \n \nThis game has some notoriously poor game design, such as ammo replenishing items being hidden, which means the player needs to shoot randomly to find them which simply depletes their finite ammo supply even faster. If the player takes too long in any one world, a massive vision-obscuring storm will roll in and make the game considerably more difficult to play. The game, however, does feature an early example of a non-linear stage selection progress as different paths become available after defeating each boss.', 'T', 1270, 0, 2.5, ''),
(11, 'The Adventures of Tom Sawyer', '6th February, 1989', 'The Adventures of Tom Sawyer is a platformer game released for the Nintendo Entertainment System in 1989. The storyline does does directly portray the book written by Mark Twain. However, the characters in the game are characters in the book.', 'T', 1271, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fa1ifqvzi3zjkmklpcd6.jpg'),
(11, 'Toobin\'', '31st December, 1988', 'Toobin\' involves Biff and Jet racing their way down the rapids of a river, riding on tires. You rotate your tyre left or right, and drift as the current sends you, making sure to avoid the banks of the river, and the dividing lines in the middle. Hazards include crocodiles, stray logs and branches, and fishermen - you are armed with a limited supply of tin cans to take care of these. There are gates to slide through on the way down - these give you a points bonus. Each level has a strict time limit to adhere to, although there\'s a kickin\' party at the end if you succeed.', 'T', 1272, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tstilhw2iwoylcp7erge.jpg'),
(11, 'Top Gun', '24th November, 1987', 'The sun shimmers on the horizon as your armed-to-the-teeth Navy fighter screams from the carrier deck, accelerating into the danger zone. High above hostile waters your mission is to defend the task force from enemy attack. Suddenly, bogeys flash onto your radar. They\'re everywhere, diving toward you at Mach 2. Only a second to react, you go to guns and arm missiles. Your heart pounds and palms sweat as you blast into the dogfight with cannons blazing. Tracers zip past your engines. Shells shatter your senses. Now it\'s just you against them. And to survive you\'ll need more than speed and firepower. You\'ll need guts and instinct. You\'ll need to be a &quot;TOP GUN&quot; pilot!', 'T', 1273, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/eb9uumdjuwbqxwp2owqs.jpg'),
(11, 'Top Gun: The Second Mission', '15th December, 1989', 'So you think you\'re a Top Gun hero, just because you splashed a few bogeys in the Persian Gulf. Well, before polishing your ego, you\'ve gotta survive a second mission that\'s ten times more deadly than the first. Soaring against an Armageddon bound armada of planes, tanks, ships, and satellite laser beams, every ounce of your skill and courage will be drained as you fight fire with fire, while out-maneuvering anti-aircraft blasts, cannon bursts and heat seeking missiles that are looking to roast your tail.', 'T', 1274, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kue8dtl6zsmjfllx7yhv.jpg'),
(11, 'Top Rider', '17th December, 1988', 'A motorcycle driving game developed by Human and published by Varie for the NES. It was released in Japan only at the end of 1988.', 'T', 1275, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/w2qulsnsryqnxn7zmddd.jpg'),
(11, 'Total Recall', '31st December, 1990', 'Based on the movie of the same name, Total Recall puts you in charge of Douglas Quaid, who must find a way to Mars in order to find the answers to his two questions: why is he being hunted, and who is hunting him. In order to do this, Quaid must go through level after level of beating up bad guys that get in his way. \n \nSome of the levels differ in gameplay, and range between action and driving scenes. The action scenes mainly require you to collect some items before leaving the level. You have only one chance to complete the current level, which means that if your energy is lost, the game ends. Energy is lost if you are attacked by an obstacle, or if you are shot at by an enemy. You can gain more energy by either collecting some pills or a heart, depending on the platform.', 'T', 1276, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tkfbcle1e9bn61dpkzbk.jpg'),
(11, 'Touhou Kenbun Roku', '10th November, 1988', 'A sci-fi/comedy NES adventure game developed and published by Natsume in Japan only. \n \nTouhou Kenbun Roku (&quot;The Travels of Marco Polo&quot;) is an adventure game that uses the then-ubiquitous NES adventure game system of having a series of menu commands with which to interact with the world. As a text-heavy Japanese adventure game, some fluency with the language is required in order to play it. \n \nThe game depicts a troublemaker sent from the future back to 1275, when Marco Polo was in the midst of his explorations.', 'T', 1277, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rmp8ueybpc4hlxkvm3an.jpg'),
(11, 'Tower of Radia', '14th December, 1991', 'Radia Senki: Reimeihen is a Tecmo-developed action RPG released for the Famicom exclusively in Japan. As an amnesiac, the player wanders around the game world with a party in tow as they fight monsters in real time and learn political secrets in the story. \n \nRadia Senki: Reimeihan (literally &quot;Chronicles of the Radia War: Dawn&quot;) is an action RPG developed by Tecmo for the Famicom. Only garnering an official release in Japan, Radia Senki puts players in the shoes of an amnesiac protagonist who can be named. While in search of his own memories, the protagonist soon encounters other characters such as Darth, a man out for revenge, and a mysterious princess and together they roam the game world in search of answers to various questions that plague their lives. As per the times in Tecmo\'s development antics, the game features cinematic cutscenes and musical stylings similar to that of their critically-acclaimed Ninja Gaiden. \n \nRadia Senki features gameplay mechanics that are unconventional for its period, only being commonly adopted in strategy RPGs and other game types in later hardware generations. While there are fundamental RPG components in place such as equipment, shops, town exploration, and experience points, the actual combat takes place in real-time. The player only controls the protagonist directly, but can issue different strategic commands to other party members that, in turn, influence their AI as they fight. Furthermore, while fights do consist of random encounters, they take place on the same playing field as the game world itself, meaning that there are no transitions into battle-specific arenas like turn-based RPGs at the time such as Final Fantasy. Experience points are also gained in real-time as each character defeats enemies. When battles have concluded, the player receives complimentary items before being whisked back to the point on the map where they were walking prior to the fighting.', 'T', 1278, 0, 2.5, ''),
(11, 'Town &amp; Country Surf Designs II: Thrilla\'s Surfari', '31st March, 1992', 'Whoa, Thrilla Gorilla! Bag your boards and lay back tall for the raddest, weirdest surf and skate action ever! Wazula, an evil Kahuna, has stolen your babe and taken her to Africa. No curbs and quarter-pipes here, just the ultimate skate challenge of gnarly jungles and bakin\' deserts! It\'s hardcore surfin\' down killer volcanoes and mammoth waterfalls... ever catch a wave riding a shark? Wazula\'s got some smooth moves of his own, like a two-headed flying Rhino, a saw-toothed Great White, and a way-tough Lava Monster big as a volcano. So get rippin\' through the scorpions, slashin\' through the rapids, and trash that Wazula doofus! But don\'t choke, Thrilla... or your babe\'s toast.', 'T', 1279, 0, 2.5, ''),
(11, 'Town &amp; Country Surf Designs: Wood &amp; Water Rage', '31st December, 1987', 'O.K. dudes, the time has come to really get radical. You and the rest of &quot;Da Boys&quot;, T&amp;C\'s famous group of skate and surf crazies, can kick out and pull off some awesome maneuvers together. Whether you\'re jammin\' the ramps, jumping the cracks, riding the rails or just laying back tall, the skate action is hotter than hot!', 'T', 1280, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ijfdopzy5gqxfsvcstgo.jpg'),
(11, 'Toxic Crusaders', '31st December, 1992', 'It\'s Clean Up Time! \n \nOnly a complete and helpless nerd like Melvin Junko could be such a klutz that he would run into a vat of Grossolium 90, a terribly toxic waste by-product of the Island City Chemical Plant. Now the wimpy nerd Melvin has mutated into Toxie, a hideously deformed creature of super-human size and strength. But all is not lost, Toxie, with his newfound power, has joined forces with Major Disaster, Nozone, Headbanger, and Junkyard to form the Toxic Crusaders. No, not the ultimate heavy metal band, you moron! This motley crew is sworn to defend Tromaville and the rest of the U.S. from the polluting ways of Dr. Killemoff and his Radiation Rangers! \n \nIt won\'t be any easy mop up operation, but with your help the Toxic Crusaders are sure to make a clean sweep of the six levels of sludge, slime, goop and grime, while washing Killemoff and his filthy friends off the face of the earth forever!', 'T', 1281, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jkwbz3h2vnl0lzvvuvde.jpg'),
(11, 'Track &amp; Field', '31st December, 1983', 'Track &amp; Field, known in Japan as Hyper Olympic (ãƒã‚¤ãƒ‘ãƒ¼ã‚ªãƒªãƒ³ãƒ”ãƒƒã‚¯?), is a 1983 Olympic-themed arcade game developed and published by Konami. \n \nThe arcade version was released in 1983. The simple gameplay, based on quick repeating button presses, set the basics for sequels and similar games in the genre for the next decades. There were several home versions of the original; the ZX Spectrum and Amstrad CPC versions were only released as part of the Game, Set and Match II compilation in 1988, and are poorly regarded by fans.', 'T', 1282, 0, 3.75, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ca1va3g6wbvydgm8oeb6.jpg'),
(11, 'Track &amp; Field II', '31st December, 1984', 'A sequel to Konami\'s Track &amp; Field based on the 1988 Olympics in Seoul, South Korea. The game features three different playing modes and 15 different sporting events.', 'T', 1283, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/afv4zghwj7saoc9ffjat.jpg'),
(11, 'Track &amp; Field in Barcelona', '31st January, 1992', 'Track &amp; Field, known in Japan as Hyper Olympic (ãƒã‚¤ãƒ‘ãƒ¼ã‚ªãƒªãƒ³ãƒ”ãƒƒã‚¯ HaipÄ Orinpikku?), is a 1983 Olympic-themed sports arcade game developed and published by Konami. The Japanese release sported an official license for the 1984 Summer Olympics. \n \nThe arcade version was released in 1983. The simple gameplay, based on quick repeating button presses, set the basics for sequels and similar games in the genre for the next decades. \n \nThe NES version of Track &amp; Field was re-released in Europe in 1992 as Track &amp; Field in Barcelona by Kemco in the light of the 1992 Summer Olympics. The opening song for the NES version is the Chariots of Fire theme by Vangelis (which was also used in the arcade version\'s high score screen).', 'T', 1284, 0, 2.5, ''),
(11, 'The Triathron', '16th December, 1988', 'The Triathron allows players to compete in the three consecutive events of the triathlon: Swimming, Cycling and Running. In each stage of the race, the player must mash the B button, similar to Track &amp; Field, in order to reach the end of each course before their opponents. After winning a triathlon, the player can invest some points into their chosen competitor\'s stats and move onto the next.', 'T', 1285, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/czssxxjqtsvrrtcbx4xx.jpg'),
(11, 'Trog!', '1st February, 1991', 'It\'s survival of the fastest in the prehistoric land of Og. That crazy, one-eyed caveman, the Trog, is hungry... and dinos Spike and Bloop know what that means: RUN FOR YOUR LIVES! Here\'s your chance to change the course of history and save the dinosaurs. Don\'t become Trog\'s Stone Age feast! Instead, use your reflexes and wits racing through 50 fun-filled islands, packed with dino-mite action and surprises. You\'ll witness the greatest inventions of all time: fire, the wheel, the pogo stick (the pogo stick?) - all invented by Trog to catch his dinner - you! Just watch out for the Tar Pits... sticky business. You\'ve got special pick-ups to keep that carnivorous chow hound in check, like pineapples that turn you into a ferocious Trog-munching T-Rex. It\'s like this: either you save the Dinos... or you\'re extinct!', 'T', 1286, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fvxlil5eo0sfz7xauyok.jpg'),
(11, 'Trojan', '24th December, 1986', 'The arcade version can be played by up to two players alternating. The game\'s controls consists of an eight-way joystick and two action buttons. Similarly to Kung-Fu Master or Rush\'n Attack, the player jumps by holding the joystick upwards instead of having a dedicated jump button like other side-scrolling action games. Instead, one button is used to swing the sword at enemies and the other button is used to hold the shield to block enemy attacks, including projectiles such as throwing knives and arrows. The shield can be held towards the player while standing or crouching, as well as upwards vertically and diagonally. Some enemies will throw magic balls which will cause the player to lose their sword and shield if they block. During these instances, the player will fight barehanded, with the sword and shield buttons used to punch and kick respectively. The sword and shield will appear on-screen after some point, allowing the player to recover their weapon. Other power-ups includes floating hearts that will restore the player\'s health and jumping spots where the player can jump higher than usual. \n \nThe game consist of six stages, where the player will face the usual series of small fry enemies, as well as a sub-boss at the middle of each stage and a boss at the end. The player is allowed to start the game at any of the six stages. However, the player must play through the entire game again after defeating the final boss, Achilles, in order to see the true ending (similarly to Ghosts\'n Goblins). The player can continue after a game over depending on the dip switch settings.', 'T', 1287, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ordgfcwyotvkrudq3osu.jpg'),
(11, 'Trolls in Crazyland', '22nd August, 1993', 'Winky\'s girlfriend, Kiki, has suddenly disappeared. When Winky learns that Kiki is imprisoned in the Amusement Park Crazyland, he decides to free her. When entering the park, Winky senses that something is quite rotten. \n \nIn order to find Kiki, he has to cross the entire park, which means he has to ride a roller coaster and use his fire balls and other useful tools to eliminate the hostile comic figures that stand in his way. \n \nEnter the exciting world of trolls and enjoy the attraction of your life in this totally crazy Crazyland adventure on NES!', 'T', 1288, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/f7l1cwsgwifpqxojz63b.jpg'),
(11, 'Trolls on Treasure Island', '1st February, 1994', 'In this puzzle game, the player controls one of the trolls as they bounce back and forth across the screen trying to acquire the jewels on the playfield. The one caveat is that the players troll has to match the color of the jewel he or she is trying to collect. To become the correct color to snatch up the jewels, the player has to bounce across a paint can that will change your trolls hair to that of the same color as the paint can. The object in each puzzle is to retrieve all the treasures in a room without their character falling prey to the various enemies in rooms or running out of time.', 'T', 1289, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oawwcly9jxwsxuidqw82.jpg'),
(11, 'Tsuppari Wars', '28th July, 1991', 'Tsuppari Wars ( ã¤ã£ã±ã‚Šã‚¦ã‚©ãƒ¼ã‚º?, &quot;Delinquent Wars&quot;) is an action video game for the Family Computer. The object is to acquire all of the enemies\' territory and defeat the evil gang leaders. Even though this game was only released in Japan, the gangsters fight without any weapons and the violence level is mild compared to later gang-related games. Its spiritual descendant is Grand Theft Auto: San Andreas due to its simulation of gang warfare. \n \nOnce the main gang leader is defeated in either Tsuppari Wars (ãƒ„ãƒƒãƒ‘ãƒªã‚¦ã‚©ãƒ¼ã‚º?) or Tsuppari Suku (ãƒ„ãƒƒãƒ‘ãƒªã‚¹ã‚¯?) mode, the remaining members of the gang switch membership to become a gray-colored gang that does not have a leader. Consequently, all territory that belonged to leader that was killed in combat becomes neutral territory with a number describing the strength of the &quot;neutral gangs.&quot; These &quot;neutral gangs&quot; will attempt to defend their turf. In order for a gang with colors (red, blue, or green) to use the land as their own, they must eliminate all the gangsters in that territory. However, invasions can be canceled before they can begin by saying &quot;no&quot; when asked to fight (ãŸãŸã‹ã„?, &quot;Struggle&quot;). \n \nNeutral gangs, fortunately, do not have ability to invade the territories of the red, blue, or green colored gangs. There are three difficulty levels for computer opponents and games are possible with two or three colors (but never with only one color). After naming the character (using the Japanese alphabet), the player must select his face that will represent his main gang leader. The two gang leaders involved will use a special fighting game engine to settle their differences while individual gang members will fight each other through a special battle screen. The battle screen allows players to use special effects against the opponent like a motorcycle, a thunderstorm, or even a quick call to the police\'s riot squad. All brawls are timed by a timer which is never seen in the game. \n \nThat means if there is no determined winner in a certain number of time, the brawl ends with a stalemate and no territory gains or losses are made. The brawl can be re-initiated either during the player\'s next turn or during the opponent\'s turn. There are eight different maps to choose from that depict the world in a manner similar to the board game Risk. There are islands with land bridges and bodies of water to them. Between combat, the player can either move (ã„ã©ã†ã—?, &quot;Not among&quot;) his gang members from territory to territory or immediately end his turn. It is possible for a player to transfer all of his gang members out of a territory, turning it into a blank grey territory without a number.', 'T', 1290, 0, 2.5, ''),
(11, 'Tsuri Kichi Sanpei: Blue Marlin Hen', '17th March, 1988', 'A fishing sim based on a manga license for the NES. It was developed by Victor Interactive and never released outside of Japan. \n \nTsurikichi Sanpei: Blue Marlin Hen (lit: &quot;Fishing Maniac Sanpei: Blue Marlin Chapter&quot;) is a fishing sim based on a manga and eventual anime named Tsurikichi Sanpei, following the adventures of a preternaturally gifted young fisherman and his travails in various fishing competitions. \n \nThe game is centered around one of these fishing competitions, where Sanpei has a limited amount of time to catch the largest blue marlin out of all the competitors. The player must make careful judgements and use their limited time wisely to find and hook the largest marlin they can before the competition ends. \n \nThe first game based on the Tsurikichi Sanpei license, Blue Marlin Hen was released on the NES and the MSX around the same time in 1988. Later, there would be a sequel of sorts for the MSX only in 1989 and a PS1 game much later in 2002. \n \nIn order to catch anything, the player must choose one of several regions of sea in which to fish. Areas which look promising have large fish icons. Time passes more quickly on this screen, so it\'s in the player\'s best interest to find a spot quickly. \n \nOnce a sea region has been selected, the player must choose the right kind of bait for hooking billfish and simply sit until they have a bite. At this point, the player must use the gauge above the screen to maneuver themselves and reel the fish on the line. Each fish is judged on its size and play resumes.', 'T', 1291, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bfnxbykdwmbmimpxbbfq.jpg'),
(11, 'Twin Eagle', '1st April, 1988', 'A helicopter vertical shoot \'em up that debuted in the Arcades in 1988 before being ported to the NES the following year.', 'T', 1292, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oxjct37nq3rwev1c275z.jpg'),
(11, 'TwinBee 3: Poko Poko DaimaÅ', '29th October, 1989', 'TwinBee 3: Poko Poko DaimaÅ (ãƒ„ã‚¤ãƒ³ãƒ“ãƒ¼ï¼“ ãƒã‚³ãƒã‚³å¤§é­”çŽ‹ TsuinbÄ« SurÄ«?, &quot;The Great Demon King Poko Poko&quot;) is a vertical-scrolling shoot \'em up video game produced by Konami originally released for the Famicom in 1989. It was the third game in the TwinBee series released for the Famicom, following the home version of the original TwinBee and the Famicom-exclusive Moero TwinBee. Unlike Moero, which was released in North America as Stinger, TwinBee 3 was a Japan-only release. It was re-released on April 14, 2006 as part of the i-Revo downloadable game service. \n \nTwinBee 3 ditches the side-scrolling stages from Stinger and only features top-scrolling ones similar to the original. Moreover, the game lacks the 3-Player mode from Moero, allowing only up to two players. The game is considerably easier than its predecessors due to an option mode that allows players to adjust the difficulty and number of ships, as well as the inclusion of the new &quot;soul reviving system&quot;, which allows players to recover their power-ups after losing a ship. \n \nThe game uses digitized PCM voice samples, particularly when the conga music in one stage chants &quot;Poko Poko&quot;, and in the beginning of each stage, in which a voice proclaims the name of the stage.', 'T', 1293, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gzj48gc67udgutu1cewm.jpg'),
(11, 'Uchuu Keibitai SDF', '7th October, 1990', 'A meteorite group floats in space, full of mystery. Near the sand filled planet, a battleship looms. Space colonies emerge in the moon light. In the endlessly wide universe, a large shooting game that unfolds .', 'U', 1294, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vpckeickish7hbaj2an8.jpg'),
(11, 'Uchuusen Cosmo Carrier', '6th December, 1987', 'When the moon departed from its usual orbit sometime in the year 1999, Nostradamus\' prediction finally become true. A huge squadron of spaceships piloted by hostile alien forces came out of an artificial planet constructed near Pluto. A ragtag defense force has been assembled by the leaders of humanity in the hopes of being able to fend of the invasion. \n \nOnly a photon missile, invented by the extraterrestrials themselves, can destroy this fake planet and bring a halt to this invasion. The earth only has 100 days left to live unless the commander of the Cosmo Carrier can succeed in his duties.', 'U', 1295, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y7shts7ml7fvvszyct0k.jpg'),
(11, 'Ultima: Exodus', '1st March, 1989', 'Ultima: Exodus is the first release for the Nintendo Entertainment System of the popular series. Don\'t expect to able to follow the storylines from the original computer series; this version is completely different and is meant as a stand alone game. At the beginning of the game, you can form your party either from a computer generated randomization or make your own characters if you have the time and talent to do so (there are a TON of different options for characters). \n \nThe evil Exodus has risen from the seas to make his new home on a fiery island near Britannia Kingdom. Lord British sends out a plea for the best and greatest warriors known to man to join your group as you set out to defeat this monster. So gather ye weapons and magic spells and take on evils unknown is Ultima: Exodus.', 'U', 1296, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/isqdo1xfjgaesjnbbu6x.jpg'),
(11, 'Ultima IV: Quest of the Avatar', '31st December, 1985', 'As an addendum to this work, I, Lord British, would like to speak of the Quest of the Avatar mentioned in these pages. The Quest of the Avatar is the search for a new standard, a new vision of life for which out people may strive. We seek the person who can become a shining example of our nation and guides us from the Age of Darkness into the Age of Light. We have sent this message our to the farthest reaches of the known universe, indeed, we have even spoken across the void of time. Is there One who can complete the Quest of the Avatar? Many have tried already, and have met with partial success, becoming enlightened in one or more of the Eight Virtues of the Avatar - but none have yet attained the true state of being an Avatar. \n\nThe secrets of the Avatar are buried deep in the hearts of both our people and the land in which we dwell. The search will be arduous and the One who shall succeed must be able to assemble all the parts of the great mystery in order to solve the Quest. Gaze upon the device portrayed on the facing page of this tome. Learn it well, for when thou dost gaze upon it again then shall thy life\'s quest be revealed.', 'U', 1297, 0, 4.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1oi8.jpg'),
(11, 'Ultima V: Warriors of Destiny', '1st March, 1988', 'After a century of relative peace, the Avatar of Virtue is summoned back to the medieval kingdom of Britannia to deal with a new threat: the usurper Lord Blackthorn, a formerly honorable nobleman who has been corrupted by strange new creatures called the Shadowlords. After the recent disappearance of the true king, Lord British, the realm has fallen under martial law. Blackthorn now rules the land by brutally enforcing the eight Virtues upon the people of Britannia - corrupting their meaning in the process. The Avatar must gather together his former companions, now made outlaws by Blackthorn\'s regime, and venture forth to defeat the vile Shadowlords and recover the true king from the shadowy depths of the Underworld.', 'U', 1298, 0, 4.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ppksa703bkhisieixrkc.jpg'),
(11, 'Ultimate Air Combat', '1st May, 1992', 'Ultimate Air Combat has 36 different missions, then one last final mission. Each mission is grouped into two parts. The first part uses a cockpit view where the player must shoot down three planes before either running out of fuel or getting shot down by enemy planes. After that, the second half of the mission uses an isometric view where the player must destroy enemy forces and installations.', 'U', 1299, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/m2txgy2fr1b18pwqc6zt.jpg'),
(11, 'Ultimate Basketball', '1st October, 1990', 'Shoot some hoops with Ultimate Basketball. All of the traditional rules of basketball apply as you take control of a fictional team from one of seven American locales. Each team has its own full roster of players as well as unique strengths and weaknesses. For example, Houston has a tight defense and can shoot the three, while Dallas excels at the passing game. \n \nThe point of view is horizontal for the most part. Occasionally, you will get a close-up action scene on plays such as slam dunks and free throws. There are also two different play modes, &quot;Tournament&quot; and &quot;One Game.&quot; You can play by yourself, against a friend, or with a friend against the computer.', 'U', 1300, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gjtm8sjd7zb0gmg6dt6t.jpg'),
(11, 'Ultimate League Soccer', '1st February, 1992', 'Yes it\'s ULTIMATE LEAGUE SOCCER with one of the highest stakes in international sport. \n Get into the action of Ultimate League Soccer, made up of the top players from around the world, play soccer with more power and determination than it\'s ever been seen in the history of the game. \n Now you can join these great international players as they compete in the most exciting sport ever. Choose from eight of the world\'s top teams. Play against the computer or take on a friend in a head to head contest of skill that will challenge you as never before.', 'U', 1301, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ag5qev4vvfetdbkgcyne.jpg'),
(11, 'The Ultimate Stuntman', '5th October, 1990', 'Too hot to handle? Or can you take up the challenge? Equipped with a dazzling range of weapons and skills, travel through scores of different action scenes, battling against the hottest, meanest, mechanized maniacs ever dreamed up! Rescue the kidnapped scientist to halt the corrupt plans of Dr. Evil. Heaps of hardware, power-ups, bonuses, booby-trapped bombs and the baddest bosses!', 'T', 1302, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rocebsqt8rguzduhilyf.jpg'),
(11, 'The Uncanny X-Men', '1st December, 1989', 'The entire human race is in danger! Magneto and his band of evil mutants are on the rampage and nothing can stop them... except for you, professor Xavier and your uncanny X-Men. Cerebro, your advanced computer system, displays the different missions, all of which must be completed in order to accomplish your ultimate goal... the defeat of Magneto! \nWorking with Wolverine, Cyclops, Storm, Colossus, Nightcrawler and Iceman, you select the best attack team for each battle based on their combination of superhuman skills. \nThe X-Men must work together as a team in both the 1 player and 2 player games. The 2 player game features simultaneous control where cooperation and teamwork are essential... but be careful; once one of your super heroes is immobilized, they\'re out of action for the rest of the game. Good luck... humanity\'s fate is in your hands!', 'T', 1303, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/auintiq0qjn5rvt4kttj.jpg'),
(11, 'The Universe Soldiers', '31st January, 1993', 'The Universe Soldiers is a Pac-Man clone made by the Taiwanese developer, Gametek. \n \nIn the game you travel around the universe collecting dots to save the universe. Each world within the game contains 2-3 levels. An ending is also included.', 'T', 1304, 0, 2.5, ''),
(11, 'Urban Champion', '14th November, 1984', 'Urban Champion (ã‚¢ãƒ¼ãƒãƒ³ãƒãƒ£ãƒ³ãƒ”ã‚ªãƒ³) is a 2-player fighting game produced by Nintendo in 1984. It was inspired by the 1984 Game &amp; Watch title, Boxing (also known as Punch-Out!!). It is also Nintendo\'s first 2D fighting game, followed by the 1993 Joy Mech Fight, released exclusively in Japan for the same platform.', 'U', 1305, 0, 2.65, 'http://images.igdb.com/igdb/image/upload/t_cover_big/mn99pjoaghuvza3rxikx.jpg'),
(11, 'Urusei Yatsura: Lum\'s Wedding Bell', '23rd November, 1986', 'In Urusei Yatsura: Lum\'s Wedding Bell (ã†ã‚‹æ˜Ÿã‚„ã¤ã‚‰ ãƒ©ãƒ ã®ã‚¦ã‚§ãƒ‡ã‚£ãƒ³ã‚°ãƒ™ãƒ« Urusei Yatsura: Ramu no Uedingu Beru?), the player controls Lum as she grows up and has to avoid alien invaders while trying to reach her rescue UFO. The game\'s storyline involves a severe earthquake striking in Tomobiki-cho (the town where the Urusei Yatsura series takes place) and tearing the space-time continuum, forcing Lum to have to travel forward through time in order to be reunited with her &quot;darling&quot; Ataru Moroboshi. \n \nThe player starts out at infant school, then works her way to elementary school, junior high school, high school, college, and finally the player gets married to a bridegroom (Ataru) in a white tie outfit. After that, the game starts over again. The game has never been released outside Japan.', 'U', 1306, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/nkeeryjtg4waqqmrrfh8.jpg'),
(11, 'Utsurun Desu.: Kawauso Hawaii e Iku!!!', '6th March, 1992', 'While ostensibly a traditional platform game in which the player controls Kawauso-kun, the game has gained renown for being one of the earliest titles to attempt to break away from the video game conventions of the time. Among other convention-flouting novelties that the game offers are a series of fake title screens that the player must pass through at the start, and the allowance of the main character to traverse the background at times to bypass pits of spikes that otherwise appear impossible to cross. \n \nIn addition, the character\'s attack requires the player to hold down the attack button as the game cycles through the possible special moves with the more powerful attacks only highlighted for a short period of time.', 'U', 1307, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lmk7ubcq0gbgzfm8zl8y.jpg'),
(11, 'Vegas Connection: Casino Kara Ai o Komete', '23rd December, 1989', 'Vegas Connection: Casino Kara Ai o Komete is a Miscellaneous game, developed by Graphic Research and published by Sigma Ent. Inc., which was released in Japan in 1989.', 'V', 1308, 0, 2.5, ''),
(11, 'Vegas Dream', '30th September, 1988', 'Bring a casino to your living room! Up to four high-rollers can play Blackjack, Roulette, Keno, or Slot Machines. Odds are youâ€™re going to love VEGAS DREAM!', 'V', 1309, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/vyv3sewqemxdnbeav9j8.jpg'),
(11, 'Venice Beach Volleyball', '1st February, 1991', 'Venice Beach Volleyball is no doubt the coolest video game under the hot summer sun. Check it out! We took miles of clear blue sky, warm sand, along with millions of gnarly 8-foot waves, mixed in dudes, babes, and one ton of pure fun, then crammed the whole thing with the maximum amount of challenge and excitement allowable by federal law. Here you have it, the most excellent beach volleyball game ever! Locals say kicking the butt of a computer controlled team is never easy without a lot of practice. You haven\'t seen anything until you challenge a friend head to head in competitive double player action mode. Way rad beach volleyball action, blazing 8-bit graphics and killer tunes. That\'s what VENICE BEACH VOLLEYBALL is all about!', 'V', 1310, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/c9qdfwwbrvyitoo7lfkh.jpg');
INSERT INTO `gamelist` (`pageid`, `gametitle`, `gamedate`, `gamedesc`, `gameindex`, `gameid`, `deleted`, `gamerating`, `gamecover`) VALUES
(11, 'Videomation', '2nd June, 1991', 'With Videomation, everyone is an artist! Videomation has drawing tools, stamps and an animation feature that lets your imagination go wild! Use with the NES to create vivid pictures with spectacular colors - some you can even program to move! Add fun stamps to your drawing and direct the animation selection to make it come alive. Hook up your VCR with Videomation to create wonderful, crazy additions to your family videos. It\'s easy enough for everyone! Bring the action of a starship battle or the mystery of a dark forest into your home. Remember, the only limits to Videomation is your own imagination!', 'V', 1311, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qwnxqgjalkgyabpgwvnz.jpg'),
(11, 'Vindicators', '31st December, 1988', 'he game begins by asking the player(s) to choose a difficulty level, not only making the enemies more difficult and the players weaker, but higher difficulties start the players in a later set of levels (called &quot;galaxies&quot;) and with some powerups. The easiest difficulty level starts the player(s) in the first level with no bonuses. The player controls a tank with constantly draining fuel, and must navigate through multiple levels (14 stations in the arcade version) from bottom to top, encountering obstacles and enemies. Along the way, a player may find powerups including tank fuel, stars (currency), shields, and two types of sub-weapons: smart shots (homing missiles) and bombs (powerful rockets). Each level has a key that will open a door at the top of the level, which will either take the player to the next level or to a special hub with multiple powerups that must be escaped in 10 seconds or less. If the player is unable to escape, the tank will lose half its fuel. After escaping the hub, the player(s) then proceeds to the next station. \n \nOccasionally, the player(s) will face a boss that must be defeated to advance. Normal shots are ineffective however, and the player must decide/guess the appropriate time to buy sub-weapons to greatly raise the chance of victory. After destroying a boss, the player(s) can continue to the end of the level. \n \nBetween levels, the player is taken to a shop where items and upgrades to tank speed, power, etc. may be purchased with stars. Any damage caused to the player\'s tank will decrease the shield level. Purchasing a shield drastically reduces damage down to a mere pixel worth of the fuel gauge per hit. When the fuel depletes, the speed of the tank is reduced to a crawl and a countdown begins from 10. If no fuel is gained before the timer reaches zero, or if the player is shot during the countdown, the tank explodes and a life is lost. \n \nThe arcade version, in addition to having special two-joystick controls for each player, contained three special contest levels, with one contest star in each. With three contest stars and nine normal stars, the player(s) could compete in a special time-limited contest level in which the player could win a T-shirt. A later version of the game was released which eliminated the contest levels and stars.', 'V', 1312, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ntbteeq60ihtvcmwukkv.jpg'),
(11, 'NES Virus Cleaner', '26th May, 2011', 'NES Virus Cleaner is pretty much a spoof of the NES Cleaning Kit. That thing barely helped clean the NES, just as NES Virus Cleaner doesnâ€™t do much for removing â€œvirusesâ€ from your NES. You guide Clik, the hero, around inside your NES and grab viruses in the various spots they are placed. The ultimate goal is to get to the lockout chip and destroy Virii, the main virus. The obstacles in the game are electric bolts, electric sparks, disappearing blocks, a homing missile system, and of course, time. If you run out of time on a certain level, the game is over. If you get hit by an enemy, you will respawn at the point where you picked up the last virus. Itâ€™s a pretty simple concept overall. I tried to cover everything in the tutorial, but I did in fact miss the part about respawning at the last picked up virus. Oh well, things happen!', 'N', 1313, 0, 2.5, ''),
(11, 'Volguard II', '7th January, 1986', 'The player controls a pilot who is trying to defend the Earth from an evil nation\'s global revolution sometime in the year 20XX. Given the assignment, the overall purpose of the game is to infiltrate their base and take out their defences and army, and then kill their leader. Enemies include a series of battle stations, various groups of aircraft, barriers, cargo planes, mechs, and other assorted enemies. Volguard II was a modified high-mobility combat mecha developed by the distant ancestors.', 'V', 1314, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jigmugk9ibrbbi7d35l9.jpg'),
(11, 'Volleyball', '21st July, 1986', 'Volleyball is one of the fastest team games around, and this NES classic recreates the speedy sport in a way that anyone can play.', 'V', 1315, 0, 1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/v3wsjre1fjxilrheb0vo.jpg'),
(11, 'Wagyan Land', '9th March, 1989', 'Wagyan Land is an Action game, developed by Now Production and published by Namco, which was released in Japan in 1989.', 'W', 1316, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sa7h0ele9iaapfveec3n.jpg'),
(11, 'Wagyan Land 2', '14th January, 1991', 'Wagyan Land 2 is an Action game, developed by Now Production and published by Namco, which was released in Japan in 1990.', 'W', 1317, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/irtnayfw3ezx3fjqtomv.jpg'),
(11, 'Wagyan Land 3', '8th January, 1993', 'Wagyan Land 3 is an Action game, developed and published by Namco, which was released in Japan in 1992.', 'W', 1318, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rut5xpnfhoeifebtedqo.jpg'),
(11, 'Wai Wai World 2: SOS!! Parsley Jou', '5th February, 1991', 'Wai Wai World is in trouble, as the evil Waruumon has kidnapped Princess Herb! Luckily, Dr. Cinnimon has created a hero that can stop him. Rikkuru! Can he save the princess, by traveling through all of Wai Wai world??', 'W', 1319, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bam3prmslpfwadw0zek9.jpg'),
(11, 'Wall Street Kid', '1st July, 1990', 'Where life, love and money all depend on how well you play the game. Make billions of dollars when you deal with the giants of Wall Street. Not only do you take risks by playing the stock market, but you must prove you can uphold a high standard of living. If you dream of fame and fortune, this Life Simulation game is your way to the top. You can taste the victory of success, but only if you\'re strong enough to face the challenge of life. Now, are you ready to deal?', 'W', 1320, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dmcpzi498digrqnnxonu.jpg'),
(11, 'Wally Bear and the NO! Gang', '1st February, 1992', 'Wally Bear and the NO! Gang is a side-scrolling platformer designed to teach kids the dangers of doing drugs, gang banging and hanging out with the wrong crowd. Most obstacles can be avoided, but Wally can also bop enemies on the head with his skateboard. The game features seven levels to traverse and a total of two power ups to find all while racing against the clock to help out your friends.', 'W', 1321, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bppxlh9g3uz5qojri7ea.jpg'),
(11, 'War in the Gulf', '1st February, 1991', 'A game produced in Brazil for the NES clone Turbo Game. \n \nThe Persian Gulf and the Paradise of the Black Gold (Petroleum). Many countries depend on the oil for its proper economic development. One ambitious politician, to satisfy its desire to control the world, ogranized an army with extraordinary power fight and occupy the Persian Golf. The dependent countries had been without conditions to face this ruler, then, they had created an organization for the protection of peace worldwide and had sent the helicopter SUPER AH-64 to intervene in the enemy battlefield.', 'W', 1322, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ftwmun46iderc7rqspai.jpg'),
(11, 'Wario\'s Woods', '19th February, 1994', 'It\'s up to Toad to keep the woods safe in this new Super NES puzzle action! \n \nToad is back in his very own big adventure in this game with the challenge of Tetris. It\'s up to you and Toad to keep peace in the Mushroom Kingdom - and that means outfoxing the wicked Wario! \n \nMonsters, goblins and bombs fall from the sky faster and faster as Wario fires them into the woods. Toad must scramble to catch and line up the falling puzzle pieces to eliminate Wario\'s evil hold. If you loved Tetris, this puzzle action game is for you!', 'W', 1323, 0, 3.45, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1wqb.jpg'),
(11, 'Warpman', '12th July, 1985', 'Warpman is an Action game, developed and published by Namco, which was released in Japan in 1985.', 'W', 1324, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wtipey8vhvyircf7wnnm.jpg'),
(11, 'Wayne Gretzky Hockey', '1st February, 1991', 'Face off with &quot;The Great One&quot;, number &quot;99&quot;, Wayne Gretzky, nine-time winner of the NHL\'s MVP award and all-time hockey great. Designed with Wayne and other hockey professionals, this riveting simulation is packed with all the excitement and hard-hitting action that could be squeezed into a computer. From the adrenaline rush of a breakaway goal to the tension of sudden death overtime, Wayne Gretzky Hockey takes you onto the ice for the ultimate test of skill.', 'W', 1325, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/dgbmjpoxreldakpxahde.jpg'),
(11, 'Wayne\'s World', '18th February, 1993', '&quot;Wayne\'s World, Wayne\'s World! Party time! Excellent! Woo, woo, woo!&quot; \n \nIt\'s Friday, it\'s 10:30 and like usual, Wayne and Garth are presenting their TV show. First they start off by reading a top-10 list of the worst games they recently played at the arcade. Then Wayne accounts on how he and Garth were suddenly sucked into a video game, and Garth was kidnapped by the mysterious Zantar. &quot;Weeuuu, weeuuu, weeuuu!&quot; FLASHBACK, and now you\'re suddenly in control of Wayne as he must embark upon a quest to save his good pal Garth. \n \nNot to be confused with the DOS license, this Wayne\'s World is a platform- style game. You must jump, fight and rock your way through 4 different levels which include Kramer\'s Music Store, Stan Mikita\'s Donut Store, Gas Works and Surburbia. Using Wayne\'s guitar as your sonic weapon, it\'s most excellent noise will bring death to various enemies. Will you save Garth from the evil purple clutches of Zantar? SCHWING!', 'W', 1326, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fkrw95bvznc6tdfqpxhv.jpg'),
(11, 'Werewolf: The Last Warrior', '1st December, 1990', 'He\'s BAD, RAD and extremely MAD - because to a WEREWOLF, there\'s nothing like revenge! The world\'s been destroyed by Dr. Faryan, a twisted madman possessed by an ancient spirit. Faryan\'s henchmen rule. But one buff warrior\'s been granted magical powers of the wolf and is now out to bust-up Faryan. And when WEREWOLF finds him, the fur and fangs will fly!', 'W', 1327, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/y6tkbybxgbfuqac6jx1t.jpg'),
(11, 'Wheel of Fortune', '1st October, 1998', 'Wheel of Fortune was the first game based on the TV game show for the NES. It was developed by Rare and released on the same month as their NES Jeopardy! adaptation. Rare would follow it up with two more NES adaptations of the show: Wheel of Fortune: Junior Edition and Wheel of Fortune: Family Edition. \n \nIt follows the rules of the show, where people spin a wheel and then try to solve a hangman puzzle, either guessing a consonant or spending their reward money to buy a vowel. Up to three human players can play via a pass-and-play system. Players must input their answers within a time limit using the in-game text parser.', 'W', 1328, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1k7k.jpg'),
(11, 'Wheel of Fortune: Family Edition', '1st April, 1990', 'Wheel of Fortune: Family Edition is one of a series of NES games based on the famous TV game show. The goal is to solve a word puzzle by guessing letters. The players take turns spinning a wheel that has designated money amounts in most spaces, but can also bankrupt the player in the wheel lands on the wrong space. A player can guess a letter and if that letter is in the puzzle, those spaces are flipped to reveal the letter and the player earns the cash amount specified by the wheel spin, multiplied by the number of occurrences of the letter. Only English consonants can be guessed-- the 5 English vowels can be purchased using a player\'s earnings.', 'W', 1329, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d2narmz2rwvkf2dezrmu.jpg'),
(11, 'Wheel of Fortune: Junior Edition', '1st November, 1989', 'Now everyoneâ€™s favorite TV Game Show is just for kids! Itâ€™s got all the excitement of the adult versionâ€¦ everything you see on TV and more, But the puzzles have been created just for the younger player. \n \nItâ€™s your turn to be the contestant. Compete against your friends or match wits with the computer. Press the button, hear the theme music, spin the wheel, solve the puzzle and win a fortune, or hit bankrupt and lose it all. There are over 1000 puzzles to keep you guessing, and if youâ€™re stuck you can always buy a vowel. Itâ€™s time to play WHEEL OF FORTUNE!', 'W', 1330, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/gza4dpkcvtdg5uhp5xxq.jpg'),
(11, 'Where in Time is Carmen Sandiego?', '31st December, 1989', 'Carmen Sandiego and her gang are loose once again, and it is the players job to capture her! This time around the player not only has to find where she is, but also when she is. Traveling to various locations, they need to assemble clues by questioning witnesses and searching locations to close in and capture Carmen Sandiego. Included with the game is The New America Desk Encyclopedia to help make clues more meaningful (and act as a form of copy protection!).', 'W', 1331, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rzzds6p0foqwixtjur8w.jpg'),
(11, 'Where\'s Waldo?', '1st September, 1991', 'Your goal is to find Waldo in various pictures in order to progress through the game. \n \nThe pictures are still images the size of the screen in the Easy and Practice levels. In the Medium and Hard levels, the player has to scroll to the side to see the rest of the area. The directional buttons control a magnifying glass and once the player finds Waldo, they get to go to the next level and a new picture.', 'W', 1332, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xen5txzsyeihpy1ltnfy.jpg'),
(11, 'Who Framed Roger Rabbit', '1st September, 1989', 'You play this game as the Private Investigator, Eddie Valliant, while Roger Rabbit wanders around the scenery behind you. Your job is to search the city for clues, items and punchlines to jokes which will be your only defense should the Weasels catch up to poor Roger. Except for these Weasels (and birds flying overhead), Roger is more or less invincible as a toon. That means for most of the gameplay, he will be ignored. Should the Weasels appear in an area with you however (with an alarm sounding as they get close), Roger will go bug-eyed and try to run away. It is then up to Eddie to keep the Weasels away from Roger or engage in knock-knock jokes should they happen to catch him.', 'W', 1333, 0, 3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/wqxmprzcsf4lnjgqllqw.jpg'),
(11, 'Whomp \'Em', '1st April, 1991', 'Unknown perils lurk behind every corner! Seven powerful magical objects to use. Fight your way through eight complete worlds. Choose your own adventure. Grapple evil beasts at the end of each world.', 'W', 1334, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/df8cux2ial5es30p3oac.jpg'),
(11, 'Wild Gunman', '18th February, 1984', 'Wild Gunman (ãƒ¯ã‚¤ãƒ«ãƒ‰ã‚¬ãƒ³ãƒžãƒ³ Wairudo Ganman) is a light gun shooter game created by Nintendo.', 'W', 1335, 0, 3.1, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ig1hbeq7bjokiqzluzn3.jpg'),
(11, 'Willow', '18th July, 1989', 'The arcade version of the game belongs to the platform genre. It has six stages, some where Willow plays his part, others where Madmartigan plays his and one of the stages where either character is selectable. Move the joystick left or right to move in that direction. Press the A button to use a weapon. Hold down the A button and let go to fire stronger shots indicated on the magic power gauge. Press the B button to jump. While jumping press the B button and move the joystick up to haul up ledges. Press the B button and moving the joystick down the player can descend ledges or slide on other surfaces. Chests can be smashed open to reveal useful items. Collect gold for purchasing items at shops from the Owl Mage. Purchasable items include weapons, healing potions, defensive jewellery, a life pack, a 1-up and some information. Depending on whether the player is playing as Willow or Madmartigan determines if either the magic weapon or the blade weapon can be purchased. There are also sub-bosses in some stages. At the end of each stage, stage boss must be defeated to proceed. \n \nThe version of Willow released for the Nintendo Entertainment System and the Famicom is an adventure game in the vein of The Legend of Zelda. The game has the player taking on the role of Willow. Unlike the film and arcade game, Willow generally travels alone, only briefly meeting other characters. In the tradition of The Legend of Zelda, Willow wields a sword and shield and many supplementary items along with a wide variety of magic spells. As the game progresses and Willow defeats enemies, he gains experience points and levels as in a role-playing video game.', 'W', 1336, 0, 3.3, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pqqo1sh0rnwllabwidlz.jpg'),
(11, 'Win, Lose or Draw', '1st February, 1990', 'Win, Lose or Draw was a popular TV show requiring artistic skills and an ability to think laterally. A player on your team draws something on the big game board, and you must work out what it represents. They will be common expressions depicted literally, such as \'bright idea\' showing a light bulb over somebody\'s head, and \'cabin fever\' as a rickety building next to a man with a thermometer in his mouth.', 'W', 1337, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z9etszjdezj1mlopwrby.jpg'),
(11, 'Winter Games', '31st December, 1985', 'Another in the series of Epyx Olympic sports games. Compete in many different sporting events like: Ski Jump, Hot Dog, Biathlon, Bobsled, Free Skating, Figure Skating and more.', 'W', 1338, 0, 2.95, 'http://images.igdb.com/igdb/image/upload/t_cover_big/z75gbgwozv0nncp6xmjk.jpg'),
(11, 'Wizardry: Knight of Diamonds - The Second Scenario', '31st December, 1982', 'Are you ready to take the next step into the world of Wizardry? A step so dangerous, the mere utterance of a spell can decimate the entire city of Llylgamyn. Knight of Diamonds is the Second Scenario in the Wizardry Master Series, the fantasy role-playing simulation for the Nintendo Entertainment System. In Wizardr Knight of Diamonds, only the bravest may venture through murky dungeons more dangerous than any ever encountered by earthly mortals. Only the most cunning may recover the magical Staff of Gailda and save the city of Llylgamyn.', 'W', 1339, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/waa1eqqxlgxpyo7fgubn.jpg'),
(11, 'Wizardry: Proving Grounds of the Mad Overlord', '1st September, 1981', 'The Mad Overlord Trebor was once only power-mad, but went off the deep end after he acquired a magical amulet of immense power, only to have it stolen from him by his nemesis, the evil archmage Werdna. Werdna, not quite sure how to use the amulet properly, accidentally causes an earthquake which creates a ten-level dungeon beneath Trebor\'s castle. To avoid looking silly, Werdna declares the dungeon to be the new lair for him and his monster hordes. Trebor, not to be outdone, declares the labyrinth his new Proving Grounds where adventurers must prove themselves for membership in his elite honor guard, and incidentally retrieve his amulet in the process. \n \nThe first Wizardry was one of the original dungeon-crawling role-playing games, and stands along with Ultima and Might &amp; Magic as one of the defining staples of the genre. \n \nThe player generates and control a party of up to six different adventurers, choosing from four races (humans, elves, dwarves, gnomes and hobbits), three alignments (good, neutral and evil), and four basic classes (fighter, priest, mage and thief). These can later evolve into elite classes (bishop: priest with mage spells; samurai: fighter with mage spells; lord: fighter with priest spells, and ninja: fighter with thief abilities) if they meet the necessary level requirements. After outfitting the party with basic weapons and armor, the player sends it into a 3D vector maze-like dungeon to fight monsters in turn-based combat and find treasure.', 'W', 1340, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/lmjropyezmwji2jnpkb8.jpg'),
(11, 'Wolverine', '1st October, 1991', 'Wolverine is an action video game. It is a licensed game based on the Marvel Comics superhero of the same name, as well as the X-Men.', 'W', 1341, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hej68xucycu6ont6lvs0.jpg'),
(11, 'Woody Poko', '20th July, 1987', 'The player controls an old wooden figure named &quot;This Baggage.&quot; \n \nHe is a hero who has lived in harmony with humans for many years. For This Baggage, the journey is to find the fairy who teaches people to get back to being friendly with wooden dolls. Enemies encountered through the game are strange creatures and bothersome old men. The player attacks by using his fists at them. Players can steal the items in the store. But after stealing, the player\'s appearance is changed to resemble that of a thief. Hotels and pawn shops can no longer admit the player for the remainder of the game after a theft has taken place.', 'W', 1342, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/emjwq4zvjhih0ants3ya.jpg'),
(11, 'World Boxing', '7th October, 1990', 'World Boxing is a Sports game, developed by Natsume and published by TSS, which was released in Japan in 1990.', 'W', 1343, 0, 2.5, ''),
(11, 'Super Mario Bros. / Duck Hunt / World Class Track Meet', '31st December, 1990', 'A three-in-one cartridge containing the original Super Mario Bros., Duck Hunt, and World Class Track Meet.', 'S', 1344, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/i4jhyvpguylos0ipnd36.jpg'),
(11, 'World Games', '31st December, 1986', 'World Games is an Olympics-style sports game with arcade-oriented gameplay. The events players can compete in include: â€¢Barrel jumping \n â€¢Bull riding \n â€¢Caber toss \n â€¢Cliff diving \n â€¢Log rolling \n â€¢Platform diving \n â€¢Pole vault \n â€¢Skiing \n â€¢Sumo wrestling \n â€¢Weightlifting', 'W', 1345, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/qbvx2gf4dfm2hxmll0jd.jpg'),
(11, 'Wrecking Crew', '18th June, 1985', 'This amazing Nintendo Programmable game lets you design your own building, place obstacles wherever you want them, and then blow everything to smithereens! You can play the game as designed by Nintendo, or you can be the game designer and build a different maze of barriers to tear down every time. You\'ll have hours of fun demolishing monsters like Gotchawrench and Eggplant Man, and blowing up a building you built yourself, in this off-the-wall demolition game!', 'W', 1346, 0, 3.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/o5wbchpngk300qgkhooo.jpg'),
(11, 'Wurm: Journey to the Center of the Earth', '1st February, 1991', 'Wurm: Journey to the Center of the Earth is a game featuring multiple sequences. The player controls the VZR vehicle, and occasionally Captain Moby when she ventures out on foot in vertically and horizontally scrolling sequences as well as a first person battle against enemy monsters. Players progress through 5 levels, in which the VZR-5 investigates the fate of the other VZRs. After the completion of each level, the player gains a crystal, which will unlock additional weapons for the VZR, mentioned below.', 'W', 1347, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/r7fe9lmfjtk9bkpyljaj.jpg'),
(11, 'WWF King of the Ring', '1st December, 1993', 'It\'s the event that everyone is talking about --- The King of the Ring? --- and now it\'s time to prove you\'re the best! It\'s a brutal, no time out elimination tournament for the wrestling crown! \n \nÂ» All-New King of the Ring Tournament? \nÂ» 10 of the hottest superstars \nÂ» Create your own wrestler with customizes strength, speed, and more \nÂ» Grueling One-on-One and tag team bouts \n \nIf you\'ve got the guts...take the challenge. \n \nIf you\'ve got the skill...TAKE THE CROWN!!', 'W', 1348, 0, 3.15, 'http://images.igdb.com/igdb/image/upload/t_cover_big/fujvgoqamiskkzafuhfb.jpg'),
(11, 'WWF Wrestlemania', '31st December, 1988', 'First WWF game to be published on 8-bit and 16-bit gaming platforms', 'W', 1349, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/pewk73cit7evbkhbnc6u.jpg'),
(11, 'WWF WrestleMania Challenge', '1st February, 1990', 'Get ready for the greatest in powerhouse action --- both in and out of the ring. Go head-to-head with either of the biggest WWF Superstars. \n \nCan you survive the Atomic Drop, Warrior Wallop, the Hulkster Splash, the Sleeperhold and the Rude Awakening? Fight back with some classic moves of your own --- like Flying Turnbuckle Leaps, Headbutts, Elbow Smashes and more! \n \nChoose Between: \nÂ» Singles and tag team matches (even double-teaming!) \n \nÂ» Incredible 3-on-3 Survivor SeriesÂ® mode \n \nÂ»1 and 2 player head-to-head and team-play action \n \nYou can even enter the ring as &quot;yourself&quot; and prove to the world that there\'s only one true WWF Champion --- you!', 'W', 1350, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/sr29vmdrr9syomxv5db9.jpg'),
(11, 'WWF Wrestlemania: Steel Cage Challenge', '31st December, 1992', 'WWF Wrestlemania: Steel Cage Challenge is a Sports game, developed by Teeny Weeny Games and published by Flying Edge, which was released in 1993.', 'W', 1351, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/jr4iyyxlfi4a5zadbcni.jpg'),
(11, 'Xenophobe', '31st December, 1987', 'Xenophobe is a 1987 arcade game developed and published by Bally Midway.[1] Starbases, moons, ships, and space cities are infested with aliens, and the players have to kill the aliens before each is completely overrun. Xenophobe can be played by up to three players, and the goal of each level is to defeat all the aliens before time runs out. Some rooms routinely display the percentage of alien infection and time remaining until self-destruct when the level ends (but a nearby button can temporarily deactivate the count-down). Levels may contain more than one floor, and players use elevators (and sometimes holes in the floor) to move between floors to defeat all of the aliens. Players can also pick up more powerful weapons and other items to help in their eradication of the aliens.', 'X', 1352, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/d2dx34tdbp30eavkmpdn.jpg'),
(11, 'Xevious', '31st December, 1982', 'It\'s a nightmare, but it\'s true! Research shows that we are the actual aliens on Earth, and the ruthless Xevions are the original inhabitants. \n \nNow the Xevions want Earth back -- minus humans! Their invasion forces are fierce -- the land is crawling with deadly Domogram Rovers; the sky is black with Toroid Patrol Fleets and Zoshi Death Squads. \n \nOur puny weapons offer no defense. Earth\'s only hope is our powerful new Solvalou Fighter Plane. Its pilot will have a single mission: Penetrate the enemy ranks and destroy the Xevious Mother Ship. \n \nThe mission is dangerous. We can\'t guarantee success. But at this point, it\'s do or die! \n \nOne small problem. We still need a pilot. Any volunteers?', 'X', 1353, 0, 3.05, 'http://images.igdb.com/igdb/image/upload/t_cover_big/aqc14gpqnxyfcpqsq91s.jpg'),
(11, 'Xevious: The Avenger', '30th September, 1988', 'The player uses an 8-way joystick to pilot a combat aircraft called a Solvalou, which is armed with a forward-firing Zapper for aerial targets and a Blaster which fires an unlimited supply of air-to-surface bombs for ground targets. The game, presumably set in Peru, was noted for the varied terrain below, which included forests, airstrips, bases, and mysterious Nazca Line-like drawings on the ground', 'X', 1354, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/uaxoiyu7cmnxf2aamplz.jpg'),
(11, 'Yie Ar Kung-Fu', '22nd April, 1985', 'Yie Ar Kung-Fu is a 1985 fighting game developed and published by Konami. Along with 1984\'s Karate Champ, which influenced Yie-Ar Kung Fu, it is one of the games that established the basis for modern fighting games.', 'Y', 1355, 0, 3.35, 'http://images.igdb.com/igdb/image/upload/t_cover_big/kkhrk344fkxvohjlh70d.jpg'),
(11, 'Yoshi', '14th December, 1991', 'A quick-shuffle action puzzle game starring Yoshi!', 'Y', 1356, 0, 2.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1rhv.jpg'),
(11, 'Yoshi\'s Cookie', '21st November, 1992', 'Yoshi\'s Cookie is a tile-matching video game in which the player is given a playing field populated with cookies of five various types, arranged in a rectangular grid. The main objective of each level is to clear the playing field of all the cookies.', 'Y', 1357, 0, 3.9, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1rey.jpg'),
(11, 'Youkai Club', '19th June, 1987', 'Youkai Club is an Action game, developed by TOSE and published by Jaleco Entertainment, which was released in Japan in 1987.', 'Y', 1358, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/tnrrqcp9xpfac154gahq.jpg'),
(11, 'Youkai Douchuuki', '1st April, 1987', 'The player controls a boy named Tarosuke, who travels through &quot;Jigoku&quot; (the Japanese concept of Hell) fighting off &quot;yokai&quot; (mythical Japanese monsters) on his way to his final fate, as determined by Buddha. He destroys his enemies by firing small Ki bullets, which can be charged to increase their power; however, if overcharged, he is left unable to move or fight for a few seconds. During boss battles, Tarosuke kneels at a shrine to Buddha and prays, summoning &quot;Monmotaro&quot; (not to be confused with &quot;MomotarÅ&quot;), a spirit which floats in the air and drops energy balls on the boss and any lackeys he has. Once the boss is defeated, Tarosuke goes to the next stage.', 'Y', 1359, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ykgsggfqcs3gh6lwc0n1.jpg'),
(11, 'Young Indiana Jones Chronicles', '15th January, 1993', 'Here is your chance to become Young Indiana Jones, as you set out to single-handedly save the world from the Kaiser\'s war machine. In this World War I epic, you\'ll battle through 19 stages of globe-spanning action, from the deserts of Mexico to the trenches on the Western front to the heart of the German headquarters. You\'ll take on Pancho Villa and Big Bertha, battle tanks and tri-planes and team up with Canadian flying ace Billy Bishop in a dogfight against the Red Baron.', 'Y', 1360, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/e2pk0nqxbfyurfazcdvf.jpg'),
(11, 'Ys: The Vanished Omens', '26th June, 1987', 'The hero of Ys is an adventurous young swordsman named Adol Christin. As the story begins, he has just arrived at the Town of Minea, in the land of Esteria. He is called upon by Sara, a fortuneteller, who tells him of a great evil that is sweeping the land. \n \nAdol is informed that he must seek out the six Books of Ys. These books contain the history of the ancient land of Ys, and will give him the knowledge he needs to defeat the evil forces. Sara gives Adol a crystal for identification and instructs him to find her aunt in Zepik Village, who holds the key to retrieving one of the Books. With that, his quest begins.', 'Y', 1361, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/hh9g1icna6balurtcuuo.jpg'),
(11, 'Ys II: Ancient Ys Vanished â€“ The Final Chapter', '1st April, 1988', 'A bright light shot up from Darm Tower in the end of the first Ys, and Adol Christin is awakened by a young girl who finds him lying on the ground. She introduces herself as Lilia and tells Adol he is in the land of Ys. Finally he was able to establish a connection between his world and this mysterious land! But finding the gateway to Ys is not enough: Adol must stop an evil entity that his archenemy Dark Fact served. And his foes already know where he is. \n \nYs II: Ancient Ys Vanished - The Final Chapter is a direct sequel to Ys: The Vanished Omens. The game continues to utilize the action role-playing combat style of the first installment, which requires the player to make the protagonist run into the enemy in order to cause damage, without the need to press an attack button. The player should choose the angles and the measure of contact with the enemy carefully, otherwise the hero will be killed. The player character can (and should) level up, perform quests for village people, gather money, and upgrade weapons and inventory, like in most other RPGs. \n \nThe sequel offers a longer quest than the first installment, and adds a magic arsenal to Adol\'s abilities. Among the magic spells is a fire attack, a time-stopping spell, and a transformation ability that allows Adol to pass for a monster and converse with enemies. Magic spells deplete Adol\'s magic points bar.', 'Y', 1362, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/rgay69vtuabjikx7fk2m.jpg'),
(11, 'Ys III: Wanderers from Ys', '1st July, 1989', 'Adol Christin\'s long-time friend, Dogi, wishes to return to his home town of Redmont after hearing about strange disturbances that are happening there. Always looking for an adventure, Adol joins him and soon finds out the cause of this new evil. \n \nYs III: Wanderers from Ys breaks away from the &quot;bumping into enemies&quot; battle system of the first two games, allowing Adol to control his sword in a variety of directions. Beside changing the battle system, the game\'s perspective switches to a side-scrolling view, as opposed to the top-down one of the previous games. Adol also has the ability to jump now. New to the series is the use of magical rings, which give Adol different powering-up abilities such as healing and shielding. The game also uses various key items found along the way to solve minor puzzles and progress the story.', 'Y', 1363, 0, 4, 'http://images.igdb.com/igdb/image/upload/t_cover_big/oxfvvrwdqhon6c1q9xa2.jpg'),
(11, 'Yume Penguin Monogatari', '25th February, 1991', 'Penta, a cute blue penguin, has a tragic flaw - he really enjoys eating. As a result, his girlfriend Penko left him for another fashionable penguin called Ginji because, she thinks, he has become too chubby for her liking. And yet, she decides to give him a second chance - if he manages to lose all this weight and keep it off, then she will give all her love and attention to him. But the covetous Ginji doesn\'t share the same sentiments and will do everything in his power to stop the poor flightless seabird before he slims down.', 'Y', 1364, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/bgw9sujh8cf5emzenkig.jpg'),
(11, 'ZANAC', '28th November, 1986', 'The &quot;system&quot; was created by an organic intelligence body many milleniums ago and began attacking the human race. The earth was thrown into turmoil with only one hope for salvation. Fighter model AFX-6502 ZANAC was perfected by the 256th Riot Fleet to ward off the enemy system. It\'s your job, as ZANAC, to save the human race. Using eight special weapons and secret power forces buried along the way, guide ZANAC through 12 screens of enemy creatures to victory.', 'Z', 1365, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1r5x.jpg'),
(11, 'Zelda II: The Adventure of Link', '14th January, 1987', 'The land of Hyrule is in chaos. As Link, youâ€™ll be sent on a treacherous journey to return six precious Crystals to their origins in six stone statues. Only by defeating the guardians of the six palaces will you gain passage to the seventh palace, take on the ultimate challenge that awaits you, and wake the Princess Zelda from her sleeping spell. On your way, helpful villagers you encounter will offer clues and secret messages invaluable in your quest. As you guide Link through the levels of Hyrule, close-ups and overviews will enhance your video vision. Are you up to the challenge?', 'Z', 1366, 0, 3.55, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1uje.jpg'),
(11, 'Zen: Intergalactic Ninja', '1st March, 1993', 'IF YOU LIKE FIGHTING DIRTY, YOU\'RE GONNA DIG ZEN! \n \nThe greatest environmental disaster in human history is about to hit your backyard. But you\'re not backing down, because you\'re Zen, a cold-blooded Ninja warrior who\'s come to Earth to clean the clock of Lord Contaminous and his crud-loving cronies. \n \nBut wasting these slimeballs won\'t be easy. Because they\'ll spew forth the most hazardous graphics ever to wreak havoc on your NES. We\'re talking horizontal, vertical and 3/4 view scrolling that will give you a whole new perspective on acid rain, oil spills and ozone-ravaging smog. And wait till you see the fluid character movements. They\'re hotter than a uranium-oozing nuclear meltdown! \n \nThere are 12 total levels, each with its own ecological enemies, toxic traps and pollution-fighting objectives. You\'ll battle oil rig fires, trying to save trapped workers. Use your Photon-Stick to zap gaseous garbage men on a high-speed plutonium mining car ride. Vertical jump through two separate screens to reach a venomous vixen who\'s single-handedly scorching the rainforests. And spin kick Smogger, a smoked-out scum of the Earth. \n \nFinally, try to survive a rescue mission stage. Rack up points in the bonus recycling level. And slash through 6 subgames that will lead you to the feet of Lord Contaminous, who you must dispose of before he trashes every living thing on the face of the Earth. \n \nFor 1 Ninja Master.', 'Z', 1367, 0, 3.8, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1r5v.jpg'),
(11, 'Zoda\'s Revenge: StarTropics II', '1st March, 1994', 'Stop Zoda\'s revenge and break the code! \n \nIntrepid adventurer Mike Jones, just back from the South Pacific, is off on a new journey through time and space. Mikes mission: to save seven mystic Tetrads while he faces the avengers of his foiled foe, the evil Zoda! Now three alien clones are hot on his trail through time! \n \nUnfold nine new chapters of adventures to decipher codes, solve mysteries and battle dragons with heroes of days gone by. Mike won\'t stop until the Tetrads are found and the Zodas are history! \n \n+Wind your way through more than a dozen action-packed stages in eight settings! \n+Save your progress and continue your time travels with the battery-backed memory! \n+Now with 8-directional diagonal movement!', 'Z', 1368, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/co1r5u.jpg'),
(11, 'Zoids: Mokushiroku', '21st January, 1991', 'Zoids: Mokushiroku is a Strategy game, published by Tomy Corporation, which was released in Japan in 1990.', 'Z', 1369, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/xmrkliphjnhtjkfgv93g.jpg'),
(11, 'Zombie Hunter', '3rd August, 1987', 'The city of Palma had been protected by the four spirits who govern fire, water, wind, and earth, continuing a long era of peace. \n \nOne day, Dolgo, the spirit of earth, started a revolt. He made off with the Life Seeker and disappeared into his underground labyrinth. \n \nThe Life Seeker does the essential work of controlling this world\'s Energy. Dolgo acquired the ability to freely use that Energy. \n \nMeanwhile, the people of Palma began to lose their souls, and the city was filled with sadness and pain. \n \nAriel, the spirit of wind, commanded her subordinate, Byuzu to seek out a hero who could defeat Dolgo and regain the Life Seeker. \n \nYou are the warrior chosen by Byuzu. To defeat Dolgo, you set off on a journey into the underground labyrinthâ€¦', 'Z', 1370, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/yb9ypom7ybltwpb8cor9.jpg'),
(11, 'Zunou Senkan Galg', '14th January, 1986', 'Zunou Senkan Galg (&quot;Brain Battleship Galg&quot;), referred to as just Galg by the game\'s title screen, is a vertical-scrolling shoot-em-up in which the player must navigate a serious of canyon-like environments for missing pieces to a war machine. Each stage has at least one piece, so the player must visit them all in order to find the necessary number. In addition to this, there are numerous secrets hidden throughout the many stages of the game, and the player frequently has to choose between multiple paths which lead to different stages. The game advertises itself as a &quot;RPG&quot; on its box art, referring to this additional layer of complexity. \n \nLike The Tower of Druaga, it is considered a historically important game in Japan for the amount of secrets and mysteries it contains and the subsequent difficulty involved in reaching the end without this hidden knowledge. Therefore, it was one of the earliest games for the Famicom to feature its own printed game guide for players to follow. Zunou Senkan Galg is almost entirely unheard of outside of Japan, however, and has never seen a release outside of its native country. \n \nThough it was published by dB-Soft, the game was developed by a group named &quot;Team Bioteckers&quot;. Galg is their only known video game credit.', 'Z', 1371, 0, 2.5, 'http://images.igdb.com/igdb/image/upload/t_cover_big/ujmhbvqvztx5mmgrd9mf.jpg'),
(30, 'TimeSplitters 2', '9th October, 2002', 'TimeSplitters 2 is a first-person shooter that requires players to kill enemies and complete objectives using a variety of weapons and tactics in different predefined scenarios. Armour and health bars on the sides of the screen lower when the player is shot, which can be increased by walking over body armor and medical kits.', 'T', 1372, 0, 4.4, 'https://www.lukiegames.com/assets/images/XBOX/xbox_time_splitters_2-110214.jpg'),
(7, 'DOOM: Eternal', '20th March, 2020', 'Hell’s armies have invaded Earth. Become the Slayer in an epic single-player campaign to conquer demons across dimensions and stop the final destruction of humanity.\r\nThe Only Thing they Fear... Is You.\r\nExperience the ultimate combination of speed and power in DOOM Eternal - the next leap in push-forward, first-person combat.\r\nSlayer Threat Level At Maximum\r\nArmed with a shoulder-mounted flamethrower, retractable wrist-mounted blade, upgraded guns and mods, and abilities, you\'re faster, stronger, and more versatile than ever.\r\nUnholy Trinity\r\nTake what you need from your enemies: Glory kill for extra health, incinerate for armor, and chainsaw demons to stock up on ammo to become the ultimate demon-slayer.', 'D', 1373, 0, 4.25, 'https://upload.wikimedia.org/wikipedia/en/thumb/9/9d/Cover_Art_of_Doom_Eternal.png/220px-Cover_Art_of_Doom_Eternal.png'),
(7, 'Disney\'s 102 Dalmatians: Puppies to the Rescue', 'November, 2000', 'Disney\'s 102 Dalmatians: Puppies to the Rescue is a platform video game developed by Toys for Bob and published by Eidos Interactive for Microsoft Windows, PlayStation, Dreamcast and Game Boy Color. It is loosely based on the live-action Disney movie 102 Dalmatians.', 'D', 1374, 0, 4.6, 'https://oldisgoldgames.com/wp-content/uploads/2018/01/102-Dalmatians-Puppies-to-the-Rescue-Free-Download-768x576.jpg');
