(17, 50, 0, 'Manhunt is a stealth-based survival horror video game developed by Rockstar North and published by Rockstar Games. It was originally released for the PlayStation 2 on November 18, 2003, and for Microsoft Windows and Xbox on April 20, 2004.\r\nManhunt is a stealth-based psychological horror game played from a third-person perspective. The game consists of twenty levels, called &quot;scenes&quot;, as well as four unlockable bonus scenes. Players survive the scenes by dispatching enemy gang members, occasionally with firearms, but primarily by stealthily executing them.\r\n\r\nIMPORTANT:\r\n!!!JUST TO BE CERTAIN THIS IS THE PC EDITION. YOU WILL NEED 2 THINGS TO RUN IT. MANHUNT PATCHER WHICH IS IN THE TORRENT FILE AND A FRAME LIMITER. SET THE LIMITER TO 60 FPS FOR MANHUNT.EXE!!!\r\n\r\nThis Is A TPB Mirror From GWpirateGW ', 'Manhunt', 'magnet:?xt=urn:btih:d6a2b84eb0b979fba61c96d65f2fa1f77b9c5933&amp;dn=Manhunt&amp;tr=udp%3A%2F%2Ftracker.leechers-paradise.org%3A6969&amp;tr=udp%3A%2F%2Fzer0day.ch%3A1337&amp;tr=udp%3A%2F%2Fopen.demonii.com%3A1337&amp;tr=udp%3A%2F%2Ftracker.coppersurfer.tk%3A6969&amp;tr=udp%3A%2F%2Fexodus.desync.com%3A6969', 1546174036, 21, 0, 0, NULL),
