(111, 180, 0, 'Grand Theft Auto III - PC-GAME Action-Adventure.\r\nA young criminal is betrayed by his girlfriend, Catalina, during a robbery. \r\nHe then scores a lucky jailbreak after he is arrested, with his trusted \r\npartner, 8 Ball. Both of these hoodlums are now in Liberty City, both \r\nknowing Catalina is there. But everyone in the city seems to want him dead. \r\nHe will have to rob, steal, and kill to stay out of serious trouble and \r\ntake revenge on Catalina. GTA-3 game played from a third-person view. Players \r\ncomplete missions—linear scenarios with set objectives—to progress through \r\nthe story. It is possible to have several active missions running at one time, \r\nas some missions require players to wait for further instructions or events. \r\nOutside of missions, players can freely roam the game\'s open world, and have \r\nthe ability to complete option side missions. Liberty City is composed of \r\nthree boroughs: Portland, Staunton Island, and Shoreside Vale; the islands \r\nare unlocked to players as the story progresses.\r\n\r\nInfo.\r\n=&gt;-Developer......................: DMA Design.\r\n=&gt;-Publisher......................: Rockstar Games.\r\n=&gt;-Platform.......................: Microsoft Windows.\r\n=&gt;-Release date...................: 24 May 2002.\r\n=&gt;-Genre..........................: Action-adventure Open World.\r\n=&gt;-Mode...........................: Single player.\r\n=&gt;-Media..........................: 2 X CD.\r\n\r\nSystem Specifications.\r\nMinimum system requirements :.....: Recommended system requirements.\r\nCPU 450 MHz :.....................: CPU 700 MHz CPU.\r\nMemory 96 MB RAM :................: Memory 128 MB RAM.\r\nGPU 16 MB DX3D Graphics :.........: GPU 32 MB DX3D Graphics.\r\nDirect X 8.1 :....................: Direct X 8.1\r\nOS Win98/ME/2K/XP/wIN7/WIN10 :....: OS Win98/ME/2K/XP/wIN7/WIN10.\r\nHDD Space 500MB :.................: HDD Space 1.20GB.\r\nSound DX 8.1 sound card :.........: Sound DX 8.1 With Surround Sound.\r\n\r\nMedia Files.\r\n=&gt;-GTA3_AUDIO.iso.\r\n=&gt;-GTA3_INSTALL.iso.\r\n\r\nQuick Install Instructions.\r\n=&gt;-Mount or insert GTA3_INSTALL.\r\n=&gt;-Install Game.\r\n=&gt;-Apply gta3patch.\r\n=&gt;-Replace Games gta3.exe with one provided.\r\n=&gt;-Mount or insert GTA3_AUDIO.\r\n=&gt;-Copy audio folder from imagedisk to games directory.\r\n\r\nFull Install Instructions Read INFO', 'Grand Theft Auto III By eyezin', 'magnet:?xt=urn:btih:8276946399158dfa833025a55aea77e89e2d388c&amp;dn=Grand+Theft+Auto+III+-+GTA+3+Action+Adventure+2002+PC-Game&amp;tr=udp%3A%2F%2Ftracker.leechers-paradise.org%3A6969&amp;tr=udp%3A%2F%2Ftracker.openbittorrent.com%3A80&amp;tr=udp%3A%2F%2Fopen.demonii.com%3A1337&amp;tr=udp%3A%2F%2Ftracker.coppersurfer.tk%3A6969&amp;tr=udp%3A%2F%2Fexodus.desync.com%3A6969', 1557761188, 21, 0, 0, NULL),
(112, 177, 0, '======================================================================\r\n\r\n                       GTA: London 1969 + 1961\r\n\r\n======================================================================\r\n\r\nThis package contains both GTA: London 1969 and GTA: London 1961. The\r\n  base London 1969 version has been taken from the popular freeloader\r\n  version, and modified with a normal no-CD from GameCopyWorld. 1961,\r\n  however, has been cracked with a custom no-CD by me, found by diff-\r\n  ing the 1969 original EXE to the 1969 cracked EXE, and applying the\r\n  hex changes to the 1961 version. You won\'t find a cracked 1961 any-\r\n  where else ;-)\r\n\r\n-- Information\r\n\r\nJust run the version you like from the GTAWIN directory, both will do\r\n  what you expect. The DOS version is not included, as nobody uses \r\n  DOS anymore. The system requirements are the same as the Classics\r\n  version of GTA1, with probably the same incompatiblities. Note that\r\n  this one does work on Vista. :)', 'Grand Theft Auto: London 1969 + London 1961', 'magnet:?xt=urn:btih:302f8db984e70b27c201622e9fbf08bdbff3bc7b&amp;dn=Grand+Theft+Auto+London+1969+%2B+1961+%28Unique%21%29&amp;tr=udp%3A%2F%2Ftracker.leechers-paradise.org%3A6969&amp;tr=udp%3A%2F%2Ftracker.openbittorrent.com%3A80&amp;tr=udp%3A%2F%2Fopen.demonii.com%3A1337&amp;tr=udp%3A%2F%2Ftracker.coppersurfer.tk%3A6969&amp;tr=udp%3A%2F%2Fexodus.desync.com%3A6969', 1557761308, 21, 0, 0, NULL),
