(114, 176, 0, '(Google Translate Of Posters Description)   Poster - LipeWarriorCorintiano\r\n\r\nHalf-Life 2 is a first-person shooter with sci-fi theme. The title, which follows the events of Half-Life, took five years to develop; the result was quite positive, thanks to the much acclaimed Source engine, which brought new graphics and physics to the game.\r\n\r\nThe game takes place in city 17 in a brief future, where Dr. Gordon Freeman, the protagonist, is agreed. He finds himself in a repressed environment, and must fight to survive, joining those who share the ideal of changing that reality.\r\n\r\nThe basic formula of Half-Life 2 is the same as its predecessor: the player crosses several locations solving puzzles and facing enemies ranging from soldiers to hideous aliens. The big difference is due to the graphics and physical, which gave rise to new types of puzzles.\r\n\r\nA great novelty in the game is the gravity weapon, which can be used to move objects from a distance and shoot them basically, but its use goes far beyond. The player can move objects in their favor to get cover or create structures to climb and reach higher places, for example - your creativity is the limit.\r\n\r\n\r\nGenre: First Person Shooting\r\nYear: 2004\r\nGame size: 1.57 GB\r\n\r\nMinimum requirements\r\n\r\nProcessor: Pentium IV 1.2 GHz or Athlon equivalent\r\nProcessor Speed: 1.2 GHz\r\nMemory RAM: 256 MB\r\nVideo Memory: 32 MB\r\nDirect3D: Yes\r\nDirectX Version: 7.0\r\nOperating Systems: Windows 98, Windows 2000, Windows ME, Windows XP', 'Half Life 2', 'magnet:?xt=urn:btih:e6168462b884d02d2d1fcdfc3079f835903c839d&amp;dn=Half-Life+2+%28Install+and+Play%29+-+By+Lipe+WC&amp;tr=udp%3A%2F%2Ftracker.leechers-paradise.org%3A6969&amp;tr=udp%3A%2F%2Ftracker.openbittorrent.com%3A80&amp;tr=udp%3A%2F%2Fopen.demonii.com%3A1337&amp;tr=udp%3A%2F%2Ftracker.coppersurfer.tk%3A6969&amp;tr=udp%3A%2F%2Fexodus.desync.com%3A6969', 1557761901, 21, 0, 0, NULL),
