(2089, 192, 0, 'Silent Hill 2 is a survival horror video game published by Konami for the PlayStation 2 and developed by Team Silent, part of Konami Computer Entertainment Tokyo. The second installment in the Silent Hill series, Silent Hill 2 centers on James Sunderland, a widower who journeys to the town after receiving a letter from his dead wife informing him that she is waiting there for him. It was published in September 2001, and an extended version containing an extra bonus scenario, Born from a Wish, and other additions was published for Xbox in December of the same year. In 2002, it was ported to Windows. A remastered high-definition version was released for the PlayStation 3 and the Xbox 360 in 2012 as part of the Silent Hill HD Collection.', 'Silent Hill 2 (Original Edition)', 'magnet:?xt=urn:btih:0e197be29bea0e7207e257db9cdb30684325c23e&amp;dn=Silent%20Hill%202%20(USA)%20(En%2cJa).iso&amp;tr=udp%3a%2f%2ftracker.opentrackr.org%3a1337%2fannounce&amp;tr=udp%3a%2f%2ftracker.bittor.pw%3a1337%2fannounce&amp;tr=udp%3a%2f%2ftracker.swateam.org.uk%3a2710%2fannounce&amp;tr=udp%3a%2f%2fbt.xxx-tracker.com%3a2710%2fannounce&amp;tr=udp%3a%2f%2ftracker.flashtorrents.org%3a6969%2fannounce&amp;tr=udp%3a%2f%2ftracker.coppersurfer.tk%3a6969%2fannounce&amp;tr=udp%3a%2f%2ftracker.vanitycore.co%3a6969%2fannounce&amp;tr=http%3a%2f%2ftracker.baravik.org%3a6970%2fannounce&amp;tr=udp%3a%2f%2ftracker.internetwarriors.net%3a1337%2fannounce&amp;tr=udp%3a%2f%2fmgtracker.org%3a2710%2fannounce&amp;tr=udp%3a%2f%2ftracker.sktorrent.net%3a6969%2fannounce&amp;tr=udp%3a%2f%2ftracker.ex.ua%3a80%2fannounce&amp;tr=udp%3a%2f%2ftracker.grepler.com%3a6969%2fannounce&amp;tr=https%3a%2f%2ftracker.bt-hash.com%3a443%2fannounce&amp;tr=udp%3a%2f%2ftracker.justseed.it%3a1337%2fannounce&amp;tr=http%3a%2f%2fretracker.gorcomnet.ru%2fannounce&amp;tr=http%3a%2f%2ftracker2.itzmx.com%3a6961%2fannounce&amp;tr=udp%3a%2f%2fzephir.monocul.us%3a6969%2fannounce&amp;tr=http%3a%2f%2ftracker.calculate.ru%3a6969%2fannou